INSERT INTO `Article` VALUES (1,1,29720948,'1664-042X','The Oxygen Consumption and Metabolic Cost of Walking and Running in Adults With Achondroplasia.','The disproportionate body mass and leg length of Achondroplasic individuals may affect their net oxygen consumption ([Formula: see text]O) and metabolic cost (C) when walking at running compared to those of average stature (controls). The aim of this study was to measure submaximal [Formula: see text]O and C during a range of set walking speeds (SWS; 0.56 - 1.94 m⋅s, increment 0.28 m⋅s), set running speeds (SRS; 1.67 - 3.33 m⋅s, increment 0.28 m⋅s) and a self-selected walking speed (SSW). [Formula: see text]O and C was scaled to total body mass (TBM) and fat free mass (FFM) while gait speed was scaled to leg length using Froude\'s number (Fr). Achondroplasic [Formula: see text]O and [Formula: see text]O were on average 29 and 35% greater during SWS ( < 0.05) and 12 and 18% higher during SRS ( < 0.05) than controls, respectively. Achondroplasic C and C were 29 and 33% greater during SWS ( < 0.05) and 12 and 18% greater during SRS ( < 0.05) than controls, respectively. There was no difference in SSW [Formula: see text]O or [Formula: see text]O between groups ( > 0.05), but C and C at SSW were 23 and 29% higher ( < 0.05) in the Achondroplasic group compared to controls, respectively. [Formula: see text]O and [Formula: see text]O correlated with Fr for both groups ( = 0.984 - 0.999,  < 0.05). Leg length accounted for the majority of the higher [Formula: see text]O and [Formula: see text]O in the Achondroplasic group, but further work is required to explain the higher Achondroplasic C and C at all speeds compared to controls.  There is a leftward shift of oxygen consumption scaled to total body mass and fat free mass in Achondroplasic adults when walking and running. This is nullified when talking into account leg length. However, despite these scalars, Achondroplasic individuals have a higher walking and metabolic cost compared to age matched non-Achondroplasic individuals, suggesting biomechanical differences between the groups.','2018-05-17 00:00:00','2018-04-18 00:00:00','2018-05-07 00:00:00',0,0,'Sims, David T, DT|Onambélé-Pearson, Gladys L, GL|Burden, Adrian, A|Payton, Carl, C|Morse, Christopher I, CI','2018-05-17 22:46:19','2018-05-17 22:46:19'),(2,1,29681095,'1552-4833','Further delineation of achondroplasia-hypochondroplasia complex with long-term survival.','Achondroplasia-hypochondroplasia (ACH-HCH) complex is caused by the presence of two different pathogenic variants in each allele of FGFR3 gene. Only four patients with confirmed molecular diagnoses have been reported to date, and the phenotype has not been fully defined. Here, we describe a Mexican patient with a confirmed molecular diagnosis of ACH-HCH complex. This patient exhibits intellectual disability, has a history of seizures, experienced multiple cardiorespiratory complications during early childhood, and required foramen magnum decompression. However, he now shows a stable health condition with long-term survival (current age, 18 years). This case is particularly relevant to our understanding of ACH-HCH complex and for the genetic counseling of couples who are affected with ACH or HCH.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-04-22 00:00:00',0,0,'González-Del Angel, Ariadna, A|Rius, Rocío, R|Alcántara-Ortigoza, Miguel A, MA|Spector, Elaine, E|Del Castillo, Victoria, V|Mata-García, Luis Enrique, LE','2018-05-17 22:46:19','2018-05-17 22:46:19'),(3,1,29652901,'1932-6203','Early postnatal soluble FGFR3 therapy prevents the atypical development of obesity in achondroplasia.','Achondroplasia is a rare genetic disease is characterized by abnormal bone development and early obesity. While the bone aspect of the disease has been thoroughly studied, early obesity affecting approximately 50% of them during childhood has been somewhat neglected. It nevertheless represents a major health problem in these patients, and is associated to life-threatening complications including increasing risk of cardiovascular pathologies. We have thus decided to study obesity in patients and to use the mouse model to evaluate if soluble FGFR3 therapy, an innovative treatment approach for achondroplasia, could also impact the development of this significant complication.To achieve this, we have first fully characterized the metabolic deregulations in these patients by conducting a longitudinal retrospective study, in children with achondroplasia Anthropometric, densitometric measures as well as several blood parameters were recorded and compared between three age groups ranging from [0-3], [4-8] and [9-18] years old. Our results show unexpected results with the development of an atypical obesity with preferential fat deposition in the abdomen that is remarkably not associated with classical complications of obesity such as diabetes or hypercholosterolemia. Because it is not associated with diabetes, the atypical obesity has not been studied in the past even though it is recognized as a real problem in these patients. These results were validated in a murine model of achondroplasia (Fgfr3ach/+) where similar visceral adiposity was observed. Unexpected alterations in glucose metabolism were highlighted during high-fat diet. Glucose, insulin or lipid levels remained low, without the development of diabetes. Very interestingly, in achondroplasia mice treated with soluble FGFR3 during the growth period (from D3 to D22), the development of these metabolic deregulations was prevented in adult animals (between 4 and 14 weeks of age). The lean-over-fat tissues ratio was restored and glucose metabolism showed normal levels. Treating Fgfr3ach/+ mice with soluble FGFR3 during the growth period, prevented the development of these metabolic deregulations in adult animals and restored lean-over-fat tissues ratio as well as glucose metabolism in adult animals.This study demonstrate that achondroplasia patients develop an atypical obesity with preferential abdominal obesity not associated with classical complications. These results suggest that achondroplasia induces an uncommon metabolism of energy, directly linked to the FGFR3 mutation. These data strongly suggest that this common complication of achondroplasia should be included in the clinical management of patients. In this context, sFGFR3 proved to be a promising treatment for achondroplasia by normalizing the biology at different levels, not only restoring bone growth but also preventing the atypical visceral obesity and some metabolic deregulations.','2018-05-17 00:00:00','2018-04-13 00:00:00','2018-04-29 00:00:00',0,0,'Saint-Laurent, Celine, C|Garcia, Stephanie, S|Sarrazy, Vincent, V|Dumas, Karine, K|Authier, Florence, F|Sore, Sophie, S|Tran, Albert, A|Gual, Philippe, P|Gennero, Isabelle, I|Salles, Jean-Pierre, JP|Gouze, Elvire, E','2018-05-17 22:46:19','2018-05-17 22:46:19'),(4,1,29622960,'2090-911X','A case of multivessel PTCA in achondroplasia patient.','No abstract found.','2017-03-01 00:00:00','2016-03-15 00:00:00','2018-04-08 00:00:00',0,0,'Kumar, Viveka, V|Kumar, Vivek, V','2018-05-17 22:46:19','2018-05-17 22:46:19'),(5,1,29593476,'1661-8769','Novel and Recurrent Mutations in the  Gene and Double Heterozygosity Cases in a Cohort of Brazilian Patients with Skeletal Dysplasia.','Mutations in the fibroblast growth factor receptor 3 gene () cause achondroplasia (ACH), hypochondroplasia (HCH), and thanatophoric dysplasia types I and II (TDI/TDII). In this study, we performed a genetic study of 123 Brazilian patients with these phenotypes. Mutation hotspots of the  gene were PCR amplified and sequenced. All cases had recurrent mutations related to ACH, HCH, TDI or TDII, except for 2 patients. One of them had a classical TDI phenotype but a typical ACH mutation (c.1138G>A) in combination with a novel c.1130T>C mutation predicted as being pathogenic. The presence of the second c.1130T>C mutation likely explained the more severe phenotype. Another atypical patient presented with a compound phenotype that resulted from a combination of ACH and X-linked spondyloepiphyseal dysplasia tarda (OMIM 313400). Next-generation sequencing of this patient\'s DNA showed double heterozygosity for a typical de novo ACH c.1138G>A mutation and a maternally inherited  c.6del mutation. All mutations were confirmed by Sanger sequencing. A pilot study using high-resolution melting (HRM) technique was also performed to confirm several mutations identified through sequencing. We concluded that for recurrent  mutations, HRM can be used as a faster, reliable, and less expensive genotyping test than Sanger sequencing.','2018-02-01 00:00:00','2018-02-02 00:00:00','2018-04-01 00:00:00',0,0,'Gomes, Maria E S, MES|Kanazawa, Thatiane Y, TY|Riba, Fernanda R, FR|Pereira, Natálya G, NG|Zuma, Maria C C, MCC|Rabelo, Natana C, NC|Sanseverino, Maria T, MT|Horovitz, Dafne D G, DDG|Llerena, Juan C, JC|Cavalcanti, Denise P, DP|Gonzalez, Sayonara, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(6,1,29542187,'1741-4520','Multiplex PCR in noninvasive prenatal diagnosis for FGFR3-related disorders.','Thanatophoric dysplasia and achondroplasia are allelic disorders caused by a constitutively active mutation in the FGFR3 gene. Because thanatophoric dysplasia is a lethal disorder and achondroplasia is non-lethal, they need to be distinguished after ultrasound identification of fetal growth retardation with short limbs. Accordingly, we have developed a noninvasive prenatal test using cell-free fetal DNA in the maternal circulation to distinguish thanatophoric dysplasia and achondroplasia. A multiplex PCR system encompassing five mutation hotspots in the FGFR3 gene allowed us to efficiently identify the responsible mutation in cell-free DNA in all examined pregnancies with a suspected thanatophoric dysplasia or achondroplasia fetus. This system will be helpful in the differential diagnosis of thanatophoric dysplasia and achondroplasia in early gestation and in couples concerned about the recurrence of thanatophoric dysplasia due to germinal mosaicism.','2018-03-14 00:00:00','2018-03-14 00:00:00','2018-04-15 00:00:00',0,0,'Terasawa, Sumire, S|Kato, Asuka, A|Nishizawa, Haruki, H|Kato, Takema, T|Yoshizawa, Hikari, H|Noda, Yoshiteru, Y|Miyazaki, Jun, J|Ito, Mayuko, M|Sekiya, Takao, T|Fujii, Takuma, T|Kurahashi, Hiroki, H','2018-05-17 22:46:19','2018-05-17 22:46:19'),(7,1,29516753,'1464-5165','Piloting and psychometric properties of a patient-reported outcome instrument for young people with achondroplasia based on the International Classification of Functioning Disability and Health: the Achondroplasia Personal Life Experience Scale (APLES).','This study describes the psychometric testing of the Achondroplasia Personal Life Experience Scale (APLES): a new disease- and functioning-specific health-related quality of life instrument for young people with achondroplasia, which was developed based on the International Classification of Functioning-Children and Youth Version.The qualitative analysis of focus group statements from German patients and parents using the International Classification of Functioning-Children and Youth Version yielded 59 items, which after cognitive debriefing were included in a pilot-test. Psychometric performance was cross-culturally examined in a field- and re-test in Germany and Spain.Cognitive debriefing and pilot-test results suggested to reduce the 59-APLES version to a 35-items version. Field-test data showed acceptable reliability and validity, which further improved after the APLES was shortened to 21 items.Developing a disease-specific instrument within the framework of the International Classification of Functioning allows the universal assessment and comparison of perceived health. Psychometric analysis showed that the APLES fulfills psychometric quality standards and provides a way to assess health-related quality of life from self- and observer report in young persons with achondroplasia. Further studies may use the instrument in clinical research and practice to understand perceived burden and to optimize care. Implications for Rehabilitation Health-related quality of life instruments are useful tools to include in clinical research and/or practice to evaluate treatment effects directly from the patient\'s perspective. Cross-culturally developed health-related quality of life measures that are based on the International Classification of Functioning Disability and Health provide the opportunity to assess the health status in a standardized language and to compare it across countries and health professions. All four components of the International Classification of Functioning Disability and Health - Child and Youth Version (\"Body Functions & Structures\", \"Activities and Participation\", \"Environmental Factors\", and \"Personal Factors\") have been shown to be relevant in assessing health-related quality of life and functioning in young achondroplasia patients. Results underline the important aspects associated with disproportionate short stature, emphasizing the benefits of a disease-specific instrument.','2018-03-08 00:00:00','2018-03-08 00:00:00','2018-03-08 00:00:00',0,0,'Bloemeke, Janika, J|Sommer, Rachel, R|Witt, Stefanie, S|Dabs, Michaela, M|Badia, Francisco Javier, FJ|Bullinger, Monika, M|Quitmann, Julia, J','2018-05-17 22:46:19','2018-05-17 22:46:19'),(8,1,29512530,'0917-5857','[Homeostasis and Disorder of Musculoskeletal System.Diagnosis and Treatment of Congenital Musculoskeletal Diseases.]','Congenital skeletal dysplasias have been considered to be fundamentally untreatable diseases. However, molecular diagnosis by genetic testing has become more prevalent, and efforts are being made to develop novel therapies based on the pathogenesis. As treatments for osteogenesis imperfecta, in addition to anti-resorptive agents, neutralizing antibodies against sclerostin and transforming growth factor(TGF)-β and chemical chaperones can be beneficial. Enzyme replacement therapy using bone-targeting recombinant alkaline phosphatase has been recently developed to treat hypophosphatasia and has much improved the prognosis of the patients affected with severe forms of the disease. To treat the severe short stature in achondroplasia, drugs targeting the fibroblast growth factor receptor 3(FGFR3)-mediated signal are in development for clinical use.','2018-01-01 00:00:00','0000-00-00 00:00:00','2018-04-10 00:00:00',0,0,'Michigami, Toshimi, T','2018-05-17 22:46:19','2018-05-17 22:46:19'),(9,1,29496218,'1879-9825','Trabecular bone microarchitecture analysis, a way for an early detection of genetic dwarfism? Case study of a dwarf mother\'s offspring.','A 66 year-old woman with a disproportionate dwarfism and who bore seven children was discovered at the Middenbeemster archaeological site (The Netherlands). Three are perinates and show no macroscopic or radiological evidence for a FGFR3 mutation causing hypo-or achondroplasia. This mutation induces dysfunction of the growth cartilage, leading to abnormalities in the development of trabecular bone. Because the mutation is autosomal dominant, these perinates have a 50% risk of having been affected. This study determines whether trabecular bone microarchitecture (TBMA) analysis is useful for detecting genetic dwarfism. Proximal metaphyses of humeri were μCT-scanned with a resolution of 7-12 μm. Three volumes of interest were segmented from each bone with TIVMI© software. The TBMA was quantified in BoneJ© using six parameters on which a multivariate analysis was then performed. Two of the Middenbeemster perinates show a quantitatively different TBMA organization. These results and the family\'s medical history suggest a diagnosis of genetic dwarfism for this two perinates. This study provides evidence to support the efficacy of μCT for diagnosing early-stage bone disease.','2018-03-01 00:00:00','2017-12-14 00:00:00','2018-03-02 00:00:00',0,0,'Colombo, Antony, A|Hoogland, Menno, M|Coqueugniot, Hélène, H|Dutour, Olivier, O|Waters-Rist, Andrea, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(10,1,29466240,'2191-0251','Growth velocity and biological variables during puberty in achondroplasia.','Achondroplasia is the most common form of inherited disproportionate short stature. Cross-sectional design studies of height show that, during childhood, height standard deviation scores (SDS) declines steadily and reaches a mean adult height at -6.42 and -6.72 SDS. However, there is a lack of knowledge about longitudinal growth and biological variables during puberty for children with achondroplasia. Here we report the growth velocity and biological parameters during puberty in children with achondroplasia.The study was an observational, cohort study. A total of 23 patients, 15 girls and eight boys with achondroplasia, who reached adult size were included. Growth data was collected from mid-childhood until final height by the same trained observer. Individual growth curves were estimated by fitting the Preece-Baines model 1 (PB1) to each individual\'s height for age data. Pubertal development was scored on Tanner scale on each visit.In boys with achondroplasia the mean adult height was 129.18 cm. Age and velocity at peak velocity in puberty were 13.89 years and 4.86 cm/year, respectively. The adolescent gain was 20.40 cm. Mean age at genital development 2 and 5 were 12.16 (0.60) and 14.97 (0.88), respectively. In girls the mean adult height was 118.67 cm. Age and velocity at peak velocity in puberty were 11.45 years and 4.40 cm/year, respectively. The adolescent gain was 19.35 cm. Mean age at breast 2 and 4 were 10.20 (1.24) and 12.49 (1.07), respectively.Children with achondroplasia experienced an adolescent growth spurt, which was similar in shape and half the magnitude of the non-achondroplasia population.','2018-03-28 00:00:00','0000-00-00 00:00:00','2018-03-29 00:00:00',0,0,'Del Pino, Mariana, M|Fano, Virginia, V|Adamo, Paula, P','2018-05-17 22:46:19','2018-05-17 22:46:19'),(11,2,29750285,'1938-2359','Updates in Newborn Screening.','Newborn screening in the United States is an important public health measure to provide early detection for specified disorders when early treatment is both possible and beneficial. As technology improves, newborn screening can be offered for many more conditions. In the past 10 years, screening has expanded to include severe combined immunodeficiency, congenital heart disease, lysosomal storage disease, and X-linked adrenoleukodystrophy. This article reviews the current state of newborn screening with updates on recent developments. [Pediatr Ann. 2018;47(5):e187-e190.].','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-05-11 00:00:00',0,0,'Rajabi, Farrah, F','2018-05-17 22:46:19','2018-05-17 22:46:19'),(12,2,29740390,'1664-2295','A Novel Variant in  Gene Presenting as Adolescent-Onset Atypical Adrenomyeloneuropathy With Spastic Ataxia.','X-linked adrenoleukodystrophy (X-ALD) is a rare neurological disorder with a highly complex clinical presentation. Adrenal function, spinal cord, peripheral nerves, and cerebral white matter are commonly affected in adult-onset male patients. Here, we report a family with unusual presentation of X-ALD. The 19-year-old proband had presented with atypical symptoms of adrenomyeloneuropathy (AMN) for 3 years, only with spastic paraparesis, cerebellar ataxia, and cerebellar atrophy with white matter hyperintensity. It is rare for an AMN male patient to present the initial symptoms at such an early age with the adrenal function, sphincter function, and dorsal column of the spinal cord spared. He is also the youngest male AMN patient reported to have cerebellar ataxia. His mother also presented unusually early onset of the similar manifestations. A novel variant c.1144A>C (p.Thr382Pro) in exon 3 of the  gene was identified. Family study involving the grandparents of the proband revealed the  occurrence of the variant in the mother.','2018-05-17 00:00:00','2018-04-23 00:00:00','2018-05-11 00:00:00',0,0,'Chen, Yanxing, Y|Zhang, Jianfang, J|Wang, Jianwen, J|Wang, Kang, K','2018-05-17 22:46:19','2018-05-17 22:46:19'),(13,2,29739804,'1754-8411','Etiology and treatment of adrenoleukodystrophy: new insights from .','Adrenoleukodystrophy (ALD) is a fatal progressive neurodegenerative disorder affecting brain white matter. The most common form of ALD is X-linked (X-ALD) and results from mutation of the -encoded very long chain fatty acid (VLCFA) transporter. X-ALD is clinically heterogeneous, with the cerebral form being the most severe. Diagnosed in boys usually between the ages of 4 and 8, cerebral X-ALD symptoms progress rapidly (in as little as two years) through declines in cognition, learning, and behavior, to paralysis and ultimately to a vegetative state and death. Currently, there are no good treatments for X-ALD. Here we exploit the  ()  () model of neurometabolic disease to expand diagnostic power and therapeutic potential for adrenoleukodystrophy. We show that loss of the  long/very long chain acyl-CoA synthetase genes  and/or  is indistinguishable from loss of the  ABC transporter gene  Shared loss-of-function phenotypes for synthetase and transporter mutants point to a lipid metabolic pathway association with ALD-like neurodegenerative disease in ; a pathway association that has yet to be established in humans. We also show that manipulation of environment increases the severity of neurodegeneration in  and  flies, adding even further to a suite of new candidate ALD disease-causing genes and pathways in humans. Finally, we show that it is a lack of lipid metabolic pathway product and not (as commonly thought) an accumulation of pathway precursor that is causative of neurometabolic disease: addition of medium chain fatty acids to the diet of  or  flies prevents the onset of neurodegeneration. Taken together, our data provide new foundations both for diagnosing adrenoleukodystrophy and for designing effective, mechanism-based treatment protocols.','2018-05-08 00:00:00','2018-05-08 00:00:00','2018-05-09 00:00:00',0,0,'Gordon, Hannah B, HB|Valdez, Lourdes, L|Letsou, Anthea, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(14,2,29730299,'1638-6183','Plasma oxysterol profiling in children reveals 24-hydroxycholesterol as a potential marker for Autism Spectrum Disorders.','Cholesterol and its oxygenated metabolites, such as oxysterols, are intensively investigated as potential players in the pathophysiology of brain disorder. Altered oxysterol levels have been described in patients with numerous neuropsychiatric disorders, including Alzheimer\'s disease, Amyotrophic Lateral Sclerosis, Parkinson\'s disease, X-linked adrenoleukodystrophy, and Smith-Lemli-Opitz Syndrome. Recent studies have shown that Autism Spectrum Disorders are associated with disruption of cholesterol metabolism. The present study aimed at investigating the profile of oxysterols in plasma and their association with clinical parameters in patients with Autism Spectrum Disorders. Thirty-six children with Autism Spectrum Disorders and thirty-eight healthy children, from Sfax (a southern area of Tunisia) matched for age and sex, were included in the study. The severity of Autism Spectrum Disorders was evaluated using the childhood autism rating scale. Standard lipid profile (total cholesterol, triglycerides, and high-density lipoprotein-cholesterol), serum glucose, high-sensitive C-reactive protein, and orosomucoid levels were measured utilizing standard techniques; oxysterol levels were measured by isotope-dilution gas chromatography/mass spectrometry. Standard lipid profile, serum glucose, high-sensitive C-reactive protein, and orosomucoid levels were similar between the two studied populations. Compared to the control group, children with Autism Spectrum Disorders showed a significant higher plasma level of 24-hydroxycholesterol, while borderline significance was observed for 7α-Hydroxycholesterol, and 25-hydroxycholersterol. In patients, 24-hydroxycholesterol was inversely correlated with age. Multivariate analysis showed that high plasma levels of 24-hydroxycholesterol are independent risk factors for Autism Spectrum Disorders. On the other hand, an analysis of the receiver\'s operating characteristics proved that the measured parameters recorded satisfactory levels of specificity and sensitivity. The present study provides evidence that Autism Spectrum Disorders are associated with altered levels in circulating oxysterols. The finding that 24-hydroxycholesterol is an independent risk factor for the disease and suggests the use of this oxysterol as a diagnostic tool in Autism Spectrum Disorders.','2018-05-03 00:00:00','2018-05-03 00:00:00','2018-05-06 00:00:00',0,0,'Grayaa, S, S|Zerbinati, C, C|Messedi, M, M|HadjKacem, I, I|Chtourou, M, M|Ben Touhemi, D, D|Naifar, M, M|Ayadi, H, H|Ayedi, F, F|Iuliano, L, L','2018-05-17 22:46:19','2018-05-17 22:46:19'),(15,2,29725109,'1476-5365','Busulfan, Fludarabine, and Cyclophosphamide (BFC) conditioning allowed stable engraftment after haplo-identical allogeneic stem cell transplantation in children with adrenoleukodystrophy and mucopolysaccharidosis.','No abstract found.','2018-05-03 00:00:00','2018-05-03 00:00:00','2018-05-04 00:00:00',0,0,'Chen, Yao, Y|Xu, Lan-Ping, LP|Zhang, Xiao-Hui, XH|Chen, Huan, H|Wang, Feng-Rong, FR|Liu, Kai-Yan, KY|Qin, Jiong, J|Yang, Yan-Ling, YL|Huang, Xiao-Jun, XJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(16,2,29708222,'2163-0402','When multiple sclerosis and X-linked adrenoleukodystrophy are tangled: A challenging case.','No abstract found.','2018-04-01 00:00:00','0000-00-00 00:00:00','2018-05-02 00:00:00',0,0,'Brandão de Paiva, Anderson Rodrigues, AR|Pucci Filho, Carlos Rory, CR|Porto, Alan Monteiro, AM|Feltrin, Fabrício Stewan, FS|Kok, Fernando, F|Camargo, Carlos Henrique Ferreira, CHF','2018-05-17 22:46:19','2018-05-17 22:46:19'),(17,2,29694951,'1663-2826','Vanishing 17-Hydroxyprogesterone Concentrations in 21-Hydroxylase Deficiency.','We present a boy with a genetically proven congenital adrenal hyperplasia (CAH) due to 21-hydroxylase deficiency. While massively elevated 17-hydroxyprogesterone (17-OHP) concentrations after birth led to the diagnosis, 17-OHP concentrations became immeasurable starting with the second year of life even though the dose of hydrocortisone was continuously decreased to ∼7 mg/m2/day. Furthermore, 17-OHP levels were immeasurable during the ACTH test and after withdrawing hydrocortisone medication. In contrast, ACTH levels increased after cessation of hydrocortisone treatment suggesting complete primary adrenal cortex failure. We discuss this case based on the differential diagnosis of complete adrenal cortex failure including other genetic causes in addition to CAH, prednisolone treatment, autoimmune adrenalitis, adrenoleukodystrophy, CMV infection, and adrenal hemorrhage infarction. The most likely disease in our boy is autoimmune adrenalitis, which is difficult to prove years after the onset of the disease. Treatment of CAH had masked the classical symptoms of complete adrenal cortex insufficiency leading to delayed diagnosis in this case.','2018-04-25 00:00:00','2018-04-25 00:00:00','2018-04-25 00:00:00',0,0,'Reinehr, Thomas, T|Rothermel, Juliane, J|Wegener-Panzer, Andreas, A|Hartmann, Michaela F, MF|Wudy, Stefan A, SA|Holterhus, Paul-Martin, PM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(18,2,29680633,'1096-7206','Multiplex tandem mass spectrometry assay for newborn screening of X-linked adrenoleukodystrophy, biotinidase deficiency, and galactosemia with flexibility to assay other enzyme assays and biomarkers.','All States screen for biotinidase deficiency and galactosemia, and X-linked adrenoleukodystrophy (X-ALD) has recently been added to the Recommended Uniform Screening Panel (RUSP).We sought to consolidate these tests by combining them into a single multiplex tandem mass spectrometry assay as well as to improve the current protocol for newborn screening of galactosemia.A 3 mm punch of a dried blood spot (DBS) was extracted with organic solvent for analysis of the C26:0-lysophosphatidylcholine biomarker for X-ALD.An additional punch was used to assay galactose-1-phosphate uridyltransferase (GALT) and biotinidase.All assays were combined for a single injection for analysis by liquid chromatography-tandem mass spectrometry (LC-MS/MS) (2.3 min per sample).The GALT LC-MS/MS assay does not give a false positive for galactosemia if glucose-6-phosphate dehydrogenase is deficient.The multiplex assay shows acceptable reproducibility and provides for rapid analysis of X-ALD, biotinidase deficiency, and galactosemia.The throughput and ease of sample preparation are acceptable for newborn screening laboratories.We also show that the LC-MS/MS assay is expandable to include several other diseases including Pompe and Hurler diseases (enzymatic activities and biomarkers).Because of consolidation of assays, less manpower is needed compared to running individual assays on separate platforms.The flexibility of the LC-MS/MS platform allows each newborn screening laboratory to analyze the set of diseases offered in their panel.','2018-03-29 00:00:00','2018-03-29 00:00:00','2018-04-22 00:00:00',0,0,'Hong, Xinying, X|Kumar, Arun Babu, AB|Ronald Scott, C, C|Gelb, Michael H, MH','2018-05-17 22:46:19','2018-05-17 22:46:19'),(19,2,29620081,'2163-0402','Relative adrenal insufficiency in adult-onset cerebral X-linked adrenoleukodystrophy.','No abstract found.','2017-10-01 00:00:00','0000-00-00 00:00:00','2018-04-08 00:00:00',0,0,'Sato, Takeo, T|Umehara, Tadashi, T|Nakahara, Atsuo, A|Oka, Hisayoshi, H','2018-05-17 22:46:19','2018-05-17 22:46:19'),(20,2,29615068,'2045-8118','Modeling and rescue of defective blood-brain barrier function of induced brain microvascular endothelial cells from childhood cerebral adrenoleukodystrophy patients.','X-linked adrenoleukodystrophy (X-ALD) is caused by mutations in the ABCD1 gene. 40% of X-ALD patients will convert to the deadly childhood cerebral form (ccALD) characterized by increased permeability of the brain endothelium that constitutes the blood-brain barrier (BBB). Mutation information and molecular markers investigated to date are not predictive of conversion. Prior reports have focused on toxic metabolic byproducts and reactive oxygen species as instigators of cerebral inflammation and subsequent immune cell invasion leading to BBB breakdown. This study focuses on the BBB itself and evaluates differences in brain endothelium integrity using cells from ccALD patients and wild-type (WT) controls.The blood-brain barrier of ccALD patients and WT controls was modeled using directed differentiation of induced pluripotent stem cells (iPSCs) into induced brain microvascular endothelial cells (iBMECs). Immunocytochemistry and PCR confirmed characteristic expression of brain microvascular endothelial cell (BMEC) markers. Barrier properties of iBMECs were measured via trans-endothelial electrical resistance (TEER), sodium fluorescein permeability, and frayed junction analysis. Electron microscopy and RNA-seq were used to further characterize disease-specific differences. Oil-Red-O staining was used to quantify differences in lipid accumulation. To evaluate whether treatment with block copolymers of poly(ethylene oxide) and poly(propylene oxide) (PEO-PPO) could mitigate defective properties, ccALD-iBMECs were treated with PEO-PPO block copolymers and their barrier properties and lipid accumulation levels were quantified.iBMECs from patients with ccALD had significantly decreased TEER (2592 ± 110 Ω cm) compared to WT controls (5001 ± 172 Ω cm). They also accumulated lipid droplets to a greater extent than WT-iBMECs. Upon treatment with a PEO-PPO diblock copolymer during the differentiation process, an increase in TEER and a reduction in lipid accumulation were observed for the polymer treated ccALD-iBMECs compared to untreated controls.The finding that BBB integrity is decreased in ccALD and can be rescued with block copolymers opens the door for the discovery of BBB-specific molecular markers that can indicate the onset of ccALD and has therapeutic implications for preventing the conversion to ccALD.','2018-04-04 00:00:00','2018-04-04 00:00:00','2018-04-12 00:00:00',0,0,'Lee, Catherine A A, CAA|Seo, Hannah S, HS|Armien, Anibal G, AG|Bates, Frank S, FS|Tolar, Jakub, J|Azarin, Samira M, SM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(21,3,29751240,'1573-2517','Temperament clusters associate with anxiety disorder comorbidity in depression.','Individual temperament is associated with psychiatric morbidity and could explain differences in psychiatric comorbidities. We investigated the association of temperament profile clusters with anxiety disorder comorbidity in patients with depression.We assessed the temperament of 204 specialized care-treated depressed patients with the Temperament and Character Inventory (TCI-R) and their diagnoses with the Mini International Neuropsychiatric Interview. Two-step cluster analysis was used for defining patients\' temperament profiles and logistic regression analysis was used for predicting different anxiety disorders for various temperament profiles.Four temperament clusters were found: 1) Novelty seekers with highest Novelty Seeking scores (n = 56),2) Persistent with highest Persistence scores (n = 36), 3) Reserved with lowest Novelty Seeking scores (n = 66) and 4) Wearied with highest Harm avoidance, lowest Reward Dependence and lowest Persistence scores (n = 58). After adjusting for clinical variables, panic disorder and/or agoraphobia were predicted by Novelty seekers\' temperament profile with odds ratio [OR] = 3.5 (95% confidence interval [CI] = 1.8 - 6.9, p < 0.001), social anxiety disorder was predicted by Wearied temperament profile with OR = 3.4 (95% CI = 1.6 - 7.5, p = 0.002), and generalized anxiety disorder was predicted by Reserved temperament profile with OR = 2.6 (95% CI = 1.2 - 5.3, p = 0.01).The patients\' temperament profiles were assessed while displaying depressive symptoms, which may have affected results.Temperament clusters with unique dimensional profiles were specifically associated with different anxiety disorders in this study. These results suggest that TCI-R could offer a valuable dimensional method for predicting the risk of anxiety disorders in diverse depressed patients.','2018-04-23 00:00:00','2018-04-23 00:00:00','2018-05-11 00:00:00',0,0,'Paavonen, Vesa, V|Luoto, Kaisa, K|Lassila, Antero, A|Leinonen, Esa, E|Kampman, Olli, O','2018-05-17 22:46:19','2018-05-17 22:46:19'),(22,3,29745445,'1520-6394','Prevalence of psychiatric morbidity in United States military spouses: The Millennium Cohort Family Study.','Approximately half of US service members are married, equating to 1.1 million military spouses, yet the prevalence of psychiatric morbidity among military spouses remains understudied. We assessed the prevalence and correlates of eight mental health conditions in spouses of service members with 2-5 years of service.We employed baseline data from the Millennium Cohort Family Study, a 21-year longitudinal survey following 9,872 military-affiliated married couples representing all US service branches and active duty, Reserve, and National Guard components. Couples were surveyed between 2011 and 2013, a period of high military operational activity associated with Operation Iraqi Freedom and Operation Enduring Freedom. Primary outcomes included depression, anxiety, posttraumatic stress disorder (PTSD), panic, alcohol misuse, insomnia, somatization, and binge eating, all assessed with validated self-report questionnaires.A total of 35.90% of military spouses met criteria for at least one psychiatric condition. The most commonly endorsed conditions were moderate-to-severe somatization symptoms (17.63%) and moderate-to-severe insomnia (15.65%). PTSD, anxiety, depression, panic, alcohol misuse, and binge eating were endorsed by 9.20%, 6.65%, 6.05%, 7.07%, 8.16%, and 5.23% of spouses, respectively. Having a partner who deployed with combat resulted in higher prevalence of anxiety, insomnia, and somatization. Spouses had lower prevalence of PTSD, alcohol misuse, and insomnia but higher rates of panic and binge eating than service members. Both members of a couple rarely endorsed having the same psychiatric problem.One third of junior military spouses screened positive for one or more psychiatric conditions, underscoring the need for high-quality prevention and treatment services.','2018-05-10 00:00:00','2018-05-10 00:00:00','2018-05-10 00:00:00',0,0,'Steenkamp, Maria M, MM|Corry, Nida H, NH|Qian, Meng, M|Li, Meng, M|McMaster, Hope Seib, HS|Fairbank, John A, JA|Stander, Valerie A, VA|Hollahan, Laura, L|Marmar, Charles R, CR','2018-05-17 22:46:19','2018-05-17 22:46:19'),(23,3,29736064,'0019-5545','Psychiatric comorbidities in acute coronary syndromes: Six-month follow-up study.','Acute coronary syndrome (ACS) caused by coronary atherosclerosis include ST-segment elevation myocardial infarction (STEMI), non-STEMI, and unstable angina. The relation between psychiatric disorders and coronary artery disease is a complex one which includes the effect of the psychosocial factors on heart and vice versa. Point prevalence studies have been reported, but there is paucity of follow-up studies from India.The study is a follow-up evaluation at discharge of 248 consecutive patients presented with ACS at JSS Hospital, Mysuru, Karnataka, over a period of 6 months to assess the psychiatric comorbidities. The patients were assessed on a structured and validated pro forma before discharge, at 3 months, and at 6 months. Screening of psychiatric disorders was done using Mini International Neuropsychiatric Interview PLUS 5.0.0 and assessment of depression was done using Hamilton Depression Rating Scale. ANOVA, Student\'s -test, and SPSS 21 were used for statistical analysis.The most common psychiatric comorbidities include major depressive disorder (44%), it persisted at the end of 3 ( < 0.001) and 6 ( < 0.001) months. A spectrum of anxiety disorders including panic disorder (12.10%), dysthymia (3.60%), agoraphobia (2.40%), social phobia (2%), obsessive-compulsive disorder (1.6%), specific phobia (1.2%), and posttraumatic stress disorder (0.8%) in descending order at the end of 6 months were found. Significant reduction in substance use of nicotine (66.1%) and alcohol (56.0%) was reported on follow-up.Depression, anxiety, and substance use occur in patients with ACS which persist on follow-up. Early recognition at discharge and appropriate counseling on follow-up improve the clinical outcomes.','2018-01-01 00:00:00','0000-00-00 00:00:00','2018-05-11 00:00:00',0,0,'Shruthi, D Ramya, DR|Kumar, S Sunil, SS|Desai, Nagaraj, N|Raman, Rajesh, R|Sathyanarayana Rao, T S, TS','2018-05-17 22:46:19','2018-05-17 22:46:19'),(24,3,29649673,'1872-7123','The relationship between impulsivity and panic disorder-agoraphobia: The role of affective temperament.','There are opinions regarding that impulsivity may play a role in the pathogenesis of neuropsychiatric disorders. The aim of this study was to investigate the relationship between impulsivity and panic disorder (PD) in the patient group, to compare impulsivity and affective temperamental traits between patients and healthy controls and to investigate whether there is a relationship between impulsivity and affective temperamental traits. Participants comprised 70 patients with PD and 58 healthy volunteers. The Panic Agoraphobia Scale (PAS), the Barratt Impulsiveness Scale (BIS-11) and the Temperament Evaluation of Memphis, Pisa, Paris, San Diego Autoquestionnaire (TEMPS-A) were applied. Patients have significantly higher scores in affective temperament (except hyperthymic) and attentional impulsiveness subscales than the healthy controls. Positive and negative correlations were found between some PAS and BIS-11 scores as well as correlations between especially cyclothymic, hyperthymic, irritable and anxious subscale scores of the TEMPS-A and the BIS-11 scores in the patient group. The results of this study indicate a relationship between impulsivity and PD. The correlations found between affective temperament dimensions and impulsivity suggest how affective temperamental traits may influence different impulsivity dimensions.','2018-03-22 00:00:00','2018-03-22 00:00:00','2018-05-07 00:00:00',0,0,'Beşirli, Aslı, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(25,3,29644923,'1502-4725','Patients\' characteristics and their influence on course of fear during agoraphobic symptom provocation: may SS(N)RI treatment compensate unfavorable individual preconditions?','Patients\' characteristics and antidepressants are discussed to be relevant in the context of phobic exposure.To identify patients characteristics associated with a differential course of fear during disorder-specific symptom provocation as well as to elucidate the effect of selective serotonin-(noradrenalin-) reuptake inhibitors [SS(N)RI] on development of fear in the context of re-exposure to the phobic stimuli.Twenty-eight clinically well-characterized patients with panic disorder and agoraphobia (PD/AG) were classified into subjects who show a reduction of fear (\'Fear-\') during a symptom provocation via a picture-based paradigm (T1) and those who did not (\'Fear+\'). Subsequently, SS(N)RI treatment was administered to all patients and subjects were re-exposed to the feared stimuli after 8 weeks of treatment (T2). Moreover, brain activity within the \'fear network\' was measured via functional magnetic resonance imaging (fMRI) at T1 and T2.Fear - were significantly younger and demonstrated increased exposure-related fear as well as stronger activity in several fear-related brain areas than Fear+. We found significant improvements in all clinical parameters after pharmacological intervention for the whole sample (T1-T2; all measures p < .02). However, reduction of fear as well as activation in (para)limbic structures during symptom provocation were now attenuated in Fear - but increased in Fear+.Advanced age may predict a therapeutically unfavorable course of fear during agoraphobic symptom provocation. Since we found no negative impact of medication on fear development at all, there was some evidence that SS(N)RI treatment might improve the individual ability to get involved with the agoraphobic stimuli while conducting disorder-specific exposure.','2018-04-12 00:00:00','2018-04-12 00:00:00','2018-04-12 00:00:00',0,0,'Plag, Jens, J|Petzold, Moritz B, MB|Gechter, Johanna, J|Liebscher, Carolin, C|Ströhle, Andreas, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(26,3,29620793,'1469-493X','Antidepressants versus placebo for panic disorder in adults.','Panic disorder is characterised by repeated, unexpected panic attacks, which represent a discrete period of fear or anxiety that has a rapid onset, reaches a peak within 10 minutes, and in which at least four of 13 characteristic symptoms are experienced, including racing heart, chest pain, sweating, shaking, dizziness, flushing, stomach churning, faintness and breathlessness. It is common in the general population with a lifetime prevalence of 1% to 4%. The treatment of panic disorder includes psychological and pharmacological interventions. Amongst pharmacological agents, the National Institute for Health and Care Excellence (NICE) and the British Association for Psychopharmacology consider antidepressants, mainly selective serotonin reuptake inhibitors (SSRIs), as the first-line treatment for panic disorder, due to their more favourable adverse effect profile over monoamine oxidase inhibitors (MAOIs) and tricyclic antidepressants (TCAs). Several classes of antidepressants have been studied and compared, but it is still unclear which antidepressants have a more or less favourable profile in terms of effectiveness and acceptability in the treatment of this condition.To assess the effects of antidepressants for panic disorder in adults, specifically:1. to determine the efficacy of antidepressants in alleviating symptoms of panic disorder, with or without agoraphobia, in comparison to placebo;2. to review the acceptability of antidepressants in panic disorder, with or without agoraphobia, in comparison with placebo; and3. to investigate the adverse effects of antidepressants in panic disorder, with or without agoraphobia, including the general prevalence of adverse effects, compared to placebo.We searched the Cochrane Common Mental Disorders\' (CCMD) Specialised Register, and CENTRAL, MEDLINE, EMBASE and PsycINFO up to May 2017. We handsearched reference lists of relevant papers and previous systematic reviews.All double-blind, randomised, controlled trials (RCTs) allocating adults with panic disorder to antidepressants or placebo.Two review authors independently checked eligibility and extracted data using a standard form. We entered data into Review Manager 5 using a double-check procedure. Information extracted included study characteristics, participant characteristics, intervention details and settings. Primary outcomes included failure to respond, measured by a range of response scales, and treatment acceptability, measured by total number of dropouts for any reason. Secondary outcomes included failure to remit, panic symptom scales, frequency of panic attacks, agoraphobia, general anxiety, depression, social functioning, quality of life and patient satisfaction, measured by various scales as defined in individual studies. We used GRADE to assess the quality of the evidence for each outcome MAIN RESULTS: Forty-one unique RCTs including 9377 participants overall, of whom we included 8252 in the 49 placebo-controlled arms of interest (antidepressant as monotherapy and placebo alone) in this review. The majority of studies were of moderate to low quality due to inconsistency, imprecision and unclear risk of selection and performance bias.We found low-quality evidence that revealed a benefit for antidepressants as a group in comparison with placebo in terms of efficacy measured as failure to respond (risk ratio (RR) 0.72, 95% confidence interval (CI) 0.66 to 0.79; participants = 6500; studies = 30). The magnitude of effect corresponds to a number needed to treat for an additional beneficial outcome (NNTB) of 7 (95% CI 6 to 9): that means seven people would need to be treated with antidepressants in order for one to benefit. We observed the same finding when classes of antidepressants were compared with placebo.Moderate-quality evidence suggested a benefit for antidepressants compared to placebo when looking at number of dropouts due to any cause (RR 0.88, 95% CI 0.81 to 0.97; participants = 7850; studies = 30). The magnitude of effect corresponds to a NNTB of 27 (95% CI 17 to 105); treating 27 people will result in one person fewer dropping out. Considering antidepressant classes, TCAs showed a benefit over placebo, while for SSRIs and serotonin-norepinephrine reuptake inhibitor (SNRIs) we observed no difference.When looking at dropouts due to adverse effects, which can be considered as a measure of tolerability, we found moderate-quality evidence showing that antidepressants as a whole are less well tolerated than placebo. In particular, TCAs and SSRIs produced more dropouts due to adverse effects in comparison with placebo, while the confidence interval for SNRI, noradrenergic reuptake inhibitors (NRI) and other antidepressants were wide and included the possibility of no difference.The identified studies comprehensively address the objectives of the present review.Based on these results, antidepressants may be more effective than placebo in treating panic disorder. Efficacy can be quantified as a NNTB of 7, implying that seven people need to be treated with antidepressants in order for one to benefit. Antidepressants may also have benefit in comparison with placebo in terms of number of dropouts, but a less favourable profile in terms of dropout due to adverse effects. However, the tolerability profile varied between different classes of antidepressants.The choice of whether antidepressants should be prescribed in clinical practice cannot be made on the basis of this review.Limitations in results include funding of some studies by pharmaceutical companies, and only assessing short-term outcomes.Data from the present review will be included in a network meta-analysis of psychopharmacological treatment in panic disorder, which will hopefully provide further useful information on this issue.','2018-04-05 00:00:00','2018-04-05 00:00:00','2018-05-09 00:00:00',0,0,'Bighelli, Irene, I|Castellazzi, Mariasole, M|Cipriani, Andrea, A|Girlanda, Francesca, F|Guaiana, Giuseppe, G|Koesters, Markus, M|Turrini, Giulia, G|Furukawa, Toshi A, TA|Barbui, Corrado, C','2018-05-17 22:46:19','2018-05-17 22:46:19'),(27,3,29592527,'1360-0451','The association between HIV clinical disease severity and psychiatric disorders as seen in Western Romania.','HIV disease continues to be a serious health issue all over the world. By the end of 2016, 36.7 million people were living with HIV, 1.8 million people became newly infected and 1 million died of HIV-related causes/diseases. In order to develop effective treatment strategies, is important to assess the risk factors that affect negatively the HIV-positive patients. HIV-infected patients are at high risk of developing psychiatric disorders in every stage of the illness. Psychiatric disorders can negatively influence the treatment adherence, induce risk behavior and influence the quality of life. The purpose of this study is to determine if the severity of HIV disease is associated with increased frequency of psychiatric disorders. We evaluated 101 HIV-positive patients receiving antiretroviral therapy in Western Romania via Psychiatric Diagnostic Screening Questionnaire (PDSQ). We conducted a risk analysis in order to see if the patients have a higher risk of developing psychiatric disorders depending on HIV serostatus factor (HIV asymptomatic, symptomatic, AIDS converted). Our study shows that, the patients having AIDS and symptomatic HIV have a higher prevalence for the most common psychiatric disorders: major depressive disorder (OR = 5.81;p < 0.001), panic disorder (OR = 3.11; p = 0.016), agoraphobia (OR = 4.31; p = 0.024), social phobia (OR = 2.81; p = 0.038), generalized anxiety disorder (OR = 4.79; p = 0.006), somatization (OR = 8.72; p < 0.0010) and hypochondria (OR = 4.66; p = 0.0013). Symptomatic HIV and AIDS converted serostatus is also a risk factor for post-traumatic stress disorder, obsessive-compulsive disorder and psychosis. The main conclusion of this study is that the more severe HIV clinical disease was associated with increased frequency of psychiatric disorders. As a consequence, we conclude that psychiatric disorders and HIV/AIDS treatment should be addressed simultaneously, depending on the risk specific factors such as the HIV infection stage and, due to psychiatric repercussions of HIV is expected to become more relevant in the coming years.','2018-03-28 00:00:00','2018-03-28 00:00:00','2018-03-29 00:00:00',0,0,'Ursoiu, Fulvia, F|Moleriu, Lavinia, L|Lungeanu, Diana, D|Puschită, Maria, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(28,3,29580906,'2213-0276','Post-traumatic psychiatric disorders: PTSD is not the only diagnosis.','Traumatic events and their consequences are often hidden or minimised by patients for reasons linked to the post-traumatic stress disorder itself (inexpressibility, shame, depressive thoughts, fear of stigmatisation, etc.). Although post-traumatic stress disorder (PTSD) remains the most widely known disorder, chronic post-traumatic psychiatric disorders are many and varied. After a trauma, the practitioner has to check for the different clinical forms of post-traumatic psychological consequences: PTSD is not the only diagnosis. Based on our own clinical experience compared to the international literature, we think necessary to build a didactic classification describing chronic post-traumatic symptoms and syndromes. Post traumatic depressions and bereavement lead to high risk of suicidal crisis and self-harm behaviours. Re-experiencing are felt with anxiety, hyper arousal increases anxious reactivity, and avoidance strategies increase anticipatory anxiety, indicating post-traumatic anxiety disorders (agoraphobia, specific phobia, obsessive compulsive disorder, separation anxiety, social phobia). Characterising an often-severe clinical picture, the co-occurrence of post-traumatic and chronic psychotic symptoms is not unusual (post-traumatic schizophrenia, post-traumatic depression with mood-congruent psychotic features, non-schizophrenic post-traumatic psychotic disorder, and bipolar reaction to trauma). A physical injury occurring at the same time as a traumatic exposure increases the risk of developing post-traumatic stress disorder later which, in turn, afflicts the subjective perception of the physical health (development of somatoform and psychosomatic disorders, comorbidity with a post-concussion syndrome). The trauma may cause a rupture in the biography of a person, also in his/her internal physiological functioning as in his/her social activities (impacts of instinctive functions and behaviours, personality changes, and adjustment difficulties on professional and personal life). Although a nomenclature is necessary for semiological descriptions, a thorough analysis of the patient\'s general psychological functioning must also be conducted.','2018-03-23 00:00:00','2018-03-23 00:00:00','2018-03-27 00:00:00',0,0,'Auxéméry, Yann, Y','2018-05-17 22:46:19','2018-05-17 22:46:19'),(29,3,29573755,'1988-2904','Psychometric Properties of the Spanish Version of the Panic Disorder Severity Scale.','The Panic Disorder Severity Scale (PDSS) is a well-established measure of panic symptoms but few data exist on this instrument in non north-American samples. Our main goal was to assess the psychometric properties (internal consistency, test re-test reliability, inter-rater reliability, convergent and divergent validity) and the factor structure of the Spanish version. Ninety-four patients with a main diagnosis of panic disorder were assessed with the Spanish version of PDSS, the Anxiety Sensitivity Index-3 (ASI-3), the Panic and Agoraphobia Scale (PAS), the Beck Anxiety Inventory (BAI), the Beck Depression Inventory-II (BDI-II) the PDSS self-rating form and the Clinical Global Impression-Severity scale (CGI). The Spanish PDSS showed acceptable internal consistency (α = .74), excellent test-retest (total score and items 1-6: α > .58, p .90) and medium to large convergent validity (r = .68, 95% CI [.54, .79], p < .01; r = .80, 95% CI [.70, .87], p < .01; r = .48, 95% CI [.28, .67], p < .01; BAI, PAS and ASI-3 total scores respectively). Data on divergent validity (BDI-II total score: r = .52, 95% CI [.34, .67], p < .01) suggest some need for refinement of the PDSS. The confirmatory factor analysis suggested a two-factor modified model for the scale (nested χ2 = 14.01, df = 12, p < .001). The Spanish PDSS has similar psychometric properties as the previous versions and is a useful instrument to assess panic symptoms in clinical settings in Spanish-speaking populations.','2018-03-25 00:00:00','2018-03-25 00:00:00','2018-03-25 00:00:00',0,0,'Fuste, Gideoni, G|Gil, María Ángeles, MÁ|López-Solà, Clara, C|Rosado, Silvia, S|Bonillo, Albert, A|Pailhez, Guillem, G|Bulbena, Antoni, A|Pérez, Víctor, V|Fullana, Miguel A, MA','2018-05-17 22:46:19','2018-05-17 22:46:19'),(30,3,29544715,'2212-0289','[The Jena Anxiety Monitoring List (JAMoL) - a tool for the evidence-based treatment of panic disorder with or without agoraphobia in primary care].','Behavior therapy-oriented methods are recommended for treating anxiety disorders in primary care. The treatment of patients with long-term conditions can be improved by case management and structured clinical monitoring. The present paper describes the rationale, design and application of the \'Jena Anxiety Monitoring List\' (JAMoL), a monitoring tool for the treatment of patients with panic disorder, with or without agoraphobia, in primary care.JAMoL\'s design was based on established clinical measures, the rationale of exposure-based anxiety treatment, and research on family practice-based case management. After piloting, the JAMoL was used in the clinical study \'Jena-PARADISE\' (ISRCTN64669297), where non-physician practice staff monitored patients with panic disorder by telephone. Using semi-structured interviews in concomitant studies, study participants were asked about the instrument\'s functionality.The JAMoL assesses the severity of anxiety symptoms (6 items) as well as the patient\'s adherence to therapy (4 items) and fosters the case management-related information exchange (3 items). An integrated traffic light scheme facilitates the evaluation of monitoring results. Within the clinical study, non-physician practice staff carried out a total of 1,525 JAMoL-supported monitoring calls on 177 patients from 30 primary care practices (median calls per patient: 10 [interquartile range, 9-10]). Qualitative analyses revealed that most practice teams and patients rated the JAMoL as a practicable and treatment-relevant tool.The JAMoL enables primary care practice teams to continuously monitor anxiety symptoms and treatment adherence in patients with panic disorder with or without agoraphobia. Within the behavior therapy-oriented treatment program \'Jena-PARADISE\', the JAMoL constitutes an important case management tool.','0000-00-00 00:00:00','2018-03-13 00:00:00','2018-04-30 00:00:00',0,0,'Hiller, Thomas Stephan, TS|Freytag, Antje, A|Breitbart, Jörg, J|Teismann, Tobias, T|Schöne, Elisabeth, E|Blank, Wolfgang, W|Schelle, Mercedes, M|Vollmar, Horst Christian, HC|Margraf, Jürgen, J|Gensichen, Jochen, J|für die Jena-PARADISE Study Group','2018-05-17 22:46:19','2018-05-17 22:46:19'),(31,4,29753156,'1523-6536','Antiviral T-Cells for Adenovirus in the Pre-Transplant Period: a Bridge Therapy for Severe Combined Immunodeficiency.','Viral infections can be life-threatening in patients with severe combined immunodeficiency (SCID) and other forms of profound primary immunodeficiency disorders both before and after hematopoietic stem cell transplant (HSCT). Adoptive immunotherapy with virus-specific T-cells (VST) has been utilized in many patients in the setting of HSCT, but has very rarely been attempted for treatment of viral infections before HSCT. Here we describe the use of VSTs in an infant with RAG1 SCID who had developed disseminated adenovirus which failed to improve on cidofovir. Adenovirus cleared following two doses of VSTs and marrow infusion from a matched unrelated donor, without incidence of graft versus host disease. T cell receptor-b sequencing demonstrated expansion of adenovirus-specific T-cell fraction of the VSTs, suggesting that infusion facilitated viral clearance. This report suggests that VSTs are likely safe in the pre-HSCT period, and may be a useful bridge therapy for infants with SCID and persistent viral infections.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-12 00:00:00',0,0,'Miller, Holly K, HK|Hanley, Patrick J, PJ|Lang, Haili, H|Lazarski, Christopher A, CA|Chorvinsky, Elizabeth A, EA|McCormack, Sarah, S|Roesch, Lauren, L|Albihani, Shuroug, S|Dean, Marcus, M|Hoq, Fahmida, F|Adams, Roberta H, RH|Bollard, Catherine, C|Keller, Michael D, MD','2018-05-17 22:46:19','2018-05-17 22:46:19'),(32,4,29753112,'1934-1563','Patients with chronic spinal pain benefit from pain neuroscience education regardless the self-reported signs of central sensitization: secondary analysis of a randomized controlled multicentre trial.','Pain neuroscience education is effective in chronic pain management. Central sensitization (i.e. generalized hypersensitivity) is often explained as underlying mechanism for chronic pain, because of its clinical relevance and influence on pain severity, prognosis, and treatment outcome.To examine whether patients with more or fewer symptoms of central sensitization respond differently to pain neuroscience education.A secondary analysis of a multicentre, triple-blind randomized controlled trial SETTING: University hospital Ghent and University Hospital Brussels, Belgium.120 persons with chronic spinal pain with high or low self-reported symptoms of central sensitization INTERVENTIONS: Pain neuroscience education or neck/back school. Both interventions were delivered in three sessions: one group session, one online session and one individual session.disability (primary), pain catastrophizing, kinesiophobia, illness perceptions and hypervigilance.Pain disability did not change in any group (p=.242). Regarding secondary outcomes: significant interaction effects were found for pain catastrophizing (p-values: p=.02 to p=.05), kinesiophobia (p=.02), and several aspects of illness perceptions (chronicity: p=.002; negative consequences: p=.02; personal control: p=.02; and cyclicity: p=.02). Bonferroni post-hoc analysis showed that only the pain neuroscience education group showed a significant improvement regarding kinesiophobia (p<.001, medium effect sizes), perceived negative consequence (p=.004 and p<.001, small to medium effect sizes) and perceived cyclicity of the illness (p=.01 and p=.01, small effect sizes).Pain neuroscience education is useful in all patients with chronic spinal pain as it improves kinesiophobia and the perceived negative consequences and cyclicity of the illness regardless the self-reported signs of central sensitization. Regarding pain catastrophizing, pain neuroscience education is more effective in patients with high self-reported symptoms of central sensitization.Therapy, Level I.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-12 00:00:00',0,0,'Malfliet, Anneleen, A|Kregel, Jeroen, J|Meeus, Mira, M|Danneels, Lieven, L|Cagnie, Barbara, B|Roussel, Nathalie, N|Nijs, Jo, J','2018-05-17 22:46:19','2018-05-17 22:46:19'),(33,4,29753054,'1097-6787','Psoriatic patients with chronic viral hepatitis do not have an increased risk of liver cirrhosis despite long-term methotrexate use: real-world data from a nationwide cohort study in Taiwan.','Methotrexate (MTX) is commonly used in the treatment of patients with moderate to severe psoriasis.We conducted a nationwide population-based cohort study to investigate the impact of long-term MTX use on the risk of chronic viral hepatitis-related cirrhosis among psoriatic patients in Taiwan.This study obtained data from the National Health Insurance Research Database in Taiwan. We identified 2417 psoriatic patients with chronic hepatitis B (CHB) (370 MTX users and 2047 MTX non-users) and 1127 psoriatic patients with chronic hepatitis C (CHC) (174 MTX users and 953 MTX non-users) from January 1, 2000 to December 31, 2010.After a mean follow-up of more than 9 years since the diagnosis of chronic viral hepatitis, a total of 125 (5%) CHB patients and 120 (11%) CHC patients developed liver cirrhosis. A comparable proportion of MTX users and MTX non-users developed liver cirrhosis (4% vs. 5% in CHB patients and 11% and vs. 11% in CHC patients, both p < 0.05).There is possibly selection bias and medication nonadherence.Our real-world data show that long-term MTX use may not be associated with an increased risk of liver cirrhosis among psoriatic patients with chronic viral hepatitis.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-12 00:00:00',0,0,'Tang, Kuo-Tung, KT|Chen, Yi-Ming, YM|Chang, Shih-Ni, SN|Lin, Ching-Heng, CH|Chen, Der-Yuan, DY','2018-05-17 22:46:19','2018-05-17 22:46:19'),(34,4,29753042,'1879-0712','Application of E75 peptide vaccine in breast cancer patients: a systematic review and meta-analysis.','The E75 peptide vaccine, derived from tumor-associated antigen HER2, is the most frequently studied anti-HER2 vaccination strategy for the treatment of breast cancer patients. It has been investigated in the several phases Ι/Π of the clinical trials and is currently being evaluated in a randomized multicenter phase III clinical trial. We conducted a systematic review and meta-analysis to clarify the outcomes of the E75 peptide vaccine including the therapeutic efficacy, the disease recurrence, the survival rate, and the side effects. Three peer-reviewed literature databases including the PubMed, Web of Science, and Scopus were sought. Of 29 trials assessed for eligibility, 16 were considered based on our inclusion criteria. Statistical analyses were performed by The Excel and STATA v.11.0. Meta-analysis of delayed-type hypersensitivity)DTH( reactions and CD8-T cell levels, as immune responses, displayed the significant differences in the vaccinated groups compared to their non-vaccinated counterparts. In addition, the recurrence, and the overall and the disease-free survival were significantly different in the vaccinated subjects versus the control. Evaluation of the local and systemic toxicity of the E75 peptide vaccine demonstrated the minimal side effects. It seems that the E75 peptide vaccine is safe and effective, and can be used for further randomized clinical trials.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-12 00:00:00',0,0,'Chamani, Reyhane, R|Ranji, Peyman, P|Hadji, Maryam, M|Nahvijou, Azin, A|Esmati, Ebrahim, E|Alizadeh, Ali Mohammad, AM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(35,4,29753036,'2213-2201','Explaining the amount and consistency of medical care and self-management support in asthma: a survey of primary care providers in France and the United Kingdom.','The quality of asthma primary care may vary between countries, health care practices, and health care professionals (HCPs). Identifying and explaining such differences is critical for health services improvement.To examine the quality of asthma primary care in France and United Kingdom, and identify within-country and between-country predictors amenable to intervention.An online questionnaire to capture asthma medical care and self-management support, practice characteristics, and psychosocial determinants, was completed by 276 HCPs. Mokken Scaling analyses were used to examine item structure and consistency. Hierarchical regression analyses were used to identify predictors of the amount (number of asthma care activities HCPs delivered) and consistency (the degree to which HCPs deliver similar care) of asthma medical care and self-management support.On average, HCPs reported delivering 74,2% of guideline-recommended care. Consistency of medical care and self-management support was lower among HCPs delivering a lower amount of care (r=.58 and r=.57, p<.001). UK HCPs provided more and more consistent asthma self-management support -but not medical care- than French HCPs, which was explained by the presence of practice nurses in the UK. More training, positive social norms, and higher behavioural control explained better quality of care across all HCPs.Using carefully-developed questionnaires and advanced psychometric analyses, this study suggests that involving practice nurses, making social expectations visible, and providing more training to enhance skills and confidence in asthma care delivery could enhance the amount and consistency of asthma primary care. This needs to be corroborated in a future intervention trial.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-12 00:00:00',0,0,'de Bruin, Marijn, M|Dima, Alexandra L, AL|Texier, Nathalie, N|van Ganse, Eric, E|ASTRO-LAB group','2018-05-17 22:46:19','2018-05-17 22:46:19'),(36,4,29753035,'2213-2201','Safety of multi-dose immunotherapy vials after routine use.','No abstract found.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-12 00:00:00',0,0,'Nath, Priya, P|Freiler, John, J|Gomez, Robert Anthony, RA','2018-05-17 22:46:19','2018-05-17 22:46:19'),(37,4,29753033,'1097-6825','Nemolizumab in moderate-to-severe atopic dermatitis: Randomized, phase II, long-term extension study.','Nemolizumab, an anti-interleukin-31 receptor A monoclonal antibody, improved pruritus, dermatitis, and sleep in adults with moderate-to-severe atopic dermatitis inadequately controlled by topical treatments in a phase II, 12-week, randomized, double-blind, placebo-controlled study (Part A) (NCT01986933).To assess long-term efficacy and safety of nemolizumab injected subcutaneously every 4 weeks (Q4W) or every 8 weeks (Q8W) in a 52-week double-blind extension (Part B).During Part B, patients continued previous nemolizumab dose (0.1, 0.5, or 2.0 mg/kg Q4W or 2.0 mg/kg Q8W). Part B endpoints included percentage improvement from baseline in pruritus visual analogue scale (VAS) and dermatitis scores (including Eczema Area and Severity Index [EASI]).Overall, 216/264 patients completed Part A and 191 entered Part B; 131 completed Part B. In 153 patients randomized to nemolizumab in Part A, improvement from baseline in pruritus VAS was maintained/increased from Week 12 to 64, with greatest improvement in the 0.5-mg/kg Q4W group (percentage change from baseline at Week 64: -73.0, -89.6, -74.7, and -79.1 in the 0.1-, 0.5-, and 2.0-mg/kg Q4W and 2.0-mg/kg Q8W groups, respectively). Improvement from baseline in dermatitis scores was also maintained/increased to Week 64 (percent change in EASI score: -68.5, -75.8, -78.9, and -69.3 in the 0.1-, 0.5-, and 2.0-mg/kg Q4W and 2.0-mg/kg Q8W groups, respectively). Over 64 weeks, 83-89% had ≥1 adverse event, with no new safety concerns identified.Nemolizumab for up to 64 weeks was efficacious and, overall, well tolerated in patients with moderate-to-severe atopic dermatitis inadequately controlled by topical therapy.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-12 00:00:00',0,0,'Kabashima, Kenji, K|Furue, Masutaka, M|Hanifin, Jon M, JM|Pulka, Grazyna, G|Wollenberg, Andreas, A|Galus, Ryszard, R|Etoh, Takafumi, T|Mihara, Ryosuke, R|Nakano, Miwa, M|Ruzicka, Thomas, T','2018-05-17 22:46:19','2018-05-17 22:46:19'),(38,4,29753021,'1752-9867','The Antagonistic Action of Abscisic Acid and Cytokinin Signaling Mediates Drought Stress Response in Arabidopsis.','As sessile organisms, plants encounter a variety of environmental stresses and must optimize their growth for survival. Abscisic acid (ABA) and cytokinin antagonistically regulate many developmental processes and environmental stress responses in plants. However, the molecular mechanism underlying the antagonism remains poorly defined. In this study, we demonstrated that Sucrose nonfermenting1-related kinases SnRK2.2/2.3/2.6, the key kinases of ABA signaling pathway, directly interacted with and phosphorylated type-A response regulator 5 (ARR5), a negative regulator in cytokinin signaling. The phosphorylation of ARR5 at Ser residues by SnRK2s enhanced ARR5 protein stability. Accordingly, overexpression of ARR5 showed ABA hypersensitivity and drought tolerance, which could not be recapitulated by mimic non-phosphorylated ARR5. Moreover, type-B ARR1, 11, and 12 physically interacted with SnRK2s and repressed the kinase activity of SnRK2.6. The arr1,11,12 triple mutant exhibited hypersensitivity to ABA. Genetic analysis demonstrated that SnRK2s act upstream of ARR5 and downstream of ARR1,11,12 in mediating ABA response and drought tolerance. Together, this study unravels the antagonistic action underlying ABA and cytokinin signaling pathways, thus providing insights into how plants coordinate growth and stress response by integrating multiple hormone pathways under drought stress.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-12 00:00:00',0,0,'Huang, Xiaozhen, X|Hou, Lingyan, L|Meng, Jingjing, J|You, Huiwen, H|Li, Zhen, Z|Gong, Zhizhong, Z|Yang, Shuhua, S|Shi, Yiting, Y','2018-05-17 22:46:19','2018-05-17 22:46:19'),(39,4,29752758,'1365-2222','Src-type tyrosine kinase p56lck is critical for thymic stromal lymphopoietin-induced allergic rhinitis.','Thymic stromal lymphopoietin (TSLP) is a regulator of mast cell-mediated allergic inflammatory reactions, but the manner in which TSLP contributes to allergic rhinitis (AR) remains unclear.Here we sought to determine that TSLP plays a crucial role in AR by interacting with Src-type tyrosine kinase p56lck and STAT6 and promoting mast cells degranulation.The effects of TSLP on mast cell degranulation and AR were analyzed in human mast cell line (HMC-1 cells), ovalbumin (OVA)-induced AR animal model, and human subjects. Small interfering RNA experiments were performed in HMC-1 cells and OVA-induced AR model. Immune responses were analyzed by enzyme-linked immunosorbent assay, Western blotting, immunoprecipitation, and histological studies.TSLP levels and mast cell-derived p56lck activation were elevated in human subjects with AR, and in AR mice, exogenous TSLP accelerated TH2-allergic inflammatory reactions by up-regulating p56lck and STAT6. On the other hand, depletion of TSLP, p56lck, and STAT6 ameliorated clinical symptoms in AR mice. The selective inhibitor of p56lck, damnacanthal inhibits AR reactions.Collectively, these observations suggest a role for TSLP/p56lck/STAT6 in AR and offer insight of potential therapeutic strategies. This article is protected by copyright. All rights reserved.','2018-05-12 00:00:00','2018-05-12 00:00:00','2018-05-12 00:00:00',0,0,'Nam, Sun-Young, SY|Kim, Hee-Yun, HY|Han, Na-Ra, NR|Moon, Phil-Dong, PD|Cho, Joong-Saeng, JS|Kim, Hyung-Min, HM|Jeong, Hyun-Ja, HJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(40,4,29752757,'1365-2222','Subcutaneous immunotherapy suppresses Th2 inflammation and induces neutralizing antibodies but sublingual immunotherapy suppresses airway hyperresponsiveness in grass pollen mouse models for allergic asthma.','Both subcutaneous and sublingual allergen immunotherapy (SCIT and SLIT) have been shown to effectively suppress allergic manifestations upon allergen exposure, providing long term relief from symptoms in allergic disorders including allergic asthma. Clinical studies directly comparing SCIT and SLIT report a different kinetics and magnitude of immunological changes induced during treatment. Comparative studies into the mechanisms underlying immune suppression in SCIT and SLIT are lacking.We aimed to establish an experimental model for grass pollen (GP) SCIT and SLIT that would allow a head-to-head comparison of the two treatments.Balb/c mice were sensitized with GP-extract, followed by SCIT and SLIT treatments with various GP dosages. Subsequently, we challenged mice with GP and measured airway responsiveness (AHR), GP-specific immunoglobulins, ear-swelling tests (EST), eosinophilic inflammation in broncho-alveolar lavage fluid (BALF) and T-cell cytokine release after re-stimulation of lung cells (IL-5, -10, and -13).We find that SLIT treatment was able to suppress allergen-induced AHR, while allergic inflammation was not effectively suppressed even at the highest GP dose in this model. In contrast, SCIT treatment induced higher levels of GP-specific IgG1, while SLIT was superior in inducing a GP-specific IgG2a response, which was associated with increased Th1 activity in lung tissue after SLIT, but not SCIT treatment. Interestingly, SCIT was able to suppress Th2-type cytokine production in lung cell suspensions, while SLIT failed to do so.In conclusion, GP-SCIT suppresses Th2 inflammation and induced neutralizing antibodies, while GP-SLIT suppresses the clinically relevant lung function parameters in an asthma mouse model, indicating that the two application routes depend on partially divergent mechanisms of tolerance induction. Interestingly, these data mirror observations in clinical studies, underscoring the translational value of these mouse models. This article is protected by copyright. All rights reserved.','2018-05-12 00:00:00','2018-05-12 00:00:00','2018-05-12 00:00:00',0,0,'Hesse, Laura, L|Brouwer, Uilke, U|Petersen, Arjen H, AH|Gras, Renée, R|Bosman, Lisette, L|Brimnes, Jens, J|Oude Elberink, Joanne N G, JNG|van Oosterhout, Antoon J M, AJM|Nawijn, Martijn C, MC','2018-05-17 22:46:19','2018-05-17 22:46:19'),(41,5,29693241,'1399-0004','Identification of 4 novel mutations of androgen receptor gene in 8 Chinese families with complete androgen insensitivity syndrome.','No abstract found.','2018-04-25 00:00:00','2018-04-25 00:00:00','2018-04-25 00:00:00',0,0,'Wu, Q, Q|Wang, C, C|Shi, H, H|Mei, S, S|Liu, L, L|Xin, Y, Y|Kong, X, X','2018-05-17 22:46:19','2018-05-17 22:46:19'),(42,5,29615040,'1477-7525','Multicentre cross-sectional clinical evaluation study about quality of life in adults with disorders/differences of sex development (DSD) compared to country specific reference populations (dsd-LIFE).','Previous studies in quality of life (QOL) in individuals with disorders/differences of sex development (DSD) have been restricted to subpopulations of the condition. We describe QOL in adult persons with DSD compared to country specific references and assess the impact of diagnosis.The multicentre cross-sectional clinical evaluation (dsd-LIFE) took place in 14 specialized clinics in six European countries. Adolescents (≥16 years) and adults having a DSD condition were included from 02/2014 to 09/2015. The main outcome QOL was measured by the WHOQOL-BREF (domains of physical health, psychological, social relationships, and environment). QOL was compared to country specific reference populations by using unpaired t-tests. Linear regression models explained the additional variance of the diagnosis on QOL.Three hundred one individuals with Turner Syndrome, 219 with Klinefelter Syndrome (including XYY), 226 with 46,XX CAH and 294 with rare DSD conditions (gonadal dysgenesis, androgen insensitivity syndrome, severe hypospadias, and androgen synthesis errors or other diagnosis) took part. Compared to healthy European populations, QOL was similar in psychological, slightly worse in physical health, and slightly better in environment. In social relationships, QOL was significantly poorer compared to healthy and non-healthy reference populations. In linear regression models health status was the most important predictor of QOL; additional variance was explained by feelings about household\'s income in all domains, and the relationship status in social relationships. Diagnosis explained nearly no additional variance.Except for social relationships, most people with DSD adapt well to their life circumstances and report a good QOL. Not diagnosis, but the individual\'s health status is much more important than previously thought. Therefore care for people with DSD should focus more on chronic physical or mental health problems both related and unrelated to the diagnosis itself.German Clinical Trials Register DRKS00006072 .','2018-04-03 00:00:00','2018-04-03 00:00:00','2018-04-11 00:00:00',0,0,'Rapp, Marion, M|Mueller-Godeffroy, Esther, E|Lee, Peter, P|Roehle, Robert, R|Kreukels, Baudewijntje P C, BPC|Köhler, Birgit, B|Nordenström, Anna, A|Bouvattier, Claire, C|Thyen, Ute, U|dsd-LIFE group','2018-05-17 22:46:19','2018-05-17 22:46:19'),(43,5,29398092,'1873-3360','Prenatal testosterone and theory of mind development: Findings from disorders of sex development.','Women on average perform better than men on the \"Reading the Mind in the Eyes\" test (RMET) which is a measure of Theory of Mind (ToM). The aim of this study was to assess whether these sex differences are influenced by differences in prenatal testosterone levels through a study on individuals with Disorders of Sex Development and matched controls. ToM performance was examined using the RMET in female-assigned-at-birth individuals with increased prenatal testosterone exposure (Congenital Adrenal Hyperplasia (CAH) and 5-alpha Reductase type-2 Deficiency (5α-RD-2)), female-assigned-at-birth individuals with testosterone insensitivity (Complete Androgen Insensitivity Syndrome (CAIS)), and their age-matched unaffected male and female relatives. A total number of 158 individuals participated in the study; 19 with 5α-RD-2, 17 with CAH, 18 women with CAIS, 52 matched unaffected men and 52 matched unaffected women. All subgroups were around 20 years of age. Women with CAH scored significantly lower on RMET than control women and CAIS individuals. CAIS individuals scored significantly higher than control men and participants with 5α-RD. Statistically, CAIS individuals\' performance on RMET was similar to control women\'s, women with CAH did not differ significantly from control men and 5α-RD-2 individuals scored significantly lower than control men. These results, which are in line with previous theories, illustrate that performance on the RMET, as an index of ToM, may be influenced by variations in prenatal androgens levels.','2018-03-01 00:00:00','2017-12-14 00:00:00','2018-03-31 00:00:00',0,0,'Khorashad, Behzad S, BS|Khazai, Behnaz, B|Roshan, Ghasem M, GM|Hiradfar, Mehran, M|Afkhamizadeh, Mozhgan, M|van de Grift, Tim C, TC','2018-05-17 22:46:19','2018-05-17 22:46:19'),(44,5,29396419,'2045-2322','Partial androgen insensitivity syndrome caused by a deep intronic mutation creating an alternative splice acceptor site of the AR gene.','Although partial androgen insensitivity syndrome (PAIS) is caused by attenuated responsiveness to androgens, androgen receptor gene (AR) mutations on the coding regions and their splice sites have been identified only in <25% of patients with a diagnosis of PAIS. We performed extensive molecular studies including whole exome sequencing in a Japanese family with PAIS, identifying a deep intronic variant beyond the branch site at intron 6 of AR (NM_000044.4:c.2450-42 G > A). This variant created the splice acceptor motif that was accompanied by pyrimidine-rich sequence and two candidate branch sites. Consistent with this, reverse transcriptase (RT)-PCR experiments for cycloheximide-treated lymphoblastoid cell lines revealed a relatively large amount of aberrant mRNA produced by the newly created splice acceptor site and a relatively small amount of wildtype mRNA produced by the normal splice acceptor site. Furthermore, most of the aberrant mRNA was shown to undergo nonsense mediated decay (NMD) and, if a small amount of aberrant mRNA may have escaped NMD, such mRNA was predicted to generate a truncated AR protein missing some functional domains. These findings imply that the deep intronic mutation creating an alternative splice acceptor site resulted in the production of a relatively small amount of wildtype AR mRNA, leading to PAIS.','2018-02-02 00:00:00','2018-02-02 00:00:00','2018-02-14 00:00:00',0,0,'Ono, Hiroyuki, H|Saitsu, Hirotomo, H|Horikawa, Reiko, R|Nakashima, Shinichi, S|Ohkubo, Yumiko, Y|Yanagi, Kumiko, K|Nakabayashi, Kazuhiko, K|Fukami, Maki, M|Fujisawa, Yasuko, Y|Ogata, Tsutomu, T','2018-05-17 22:46:19','2018-05-17 22:46:19'),(45,5,29393262,'1661-5433','Androgen Insensitivity Syndrome at Prepuberty: Marked Loss of Spermatogonial Cells at Early Childhood and Presence of Gonocytes up to Puberty.','Androgen insensitivity syndrome (AIS) is a hereditary condition in patients with a 46,XY karyotype in which loss-of-function mutations of the androgen receptor (AR) gene are responsible for defects in virilization. The aim of this study was to investigate the consequences of the lack of AR activity on germ cell survival and the degree of testicular development reached by these patients by analyzing gonadal tissue from patients with AIS prior to Sertoli cell maturation at puberty. Twenty-three gonads from 13 patients with AIS were assessed and compared to 18 testes from 17 subjects without endocrine disorders. The study of the gonadal structure using conventional microscopy and the ultrastructural characteristics of remnant germ cells using electron microscopy, combined with the immunohistochemical analysis of specific germ cell markers (MAGE-A4 for premeiotic germ cells and of OCT3/4 for gonocytes), enabled us to carry out a thorough investigation of germ cell life in an androgen-insensitive microenvironment throughout prepuberty until young adulthood. Here, we show that germ cell degeneration starts very early, with a marked decrease in number after only 2 years of life, and we demonstrate the permanence of gonocytes in AIS testis samples until puberty, describing 2 different populations. Additionally, our results provide further evidence for the importance of AR signaling in peritubular myoid cells during prepuberty to maintain Sertoli and spermatogonial cell health and survival.','2018-05-17 00:00:00','2018-01-24 00:00:00','2018-02-27 00:00:00',0,0,'Aliberti, Paula, P|Perez Garrido, Natalia, N|Marino, Roxana, R|Ramirez, Pablo, P|Solari, Alberto J, AJ|Sciurano, Roberta, R|Costanzo, Mariana, M|Guercio, Gabriela, G|Warman, Diana Mónica, DM|Bailez, Marcela, M|Baquedano, María Sonia, MS|Rivarola, Marco A, MA|Belgorosky, Alicia, A|Berensztein, Esperanza, E','2018-05-17 22:46:19','2018-05-17 22:46:19'),(46,5,29388223,'1365-2230','Aberrant breast tissue in complete androgen insensitivity syndrome.','No abstract found.','2018-06-01 00:00:00','2018-02-01 00:00:00','2018-05-09 00:00:00',0,0,'Nazzaro, G, G|Genovese, G, G|Brena, M, M|Passoni, E, E|Tadini, G, G','2018-05-17 22:46:19','2018-05-17 22:46:19'),(47,5,29386228,'2049-3614','Disorders of sex development: a study of 194 cases.','To study the clinical proﬁle and the management of patients with disorders of sex development (DSD).Retrospective study from a tertiary care hospital of North India.One hundred ninety-four patients of DSD registered in the Endocrine clinic of Postgraduate Institute of Medical Education and Research, Chandigarh between 1995 and 2014 were included.One hundred and two patients (52.5%) had 46,XY DSD and seventy-four patients (38.1%) had 46,XX DSD. Sex chromosome DSD was identified in seven (3.6%) patients. Of 102 patients with 46,XY DSD, 32 (31.4%) had androgen insensitivity syndrome and 26 (25.5%) had androgen biosynthetic defect. Of the 74 patients with 46,XX DSD, 52 (70.27%) had congenital adrenal hyperplasia (CAH) and eight (10.8%) had ovotesticular DSD. Five patients with sex chromosome DSD had mixed gonadal dysgenesis. Excluding CAH, majority of the patients (90%) presented in the post-pubertal period. One-fourth of the patients with simple virilising CAH were reared as males because of strong male gender identity and behaviour and firm insistence by the parents. Corrective surgeries were performed in twenty patients (20%) of 46,XY DSD without hormonal evaluation prior to the presentation.Congenital adrenal hyperplasia is the most common DSD in the present series. Most common XY DSD is androgen insensitivity syndrome, while CAH is the most common XX DSD. Delayed diagnosis is a common feature, and corrective surgeries are performed without seeking a definite diagnosis.','2018-02-01 00:00:00','2018-01-31 00:00:00','2018-03-02 00:00:00',0,0,'Walia, R, R|Singla, M, M|Vaiphei, K, K|Kumar, S, S|Bhansali, A, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(48,5,29306929,'2191-0251','Comparison between two inhibin B ELISA assays in 46,XY testicular disorders of sex development (DSD) with normal testosterone secretion.','Inhibin B is a hormone produced by the Sertoli cells that can provide important information for the investigation of disorders of sex development (DSD) with 46,XY karyotype. The aim of this study is to compare two enzyme-linked immunosorbent assay (ELISA) assays for dosage of serum inhibin B in patients with 46,XY DSD with normal testosterone secretion.Twenty-nine patients with 46,XY DSD and normal testosterone secretion (partial androgen insensitivity syndrome [PAIS] [n=8]; 5α-reductase deficiency [n=7] and idiopathic 46,XY DSD [n=14]) were included. Molecular analysis of the AR and SRD5A2 genes were performed in all patients and the NR5A1 gene analysis in the idiopathic group. Measurements of inhibin B were performed by two second-generation ELISA assays (Beckman-Coulter and AnshLabs). Assays were compared using the interclass correlation coefficient (ICC) and the Bland-Altman method.ICC was 0.915 [95% confidence interval (CI): 0.828-0.959], however, a discrepancy was observed between trials, which is more evident among higher values when analyzed by the Bland-Altman method.It is recommended to perform the inhibin B measurement always using the same ELISA kit when several evaluations are required for a specific patient.','2018-01-26 00:00:00','0000-00-00 00:00:00','2018-01-31 00:00:00',0,0,'Guaragna-Filho, Guilherme, G|Calixto, Antônio Ramos, AR|De Paula, Georgette Beatriz, GB|De Oliveira, Laurione Cândido, LC|Morcillo, André Moreno, AM|De Mello, Maricilda Palandi, MP|Maciel-Guerra, Andrea Trevas, AT|Guerra-Junior, Gil, G','2018-05-17 22:46:19','2018-05-17 22:46:19'),(49,5,29294229,'1573-2800','Mental Health and Disorders of Sex Development/Intersex Conditions in Iranian Culture: Congenital Adrenal Hyperplasia, 5-α Reductase Deficiency-Type 2, and Complete Androgen Insensitivity Syndrome.','Sixty-one patients (22 patients with congenital adrenal hyperplasia [CAH] with a mean age of 14.86 years [range, 5-23], 20 patients with 5-α reductase deficiency type 2 [5α-RD-2] with a mean age of 19.5 years [range, 5-29], and 19 patients with complete androgen insensitivity syndrome [CAIS] with a mean age of 18.26 years [range, 5-28]) were evaluated using the Kiddie Schedule for Affective Disorders and Schizophrenia, the Structured Clinical Interview for DSM-IV Axis I, Axis II, and the Global Assessment Functioning Scale. All participants were female-assigned at birth. Ten patients (16.4%) transitioned to the male gender. Overall, 68% of patients had one or more lifetime Axis I disorders, including 63.6% of the CAH participants, 90% of 5α-RD-2 participants, and 52.6% of the CAIS participants. The most commonly observed were affective disorders (27.9%), gender identity disorder (27.9%), and anxiety (16.4%). Our study demonstrates that mental health of Iranian patients with DSD is at risk. This might be due to the fact that patients with DSD conditions are mostly treated medically and their mental health is often superficially addressed in developing countries such as Iran, at least in the past. We argue that it is important to pay attention to the mental health issues of patients with DSD and focus on specific issues, which may vary cross-culturally.','2018-05-01 00:00:00','2018-01-02 00:00:00','2018-04-10 00:00:00',0,0,'Khorashad, Behzad S, BS|Aghili, Zahra, Z|Kreukels, Baudewijntje P C, BPC|Reid, Alistair G, AG|Roshan, Ghasem M, GM|Hiradfar, Mehran, M|Talaei, Ali, A|Cohen Kettenis, Peggy T, PT','2018-05-17 22:46:19','2018-05-17 22:46:19'),(50,5,29278518,'2520-8721','Identification of an AR mutation in Klinefelter syndrome during evaluation for penoscrotal hypospadias.','Genital anomalies, ranging from female genitalia to milder degrees of undervirilization, are rarely reported in Klinefelter syndrome, in which a male is classically expected to be born with male external genitalia. Though androgen insensitivity syndrome (AIS) is one of the possible pathogenic mechanisms also in Klinefelter syndrome with genital anomalies, to date the AR gene has not been analyzed in any of the published cases of Klinefelter syndrome of the milder phenotype, except for those patients presenting with a severe phenotype, such as female external genitalia.Lack of interest in considering androgen insensitivity in Klinefelter syndrome with a milder phenotype of genital anomalies may impede its identification through an accurate diagnosis. We present a 14-month-old boy with penoscrotal hypospadias, micropenis, and a ventral penile chordee abnormality who was observed to have both a 47,XXY karyotype and a known missense mutation in the ARgene that was inherited from his mother. Although it is recommended that Klinefelter syndrome be considered in the differential diagnosis of penoscrotal abnormalities, mutations in specific genes involved in androgen synthesis or responsiveness should also be investigated.','2017-07-01 00:00:00','0000-00-00 00:00:00','2018-04-09 00:00:00',0,0,'Acar, Sezer, S|Tuhan, Hale, H|Bora, Elçin, E|Demir, Korcan, K|Onay, Hüseyin, H|Erçal, Derya, D|Böber, Ece, E|Abacı, Ayhan, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(51,6,29753294,'1525-5069','Prescription trends and psychiatric symptoms following first receipt of one of seven common antiepileptic drugs in general practice.','We sought to examine the risk of psychiatric symptoms associated with a first prescription for specific antiepileptic drugs (AEDs) used in monotherapy in a general cohort of patients with epilepsy. We used The Health Improvement Network database (comprising the years 2000-2012) to identify incident patients with epilepsy. The index date was that on which they met the case definition for epilepsy, and analyses only included patients who remained on monotherapy or received no AED therapy following diagnosis to avoid confounding by polytherapy. Psychiatric symptoms were defined using mental health clinical or treatment (medical or therapeutic) code. We analyzed the AED of interest as a time-varying covariate in multivariate Cox proportional hazard regression models controlling for confounding factors. We identified 9595 patients with incident epilepsy, 7400 of whom (77%) received a first-recorded AED prescription. Prescriptions for newer generation AEDs (lamotrigine and levetiracetam) steadily increased (constituting over 30% of all AED prescriptions by 2012) while valproate use significantly declined in females (~40% in 2002 to just over 20% by 2012). A total of 2190 patients were first exposed to carbamazepine (29.3%) and 222 to lamotrigine (3%), both of which were associated with a lower hazard of any coded psychiatric symptom or disorder in multivariate analyses (hazard ratio [HR]: 0.84, 95% confidence interval [95% CI]: 0.73-0.97; p = 0.02 and HR: 0.83, 95% CI: 0.70-0.99; p = 0.03, respectively, for carbamazepine and lamotrigine). Carbamazepine was also associated with a lower hazard for depression (HR: 0.81; 95% CI: 0.69-0.96; p = 0.013) and anxiety (HR: 0.77; 95% CI: 0.63-0.95; p = 0.013) in secondary analyses. This study provides evidence that carbamazepine and lamotrigine are associated with lower hazards for psychiatric symptoms following a diagnosis of epilepsy. These estimates can be used in clinical settings, and the precision should improve with more contemporary data that include larger proportions of newer generation AEDs.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-12 00:00:00',0,0,'Josephson, Colin B, CB|Engbers, Jordan D T, JDT|Jette, Nathalie, N|Patten, Scott B, SB|Sajobi, Tolulope T, TT|Marshall, Deborah, D|Lowerison, Mark, M|Wiebe, Samuel, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(52,6,29753254,'1872-7123','Posttraumatic stress disorder, depression, and suicidal ideation in veterans: Results from the mind your heart study.','Veterans with PTSD or depression are at increased risk for suicidal ideation. However, few studies have examined that risk in those with comorbid PTSD and depression, instead focusing on these disorders individually. This study investigates the association of suicidal ideation with comorbid PTSD and depression and examines the role of military and psychosocial covariates. We evaluated 746 veterans using the CAPS to assess PTSD and the PHQ-9 to measure depression and suicidal ideation. Covariates were assessed via validated self-report measures. 49% of veterans with comorbid PTSD and depression endorsed suicidal ideation, making them more likely to do so than those with depression alone (34%), PTSD alone (11%), or neither (2%). In multivariate logistic regression models, this association remained significant after controlling for demographics and symptom severity. Anger, hostility, anxiety, alcohol use, optimism and social support did not explain the elevated risk of suicidal ideation in the comorbid group in fully adjusted models. As suicidal ideation is a known risk factor for suicide attempts and completions, veterans with comorbid PTSD and depression represent a vulnerable group who may need more intensive monitoring and treatment to reduce risk of suicide.','2018-04-22 00:00:00','2018-04-22 00:00:00','2018-05-12 00:00:00',0,0,'Arenson, Melanie B, MB|Whooley, Mary A, MA|Neylan, Thomas C, TC|Maguen, Shira, S|Metzler, Thomas J, TJ|Cohen, Beth E, BE','2018-05-17 22:46:19','2018-05-17 22:46:19'),(53,6,29753050,'1878-4216','Sex-specific differences in corticosterone secretion, behavioral phenotypes and expression of TrkB.T1 and TrkB.FL receptor isoforms: Impact of systemic TrkB inhibition and combinatory stress exposure in adolescence.','Stress exposure has been implicated in the development of mood disorders, although little is known about the lasting effects of repeated stress during the adolescent period on sex-specific differences in endocrine and plasticity-signaling responses in adulthood. Using a 10-day combinatory stress paradigm (postnatal day (PND) 26 to 35), we examined sex-specific impact of adolescent stress and inhibition of tyrosine-related kinase B (TrkB) receptor (ANA-12; 0.5 mg/kg, i.p.) on 1) adolescent blood corticosterone levels, 2) adult locomotion and anxiety behavior, and 3) region-specific differences in endogenous TrkB full-length (TrkB.FL) and truncated (TrkB.T1) receptor isoforms. Blood collected on days 1, 5 and 10 revealed elevated basal and stress-induced CORT secretion in females compared to males, while ANA-12 attenuated CORT elevations post stress in both sexes. As adults, all females exhibit higher locomotor and exploratory activity than males in the open field test and elevated plus maze, and differences were comparable in the forced swim within stress-naïve and stress groups. Biochemically, vehicle-treated males showed elevated TrkB.T1 and TrkB.FL compared to vehicle-treated females in the PFC, hippocampus and NAc, and levels were consistently attenuated by ANA-12 treatment in non-stress males. With regards to stress exposure, expression of both isoforms was strongly down-regulated in the NAc of males only and was associated with increased TrkB.T1 in the PFC. ANA-12 enhanced expression in females, independent of stress exposure, compared to vehicle-treated counterparts, expression being increased for TrkB.T1 versus TrkB.FL and magnitude of the changes being region-specific. In contrast, ANA-12 effects in stressed males were restricted to inhibition of both isoforms in the hippocampus. Together, our findings support that TrkB activation, contingent on stress exposure, differentially affects TrkB isoform regulation during adulthood. Sex-specific biochemical responses at delayed intervals following adolescent stress exposure further support the need to include the sex variable in animal models.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-12 00:00:00',0,0,'Azogu, Idu, I|Liang, Jacky, J|Plamondon, Helene, H','2018-05-17 22:46:19','2018-05-17 22:46:19'),(54,6,29752662,'1573-3327','Executive Attention and Empathy-Related Responses in Boys with Oppositional Defiant Disorder or Conduct Disorder, With and Without Comorbid Anxiety Disorder.','This is a first study that investigated the relationships between executive attention-as an important aspect of emotion regulation-and state empathy and sympathy in ODD/CD boys with (N = 31) and without (N = 18) comorbid anxiety disorder (7-12 years). Empathic reactions were evoked using three sadness-inducing film clips. One clip was highly evocative involving a bear cub losing his mother, whilst two other clips were mildly evocative involving children in common childhood situations. Self-reports of empathy and sympathy were collected and executive attention was assessed with a performance task. Poor executive attention skills were associated with less empathy and sympathy, particularly in ODD/CD boys with anxiety and under conditions of a highly evocative stimulus. Our findings support the view that different mechanisms may be involved in empathy problems of ODD/CD children.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Pijper, Jarla, J|de Wied, Minet, M|van Rijn, Sophie, S|van Goozen, Stephanie, S|Swaab, Hanna, H|Meeus, Wim, W','2018-05-17 22:46:19','2018-05-17 22:46:19'),(55,6,29752303,'1526-632X','Typical features of Parkinson disease and diagnostic challenges with microdeletion 22q11.2.','To delineate the natural history, diagnosis, and treatment response of Parkinson disease (PD) in individuals with 22q11.2 deletion syndrome (22q11.2DS), and to determine if these patients differ from those with idiopathic PD.In this international observational study, we characterized the clinical and neuroimaging features of 45 individuals with 22q11.2DS and PD (mean follow-up 7.5 ± 4.1 years).22q11.2DS PD had a typical male excess (32 male, 71.1%), presentation and progression of hallmark motor symptoms, reduced striatal dopamine transporter binding with molecular imaging, and initial positive response to levodopa (93.3%). Mean age at motor symptom onset was relatively young (39.5 ± 8.5 years); 71.4% of cases had early-onset PD (<45 years). Despite having a similar age at onset, the diagnosis of PD was delayed in patients with a history of antipsychotic treatment compared with antipsychotic-naive patients (median 5 vs 1 year,  = 0.001). Preexisting psychotic disorders (24.5%) and mood or anxiety disorders (31.1%) were common, as were early dystonia (19.4%) and a history of seizures (33.3%).Major clinical characteristics and response to standard treatments appear comparable in 22q11.2DS-associated PD to those in idiopathic PD, although the average age at onset is earlier. Importantly, treatment of preexisting psychotic illness may delay diagnosis of PD in 22q11.DS patients. An index of suspicion and vigilance for complex comorbidity may assist in identifying patients to prioritize for genetic testing.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Boot, Erik, E|Butcher, Nancy J, NJ|Udow, Sean, S|Marras, Connie, C|Mok, Kin Y, KY|Kaneko, Satoshi, S|Barrett, Matthew J, MJ|Prontera, Paolo, P|Berman, Brian D, BD|Masellis, Mario, M|Dufournet, Boris, B|Nguyen, Karine, K|Charles, Perrine, P|Mutez, Eugénie, E|Danaila, Teodor, T|Jacquette, Aurélia, A|Colin, Olivier, O|Drapier, Sophie, S|Borg, Michel, M|Fiksinski, Ania M, AM|Vergaelen, Elfi, E|Swillen, Ann, A|Vogels, Annick, A|Plate, Annika, A|Perandones, Claudia, C|Gasser, Thomas, T|Clerinx, Kristi','2018-05-17 22:46:19','2018-05-17 22:46:19'),(56,6,29751819,'1745-6215','Mindfulness as a complementary intervention in the treatment of overweight and obesity in primary health care: study protocol for a randomised controlled trial.','Mindfulness has been applied in the United States and Europe to improve physical and psychological health; however, little is known about its feasibility and efficacy in a Brazilian population. Mindfulness may also be relevant in tackling obesity and eating disorders by decreasing binge eating episodes-partly responsible for weight regain for a large number of people-and increasing awareness of emotional and other triggers for overeating. The aim of the present study protocol is to evaluate and compare the feasibility and efficacy of two mindfulness-based interventions (MBIs) addressing overweight and obesity in primary care patients: a general programme called Mindfulness-Based Health Promotion and a targeted mindful eating protocol called Mindfulness-Based Eating Awareness Training.A randomised controlled trial will be conducted to compare treatment as usual separately in primary care with both programmes (health promotion and mindful eating) added to treatment as usual. Two hundred forty adult women with overweight and obesity will be enrolled. The primary outcome will be an assessment of improvement in eating behaviour. Secondary outcomes will be (1) biochemical control; (2) anthropometric parameters, body composition, dietary intake and basal metabolism; and (3) levels of mindfulness, stress, depression, self-compassion and anxiety. At the end of each intervention, a focus group will be held to assess the programme\'s impact on the participants\' lives, diet and health. A feasibility study on access to benefits from and importance of MBIs at primary care facilities will be conducted among primary care health care professionals and participants. Monthly maintenance sessions lasting at least 1 hour will be offered, according to each protocol, during the 3-month follow-up periods.This clinical trial will result in more effective mindfulness-based interventions as a complementary treatment in primary care for people with overweight and obesity. If the findings of this study confirm the effectiveness of mindfulness programmes in this population, it will be possible to improve quality of life and health while optimising public resources and reaching a greater number of people. In addition, on the basis of the evaluation of the feasibility of implementing this intervention in primary care facilities, we expect to be able to suggest the intervention for incorporation into public policy.ClinicalTrials.gov, NCT02893150 . Registered retrospectively on 30 March 2017.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Salvo, Vera, V|Kristeller, Jean, J|Marin, Jesus Montero, JM|Sanudo, Adriana, A|Lourenço, Bárbara Hatzlhoffer, BH|Schveitzer, Mariana Cabral, MC|D\'Almeida, Vania, V|Morillo, Héctor, H|Gimeno, Suely Godoy Agostinho, SGA|Garcia-Campayo, Javier, J|Demarzo, Marcelo, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(57,6,29751598,'2076-3425','Informed Consent Decision-Making in Deep Brain Stimulation.','Deep brain stimulation (DBS) has proved useful for several movement disorders (Parkinson&rsquo;s disease, essential tremor, dystonia), in which first and/or second line pharmacological treatments were inefficacious. Initial evidence of DBS efficacy exists for refractory obsessive-compulsive disorder, treatment-resistant major depressive disorder, and impulse control disorders. Ethical concerns have been raised about the use of an invasive surgical approach involving the central nervous system in patients with possible impairment in cognitive functioning and decision-making capacity. Most of the disorders in which DBS has been used might present with alterations in memory, attention, and executive functioning, which may have an impact on the mental capacity to give informed consent to neurosurgery. Depression, anxiety, and compulsivity are also common in DBS candidate disorders, and could also be associated with an impaired capacity to consent to treatment or clinical research. Despite these issues, there is limited empirical knowledge on the decision-making levels of these patients. The possible informed consent issues of DBS will be discussed by focusing on the specific treatable diseases.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Mandarelli, Gabriele, G|Moretti, Germana, G|Pasquini, Massimo, M|Nicolò, Giuseppe, G|Ferracuti, Stefano, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(58,6,29751240,'1573-2517','Temperament clusters associate with anxiety disorder comorbidity in depression.','Individual temperament is associated with psychiatric morbidity and could explain differences in psychiatric comorbidities. We investigated the association of temperament profile clusters with anxiety disorder comorbidity in patients with depression.We assessed the temperament of 204 specialized care-treated depressed patients with the Temperament and Character Inventory (TCI-R) and their diagnoses with the Mini International Neuropsychiatric Interview. Two-step cluster analysis was used for defining patients\' temperament profiles and logistic regression analysis was used for predicting different anxiety disorders for various temperament profiles.Four temperament clusters were found: 1) Novelty seekers with highest Novelty Seeking scores (n = 56),2) Persistent with highest Persistence scores (n = 36), 3) Reserved with lowest Novelty Seeking scores (n = 66) and 4) Wearied with highest Harm avoidance, lowest Reward Dependence and lowest Persistence scores (n = 58). After adjusting for clinical variables, panic disorder and/or agoraphobia were predicted by Novelty seekers\' temperament profile with odds ratio [OR] = 3.5 (95% confidence interval [CI] = 1.8 - 6.9, p < 0.001), social anxiety disorder was predicted by Wearied temperament profile with OR = 3.4 (95% CI = 1.6 - 7.5, p = 0.002), and generalized anxiety disorder was predicted by Reserved temperament profile with OR = 2.6 (95% CI = 1.2 - 5.3, p = 0.01).The patients\' temperament profiles were assessed while displaying depressive symptoms, which may have affected results.Temperament clusters with unique dimensional profiles were specifically associated with different anxiety disorders in this study. These results suggest that TCI-R could offer a valuable dimensional method for predicting the risk of anxiety disorders in diverse depressed patients.','2018-04-23 00:00:00','2018-04-23 00:00:00','2018-05-11 00:00:00',0,0,'Paavonen, Vesa, V|Luoto, Kaisa, K|Lassila, Antero, A|Leinonen, Esa, E|Kampman, Olli, O','2018-05-17 22:46:19','2018-05-17 22:46:19'),(59,6,29751238,'1573-2517','Prevalence of anxiety and depressive disorders among youth with intellectual disabilities: A systematic review and meta-analysis.','The purpose of this meta-analytic study was to determine the pooled prevalence estimates of anxiety and depressive disorders among children and adolescents with intellectual disabilities (ID) and to assess the extent to which these pooled prevalence rates differed according to studies\' characteristics.A systematic literature search was performed in nine databases and 21 studies, published between 1975 and 2015, met the inclusion criteria.The resulting pooled prevalence estimates of combined subtypes of anxiety and depressive disorders were respectively (a) 5.4% and 2.8% across samples; (b) 1.2% and 0.03% among children; and (c) 7.9% and 1.4% among adolescents. Pooled prevalence estimates for specific subtypes of anxiety disorders ranged from (a) 0.2% to 11.5% across samples; (b) 0.7% to 17.6% among children; and (c) 0.6% to 19.8% among adolescents. Pooled prevalence estimates of dysthymic disorder and major depressive disorder were respectively (a) 3.4% and 2.5% across samples; (b) 2.1% and 3.2% among children; and (c) 6.9% and 5.7% among adolescents. Finally, subgroup analyses showed significant variations in the pooled prevalence estimates of combined subtypes of anxiety disorders, obsessive-compulsive disorder, and generalized anxiety disorder; and combined subtypes of depressive disorders.The present findings of this meta-analysis should be interpreted with caution given several limitations related to the characteristics of the populations, diagnostic method and sampling method.Findings provide recommendations for future studies investigating psychological disorders among youth with ID, as well as how clinicians and policy makers can improve diagnostic practices and support for youth with ID.','2018-04-06 00:00:00','2018-04-06 00:00:00','2018-05-11 00:00:00',0,0,'Maïano, Christophe, C|Coutu, Sylvain, S|Tracey, Danielle, D|Bouchard, Stéphane, S|Lepage, Geneviève, G|Morin, Alexandre J S, AJS|Moullec, Grégory, G','2018-05-17 22:46:19','2018-05-17 22:46:19'),(60,6,29751168,'1872-7123','Subjective cognitive function in hoarding disorder.','The aim of the present study was to examine subjective cognitive impairment among adult patients with hoarding disorder (HD). Eighty-three patients with HD and 46 age- and gender-matched healthy control (HC) participants received a diagnostic interview and completed measures of subjective cognitive functioning and motivations for saving behavior, as well as measures of hoarding severity, depression, anxiety, stress, and obsessive-compulsive disorder (OCD) symptoms. The HD group reported more impairment than did the HC group in domains of memory, distractibility, blunders, memory for names, and inattention. These differences generally remained significant when controlling for comorbid symptoms. In the HD group, the degree of cognitive impairment was significantly correlated with severity of saving and acquiring behaviors, although results were attenuated when controlling for comorbid symptoms (overall HD severity, but not saving behavior specifically, remained significantly correlated with cognitive impairment). Subjective cognitive impairment was further associated with a desire to save possessions in order to avoid forgetting, and these results remained significant when controlling for comorbid symptoms. These results comport with current behavioral models of HD that emphasize decision-making deficits, as well as clinician observations suggestive of impaired cognitive function, and complement a growing body of neuropsychological testing studies.','2018-05-04 00:00:00','2018-05-04 00:00:00','2018-05-11 00:00:00',0,0,'Tolin, David F, DF|Hallion, Lauren S, LS|Wootton, Bethany M, BM|Levy, Hannah C, HC|Billingsley, Amber L, AL|Das, Akanksha, A|Katz, Benjamin W, BW|Stevens, Michael C, MC','2018-05-17 22:46:19','2018-05-17 22:46:19'),(61,7,29726775,'1933-0693','Parietal association deficits in patients harboring parietal lobe gliomas: a prospective study.','OBJECTIVE Although the parietal lobe is a common site for glioma formation, current literature is scarce, consists of retrospective studies, and lacks consistency with regard to the incidence, nature, and severity of parietal association deficits (PADs). The aim of this study was to assess the characteristics and incidence of PADs in patients suffering from parietal lobe gliomas through a prospective study and a battery of comprehensive neuropsychological tests. METHODS Between 2012 and 2016 the authors recruited 38 patients with glioma confined in the parietal lobe. Patients were examined for primary and secondary association deficits with a dedicated battery of neuropsychological tests. The PADs were grouped into 5 categories: visuospatial attention, gnosis, praxis, upper-limb coordination, and language. For descriptive analysis tumors were divided into high- and low-grade gliomas and also according to patient age and tumor size. RESULTS Parietal association deficits were elicited in 80% of patients, thus being more common than primary deficits (50%). Apraxia was the most common PAD (47.4%), followed by anomic aphasia and subcomponents of Gerstmann\'s syndrome (34.2% each). Other deficits such as hemineglect, stereoagnosia, extinction, and visuomotor ataxia were also detected, albeit at lower rates. There was a statistically nonsignificant difference between PADs and sex (72.2% males, 85% females) and age (77.8% at ≤ 60 years, 80% at age > 60 years), but a statistically significant difference between the > 4 cm and the ≤ 4 cm diameter group (p = 0.02, 94.7% vs 63.2%, respectively). There was a tendency (p = 0.094) for low-grade gliomas to present with fewer PADs (50%) than high-grade gliomas (85.7%). Tumor laterality showed a strong correlation with hemineglect (p = 0.004, predilection for right hemisphere), anomia (p = 0.001), and Gerstmann\'s symptoms (p = 0.01); the last 2 deficits showed a left (dominant) hemispheric preponderance. CONCLUSIONS This is the first study to prospectively evaluate the incidence and nature of PADs in patients with parietal gliomas. It could be that the current literature may have underestimated the true incidence of deficits. Dedicated neuropsychological examination detects a high frequency of PADs, the most common being apraxia, followed by anomia and subcomponents of Gerstmann\'s syndrome. Nevertheless, a direct correlation between the clinical deficit and its anatomical substrate is only possible to a limited extent, highlighting the need for intraoperative cortical and subcortical functional mapping.','2018-05-04 00:00:00','2018-05-04 00:00:00','2018-05-04 00:00:00',0,0,'Liouta, Evangelia, E|Stranjalis, George, G|Kalyvas, Aristotelis V, AV|Koutsarnakis, Christos, C|Pantinaki, Stavroula, S|Liakos, Faidon, F|Komaitis, Spyros, S|Stavrinou, Lampis C, LC','2018-05-17 22:46:19','2018-05-17 22:46:19'),(62,7,29722099,'1097-0193','Deficient supplementary motor area at rest: Neural basis of limb kinetic deficits in Parkinson\'s disease.','Parkinson\'s disease (PD) patients frequently suffer from limb kinetic apraxia (LKA) affecting quality of life. LKA denotes an impairment of precise and independent finger movements beyond bradykinesia, which is reliably assessed by coin rotation (CR) task. BOLD fMRI detected activation of a left inferior parietal-premotor praxis network in PD during CR. Here, we explored which network site is most critical for LKA using arterial spin labeling (ASL). Based on a hierarchical model, we hypothesized that LKA would predominantly affect the functional integrity of premotor areas including supplementary motor areas (SMA). Furthermore, we suspected that for praxis function with higher demand on temporal-spatial processing such as gesturing, inferior parietal lobule (IPL) upstream to premotor areas would be essential. A total of 21 PD patients and 20 healthy controls underwent ASL acquisition during rest. Behavioral assessment outside the scanner involved the CR, finger tapping task, and the test of upper limb apraxia (TULIA). Whole-brain analysis of activity at rest showed a significant reduction of CR-related perfusion in the left SMA of PD. Furthermore, the positive correlation between SMA perfusion and CR, seen in controls, was lost in patients. By contrast, TULIA was significantly associated with the perfusion of left IPL in both patients and controls. In conclusion, the findings suggest that LKA in PD are linked to an intrinsic disruption of the left SMA function, which may only be overcome by compensatory network activation. In addition, gestural performance relies on IPL which remains available for functional recruitment in early PD.','2018-05-02 00:00:00','2018-05-02 00:00:00','2018-05-03 00:00:00',0,0,'Kübel, Stefanie, S|Stegmayer, Katharina, K|Vanbellingen, Tim, T|Walther, Sebastian, S|Bohlhalter, Stephan, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(63,7,29713440,'2040-2295','Social Robotics in Therapy of Apraxia of Speech.','Apraxia of speech is a motor speech disorder in which messages from the brain to the mouth are disrupted, resulting in an inability for moving lips or tongue to the right place to pronounce sounds correctly. Current therapies for this condition involve a therapist that in one-on-one sessions conducts the exercises. Our aim is to work in the line of robotic therapies in which a robot is able to perform partially or autonomously a therapy session, endowing a social robot with the ability of assisting therapists in apraxia of speech rehabilitation exercises. Therefore, we integrate computer vision and machine learning techniques to detect the mouth pose of the user and, on top of that, our social robot performs autonomously the different steps of the therapy using multimodal interaction.','2018-05-17 00:00:00','2018-03-11 00:00:00','2018-05-03 00:00:00',0,0,'Castillo, José Carlos, JC|Álvarez-Fernández, Diego, D|Alonso-Martín, Fernando, F|Marques-Villarroya, Sara, S|Salichs, Miguel A, MA','2018-05-17 22:46:19','2018-05-17 22:46:19'),(64,7,29710718,'1875-8908','The Progressive Acalculia Presentation of Parietal Variant Alzheimer\'s Disease.','Many patients with early-onset Alzheimer\'s disease (EOAD; age of onset <65 years) have non-amnestic presentations involving language (logopenic primary progressive aphasia, lvPPA), visuospatial abilities (posterior cortical atrophy, PCA), and even asymmetric symptoms consistent with corticobasal syndrome (CBS). An inferior parietal lobule variant of EOAD commonly presents with progressive difficulty with calculations.We reviewed 276 EOAD patients for presentations with predominant acalculia. These patients were diagnosed with clinically probable Alzheimer\'s disease (AD) verified by positron emission tomography (PET) or cerebrospinal fluid amyloid-β or tau biomarkers.We identified 18 (9M/9F) (6.5%) EOAD patients with progressive acalculia that did not meet most criteria for lvPPA, visual PCA, or CBS. Their ages of onset and presentation were 56.6 (5.0) and 59.4 (6.5), respectively. Their acalculia was consistent with a primary acalculia (\"anarithmetia\") not explained by language or visuospatial impairments. Many also had anomia (14/18), ideomotor apraxia (13/18), and the complete Gerstmann\'s syndrome (7/18). Visual analysis of their diverse magnetic resonance imaging disclosed biparietal atrophy, disproportionately worse on the left.Primary acalculia may be the most common manifestation of an inferior parietal presentation of EOAD affecting the left intraparietal sulcus. This parietal variant also commonly involves progressive anomia, ideomotor apraxia, and other elements of Gerstmann\'s syndrome. The early recognition of patients with this variant, which is distinguishable from lvPPA, visual PCA, or CBS, would be facilitated by its recognition as a unique subtype of EOAD.','2018-04-28 00:00:00','2018-04-28 00:00:00','2018-05-01 00:00:00',0,0,'Mendez, Mario F, MF|Moheb, Negar, N|Desarzant, Randy E, RE|Teng, Edmond H, EH','2018-05-17 22:46:19','2018-05-17 22:46:19'),(65,7,29710021,'1882-0654','[Right parietal cerebral infarction with symptoms challenging to differentiate between alien hand sign and sensory ataxia: a case report].','We report the case of a 73-year-old right-handed female with a right parietal cerebral infarction and presented symptoms that were challenging to differentiate between alien hand sign (AHS) and sensory ataxia. She presented to our emergency department with chief complaints of abnormal involuntary movements and a feeling of foreignness on her left upper limb. The first neurological examination revealed left spatial neglect, left-side sensory impairment that included superficial and deep sensations, left limb-kinetic apraxia, and left limb ataxia. Furthermore, her symptoms and complaints had characteristics of AHS that includes a sensation that her left upper limb dose not belong to herself and an abnormal behavior of left hand that is contrary to her own intent. Brain MRI revealed an acute cerebral infarction confined to the right postcentral gyrus. This case highlights that sensory ataxia due to the disturbance of deep sensation might present symptoms similar to AHS. Previous studies suggested the involvement of the disturbance of somatosensory pathway in posterior-variant AHS. Therefore, a precise distinction between AHS and sensory ataxia, especially in posterior-variant AHS, is imperative to avoid confusion regarding the term \"alien hand sign.\"','2018-04-28 00:00:00','2018-04-28 00:00:00','2018-04-30 00:00:00',0,0,'Kanbayashi, Takamichi, T|Uchida, Yudai, Y|Hokkoku, Keiichi, K|Sonoo, Masahiro, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(66,7,29703090,'1477-3848','Using eye-tracking technology for communication in Rett syndrome: perceptions of impact.','Studies have investigated the use of eye-tracking technology to assess cognition in individuals with Rett syndrome, but few have looked at this access method for communication for this group. Loss of speech, decreased hand use, and severe motor apraxia significantly impact functional communication for this population. Eye gaze is one modality that may be used successfully by individuals with Rett syndrome. This multiple case study explored whether using eye-tracking technology, with ongoing support from a team of augmentative and alternative communication (AAC) therapists, could help four participants with Rett syndrome meet individualized communication goals. Two secondary objectives were to examine parents\' perspectives on (a) the psychosocial impact of their child\'s use of the technology, and (b) satisfaction with using the technology. All four participants were rated by the treating therapists to have made improvement on their goals. According to both quantitative findings and descriptive information, eye-tracking technology was viewed by parents as contributing to participants\' improved psychosocial functioning. Parents reported being highly satisfied with both the device and the clinical services received. This study provides initial evidence that eye-tracking may be perceived as a worthwhile and potentially satisfactory technology to support individuals with Rett syndrome in communicating. Future, more rigorous research that addresses the limitations of a case study design is required to substantiate study findings.','2018-04-27 00:00:00','2018-04-27 00:00:00','2018-04-28 00:00:00',0,0,'Vessoyan, Kelli, K|Steckle, Gill, G|Easton, Barb, B|Nichols, Megan, M|Mok Siu, Victoria, V|McDougall, Janette, J','2018-05-17 22:46:19','2018-05-17 22:46:19'),(67,7,29700893,'1097-0193','Action and semantic tool knowledge - Effective connectivity in the underlying neural networks.','Evidence from neuropsychological and imaging studies indicate that action and semantic knowledge about tools draw upon distinct neural substrates, but little is known about the underlying interregional effective connectivity. With fMRI and dynamic causal modeling (DCM) we investigated effective connectivity in the left-hemisphere (LH) while subjects performed (i) a function knowledge and (ii) a value knowledge task, both addressing semantic tool knowledge, and (iii) a manipulation (action) knowledge task. Overall, the results indicate crosstalk between action nodes and semantic nodes. Interestingly, effective connectivity was weakened between semantic nodes and action nodes during the manipulation task. Furthermore, pronounced modulations of effective connectivity within the fronto-parietal action system of the LH (comprising lateral occipito-temporal cortex, intraparietal sulcus, supramarginal gyrus, inferior frontal gyrus) were observed in a bidirectional manner during the processing of action knowledge. In contrast, the function and value knowledge tasks resulted in a significant strengthening of the effective connectivity between visual cortex and fusiform gyrus. Importantly, this modulation was present in both semantic tasks, indicating that processing different aspects of semantic knowledge about tools evokes similar effective connectivity patterns. Data revealed that interregional effective connectivity during the processing of tool knowledge occurred in a bidirectional manner with a weakening of connectivity between areas engaged in action and semantic knowledge about tools during the processing of action knowledge. Moreover, different semantic tool knowledge tasks elicited similar effective connectivity patterns.','2018-04-26 00:00:00','2018-04-26 00:00:00','2018-04-27 00:00:00',0,0,'Kleineberg, Nina N, NN|Dovern, Anna, A|Binder, Ellen, E|Grefkes, Christian, C|Eickhoff, Simon B, SB|Fink, Gereon R, GR|Weiss, Peter H, PH','2018-05-17 22:46:19','2018-05-17 22:46:19'),(68,7,29685679,'1532-2165','Extra-Thoracic Supra-aortic Bypass Surgery Is Safe in Thoracic Endovascular Aortic Repair and Arterial Occlusive Disease Treatment.','The safety and feasibility of supra-aortic debranching as part of endovascular aortic surgery or as a treatment option for arterial occlusive disease (AOD) remains controversial. The aim of this study was to assess the clinical outcome of this surgery.This single centre, retrospective study included 107 patients (mean age 69.2 years, 38.4% women) who underwent supra-aortic bypass surgery (carotid-subclavian bypass, carotid-carotid bypass, and carotid-carotid-subclavian bypass) because of thoracic or thoraco-abdominal endovascular aortic repair (57%; 61/107) or as AOD treatment (42.9%; 46/107) between January 2006 and January 2015. Mortality, morbidity with a focus on neurological complications, and patency rate were assessed. Twenty-six of 107 (14.2%) of the debranching patients were treated under emergency conditions because of acute type B dissection or symptomatic aneurysm. Follow up, conducted by imaging interpretation and telephone interviews, continued till March 2017 (mean 42.1, 0-125, months).The in hospital mortality rate was 10.2% (11/107), all of these cases from the debranching group and related to emergency procedures (p < .0001). One procedure related death of a patient in the debranching group, who had a lethal stroke 72 months post-operatively following bypass occlusion was observed. Early neurological complications were recognised in 10 patients, including two transient cases of Horner syndrome and vocal cord paralysis as well as six cases of phrenic nerve apraxia. Three cases of stenosis and one case of occlusion were successfully treated. In three AOD patients, the graft had to be exchanged because of peri-graft reaction. Primary and secondary patency rates of 96 patients after 36 months were 95% (SE 2.6%) and 98% (SE 1.8%), respectively.Extra-thoracic supra-aortic bypass surgery involves low complication rates and high mid-term bypass patency rates. It is a safe and feasible treatment option in the form of debranching in combination with endovascular aortic aneurysm repair and in AOD.','2018-04-20 00:00:00','2018-04-20 00:00:00','2018-04-24 00:00:00',0,0,'Gombert, Alexander, A|van Issum, Lea, L|Barbati, Mohammad E, ME|Grommes, Jochen, J|Keszei, Andras, A|Kotelis, Drosos, D|Jalaie, Houman, H|Greiner, Andreas, A|Jacobs, Michael J, MJ|Kalder, Johannes, J','2018-05-17 22:46:19','2018-05-17 22:46:19'),(69,7,29682238,'1980-5764','Rate and rhythm control strategies for apraxia of speech in nonfluent primary progressive aphasia.','The nonfluent/agrammatic variant of primary progressive aphasia is characterized by apraxia of speech and agrammatism. Apraxia of speech limits patients\' communication due to slow speaking rate, sound substitutions, articulatory groping, false starts and restarts, segmentation of syllables, and increased difficulty with increasing utterance length. Speech and language therapy is known to benefit individuals with apraxia of speech due to stroke, but little is known about its effects in primary progressive aphasia. This is a case report of a 72-year-old, illiterate housewife, who was diagnosed with nonfluent primary progressive aphasia and received speech and language therapy for apraxia of speech. Rate and rhythm control strategies for apraxia of speech were trained to improve initiation of speech. We discuss the importance of these strategies to alleviate apraxia of speech in this condition and the future perspectives in the area.','2018-01-01 00:00:00','0000-00-00 00:00:00','2018-04-25 00:00:00',0,0,'Beber, Bárbara Costa, BC|Berbert, Monalise Costa Batista, MCB|Grawer, Ruth Siqueira, RS|Cardoso, Maria Cristina de Almeida Freitas, MCAF','2018-05-17 22:46:19','2018-05-17 22:46:19'),(70,7,29680308,'1873-5126','Oculomotor apraxia and disrupted sleep with nocturnal ballistic bouts in ADCY5-related disease.','To characterise the distinctive eye movement disorder and the sleep-related dyskinesia in Adenylate cyclase 5 (ADCY5) related disease.Formal eye movement examination and video-polysomnography in a cohort of patients with ADCY5 mutations.All three patients had an eye movement disorder characterised by oculomotor apraxia with gaze limitation most prominently in the vertical plane. All patients had disrupted sleep architecture with reduced sleep efficiency due to frequent and prolonged arousals and awakenings in the context of dyskinesia, which could arise from any sleep stage. The nocturnal movements could last up to 30 min and be more severe than those seen during day-time.Nocturnal exacerbations of dyskinesia (\"ballistic bouts\") seem to be a characteristic feature of the disease, affect the quality of life of patients and therefore require awareness and symptomatic treatment approaches. Apraxia of eye movements, with predominant difficulties in the vertical plane, was a common finding in our patients with ADCY5 mutations. These features may prompt the diagnosis and help to distinguish ADCY5-related disease from other childhood-onset hyperkinetic movement disorders.','2018-04-10 00:00:00','2018-04-10 00:00:00','2018-04-22 00:00:00',0,0,'Balint, Bettina, B|Antelmi, Elena, E|Mencacci, Niccolò E, NE|Batla, Amit, A|Eriksson, Sofia H, SH|Walker, Matthew C, MC|Bronstein, Adolfo M, AM|Bhatia, Kailash P, KP','2018-05-17 22:46:19','2018-05-17 22:46:19'),(71,8,29753036,'2213-2201','Explaining the amount and consistency of medical care and self-management support in asthma: a survey of primary care providers in France and the United Kingdom.','The quality of asthma primary care may vary between countries, health care practices, and health care professionals (HCPs). Identifying and explaining such differences is critical for health services improvement.To examine the quality of asthma primary care in France and United Kingdom, and identify within-country and between-country predictors amenable to intervention.An online questionnaire to capture asthma medical care and self-management support, practice characteristics, and psychosocial determinants, was completed by 276 HCPs. Mokken Scaling analyses were used to examine item structure and consistency. Hierarchical regression analyses were used to identify predictors of the amount (number of asthma care activities HCPs delivered) and consistency (the degree to which HCPs deliver similar care) of asthma medical care and self-management support.On average, HCPs reported delivering 74,2% of guideline-recommended care. Consistency of medical care and self-management support was lower among HCPs delivering a lower amount of care (r=.58 and r=.57, p<.001). UK HCPs provided more and more consistent asthma self-management support -but not medical care- than French HCPs, which was explained by the presence of practice nurses in the UK. More training, positive social norms, and higher behavioural control explained better quality of care across all HCPs.Using carefully-developed questionnaires and advanced psychometric analyses, this study suggests that involving practice nurses, making social expectations visible, and providing more training to enhance skills and confidence in asthma care delivery could enhance the amount and consistency of asthma primary care. This needs to be corroborated in a future intervention trial.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-12 00:00:00',0,0,'de Bruin, Marijn, M|Dima, Alexandra L, AL|Texier, Nathalie, N|van Ganse, Eric, E|ASTRO-LAB group','2018-05-17 22:46:19','2018-05-17 22:46:19'),(72,8,29752757,'1365-2222','Subcutaneous immunotherapy suppresses Th2 inflammation and induces neutralizing antibodies but sublingual immunotherapy suppresses airway hyperresponsiveness in grass pollen mouse models for allergic asthma.','Both subcutaneous and sublingual allergen immunotherapy (SCIT and SLIT) have been shown to effectively suppress allergic manifestations upon allergen exposure, providing long term relief from symptoms in allergic disorders including allergic asthma. Clinical studies directly comparing SCIT and SLIT report a different kinetics and magnitude of immunological changes induced during treatment. Comparative studies into the mechanisms underlying immune suppression in SCIT and SLIT are lacking.We aimed to establish an experimental model for grass pollen (GP) SCIT and SLIT that would allow a head-to-head comparison of the two treatments.Balb/c mice were sensitized with GP-extract, followed by SCIT and SLIT treatments with various GP dosages. Subsequently, we challenged mice with GP and measured airway responsiveness (AHR), GP-specific immunoglobulins, ear-swelling tests (EST), eosinophilic inflammation in broncho-alveolar lavage fluid (BALF) and T-cell cytokine release after re-stimulation of lung cells (IL-5, -10, and -13).We find that SLIT treatment was able to suppress allergen-induced AHR, while allergic inflammation was not effectively suppressed even at the highest GP dose in this model. In contrast, SCIT treatment induced higher levels of GP-specific IgG1, while SLIT was superior in inducing a GP-specific IgG2a response, which was associated with increased Th1 activity in lung tissue after SLIT, but not SCIT treatment. Interestingly, SCIT was able to suppress Th2-type cytokine production in lung cell suspensions, while SLIT failed to do so.In conclusion, GP-SCIT suppresses Th2 inflammation and induced neutralizing antibodies, while GP-SLIT suppresses the clinically relevant lung function parameters in an asthma mouse model, indicating that the two application routes depend on partially divergent mechanisms of tolerance induction. Interestingly, these data mirror observations in clinical studies, underscoring the translational value of these mouse models. This article is protected by copyright. All rights reserved.','2018-05-12 00:00:00','2018-05-12 00:00:00','2018-05-12 00:00:00',0,0,'Hesse, Laura, L|Brouwer, Uilke, U|Petersen, Arjen H, AH|Gras, Renée, R|Bosman, Lisette, L|Brimnes, Jens, J|Oude Elberink, Joanne N G, JNG|van Oosterhout, Antoon J M, AJM|Nawijn, Martijn C, MC','2018-05-17 22:46:19','2018-05-17 22:46:19'),(73,8,29752708,'0065-2598','Coexistence of Chronic Bronchitis in Chronic Obstructive Lung Disease.','The incidence of chronic obstructive pulmonary disease (COPD) is on the rise worldwide. Chronic bronchitis is a frequent accompaniment of COPD, which increases the burden of COPD in affected individuals. The aim of this study was to characterize the phenotype of chronic bronchitis in COPD patients. The study was based on the survey data retrospectively retrieved from the Action Health-Lung Cancer Prophylaxis and Health Care Improvement screening program that concerned all the inhabitants, aged over 40, of the Proszowice administrative region situated in the Lesser Poland Voivodeship in southern Poland. Participants with the symptoms suggestive of a lung disease were subject to further evaluation. The findings were that 546 (13.3%) out of the 4105 individuals displayed spirometry features of COPD. Symptoms of chronic bronchitis were present in 92 (16.8%) out of the COPD afflicted persons. Chronic bronchitis was commoner in current smokers and its incidence increased with increasing severity of airway obstruction. In multivariate analysis, chronic bronchitis was independently related to lower FEV1, FVC, FEV1/FVC, and to dyspnea. In regression model, factors related to increased risk of chronic bronchitis were current smoking, asthma, and lower lung function. We conclude that COPD with coexisting chronic bronchitis is linked to severer dyspnea and worse lung function. Current smoking, asthma, and lower lung function are related to increased risk of chronic bronchitis accompanying COPD.','2018-05-12 00:00:00','2018-05-12 00:00:00','2018-05-12 00:00:00',0,0,'Mejza, Filip, F|Nastałek, Paweł, P|Mastalerz-Migas, Agnieszka, A|Doniec, Zbigniew, Z|Skucha, Wojciech, W','2018-05-17 22:46:19','2018-05-17 22:46:19'),(74,8,29752613,'1672-0415','Immune Homeostasis: Effects of Chinese Herbal Formulae and Herb-Derived Compounds on Allergic Asthma in Different Experimental Models.','Allergic asthma is thought to arise from an imbalance of immune regulation, which is characterized by the production of large quantities of IgE antibodies by B cells and a decrease of the interferon-γ/interleukin-4 (Th1/Th2) ratio. Certain immunomodulatory components and Chinese herbal formulae have been used in traditional herbal medicine for thousands of years. However, there are few studies performing evidence-based Chinese medicine (CM) research on the mechanisms and effificacy of these drugs in allergic asthma. This review aims to explore the roles of Chinese herbal formulae and herb-derived compounds in experimental research models of allergic asthma. We screened published modern CM research results on the experimental effects of Chinese herbal formulae and herb-derived bioactive compounds for allergic asthma and their possible underlying mechanisms in English language articles from the PubMed and the Google Scholar databases with the keywords allergic asthma, experimental model and Chinese herbal medicine. We found 22 Chinese herb species and 31 herb-derived anti-asthmatic compounds as well as 12 Chinese herbal formulae which showed a reduction of airway hyperresponsiveness, allergen-specifific immunoglobulin E, inflflammatory cell infifiltration and a regulation of Th1 and Th2 cytokines in vivo, in vitro and ex vivo, respectively. Chinese herbal formulae and herbderived bioactive compounds exhibit immunomodulatory, anti-inflflammatory and anti-asthma activities in different experimental models and their various mechanisms of action are being investigated in modern CM research with genomics, proteomics and metabolomics technologies, which will lead to a new era in the development of new drug discovery for allergic asthma in CM.','2018-05-01 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Liu, Lu, L|Wang, Lin-Peng, LP|He, Shan, S|Ma, Yan, Y','2018-05-17 22:46:19','2018-05-17 22:46:19'),(75,8,29752346,'1468-3296','Rates of asthma exacerbations and mortality and associated factors in Uganda: a 2-year prospective cohort study.','Data on asthma treatment outcomes in Africa are limited. 449 patients with asthma (age 5-93 years) in Uganda were followed up for 2 years to determine rates of exacerbations and mortality and associated factors. During follow-up the median number of exacerbations per patient was 1 (IQR 0-5) and 17 patients died (3.7%, 27.3 deaths per 1000 person years). Considering only the first year of follow-up, 59.6% of the patients experienced at least one exacerbation, 32.4% experienced three or more exacerbations. A multivariable model showed that the likelihood of experiencing at least one exacerbation in the first year of follow-up was lower with better baseline asthma control (higher asthma control test (ACT) score), with OR 0.87 (95% CI: 0.82 to 0.93, P=0.000), and was higher with more exacerbations in the year prior to enrolment (OR for log number of exacerbations 1.28, 95% CI: 1.04 to 1.57, P=0.018). Better asthma control (OR 0.93, 95% CI: 0.88 to 0.99, P=0.021) and number of baseline exacerbations (OR 1.35,95% CI: 1.11 to 1.66, P=0.005) were also the only factors that were independently associated with experiencing three or more exacerbations during the first year of follow-up. The only factor found to be associated with all-cause mortality was FEV, with higher recent FEV associated with lower all-cause mortality (OR 0.30, 95% CI: 0.14 to 0.65; P=0.002). Rates of asthma exacerbations and mortality are high in Uganda and are associated with poor asthma control. Health systems should be strengthened to care for asthma patients.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Kirenga, Bruce J, BJ|de Jong, Corina, C|Mugenyi, Levicatus, L|Katagira, Winceslaus, W|Muhofa, Abdallah, A|Kamya, Moses R, MR|Boezen, H Marike, HM|van der Molen, Thys, T','2018-05-17 22:46:19','2018-05-17 22:46:19'),(76,8,29751756,'1471-2466','Prevalence of asthma among the adult general population of five Middle Eastern countries: results of the SNAPSHOT program.','Asthma is a common chronic respiratory disease leading to morbidity, mortality and impaired quality of life worldwide. Information on asthma prevalence in the Middle East is fragmented and relatively out-dated. The SNAPSHOT program was conducted to obtain updated information.SNAPSHOT is a cross-sectional epidemiological program carried out in five Middle Eastern countries (Egypt, Turkey, Kuwait, Saudi Arabia, and the United Arab Emirates, the latter three grouped into a Gulf cluster) to collect data on asthma, allergic rhinitis, benign prostatic hyperplasia and bipolar disorder. The survey was carried out by telephone in a random sample of the adult general population with quotas defined according to country demographics. The analysis presented in this paper focuses on asthma. Subjects were screened for asthma based on criteria from the global Asthma Insights and Reality studies. Current prevalence (last 12 months) was estimated. Multivariate logistic regression analyses were used to investigate risk factors related to asthma and the association with allergic rhinitis and other co-morbidities. Quality of life was assessed using the three-level EQ-5D questionnaire.2124 out of the 33,486 subjects enrolled in the SNAPSHOT program fulfilled the criteria for asthma. The adjusted prevalence of asthma ranged from 4.4% [95% CI: 4.0-4.8%] in Turkey, to 6.7% [95% CI: 6.2-7.2%] in Egypt and 7.6% [95% CI: 7.1-8.0%] in the Gulf cluster. Prevalence was higher (p < 0.0001) in women than men and increased with age (p < 0.0001). Co-morbidities occurred more frequently in asthma subjects compared to the non-asthma population (38% vs. 15% p < 0.0001). Subjects with asthma reported a lower (p < 0.0001) EQ-VAS score (68.2 ± 22.9) compared to the general population (78.1 ± 17.5). The risk factors associated with asthma were age, gender, country, and certain co-morbidities, namely respiratory, cardiovascular, gastrointestinal, nervous, and neurological diseases.The observed adjusted prevalence of asthma in the Middle East ranges from 4.4% to 7.6%, which is comparatively lower than the reported prevalence in Europe and North America. Asthma has a negative impact on quality of life, and is associated with high levels of co-morbid diseases, indicating a need for physicians to check for co-morbidities and ensure they are managed correctly in all asthma patients.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Tarraf, Hesham, H|Aydin, Omur, O|Mungan, Dilsad, D|Albader, Mohammad, M|Mahboub, Bassam, B|Doble, Adam, A|Lahlou, Aaicha, A|Tariq, Luqman, L|Aziz, Fayaz, F|El Hasnaoui, Abdelkader, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(77,8,29751569,'2073-4425','Genetic Mechanisms of Asthma and the Implications for Drug Repositioning.','Asthma is a chronic disease that is caused by airway inflammation. The main features of asthma are airway hyperresponsiveness (AHR) and reversible airway obstruction. The disease is mainly managed using drug therapy. The current asthma drug treatments are divided into two categories, namely, anti-inflammatory drugs and bronchodilators. However, disease control in asthma patients is not very efficient because the pathogenesis of asthma is complicated, inducing factors that are varied, such as the differences between individual patients. In this paper, we delineate the genetic mechanisms of asthma, and present asthma-susceptible genes and genetic pharmacology in an attempt to find a diagnosis, early prevention, and treatment methods for asthma. Finally, we reposition some clinical drugs for asthma therapy, based on asthma genetics.','2018-05-03 00:00:00','2018-05-03 00:00:00','2018-05-12 00:00:00',0,0,'Huo, Yue, Y|Zhang, Hong-Yu, HY','2018-05-17 22:46:19','2018-05-17 22:46:19'),(78,8,29751492,'1660-4601','Aluminum Adjuvant-Containing Vaccines in the Context of the Hygiene Hypothesis: A Risk Factor for Eosinophilia and Allergy in a Genetically Susceptible Subpopulation?','There are similarities between the immune response following immunization with aluminum adjuvants and the immune response elicited by some helminthic parasites, including stimulation of immunoglobulin E (IgE) and eosinophilia. Immunization with aluminum adjuvants, as with helminth infection, induces a Th2 type cell mediated immune response, including eosinophilia, but does not induce an environment conducive to the induction of regulatory mechanisms. Helminths play a role in what is known as the hygiene hypothesis, which proposes that decreased exposure to microbes during a critical time in early life has resulted in the increased prevalence and morbidity of asthma and atopic disorders over the past few decades, especially in Western countries. In addition, gut and lung microbiome composition and their interaction with the immune system plays an important role in a properly regulated immune system. Disturbances in microbiome composition are a risk factor for asthma and allergies. We propose that immunization with aluminum adjuvants in general is not favorable for induction of regulatory mechanisms and, in the context of the hygiene hypothesis and microbiome theory, can be viewed as an amplifying factor and significant contributing risk factor for allergic diseases, especially in a genetically susceptible subpopulation.','2018-05-03 00:00:00','2018-05-03 00:00:00','2018-05-12 00:00:00',0,0,'Terhune, Todd D, TD|Deth, Richard C, RC','2018-05-17 22:46:19','2018-05-17 22:46:19'),(79,8,29750604,'1741-0541','Pharmacogenomic test that predicts response to β-agonists in adults with asthma is cost effective.','Pharmacogenomic tests that predict which asthma patients are likely to respond to β-agonists hold promise to improve care for asthma.To identify the clinical and economic circumstances under which a pharmacogenomic test that predicts response to β-agonists might or might not be an appropriate, cost-effective option.We synthesized published data on clinical and economic outcomes in adults 18-35 to project 10-year costs, quality-adjusted life years and cost-effectiveness of pharmacogenomic testing for β-agonist response.Pharmacogenomic testing for β-agonist response conferred a cost-effectiveness ratio of $13,700 per quality-adjusted life year gained compared with no testing.Pharmacogenomic testing for β-agonist response in individuals with asthma is potentially cost effective and should be pursued by test developers.','2015-11-01 00:00:00','0000-00-00 00:00:00','2018-05-11 00:00:00',0,0,'Wu, Ann Chen, AC|Gay, Charlene, C|Rett, Melisa D, MD|Fuhlbrigge, Anne L, AL','2018-05-17 22:46:19','2018-05-17 22:46:19'),(80,8,29749828,'1741-0541','Candidate gene analysis of asthma in a population of Arab descent: a case-control study in Jordan.','To evaluate whether SNPs (n = 15) in ten candidate genes (ADRB2, ADH5, ARGI, CRHR1, STIP1, LTA4H, LTC4S, ALOX5, ABCC1 and OATP2B1) are associated with asthma in Jordanian population of Arab descent.A case-control study included 245 adult asthmatics and 249 controls.Significant genetic association was identified at the rs2236647 (T/C) SNP in STIP1 and risk of asthma (p < 0.001). The C allele and CC genotype of this SNP were significantly higher in asthmatics compared with controls. The rs1141370 SNP (Val34Met) in ADRB2 is not polymorphic in our cohort.The rs2236647 SNP could act as a reliable tool to identify individuals at risk of developing asthma and provision of early intervention in population of Arab descent.','2017-01-01 00:00:00','2016-11-30 00:00:00','2018-05-11 00:00:00',0,0,'Almomani, Basima A, BA|Al-Eitan, Laith N, LN|Samrah, Shaher M, SM|Al-Quasmi, Mohammed N, MN|McKnight, Amy J, AJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(81,9,29748471,'2072-6651','Novel Botulinum Neurotoxins: Exploring Underneath the Iceberg Tip.','Botulinum neurotoxins (BoNTs), the etiological agents of botulism, are the deadliest toxins known to humans. Yet, thanks to their biological and toxicological features, BoNTs have become sophisticated tools to study neuronal physiology and valuable therapeutics for an increasing number of human disorders. BoNTs are produced by multiple bacteria of the genus  and, on the basis of their different immunological properties, were classified as seven distinct types of toxin. BoNT classification remained stagnant for the last 50 years until, via bioinformatics and high-throughput sequencing techniques, dozens of BoNT variants, novel serotypes as well as BoNT-like toxins within non-clostridial species have been discovered. Here, we discuss how the now &ldquo;booming field&rdquo; of botulinum neurotoxin may shed light on their evolutionary origin and open exciting avenues for future therapeutic applications.','2018-05-10 00:00:00','2018-05-10 00:00:00','2018-05-11 00:00:00',0,0,'Tehran, Domenico Azarnia, DA|Pirazzini, Marco, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(82,9,29745121,'0041-4301','Complete paralytic botulism mimicking a deep coma in a child.','Botulism is a rare cause of neuroparalysis. Delay in diagnosis and treatment exerts adverse impact on mortality and morbidity. We report a child with complete flaccid paralysis followed by progression to coma-like consciousness. The patient required mechanical ventilation. As serological tests could not be performed, detailed history and physical examinations led to the suspicion of botulism, and repetitive nerve stimulation tests supported the diagnosis. Botulinum antitoxin was administered. The patient`s neuromuscular function improved rapidly.','2018-05-17 00:00:00','0000-00-00 00:00:00','2018-05-10 00:00:00',0,0,'Azapağası, Ebru, E|Kendirli, Tanıl, T|Öz-Tuncer, Gökçen, G|Albayrak, Pelin, P|Teber, Serap, S|Deda, Gülhis, G','2018-05-17 22:46:19','2018-05-17 22:46:19'),(83,9,29746518,'1932-6203','An ambient temperature-stable antitoxin of nine co-formulated antibodies for botulism caused by serotypes A, B and E.','Safe and effective antitoxins to treat and prevent botulism are needed for biodefense. We have developed recombinant antibody-based therapeutics for botulinum neurotoxin (BoNT) serotypes A, B, and E. The mechanism of action of this antitoxin requires that three mAbs bind one toxin molecule to achieve clearance. Here we present a co-formulation of an antitoxin to the three most important serotypes. Combining these antibodies obviates the need to identify the serotype causing intoxication prior to drug administration, which would facilitate administration. The lyophilized powder formulation contains nine mAbs, three mAbs for each of the three serotypes (A, B, E). The formulation was stored as a liquid and lyophilized powder for up to one year, and characterized by binding affinity and multiple physicochemical methods. No significant increase in soluble higher order aggregates, cleavage products, or change in charge isoforms was measured after storage as a lyophilized powder at 50°C for one year. Furthermore, toxin-domain binding ELISA data indicated that each of the individual antibodies in the lyophilized drug product showed essentially full binding capability to their respective toxin domains after being stored at 50°C for one year. Physicochemical characterization of the formulation demonstrated the nine individual mAbs were remarkably stable. This work demonstrates feasibility of lyophilized, oligoclonal antibody therapies for biodefense with ambient temperature stability, that would facilitate stockpiling, distribution, and administration.','2018-05-17 00:00:00','2018-05-10 00:00:00','2018-05-10 00:00:00',0,0,'Li, Mingxiang, M|Lee, Dennis, D|Obi, Chidi R, CR|Freeberg, Joel K, JK|Farr-Jones, Shauna, S|Tomic, Milan T, MT','2018-05-17 22:46:19','2018-05-17 22:46:19'),(84,9,29732040,'2008-6164','Botulism and cavernous sinus thrombosis induced by acute rhinosinusitis: A case report.','Botulism is an acute and rapidly progressive descending paralytic disease caused by a neurotoxin of clostridium botulinum.A 28-year-old woman presented with severe generalized ascending symmetrical muscle paralysis. The patient was intubated and transferred to the medical intensive care unit with several symptoms including: severe headache, dysphagia, dyspnea, ptosis, diplopia, and dry mouth. Despite being alert, pupils were bilaterally midriatic and had absent corneal reflux. Pansinusitis was seen in the paranasal sinus scan. At first, the movement of eyelids, head and neck were restored. The movement of the upper limbs (15 day) and chest wall (20 day), abdomen (25 day) and the lower extremities (32nd day) were then gradually restored. On 41 day, the patient was completely disconnected from the ventilator.Botulism should be a diagnosis in any patient with an acute progressive symmetrical descending paralysis. Sinus mucosal injury (acute sinusitis) can be inoculated with spores of ','2018-05-17 00:00:00','0000-00-00 00:00:00','2018-05-11 00:00:00',0,0,'Tavassoli, Ali, A|Sadeghi, Mahmood, M|Amri, Parviz, P','2018-05-17 22:46:19','2018-05-17 22:46:19'),(85,9,29728678,'2045-2322','The orphan germinant receptor protein GerXAO (but not GerX3b) is essential for L-alanine induced germination in Clostridium botulinum Group II.','Clostridium botulinum is an anaerobic spore forming bacterium that produces the potent botulinum neurotoxin that causes a severe and fatal neuro-paralytic disease of humans and animals (botulism). C. botulinum Group II is a psychrotrophic saccharolytic bacterium that forms spores of moderate heat resistance and is a particular hazard in minimally heated chilled foods. Spore germination is a fundamental process that allows the spore to transition to a vegetative cell and typically involves a germinant receptor (GR) that responds to environmental signals. Analysis of C. botulinum Group II genomes shows they contain a single GR cluster (gerX3b), and an additional single gerA subunit (gerXAO). Spores of C. botulinum Group II strain Eklund 17B germinated in response to the addition of L-alanine, but did not germinate following the addition of exogenous Ca-DPA. Insertional inactivation experiments in this strain unexpectedly revealed that the orphan GR GerXAO is essential for L-alanine stimulated germination. GerX3bA and GerX3bC affected the germination rate but were unable to induce germination in the absence of GerXAO. No role could be identified for GerX3bB. This is the first study to identify the functional germination receptor of C. botulinum Group II.','2018-05-04 00:00:00','2018-05-04 00:00:00','2018-05-11 00:00:00',0,0,'Brunt, Jason, J|Carter, Andrew T, AT|Pye, Hannah V, HV|Peck, Michael W, MW','2018-05-17 22:46:19','2018-05-17 22:46:19'),(86,9,29685279,'1525-3198','Silage review: Animal and human health risks from silage.','Silage may contain several agents that are potentially hazardous to animal health, the safety of milk or other animal food products, or both. This paper reviews published literature about microbial hazards, plant toxins, and chemical hazards. Microbial hazards include Clostridium botulinum, Bacillus cereus, Listeria monocytogenes, Shiga toxin-producing Escherichia coli, Mycobacterium bovis, and various mold species. High concentrations of C. botulinum in silage have been associated with cattle botulism. A high initial concentration of C. botulinum spores in forage in combination with poor silage fermentation conditions can promote the growth of C. botulinum in silage. The elevated pH level that is generally associated with aerobic deterioration of silage is a major factor influencing concentrations of L. monocytogenes, Shiga toxin-producing E. coli, and molds in silage and may also encourage survival and growth of M. bovis, the bacterium that causes bovine tuberculosis. Soil is a major source of B. cereus spores in silage; growth of this bacterium in silage appears to be limited. Hazards from plant toxins include pyrrolizidine, tropane and tropolone alkaloids, phytoestrogens, prussic acid, and mimosine, compounds that exist naturally in certain plant species that may contaminate forages at harvesting. Another group of toxins belonging to this category are ergot alkaloids, which are produced by endophytic fungal species in forages such as tall fescue grass, sorghum, and ryegrass. Varying effects of ensiling on the degradation of these plant toxins have been reported. Chemical hazards include nitrate, nitrite, and toxic oxide gases of nitrogen produced from nitrate and high levels of butyric acid, biogenic amines, and ammonia. Chemical and microbiological hazards are associated with poorly fermented silages, which can be avoided by using proper silage-making practices and creating conditions that promote a rapid and sufficient reduction of the silage pH and prevent aerobic deterioration.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-04-24 00:00:00',0,0,'Driehuis, F, F|Wilkinson, J M, JM|Jiang, Y, Y|Ogunade, I, I|Adesogan, A T, AT','2018-05-17 22:46:19','2018-05-17 22:46:19'),(87,9,29678457,'1095-8274','Erratum to \"Investigation of Clostridium botulinum group III\'s mobilome content\" [Anaerobe 49 (2018) 71-77].','No abstract found.','2018-04-18 00:00:00','2018-04-18 00:00:00','2018-04-21 00:00:00',0,0,'Woudstra, Cédric, C|Le Maréchal, Caroline, C|Souillard, Rozenn, R|Anniballi, Fabrizio, F|Auricchio, Bruna, B|Bano, Luca, L|Bayon-Auboyer, Marie-Hélène, MH|Koene, Miriam, M|Mermoud, Isabelle, I|Brito, Roseane B, RB|Lobato, Francisco C F, FCF|Silva, Rodrigo O S, ROS|Dorner, Martin B, MB|Fach, Patrick, P','2018-05-17 22:46:19','2018-05-17 22:46:19'),(88,9,29677267,'1539-3704','The Short-Lived Epidemic of Botulism From Commercially Canned Foods in the United States, 1919 to 1925.','In 1919, three deadly outbreaks of botulism caused by consumption of canned olives packed in California captured national headlines. In all of the outbreaks, which occurred in separate locales, unsuspecting people died after consuming tainted food during a banquet or family meal. The press\'s sensational portrayal of canned food as hazardous aroused alarm among consumers at a time when commercial canning was becoming more common. Intent on restoring the image of their product as safe and wholesome, canning industry leaders funded a \"botulism commission\" of scientific experts in 1919 to investigate how to systematically eliminate the threat of botulism that had imperiled their business. The commissioners identified the scientific reasons for the outbreaks, and on the basis of their findings, the California Department of Public Health issued explicit recommendations for sterilization procedures intended to ensure safety. However, the department did not mandate inspections for all canneries. When commercially packed fruits and vegetables continued to cause botulism, industry leaders voluntarily backed a cannery inspection act to legally require all California canners to possess appropriate equipment and follow scientifically validated sterilization procedures. After the California legislature approved the act in 1925, canneries were inspected, regulations were enforced, and no further outbreaks occurred. This botulism epidemic is an example of a disease outbreak that was controlled when business interests became aligned with public health goals. The press\'s portrayal of afflicted persons as innocent victims and worthy citizens galvanized businessmen to implement safeguards to protect consumers from botulism intoxication. To preserve their customer base and salvage their corporations, leaders of the canning industry acknowledged the public health threat of their unregulated procedures and acted on the recommendations of scientists.','2018-04-17 00:00:00','0000-00-00 00:00:00','2018-04-20 00:00:00',0,0,'Kazanjian, Powel, P','2018-05-17 22:46:19','2018-05-17 22:46:19'),(89,9,29644402,'2193-6226','[A case of sole supportive care of severe neuroparalytic foodborne botulism due to homemade pesto].','In this article, a case of severe foodborne botulism in a 78-year-old man due to homemade pesto is presented. His initial symptoms were gastrointestinal problems. Later he suffered of cranial nerve palsies, muscle weakness of the upper extremities and respiratory failure, so he had to be admitted to the intensive care unit for mechanical ventilation. The botulism was confirmed by serology and culture. Because of spontaneously improving neurological deficits, we decided not to treat with the botulism antitoxin and the patient had complete clinical remission.','2018-04-11 00:00:00','2018-04-11 00:00:00','2018-04-12 00:00:00',0,0,'Kuratle, M, M|Baldinger, R, R|Lienhardt Nobbe, B, B|Dreessen, P, P|Yuen, B, B','2018-05-17 22:46:19','2018-05-17 22:46:19'),(90,10,29489833,'1932-6203','Immune checkpoint inhibitor PD-1 pathway is down-regulated in synovium at various stages of rheumatoid arthritis disease progression.','Immune checkpoint blockade with therapeutic anti-cytotoxic T lymphocyte-associated antigen (CTLA)-4 (Ipilimumab) and anti-programmed death (PD)-1 (Nivolumab and Pembrolizumab) antibodies alone or in combination has shown remarkable efficacy in multiple cancer types, concomitant with immune-related adverse events, including arthralgia and inflammatory arthritis (IA) in some patients. Herein, using Nivolumab (anti-PD-1 antagonist)-responsive genes along with transcriptomics of synovial tissue from multiple stages of rheumatoid arthritis (RA) disease progression, we have interrogated the activity status of PD-1 pathway during RA development. We demonstrate that the expression of PD-1 was increased in early and established RA synovial tissue compared to normal and OA synovium, whereas that of its ligands, programmed death ligand-1 (PD-L1) and PD-L2, was increased at all the stages of RA disease progression, namely arthralgia, IA/undifferentiated arthritis, early RA and established RA. Further, we show that RA patients expressed PD-1 on a majority of synovial tissue infiltrating CD4+ and CD8+ T cells. Moreover, enrichment of Nivolumab gene signature was observed in IA and RA, indicating that the PD-1 pathway was downregulated during RA disease progression. Furthermore, serum soluble (s) PD-1 levels were increased in autoantibody positive early RA patients. Interestingly, most of the early RA synovium tissue sections showed negative PD-L1 staining by immunohistochemistry. Therefore, downregulation in PD-1 inhibitory signaling in RA could be attributed to increased serum sPD-1 and decreased synovial tissue PD-L1 levels. Taken together, these data suggest that agonistic PD1 antibody-based therapeutics may show efficacy in RA treatment and interception.','2018-05-17 00:00:00','2018-02-28 00:00:00','2018-04-06 00:00:00',0,0,'Guo, Yanxia, Y|Walsh, Alice M, AM|Canavan, Mary, M|Wechalekar, Mihir D, MD|Cole, Suzanne, S|Yin, Xuefeng, X|Scott, Brittney, B|Loza, Mathew, M|Orr, Carl, C|McGarry, Trudy, T|Bombardieri, Michele, M|Humby, Frances, F|Proudman, Susanna M, SM|Pitzalis, Costantino, C|Smith, Malcolm D, MD|Friedman, Joshua R, JR|Anderson, Ian, I|Madakamutil, Loui, L|Veale, Douglas J, DJ|Fearon, Ursula, U|Nagpal, Sunil, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(91,10,29456021,'1525-0024','Brain Nat8l Knockdown Suppresses Spongiform Leukodystrophy in an Aspartoacylase-Deficient Canavan Disease Mouse Model.','Canavan disease, a leukodystrophy caused by loss-of-function ASPA mutations, is characterized by brain dysmyelination, vacuolation, and astrogliosis (\"spongiform leukodystrophy\"). ASPA encodes aspartoacylase, an oligodendroglial enzyme that cleaves the abundant brain amino acid N-acetyl-L-aspartate (NAA) to L-aspartate and acetate. Aspartoacylase deficiency results in a 50% or greater elevation in brain NAA concentration ([NAA]). Prior studies showed that homozygous constitutive knockout of Nat8l, the gene encoding the neuronal NAA synthesizing enzyme N-acetyltransferase 8-like, prevents aspartoacylase-deficient mice from developing spongiform leukodystrophy. We now report that brain Nat8l knockdown elicited by intracerebroventricular/intracisternal administration of an adeno-associated viral vector carrying a short hairpin Nat8l inhibitory RNA to neonatal aspartoacylase-deficient Aspa mice lowers [NAA] and suppresses development of spongiform leukodystrophy.','2018-03-07 00:00:00','2018-01-10 00:00:00','2018-04-25 00:00:00',0,0,'Bannerman, Peter, P|Guo, Fuzheng, F|Chechneva, Olga, O|Burns, Travis, T|Zhu, Xiaoqing, X|Wang, Yan, Y|Kim, Bokyung, B|Singhal, Naveen K, NK|McDonough, Jennifer A, JA|Pleasure, David, D','2018-05-17 22:46:19','2018-05-17 22:46:19'),(92,10,29453510,'1573-2665','Next-generation metabolic screening: targeted and untargeted metabolomics for the diagnosis of inborn errors of metabolism in individual patients.','The implementation of whole-exome sequencing in clinical diagnostics has generated a need for functional evaluation of genetic variants. In the field of inborn errors of metabolism (IEM), a diverse spectrum of targeted biochemical assays is employed to analyze a limited amount of metabolites. We now present a single-platform, high-resolution liquid chromatography quadrupole time of flight (LC-QTOF) method that can be applied for holistic metabolic profiling in plasma of individual IEM-suspected patients. This method, which we termed \"next-generation metabolic screening\" (NGMS), can detect >10,000 features in each sample. In the NGMS workflow, features identified in patient and control samples are aligned using the \"various forms of chromatography mass spectrometry (XCMS)\" software package. Subsequently, all features are annotated using the Human Metabolome Database, and statistical testing is performed to identify significantly perturbed metabolite concentrations in a patient sample compared with controls. We propose three main modalities to analyze complex, untargeted metabolomics data. First, a targeted evaluation can be done based on identified genetic variants of uncertain significance in metabolic pathways. Second, we developed a panel of IEM-related metabolites to filter untargeted metabolomics data. Based on this IEM-panel approach, we provided the correct diagnosis for 42 of 46 IEMs. As a last modality, metabolomics data can be analyzed in an untargeted setting, which we term \"open the metabolome\" analysis. This approach identifies potential novel biomarkers in known IEMs and leads to identification of biomarkers for as yet unknown IEMs. We are convinced that NGMS is the way forward in laboratory diagnostics of IEMs.','2018-02-16 00:00:00','2018-02-16 00:00:00','2018-02-17 00:00:00',0,0,'Coene, Karlien L M, KLM|Kluijtmans, Leo A J, LAJ|van der Heeft, Ed, E|Engelke, Udo F H, UFH|de Boer, Siebolt, S|Hoegen, Brechtje, B|Kwast, Hanneke J T, HJT|van de Vorst, Maartje, M|Huigen, Marleen C D G, MCDG|Keularts, Irene M L W, IMLW|Schreuder, Michiel F, MF|van Karnebeek, Clara D M, CDM|Wortmann, Saskia B, SB|de Vries, Maaike C, MC|Janssen, Mirian C H, MCH|Gilissen, Christian, C|Engel, Jasper, J|Wevers, Ron A, RA','2018-05-17 22:46:19','2018-05-17 22:46:19'),(93,10,29401083,'1536-4801','Molecular Comparison of Adult and Pediatric Ulcerative Colitis Indicates Broad Similarity of Molecular Pathways in Disease Tissue.','Efficacy data from adult ulcerative colitis (UC) clinical trials are often extrapolated for pediatric prescribing. Consequently, it is important to understand similarities/differences in pediatric and adult UC. Pediatric UC tends to have more extensive disease at presentation, yet genetic studies have not detected pathways that distinguish the populations, and differences in mucosal gene expression between adult and pediatric UC are not well characterized.Using colonic microarray data from a phase 3 trial of golimumab in adult UC (87 UC; 21 healthy), the GSE10616 pediatric dataset (10 UC; 11 healthy), and a phase 1B trial of golimumab in pediatric UC (n = 19), UC expression profiles were compared and unique genes were defined as those with significant changes (|FC|>2x, adjusted p < 0.05) in one population, but not the other (|FC| < 1.2x, adjusted p>0.05). Pathway and upstream regulator analyses were performed. Profiles by disease extent (extensive [pancolitis] vs. limited [left-sided] involvement) were compared within each population.Pediatric and adult disease profiles overlapped substantially, with ∼50-75% overlap, depending on the fold-change cutoff used. Conversely, <10% of the disease profiles were unique to each population. Similar canonical pathways were enriched in both datasets. Predicted upstream regulators were also concordant, including lipopolysaccharide, interleukin-1β, and tumor necrosis factor-α. Expression profiles of extensive UC were indistinguishable from those of patients with limited involvement in each population.The UC gene expression landscape is shared by adults and children, independent of disease extent. This supports extrapolation of efficacy from adults to children in developing new therapies for UC.','2018-02-03 00:00:00','2018-02-03 00:00:00','2018-02-05 00:00:00',0,0,'Li, Katherine, K|Strauss, Richard, R|Ouahed, Jodie, J|Chan, Daphne, D|Telesco, Shannon E, SE|Shouval, Dror S, DS|Canavan, James B, JB|Brodmerkel, Carrie, C|Snapper, Scott B, SB|Friedman, Joshua R, JR','2018-05-17 22:46:19','2018-05-17 22:46:19'),(94,10,29275541,'1600-6143','Human polyomavirus-7-associated eruption successfully treated with acitretin.','Advances in molecular technologies have led to the discovery of several novel human polyomaviruses (HPyVs), including human polyomavirus-7 (HPyV-7). Although low levels of HPyV-7 are shed from apparently normal skin, recent reports have described clinically significant cutaneous infection in immunocompromised patients that manifests as generalized pruritic plaques. The pruritus can be severe, and treatment options have not been described. Herein we report HPyV-7 cutaneous infection in a heart transplant patient who experienced temporary improvement with intravenous cidofovir, and complete remission with acitretin. We report a case of HPyV-7 cutaneous infection demonstrating a good response to treatment.','2018-05-01 00:00:00','2018-01-21 00:00:00','2018-04-20 00:00:00',0,0,'Canavan, T N, TN|Baddley, J W, JW|Pavlidakey, P, P|Tallaj, J A, JA|Elewski, B E, BE','2018-05-17 22:46:19','2018-05-17 22:46:19'),(95,10,29206054,'1535-4970','Reply to Rodrigues et al.: Increasing Physical Activity in Daily Life in Chronic Obstructive Pulmonary Disease: To Solve the Puzzle, Every Piece Counts.','No abstract found.','2018-04-15 00:00:00','0000-00-00 00:00:00','2018-05-04 00:00:00',0,0,'Nolan, Claire M, CM|Maddocks, Matthew, M|Canavan, Jane L, JL|Jones, Sarah E, SE|Delogu, Veronica, V|Kaliaraju, Djeya, D|Banya, Winston, W|Kon, Samantha S C, SSC|Polkey, Michael I, MI|Man, William D-C, WD','2018-05-17 22:46:19','2018-05-17 22:46:19'),(96,10,29170500,'1759-4766','White matter disease: Targeted aspartoacylase gene therapy reverts Canavan disease.','No abstract found.','2018-01-01 00:00:00','2017-11-24 00:00:00','2017-12-28 00:00:00',0,0,'Starling, Shimona, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(97,10,29139195,'1440-1843','Phenotypic characteristics associated with slow gait speed in idiopathic pulmonary fibrosis.','Usual gait speed over 4 m (4MGS) is an established functional performance measure in older adults that consistently predicts adverse health outcomes, but few data exist in idiopathic pulmonary fibrosis (IPF). We assessed the reliability of 4MGS, its relationship with established outcome measures and its responsiveness to pulmonary rehabilitation.In four prospective IPF cohorts, 4MGS inter-observer (n = 46) and test-retest (n = 46) reliability, concurrent validity (n = 65 and n = 62) and responsiveness (n = 60) were determined. The phenotypic characteristics of all patients stratified according to slow 4MGS (<0.8 m/s) were compared, including lung function parameters, HRCT of the chest, 6-min walking distance (6MWD), Medical Respiratory Council (MRC) dyspnoea score, King\'s Brief Interstitial Lung Disease (KBILD) questionnaire and Gender, Age and lung Physiology (GAP) prognostic index.Intra-class correlation coefficients for inter-observer and test-retest reliability were 0.996 and 0.983, respectively. There was a strong association between 4MGS and 6MWD (r = 0.76; P < 0.0001) and moderate correlations with MRC (r = -0.56), KBILD (r = 0.44) and GAP index (r = -0.41); all P < 0.005. 4MGS improved significantly with pulmonary rehabilitation (mean (95% CI) change: 0.16 (0.12-0.20) m/s), effect size 0.65. Patients with slow 4MGS had significantly worse exercise performance (6MWD: -167 (-220 to -133) m), dyspnoea, health status and prognosis index than those with preserved 4MGS, despite similar lung function and HRCT parameters.4MGS is a simple, reliable, valid and responsive tool that may detect a patient phenotype with worse exercise performance, dyspnoea, health status and prognosis index in stable IPF.','2018-05-01 00:00:00','2017-11-14 00:00:00','2018-05-04 00:00:00',0,0,'Nolan, Claire M, CM|Maddocks, Matthew, M|Maher, Toby M, TM|Canavan, Jane L, JL|Jones, Sarah E, SE|Barker, Ruth E, RE|Patel, Suhani, S|Jacob, Joseph, J|Cullinan, Paul, P|Man, William D-C, WD','2018-05-17 22:46:19','2018-05-17 22:46:19'),(98,10,29122448,'1873-460X','Validating the association between plasma tumour necrosis factor receptor 1 levels and the presence of renal injury and functional decline in patients with Type 2 diabetes.','Elevated plasma soluble tumour necrosis factor receptor 1 (TNFR1) predicts long-term progression of chronic kidney disease. We investigated the association between elevated TNFR1 and the presence of renal disease in patients with Type 2 diabetes mellitus registering a haemoglobin A1c (HbA1c) >48mmol/mol despite medical therapy.Using sensitivity, specificity and regression analyses we interrogated the association between plasma TNFR1 and presence of chronic kidney disease as assessed by the presence of microalbuminuria and/or an estimated glomerular filtration rate of less than 60ml/min/1.73m (stages 3-5 chronic kidney disease). The association of TNFR1 with C-reactive protein and leptin-adiponectin ratio as plasma markers of systemic inflammation and adipose stress respectively was also investigated.Upper quartile TNFR1 is independently associated with elevated urinary albumin-creatinine ratios, reductions in eGFR and strongly predicts the presence of stages 3-5 chronic kidney disease in regression modelling. Elevated TNFR1 levels are associated with increased plasma C-reactive protein and augmented leptin-adiponectin ratio.Our study confirms plasma TNFR1 as a surrogate of renal structural and functional impairment in patients with type 2 diabetes mellitus. Association of TNFR1 with markers of systemic inflammation and adipose stress indicates that TNFR1 may be a biomarker of these processes as components of the pathogenesis of diabetic kidney disease.','2018-01-01 00:00:00','2017-09-18 00:00:00','2017-12-23 00:00:00',0,0,'Doody, Alison, A|Jackson, Sabrina, S|Elliott, Jessie A, JA|Canavan, Ronan J, RJ|Godson, C, C|Slattery, David, D|Twomey, Patrick J, PJ|McKenna, Malachi J, MJ|le Roux, Carel W, CW|Docherty, Neil G, NG','2018-05-17 22:46:19','2018-05-17 22:46:19'),(99,10,29116375,'1432-0533','Uncoupling N-acetylaspartate from brain pathology: implications for Canavan disease gene therapy.','N-Acetylaspartate (NAA) is the second most abundant organic metabolite in the brain, but its physiological significance remains enigmatic. Toxic NAA accumulation appears to be the key factor for neurological decline in Canavan disease-a fatal neurometabolic disorder caused by deficiency in the NAA-degrading enzyme aspartoacylase. To date clinical outcome of gene replacement therapy for this spongiform leukodystrophy has not met expectations. To identify the target tissue and cells for maximum anticipated treatment benefit, we employed comprehensive phenotyping of novel mouse models to assess cell type-specific consequences of NAA depletion or elevation. We show that NAA-deficiency causes neurological deficits affecting unconscious defensive reactions aimed at protecting the body from external threat. This finding suggests, while NAA reduction is pivotal to treat Canavan disease, abrogating NAA synthesis should be avoided. At the other end of the spectrum, while predicting pathological severity in Canavan disease mice, increased brain NAA levels are not neurotoxic per se. In fact, in transgenic mice overexpressing the NAA synthesising enzyme Nat8l in neurons, supra-physiological NAA levels were uncoupled from neurological deficits. In contrast, elimination of aspartoacylase expression exclusively in oligodendrocytes elicited Canavan disease like pathology. Although conditional aspartoacylase deletion in oligodendrocytes abolished expression in the entire CNS, the remaining aspartoacylase in peripheral organs was sufficient to lower NAA levels, delay disease onset and ameliorate histopathology. However, comparable endpoints of the conditional and complete aspartoacylase knockout indicate that optimal Canavan disease gene replacement therapies should restore aspartoacylase expression in oligodendrocytes. On the basis of these findings we executed an ASPA gene replacement therapy targeting oligodendrocytes in Canavan disease mice resulting in reversal of pre-existing CNS pathology and lasting neurological benefits. This finding signifies the first successful post-symptomatic treatment of a white matter disorder using an adeno-associated virus vector tailored towards oligodendroglial-restricted transgene expression.','2018-01-01 00:00:00','2017-11-07 00:00:00','2018-01-23 00:00:00',0,0,'von Jonquieres, Georg, G|Spencer, Ziggy H T, ZHT|Rowlands, Benjamin D, BD|Klugmann, Claudia B, CB|Bongers, Andre, A|Harasta, Anne E, AE|Parley, Kristina E, KE|Cederholm, Jennie, J|Teahan, Orla, O|Pickford, Russell, R|Delerue, Fabien, F|Ittner, Lars M, LM|Fröhlich, Dominik, D|McLean, Catriona A, CA|Don, Anthony S, AS|Schneider, Miriam, M|Housley, Gary D, GD|Rae, Caroline D, CD|Klugmann, Matthias, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(100,11,29752948,'1095-8584','Functional and transcriptomic insights into pathogenesis of R9C phospholamban mutation using human induced pluripotent stem cell-derived cardiomyocytes.','Dilated cardiomyopathy (DCM) can be caused by mutations in the cardiac protein phospholamban (PLN). We used CRISPR/Cas9 to insert the R9C PLN mutation at its endogenous locus into a human induced pluripotent stem cell (hiPSC) line from an individual with no cardiovascular disease. R9C PLN hiPSC-CMs display a blunted β-agonist response and defective calcium handling. In 3D human engineered cardiac tissues (hECTs), a blunted lusitropic response to β-adrenergic stimulation was observed with R9C PLN. hiPSC-CMs harboring the R9C PLN mutation showed activation of a hypertrophic phenotype, as evidenced by expression of hypertrophic markers and increased cell size and capacitance of cardiomyocytes. RNA-seq suggests that R9C PLN results in an altered metabolic state and profibrotic signaling, which was confirmed by gene expression analysis and picrosirius staining of R9C PLN hECTs. The expression of several miRNAs involved in fibrosis, hypertrophy, and cardiac metabolism were also perturbed in R9C PLN hiPSC-CMs. This study contributes to better understanding of the pathogenic mechanisms of the hereditary R9C PLN mutation in the context of human cardiomyocytes.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-12 00:00:00',0,0,'Ceholski, Delaine K, DK|Turnbull, Irene C, IC|Kong, Chi-Wing, CW|Koplev, Simon, S|Mayourian, Joshua, J|Gorski, Przemek A, PA|Stillitano, Francesca, F|Skodras, Angelos A, AA|Nonnenmacher, Mathieu, M|Cohen, Ninette, N|Björkegren, Johan L M, JLM|Stroik, Daniel R, DR|Cornea, Razvan L, RL|Thomas, David D, DD|Li, Ronald A, RA|Costa, Kevin D, KD|Hajjar, Roger J, RJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(101,11,29752569,'1432-0878','Widespread expression of perilipin 5 in normal human tissues and in diseases is restricted to distinct lipid droplet subpopulations.','Diseases associated with the accumulation of lipid droplets are increasing in western countries. Lipid droplet biogenesis, structure and degradation are regulated by proteins of the perilipin family. Perilipin 5 has been shown to regulate basal lipolysis in oxidative tissues. We examine perilipin 5 in normal human tissues and in diseases using protein biochemical and microscopic techniques. Perilipin 5 was constitutively located at small lipid droplets in skeletal myocytes, cardiomyocytes and brown adipocytes. In addition, perilipin 5 was detected in the epithelia of the gastrointestinal and urogenital tract, especially in hepatocytes, the mitochondria-rich parietal cells of the stomach, tubular kidney cells and ductal cells of the salivary gland and pancreas. Granular cytoplasmic expression, without a lipid droplet-bound localization was detected elsewhere. In cardiomyopathies, in skeletal muscle diseases and during hepatocyte steatogenesis, perilipin 5 was upregulated and localized to larger and more numerous lipid droplets. In steatotic human hepatocytes, perilipin 5 was moderately increased and colocalized with perilipins 1 and 2 but not with perilipin 3 at lipid droplets. In liver diseases implicated in alterations of mitochondria, such as mitochondriopathies, alcoholic liver disease, Wilson\'s disease and acute liver injury, perilipin 5 was frequently localized to small lipid droplets and less in the cytoplasm. In tumorigenesis, perilipin 5 was especially upregulated in lipo-, leio- and rhabdomyosarcoma and hepatocellular and renal cell carcinoma. In summary, our study provides evidence that perilipin 5 is not restricted to certain cell types but localizes to distinct lipid droplet subpopulations reflecting a possible function in oxidative energy supply in normal tissues and in diseases.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Hashani, Merita, M|Witzel, Hagen Roland, HR|Pawella, Lena Maria, LM|Lehmann-Koch, Judith, J|Schumacher, Jens, J|Mechtersheimer, Gunhild, G|Schnölzer, Martina, M|Schirmacher, Peter, P|Roth, Wilfried, W|Straub, Beate Katharina, BK','2018-05-17 22:46:19','2018-05-17 22:46:19'),(102,11,29752433,'2041-4889','Palmitic acid, but not high-glucose, induced myocardial apoptosis is alleviated by N‑acetylcysteine due to attenuated mitochondrial-derived ROS accumulation-induced endoplasmic reticulum stress.','Pharmacological inhibition of reactive oxygen species (ROS) is a potential strategy to prevent diabetes-induced cardiac dysfunction. This study was designed to investigate precise effects of antioxidant N‑acetylcysteine (NAC) in alleviating diabetic cardiomyopathy (DCM). Echocardiography and histologic studies were performed 12 weeks after streptozocin injection. Protein levels involved in endoplasmic reticulum stress (ERS) and apoptosis were analyzed by western blotting in diabetic hearts or high-glucose (HG, 30 mM)- and palmitic acid (PA, 300 μM)-cultured neonatal rat cardiomyocytes (NRCMs). ROS generation and structural alterations of mitochondria were also assessed. We report that NAC alleviated diabetes-induced cardiac abnormality, including restored ejection fraction (EF %), fraction shortening (FS %), peak E to peak A ratio (E/A) and reduced cardiac hypertrophy and fibrosis. These effects were concomitant with blocked ERS and apoptosis, as evidenced by inactivation of phosphorylated inositol-requiring enzyme-1α (IRE1α)/spliced X-box binding protein 1 (XBP1), phosphorylated protein kinase-like kinase (PERK)/phosphorylated eukaryotic initiation factor 2α (eIF2α) and glucose-regulated protein 78 (GRP78)/activating transcription factor 6 (ATF6α)/C/EBP homologous protein (CHOP) pathways, as well as suppressed Bcl-2-associated X protein (BAX)/B-cell lymphoma-2 (Bcl-2) and cleaved caspase 3 expressions. Mechanistically, PA mediated excessive mitochondrial ROS generation and oxidative stress, which were antagonized by NAC and Mito-TEMPO, a mitochondrial ROS inhibitor. No effects were noted by addition of apocynin, a nicotinamide adenine dinucleotide phosphate (NADPH) oxidase inhibitor, and NADPH oxidase 4 (NOX 4) and NOX 2 expressions were not altered, indicating that PA-induced ROS generation is independent of NADPH oxidases. Most intriguingly, HG failed to promote ROS production despite its ability to promote ERS and apoptosis in NRCMs. Collectively, these findings indicate that NAC primarily abrogates PA-mediated mitochondrial ROS through ERS and therefore alleviates myocardial apoptosis but has little effect on HG-induced cardiac injury. This uncovers a potential role for NAC in formulating novel cardioprotective strategies in DCM patients.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'He, Yang, Y|Zhou, Lingyun, L|Fan, Zhiqiang, Z|Liu, Shikun, S|Fang, Weijin, W','2018-05-17 22:46:19','2018-05-17 22:46:19'),(103,11,29752393,'1942-0080','Cardiac Structural Remodeling, Longitudinal Systolic Strain, and Torsional Mechanics in Lean and Nonlean Dysglycemic Chinese Adults.','Diabetes mellitus and pre-diabetes mellitus are associated with lower body mass indices and increased risk of cardiovascular events (including heart failure) at lower glucose thresholds in Chinese compared with Western cohorts. However, the extent of cardiac remodeling and regulation on cardiac mechanics in lean and nonlean dysglycemic Chinese adults is understudied.We studied 3950 asymptomatic Chinese (aged 49.7±10.7 years; 65% male; body mass index: 24.3±3.5 kg/m) with comprehensive echocardiography including speckle tracking for left ventricular global longitudinal strain/torsion, with plasma sugar, glycosylated hemoglobin (HbA1c), and insulin resistance (homeostasis model assessment of insulin resistance) obtained. Participants were classified as (1) nondiabetic (fasting glucose <100 mg/mL; HbA1c <5.7%; n=1416), prediabetic (fasting glucose 100-126 mg/dL; HbA1c 5.7%-6.4%; n=2029), or diabetic (n=505) and (2) lean (body mass index <23 kg/m; n=1445) or nonlean (n=2505). Higher sugar, HbA1c, and homeostasis model assessment of insulin resistance were independently associated with higher left ventricular mass, greater mass-to-volume ratio, more impaired diastolic indices, and worse global longitudinal strain even after adjusting for clinical covariates (adjusted coefficient value: 0.28/0.12 for global longitudinal strain per 1 U HbA1c/homeostasis model assessment of insulin resistance increment; both <0.001), with a consistent trend toward greater torsion (all trend <0.001). The optimal cutoffs in identifying subclinical systolic dysfunction (global longitudinal strain more impaired than -18%) for lean versus nonlean individuals were 97 versus 106 mg/dL for fasting sugar, 130 versus 135 mg/mL for postprandial sugar, 5.62% versus 6.28% for HbA1c, and 1.81 versus 2.40 for homeostasis model assessment of insulin resistance, respectively.These data demonstrate the presence of preclinical cardiac remodeling and systolic dysfunction in prediabetic and diabetic Chinese adults, occurring at lower thresholds of glycemic indices than defined by international standards, particularly in lean individuals.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-05-12 00:00:00',0,0,'Lin, Jiun-Lu, JL|Sung, Kuo-Tzu, KT|Su, Cheng-Huang, CH|Chou, Tzu-Hsun, TH|Lo, Chi-In, CI|Tsai, Jui-Peng, JP|Chang, Shun-Chuan, SC|Lai, Yau-Huei, YH|Hu, Kuang-Chun, KC|Liu, Chia-Yuan, CY|Yun, Chun-Ho, CH|Hung, Chung-Lieh, CL|Yeh, Hung-I, HI|Lam, Carolyn S P, CSP','2018-05-17 22:46:19','2018-05-17 22:46:19'),(104,11,29752111,'1873-0191','Doxorubicin-DNA adduct entrenched and motif tethered artificial virus encased in pH-responsive polypeptide complex for targeted cancer therapy.','Doxorubicin is a broad spectrum anticancer antibiotic that possesses toxic effects such as cardiomyopathy, that even lead to congestive heart failure. Thus, the development of a new bio-inspired system is required, that retain the advantageous effect of doxorubicin while retarding the side effects. Hence, a system was developed that we describe \'doxorubicin-DNA adduct entrenched artificial virus encased in polypeptide complex\'. The drug-DNA adduct (DDA) was prepared by a formaldehyde mediated reaction. A simple chloroform extraction method for the separation of DDA was developed. DDA was employed to self-assemble the folate tethered bovine serum albumin to form the protein coat in the proposed artificial virus. The folate tethered albumin provides an artificial virus concept, with tumor tissue targeting due to the presence of folate. The whole system was then encased in a pH-responsive polypeptide complex that dissolves in acidic pH, but not in basic pH. DDA was evaluated by UV-Vis spectrophotometry, spectrofluorimetry and high-performance liquid chromatography (HPLC). A promising drug release at physiological condition was observed from DDA. The developed system was evaluated by a developed and validated artificial cell apparatus that mimic the features of a cancer cell. The drug delivery system displayed a considerable amount of drug release within 24 h. Moreover, the developed artificial virus system reduced angiogenesis caused by tumor cells in chick chorioallantoic membrane. Histopathology of treated chicken heart slices demonstrated that the developed artificial virus system reduces the tissue deformation and apoptosis in heart tissue slices, thus providing a new approach to prevent Dox-induced cardiomyopathy.','2018-08-01 00:00:00','2018-04-12 00:00:00','2018-05-12 00:00:00',0,0,'Ajithkumar, K C, KC|Pramod, K, K','2018-05-17 22:46:19','2018-05-17 22:46:19'),(105,11,29750433,'1932-8737','Absence of a primary role for TTN missense variants in arrhythmogenic cardiomyopathy: From a clinical and pathological perspective.','Arrhythmogenic cardiomyopathy (ACM) is an inheritable heart disease characterized by fibro-fatty replacement of the myocardium. TTN missense variants were previously reported as a pathogenic factor for ACM.TTN missense variants are commonly identified in ACM, but have limited effect on the phenotype of ACM.We sequenced 15 ACM-related genes in 35 patients who had a heart transplantation and quantified myocardium, and fibrous and adipose tissue in blocks of the explanted heart. Clinical and pathological characteristics were compared between patients with TTN variants and others. Pedigree analysis was performed in 3 families with TTN variants.TTN variants were detected in 11 patients (all missense, 9 heterozygous and 2 oligogenic form). The TTN truncating variant was absent in the cohort. Patients with TTN variants had late onset age of the disease (31 ±13 years vs 17 ±3 years, P = 0.049) and age of heart transplantation (41 ±14 years vs 24 ±9 years, P = 0.027), larger left ventricle end-diastolic diameter (62 ±10 mm vs 45 ±10 mm, P = 0.019), smaller right ventricular outflow tract (34 ±14 mm vs 50 ±15 mm, P = 0.046), more myocardium (40.8% ±29.4% vs 13.8% ±11.0%, P = 0.017), and less adipose tissue (43.0% ±30.9% vs 66.9% ±18.5%, P = 0.036) in right ventricle than those with desmosomal variants. There was few difference between patients with TTN variants and those without variants. Pedigrees showed none of the family members with TTN missense variants had a disease phenotype, indicating a very low penetrance.TTN missense variants was commonly identified in ACM patients in this cohort, but hardly played a primary role in ACM as causative variants.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-11 00:00:00',0,0,'Chen, Kai, K|Song, Jiangping, J|Wang, Zhen, Z|Rao, Man, M|Chen, Liang, L|Hu, Shengshou, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(106,11,29750365,'1540-8159','Effect of coronary revascularization on long term clinical outcomes in patients with ischemic cardiomyopathy and recurrent ventricular arrhythmia.','Patients with ventricular tachycardia (VT) post myocardial infarction (MI) are a higher risk group with significant morbidity and mortality. We examined the impact of prior coronary revascularization on clinical outcomes in patients with ischemic cardiomyopathy (ICM) and VT.The VANISH trial randomized 259 patients with prior MI and antiarrhythmic drug-refractory VT to receive escalated medical therapy or catheter ablation. Clinical outcomes were compared according to whether patients have undergone prior revascularization procedures. The primary outcome was a composite of death, appropriate Implantable cardiac defibrillator (ICD) shock or VT storm. The secondary outcomes included elements of the primary outcome, hospitalization, and any ventricular arrhythmia.190 patients (73%) had prior coronary revascularization. Revascularization group had more men (97% vs 83%; P = 0.0003) and patients in that group were older (mean age 69.3 ± 7.6 vs 66.7 ± 9.2; P = 0.04), had more renal insufficiency (22.6% vs 8.7%; P = 0.01) and were more likely to have an implanted cardiac resynchronization device (23% vs 10%, P = 0.03) as compared with the non-revascularized patients. There were no significant differences in baseline medication use. There was a trend towards fewer hospitalizations in the revascularization group (64% vs 77%; P = 0.07); there were no differences in the individual outcomes of mortality, VT storm, ICD shocks, recurrent MI or cardiac failure.In this cohort of patients with an ischemic cause for VT, a history of prior coronary revascularization was not associated with a reduction in ventricular arrhythmia or mortality. This article is protected by copyright. All rights reserved.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-11 00:00:00',0,0,'Elsokkari, Ihab, I|Parkash, Ratika, R|Gray, Chris J, CJ|Gardner, Martin J, MJ|AbdelWahab, Amir M, AM|Doucette, Steve, S|Tang, Anthony S, AS|Wells, George A, GA|Stevenson, William G, WG|Sapp, John L, JL','2018-05-17 22:46:19','2018-05-17 22:46:19'),(107,11,29749992,'0253-0716','A New Mutation Causing Severe Infantile-Onset Pompe Disease Responsive to Enzyme Replacement Therapy.','Pompe disease (PD), also known as \"glycogen storage disease type II (OMIM # 232300)\" is a rare autosomal recessive disorder characterized by progressive glycogen accumulation in cellular lysosomes. It ultimately leads to cellular damage. Infantile-onset Pompe disease (IOPD) is the most severe type of this disease and is characterized by severe hypertrophic cardiomyopathy and generalized hypotonia. Mutations in the  () gene, located at locus 17q25.3, are responsible for the disease leading to reduced activity of the acid alpha-glucosidase enzyme. To date, approximately 400 pathogenic mutations have been reported in the  gene. The aim of this study is to report a novel nonsense mutation in exon 4 of  gene in an Iranian child suffering from IOPD. The patient was a female neonate with hypertrophic cardiomyopathy and a positive family history of IOPD. After definite diagnosis, enzyme-replacement therapy (ERT) was started for the patient, who was 2 months old. Now at the age of 20 months, she has had good growth and development and her echocardiographic parameters are within the normal range. This report shows that IOPD patients with this mutation can be treated with ERT successfully.','2018-03-01 00:00:00','0000-00-00 00:00:00','2018-05-11 00:00:00',0,0,'Moravej, Hossein, H|Amirhakimi, Anis, A|Showraki, Alireza, A|Amoozgar, Hamid, H|Hadipour, Zahra, Z|Nikfar, Ghasem, G','2018-05-17 22:46:19','2018-05-17 22:46:19'),(108,11,29749944,'2405-5018','The Wearable Cardioverter-Defibrillation: An Investment Worth Making or Needing Further Investigation?','No abstract found.','2018-02-01 00:00:00','2017-11-29 00:00:00','2018-05-11 00:00:00',0,0,'Adelstein, Evan, E|Saba, Samir, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(109,11,29749943,'2405-5018','Experience With Wearable Cardioverter-Defibrillators at 2 Academic Medical Centers.','This study sought to characterize the experience in a cohort of patients prescribed a wearable cardioverter-defibrillator (WCD) over a 2-year interval at 2 academic medical centers.The WCD is available for patients felt to be at high risk of sudden cardiac death. However, there is a lack of randomized data to guide its use and prescribing patterns vary.We retrospectively reviewed indications and therapies of all WCD prescriptions over a 2-year period from 2 large academic medical centers. Data on compliance and treatment events of patients wearing the WCD were reviewed.Among the 147 patients prescribed a WCD, 80% were male with an age of 59 ± 14 years. The WCD was prescribed for the following reasons: primary prevention in the setting of a left ventricular ejection fraction ≤35% (53%), secondary prevention when an implantable cardioverter-defibrillator was not implanted (16%), implantable cardioverter-defibrillator explantation (23%), and other high-risk scenarios for arrhythmic sudden death (9%). The median wear duration was 50 days (interquartile range [IQR]: 25 to 85 days) with a median of 21.0 h of wear per day (IQR: 15.0 to 22.8 h). High-voltage treatment was delivered in 3 separate patients, 2 of whom died. The third patient received 3 WCD shocks without restoration of a perfusing rhythm and ultimately was resuscitated by emergency responders. No patients received inappropriate therapies.Events requiring therapy were rare and no lives were directly saved by the WCD. Future efforts are needed to improve identification of patients most likely to benefit from a WCD.','2018-02-01 00:00:00','2017-11-15 00:00:00','2018-05-11 00:00:00',0,0,'Leyton-Mange, Jordan S, JS|Hucker, William J, WJ|Mihatov, Nino, N|Reynolds, Matthew, M|Albert, Christine, C|Lubitz, Steven A, SA|Milan, David J, DJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(110,12,29743011,'1471-2253','Procaine and saline have similar effects on articular cartilage and synovium in rat knee.','Intra-articular local anaesthetics are widely used for providing postoperative analgesia and decreasing the need for opioids. Procaine has proven positive effects in carpal tunnel syndrome and chondromalacia patella. However, the effect of procaine on articular cartilage has not yet been studied. The aim of this study was to evaluate the effects of intra-articular procaine injection on the articular cartilage and the synovium.Twenty adult Sprague-Dawley rats were enrolled in the study. After providing anaesthesia and aseptic conditions, 0.25 ml of 10% procaine was injected to the right knee joint, and 0.25 ml of normal saline (as control group) was injected to the left knee joint. Knee joint samples were obtained from four rats in each group after appropriate euthanasia on days 1, 2, 7, 14 and 21. The histological sections of the articular and periarticular regions and the synovium were evaluated by two histologists, and inflammatory changes were graded according to a five-point scale in a blinded manner. The apoptosis of chondrocytes was determined by the caspase-3 indirect immunoperoxidase method.There were no significant differences in inflammation between procaine and saline groups at any of the time intervals. Slight inflammatory infiltration due to injection was seen in both groups on the 1st day. Haemorrhage was observed in both groups at days 1 and 2, and the difference between groups was not found to be significant. No significant difference was detected in the percentage of apoptotic chondrocytes between groups at any of the time intervals.Injection of procaine seems safe to use intra-articularly based on this in vivo study on rat knee cartilage. However, further studies investigating both the analgesic and histopathological effects of procaine on damaged articular cartilage and synovium models are needed.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-10 00:00:00',0,0,'Ankay Yilbas, Aysun, A|Akca, Basak, B|Buyukakkus, Berkem, B|Bahador Zirh, Elham, E|Zeybek, Dilara, D|Uzumcugil, Filiz, F|Saricaoglu, Fatma, F','2018-05-17 22:46:19','2018-05-17 22:46:19'),(111,12,29736220,'2008-384X','Determination of cut-off point of cross-sectional area of median nerve at the wrist for diagnosing carpal tunnel syndrome.','No abstract found.','2017-10-07 00:00:00','0000-00-00 00:00:00','2018-05-11 00:00:00',0,0,'Ghasemi, Majid, M|Masoumi, Sanaz, S|Ansari, Behnaz, B|Fereidan-Esfahani, Mahboobeh, M|Mousavi, Seyed Morteza, SM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(112,12,29734916,'2424-8363','Carpal Tunnel Syndrome in Aberrant Muscle Syndrome: A Case Report and Review of the Literature.','Aberrant Muscle Syndrome (AMS) is a rare congenital hand difference that is characterised by unilateral non-progressive muscular hyperplasia. The aetiology of aberrant muscle syndrome is not known, but a recently published case has shown a somatic PIK3CA activating mutation in a patient with AMS. Carpal tunnel syndrome (CTS) in children is rare. The most common causes are the mucopolysaccaridoses but space-occupying lesions have also been reported to cause CTS in children. We report the first case of CTS in a child with AMS successfully treated with open carpal tunnel release and excision of aberrant muscles.','2018-06-01 00:00:00','0000-00-00 00:00:00','2018-05-08 00:00:00',0,0,'Steele, Jessica, J|Coombs, Christopher, C','2018-05-17 22:46:19','2018-05-17 22:46:19'),(113,12,29734910,'2424-8363','Bilateral Bifid Median Nerve with Bilateral Carpal Tunnel Syndrome: An Atypical Presentation, a Rare Cause and a Familiar Disease.','We report a case of bilateral carpal tunnel syndrome (CTS) with bilateral bifid median nerve (BMN) without a persistent median artery diagnosed by clinical examination, NCV and Ultrasonography. Bilateral BMN to produce bilateral CTS is extremely rare and is contrary to the popular classifications which state that BMN without persistent median artery or its anomalies will not produce CTS. Ultrasonogram is of additional help to identify such aberrations in the median nerve to prevent iatrogenic injuries during carpal tunnel decompression.','2018-06-01 00:00:00','0000-00-00 00:00:00','2018-05-08 00:00:00',0,0,'Bhat, Anil K, AK|Acharya, Ashwath M, AM|Narayana Kurup, Jayakrishnan K, JK|Chakraborti, Abhishek, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(114,12,29731590,'0974-2077','Carpal Tunnel Syndrome Caused by Intraneural Lipoma of the Median Nerve and Arteriovenous Malformation.','Carpal tunnel syndrome can be the result of a wide variety of etiologic factors. Compressive causes are rare and tumors causing compression are even rarer. We present a case with a carpal tunnel syndrome caused by an intraneural lipoma and an arteriovenous malformation concomitantly. The lesions were excised, and the patient recovered with full hand function and entire disappearance of acroparesthesia. To our knowledge, this is the first case report of carpal tunnel syndrome caused by an intraneural lipoma and an arteriovenous malformation concomitantly.','2018-01-01 00:00:00','0000-00-00 00:00:00','2018-05-09 00:00:00',0,0,'Aydin, Arif, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(115,12,29731324,'1873-2380','Comparison of two ways of altering carpal tunnel pressure with ultrasound surface wave elastography.','Higher carpal tunnel pressure is related to the development of carpal tunnel syndrome. Currently, the measurement of carpal tunnel pressure is invasive and therefore, a noninvasive technique is needed. We previously demonstrated that speed of wave propagation through a tendon in the carpal tunnel measured by ultrasound elastography could be used as an indicator of carpal tunnel pressure in a cadaveric model, in which a balloon had to be inserted into the carpal tunnel to adjust the carpal tunnel pressure. However, the method for adjusting the carpal tunnel pressure in the cadaveric model is not applicable for the in vivo model. The objective of this study was to utilize a different technique to adjust carpal tunnel pressure via pressing the palm and to validate it with ultrasound surface wave elastography in a human cadaveric model. The outcome was also compared with a previous balloon insertion technique. Results showed that wave speed of intra-carpal tunnel tendon and the ratio of wave speed of intra-and outer-carpal tunnel tendons increased linearly with carpal tunnel pressure. Moreover, wave speed of intra carpal tunnel tendon via both ways of altering carpal tunnel pressure showed similar results with high correlation. Therefore, it was concluded that the technique of pressing the palm can be used to adjust carpal tunnel pressure, and pressure changes can be detected via ultrasound surface wave elastography in an ex vivo model. Future studies will utilize this technique in vivo to validate the usefulness of ultrasound surface wave elastography for measuring carpal tunnel pressure.','2018-04-12 00:00:00','2018-04-12 00:00:00','2018-05-07 00:00:00',0,0,'Cheng, Yu-Shiuan, YS|Zhou, Boran, B|Kubo, Kazutoshi, K|An, Kai-Nan, KN|Moran, Steven L, SL|Amadio, Peter C, PC|Zhang, Xiaoming, X|Zhao, Chunfeng, C','2018-05-17 22:46:19','2018-05-17 22:46:19'),(116,12,29724426,'1558-349X','ACR Appropriateness Criteria Chronic Wrist Pain.','Radiographs are indicated as the first imaging test in all patients with chronic wrist pain, regardless of the suspected diagnosis. When radiographs are normal or equivocal, advanced imaging with MRI (without or without intravenous contrast or following arthrography), CT (usually without contrast), and ultrasound each has a role in establishing a diagnosis. Furthermore, these examinations may contribute to staging disease, treatment planning, and prognostication, even when radiographs are diagnostic of a specific condition. Which examination or examinations are best depends on the specific location of pain and the clinically suspected conditions. The American College of Radiology Appropriateness Criteria are evidence-based guidelines for specific clinical conditions that are reviewed annually by a multidisciplinary expert panel. The guideline development and revision include an extensive analysis of current medical literature from peer reviewed journals and the application of well-established methodologies (RAND/UCLA Appropriateness Method and Grading of Recommendations Assessment, Development, and Evaluation or GRADE) to rate the appropriateness of imaging and treatment procedures for specific clinical scenarios. In those instances where evidence is lacking or equivocal, expert opinion may supplement the available evidence to recommend imaging or treatment.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-05-04 00:00:00',0,0,'Expert Panel on Musculoskeletal Imaging:|Rubin, David A, DA|Roberts, Catherine C, CC|Bencardino, Jenny T, JT|Bell, Angela M, AM|Cassidy, R Carter, RC|Chang, Eric Y, EY|Gyftopoulos, Soterios, S|Metter, Darlene F, DF|Morrison, William B, WB|Subhas, Naveen, N|Tambar, Siddharth, S|Towers, Jeffrey D, JD|Yu, Joseph S, JS|Kransdorf, Mark J, MJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(117,12,29722324,'1673-5374','Brain remodeling after chronic median nerve compression in a rat model.','Carpal tunnel syndrome is the most common compressive neuropathy, presenting with sensorimotor dysfunction. In carpal tunnel syndrome patients, irregular afferent signals on functional magnetic resonance imaging are associated with changes in neural plasticity during peripheral nerve injury. However, it is difficult to obtain multi-point neuroimaging data of the brain in the clinic. In the present study, a rat model of median nerve compression was established by median nerve ligation, i.e., carpal tunnel syndrome model. Sensory cortex remodeling was determined by functional magnetic resonance imaging between normal rats and carpal tunnel syndrome models at 2 weeks and 2 months after operation. Stimulation of bilateral paws by electricity for 30 seconds, alternating with 30 seconds of rest period (repeatedly 3 times), resulted in activation of the contralateral sensorimotor cortex in normal rats. When carpal tunnel syndrome rats received this stimulation, the contralateral cerebral hemisphere was markedly activated at 2 weeks after operation, including the primary motor cortex, cerebellum, and thalamus. Moreover, this activation was not visible at 2 months after operation. These findings suggest that significant remodeling of the cerebral cortex appears at 2 weeks and 2 months after median nerve compression.','2018-04-01 00:00:00','0000-00-00 00:00:00','2018-05-03 00:00:00',0,0,'Bao, Bing-Bo, BB|Qu, Dan-Qian, DQ|Zhu, Hong-Yi, HY|Gao, Tao, T|Zheng, Xian-You, XY','2018-05-17 22:46:19','2018-05-17 22:46:19'),(118,12,29722064,'1098-2353','High Wrist Ratio is a Risk Factor for Carpal Tunnel Syndrome.','Carpal Tunnel Syndrome (CTS) is the most common upper extremity entrapment neuropathy and various risk factors have been implicated in the etiology. In this study, we aimed to determine whether anthropometric measurements are independent risk factors for CTS.Patients with symptoms of CTS (n= 27) and asymptomatic controls (n=27) were enrolled following electrophysiological confirmation. Body mass index (BMI) was recorded and anthropometric measurements of the hand were made by a digital caliper.BMI, wrist width, wrist depth, palm length, hand width, wrist ratio, wrist/palm ratio and wrist/hand ratio were significantly higher in the CTS group. BMI, wrist ratio, wrist/palm ratio and wrist/hand ratio were independent variables in the logistic regression analysis; wrist ratio was the only significant predictor of CTS. Patients with a wrist ratio higher than 0.69 were 8.2 times more likely to have CTS.This study suggests that wrist ratio may be considered as an independent risk factor for CTS. This article is protected by copyright. All rights reserved.','2018-05-03 00:00:00','2018-05-03 00:00:00','2018-05-03 00:00:00',0,0,'Ozcakir, S, S|Sigirli, D, D|Avsaroglu, H, H','2018-05-17 22:46:19','2018-05-17 22:46:19'),(119,12,29720795,'0972-2327','Determinants of Remission in Medically Treated Carpal Tunnel Syndrome: Study from Central India.','The factors associated with the spontaneous remission (SR) of symptoms in carpal tunnel syndrome (CTS) are not well known.To look for determinants of SR in medically treated, electrophysiologically proven patients of CTS.We revisited the medical records and nerve conduction study data of 130 hands with CTS and divided them into two groups as per the absence or persistence of the symptoms when contacted after a median time lapse of 3 years following the diagnosis.SR occurred in 46.1% of the hands. Higher odds of SR were linked with female gender, symptoms restriction to lateral fingers, symptom duration <10 months, mildly delayed median motor and sensory distal latencies, and median sensory amplitude >20 μV. We developed a seven-point scale, on which a score of ≥4 had a strong association (odds ratio 4.31) with SR.No single risk factor, standalone, can predict SR in patients with CTS, which could lead to an invasive treatment (Surgery or local injection) to them. We propose that patients scoring ≥4 on our 7 point scale should be treated medically for the initial 10 months after the symptom onset.','2018-01-01 00:00:00','0000-00-00 00:00:00','2018-05-07 00:00:00',0,0,'Sodani, Ajoy, A|Dani, Raunak, R|Dube, Mukesh, M|Choukesey, Dinesh, D|Athale, Sunil, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(120,13,29753013,'1879-0003','Transferrin-anchored poly(lactide) micelles to improve anticancer activity of curcumin in hepatic and cervical cancer cell monolayers and 3D spheroids.','In recent years, actively targeted drug delivery systems have been utilized in pre-clinical studies for site-specific delivery of drugs, which reduces toxicities associated with chemotherapy. This study reports the preparation of the tumor homing ligand, transferrin (Tf) anchored methoxy-polyethylene glycol-poly(d,l-lactide) polymeric micelles (Tf-PP). Curcumin which possess wide anti-cancer activity was loaded into the micelles. Tf-PPC with average particle size of 132.16 ± 1.3 nm and encapsulation efficiency of 88.27 ± 4.8% showed a sustained drug release. The efficacy of Tf-PPC was studied in vitro in Tf-overexpressing human cervical carcinoma (HeLa) and human hepatoma (HepG2) cells. The mouse embryo fibroblast (NIH-3T3) cells were used as control cells. Tf-PPC showed higher internalization compared to non-targeted micelles (PPC). The curcumin-mediated cytotoxicity increased significantly following Tf-PPC treatment in both the tested cell lines. In NIH-3T3 cells, Tf conjugation did not differ in comparison to the non-targeted micelles. Further, the efficiency of Tf-PPC was studied in three-dimensional (3D) HeLa tumor spheroids. The Tf-PPC was efficiently internalized by the spheroidal structures, causing higher cytotoxicity and apoptosis compared to PPC. These results reveal that the newly developed, Tf-PPC could be employed as an effective chemotherapy in the treatment of Tf-overexpressing cancers.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-12 00:00:00',0,0,'Kumari, Preeti, P|Rompicharla, Sri Vishnu Kiran, SVK|Muddineti, Omkara Swami, OS|Ghosh, Balaram, B|Biswas, Swati, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(121,13,29752912,'1873-3492','Association between viral loads of different oncogenic human papillomavirus types and the degree of cervical lesions in the progression of cervical Cancer.','In this study we determined the frequency of the most prevalent human papillomavirus (HPV) types in China and evaluated the association between viral loads of different oncogenic HPV types and the severity of disease.We enrolled 15,518 women for this study and 3199 of them (20.61%) were identified as positive by a PCR assay, that can simultaneously quantify and genotype HPV.The viral loads of HPV 16, 31, 35, 52, 58, 39, and 56 were lower for women with normal cytology compared to those with disease progression; viral loads were not appreciable for HPV 33, 18, 45, 59, 68, 53, 66, and 51. The viral load of species 9 appeared significantly higher for women with cervical intraepithelial neoplasia (CIN) 2/CIN 3 relative to women with normal/low grade squamous intraepithelial lesion (LSIL)/CIN1 (P < 0.001), and significantly lower compared to those with cervical cancer (P < 0.001). The viral load of HPV species 6 was slightly higher for women with CIN2/CIN 3 compared to women with normal/LSIL/CIN1 (P = 0.002), and not significantly different from women with cervical cancer (P = 0.548). In addition, no statistically significant difference was found in HPV species 5 or species 7 (P = 0.898; P = 0.136).The HPV viral load-associated risk for developing into CIN and cervical cancer is likely to be species-dependent and primarily restricted to species 9 (types phylogenetically close to HPV16).','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-12 00:00:00',0,0,'Wang, Wei, W|Zhang, Xian-Hui, XH|Li, Mei, M|Hao, Chong-Hua, CH|Zhao, Zhi-Min, ZM|Liang, Hong-Ping, HP','2018-05-17 22:46:19','2018-05-17 22:46:19'),(122,13,29752860,'1600-0714','Perspectives on Oral Squamous Cell Carcinoma Prevention - Proliferation, Position, Progression and Prediction.','Squamous cell carcinoma arising from oral mucosal epithelium remains a lethal and deforming disease due to tumour invasion, oro-facial destruction, cervical lymph node metastasis and ultimate blood-borne dissemination. Worldwide, 300,000 new cases are seen each year, with a recent and significant rise in incidence affecting particularly the young. In order to rationalize perspectives on preventive strategies in oral cancer management, this paper addresses a number of fundamental questions regarding carcinogenesis: Proliferation - what epithelial cell changes precede tumour development? Position - why are certain oral sites so predisposed to cancer? Progression - why do some precursor lesions progress to invasive carcinoma and others do not? Prediction - how can we predict individual patient and/or lesion behaviour to prevent disease progression? By improving our understanding of oral carcinogenesis, can we thereby facilitate more effective primary, secondary and tertiary preventive strategies and ultimately reduce the global burden of OSCC? This article is protected by copyright. All rights reserved.','2018-05-12 00:00:00','2018-05-12 00:00:00','2018-05-12 00:00:00',0,0,'Thomson, P J, PJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(123,13,29752836,'1365-3156','Effect of a \'diagonal\' intervention on uptake of HIV and reproductive health services by female sex workers in three sub-Saharan African cities.','To enhance uptake of sexual and reproductive health (SRH) services by female sex workers (FSWs), we conducted an implementation study in which we piloted and tested context-specific \'diagonal\' interventions, combining vertical, targeted interventions with horizontally improved access to the general health services, in three cities in sub-Saharan Africa.We collected indicators of SRH service uptake through face-to-face interviews with approximately 400 FSWs, pre- and post-intervention, in Durban, South Africa; Tete, Mozambique; and Mombasa, Kenya, recruited by respondent-driven sampling. Changes in uptake were tested for their statistical significance using multivariate logistic regression models.In all cities overall uptake of services increased. Having used all services for contraception, STI care, HIV testing, HIV care, cervical cancer screening and sexual violence, if needed, increased from 12.5% to 41.5% in Durban, 25.0% to 40.1% in Tete, and 44.9% to 69.1% in Mombasa. Across cities, the effect was greatest in having been tested for HIV in the past six months which increased from 40.9% to 83.2% in Durban, 56.0% to 76.6% in Tete, and 70.9% to 87.6% in Mombasa. In Tete and Mombasa rise in SRH service use was almost entirely due to a greater uptake of targeted services. Only in Durban was there additionally an increase in the utilization of general health services.SRH service utilization improved in the short-term in three different sub-Saharan African contexts, primarily through vertical, targeted components. The long-term effectiveness of diagonal approaches, in particular on the use of general, horizontal health services, needs further investigation. This article is protected by copyright. All rights reserved.','2018-05-12 00:00:00','2018-05-12 00:00:00','2018-05-12 00:00:00',0,0,'Lafort, Yves, Y|Greener, Letitia, L|Lessitala, Faustino, F|Chabeda, Sophie, S|Greener, Ross, R|Beksinska, Mags, M|Gichangi, Peter, P|Griffin, Sally, S|Smit, Jenni A, JA|Chersich, Matthew, M|Delva, Wim, W','2018-05-17 22:46:19','2018-05-17 22:46:19'),(124,13,29752775,'2045-7634','MicroRNA-92a promotes tumor growth and suppresses immune function through activation of MAPK/ERK signaling pathway by inhibiting PTEN in mice bearing U14 cervical cancer.','Cervical cancer is known as the possible outcome of genital infection, while the molecular mechanisms of initiation, development, and metastasis of cervical cancer have not yet been fully elucidated. Our study aims to investigate the effects of microRNA-92a (miR-92a) on tumor growth and immune function by targeting PTEN via the MAPK/ERK signaling pathway in tumor-bearing mice. C57BL/6 female mice were used for tumor-bearing mouse models and their tumor and adjacent normal tissues were collected, and normal cervical tissues were obtained from normal mice. Serum levels of tumor necrosis factor-α (TNF-α) and soluble interleukin-2 receptor (sIL-2R) were detected by ELISA. The cells were divided into the normal, blank, negative control (NC), miR-92a mimic, miR-92a inhibitor, siRNA-PTEN, and miR-92a inhibitor + siRNA-PTEN groups. Dual-luciferase reporter assay was adopted to determine the relationship between PTEN and miR-92a. Expressions of miR-92a, PTEN, TNF-α, sIL-2R, ERK1, and ERK2 were tested by RT-qPCR and Western blotting. Cell proliferation was detected by cell count kit-8 (CCK-8); cell cycle and apoptosis were detected by flow cytometry. Compared with the normal cervical tissues and adjacent normal tissues, the cervical cancer tissues exhibited increased expressions of miR-92a, p-ERK1/2, and serum levels of TNF-α and sIL-2R while decreased PTEN expression. PTEN was confirmed to be the target gene of miR-92a. As compared with the blank and NC groups, expressions of miR-92a, ERK1 and ERK2 increased, and expressions of PTEN decreased in the miR-92a mimic group. The miR-92a mimic group exhibited increased expression levels of TNF-α and sIL-2R, cell proliferation, and cell number in S phase but decreased cell apoptosis, and cell number in G0/G1 phase, while the miR-92a inhibitor group followed opposite trends. miR-92a promotes tumor growth and suppresses immune function by inhibiting PTEN via activation of the MAPK/ERK signaling pathway in mice bearing U14 cervical cancer.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Li, Zeng-Hui, ZH|Li, Lei, L|Kang, Lin-Ping, LP|Wang, Yan, Y','2018-05-17 22:46:19','2018-05-17 22:46:19'),(125,13,29752277,'1078-0432','The highly metastatic nature of uterine cervical/endometrial cancer displaying tumor-related leukocytosis: clinical and preclinical investigations.','The aim of this study was to investigate the metastatic potential of uterine cervical and endometrial cancer displaying tumor-related leukocytosis (TRL).Clinical data on uterine cervical (N=732) and endometrial cancer　(N=900) were collected, and the metastatic potential of TRL-positive cancer was evaluated in univariate and multivariate analyses. Tumor and blood samples obtained from cervical cancer patients, cervical cancer cell lines, and a mouse model of cervical cancer were employed to examine the mechanisms underlying the highly metastatic nature of TRL-positive cancer, focusing on tumor-derived granulocyte-colony stimulating factor (G-CSF) and the myeloid-derived suppressor cells (MDSC)-mediated premetastatic niche.Pretreatment TRL was significantly associated with visceral organ metastasis in patients with uterine cervical or endometrial cancer. The TRL-positive cervical cancer patients displayed upregulated tumor G-CSF expression, elevated G-CSF levels, and increased MDSC frequencies in the peripheral blood compared with the TRL-negative patients. In vitro and in vivo investigations revealed that MDSC produced in response to tumor-derived G-CSF are involved in premetastatic niche formation, which promotes visceral organ metastasis of TRL-positive cancer. The depletion of MDSC attenuated this premetastatic niche formation and effectively inhibited the visceral organ metastasis of TRL-positive cancer.Uterine cervical/endometrial cancer displaying TRL is a distinct clinical entity with high metastatic potential. Tumor-derived G-CSF and the MDSC-mediated premetastatic niche are responsible for the highly metastatic nature of this type of cancer. MDSC-targeting therapy might represent a potential strategy for combating metastasis derived from TRL-positive uterine cancer.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Sasano, Tomoyuki, T|Mabuchi, Seiji, S|Kozasa, Katsumi, K|Kuroda, Hiromasa, H|Kawano, Mahiru, M|Takahashi, Ryoko, R|Komura, Naoko, N|Yokoi, Eriko, E|Matsumoto, Yuri, Y|Hashimoto, Kae, K|Sawada, Kenjiro, K|Morii, Eiichi, E|Kimura, Tadashi, T','2018-05-17 22:46:19','2018-05-17 22:46:19'),(126,13,29751992,'1095-6859','The impact of health insurance status on the stage of cervical cancer diagnosis at a tertiary care center in Massachusetts.','To evaluate the impact of insurance status on the stage of cervical cancer diagnosed and treated at a tertiary care center in Massachusetts and review the preceding screening history.An IRB approved retrospective cohort study was conducted of patients with a diagnosis of cervical cancer treated at Brigham and Women\'s Hospital (BWH) between January 2011 and June 2016. Clinical and demographic data was extracted from the longitudinal medical record. Statistical analysis was performed using SAS.117 cases of cervical cancer met the inclusion criteria during the study period. Most patients (76%) were diagnosed with stage I disease. On univariate analysis, compared to patients with private insurance, patients with public insurance or no documented insurance presented at older ages, were more likely to be non-white races, and present with advanced stage disease. In an adjusted model, the risk of being diagnosed with advanced stage disease persisted among women with public or no documented insurance, adjusted odds ratio (aOR) 4.13 (1.37-12.45). There was no difference in screening history among women with private vs. public insurance, p = 0.30.Despite access to insurance, patients with public issued insurance had an increased risk of presenting with advanced stage cervical cancer in this cohort. These data suggest that additional barriers to screening and prevention may exist and are important for future investigation.','2018-05-08 00:00:00','2018-05-08 00:00:00','2018-05-12 00:00:00',0,0,'Davis, Michelle, M|Strickland, Kyle, K|Easter, Sarah Rae, SR|Worley, Michael, M|Feltmate, Colleen, C|Muto, Michael, M|Horowitz, Neil, N|Berkowitz, Ross, R|Feldman, Sarah, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(127,13,29751793,'1471-2407','Uptake of three doses of HPV vaccine by primary school girls in Eldoret, Kenya; a prospective cohort study in a malaria endemic setting.','All women are potentially at risk of developing cervical cancer at some point in their life, yet it is avoidable cause of death among women in Sub- Saharan Africa with a world incidence of 530,000 every year. It is the 4th commonest cancer affecting women worldwide with over 260,000 deaths reported in 2012. Low resource settings account for over 75% of the global cervical cancer burden. Uptake of HPV vaccination is limited in the developing world. WHO recommended that 2 doses of HPV vaccine could be given to young girls, based on studies in developed countries. However in Africa high rates of infections like malaria and worms can affect immune responses to vaccines, therefore three doses may still be necessary. The aim of this study was to identify barriers and facilitators associated with uptake of HPV vaccine.A cross-sectional survey was conducted at Eldoret, Kenya involving 3000 girls aged 9 to 14 years from 40 schools. Parents/guardians gave consent through a questionnaire.Of all 3083 the school girls 93.8% had received childhood vaccines and 63.8% had a second HPV dose, and 39.1% had a third dose. Administration of second dose and HPV knowledge were both strong predictors of completion of the third dose. Distance to the hospital was a statistically significant risk factor for non-completion (P: 0.01).Distance to vaccination centers requires a more innovative vaccine-delivery strategy and education of parents/guardians on cervical screening to increase attainment of the HPV vaccination.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Mabeya, Hillary, H|Menon, Sonia, S|Weyers, Steven, S|Naanyu, Violet, V|Mwaliko, Emily, E|Kirop, Elijah, E|Orango, Omenge, O|Vermandere, Heleen, H|Vanden Broeck, Davy, D','2018-05-17 22:46:19','2018-05-17 22:46:19'),(128,13,29751555,'1420-3049','Three New Highly Oxygenated Germacranolides from  and Their Cytotoxic Activity.','Three new highly oxygenated (⁻), and two known ( and ) germacranolides, were isolated from the whole plant of . The planar structures and relative configurations of the new compounds were determined by detailed spectroscopic analysis. The absolute configuration of  was established using the circular dichroism (CD) method and X-ray diffraction, and the stereochemistry of the new compounds ⁻ were determined using similar CD spectra with . The new compound  and the known compound  exhibited potent cytotoxicity against hepatocellular cancer (Hep G2) and human cervical cancer (HeLa) cells, superior to those of the positive control -platin.','2018-05-03 00:00:00','2018-05-03 00:00:00','2018-05-12 00:00:00',0,0,'Zhang, Tao, T|Si, Jin-Guang, JG|Zhang, Qiu-Bo, QB|Chen, Jia-Huan, JH|Ding, Gang, G|Zhang, Hong-Wu, HW|Jia, Hong-Mei, HM|Zou, Zhong-Mei, ZM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(129,13,29751037,'1879-0003','Interaction of anti-cancer drug-cisplatin with major proteinase inhibitor- alpha-2-macroglobulin: Biophysical and thermodynamic analysis.','Alpha-2-macroglobulin is a multifunctional, highly abundant, plasma protein which reacts with a wide variety of molecules and drugs such as cisplatin. Cisplatin is commonly used anticancer drug widely used for treatment of testicular, bladder, ovarian, head and neck, lung and cervical cancers. This study is designed to examine the interaction of cisplatin with human alpha-2-macroglobulin through various biophysical techniques and drug binding through molecular modeling. Cisplatin alters the function of alpha-2-macroglobulin and the thiolesters are most likely the reactive sites for cisplatin. Our result suggests that cisplatin decreases the antiproteolytic potential and causes structural and functional change in human alpha-2-macroglobulin as evident by absorption and fluorescence spectroscopy. Change in secondary structure of alpha-2-macroglobulin was confirmed by CD and FTIR. Thermodynamics parameters such as entropy (ΔS), enthalpy (ΔH) and Gibb\'s free energy changes (ΔG) along with number of binding sites (N) and affinity constant (K) of αM-cisplatin binding in solutions were determined by isothermal titration calorimetry. It was found that binding of cisplatin with alpha-2-macroglobulin is exothermic in nature. The intake of the drug and presence of αM in the blood plasma could likely facilitate their interaction which could lead to structural alterations in the conformational status of αM.','2018-05-08 00:00:00','2018-05-08 00:00:00','2018-05-11 00:00:00',0,0,'Zia, Mohammad Khalid, MK|Siddiqui, Tooba, T|Ali, Syed Saqib, SS|Ahsan, Haseeb, H|Khan, FahimHalim, F','2018-05-17 22:46:19','2018-05-17 22:46:19'),(130,14,29748588,'2045-2322','Altered attentional control over the salience network in complex regional pain syndrome.','The degree and salience of pain have been known to be constantly monitored and modulated by the brain. In the case of maladaptive neural responses as reported in centralized pain conditions such as complex regional pain syndrome (CRPS), the perception of pain is amplified and remains elevated even without sustained peripheral pain inputs. Given that the attentional state of the brain greatly influences the perception and interpretation of pain, we investigated the role of the attention network and its dynamic interactions with other pain-related networks of the brain in CRPS. We examined alterations in the intra- and inter-network functional connectivities in 21 individuals with CRPS and 49 controls. CRPS-related reduction in intra-network functional connectivity was found in the attention network. Individuals with CRPS had greater inter-network connectivities between the attention and salience networks as compared with healthy controls. Furthermore, individuals within the CRPS group with high levels of pain catastrophizing showed greater inter-network connectivities between the attention and salience networks. Taken together, the current findings suggest that these altered connectivities may be potentially associated with the maladaptive pain coping as found in CRPS patients.','2018-05-10 00:00:00','2018-05-10 00:00:00','2018-05-11 00:00:00',0,0,'Kim, Jungyoon, J|Kang, Ilhyang, I|Chung, Yong-An, YA|Kim, Tae-Suk, TS|Namgung, Eun, E|Lee, Suji, S|Oh, Jin Kyoung, JK|Jeong, Hyeonseok S, HS|Cho, Hanbyul, H|Kim, Myeong Ju, MJ|Kim, Tammy D, TD|Choi, Soo Hyun, SH|Lim, Soo Mee, SM|Lyoo, In Kyoon, IK|Yoon, Sujung, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(131,14,29742728,'1536-5964','Sympathetic blocks for the treatment of complex regional pain syndrome: A case series.','To present the successful treatment of complex regional pain syndrome type -1 utilizing sympathetic blocks.Severe pain interfering with activities of daily living and temporary disability secondary to complex regional pain syndrome.Complex regional pain syndrome type-1 with involvement of lower extremity (2 patients), and upper extremity (1 patient).We report the management of 3 patients with diagnosis of complex regional pain syndrome type-1 by early institution of sympathetic blocks for diagnostic and therapeutic purposes. All 3 patients were able to tolerate physical therapy only after adequate pain relief had been achieved with institution of sympathetic blocks.All 3 patients responded very favorably to sympathetic blocks with dramatic reversal of pathology. All patients reported almost complete resolution of pain, symptoms, and signs within 6 months duration after diagnosis of complex regional pain syndrome. All 3 patients were able to wean their pain medications and achieve normal activities of daily living without any significant limitations. All patients were able to return to full-time employment.Treatment options are limited and there is lack of high quality research regarding the efficacy of sympathetic blocks in the treatment of complex regional pain syndrome. As presented in this case series, sympathetic blocks maybe very effective in the treatment of complex regional pain syndrome in a subset of patients. Thus, early institution of sympathetic blocks should be considered in complex regional pain syndrome prior to physical therapy and consideration of more invasive pain management interventions.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-05-09 00:00:00',0,0,'Gungor, Semih, S|Aiyer, Rohit, R|Baykoca, Buse, B','2018-05-17 22:46:19','2018-05-17 22:46:19'),(132,14,29742720,'1536-5964','Sacral epiduroscopic laser decompression for complex regional pain syndrome after lumbar spinal surgery: A case report.','CRPS after a lumbar surgery has symptoms that are similar to PSSS. However, standard criteria for distinguishing CRPS from PSSS do not exist. We present a case report of a 31-year-old female with CRPS symptoms after lumbar spinal surgery treated by performing SELD.This patient was referred to our pain clinic for left ankle pain. She received a lumbar discectomy for a herniated lumbar disc (L5/S1) but the pain was aggravated after surgery.The characteristics of the pain were burning, tingling, and cold, and were accompanied by other symptoms such as swelling, color change and mail dystrophy. The patient was diagnosed with CRPS.Medications and interventional therapies were not effective in reducing pain. SELD was performed and severe adhesive inflammation was observed in the L4-S1 epidural space. We performed mechanical adhesiolysis and injected hyalurodinase and dexamethasone near the L5 and S1 root. One month after, a second SELD was performed as same manner.After second SELD, the patient\'s pain markedly decreased. On the second visit in the outpatient clinic, the patient was absent of pain without any other medications.CRPS like symptoms can appear after lumbar spinal surgery due to adhesion and inflammation in the epidural space. In such cases, SELD can be considered as diagnostic and therapeutic option.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-05-09 00:00:00',0,0,'Jung, Jae-Wook, JW|Kim, Yong Han, YH|Kim, Hyojoong, H|Kang, Eunsu, E|Jo, Hyunji, H|Ko, Myoung Jin, MJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(133,14,29742184,'1545-9616','Complex Regional Pain Syndrome: What the Dermatologist Should Know.','Reflex sympathetic dystrophy is a subtype of complex regional pain syndrome, a condition characterized by persistent post-injury extremity pain. Temperature and sweating changes, edema, mobility changes, and a variety of hair, nail, and skin sequelae have been described. Only 23 articles published since 1990 describe dermatologic changes in CRPS. Given this paucity of literature, we present a case to further elucidate cutaneous manifestations of CRPS. Our patient is a 52-year-old Caucasian woman with a 19-year history of reflex sympathetic dystrophy who has presented with several dermatologic complaints. She was first referred to the clinic due to episodic, mildly tender, clustered, non-blanching, and non-palpable petechiae on the legs bilaterally, which was histologically consistent with leukocytoclastic vasculitis. No systemic involvement was identified and symptoms resolved with topical steroids. The patient was also noted to have severe ten toenail dystrophy without any evidence of onychomycosis based on multiple cultures and PAS staining of clipped nails. Avulsion of the great toenail was performed to provide symptomatic relief. Incidentally, the patient was found to have lower extremity and facial hypotrichosis on physical exam. Further, she required increased lidocaine administration in addition to pre and post-procedure lidocaine and prilocaine 5% emulsion cream for various office procedures, suggestive of lidocaine insensitivity. This case captures previously described cutaneous manifestations of CRPS such as vasculitis, nail dystrophy, extremity hypotrichosis, and telangiectasia, along with newly described potential manifestations about which dermatologists should be aware, including facial hypotrichosis and lidocaine insensitivity. J Drugs Dermatol. 2018;17(5):532-536.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-05-09 00:00:00',0,0,'Qureshi, Azam A, AA|Friedman, Adam J, AJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(134,14,29739543,'1878-1608','Special indications for Opioid Free Anaesthesia and Analgesia, patient and procedure related: Including obesity, sleep apnoea, chronic obstructive pulmonary disease, complex regional pain syndromes, opioid addiction and cancer surgery.','Opioid-free anaesthesia (OFA) is a technique where no intraoperative systemic, neuraxial or intracavitary opioid is administered with the anaesthetic. Opioid-free analgesia similarly avoids opioids in the perioperative period. There are many compelling reasons to avoid opioids in the surgical population. A number of case reports and, increasingly, prospective studies from all over the world support its benefits, especially in the morbidly obese population with or without sleep apnoea. A derivative technique is opioid sparing, where the same techniques are used but some opioid use is allowed. This chapter is a review of the current knowledge regarding opioid-free or low-dose opioid anaesthetic and analgesic techniques for the following special populations: obesity, sleep apnoea, chronic obstructive pulmonary disease, complex regional pain syndromes, acute/chronic opioid addiction and cancer surgery. Practical aspects include sympatholysis, analgesia and Minimum Alveolar Concentration (MAC) reduction with dexmedetomidine; analgesia with low-dose ketamine and co-anaesthesia; and sympatholysis with intravenous lignocaine. Non-opioid adjuvants such as NSAIDS, paracetamol, magnesium, local anaesthetic infiltration and high-dose steroids are added in the perioperative period to further achieve co-analgesia. Loco-regional anaesthesia and analgesia are also maximised. It remains to be seen whether OFA and early postoperative analgesia, which similarly avoids opioids, can prevent the development of hyperalgesia and persistent postoperative pain syndromes.','2017-12-01 00:00:00','2017-11-16 00:00:00','2018-05-09 00:00:00',0,0,'Sultana, Adrian, A|Torres, David, D|Schumann, Roman, R','2018-05-17 22:46:19','2018-05-17 22:46:19'),(135,14,29736619,'1432-2129','[The German version of the Bath Body Perception Disturbance Scale (BBPDS-D) : Translation, cultural adaptation and linguistic validation on patients with complex regional pain syndrome].','Besides the classical clinical manifestations, body perception disturbances are common among patients with complex regional pain syndrome (CRPS). The Bath Body Perception Disturbance Scale (BBPDS) represents a useful tool to assess these changes in CRPS patients; however, to date no validated German version is available.The aim of this study was to translate the BBPDS into German, to perform a cross-cultural adaptation and linguistic validation in patients with acute (symptoms <3 months) and stable (symptoms ≥3 months) CRPS.The original English version of the BBPDS was translated into German according to published guidelines (translation and back translation) and tested on 56 patients (mean age 50.9 ± 13.1 years) with acute (n = 28) or stable (n = 28) CRPS.The relative reliability, intraclass correlation and test-retest reliability were excellent overall and in the groups with acute and stable CRPS. The smallest detectable change was at 10 points. In the test-retest 48 points lay within the 95% confidence interval and visual inspection showed no tendency towards heteroscedasticity. Spearman\'s ρ‑coefficient values showed no correlation between the total score of the BBPDS-D with the numerical rating scale (NRS, ρ = -0.19) and the EuroQol-5 D (ρ = 0.16). There were no significant differences between patients with acute and stable CRPS (p = 0.412). There were also no floor or ceiling effects.This German translation and cross-cultural adaptation of the original English version of the BBPDS is a valid instrument to assess body perception disturbances in German speaking CRPS patients. Future research should further assess the impact of body perception disturbance on treatment outcome and prognosis.','2018-05-07 00:00:00','2018-05-07 00:00:00','2018-05-08 00:00:00',0,0,'Tschopp, M, M|Swanenburg, J, J|Wertli, M W, MW|Langenfeld, A, A|McCabe, C S, CS|Lewis, J, J|Baertschi, E, E|Brunner, F, F','2018-05-17 22:46:19','2018-05-17 22:46:19'),(136,14,29736085,'0019-5545','Kinesiophobia after complex regional pain syndrome type one in a case of stroke hemiplegia and effect of cognitive behavior therapy.','No abstract found.','2018-01-01 00:00:00','0000-00-00 00:00:00','2018-05-09 00:00:00',0,0,'Sethy, Damayanti, D|Sahoo, Surjeet, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(137,14,29727760,'1873-4529','Continuous erector spinae plane block at the lower lumbar level in a lower extremity complex regional pain syndrome patient.','No abstract found.','2018-05-01 00:00:00','2018-05-01 00:00:00','2018-05-11 00:00:00',0,0,'Chung, Kyudon, K|Kim, Eung Don, ED','2018-05-17 22:46:19','2018-05-17 22:46:19'),(138,14,29724420,'1558-349X','ACR Appropriateness Criteria Shoulder Pain-Traumatic.','Traumatic shoulder pain is pain directly attributed to a traumatic event, either acute or chronic. This pain may be the result of either fracture (the clavicle, scapula, or proximal humerus) or soft-tissue injury (most commonly of the rotator cuff, acromioclavicular ligaments, or labroligamentous complex). Imaging assessment of traumatic shoulder pain begins with conventional radiography and, depending on physical examination findings, will require MRI or MR arthrography for assessment of soft-tissue injuries and CT for delineation of fracture planes. Ultrasound excels in assessment of rotator cuff injuries but has limited usefulness for assessment of the deep soft-tissues. CT angiography and conventional arteriography are helpful for assessment of vascular injury, and bone scintigraphy can be used in assessment of complex regional pain syndrome after traumatic shoulder injury. The American College of Radiology Appropriateness Criteria are evidence-based guidelines for specific clinical conditions that are reviewed annually by a multidisciplinary expert panel. The guideline development and revision include an extensive analysis of current medical literature from peer reviewed journals and the application of well-established methodologies (RAND/UCLA Appropriateness Method and Grading of Recommendations Assessment, Development, and Evaluation or GRADE) to rate the appropriateness of imaging and treatment procedures for specific clinical scenarios. In those instances where evidence is lacking or equivocal, expert opinion may supplement the available evidence to recommend imaging or treatment.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-05-04 00:00:00',0,0,'Expert Panel on Musculoskeletal Imaging:|Amini, Behrang, B|Beckmann, Nicholas M, NM|Beaman, Francesca D, FD|Wessell, Daniel E, DE|Bernard, Stephanie A, SA|Cassidy, R Carter, RC|Czuczman, Gregory J, GJ|Demertzis, Jennifer L, JL|Greenspan, Bennett S, BS|Khurana, Bharti, B|Lee, Kenneth S, KS|Lenchik, Leon, L|Motamedi, Kambiz, K|Sharma, Akash, A|Walker, Eric A, EA|Kransdorf, Mark J, MJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(139,14,29715519,'1528-8447','Oxidative stress contributes to fracture/cast-induced inflammation and pain in a rat model of complex regional pain syndrome.','Clinical evidence suggests vitamin C (Vit C) may protect against the development of complex regional pain syndrome (CRPS) after fracture and/or surgery. Tibia fracture followed by 4 weeks cast immobilization (fracture/cast) in rats results in nociceptive, vascular, and bone changes resembling clinical CRPS. In the present study, fracture/cast rats were treated with the oxidative stress inhibitors Vit C, N-acetyl cysteine (NAC) or 4-hydroxy-2,2,6,6-tetramethylpiperidin-1-oxyl (TEMPOL) to examine their effects on CRPS-related nociceptive and vascular changes. Administration of these agents significantly reduced fracture/cast-induced cutaneous allodynia by 64-78%, muscle hyperalgesia by 34-40% and hindlimb unweighting by 48-89%. Treatments with Vit C and NAC reduced the oxidative stress markers malondialdehyde in the skin, muscle and sciatic nerve, and lactate in the gastrocnemius muscle of the fracture/cast limb. Furthermore, Vit C treatment inhibited the post fracture up-regulation of SP and CGRP in the sciatic nerve and the increased expression of the pain-related inflammatory mediators, including interleukin 6 (IL-6), and nerve growth factor (NGF) in the skin and interleukin 1β (IL-1β), and IL-6 in the muscle of the post fracture/cast limb. These data suggest that oxidative stress may contribute to the nociceptive features of the rat CRPS model.Vit C reduced the CRPS-like signs, oxidative stress, and the up regulation of neuropeptide production and inflammatory mediators observed after tibia fracture and casting in rats. Limiting oxidative stress using Vit C or alternative strategies could reduce the risk of developing CRPS after surgery or other forms of trauma.','2018-04-28 00:00:00','2018-04-28 00:00:00','2018-05-08 00:00:00',0,0,'Guo, Tian-Zhi, TZ|Wei, Tzuping, T|Huang, Ting-Ting, TT|Kingery, Wade S, WS|Clark, John David, JD','2018-05-17 22:46:19','2018-05-17 22:46:19'),(140,15,29750111,'2052-6687','Demography and disorders of the French Bulldog population under primary veterinary care in the UK in 2013.','Despite its Gallic name, the French Bulldog is a breed of both British and French origin that was first recognised by The Kennel Club in 1906. The French Bulldog has demonstrated recent rapid rises in Kennel Club registrations and is now (2017) the second most commonly registered pedigree breed in the UK. However, the breed has been reported to be predisposed to several disorders including ocular, respiratory, neurological and dermatological problems. The VetCompass™ Programme collates de-identified clinical data from primary-care veterinary practices in the UK for epidemiological research. Using VetCompass™ clinical data, this study aimed to characterise the demography and common disorders of the general population of French Bulldogs under veterinary care in the UK.French Bulldogs comprised 2228 (0.49%) of 445,557 study dogs under veterinary care during 2013. Annual proportional birth rates showed that the proportional ownership of French Bulldog puppies rose steeply from 0.02% of the annual birth cohort attending VetCompass™ practices in 2003 to 1.46% in 2013. The median age of the French Bulldogs overall was 1.3 years (IQR 0.6-2.5, range 0.0-13.0). The most common colours of French Bulldogs were brindle (solid or main) (32.36%) and fawn (solid or main) (29.9%). Of the 2228 French Bulldogs under veterinary care during 2013, 1612 (72.4%) had at least one disorder recorded. The most prevalent fine-level precision disorders recorded were otitis externa (14.0%, 95% CI: 12.6-15.5), diarrhoea (7.5%, 95% CI: 6.4-8.7), conjunctivitis (3.2%, 95% CI: 2.5-4.0), nails overlong (3.1%, 95% CI% 2.4-3.9) and skin fold dermatitis (3.0%, 95% CI% 2.3-3.8). The most prevalent disorder groups were cutaneous (17.9%, 95% CI: 16.3-19.6), enteropathy (16.7%, 95% CI: 15.2-18.3), aural (16.3%, 95% CI: 14.8-17.9), upper respiratory tract (12.7%, 95% CI: 11.3-14.1) and ophthalmological (10.5%, 95% CI: 9.3-11.9).Ownership of French Bulldogs in the UK is rising steeply. This means that the disorder profiles reported in this study reflect a current young UK population and are likely to shift as this cohort ages. Otitis externa, diarrhoea and conjunctivitis were the most common disorders in French Bulldogs. Identification of health priorities based on VetCompass™ data can support evidence-based reforms to improve health and welfare within the breed.','2018-05-17 00:00:00','2018-05-03 00:00:00','2018-05-11 00:00:00',0,0,'O\'Neill, Dan G, DG|Baral, Lauren, L|Church, David B, DB|Brodbelt, Dave C, DC|Packer, Rowena M A, RMA','2018-05-17 22:46:19','2018-05-17 22:46:19'),(141,15,29735865,'1119-3077','The prevalence of allergic diseases among children with asthma: What is the impact on asthma control in South East Nigeria?','Allergic diseases are known to occur in children with asthma and its coexistence with asthma may impact on asthma control in affected children living in a low-income country. The study is to determine the allergic profile of children with asthma and the association with asthma control and attendant social risk factors.This was a cross-sectional study of consecutively enrolled children with physician diagnosed asthma, attending clinics in a tertiary center in Nigeria. The presence of asthma, allergy types, and asthma control levels were determined using the Gobal initiative on asthma (GINA), international study of asthma and allergy in childhood and asthma control test questionnaires, respectively.There were 207 children with asthma enrolled from the Pediatric Asthma Clinic at University of Nigeria Teaching Hospital, Enugu. The median age was 10 years and interquartile range of 7-11 years. There were 127 (61.4%) from middle and high socioeconomic class and 86.5% who lived in the urban areas. Of the study participants, 41.5% had one or more allergy symptoms; rhinitis (33.3%), conjunctivitis (29.0%), and dermatitis (7.2%). Allergy symptoms persisted from infancy in 55.9%. Children from large families had a lower prevalence of allergies. Having any allergy symptom and belonging to a small-sized family were both associated with asthma exacerbations. Most children studied, (69.1%) had their asthma under control. Allergy persistence from infancy and type of allergy were not significantly associated with the level of asthma control.Allergic diseases are common in children with asthma in our environment, but did not significantly impact on asthma control. Socioeconomic factors such as urbanization and family size had effects on the achievement of asthma control but not on allergy status.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-05-08 00:00:00',0,0,'Ayuk, A C, AC|Eze, J N, JN|Edelu, B O, BO|Oguonu, T, T','2018-05-17 22:46:19','2018-05-17 22:46:19'),(142,15,29735838,'1998-3646','Molecular epidemiology of circulating human adenovirus types in acute conjunctivitis cases in Chandigarh, North India.','Human adenovirus (HAdV) is a major cause of viral conjunctivitis. The various serotypes implicated in the causation are 3, 4, 8, 19 and 37. The present study aimed to know the circulating types of HAdV causing acute conjunctivitis in North India. A total of 23 conjunctival swabs were collected from patients with clinically suspected acute viral conjunctivitis during 2014-2015. The HAdV was implicated in the etiology in 65.2% of cases. The sequencing of representative samples using hexon gene suggests the presence of serotype 8 and 4. The serotype eight sequences showed 99%-100% similarity with other Indian strains. The phylogenetic analysis showed that the current circulating serotypes, responsible for conjunctivitis, belonged to epidemic keratoconjunctivitis strains.','2018-01-01 00:00:00','0000-00-00 00:00:00','2018-05-08 00:00:00',0,0,'Singh, Mini P, MP|Ram, Jagat, J|Kumar, Archit, A|Rungta, Tripti, T|Gupta, Amit, A|Khurana, Jasmine, J|Ratho, Radha Kanta, RK','2018-05-17 22:46:19','2018-05-17 22:46:19'),(143,15,29731373,'1776-2588','[Environmental exposure chambers (EEC): A novel tool for pathophysiological and pharmaceutical research].','Airborne allergic diseases (allergic asthma, rhinitis and conjunctivitis) have reached epidemic proportions and are a great burden for both society and individuals. Therefore we need to better understand the physiopathological mechanisms and to increase clinical research in these diseases. However, traditional outpatient studies are difficult and have number of limitations, in particular the variability of allergen exposure. Yet allergen provocation tests, especially bronchial challenges in asthma, are excellent tools to measure the efficiency of anti-allergic therapies. Environmental exposure chambers (EEC) allow the performance of controlled allergen provocation tests on a large scale with remarkable sensitivity, specificity and reproducibility. Moreover, they allow a precise collection of allergic symptoms, making them interesting tools for patho-physiological and clinical studies. During the last thirty years, they have assisted the study of anti-allergic therapies and provided data on their pharmacodynamic characteristics, particularly in allergic rhinitis. However, there are still no EEC tests centered on asthma. The EEC of Strasbourg (ALYATEC) was developed to fulfill two objectives: to allow standardized allergenic and non-allergenic exposures with better control of the parameters than in other EEC and to offer a place to study asthma and anti-asthmatic therapies safely.','2018-05-03 00:00:00','2018-05-03 00:00:00','2018-05-07 00:00:00',0,0,'Khayath, N, N|Radu, C, C|Choual, I, I|Jilani, S, S|Vecellio, L, L|Domis, N, N|De Blay, F, F','2018-05-17 22:46:19','2018-05-17 22:46:19'),(144,15,29723938,'0002-5151','[Prevalence of sensitization and allergy to kiwi fruit (Actinidia deliciosa) in adults with allergic diseases].','The kiwi fruit (Actinidia deliciosa) is a food that has been recognized for its allergenic capability for more than 30 years. In general, kiwi allergy is characterized by local discomfort, but systemic reactions such as rash, angioedema, rhinitis, conjunctivitis or anaphylaxis can be triggered.To determine the prevalence of sensitization and allergy to kiwi in adults with allergic diseases.By means of a cross-sectional, retrolective study, data corresponding to 370 patients aged ≥16 years were analyzed.226 patients had positive skin reaction against aeroallergens. The prevalence of food sensitization was 84/226 (37.2%; 95 % CI = 31.1 to 43.6). Overall, the prevalence of sensitization to kiwi fruit was 15/226 (6.6%; 95% CI = 3.9 to 10.7), and of kiwi allergy, 2/15 (13.3%; 95% CI = 2.5 to 39.1); one patient had symptoms consistent with oral allergy syndrome, and another, gastrointestinal and cutaneous manifestations.The prevalence of sensitization to kiwi fruit is not a rare event; in contrast, symptoms related to its consumption are uncommon.','2018-01-01 00:00:00','0000-00-00 00:00:00','2018-05-03 00:00:00',0,0,'Bedolla-Pulido, Tonatiuh Ramses, TR|Álvarez-Corona, Silvia Araceli, SA|Bedolla-Pulido, Tonantzin Isis, TI|Uribe-Cota, Benjamín, B|González-Mendoza, Tania, T|Bedolla-Barajas, Martín, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(145,15,29719638,'2008-2010','Topical Olopatadine Hydrochloride versus Ketotifen Fumarate for Allergic Conjunctivitis.','Allergic conjunctivitis (AC) is associated with itching, redness, tearing, pain, and burning sensation in the eyes. The inflammatory process is caused by the mechanism of immediate hypersensitivity due to direct contact with the allergen. This process triggers mast cells in the conjunctiva to activate and release mediators. The purpose of this study was to compare topical olopatadine and ketotifen in terms of effectiveness and safety for the management of AC.Patients clinically diagnosed with AC were randomized into two groups of 60 patients each and received either topical olopatadine HCl 0.1% or ketotifen fumarate 0.025%. They were followed up on the 4, 15, and 30 days to evaluate symptoms, signs, and quality of life (QOL) scoring.There were a total of 120 patients (67 men and 53 women) with a mean age of 36.35 ± 11 years. Compared to baseline, scores of itching, tearing, redness, eyelid swelling, chemosis and papillae addition of all the individual scores mentioned above and QOL scores reduced significantly ( = 0.001) by the 4 and 15 days of olopatadine and ketotifen application. Compared with ketotifen, olopatadine significantly reduced itching, tearing, hyperemia, and total AC scores by the 4 day ( = 0.001) and conjunctival papillae by the 15 day ( = 0.001). Adverse reactions were reported in 10% and 18% of patients treated with olopatadine and ketotifen, respectively.Compared to ketotifen, olopatadine provided quicker relief of symptoms, and improved symptoms of AC and QOL, with fewer side effects.','2018-01-01 00:00:00','0000-00-00 00:00:00','2018-05-04 00:00:00',0,0,'Patel, Dharmistha, D|Sarala, N, N|Datti, Narendra Panduranga, NP','2018-05-17 22:46:19','2018-05-17 22:46:19'),(146,15,29712621,'2369-2960','Incidence of Lower Respiratory Tract Infections and Atopic Conditions in Boys and Young Male Adults: Royal College of General Practitioners Research and Surveillance Centre Annual Report 2015-2016.','The Royal College of General Practitioners Research and Surveillance Centre comprises more than 150 general practices, with a combined population of more than 1.5 million, contributing to UK and European public health surveillance and research.The aim of this paper was to report gender differences in the presentation of infectious and respiratory conditions in children and young adults.Disease incidence data were used to test the hypothesis that boys up to puberty present more with lower respiratory tract infection (LRTI) and asthma. Incidence rates were reported for infectious conditions in children and young adults by gender. We controlled for ethnicity, deprivation, and consultation rates. We report odds ratios (OR) with 95% CI, P values, and probability of presenting.Boys presented more with LRTI, largely due to acute bronchitis. The OR of males consulting was greater across the youngest 3 age bands (OR 1.59, 95% CI 1.35-1.87; OR 1.13, 95% CI 1.05-1.21; OR 1.20, 95% CI 1.09-1.32). Allergic rhinitis and asthma had a higher OR of presenting in boys aged 5 to 14 years (OR 1.52, 95% CI 1.37-1.68; OR 1.31, 95% CI 1.17-1.48). Upper respiratory tract infection (URTI) and urinary tract infection (UTI) had lower odds of presenting in boys, especially those older than 15 years. The probability of presenting showed different patterns for LRTI, URTI, and atopic conditions.Boys younger than 15 years have greater odds of presenting with LRTI and atopic conditions, whereas girls may present more with URTI and UTI. These differences may provide insights into disease mechanisms and for health service planning.','2018-04-30 00:00:00','2018-04-30 00:00:00','2018-05-01 00:00:00',0,0,'de Lusignan, Simon, S|Correa, Ana, A|Pebody, Richard, R|Yonova, Ivelina, I|Smith, Gillian, G|Byford, Rachel, R|Pathirannehelage, Sameera Rankiri, SR|McGee, Christopher, C|Elliot, Alex J, AJ|Hriskova, Mariya, M|Ferreira, Filipa Im, FI|Rafi, Imran, I|Jones, Simon, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(147,15,29708930,'1531-7021','Management of chronic complications associated with herpes zoster ophthalmicus.','Herpes zoster ophthalmicus (HZO) has the potential to cause significant visual morbidity and functional disability in patients with recalcitrant disease, keratitis, and postherpetic neuralgia. This article will review the current methods of prevention and treatment of anterior segment-related chronic complications of HZO.HZO-related anterior segment ocular complications can range to include conjunctivitis, keratitis, and uveitis that can all be difficult to manage. Furthermore, many clinicians differ in their approach to disease management given the relative lack of large randomized controlled trials to guide therapy. The goal in managing complications of HZO is to reduce visual morbidity and to improve analgesia, and here, we present current recommendations for the management of anterior segment complications of HZO.Recent advances in vaccine technology and the initiation of the Zoster Eye Disease Study improve the possibility of reducing the burden of disease while also further standardizing management of HZO.','2018-04-27 00:00:00','2018-04-27 00:00:00','2018-04-30 00:00:00',0,0,'Vadoothker, Saujanya, S|Jeng, Bennie H, BH','2018-05-17 22:46:19','2018-05-17 22:46:19'),(148,15,29705339,'2213-2201','Pseudoallergic conjunctivitis induced by tamsulosin, a selective alpha-1 adrenergic receptor antagonist.','No abstract found.','2018-04-26 00:00:00','2018-04-26 00:00:00','2018-05-09 00:00:00',0,0,'Kelly, Brian T, BT|Locke, Bradley A, BA|Kelly, Kevin J, KJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(149,15,29704734,'1873-5967','Molecular epidemiology of human adenovirus infections in Denmark, 2011-2016.','Human adenoviruses (HAdVs) can cause respiratory tract infections, conjunctivitis, diarrhoea and outbreaks have been reported. However, little is known about the disease burden and the molecular epidemiology of HAdV.To retrospectively perform a molecular characterization of HAdV positive samples received at Statens Serum Institut during the period 2011-2016 and to compare this with demographic information, geographic location, sample collection date and type and co-infection with other viral pathogens.152 HAdV positive samples were genotyped by Sanger sequencing of a fragment of the hexon gene using published primers along with a newly developed primer set for enhanced genotyping of HAdV D. Phylogenetic analysis was used for genotyping and genotypes were compared with epidemiological information. In addition, HAdV burden and co-infection was evaluated for samples tested in laboratory analysis packages.Six out of seven HAdV species were identified and represented by 13 types. Young children (<5 years old) were more likely to be positive for HAdV and co-infections with other gastrointestinal or respiratory viruses were common. Possible outbreaks of ocular infections due to HAdV D could not be confirmed.A diverse set of HAdV species were circulating in Denmark in the study period and although possible transmission clusters were identified, this could not be verified with current genotyping methods Young children were commonly affected by HAdV infection and co-infections with other viral pathogens were frequent suggesting a possible underestimation of the real HAdV burden.','2018-04-21 00:00:00','2018-04-21 00:00:00','2018-05-10 00:00:00',0,0,'Barnadas, Céline, C|Schmidt, Dennis Jelsbak, DJ|Fischer, Thea K, TK|Fonager, Jannik, J','2018-05-17 22:46:19','2018-05-17 22:46:19'),(150,16,29681552,'1086-3176','The Cowpox Controversy: Memory and the Politics of Public Health in Cuba.','Vaccination played an important role in the formation of a national consciousness in Cuba, and vaccination\'s earliest promoters dominate nationalist narratives of medical achievement on the island. This article investigates the intense hostility exhibited by the creole medical elite toward a pivotal figure in the history of smallpox vaccination in Cuba, Spanish physician Dr. Vicente Ferrer (1823-83), the first in the Americas to mass produce smallpox vaccine using calf vaccinifiers. I argue that anger and mistrust of both Ferrer and his innovatory vaccine production technology originated in the relationship between medical politics and cultural identity in late nineteenth-century Cuba. By the late nineteenth century, smallpox vaccination was linked to glorified memories of a Cuban creole-led vaccination program and a disinterested medical profession. Both Ferrer and his private institution for the mass production of \"cowpox\" became associated with destructive changes in public health, challenging cultural narratives and regional power structures.','2018-05-17 00:00:00','0000-00-00 00:00:00','2018-04-23 00:00:00',0,0,'Gonzalez, Stephanie H, SH','2018-05-17 22:46:19','2018-05-17 22:46:19'),(151,16,29676720,'1465-2099','Mutagenic repair of double-stranded DNA breaks in vaccinia virus genomes requires cellular DNA ligase IV activity in the cytosol.','Poxviruses comprise a group of large dsDNA viruses that include members relevant to human and animal health, such as variola virus, monkeypox virus, cowpox virus and vaccinia virus (VACV). Poxviruses are remarkable for their unique replication cycle, which is restricted to the cytoplasm of infected cells. The independence from the host nucleus requires poxviruses to encode most of the enzymes involved in DNA replication, transcription and processing. Here, we use the CRISPR/Cas9 genome engineering system to induce DNA damage to VACV (strain Western Reserve) genomes. We show that targeting CRISPR/Cas9 to essential viral genes limits virus replication efficiently. Although VACV is a strictly cytoplasmic pathogen, we observed extensive viral genome editing at the target site; this is reminiscent of a non-homologous end-joining DNA repair mechanism. This pathway was not dependent on the viral DNA ligase, but critically involved the cellular DNA ligase IV. Our data show that DNA ligase IV can act outside of the nucleus to allow repair of dsDNA breaks in poxvirus genomes. This pathway might contribute to the introduction of mutations within the genome of poxviruses and may thereby promote the evolution of these viruses.','2018-04-20 00:00:00','2018-04-20 00:00:00','2018-04-20 00:00:00',0,0,'Luteijn, Rutger David, RD|Drexler, Ingo, I|Smith, Geoffrey L, GL|Lebbink, Robert Jan, RJ|Wiertz, Emmanuel J H J, EJHJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(152,16,29536472,'2567-5834','[Clinical presentation of cowpox virus infection in South American camelids - A review].','Cowpox virus (CPXV) infection is a reportable and potentially zoonotic disease that occurs sporadically in a variety of animals. During the past six decades, CPXV infection has been extensively researched and described in both domestic (cat, dog, horse, cattle) and zoo animals (e. g. elephant, rhinoceros, okapi). Of note, a review of the literature produced only three reports of CPXV in individual or small groups of South American camelids. The goal of this review was to describe the current knowledge as it relates to clinical features of CPXV infection in South American camelids and to compare the clinical manifestations with those described in other animal species. In alpacas and llamas, virus transmission occurs via direct contact with infected animals or oronasal infection through microlesions in the skin and mucous membranes. In its mild form, the disease is limited to certain regions of the body (head, neck, extremities or perineal region) and characterised by pustules or crusts. CPXV infection can also cause generalised and frequently lethal disease with multifocal to diffuse skin lesions (papules, pustules, crusts, ulcers) accompanied by virus replication in other organs. Conjunctivitis, stomatitis and rhinitis are seen commonly together with nonspecific clinical signs, including anorexia, listlessness and fever. As in other poxvirus infections, factors leading to an immunosuppression may contribute to the development of the clinical ma -nifestation of CPXV infection. There appear to be no specific manifestations of CPXV infection in South American camelids. More research is needed to fully understand the pathogenesis and epidemio logy of CPXV infection, particularly in South American camelids.','2018-02-01 00:00:00','2018-02-21 00:00:00','2018-03-14 00:00:00',0,0,'Prkno, Almut, A|Kaiser, Matthias, M|Goerigk, Daniela, D|Pfeffer, Martin, M|Vahlenkamp, Thomas W, TW|Hoffmann, Donata, D|Beer, Martin, M|Starke, Alexander, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(153,16,29491158,'1098-5514','Virulent poxviruses inhibit DNA sensing by preventing STING activation.','Cytosolic recognition of DNA has emerged as a critical cellular mechanism of host immune activation upon pathogen invasion. The central cytosolic DNA sensor cGAS activates STING, which is phosphorylated, dimerises and translocates from the ER to a perinuclear region to mediate IRF-3 activation. Poxviruses are dsDNA viruses replicating in the cytosol and hence likely to trigger cytosolic DNA sensing. Here we investigated the activation of innate immune signalling by 4 different strains of the prototypic poxvirus vaccinia virus (VACV) in a cell line proficient in DNA sensing. Infection with the attenuated VACV strain MVA activated IRF-3 via cGAS and STING, and accordingly STING dimerised and was phosphorylated during MVA infection. Conversely, VACV strains Copenhagen and Western Reserve inhibited STING dimerisation and phosphorylation during infection and in response to transfected DNA and cGAMP, thus efficiently suppressing DNA sensing and IRF-3 activation. A VACV deletion mutant lacking protein C16, thought to be the only viral DNA sensing inhibitor acting upstream of STING, retained the ability to block STING activation. Similar inhibition of DNA-induced STING activation was also observed for cowpox and ectromelia viruses. Our data demonstrate that virulent poxviruses possess mechanisms for targeting DNA sensing at the level of the cGAS-STING axis and that these mechanisms do not operate in replication-defective strains such as MVA. These findings shed light on the role of cellular DNA sensing in poxvirus-host interactions and will open new avenues to determine its impact on VACV immunogenicity and virulence. Poxviruses are dsDNA viruses infecting a wide range of vertebrates and include the causative agent of smallpox (variola virus) and its vaccine vaccinia virus (VACV). Despite smallpox eradication VACV remains of interest as a therapeutic. Attenuated strains are popular vaccine candidates, whereas replication-competent strains are emerging as efficient oncolytics in virotherapy. The successful therapeutic use of VACV depends on a detailed understanding of its ability to modulate host innate immune responses. DNA sensing is a critical cellular mechanism for pathogen detection and activation of innate immunity that is centrally coordinated by the ER-resident protein STING. Here STING is shown to mediate immune activation in response to MVA, but not to virulent VACV strains or other virulent poxviruses, which prevent STING activation and DNA sensing during infection and after DNA transfection. These results provide new insights into poxvirus immune evasion and have implications in the rational design of VACV-based therapeutics.','2018-02-28 00:00:00','2018-02-28 00:00:00','2018-05-12 00:00:00',0,0,'Georgana, Iliana, I|Sumner, Rebecca P, RP|Towers, Greg J, GJ|Maluquer de Motes, Carlos, C','2018-05-17 22:46:19','2018-05-17 22:46:19'),(154,16,29446492,'1096-9071','Bayesian reconstruction of the evolutionary history and cross-species transition of variola virus and orthopoxviruses.','Variola virus (VARV), the causative agent of smallpox, is an exclusively human virus belonging to the genus Orthopoxvirus, which includes many other viral species covering a wide range of mammal hosts, such as vaccinia, cowpox, camelpox, taterapox, ectromelia, and monkeypox virus. The tempo and mode of evolution of Orthopoxviruses were reconstructed using a Bayesian phylodynamic framework by analysing 80 hemagglutinin sequences retrieved from public databases. Bayesian phylogeography was used to estimate their putative ancestral hosts. In order to estimate the substitution rate, the tree including all of the available Orthopoxviruses was calibrated using historical references dating the South American variola minor clade (alastrim) to between the XVI and XIX century. The mean substitution rate determined by the analysis was 6.5 × 10 substitutions/site/year. Based on this evolutionary estimate, the time of the most recent common ancestor of the genus Orthopoxvirus was placed at about 10 000 years before the present. Cowpox virus was the species closest to the root of the phylogenetic tree. The root of VARV circulating in the XX century was estimated to be about 700 years ago, corresponding to about 1300 AD. The divergence between West African and South American VARV went back about 500 years ago (falling approximately in the XVI century). A rodent species is the most probable ancestral host from which the ancestors of all the known Orthopoxviruses were transmitted to the other mammal host species, and each of these species represented a dead-end for each new poxvirus species, without any further inter-specific spread.','2018-06-01 00:00:00','2018-03-12 00:00:00','2018-04-09 00:00:00',0,0,'Zehender, Gianguglielmo, G|Lai, Alessia, A|Veo, Carla, C|Bergna, Annalisa, A|Ciccozzi, Massimo, M|Galli, Massimo, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(155,16,29444189,'1553-7374','Cross-priming induces immunodomination in the presence of viral MHC class I inhibition.','Viruses have evolved mechanisms of MHCI inhibition in order to evade recognition by cytotoxic CD8+ T cells (CTLs), which is well-illustrated by our prior studies on cowpox virus (CPXV) that encodes potent MHCI inhibitors. Deletion of CPXV viral MHCI inhibitors markedly attenuated in vivo infection due to effects on CTL effector function, not priming. However, the CTL response to CPXV in C57BL/6 mice is dominated by a single peptide antigen presented by H-2Kb. Here we evaluated the effect of viral MHCI inhibition on immunodominant (IDE) and subdominant epitopes (SDE) as this has not been thoroughly examined. We found that cross-priming, but not cross-dressing, is the main mechanism driving IDE and SDE CTL responses following CPXV infection. Secretion of the immunodominant antigen was not required for immunodominance. Instead, immunodominance was caused by CTL interference, known as immunodomination. Both immunodomination and cross-priming of SDEs were not affected by MHCI inhibition. SDE-specific CTLs were also capable of exerting immunodomination during primary and secondary responses, which was in part dependent on antigen abundance. Furthermore, CTL responses directed solely against SDEs protected against lethal CPXV infection, but only in the absence of the CPXV MHCI inhibitors. Thus, both SDE and IDE responses can contribute to protective immunity against poxviruses, implying that these principles apply to poxvirus-based vaccines.','2018-02-01 00:00:00','2018-02-14 00:00:00','2018-03-01 00:00:00',0,0,'Lauron, Elvin J, EJ|Yang, Liping, L|Elliott, Jabari I, JI|Gainey, Maria D, MD|Fremont, Daved H, DH|Yokoyama, Wayne M, WM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(156,16,29427674,'1872-9096','Phage display antibodies against ectromelia virus that neutralize variola virus: Selection and implementation for p35 neutralizing epitope mapping.','In this study, five phage display antibodies (pdAbs) against ectromelia virus (ECTV) were selected from vaccinia virus (VACV)-immune phage-display library of human single chain variable fragments (scFv). ELISA demonstrated that selected pdAbs could recognize ECTV, VACV, and cowpox virus (CPXV). Atomic force microscopy visualized binding of the pdAbs to VACV. Three of the selected pdAbs neutralized variola virus (VARV) in the plaque reduction neutralization test. Western blot analysis of ECTV, VARV, VACV, and CPXV proteins indicated that neutralizing pdAbs bound orthopoxvirus 35 kDa proteins, which are encoded by the open reading frames orthologous to the ORF H3L in VACV. The fully human antibody fh1A was constructed on the base of the VH and VL domains of pdAb, which demonstrated a dose-dependent inhibition of plaque formation after infection with VARV, VACV, and CPXV. To determine the p35 region responsible for binding to neutralizing pdAbs, a panel of truncated p35 proteins was designed and expressed in Escherichia coli cells, and a minimal p35 fragment recognized by selected neutralizing pdAbs was identified. In addition, peptide phage-display combinatorial libraries were applied to localize the epitope. The obtained data indicated that the epitope responsible for recognition by the neutralizing pdAbs is discontinuous and amino acid residues located within two p35 regions, 15-19 aa and 232-237 aa, are involved in binding with neutralizing anti-p35 antibodies.','2018-04-01 00:00:00','2018-02-07 00:00:00','2018-03-16 00:00:00',0,0,'Khlusevich, Yana, Y|Matveev, Andrey, A|Baykov, Ivan, I|Bulychev, Leonid, L|Bormotov, Nikolai, N|Ilyichev, Ivan, I|Shevelev, Georgiy, G|Morozova, Vera, V|Pyshnyi, Dmitrii, D|Tikunova, Nina, N','2018-05-17 22:46:19','2018-05-17 22:46:19'),(157,16,29422319,'1532-3129','Atypical Cowpox Virus Infection in a Series of Cats.','Within 4 weeks, five cats with skin lesions affecting the hindlimbs and mainly consisting of oedema, hyperaemia and plaque-like alterations were presented to the same veterinary clinic. The cats were suffering from lameness, trauma, renal insufficiency or complicated tail amputation. Although the lesions seemed unusual for a poxvirus infection, microscopical examination of biopsy samples or specimens taken during necropsy examination revealed ballooning degeneration of keratinocytes with eosinophilic, cytoplasmic inclusion bodies indicative of an orthopoxvirus infection. Cowpox virus infection was verified using immunohistochemistry and virus isolation. Molecular analysis revealed identical haemagglutinin gene sequences in four cases and spatiotemporal circumstances in some cases pointed to hospital-acquired transmission. Unusual manifestations of feline cowpox may have an unexpected risk for human infection.','2018-01-01 00:00:00','2018-01-09 00:00:00','2018-02-09 00:00:00',0,0,'Jungwirth, N, N|Puff, C, C|Köster, K, K|Mischke, R, R|Meyer, H, H|Stark, A, A|Thoma, B, B|Zöller, G, G|Seehusen, F, F|Hewicker-Trautwein, M, M|Beineke, A, A|Baumgärtner, W, W|Wohlsein, P, P','2018-05-17 22:46:19','2018-05-17 22:46:19'),(158,16,29385360,'1533-4406','The Myth of the Milkmaid.','No abstract found.','2018-02-01 00:00:00','0000-00-00 00:00:00','2018-02-22 00:00:00',0,0,'Boylston, Arthur W, AW','2018-05-17 22:46:19','2018-05-17 22:46:19'),(159,16,29379051,'2045-2322','Global ubiquitination analysis reveals extensive modification and proteasomal degradation of cowpox virus proteins, but preservation of viral cores.','The emergence of Variola virus-like viruses by natural evolution of zoonotic Orthopoxviruses, like Cowpox virus (CPXV), is a global health threat. The proteasome is essential for poxvirus replication, making the viral components interacting with the ubiquitin-proteasome system attractive antiviral targets. We show that proteasome inhibition impairs CPXV replication by prevention of uncoating, suggesting that uncoating is mediated by proteasomal degradation of viral core proteins. Although Orthopoxvirus particles contain considerable amounts of ubiquitin, distinct modification sites are largely unknown. Therefore, for the first time, we analyzed globally ubiquitination sites in CPXV mature virion proteins using LC-MS/MS. Identification of 137 conserved sites in 54 viral proteins among five CPXV strains revealed extensive ubiquitination of structural core proteins. Moreover, since virions contained primarily K48-linked polyubiquitin, we hypothesized that core proteins are modified accordingly. However, quantitative analysis of ubiquitinated CPXV proteins early in infection showed no proteasomal degradation of core proteins. Instead, our data indicate that the recently suggested proteasomal regulation of the uncoating factor E5 is a prerequisite for uncoating. Expanding our understanding of poxvirus uncoating and elucidating a multitude of novel ubiquitination sites in poxvirus proteins, the present study verifies the major biological significance of ubiquitin in poxvirus infection.','2018-01-29 00:00:00','2018-01-29 00:00:00','2018-02-09 00:00:00',0,0,'Grossegesse, Marica, M|Doellinger, Joerg, J|Fritsch, Annemarie, A|Laue, Michael, M|Piesker, Janett, J|Schaade, Lars, L|Nitsche, Andreas, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(160,17,29753298,'1872-6976','Balance ability and cognitive impairment influence sustained walking in an assisted living facility.','The purpose of this study was to determine the influence of cognitive impairment (CI), gait quality, and balance ability on walking distance and speed in an assisted living facility.This was a longitudinal cohort study of institutionalized older adults (N = 26; 555 observations) followed for up to 8 months. Hierarchical linear modeling statistical techniques were used to examine the effects of gait quality and balance ability (using the Tinetti Gait and Balance Test) and cognitive status (using the Montreal Cognitive Assessment) on walking activity (distance, sustained distance, sustained speed). The latter were measured objectively and continuously by a real-time locating system (RTLS).A one-point increase in balance ability was associated with an 8% increase in sustained walking distance (p = 0.03) and a 4% increase in sustained gait speed (p = 0.00). Gait quality was associated with decreased sustained gait speed (p = 0.03). Residents with moderate (ERR = 2.34;p = 0.01) or severe CI (trend with an ERR = 1.62; p = 0.06) had longer sustained walking distances at slower speeds when compared to residents with no CI.After accounting for cognitive status, it was balance ability, not gait quality, that was a determinant of sustained walking distances and speeds. Therefore, balance interventions for older adults in assisted living may enable sustained walking activity. Given that CI was associated with more sustained walking, limiting sustained walking in the form of wandering behavior, especially for those with balance impairments, may prevent adverse events, including fall-related injury.','2018-05-06 00:00:00','2018-05-06 00:00:00','2018-05-12 00:00:00',0,0,'Bowen, Mary Elizabeth, ME|Crenshaw, Jeremy, J|Stanhope, Steven J, SJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(161,17,29753296,'1525-5069','Mortality-specific comorbidity among inpatients with epilepsy: A preliminary cross-sectional study in West China.','The purpose of this study was to investigate the current condition of mortality-specific comorbidity among hospitalized patients with epilepsy (PWE).The discharge abstract records of PWE from over 730,000 admissions were extracted from the hospital medical database. Fourteen mortality-related comorbidities from an epilepsy-specific index (ESI) were selected for the present assessment. The hospital-based prevalence of these comorbidities was estimated. The distributions of PWE with an ESI-based prognostic score were calculated.A cohort of 11,422 PWE (male 58.5%) was included in the present study. The order of comorbidities in terms of high to low prevalence ranking was as follows: hypertension (19.6%), peripheral vascular disease (8.1%), cardiac arrhythmias (5.8%), dementia (4.6%), renal disease (4.1%), congestive heart failure (3.8%), metastatic cancer (3.4%), brain tumor (2.4%), paraplegia and hemiplegia (2.0%), solid tumor without metastasis (1.7%), anoxic brain injury (1.4%), pulmonary circulation disorders (1.3%), moderate or severe liver disease (1.1%), and aspiration pneumonia (0.2%). High rates of comorbidities in the elderly were also noted. Spearman correlation analysis showed a moderate correlation between the changes in ages and prognostic score with a rho of 0.6 (p<0.001). The percentage of females with a score of 0 was higher than that of males (p<0.001), indicating that the prognostic survival of the majority of females was relatively longer than that of males.Our study demonstrated that the comorbidity burden of female PWE was relatively lower than that of male PWE. High prevalence of cardiac and vascular diseases was found in PWE, thereby affecting the long-term survival rate. Considering that the propensity of increased comorbidity was prevalent with age, we should implement early preventive measures to manage the potential comorbidities associated with mortality, reduce disease burden, and prolong the survival of PWE.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-12 00:00:00',0,0,'Si, Yang, Y|Xiao, Xiaoqiang, X|Sun, Hongbin, H','2018-05-17 22:46:19','2018-05-17 22:46:19'),(162,17,29752657,'1573-7365','Increased adiponectin is associated with cerebral white matter lesions in the elderly with cognitive impairment.','Adiponectin is an adipocyte-derived peptide that increases with age and is thought to protect against atherosclerotic vascular changes and organ damage. However, paradoxically, higher adiponectin levels are associated with increased risk for cardiovascular events and mortality. We investigated whether this adiponectin paradox occurs in elderly people with cognitive impairment. Fifty-two elderly participants with mild cognitive impairment or dementia (20 male and 32 female, aged 60-93 years, mean 80.0) were recruited. We evaluated serum adiponectin levels and cerebral white matter lesions (WML), which are involved in cognitive decline and dementia, by computed tomography. Body mass index (BMI), Mini-Mental State Examination score, history of hypertension (HT), chronic kidney disease, and diabetes mellitus were also assessed. Stepwise multiple regression analysis was used to reveal the relationships between serum adiponectin and age, sex, BMI, HT, diabetes mellitus, chronic kidney disease, Mini-Mental State Examination, and WML scores. High serum adiponectin levels correlated with more severe WML (P = 0.013). Low BMI (P < 0.001), female sex (P = 0.025), and high WML scores (P = 0.039) were significant determinants of high serum adiponectin. HT (P = 0.032) and high adiponectin levels (P = 0.021) were independent risk factors for WML. Overall, we observed an association between serum adiponectin levels and WML severity in elderly people with cognitive decline. Our findings reveal that the adiponectin paradox occurs in this population, and this study may help guide future treatments for elderly people with mild cognitive impairment or dementia.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Fujita, Youshi, Y|Toyomoto, Takashi, T|Sakoh-Goshima, Tomomi, T|Kohno, Yutaka, Y|Okada, Masafumi, M|Hamano, Tadanori, T|Nakamoto, Yasunari, Y','2018-05-17 22:46:19','2018-05-17 22:46:19'),(163,17,29752348,'1524-4628','Genetic Study of White Matter Integrity in UK Biobank (N=8448) and the Overlap With Stroke, Depression, and Dementia.','Structural integrity of the white matter is a marker of cerebral small vessel disease, which is the major cause of vascular dementia and a quarter of all strokes. Genetic studies provide a way to obtain novel insights in the disease mechanism underlying cerebral small vessel disease. The aim was to identify common variants associated with microstructural integrity of the white matter and to elucidate the relationships of white matter structural integrity with stroke, major depressive disorder, and Alzheimer disease.This genome-wide association analysis included 8448 individuals from UK Biobank-a population-based cohort study that recruited individuals from across the United Kingdom between 2006 and 2010, aged 40 to 69 years. Microstructural integrity was measured as fractional anisotropy- (FA) and mean diffusivity (MD)-derived parameters on diffusion tensor images. White matter hyperintensity volumes (WMHV) were assessed on T2-weighted fluid-attenuated inversion recovery images.We identified 1 novel locus at genome-wide significance ( [versican]: rs13164785; =3.7×10 for MD and rs67827860; =1.3×10 for FA). LD score regression showed a significant genome-wide correlation between FA, MD, and WMHV (FA-WMHV rG 0.39 [SE, 0.15]; MD-WMHV rG 0.56 [SE, 0.19]). In polygenic risk score analysis, FA, MD, and WMHV were significantly associated with lacunar stroke, MD with major depressive disorder, and WMHV with Alzheimer disease.Genetic variants within the  gene may play a role in the mechanisms underlying microstructural integrity of the white matter in the brain measured as FA and MD. Mechanisms underlying white matter alterations are shared with cerebrovascular disease, and inherited differences in white matter microstructure impact on Alzheimer disease and major depressive disorder.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Rutten-Jacobs, Loes C A, LCA|Tozer, Daniel J, DJ|Duering, Marco, M|Malik, Rainer, R|Dichgans, Martin, M|Markus, Hugh S, HS|Traylor, Matthew, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(164,17,29752306,'1526-632X','','No abstract found.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Oveisgharan, Shahram, S|Buchman, Aron S, AS|Yu, Lei, L|Farfel, Jose, J|Hachinski, Vladimir, V|Gaiteri, Chris, C|De Jager, Philip L, PL|Schneider, Julie A, JA|Bennett, David A, DA','2018-05-17 22:46:19','2018-05-17 22:46:19'),(165,17,29752254,'2368-7959','Cognitive Assessment of Patients With Alzheimer\'s Disease by Telemedicine: Pilot Study.','Approximately 46.8 million people are living with dementia worldwide and their number will grow in the next years. Any potential treatment should be administered as early as possible because it is important to provide an early cognitive assessment and to regularly monitor the mental function of patients. Information and communication technologies can be helpful to reach and follow patients without displacing them, but there may be doubts about the reliability of cognitive tests performed by telemedicine.The purpose of this study was to evaluate the reliability of the Mini Mental State Examination (MMSE) and the Alzheimer\'s Disease Assessment Scale cognitive subscale (ADAS-cog) tests administered in hospital by videoconference to patients with mild to moderate Alzheimer\'s disease.The tests were administered to 28 Alzheimer\'s disease outpatients (8 male, mean age 73.88, SD 7.45 years; 20 female mean age 76.00, SD 5.40 years) recruited and followed in the Alzheimer\'s Unit of the A Cardarelli National Hospital (Naples, Italy) at baseline and after 6, 12, 18, and 24 months of observation. Patients were evaluated first face-to-face by a psychologist and then, after 2 weeks, by another psychologist via videoconference in hospital.This study showed no differences in the MMSE and ADAS-cog scores when the tests were administered face-to-face or by videoconference, except in patients with more pronounced cognitive deficits (MMSE<17), in which the assessment via videoconference overestimated the cognitive impairment (face to face, MMSE mean 13.9, SD 4.9 and ADAS-cog mean 9.0, SD 3.8; videoconference, MMSE mean 42.8, SD 12.5 and ADAS-cog mean 56.9, SD 5.5).We found that videoconferencing is a reliable approach to document cognitive stability or decline, and to measure treatment effects in patients with mild to moderate dementia. A more extended study is needed to confirm these results.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Carotenuto, Anna, A|Rea, Raffaele, R|Traini, Enea, E|Ricci, Giovanna, G|Fasanaro, Angiola Maria, AM|Amenta, Francesco, F','2018-05-17 22:46:19','2018-05-17 22:46:19'),(166,17,29752159,'1538-9375','Predictors of Falls and Fractures Leading to Hospitalization in People With Dementia: A Representative Cohort Study.','Investigate predictors of falls and fractures leading to hospitalization in a large cohort of people with dementia.A retrospective cohort study.People with diagnosed dementia between January 2007 and March 2013, aged >65 years, were assembled using data from the Maudsley Biomedical Research Centre Case Register, from 4 boroughs in London serving a population of 1.3 million people.Falls and/or fractures leading to hospitalization were ascertained from linked national records. Demographic data, cognitive test scores, medications, and symptom and functioning scores from Health of the Nation Outcome Scales (HoNOS65+) were modeled in multivariate survival analyses to identify predictors of falls and fractures.Of 8036 people with dementia (63.9% female), 2500 (31.1%, incidence rate 125.5 per 1000 person-years) had a fall during a mean follow-up of 2.5 years and 1437 (17.7%, incidence rate 65.5 per 1000 person-years) had a fracture. In multivariable models, significant predictors of falls were increased age, female gender, physical health problems, previous fall or fracture, vascular dementia vs Alzheimer\'s disease, higher neighborhood deprivation, noncohabiting status, and problems with living conditions. Ethnic minority status was protective of falls (eg, Caribbean/Asian ethnicity). Medications (including psychotropic and antipsychotics), neuropsychiatric symptoms, cognitive (Mini-Mental State Examination scores), or functional problems did not predict hospitalized falls. Predictors of fractures were similar to those predicting falls.Over an average of 2.5 years, a third of people with dementia had a fall leading to hospitalization, necessitating action in clinical practice. Clinicians should consider that besides established demographic and physical health-related factors, the risk of hospitalization due to a fall or fractures in dementia is largely determined by environmental and socioeconomic factors. Interestingly, our data suggest that neuropsychiatric symptoms, cognitive status, functioning, or pharmacotherapy were not associated with falls/fractures.','2018-05-02 00:00:00','2018-05-02 00:00:00','2018-05-12 00:00:00',0,0,'Sharma, Shalini, S|Mueller, Christoph, C|Stewart, Robert, R|Veronese, Nicola, N|Vancampfort, Davy, D|Koyanagi, Ai, A|Lamb, Sarah E, SE|Perera, Gayan, G|Stubbs, Brendon, B','2018-05-17 22:46:19','2018-05-17 22:46:19'),(167,17,29752066,'1097-4180','The Microglial Innate Immune Receptor TREM2 Is Required for Synapse Elimination and Normal Brain Connectivity.','The triggering receptor expressed on myeloid cells 2 (TREM2) is a microglial innate immune receptor associated with a lethal form of early, progressive dementia, Nasu-Hakola disease, and with an increased risk of Alzheimer\'s disease. Microglial defects in phagocytosis of toxic aggregates or apoptotic membranes were proposed to be at the origin of the pathological processes in the presence of Trem2 inactivating mutations. Here, we show that TREM2 is essential for microglia-mediated synaptic refinement during the early stages of brain development. The absence of Trem2 resulted in impaired synapse elimination, accompanied by enhanced excitatory neurotransmission and reduced long-range functional connectivity. Trem2 mice displayed repetitive behavior and altered sociability. TREM2 protein levels were also negatively correlated with the severity of symptoms in humans affected by autism. These data unveil the role of TREM2 in neuronal circuit sculpting and provide the evidence for the receptor\'s involvement in neurodevelopmental diseases.','2018-05-03 00:00:00','2018-05-03 00:00:00','2018-05-12 00:00:00',0,0,'Filipello, Fabia, F|Morini, Raffaella, R|Corradini, Irene, I|Zerbi, Valerio, V|Canzi, Alice, A|Michalski, Bernadeta, B|Erreni, Marco, M|Markicevic, Marija, M|Starvaggi-Cucuzza, Chiara, C|Otero, Karel, K|Piccio, Laura, L|Cignarella, Francesca, F|Perrucci, Fabio, F|Tamborini, Matteo, M|Genua, Marco, M|Rajendran, Lawrence, L|Menna, Elisabetta, E|Vetrano, Stefania, S|Fahnestock, Margaret, M|Paolicelli, Rosa Chiara, RC|Matteoli, Michela, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(168,17,29752036,'1578-1968','Blood biomarkers in Alzheimer\'s disease.','The early diagnosis of Alzheimer\'s disease (AD) via the use of biomarkers could facilitate the implementation and monitoring of early therapeutic interventions with the potential capacity to significantly modify the course of the disease.Classic cerebrospinal fluid biomarkers and approved structural and functional neuroimaging have a limited clinical application given their invasive nature and/or high cost. The identification of more accessible and less costly biomarkers, such as blood biomarkers, would facilitate application in clinical practice. We present a literature review of the main blood biochemical biomarkers with potential use for diagnosing Alzheimer\'s disease.Blood biomarkers are cost and time effective with regard to cerebrospinal fluid biomarkers. However, the immediate applicability of blood biochemical biomarkers in clinical practice is not very likely. The main limitations come from the difficulties in measuring and standardising thresholds between different laboratories and in failures to replicate results. Among all the molecules studied, apoptosis and neurodegeneration biomarkers and the biomarker panels obtained through omics approaches, such as isolated or combined metabolomics, offer the most promising results.','2018-05-08 00:00:00','2018-05-08 00:00:00','2018-05-12 00:00:00',0,0,'Altuna-Azkargorta, M, M|Mendioroz-Iriarte, M, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(169,17,29752034,'1578-1968','Validity of a computerized population registry of dementia based on clinical databases.','The handling of information through digital media allows innovative approaches for identifying cases of dementia through computerized searches within the clinical databases that include systems for coding diagnoses. The aim of this study was to analyze the validity of a dementia registry in Gipuzkoa based on the administrative and clinical databases existing in the Basque Health Service.This is a descriptive study based on the evaluation of available data sources. First, through review of medical records, the diagnostic validity was evaluated in 2 samples of cases identified and not identified as dementia. The sensitivity, specificity and positive and negative predictive value of the diagnosis of dementia were measured. Subsequently, the cases of living dementia in December 31, 2016 were searched in the entire Gipuzkoa population to collect sociodemographic and clinical variables.The validation samples included 986 cases and 327 no cases. The calculated sensitivity was 80.2% and the specificity was 99.9%. The negative predictive value was 99.4% and positive value was 95.1%. The cases in Gipuzkoa were 10,551, representing 65% of the cases predicted according to the literature. Antipsychotic medication were taken by a 40% and a 25% of the cases were institutionalized.A registry of dementias based on clinical and administrative databases is valid and feasible. Its main contribution is to show the dimension of dementia in the health system.','2018-05-08 00:00:00','2018-05-08 00:00:00','2018-05-12 00:00:00',0,0,'Mar, J, J|Arrospide, A, A|Soto-Gordoa, M, M|Machón, M, M|Iruin, Á, Á|Martinez-Lage, P, P|Gabilondo, A, A|Moreno-Izco, F, F|Gabilondo, A, A|Arriola, L, L','2018-05-17 22:46:19','2018-05-17 22:46:19'),(170,18,29752950,'1872-9096','Minocycline suppresses dengue virus replication by down-regulation of macrophage migration inhibitory factor-induced autophagy.','Dengue virus (DENV) infection is the most prevalent mosquito-borne viral infection of which there is no licensed therapeutic drug available. Previous studies have shown that minocycline, an antibiotic, can inhibit DENV infection in vitro. However, the mechanism is not fully understood. It is known that macrophage migration inhibitory factor (MIF), a pro-inflammatory cytokine, is involved in dengue disease development; MIF can induce autophagy, and autophagy can facilitate DENV replication. Therefore, we tested the hypothesis that MIF-induced autophagy is involved in minocycline treatment against DENV infection. We first showed that DENV infection induced MIF secretion and autophagy flux in HuH-7 cells. Suppression of endogenous MIF by short hairpin RNA (shRNA) and inhibition of MIF by its inhibitors attenuated DENV replication and autophagy formation. In addition, minocycline treatment suppressed DENV-induced MIF secretion and autophagy in vitro. Finally, we demonstrated that minocycline treatment attenuated viral load, MIF secretion, autophagy and increase survival in DENV-infected mice. These results suggest that inhibition of MIF-induced autophagy by minocycline might represent an alternative therapeutic approach against DENV infection.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-12 00:00:00',0,0,'Lai, Yen-Chung, YC|Chuang, Yung-Chun, YC|Chang, Chih-Peng, CP|Lin, Yee-Shin, YS|Perng, Guey-Chuen, GC|Wu, Han-Chung, HC|Hsieh, Shie-Liang, SL|Yeh, Trai-Ming, TM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(171,18,29752023,'1873-2518','Decreased accumulation of subgenomic RNA in human cells infected with vaccine candidate DEN4Δ30 increases viral susceptibility to type I interferon.','The NIH has developed live attenuated dengue virus (DENV) vaccine candidates by deletion of 30 nucleotides (Δ30) from the untranslated region of the viral genome. Although this attenuation strategy has proven to be effective in generating safe and immunogenic vaccine strains, the molecular mechanism of attenuation is largely unknown. To examine the mediators of the observed attenuation phenotype, differences in translation efficiency, genome replication, cytotoxicity, and type I interferon susceptibility were compared between wild type parental DENV and DENVΔ30 attenuated vaccine candidates. We observed that decreased accumulation of subgenomic RNA (sfRNA) from the vaccine candidates in infected human cells causes increased type I IFN susceptibility and propose this as one of the of attenuation mechanisms produced by the 3\' UTR Δ30 mutation.','2018-05-08 00:00:00','2018-05-08 00:00:00','2018-05-12 00:00:00',0,0,'Bustos-Arriaga, José, J|Gromowski, Gregory D, GD|Tsetsarkin, Konstantin A, KA|Firestone, Cai-Yen, CY|Castro-Jiménez, Tannya, T|Pletnev, Alexander G, AG|Cedillo-Barrón, Leticia, L|Whitehead, Stephen S, SS','2018-05-17 22:46:19','2018-05-17 22:46:19'),(172,18,29751893,'1877-5853','Dynamics of dengue disease with human and vector mobility.','Dengue is a vector borne disease transmitted to humans by Aedes aegypti mosquitoes carrying virus of different serotypes. Dengue exhibits complex spatial and temporal dynamics, influenced by various biological, human and environmental factors. In this work, we study the dengue spread for a single serotype (DENV-1) including statistical models of human mobility with exponential step length distribution, by using reaction-diffusion equations and Stochastic Cellular Automata (SCA) approach. We analyze the spatial and temporal spreading of the disease using parameters from field studies. We choose mosquito density data from Ahmedabad city as a proxy for climate data in our SCA model. We find an interesting result that although human mobility makes the infection spread faster, there is an apparent early suppression of the epidemic compared to immobile humans. The disease extinction time is lesser when human mobility is included.','2018-06-01 00:00:00','2018-03-10 00:00:00','2018-05-12 00:00:00',0,0,'Enduri, Murali Krishna, MK|Jolad, Shivakumar, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(173,18,29751873,'1875-9157','Acute Viral Hepatitis: Beyond A, B, and C.','From the standpoint of the surgical pathologist \"hepatitis\" is defined as the set of histologic patterns of lesions found in livers infected by hepatotropic viruses, by non-hepatotrophic viruses leading to liver inflammation in the context of systemic infection, or due to an autoimmune disease, drug, or toxin involving the liver. This article is centered on the histologic patterns of injury in acute viral hepatitis, encompassing the hepatotropic viruses A, B, C, D, and E and the \"icteric hemorrhagic fevers\" (dengue, hantavirus, yellow fever). A brief mention of viruses causing hepatitis in immunosuppressed patients also is presented.','2018-06-01 00:00:00','2018-03-26 00:00:00','2018-05-12 00:00:00',0,0,'Alves, Venancio Avancini Ferreira, VAF','2018-05-17 22:46:19','2018-05-17 22:46:19'),(174,18,29751814,'1756-3305','A Wolbachia triple-strain infection generates self-incompatibility in Aedes albopictus and transmission instability in Aedes aegypti.','Artificially-introduced transinfections of the intracellular bacterium Wolbachia pipientis have the potential to reduce the vectorial capacity of mosquito populations for viruses such as dengue and chikungunya. Aedes albopictus has two native strains of Wolbachia, but their replacement with the non-native wMel strain blocks transmission of both viruses. The pattern of cytoplasmic incompatiiblity generated by wMel with wild-types is bidirectional. Novel-plus-native-strain co-infection is predicted to lead to a more efficient population spread capacity; from a bi-directional to a uni-directional cytoplasmic incompatibility (CI) model.A novel-plus-native-strain triple-infection in Ae. albopictus (wAlbAwAlbBwMel) was generated. Although triple-infected females were fully reproductively viable with uninfected males, they displayed self-incompatibility. qPCR of specific strains in dissected tissues suggested that this may be due to the displacement of one of the native strains (wAlbA) from the ovaries of triple-infected females. When the triple strain infection was transferred into Aedes aegypti it displayed an unexpectedly low level of transmission fidelity of the three strains in this species.These results suggest that combining Wolbachia strains can lead to co-infection interactions that can affect outcomes of CI and maternal transmission.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Ant, Thomas H, TH|Sinkins, Steven P, SP','2018-05-17 22:46:19','2018-05-17 22:46:19'),(175,18,29751761,'1743-422X','Evaluation of an immunochromatography rapid diagnosis kit for detection of chikungunya virus antigen in India, a dengue-endemic country.','Chikungunya virus (CHIKV) and dengue virus (DENV) are arboviruses that share the same Aedes mosquito vector, and there is much overlap in endemic areas. In India, co-infection with both viruses is often reported. Clinical manifestations of Chikungunya fever is often confused with dengue fever because clinical symptoms of both infections are similar. It is, therefore, difficult to differentiate from those of other febrile illnesses, especially dengue fever. We previously developed a CHIKV antigen detection immunochromatography (IC) rapid diagnosis kit [1]. The current study examined the efficacy of previously mentioned IC kit in India, a dengue-endemic country.Sera from 104 CHIKV-positive (by qRT-PCR) and/or IgM-positive (ELISA) subjects collected in 2016, were examined. Fifteen samples from individuals with CHIKV-negative/DENV-positive and 4 samples from healthy individuals were also examined. Of the 104 CHIKV-positive sera, 20 were co-infected with DENV.The sensitivity, specificity and overall agreement of the IC assay were 93.7, 95.5 and 94.3%, respectively, using qRT-PCR as a gold standard. Also, there was a strong, statistically significant positive correlation between the IC kit device score and the CHIKV RNA copy number. The IC kit detected CHIKV antigen even in DENV-co-infected patient sera and did not cross-react with DENV NS1-positive/CHIKV-negative samples.The results suggest that the IC kit is useful for rapid diagnosis of CHIKV in endemic areas in which both CHIKV and DENV are circulating.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Jain, Jaspreet, J|Okabayashi, Tamaki, T|Kaur, Navjot, N|Nakayama, Emi, E|Shioda, Tatsuo, T|Gaind, Rajni, R|Kurosu, Takeshi, T|Sunil, Sujatha, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(176,18,29751758,'1471-2458','Factors associated with dengue prevention behaviour in Lowokwaru, Malang, Indonesia: a cross-sectional study.','Dengue prevention is important for controlling the spread of dengue infection. Transmission of dengue can be prevented by controlling mosquito breeding sites. Indonesia has dengue a prevention program to minimize mosquito breeding sites known as 3 M Plus. This study aimed to investigate factors associated with dengue prevention behaviour among respondents in the Lowokwaru subdistrict, an urban area in Malang, Indonesia.This cross-sectional study used a semi-structured questionnaire that was conducted by face-to-face interview.Older respondents (> 60 years and 41-60 years) showed better dengue prevention behaviour than younger respondents (21-40 years and < 21 years) (p value = 0.01). Proportionally more male respondents showed poor dengue prevention behaviour compared with female respondents (p value = 0.007). Respondents who lived in Malang for long durations showed better dengue prevention behaviour compared with those who lived there for a shorter period (p value = 0.016). Those with more family members in their households practiced better dengue prevention behaviour compared with those with fewer family members (p value = 0.004). Perception was associated with dengue prevention behaviour. Respondents who had higher perceived susceptibility showed better dengue prevention behaviour compared with those who had moderate perceptions (p value = 0.000).Age, gender, duration of stay in Malang, number of family members, and perception of dengue susceptibility were associated with dengue prevention behaviour.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Rakhmani, Alidha Nur, AN|Limpanont, Yanin, Y|Kaewkungwal, Jaranit, J|Okanurak, Kamolnetr, K','2018-05-17 22:46:19','2018-05-17 22:46:19'),(177,18,29751486,'1999-4915','Current Strategies for Inhibition of Chikungunya Infection.','Increasing incidences of Chikungunya virus (CHIKV) infection and co-infections with Dengue/Zika virus have highlighted the urgency for CHIKV management. Failure in developing effective vaccines or specific antivirals has fuelled further research. This review discusses updated strategies of CHIKV inhibition and provides possible future directions. In addition, it analyzes advances in CHIKV lifecycle, drug-target development, and potential hits obtained by in silico and experimental methods. Molecules identified with anti-CHIKV properties using traditional/rational drug design and their potential to succeed in subsequent stages of drug development have also been discussed. Possibilities of repurposing existing drugs based on their in vitro findings have also been elucidated. Probable modes of interference of these compounds at various stages of infection, including entry and replication, have been highlighted. The use of host factors as targets to identify antivirals against CHIKV has been addressed. While most of the earlier antivirals were effective in the early phases of the CHIKV life cycle, this review is also focused on drug candidates that are effective at multiple stages of its life cycle. Since most of these antivirals require validation in preclinical and clinical models, the challenges regarding this have been discussed and will provide critical information for further research.','2018-05-03 00:00:00','2018-05-03 00:00:00','2018-05-12 00:00:00',0,0,'Subudhi, Bharat Bhusan, BB|Chattopadhyay, Soma, S|Mishra, Priyadarsee, P|Kumar, Abhishek, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(178,18,29751200,'1873-4235','Biosensor-based selective detection of Zika virus specific antibodies in infected individuals.','Zika virus (ZIKV) recently emerged as a global threat subsequent to its global spread because it induces microencephaly and other brain damages in infants born to infected mothers. Epidemiological monitoring of infection has been hampered by the absence of reliable serological tests capable to distinguish between ZIKV and other Flavivirus infections, in particular Dengue virus (DENV). As both viruses are transmitted by the same mosquito-species, their distributions largely overlap and reliable serological distinction between the viruses is essential. Here we develop a novel biosensor which is based on recombinant forms of ZIKV non-structural protein 1 (NS1) and the domain III of the envelope protein (EDIII). Using electrochemical impedance spectroscopy (EIS) and square wave voltammetry (SWV), we demonstrate that in addition to extremely sensitive detection of ZIKV-specific antibodies in serum and saliva, the biosensor promptly distinguished ZIKV and DENV-specific antibodies. Hence, this novel biosensor allows assessing ZIKV antibodies in blood and saliva and results are unaffected by presence of DENV virus-specific antibodies.','2018-05-01 00:00:00','2018-05-01 00:00:00','2018-05-11 00:00:00',0,0,'Cabral-Miranda, Gustavo, G|Cardoso, Ana R, AR|Ferreira, Luis C S, LCS|Sales, M Goreti F, MGF|Bachmann, Martin F, MF','2018-05-17 22:46:19','2018-05-17 22:46:19'),(179,18,29749366,'0971-5916','Experimental Zika virus infection in : Susceptibility, transmission & co-infection with dengue & chikungunya viruses.','There are reports about the susceptibility of Aedes mosquitoes to ZIKV from various countries, however, no such information is available from Indian sub-continent, although, high level of group cross-reactivity of ZIKV with other flaviviruses has been reported. During outbreak situations, many cases of Dengue (DEN) and Chikungunya (CHIK) are reported. In such scenario, vector mosquitoes are likely to get co-infection/secondary-infection with one or other virus. The present study was carried out to determine the susceptibility of Indian strain of Aedes aegypti to Zika virus (ZIKV) strain (MR-766) and the effect of co-infection/super-infection with either dengue virus (serotype-2) (DENV) or chikungunya virus (CHIKV) on ZIKV replication.Ae. aegypti mosquitoes used in this study were reared for many generations since 1980 at laboratory colony maintained at the ICMR-National Institute of Virology, Pune, India. Transmissibility of ZIKV from infected mosquitoes to suckling mice was also studied. Mosquitoes were experimentally infected with ZIKV and super-infected with either DENV or CHIKV via membrane-feeding route and incubated for 14 days at 28±2°C and humidity of 85±5 per cent. Replication of these viruses in mosquitoes was confirmed using real-time reverse transcription-polymerase chain reaction and immunofluorescence assay. Twenty infected mosquitoes were allowed to feed upon four suckling CD1 mice for about 30 min. Transmission of the ZIKV by infected mosquitoes to suckling mice was confirmed by the appearance of clinical signs and the presence of viral RNA in different organs.Concomitant infection of mosquitoes with all the three viruses showed simultaneous propagation of all three viruses, confirmed by real time RT-PCR and IFA. Infection of mosquitoes with CHIKV followed by ZIKV showed positivity in individual head squashes (7%) for both viruses using IFA; only 8.3 per cent showed dual positivity with primary infection of ZIKV followed by DENV; 8.3 per cent dual infection positivity was observed when infected with DENV followed by ZIKV; 5 per cent showed dual infection was observed when infected with ZIKV followed by CHIKV. Ae. aegypti was found to be susceptible to ZIKV strain as ZIKV could be detected from the second post-infection day (PID) in infected mosquitoes. Transmission of ZIKV to mice by the bite of infected Ae. aegypti establishes this species as a potential vector.From super-infection experiments, it was concluded that ZIKV might have a relative advantage in replication dynamics over DENV. Vertical transmission was not observed for ZIKV in experimentally infected mosquitoes (n=920 larvae). Further studies are required to understand the possibility of silently circulating ZIKV in India, which remain non-detected because of lack of surveillance.','2018-01-01 00:00:00','0000-00-00 00:00:00','2018-05-11 00:00:00',0,0,'Mourya, Devendra T, DT|Gokhale, Mangesh D, MD|Majumdar, Triparna D, TD|Yadav, Pragya D, PD|Kumar, Vimal, V|Mavale, Mangala S, MS','2018-05-17 22:46:19','2018-05-17 22:46:19'),(180,19,29753033,'1097-6825','Nemolizumab in moderate-to-severe atopic dermatitis: Randomized, phase II, long-term extension study.','Nemolizumab, an anti-interleukin-31 receptor A monoclonal antibody, improved pruritus, dermatitis, and sleep in adults with moderate-to-severe atopic dermatitis inadequately controlled by topical treatments in a phase II, 12-week, randomized, double-blind, placebo-controlled study (Part A) (NCT01986933).To assess long-term efficacy and safety of nemolizumab injected subcutaneously every 4 weeks (Q4W) or every 8 weeks (Q8W) in a 52-week double-blind extension (Part B).During Part B, patients continued previous nemolizumab dose (0.1, 0.5, or 2.0 mg/kg Q4W or 2.0 mg/kg Q8W). Part B endpoints included percentage improvement from baseline in pruritus visual analogue scale (VAS) and dermatitis scores (including Eczema Area and Severity Index [EASI]).Overall, 216/264 patients completed Part A and 191 entered Part B; 131 completed Part B. In 153 patients randomized to nemolizumab in Part A, improvement from baseline in pruritus VAS was maintained/increased from Week 12 to 64, with greatest improvement in the 0.5-mg/kg Q4W group (percentage change from baseline at Week 64: -73.0, -89.6, -74.7, and -79.1 in the 0.1-, 0.5-, and 2.0-mg/kg Q4W and 2.0-mg/kg Q8W groups, respectively). Improvement from baseline in dermatitis scores was also maintained/increased to Week 64 (percent change in EASI score: -68.5, -75.8, -78.9, and -69.3 in the 0.1-, 0.5-, and 2.0-mg/kg Q4W and 2.0-mg/kg Q8W groups, respectively). Over 64 weeks, 83-89% had ≥1 adverse event, with no new safety concerns identified.Nemolizumab for up to 64 weeks was efficacious and, overall, well tolerated in patients with moderate-to-severe atopic dermatitis inadequately controlled by topical therapy.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-12 00:00:00',0,0,'Kabashima, Kenji, K|Furue, Masutaka, M|Hanifin, Jon M, JM|Pulka, Grazyna, G|Wollenberg, Andreas, A|Galus, Ryszard, R|Etoh, Takafumi, T|Mihara, Ryosuke, R|Nakano, Miwa, M|Ruzicka, Thomas, T','2018-05-17 22:46:19','2018-05-17 22:46:19'),(181,19,29752728,'1365-4632','A retrospective study of dermatitis herpetiformis from an immunobullous disease clinic in north India.','Indian data on dermatitis herpetiformis (DH) is not available. The aim of this study was to investigate the demographic and clinicopathological characteristics of patients with DH and to study its association with other autoimmune diseases.All data were collected from case record forms of patients registered in immunobullous disease clinic of our institute. The diagnosis was based on characteristic clinical and immuno/histopathological features.A total of 65 patients were included, which constituted 9.47% of the registered patients in the immunobullous disease clinic over 3.5 years. The male to female ratio was 1.4 : 1; the average age was 44.35 ± 15.52 years. Direct immunofluorescence showed granular IgA deposits at the papillary tips in 83.07% and basement membrane zone in 12.3% patients. Sixteen (24.1%) patients had associated celiac disease, and 15 (23.07%) patients had other autoimmune comorbidities such as hypothyroidism. Forty percent of patients on strict gluten-free diet achieved remission in 2 years, while 35.4% had frequent relapses as they continued gluten intake.Dermatitis herpetiformis is not a rare disease in northern India as previously believed. The clinical, histological, and immunopathological characteristics of Indian DH patients are similar to those reported in Caucasian populations. The limitations of our study include an absence of genetic testing for HLA-DQ2 or DQ8, nonavailability of kits for detecting IgA specific for epidermal transglutaminase (IgA eTG), and short follow-up period.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Handa, Sanjeev, S|Dabas, Garima, G|De, Dipankar, D|Mahajan, Rahul, R|Chatterjee, Debajyoti, D|Saika, Uma N, UN|Radotra, Bishan D, BD','2018-05-17 22:46:19','2018-05-17 22:46:19'),(182,19,29752146,'1873-569X','A novel, topical, nonsteroidal, TRPV1 antagonist, PAC-14028 cream improves skin barrier function and exerts anti-inflammatory action through modulating epidermal differentiation markers and suppressing Th2 cytokines in atopic dermatitis.','Although it is established that epidermal barrier disturbance and immune dysfunction resulting in IgE sensitization are critical factors in the development of cutaneous inflammation, the pathogenesis and targeted therapy of atopic dermatitis (AD)-specific pathways have still been unknown.Taking into account the fact that Th2 cytokines in AD have both unique and overlapping functions including increased epidermal thickening, inflammation, and decreased expressing of the barrier proteins keratinocyte differentiation, we sought to clarify our hypothesis that TRPV1 antagonist plays a critical role in skin barrier function and can be a therapeutic target for AD.AD-like dermatitis was induced in hairless mice by repeated oxazolone (Ox) challenges to hairless mice. The functional studies concerning skin barrier function, anti-inflammatory action, and molecular mechanism by TRPV1 antagonism were conducted by histopathological assays, ELISA, qPCR, western blotting, and skin blood flow measurement.Topically administered TRPV1 antagonist, PAC-14028 (Asivatrep: CHFNOS), improved AD-like dermatitis and skin barrier functions, and restored the expression of epidermal differentiation markers. In addition, the PAC-14028 cream significantly inhibited cutaneous inflammation by decreasing the expression of serum IgE, and the epidermal expression of IL-4, and IL-13 in Ox-AD mice. These results may provide a novel insight into the molecular mechanism of PAC-14028 cream involved in anti-inflammatory effects and skin barrier functions by suppressing the multiple signaling pathways including IL-4/-13-mediated activation of JAK/STAT, TRPV1, and neuropeptides.PAC-14028 cream can be a potential therapeutic tool for the treatment of chronic inflammation and disrupted barrier function in patients with AD.','2018-04-30 00:00:00','2018-04-30 00:00:00','2018-05-12 00:00:00',0,0,'Lee, Ji-Hae, JH|Choi, Chang Soon, CS|Bae, Il-Hong, IH|Choi, Jin Kyu, JK|Park, Young-Ho, YH|Park, Miyoung, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(183,19,29751573,'2076-2615','Effect of Different Flooring Designs on the Performance and Foot Pad Health in Broilers and Turkeys.','Litter quality has a significant influence on the performance and foot pad health in poultry. The objective of this study was to evaluate the effects of different types of flooring designs on the performance and foot pad health in fattening broilers and turkeys. Three trials were conducted for each species using a total of 720 Ross 308 broilers and 720 Big 6 turkeys. After day seven, animals were randomly assigned to four groups with three subgroups each: G1&mdash;floor pens with litter, G2&mdash;floor pens with litter and floor heating, G3&mdash;partially-slatted flooring, including a littered area, and G4&mdash;fully-slatted flooring with a sand bath (900 cm²). Animals of both species had a significantly higher final body weight at dissection (day 36) after being reared on fully-slatted floors compared to common littered floors. In turkeys, the feed conversion ratio was worse in G4 (1.53 ± 0.04) than in G1 (1.47 ± 0.02) and G2 (1.48 ± 0.03). Water to feed ratio was significantly higher in G2 than other groups. Turkeys&rsquo; foot pad health was significantly better in G4 than in other groups beginning at day 21. In turkeys, platforms with slatted floors that allow for temporary separation of the feet from the litter could lead to improvements in foot pad health which could better enable the realization of species-specific behaviours and activities in littered areas.','2018-05-03 00:00:00','2018-05-03 00:00:00','2018-05-12 00:00:00',0,0,'Chuppava, Bussarakam, B|Visscher, Christian, C|Kamphues, Josef, J','2018-05-17 22:46:19','2018-05-17 22:46:19'),(184,19,29751002,'1523-1747','ADAM17 deficient mice model the transcriptional signature of human atopic dermatitis.','No abstract found.','2018-05-08 00:00:00','2018-05-08 00:00:00','2018-05-11 00:00:00',0,0,'Woodring, Therese, T|Kobayashi, Tetsuro, T|Kim, Doyoung, D|Nagao, Keisuke, K','2018-05-17 22:46:19','2018-05-17 22:46:19'),(185,19,29750772,'1531-698X','The ins and outs of an \'outside-in\' view of allergies: atopic dermatitis and allergy prevention.','The skin barrier is a dynamic innate immune organ. This review summarizes the current understanding of how deficiencies associated with atopic dermatitis invite other atopic disorders of the allergic march.Atopic dermatitis is characterized by skin barrier defects (such as mutations in filaggrin), intrinsic proallergic T-helper cell 2 immune dysregulation, and skin microbiome alterations. These factors promote the development of food allergy and asthma. Prevention of atopic dermatitis may involve topical emollients and oral probiotic supplementation, while some food allergies can be prevented by early introduction of potential food allergens to at-risk infants. Traditional therapies for atopic dermatitis involve skin hydration, emollients, and anti-inflammatory topical therapies including topical corticosteroids and calcineurin inhibitors. Dupilumab is a new and promising targeted biologic medication approved for use in adults with more severe atopic dermatitis; however, additional research is needed to determine whether this medication should be incorporated more broadly into management of severe childhood atopic dermatitis.Atopic dermatitis management involves early diagnosis, skin barrier function support, mitigation of cutaneous inflammation, and concomitant risk stratification for the development of food allergy, asthma, allergic rhinitis, and environmental allergies.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-11 00:00:00',0,0,'Shaker, Marcus, M|Murray, Robert G P, RGP|Mann, Julianne A, JA','2018-05-17 22:46:19','2018-05-17 22:46:19'),(186,19,29750111,'2052-6687','Demography and disorders of the French Bulldog population under primary veterinary care in the UK in 2013.','Despite its Gallic name, the French Bulldog is a breed of both British and French origin that was first recognised by The Kennel Club in 1906. The French Bulldog has demonstrated recent rapid rises in Kennel Club registrations and is now (2017) the second most commonly registered pedigree breed in the UK. However, the breed has been reported to be predisposed to several disorders including ocular, respiratory, neurological and dermatological problems. The VetCompass™ Programme collates de-identified clinical data from primary-care veterinary practices in the UK for epidemiological research. Using VetCompass™ clinical data, this study aimed to characterise the demography and common disorders of the general population of French Bulldogs under veterinary care in the UK.French Bulldogs comprised 2228 (0.49%) of 445,557 study dogs under veterinary care during 2013. Annual proportional birth rates showed that the proportional ownership of French Bulldog puppies rose steeply from 0.02% of the annual birth cohort attending VetCompass™ practices in 2003 to 1.46% in 2013. The median age of the French Bulldogs overall was 1.3 years (IQR 0.6-2.5, range 0.0-13.0). The most common colours of French Bulldogs were brindle (solid or main) (32.36%) and fawn (solid or main) (29.9%). Of the 2228 French Bulldogs under veterinary care during 2013, 1612 (72.4%) had at least one disorder recorded. The most prevalent fine-level precision disorders recorded were otitis externa (14.0%, 95% CI: 12.6-15.5), diarrhoea (7.5%, 95% CI: 6.4-8.7), conjunctivitis (3.2%, 95% CI: 2.5-4.0), nails overlong (3.1%, 95% CI% 2.4-3.9) and skin fold dermatitis (3.0%, 95% CI% 2.3-3.8). The most prevalent disorder groups were cutaneous (17.9%, 95% CI: 16.3-19.6), enteropathy (16.7%, 95% CI: 15.2-18.3), aural (16.3%, 95% CI: 14.8-17.9), upper respiratory tract (12.7%, 95% CI: 11.3-14.1) and ophthalmological (10.5%, 95% CI: 9.3-11.9).Ownership of French Bulldogs in the UK is rising steeply. This means that the disorder profiles reported in this study reflect a current young UK population and are likely to shift as this cohort ages. Otitis externa, diarrhoea and conjunctivitis were the most common disorders in French Bulldogs. Identification of health priorities based on VetCompass™ data can support evidence-based reforms to improve health and welfare within the breed.','2018-05-17 00:00:00','2018-05-03 00:00:00','2018-05-11 00:00:00',0,0,'O\'Neill, Dan G, DG|Baral, Lauren, L|Church, David B, DB|Brodbelt, Dave C, DC|Packer, Rowena M A, RMA','2018-05-17 22:46:19','2018-05-17 22:46:19'),(187,19,29749768,'0966-0461','Incontinence-associated dermatitis from a urinary incontinence perspective.','This article looks at incontinence-associated dermatitis (IAD) from the perspective of urinary incontinence (UI). IAD is caused by urine remaining on the skin following UI, which has many causes. It therefore should be assessed, treated and either resolved or managed to reduce the risk of IAD or its impact. The skin\'s anatomy and physiology are discussed and the changes resulting from IAD are explained. Should it occur, IAD can be treated by cleansing, moisturising and protecting the skin as appropriate, thus restoring its previous barrier functions. There can be confusion with grade 1 and 2 pressure ulcers, and the article points out the visual differences between these and IAD.','2018-05-10 00:00:00','0000-00-00 00:00:00','2018-05-11 00:00:00',0,0,'Wilson, Mary, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(188,19,29749619,'1600-0536','Allergic contact cheilitis in an adolescent to Ricinus communis seed oil (castor oil) in a lip balm.','No abstract found.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-11 00:00:00',0,0,'Sánchez-Herrero, Alejandro, A|Mateos-Mayo, Ana, A|Rodríguez-Lomba, Enrique, E|Molina-López, Irene, I|Campos-Domínguez, Minia, M|Suárez Fernández, Ricardo, R','2018-05-17 22:46:19','2018-05-17 22:46:19'),(189,19,29749093,'1440-0960','Contact dermatitis to Dermabond Advance®.','No abstract found.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-11 00:00:00',0,0,'Kanazawa, Azusa, A|Uno, Hirokazu, H|Nakada, Tokio, T|Shaw, Daniel W, DW|Maibach, Howard I, HI','2018-05-17 22:46:19','2018-05-17 22:46:19'),(190,20,29752700,'1573-7403','Neuro-radiological features can predict hypopituitarism in primary autoimmune hypophysitis.','Primary autoimmune hypophysitis (PAH) is considered an underdiagnosed disease, due to the difficulty in reaching a definitive diagnosis. PAH clinical diagnosis remains an exclusion diagnosis. We aimed to correlate PAH neuro-radiological signs to endocrine features and evaluate their prognostic role. 24 PAH cases were enrolled and classified according to neuro-radiological signs: in 12 adeno-hypophysitis (AHs), 8 infundibulo-neuro-hypophysitis (INHs) and 4 pan-hypophysitis (PHs). Secondary hypogonadism developed more frequently in INHs as compared to AHs (54.5% vs. 27.3%, p = 0.05), without no difference with PHs (p = 0.6). Diabetes insipidus occurred more frequently in INHs cases (72.7%, p < 0.001) and in PHs cases (27.3%, p = 0.007), as compared to AHs cases (0%). Similarly, all cases of GHD occurred in INHs (100%) as compared to AHs (0%, p < 0.001) and PHs (0%, p < 0.001). The pituitary stalk (PS) showed a pseudo-triangular shape (larger at the optical chiasma) in INHs and a pseudo-cylindrical shape (larger both at the optical chiasma and at the pituitary insertion) in PHs. The PS pseudo-triangular shape correlated to the occurrence of GHD and diabetes insipidus (p < 0.001/p = 0.03). At the 1-year follow-up, improvement of baseline radiological features positively correlated with the loss of the neuro-pituitary \"bright spot\" on T1-weighted images (OR 0.16; 95% CI 0.03-0.9 p = 0.02) and with a PS diameter at the optical chiasma level larger than 4.1 mm (AUC 0.97, sensibility 80%, specificity 100%, OR 6; 95% CI1.1-28.8, p = 0.01) Our data suggest that neuro-radiological PAH classification in PH, AH and INH can predict pituitary dysfunction and that some neuro-radiological features, such as the pituitary stalk diameter and the loss of the neuro-pituitary bright spot on T1w images can play a role as a positive prognostic marker of the radiological hypophysitis outcome.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Tartaglione, Tommaso, T|Chiloiro, Sabrina, S|Laino, Maria Elena, ME|Giampietro, Antonella, A|Gaudino, Simona, S|Zoli, Angelo, A|Bianchi, Antonio, A|Pontecorvi, Alfredo, A|Colosimo, Cesare, C|De Marinis, Laura, L','2018-05-17 22:46:19','2018-05-17 22:46:19'),(191,20,29752488,'1433-0350','Open resection of hypothalamic hamartomas for intractable epilepsy revisited, using intraoperative MRI.','Hypothalamic hamartomas (HHs) are rare non-neoplastic lesions which cause drug-resistant epilepsy with associated behavioural, psychiatric and endocrine issues. With the development of new minimally invasive techniques for the treatment of HH, there is a need to reappraise the effectiveness and safety of each approach. We review the outcomes of HH patients treated surgically, utilizing intraoperative magnetic resonance imaging (IOMRI), by a team of Alder Hey NHS Foundation Trust tumour and epilepsy neurosurgeons since 2011.Patient records of all HH cases operated on since 2011 were reviewed to confirm history of presentation and clinical outcomes.Ten patients have undergone surgery for HH under the dual care of Alder Hey tumour and epilepsy neurosurgeons during this period. Eight cases had a midline transcallosal, interforniceal approach with the remaining 2 having a transcallosal, transforaminal approach. All patients had an IOMRI scan, with 40% needing further tumour resection post-IOMRI. Forty percent had a total resection, 3 patients had near-total resection and 3 patients had subtotal resection (~ 30% tumour residual on post-operative MRI). No new neurological complications developed post-operatively. Hypothalamic axis derangements were seen in 3 cases, including 1 diabetes insipidus with hypocortisolaemia, 1 hypodipsia and 1 transient hyperphagia. Eighty percent are seizure free; the remaining two patients have had significant improvements in seizure frequency.IOMR was used to tailor the ideal tumour resection volume safely based on anatomy of the lesion, which combined with the open transcallosal, interforniceal route performed by surgeons experienced in the approach resulted in excellent, safe and effective seizure control.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'van Tonder, Libby, L|Burn, Sasha, S|Iyer, Anand, A|Blair, Jo, J|Didi, Mohammed, M|Carter, Michael, M|Martland, Timothy, T|Mallucci, Conor, C','2018-05-17 22:46:19','2018-05-17 22:46:19'),(192,20,29728875,'1559-0100','Natural history and clinical characteristics of 50 patients with Wolfram syndrome.','To describe clinical characteristics of diabetes mellitus (DM) in a group of patients with Wolfram Syndrome (WS).Descriptive, cross-sectional observational design. The sample consisted of 50 patients diagnosed with WS. Clinical criteria contributing to WS diagnosis were analyzed: diabetes mellitus (DM), optic nerve atrophy (OA), sensorineural deafness, urological and neurological dysfunction, among others. These parameters were assessed according to their presence/absence, age of onset, and various clinical-analytical parameters.All the patients studied presented DM and OA, with a mean age of onset of 5.4 ± .9 (1-14) years and 9 ± .9 (1-16) years, respectively. The remaining criteria were present with a variable frequency: 77% had diabetes insipidus, 66.7% auditory alterations, 77.8% neurogenic bladder, 61.1% neurological involvement, and 27.8% hypogonadism. A 16.7% of the patients had positive albuminuria (urinary albumin/creatinine ratio > 30 mg/g) and 72.2% had hyporreflexia. There were no significant differences in the age of diagnosis nor of the presence of different pathologies according to sex.The early presence of a non-autoimmune insulin dependent DM, should alert us of an \"infrequent\" diabetes syndrome. Wolfram\'s presumptive diagnosis could be established if juvenile-onset DM occurs concomitantly with OA, and this visual impairment is not attributable to diabetic retinopathy. Despite the long period of evolution of DM and altered values of HbA1c, the prevalence of microvascular complications in the sample are low.','2018-05-04 00:00:00','2018-05-04 00:00:00','2018-05-05 00:00:00',0,0,'Bueno, Gema Esteban, GE|Ruiz-Castañeda, Dyanne, D|Martínez, Javier Ruiz, JR|Muñoz, Manuel Romero, MR|Alascio, Pedro Carrillo, PC','2018-05-17 22:46:19','2018-05-17 22:46:19'),(193,20,29724799,'1535-5675','','A 21-year-old man presented with polyuria and polydipsia and was discovered to have diabetes insipidus due to eosinophilic granuloma of the hypothalamus. F FDG-PET/CT for metastatic work-up revealed an intensely FDG avid hypothalamic mass and no other sites of disease.','2018-05-03 00:00:00','2018-05-03 00:00:00','2018-05-04 00:00:00',0,0,'Eshghi, Anna, A|Klein, Robert, R|Eshghi, Naghmehossadat, N|Kuo, Phillip Hsin, PH','2018-05-17 22:46:19','2018-05-17 22:46:19'),(194,20,29722489,'0035-3639','[Study of diagnostic value of natremia in a cohort of patients with hypercalcemia].','Hypercalcemia is a common pathological condition in clinical practice. The two most common causes are primary hyperparathyroidism and cancer. SIADH is often encountered in cancer cases and is the most common cause of hyponatremia. The aim of this study is to evaluate serum sodium levels in a cohort of patients with hypercalcemia and consider its predictive value in determining the origin of this hypercalcemia.We performed a retrospective study on a series of 15.284 blood tests among adult patients with hypercalcemia. After selection, the study population had 151 patients. We studied mainly serum sodium and etiology of hypercalcemia in our population.We observed a statistically significant association between the presence of hyponatremia and the neoplastic etiology of hypercalcemia. This association persisted after exclusion of patients under treatment with loop diuretics. Conversely, there was no association between hypernatremia and cancer-related hypercalcemia. Among 151 patients with hypercalcemia, 16 presented hyponatremia and 7 with hypernatremia. SIADH was the main cause of hyponatremia. We performed univariate and multivariate logistic regression showing the association between the presence of cancer and the presence of hyponatremia.Our study shows that there is an association between the presence of hyponatremia and neoplastic origin of hypercalcemia. Besides, the association described between hyponatremia and cancer is not faulted by the presence of hypercalcemia, a potential cause of acquired nephrogenic diabetes insipidus.','2018-05-17 00:00:00','0000-00-00 00:00:00','2018-05-03 00:00:00',0,0,'Le, A, A|Couturier, B, B|Cogan, E, E|Vandergheynst, F, F','2018-05-17 22:46:19','2018-05-17 22:46:19'),(195,20,29716529,'1471-2377','Severe localised granulomatosis with polyangiitis (Wegener\'s granulomatosis) manifesting with extensive cranial nerve palsies and cranial diabetes insipidus: a case report and literature review.','Granulomatosis with polyangiitis (GPA, formerly Wegener\'s granulomatosis) is a multisystem vasculitis of small- to medium-sized blood vessels. Cranial involvement can result in cranial nerve palsies and, rarely, pituitary infiltration.We describe the case of a 32 year-old woman with limited but severe GPA manifesting as progressive cranial nerve palsies and pituitary dysfunction. Our patient initially presented with localised ENT involvement, but despite treatment with methotrexate, she deteriorated. Granulomatous inflammatory tissue around the skull base resulted in cavernous sinus syndrome, facial nerve palsy, palsies of cranial nerves IX-XII (Collet-Sicard syndrome), and the rare complication of cranial diabetes insipidus due to pituitary infiltration. The glossopharyngeal, vagus and accessory nerve palsies resulted in severe dysphagia and she required nasogastric tube feeding. Her neurological deficits substantially improved with treatment including high dose corticosteroid, cyclophosphamide and rituximab.This case emphasises that serious morbidity can arise from localised cranial Wegener\'s granulomatosis in the absence of systemic disease. In such cases intensive induction immunosuppression is required. Analysis of previously reported cases of pituitary involvement in GPA reveals that this rare complication predominantly affects female patients.','2018-05-01 00:00:00','2018-05-01 00:00:00','2018-05-11 00:00:00',0,0,'Peters, James E, JE|Gupta, Vivek, V|Saeed, Ibtisam T, IT|Offiah, Curtis, C|Jawad, Ali S M, ASM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(196,20,29696555,'2199-1162','Desmopressin-Induced Severe Hyponatremia with Central Pontine Myelinolysis: A Case Report.','Desmopressin, a synthetic vasopressin analog, is used to treat central diabetes insipidus, hemostatic disorders such as von Willebrand\'s disease, and nocturnal enuresis. We present the case of a 69-year-old man who developed severe hyponatremia during treatment with intranasal desmopressin at 10 µg twice daily for chronic polyuria and nocturia thought to be due to central diabetes insipidus. After 5 months of therapy, the patient noticed progressive fatigue, anorexia, dizziness, weakness, light-headedness, decreased concentration, and new-onset falls. At 6 months of therapy, the patient was brought to the emergency department for altered mental status and was found to be severely hyponatremic with a serum sodium level of 96 mmol/L, down from a value of 134 mmol/L at the initiation of therapy. The intranasal desmopressin was discontinued and the patient was admitted to the intensive care unit where the hyponatremia was slowly corrected over the next week to 132 mmol/L, never increasing by more than 8 mmol/L a day, with careful fluid management. This included infusion of over 11 L of 5% dextrose to account for a high urine output, which peaked at 7.4 L in 1 day. However, while the recommended rate for sodium correction was followed, the patient\'s magnetic resonance imaging of the brain obtained after discharge displayed evidence of central pontine myelinolysis. Despite this finding, the patient eventually returned to his baseline mental status with no permanent neurologic deficits.','2018-04-25 00:00:00','2018-04-25 00:00:00','2018-05-03 00:00:00',0,0,'Hossain, Tanzib, T|Ghazipura, Marya, M|Reddy, Vineet, V|Rivera, Pedro J, PJ|Mukherjee, Vikramjit, V','2018-05-17 22:46:19','2018-05-17 22:46:19'),(197,20,29686164,'0301-2603','[Treatment of Rathke\'s Cleft Cyst:Technical Note for Preservation of Pituitary Function].','Pituitary dysfunction, such as panhypopituitarism or diabetes insipidus(DI), is often found in patients with Rathke\'s cleft cyst. Patients were treated with transsphenoidal microscopic surgery; however, pituitary dysfunction did not usually recover. Recently, endoscopic transsphenoidal surgery(eTSS)has enabled minimally invasive surgery for patients with Rathke\'s cleft cyst. In this study, we analyzed 22 consecutive patients with Rathke\'s cleft cyst who underwent eTSS to determine if pituitary dysfunction recovered. The follow-up period ranged from 3 months to 19.25 years(mean, 4.75 years). Preoperative endocrinological evaluation showed impaired secretion of adrenocorticotropic hormone(ACTH)in 4 cases(18.2%), thyroid-stimulating hormone(TSH)in 2 cases(9.1%), hyperprolactinemia in 5 cases(22.7%), growth hormone(GH)in 9 cases(40.9%), and luteinizing hormone(LH)/follicle-stimulating hormone(FSH)in 11 cases(50%). In addition, preoperative DI was found in 2 cases(9.1%). We planned the site of fenestration for the cyst wall using preoperative sagittal magnetic resonance imaging. As a result, the recovery rate for ACTH, GH, and TSH secretion was 25%, 33.3%, and 50%, respectively. On the other hand, two patients with DI and other hormonal deficiencies did not recover pituitary function because of severe inflammation. Pituitary function might be preserved with minimally invasive surgery for Rathke\'s cleft cyst with mild inflammation.','2018-04-01 00:00:00','0000-00-00 00:00:00','2018-04-24 00:00:00',0,0,'Ito, Miiko, M|Matsuda, Kenichiro, K|Kuge, Atsushi, A|Sato, Shinya, S|Kayama, Takamasa, T|Sonoda, Yukihiko, Y','2018-05-17 22:46:19','2018-05-17 22:46:19'),(198,20,29681579,'1881-7122','A rat model for pituitary stalk electric lesion-induced central diabetes insipidus: application of 3D printing and further outcome assessments.','A stable and reproducible rat injury model is not currently available to study central diabetes insipidus (CDI) and the neurohypophyseal system. In addition, a system is needed to assess the severity of CDI and measure the accompanying neurobiological alterations. In the present study, a 3D-printed lesion knife with a curved head was designed to fit into the stereotaxic instrument. The neuro-anatomical features of the brain injury were determined by in vivo magnetic resonance imaging (MRI) and arginine vasopressin (AVP) immunostaining on brain sections. Rats that underwent pituitary stalk electrical lesion (PEL) exhibited a tri-phasic pattern of CDI. MRI revealed that the hyperintenseT1-weighted signal of the pituitary stalk was interrupted, and the brain sections showed an enlarged end proximal to the injury site after PEL. In addition, the number of AVP-positive cells in supraoptic nucleus (SON) and paraventricular nucleus (PVN) decreased after PEL, which confirmed the success of the CDI model. Unlike hand-made tools, the 3D-printed lesion knives were stable and reproducible. Next, we used an ordinal clustering method for staging and the k-means\' clustering method to construct a CDI index to evaluate the severity and recovery of CDI that could be used in other multiple animals, even in clinical research. In conclusion, we established a standard PEL model with a 3D-printed knife tool and proposed a CDI index that will greatly facilitate further research on CDI.','2018-04-20 00:00:00','2018-04-20 00:00:00','2018-04-23 00:00:00',0,0,'Feng, Zhanpeng, Z|Ou, Yichao, Y|Zhou, Mingfeng, M|Wu, Guangsen, G|Ma, Linzi, L|Bao, Yun, Y|Qiu, Binghui, B|Qi, Songtao, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(199,20,29675260,'2052-0573','One too many diabetes: the combination of hyperglycaemic hyperosmolar state and central diabetes insipidus.','The combination of hyperosmolar hyperglycaemic state and central diabetes insipidus is unusual and poses unique diagnostic and therapeutic challenges for clinicians. In a patient with diabetes mellitus presenting with polyuria and polydipsia, poor glycaemic control is usually the first aetiology that is considered, and achieving glycaemic control remains the first course of action. However, severe hypernatraemia, hyperglycaemia and discordance between urine-specific gravity and urine osmolality suggest concurrent symptomatic diabetes insipidus. We report a rare case of concurrent manifestation of hyperosmolar hyperglycaemic state and central diabetes insipidus in a patient with a history of craniopharyngioma.In patients with diabetes mellitus presenting with polyuria and polydipsia, poor glycaemic control is usually the first aetiology to be considered.However, a history of craniopharyngioma, severe hypernatraemia, hyperglycaemia and discordance between urine-specific gravity and osmolality provide evidence of concurrent diabetes insipidus.Therefore, if a patient with diabetes mellitus presents with severe hypernatraemia, hyperglycaemia, a low or low normal urinary-specific gravity and worsening polyuria despite correction of hyperglycaemia, concurrent diabetes insipidus should be sought.','2018-05-17 00:00:00','2018-04-11 00:00:00','2018-04-22 00:00:00',0,0,'Burmazovic, Snezana, S|Henzen, Christoph, C|Brander, Lukas, L|Cioccari, Luca, L','2018-05-17 22:46:19','2018-05-17 22:46:19'),(200,21,29741925,'1557-8593','Glycemic Control in Adult Type 1 Diabetes Patients with Insulin Glargine, Insulin Detemir, or Continuous Subcutaneous Insulin Infusion in Daily Practice.','This study aims to compare glycemic control of persons with type 1 diabetes using multiple daily injections (MDI) with insulin glargine versus insulin detemir or with continuous subcutaneous insulin infusion (CSII) in daily practice.All adult individuals with type 1 diabetes (n = 1053) were identified from the electronic patient database in North Karelia, Finland. The persons\' individual data for insulin treatment, diabetic ketoacidosis (DKA), and hemoglobin A (HbA1c) measurements during the year 2014 were obtained from medical records. Persons using long-acting insulin analogs or CSII were included in the analyses (n = 1004).Altogether, 47.7% used glargine, 43.9% used detemir, and 8.4% used CSII. The mean HbA1c was lower in the CSII group (63 mmol/mol [7.9%]) compared with the glargine group (66 mmol/mol [8.2%]) or the detemir group (67 mmol/mol [8.3%]). The overall rate of DKA was 5.1% per year. The rate of DKA was higher in the detemir group compared with the glargine group (6.3% per year vs. 3.8% per year, respectively, P < 0.049). In logistic regression analyses, the higher rate of DKA with detemir use was explained by HbA1c.In daily practice, the glycemic control of type 1 diabetes patients with MDI was similar regardless of basal insulin, glargine, or detemir, whereas CSII allowed better glycemic control than MDI. The rate of DKA was higher with detemir than with glargine, but this is likely related to higher HbA1c rather than insulin regimen.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-09 00:00:00',0,0,'Rautiainen, Päivi, P|Tirkkonen, Hilkka, H|Laatikainen, Tiina, T','2018-05-17 22:46:19','2018-05-17 22:46:19'),(201,21,29732161,'2052-0573','Rapid-onset diabetic ketoacidosis secondary to nivolumab therapy.','We report a case of a 67-year-old man with type 2 diabetes presented with diabetic ketoacidosis, two weeks after his first dose of nivolumab therapy for non-small-cell lung carcinoma. He was started on empagliflozin two days prior in the setting of hyperglycaemia after the initiation of nivolumab therapy. Laboratory evaluation revealed an undetectable C-peptide and a positive anti-glutamic acid decarboxylase (GAD) antibody. He was treated with intravenous fluids and insulin infusion and was subsequently transitioned to subcutaneous insulin and discharged home. He subsequently has developed likely autoimmune thyroiditis and autoimmune encephalitis.Glycemic surveillance in patients receiving immune checkpoint inhibitors is recommended.Early glycemic surveillance after commencement of anti-programmed cell death-1 (PD-1) inhibitors may be indicated in selected populations, including patients with underlying type 2 diabetes mellitus and positive anti-glutamic acid decarboxylase (GAD) antibody.Sodium-glucose co transporter-2 (SGLT2) inhibitors should be used with caution in patients on immunotherapy.','2018-05-17 00:00:00','2018-04-27 00:00:00','2018-05-11 00:00:00',0,0,'Lee, Senhong, S|Morgan, Aparna, A|Shah, Sonali, S|Ebeling, Peter R, PR','2018-05-17 22:46:19','2018-05-17 22:46:19'),(202,21,29731652,'1178-7007','Adjunctive therapy for glucose control in patients with type 1 diabetes.','Type 1 diabetes mellitus (T1DM) is characterized by relative or absolute insulin deficiency. Despite treatment with insulin therapy, glycemic goals are not always met, and insulin therapy is sometimes limited by adverse effects, including hypoglycemia and weight gain. Several adjunctive therapies have been evaluated in combination with insulin in patients with T1DM to improve glycemic control while minimizing adverse effects. Pramlintide, an amylin analog, can improve glycemic control, primarily through lowering postprandial blood glucose levels. Patients may experience weight loss and an increased risk of hypoglycemia and require additional mealtime injections. Metformin provides an inexpensive, oral treatment option and may reduce blood glucose, especially in overweight or obese patients with minimal risk of hypoglycemia. Metformin may be more effective in patients with impaired insulin sensitivity. Glucagon-like peptide-1 receptor agonists reduce primarily postprandial blood glucose and insulin dose and promote weight loss. They are expensive, cause transient nausea, may increase risk of hypoglycemia and require additional injections. Sodium-glucose transport-2 inhibitors improve glycemic control, promote weight loss and have low risk of hypoglycemia with appropriate insulin adjustment; however, these agents may increase the risk of diabetic ketoacidosis in patients with T1DM. Patient-specific characteristics should be considered when selecting adjunctive therapy for patients with T1DM. Close monitoring, insulin dose adjustments and patient education are all important to ensure safe and effective use of these agents.','2018-05-17 00:00:00','2018-04-27 00:00:00','2018-05-11 00:00:00',0,0,'Harris, Kira, K|Boland, Cassie, C|Meade, Lisa, L|Battise, Dawn, D','2018-05-17 22:46:19','2018-05-17 22:46:19'),(203,21,29731109,'2213-3941','Plasma glucose to glycated hemoglobin ratio: Method of differentiating fulminant type 1 diabetes from diabetic ketoacidosis.','In fulminant type 1 diabetes mellitus (fT1DM), plasma glucose (PG) levels are strongly increased, unlike glycated hemoglobin (HbA) levels, resulting in a sharply increased PG/HbA ratio. We investigated the PG/HbA ratio in fT1DM and tested the accuracy of cutoff points to easily and efficiently differentiate fT1DM from diabetic ketoacidosis (DKA).We report 41 cases of fT1DM in which PG/HbA ratio was studied as a novel clinical parameter to predict fT1DM. Clinical and biochemical characteristics were analyzed in 41 fT1DM and 51 DKA patients in China. Receiver-operating characteristic curve analysis was used to identify PG/HbA ratio cutoff points to differentiate fT1DM from DKA.PG/HbA ratio was significantly higher in fT1DM patients (7.24±2.49mmol/L/%; i.e., 0.88±0.36L/mol) than in DKA patients (2.60±0.69mmol/L/%; i.e., 0.06±0.01L/mol) (P<0.001). PG/HbA ratio exceeded 4.2mmol/L/% (i.e., 0.6 l/mol) in 39 of the 41 fT1DM patients (95.1%), versus only 1 of the 51 DKA patients (1.9%).PG/HbA ratio is a simple tool that may be useful to identify DKA patients at high risk of fT1DM. PG/HbA ratio with a threshold of≥4.2mmol/L/% (i.e., 0.6L/mol) can be adopted as a new clinical parameter in predicting fT1DM.','2018-05-03 00:00:00','2018-05-03 00:00:00','2018-05-07 00:00:00',0,0,'Liu, Lan, L|Jia, Wenjuan, W|Wu, Yixing, Y|Liu, Ruike, R|Zeng, Chunping, C||Shen, Jie, J','2018-05-17 22:46:19','2018-05-17 22:46:19'),(204,21,29721004,'1671-5411','Anterior myocardial pseudoinfarction in a patient with diabetic ketoacidosis.','No abstract found.','2018-03-01 00:00:00','0000-00-00 00:00:00','2018-05-07 00:00:00',0,0,'Ruiz-Morales, Jose, J|Canha, Catarina, C|Al-Saffar, Farah, F|Ibrahim, Saif, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(205,21,29716801,'1532-8171','Eruptive xanthoma in the setting of hypertriglyceridemia and pancreatitis.','Undifferentiated dermatologic complaints are often encountered in the emergency department. While a patient\'s exposures, risk factors, and comorbidities may help guide emergency department evaluation, the accurate diagnosis of dermatologic findings is critical to allowing rapid identification and treatment of disease.In this vignette we discuss a case of eruptive xanthoma in a 33-year-old male with diabetic ketoacidosis and pancreatitis.Dermatologic complaints pose a unique challenge to the emergency physician. Many dermatologic findings are benign; however, some may represent underlying serious disease even in young, otherwise healthy appearing patients. Eruptive xanthomas are cutaneous lesions often indicating severe hypertriglyceridemia and uncontrolled diabetes. Likely presentations and risk factors for eruptive xanthomas will be discussed as well as ED evaluation and management.','2018-04-25 00:00:00','2018-04-25 00:00:00','2018-05-02 00:00:00',0,0,'Stark, Matthew, M|Stuart, Jonathan, J','2018-05-17 22:46:19','2018-05-17 22:46:19'),(206,21,29713649,'2314-6753','Treatment Discontinuation and Clinical Events in Type 2 Diabetes Patients Treated with Dipeptidyl Peptidase-4 Inhibitors or NPH Insulin as Third-Line Therapy.','To compare dipeptidyl peptidase-4 (DPP-4) inhibitors with neutral protamine Hagedorn (NPH) insulin, in terms of effectiveness and safety for the management of patients with type 2 diabetes mellitus (DM2) not controlled on metformin and sulfonylureas.A retrospective cohort study of individuals with DM2 newly dispensed with either DPP-4 inhibitors or NPH as third-line therapy, after metformin and sulfonylurea. Treatment discontinuation, macrovascular outcomes, and hypoglycemia were compared using multivariable Cox regression models, adjusted for sex, age, year of cohort entry, place of residence, hypertension, past history of hypoglycemia, diabetic ketoacidosis, comorbidities, and number of visits to emergency departments, outpatient physician, and hospitalizations.Treatment discontinuation and hypoglycemia occurred more frequently with NPH than with DPP-4 inhibitor users. In the adjusted Cox model, the use of NPH compared to that of DPP-4 inhibitors was associated with a higher risk of discontinuation (HR: 1.33; 95% CI 1.27-1.40) and hypoglycemia (HR: 2.98; 95% CI 2.72-3.28). Risk of cardiovascular events was similar across groups.This real-world analysis suggests that DM2 patients initiating third-line therapy with NPH have poorer control of diabetes when compared to DPP-4 inhibitor initiators.','2018-05-17 00:00:00','2018-03-11 00:00:00','2018-05-03 00:00:00',0,0,'Moura, Cristiano S, CS|Rosenberg, Zale B, ZB|Abrahamowicz, Michal, M|Bernatsky, Sasha, S|Behlouli, Hassan, H|Pilote, Louise, L','2018-05-17 22:46:19','2018-05-17 22:46:19'),(207,21,29709945,'1349-7235','A Case of Fulminant Type 1 Diabetes Mellitus Complicated with a Life-threatening Electrolyte Abnormality and Abnormal Electrocardiogram Findings.','Fulminant type 1 diabetes mellitus (T1DM) is idiopathic T1DM with the rapid destruction of pancreatic β-cells. We herein report a 48-year-old man who developed fulminant T1DM complicated with a life-threatening electrolyte abnormality and abnormal electrocardiogram findings. He had no remarkable medical history, but one day, he developed general fatigue. His blood glucose level and HbA1c were 806 mg/dL and 6.3%, and his insulin secretion was markedly suppressed. He had ketoacidosis, hyponatremia and hyperkalemia. Furthermore, a life-threatening abnormality was noted on electrocardiogram. After fluid infusion and insulin therapy, the abnormality disappeared. In conclusion, we should bear in mind the possibility of fulminant T1DM in patients complaining of general malaise.','2018-04-27 00:00:00','2018-04-27 00:00:00','2018-04-30 00:00:00',0,0,'Kinoshita, Tomoe, T|Kaneto, Hideaki, H|Kawasaki, Fumiko, F|Anno, Takatoshi, T|Kurihara, Takeyuki, T|Yamada, Haruki, H|Oshiro, Yoshiyuki, Y|Miyashita, Naoyuki, N|Okimoto, Niro, N|Kaku, Kohei, K','2018-05-17 22:46:19','2018-05-17 22:46:19'),(208,21,29707419,'2158-8333','OLANZAPINE AND DIABETIC KETOACIDOSIS: WHAT IS THE UNDERLYING MECHANISM?','No abstract found.','2018-04-01 00:00:00','0000-00-00 00:00:00','2018-05-03 00:00:00',0,0,'Nagamine, Takahiko, T','2018-05-17 22:46:19','2018-05-17 22:46:19'),(209,21,29706815,'0899-8280','Acute pancreatitis secondary to hypertriglyceridemia precipitated by diabetic ketoacidosis in a previously undiagnosed ketosis-prone patient with diabetes mellitus.','Diabetic ketoacidosis is a potentially fatal complication of diabetes mellitus that may result in hypertriglyceridemia. Rarely, the resulting hypertriglyceridemia may precipitate acute pancreatitis. We report a case of acute pancreatitis secondary to hypertriglyceridemia precipitated by diabetic ketoacidosis and postulate that this unusual presentation is due to the patient being prone to ketosis.','2018-04-01 00:00:00','2018-03-20 00:00:00','2018-05-02 00:00:00',0,0,'Ramachandran, Vignesh, V|Vila, Diana M, DM|Cochran, John M, JM|Caruso, Andrew C, AC|Balchandani, Rajeev, R','2018-05-17 22:46:19','2018-05-17 22:46:19'),(210,22,29752946,'1096-0007','Effect of free amino acids on bovine retinal pericytes.','This study was conducted to estimate the aminoacid levels in the vitreous of patients with proliferative diabetic retinopathy, and to correlate it with the adiponectin levels. Secondly to test if these amino acids can alter or induce adiponectin levels and its related factors in retinal cells like pericyte as an in vitro model.All human studies were done as per declaration of Helsinki with institutional approval and after obtaining consent from participating individuals. The vitreous amino acids were estimated in PDR (Proliferative diabetic retinopathy) and MH (Macular Hole) as disease control using HPLC. Bovine retinal pericytes (BRP) were cultured in DMEM/F12 medium and treated with 0.5 mM of any one of the individual amino acids (proline, hydroxyproline, phenylalanine, alanine, serine, glycine, lysine, isoleucine or valine) along with 100 nM insulin for 14 days in high glucose (25 mM) condition. The mRNA expression profile of adipogenic markers (such as Pref1, APN, ZAG and PPARγ), angiogenic markers (VEGF, MMP-2 and MMP-9, TGF-β) and antioxidant markers (Nrf2 and UCP-2) were evaluated by qPCR. Adipogenesis was further confirmed by adipogenesis assay, secretion of adiponectin in medium and triglyceride accumulation by Oil red O staining in Bovine retinal pericytes.Amino acids valine (p < 0.004), isoleucine (p < 0.0007), leucine (p < 0.022), serine (p < 0.0007), glycine (p < 0.001), alanine (p < 0.017), phenylalanine (p < 0.013), and lysine (p < 0.001) were significantly elevated in the vitreous of PDR group (n = 30) when compared to macular hole (n = 20). There was a significant positive correlation between serine (p < 0.021), alanine (p < 0.00016), phenylalanine (p < 0.04), isoleucine (p < 0.023), leucine (p < 0.043), and lysine (p < 0.026) with adiponectin level in the vitreous. The amino acids hydroxyproline, proline, lysine, glycine and alanine induced the triglyceride accumulation and expression of Adiponectin. VEGF and MMP-9 expression was decreased with all the amino acids treated and PEDF was significantly increased with phenylalanine treatment. TGFβ mRNA expression showed a significant decrease with proline, alanine, glycine, lysine and isoleucine. The Nrf2 expression was significantly increased in alanine and serine when compared to control. The UCP-2 gene showed a significant increase in proline and lysine treatment.Our results suggest that amino acids hydroxyproline, proline, lysine, glycine and alanine which are elevated in the PDR vitreous show a tendency to induce adipogenic effects in retinal pericytes by triggering the accumulation of triglycerides and adiponectin. Hence we hypothesize that these aminoacids when elevated along with insulin and glucose can induce metabolic changes in pericytes. The functional implications of these changes tend to be protective as it increases the antioxidant potential and decreases the angiogenesis markers which are potentially pathogenic.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-12 00:00:00',0,0,'Vidhya, S, S|Ramya, R, R|Coral, K, K|Sulochana, K N, KN|Bharathidevi, S R, SR','2018-05-17 22:46:19','2018-05-17 22:46:19'),(211,22,29752167,'1878-1780','Dipeptidyl peptidase-4 inhibitor use and risk of diabetic retinopathy: A population-based study.','This study examined whether dipeptidyl peptidase (DPP)-4 inhibitor use is beneficial or harmful to diabetic retinopathy (DR) compared with other glucose-lowering agents in patients with type 2 diabetes (T2D).From a population-based cohort provided by the National Health Insurance Service in Korea, 67,743 adults with T2D were identified as having been treated with oral glucose-lowering agents between 2008 and 2013. Matching (1:1) was performed for two groups comparing ever-use (cases) and never-use (controls) of DPP-4 inhibitors (n=14,522 in each group). Cox regression analyses were used to assess risk of the following DR events: vitreous haemorrhage; vitrectomy or photocoagulation; intravitreal agent use; and blindness.During a median follow-up of 28.4 (14.0-45.2) months, there were 305 (in controls) and 342 (in cases) composite DR events. DPP-4 inhibitor ever-use was not associated with overall risk of composite DR events [adjusted hazard ratio (HR): 1.08, 95% CI: 0.93-1.26] compared with never-use, nor was the risk of each DR outcome increased with DPP-4 inhibitor therapy either. However, DPP-4 inhibitor administration for<12 months was associated with a greater risk of composite DR events (adjusted HR: 1.31, 95% CI: 1.09-1.57) compared with other glucose-lowering agents over the same treatment period.In comparison to other oral glucose-lowering agents, DPP-4 inhibitor treatment did not increase overall risk of DR. However, DPP-4 inhibitors may be associated with an increased risk of retinopathy events early in the treatment phase.','2018-03-27 00:00:00','2018-03-27 00:00:00','2018-05-12 00:00:00',0,0,'Kim, N H, NH|Choi, J, J|Kim, N H, NH|Choi, K M, KM|Baik, S H, SH|Lee, J, J|Kim, S G, SG','2018-05-17 22:46:19','2018-05-17 22:46:19'),(212,22,29752166,'1878-0334','Circulating matrix modulators (MMP-9 and TIMP-1) and their association with severity of diabetic retinopathy.','Diabetic Retinopathy (DR) is the leading cause of vision loss in the working age population. Matrix metalloproteinase-9 (MMP-9) and tissue inhibitor of metalloproteinase-1 (TIMP-1), are molecules involved in extracellular tissue matrix remodelling. They are implicated in the loss of retinal tissue integrity, a major cause of DR, that leads to retinal tissue degradation and apoptosis. This study is therefore, conducted to compare the serum levels of MMP-9 and TIMP-1 in T2DM patients without and with retinopathy, and to evaluate their association with the severity of DR.Our study comprised of 2 groups of 41 each. Group A (cases) included T2DM patients with retinopathy and Group B (controls) included T2DM patients without retinopathy. Routine parameters, mainly, fasting blood glucose, and lipid profile were measured using autoanalyzer. Serum MMP-9, TIMP-1, and insulin levels were assessed using ELISA method.Statistically significant increase in the levels of MMP-9, insulin, fasting blood glucose and lipid profile were observed in the serum of T2DM patients with retinopathy, as compared with those without retinopathy. These results help to conclude that rise in MMP-9, and associated serum markers promote disease progress in DR. These findings suggest that the elevations of our study markers in the serum of the type 2 diabetic patients with retinopathy, as compared to those without retinopathy, play important roles in aggravating tissue matrix degradation, supporting DR disease progression.','2018-05-05 00:00:00','2018-05-05 00:00:00','2018-05-12 00:00:00',0,0,'Jayashree, Kuppuswami, K|Yasir, Md, M|Senthilkumar, Gandhipuram Periyasamy, GP|Ramesh Babu, K, K|Mehalingam, Vadivelan, V|Mohanraj, Palani Selvam, PS','2018-05-17 22:46:19','2018-05-17 22:46:19'),(213,22,29752001,'1549-4713','Efficacy of Ranibizumab in Eyes with Diabetic Macular Edema and Macular Nonperfusion in RIDE and RISE.','To determine whether there are baseline characteristics that distinguish patients with diabetic macular edema (DME) with coexisting macular nonperfusion (MNP) at baseline and assess these patients\' potential to achieve favorable visual acuity (VA), anatomic, and diabetic retinopathy (DR) outcomes over 24 months.Post hoc analysis of RIDE/RISE, 2 phase 3, parallel, randomized, multicenter, double-masked trials (ClinicalTrials.gov: NCT00473382; NCT00473330).Study eyes with best-corrected VA (BCVA)/fluorescein angiogram (FA) data at baseline.To measure MNP, the Early Treatment for Diabetic Retinopathy Study (ETDRS) grid was overlaid on FAs of the macula. The MNP area was calculated by estimating the percentage of capillary loss in the central, inner, and outer subfields and converting into disc areas (DAs) using a software algorithm. Summary statistics and P values, respectively, were provided for all outcomes and comparisons of interest.Baseline characteristics; MNP area, BCVA, and central subfield thickness (CST) at months 12 and 24; and incidence of study eyes with ≥2-step DR improvement at months 3, 6, 12, 18, and 24.Baseline MNP was detected in 28.2%, 25.8%, and 26.3% of study eyes in the ranibizumab 0.3 mg (n = 213), ranibizumab 0.5 mg (n = 225), and sham (n = 228) arms, respectively. At baseline, patients with MNP were younger and had shorter diabetes duration, worse vision, increased CST, and worse DR severity (P values < 0.01 vs. those without MNP). In the ranibizumab 0.3 mg arm, eyes with baseline MNP had lower mean baseline BCVA (53.4 vs. 57.2 ETDRS letters for those without baseline MNP; P = 0.05), but mean BCVA gain at month 24 was comparable (+15.6 vs. +13.4 ETDRS letters, respectively; P = 0.2). Eyes with baseline MNP had increased CST at baseline, but experienced a greater decrease in CST by month 24. The proportion of eyes with ≥2-step DR improvement was greater for eyes with versus without baseline MNP in each ranibizumab arm.Despite having worse vision/increased CST versus those without baseline MNP, eyes with concurrent DME and baseline MNP entering RIDE/RISE experienced robust VA and anatomic improvement with ranibizumab and therefore should not be excluded from therapy.','2018-05-08 00:00:00','2018-05-08 00:00:00','2018-05-12 00:00:00',0,0,'Reddy, Rahul K, RK|Pieramici, Dante J, DJ|Gune, Shamika, S|Ghanekar, Avanti, A|Lu, Na, N|Quezada-Ruiz, Carlos, C|Baumal, Caroline R, CR','2018-05-17 22:46:19','2018-05-17 22:46:19'),(214,22,29750972,'1096-0007','Inhibition of Cx43 gap junction uncoupling prevents high glucose-induced apoptosis and reduces excess cell monolayer permeability in retinal vascular endothelial cells.','The aim of this study was to investigate whether inhibition of connexin 43 gap junction-uncoupling is sufficient to prevent retinal vascular cell loss under high glucose condition and reduce cell monolayer permeability. Rat retinal endothelial cells were grown for 3, 5, and 7 days in normal (5 mM) or high glucose (30 mM) medium; in parallel, cells grown in high glucose medium were exposed for 3, 5, and 7 days to 100 nM danegaptide, which stabilizes connexin 43-mediated cell coupling. Additionally, cells grown in normal medium were treated with a connexin 43 blocker as a negative control. To determine gap junction intercellular communication, scrape load dye transfer assay was performed at the three time points. Cells were assessed for apoptosis and cell monolayer permeability by differential dye staining and in vitro permeability assays, respectively. Cells treated with danegaptide preserved gap junction intercellular communication, decreased cell death, and reduced cell monolayer permeability. Scrape load dye transfer assay indicated that cells exposed to danegaptide for 3, 5, and 7 days under high glucose condition maintained gap junction intercellular communication. Importantly, danegaptide significantly prevented high glucose-induced apoptosis at all three time points, and inhibited cell monolayer permeability by day 5. Cells exposed to a connexin 43 blocker, which decreased cell coupling, showed excess apoptosis and cell monolayer permeability. These findings suggest that prevention of high glucose-induced compromised cell-cell coupling may be a useful strategy for inhibiting apoptosis and excess vascular permeability associated with diabetic retinopathy.','2018-05-08 00:00:00','2018-05-08 00:00:00','2018-05-11 00:00:00',0,0,'Kim, Dongjoon, D|Mouritzen, Ulrik, U|Larsen, Bjarne Due, BD|Roy, Sayon, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(215,22,29749515,'1791-3004','Significant role of microRNA‑219‑5p in diabetic retinopathy and its mechanism of action.','Diabetic retinopathy (DR) is the leading cause of blindness and visual impairment. The role of microRNA (miRNA) in DR remains largely unknown. The present study aimed to investigate the role of miR‑219‑5p in the progression of DR. Human retinal pigment epithelial (RPE) cells were treated with a high concentration of glucose (50 mM D‑glucose) for 24 h and the miR‑219‑5p level was detected using reverse transcription‑quantitative polymerase chain reaction. The results revealed that miR‑219‑5p was significantly upregulated by high glucose (HG) treatment. To explore the role and mechanism of miR‑219‑5p in DR progression, miR‑219‑5p was downregulated in ARPE‑19 cells. An MTT assay and flow cytometry were used to determine the level of viability and apoptosis of ARPE‑19 cells, respectively. MicroRNA.org was used to predict the targets of miR‑219‑5p and the prediction was investigated using a dual‑luciferase reporter assay. In addition, the level of associated proteins were measured using western blot analysis. It was observed that liver receptor homolog‑1 (LRH‑1) was a direct target of miR‑219‑5p. LRH‑1 was significantly downregulated in ARPE‑19 cells following HG treatment and negatively regulated by miR‑219‑5p in ARPE‑19 cells. MiR‑219‑5p inhibitor significantly prevented ARPE‑19 cell apoptosis induced by HG treatment and cell viability was markedly promoted. The results also suggested that the LRH‑1/Wnt/β‑Catenin signaling pathway was activated by miR‑219‑5p inhibition. In addition, it was revealed that LRH‑1 inhibition eliminated the effects of miR‑219‑5p inhibitor on ARPE‑19 cells. In conclusion, the results indicated that miR‑219‑5p was involved in the progression of DR through regulating human RPE cell apoptosis by modulation of the LRH‑1/Wnt/β‑Catenin signaling pathway.','2018-05-08 00:00:00','2018-05-08 00:00:00','2018-05-11 00:00:00',0,0,'Zhao, Junying, J|Gao, Sha, S|Zhu, Yanji, Y|Shen, Xi, X','2018-05-17 22:46:19','2018-05-17 22:46:19'),(216,22,29749141,'1560-2281','Particle swarm optimization method for small retinal vessels detection on multiresolution fundus images.','Retinal vessel segmentation plays an important role in the diagnosis of eye diseases and is considered as one of the most challenging tasks in computer-aided diagnosis (CAD) systems. The main goal of this study was to propose a method for blood-vessel segmentation that could deal with the problem of detecting vessels of varying diameters in high- and low-resolution fundus images. We proposed to use the particle swarm optimization (PSO) algorithm to improve the multiscale line detection (MSLD) method. The PSO algorithm was applied to find the best arrangement of scales in the MSLD method and to handle the problem of multiscale response recombination. The performance of the proposed method was evaluated on two low-resolution (DRIVE and STARE) and one high-resolution fundus (HRF) image datasets. The data include healthy (H) and diabetic retinopathy (DR) cases. The proposed approach improved the sensitivity rate against the MSLD by 4.7% for the DRIVE dataset and by 1.8% for the STARE dataset. For the high-resolution dataset, the proposed approach achieved 87.09% sensitivity rate, whereas the MSLD method achieves 82.58% sensitivity rate at the same specificity level. When only the smallest vessels were considered, the proposed approach improved the sensitivity rate by 11.02% and by 4.42% for the healthy and the diabetic cases, respectively. Integrating the proposed method in a comprehensive CAD system for DR screening would allow the reduction of false positives due to missed small vessels, misclassified as red lesions.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-05-11 00:00:00',0,0,'Khomri, Bilal, B|Christodoulidis, Argyrios, A|Djerou, Leila, L|Babahenini, Mohamed Chaouki, MC|Cheriet, Farida, F','2018-05-17 22:46:19','2018-05-17 22:46:19'),(217,22,29748945,'1020-3397','Causes of low vision and blindness in a Turkish adult population: the Izmir eye study.','Data from Turkey show that sense organ diseases were the second leading cause of years lost due to disability in 2015. However, there are no reliable data on either the baseline causative disorders of visual impairment or the burden of these disorders on the population in Izmir region. Izmir is the third most populated city of Turkey with a population of approximately 4.2 million.The purpose of this study was to define the baseline disorders causing low vision and blindness in accordance with World Health Organization criteria in an adult population in Izmir.We evaluated the ophthalmologic reports of 20 790 people in Izmir, Turkey. Age- and sex-specific causes of low vision and blindness were identified.Bilateral low vision and blindness was detected in 347 people, 172 males and 175 females. For those aged 18-50 years, retinal dystrophies (37%), congenital eye anomalies (14%) and myopic degenerations (13%) were the most common causes. For those aged 50+ years, age-related macular degeneration (21%) was the leading cause. Diabetic retinopathy (17%), corneal opacities (14%), cataract (12%) and glaucoma (9%) were also important. Sex was not a significant determinant.The specific causes of visual impairment vary greatly with age, however, unavoidable retinal pathologies were the predominant causes at all ages.','2018-05-03 00:00:00','2018-05-03 00:00:00','2018-05-11 00:00:00',0,0,'Koç, Feray, F|Erden, Veysi, V|Sefi-Yurdakul, Nazife, N','2018-05-17 22:46:19','2018-05-17 22:46:19'),(218,22,29747621,'1471-2415','Prevalence and clinical characteristics of dry eye disease in community-based type 2 diabetic patients: the Beixinjing eye study.','This study was performed to evaluate the prevalence and clinical characteristics of dry eye disease (DED) in community-based type 2 diabetic patients and to identify the associated factors related with DED.A total of 1360 type 2 diabetic patients in the Beixinjing community were randomly selected. All participants were given a questionnaire that assessed basic information and subjective symptoms.DED was diagnosed using the revised Japanese DED diagnostic criteria. All subjects underwent a routine ophthalmic examination, corneal sensitivity test, tear film break-up time(BUT) test, Schirmer I test, fluorescein and lissamine green staining(FL) and fundus photography. Diabetic retinopathy (DR) was graded according to the International severity scale of diabetic retinopathy and diabetic macular edema.Of the 1360 subjects, 238 (17.5%) were diagnosed with DED. There was a significant association between the presence of DED and higher blood glucose (P < 0.001, OR1.240) as well as higher levels of glycosylated hemoglobin HbA1c (P < 0.001, OR1.108). Corneal sensitivity was negatively correlated with the prevalence of DED (P = 0.02, OR0.973).The prevalence of DED in this community-based study was 17.5%, which was lower than that observed in hospital-based studies. Diabetic patients with poor metabolic control were more likely to present with DED. A dry eye examination should be added to the routine screening of diabetes.','2018-05-10 00:00:00','2018-05-10 00:00:00','2018-05-11 00:00:00',0,0,'Zou, Xinrong, X|Lu, Lina, L|Xu, Yi, Y|Zhu, Jianfeng, J|He, Jiangnan, J|Zhang, Bo, B|Zou, Haidong, H','2018-05-17 22:46:19','2018-05-17 22:46:19'),(219,22,29746877,'1873-5169','Liraglutide attenuates the migration of retinal pericytes induced by advanced glycation end products.','Retinal pericyte migration represents a novel mechanism of pericyte loss in diabetic retinopathy (DR), which plays a crucial role in the early impairment of the blood-retinal barrier (BRB). Glucagon-like peptide-1 (GLP-1) has been shown to protect the diabetic retina in the early stage of DR; however, the relationship between GLP-1 and retinal pericytes has not been discussed. In this study, advanced glycation end products (AGEs) significantly increased the migration of primary bovine retinal pericytes without influencing cell viability. AGEs also significantly enhanced phosphatidylinositol 3-kinase (PI3K)/Akt activation, and changed the expressions of migration-related proteins, including phosphorylated focal adhesion kinase (p-FAK), matrix metalloproteinase (MMP)-2 and vinculin. PI3K inhibition significantly attenuated the AGEs-induced migration of retinal pericytes and reversed the overexpression of MMP-2. Glucagon-like peptide-1 receptor (Glp1r) was expressed in retinal pericytes, and liraglutide, a GLP-1 analog, significantly attenuated the migration of pericytes by Glp1r and reversed the changes in p-Akt/Akt, p-FAK/FAK, vinculin and MMP-2 levels induced by AGEs, indicating that the protective effect of liraglutide was associated with the PI3K/Akt pathway. These results provided new insights into the mechanism underlying retinal pericyte migration. The early use of liraglutide exerts a potential bebefical effect on regulating pericyte migration, which might contribute to mechanisms that maintain the integrity of vascular barrier and delay the development of DR.','2018-05-07 00:00:00','2018-05-07 00:00:00','2018-05-10 00:00:00',0,0,'Lin, Wen-Jian, WJ|Ma, Xue-Fei, XF|Hao, Ming, M|Zhou, Huan-Ran, HR|Yu, Xin-Yang, XY|Shao, Ning, N|Gao, Xin-Yuan, XY|Kuang, Hong-Yu, HY','2018-05-17 22:46:19','2018-05-17 22:46:19'),(220,23,29752274,'1098-5336','Molecular epidemiology of Shiga toxin-producing  (STEC) on New Zealand dairy farms: application of a culture-independent assay and whole genome sequencing.','No abstract found.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Browne, A Springer, AS|Midwinter, Anne C, AC|Withers, Helen, H|Cookson, Adrian L, AL|Biggs, Patrick J, PJ|Marshall, Jonathan C, JC|Benschop, Jackie, J|Hathaway, Steve, S|Haack, Neville A, NA|Akhter, Rukhshana N, RN|French, Nigel P, NP','2018-05-17 22:46:19','2018-05-17 22:46:19'),(221,23,29752199,'2352-3026','Gemcitabine-oxaliplatin plus rituximab (R-GemOx) as first-line treatment in elderly patients with diffuse large B-cell lymphoma: a single-arm, open-label, phase 2 trial.','The combination of rituximab, gemcitabine, and oxaliplatin (R-GemOx) has shown high efficacy with a low toxicity profile in elderly patients with relapsed and refractory diffuse large B-cell lymphoma. We aimed to evaluate the efficacy, safety, and feasibility of the R-GemOx regimen as a first-line treatment in elderly patients with diffuse large B-cell lymphoma.In this single-arm, open-label, phase 2 clinical trial, we enrolled patients with previously untreated, histologically confirmed, CD20-positive diffuse large B-cell lymphoma, aged 70 years or older, or aged 60-69 years with an Eastern Cooperative Oncology Group (ECOG) performance status score of 2 or greater. Patients were recruited from Jiangsu Province Hospital (Jiangsu Sheng, China). The R-GemOx regimen was administered intravenously: rituximab 375 mg/m on day 0; gemcitabine 1 g/m on day 1; and oxaliplatin 100 mg/m on day 1. The cycle was repeated every 14 days. Six cycles were planned if the patient achieved at least partial remission after the interim assessment. The primary endpoint was the proportion of patients who achieved an overall response at the end of treatment (defined as complete response plus partial response). Analyses were done by intention to treat. The trial is ongoing but no longer recruiting patients. This study is registered with ClinicalTrials.gov, number NCT01670370.Between Aug 22, 2012, and Dec 31, 2015, 60 patients were enrolled and included in the study. The median age of the patients was 75 years (IQR 70-80) and 27 (45%) patients had a poor performance status with an ECOG score of 2 or greater. 45 (75%) patients achieved an overall response at the end of the treatment, with 28 (47%) achieving a complete response. Common grade 3-4 adverse events were haematological toxicities (thrombocytopenia in five [8%] patients, anaemia in four [7%], and neutropenia in nine [15%]) and gastrointestinal complications (nausea in five [8%] patients, vomiting in three [5%], and diarrhoea in one [2%]). No treatment-related deaths were reported.The R-GemOx regimen shows high efficacy and safety as a front-line treatment in an elderly patient subpopulation and might be a therapeutic option for management of diffuse large B-cell lymphoma in elderly patients.National Natural Science Foundation of China, Jiangsu Province\'s Medical Elite Programme, Project of National Key Clinical Specialty, National Science & Technology Pillar Program, Jiangsu Provincial Special Program of Medical, and National Science and Technology Major Project.','2018-05-08 00:00:00','2018-05-08 00:00:00','2018-05-12 00:00:00',0,0,'Shen, Qiu-Dan, QD|Zhu, Hua-Yuan, HY|Wang, Li, L|Fan, Lei, L|Liang, Jin-Hua, JH|Cao, Lei, L|Wu, Wei, W|Xia, Yi, Y|Li, Jian-Yong, JY|Xu, Wei, W','2018-05-17 22:46:19','2018-05-17 22:46:19'),(222,23,29752026,'1873-2518','Safety of a heat-stable rotavirus vaccine among children in Niger: Data from a phase 3, randomized, double-blind, placebo-controlled trial.','Rotavirus remains a major cause of diarrhea among children under 5 years of age. The efficacy of RotaSIIL, a pentavalent rotavirus vaccine, was shown in an event-driven trial in Niger. We describe the two-year safety follow-up of this trial.Follow-up of safety outcomes began upon administration of the first dose of RotaSIIL or placebo. Adverse events were followed until 28 days after the third dose, and serious adverse events were followed until 2 years of age. Suspected cases of intussusception were evaluated at first point of contact and then referred to hospital for surgical evaluation. Causes of death were obtained by chart review and verbal autopsy. Passive surveillance was carried out in health centers. Community health workers carried out active surveillance in villages. Between-group differences were evaluated using the chi-squared test and Fisher\'s exact test.A total of 4092 children were randomized, and 4086 received at least one dose of RotaSIIL or placebo, constituting the intention-to-treat population, who accrued a total of 7385 child-years of follow-up time. At two years of follow-up, 58 (2.8%) participants who received RotaSIIL and 49 (2.4%) participants who received placebo had died (p = 0.38). Most deaths were due to infectious causes common to the study area. One participant had confirmed intussusception, 542 days after receiving the third dose of RotaSIIL. A total of 395 (19.3%) participants receiving RotaSIIL and 419 (20.5%) participants receiving placebo experienced any serious adverse event (p = 0.36). Most serious adverse events were hospitalizations due to infection (malaria, lower respiratory tract infection and gastroenteritis) or marasmus. Overall, 1474 (72.1%) participants receiving RotaSIIL and 1456 (71.1%) participants receiving placebo had at least one adverse event (p = 0.49) in the follow-up period.At two years of follow-up, RotaSIIL was found to be safe.ClinicalTrials.gov: NCT02145000.','2018-05-08 00:00:00','2018-05-08 00:00:00','2018-05-12 00:00:00',0,0,'Coldiron, Matthew E, ME|Guindo, Ousmane, O|Makarimi, Rockyath, R|Soumana, Issaka, I|Matar Seck, Amadou, A|Garba, Souna, S|Macher, Emilie, E|Isanaka, Sheila, S|Grais, Rebecca F, RF','2018-05-17 22:46:19','2018-05-17 22:46:19'),(223,23,29751722,'1001-5302','[Comparison between Ye Tianshi and Xue Shengbai in treatment of diarrfea with damp-heat].','Ye Tianshi and Xue Shengbai are two febrile disease specialists in same time, and for the treatment of dampness and heat, they have different medication ideas. With the help of traditional Chinese medicine(TCM), author has studied two specialists\' consilias of dampness and heat, through the statistics and analysis of their medicine during the treatment of dampness and heat, summarizes the similarities and differences of Ye and Xue\'s medicine application\'s assoations and models. Ye Tianshi and Xue Shengbai were both thought that the reason of dampness and heat was damp heat pathogenic factors, for this reason, the spleen and stomach conduction disordered, They both treated from the middle-jiao of Yangming and Taiyin, focused on warm-natured medicine, cold-natured medicine, used less cool-natured and heat-natured medicine, and more bitter, pungent, sweet medicine; Ye Tianshi usually use Scutellariae Radix, Paeoniae Radix Alba, Coptidis Rhizoma, Polyporus, Poria, Alismatis Rhizoma; Xue Shengbai commonly use Poria, Citri Reticulatae Pericarpium, Magnoliae officinalis Cortex, Patchouli, Glycyrrhizae Radix et Rhizoma, Angelicae Sinensis Radix, Paeoniae Radix Alba, Lablab Semen Album, Puerariae Lobatae Radix, Mume Fructus, Tsaoko Fructus, Amomi Fructus, Coptidis Rhizoma and Phellodendri Chinensis Cortex. The differences between the two masters in medicine application provide a reference for the clinical treatment of dampness and heat.','2018-04-01 00:00:00','0000-00-00 00:00:00','2018-05-12 00:00:00',0,0,'Liu, Xiao-Yu, XY|Li, Yu-Juan, YJ|Jiang, Hou-Wang, HW|Li, Hong-Pei, HP|Xiao, Lian-Yu, LY|Zhao, Yan-Song, YS','2018-05-17 22:46:19','2018-05-17 22:46:19'),(224,23,29751672,'1660-4601','A Simulation-Based Study on the Comparison of Statistical and Time Series Forecasting Methods for Early Detection of Infectious Disease Outbreaks.','Early detection of infectious disease outbreaks is one of the important and significant issues in syndromic surveillance systems. It helps to provide a rapid epidemiological response and reduce morbidity and mortality. In order to upgrade the current system at the Korea Centers for Disease Control and Prevention (KCDC), a comparative study of state-of-the-art techniques is required. We compared four different temporal outbreak detection algorithms: the CUmulative SUM (CUSUM), the Early Aberration Reporting System (EARS), the autoregressive integrated moving average (ARIMA), and the Holt-Winters algorithm. The comparison was performed based on not only 42 different time series generated taking into account trends, seasonality, and randomly occurring outbreaks, but also real-world daily and weekly data related to diarrhea infection. The algorithms were evaluated using different metrics. These were namely, sensitivity, specificity, positive predictive value (PPV), negative predictive value (NPV), F1 score, symmetric mean absolute percent error (sMAPE), root-mean-square error (RMSE), and mean absolute deviation (MAD). Although the comparison results showed better performance for the EARS C3 method with respect to the other algorithms, despite the characteristics of the underlying time series data, Holt⁻Winters showed better performance when the baseline frequency and the dispersion parameter values were both less than 1.5 and 2, respectively.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Yang, Eunjoo, E|Park, Hyun Woo, HW|Choi, Yeon Hwa, YH|Kim, Jusim, J|Munkhdalai, Lkhagvadorj, L|Musa, Ibrahim, I|Ryu, Keun Ho, KH','2018-05-17 22:46:19','2018-05-17 22:46:19'),(225,23,29751649,'2306-7381','Serosurvey for Infectious Agents Associated with Subfertility and Abortion in Dairy Cattle in Trinidad and Tobago, West Indies.','Despite frequent reports of subfertility and abortion in dairy cattle in Trinidad and Tobago (T&amp;T), little is known about the potential infectious and non-infectious causes. This study set out to investigate possible infectious causes of reproductive problems by measuring the seroprevalence of four of the most significant reproductive pathogens in dairy cattle worldwide: ;  (), Bovine Viral Diarrhoea virus (BVDV), and Infectious Bovine Rhinotracheitis virus (IBRV). These four reproductive pathogens have been suspected to be present in dairy cattle in T&amp;T for some time but, previously, studies have not been carried out to confirm their presence. Bulk milk samples were collected from 92 dairy farms across Trinidad, representing a total of 1177 dairy cattle. Four dairy farms were selected for individual milk sampling to assess in-farm seroprevalence levels. Milk samples were tested for antibodies to the four pathogens by commercial ELISA kits. The overall farm seroprevalence was 62% for  and 23% for IBRV, and no antibodies were detected in any of the bulk milk samples for  or BVDV. Mixed infections for IBRV and  were common. Seroprevalence levels were between 8% and 65% for  and between 3% and 53% IBRV on the four individual farms. These results reveal the presence of IBRV and  for the first time on the island of Trinidad and importantly reveal no evidence for the circulation of BVDV or  in dairy cattle in Trinidad.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Morris, Michael J, MJ|Sookhoo, Jamie, J|Blake, Lemar, L|Brown Jordan, Arianne, A|John, Justine, J|Ali, Sheliza, S|Sarjusingh, Gervaise, G|St Aime, Janelle, J|Amoroso, Edward H, EH|Oura, Christopher A L, CAL','2018-05-17 22:46:19','2018-05-17 22:46:19'),(226,23,29750083,'1687-6334','Phytochemical and Pharmacological Review of  (Lindl.) Schlechter.','No abstract found.','2018-05-17 00:00:00','2017-10-15 00:00:00','2018-05-11 00:00:00',0,0,'Osafo, Newman, N|Mensah, Kwesi Boadu, KB|Yeboah, Oduro Kofi, OK','2018-05-17 22:46:19','2018-05-17 22:46:19'),(227,23,29750591,'1931-8448','Salmonella Species\' Persistence and Their High Level of Antimicrobial Resistance in Flooded Man-Made Rivers in China.','Man-made rivers, owing to proximity to human habitats, facilitate transmission of salmonellosis to humans. To determine the contamination situation by Salmonella in flooded man-made rivers and thereafter the exposure risk to public health, we investigated the prevalence of Salmonella species and their antimicrobial resistance in such rivers, as well as the relationship between the incidence of local infectious diarrhea cases and the number of Salmonella isolates from patients. After a heavy flood, 95 isolates of 13 Salmonella serotypes were isolated from 80 river water samples. The two most prevalent serotypes were Typhimurium and Derby. Eight Salmonella serotypes were newly detected after the flood. Overall, 50 isolates were resistant to ampicillin and/or cefotaxime and carried at least bla. Twelve isolates of serotypes Typhimurium, Derby, Rissen, and Indiana were extended-spectrum β-lactamase (ESBL) producing and carried at least one of bla and bla genes. Twelve isolates of serotypes Typhimurium, Derby, Agona, Rissen, and Indiana were resistant to ciprofloxacin and had gyrA mutations. Isolates of Typhimurium, Derby, and Indiana were concurrently ciprofloxacin resistant and ESBL producing. Pulsed-field gel electrophoresis illustrates the circulation of two dominant clones of Salmonella Typhimurium isolates among patients, river, and food. High prevalence of various highly pathogenic and antimicrobial-resistant Salmonella serotypes shows that man-made rivers are prone to heavy contamination with Salmonella, and as a result put public health at greater risk.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-11 00:00:00',0,0,'Song, Qifa, Q|Zhang, Danyang, D|Gao, Hong, H|Wu, Junhua, J','2018-05-17 22:46:19','2018-05-17 22:46:19'),(228,23,29750396,'1545-5017','A phase 1/2 dose-finding, safety, and activity study of cabazitaxel in pediatric patients with refractory solid tumors including tumors of the central nervous system.','This phase 1/2 study (NCT01751308) evaluated cabazitaxel in pediatric patients. Phase 1 determined the maximum tolerated dose (MTD) in patients with recurrent/refractory solid tumors, including central nervous system (CNS) tumors. Phase 2 evaluated activity in pediatric recurrent high-grade glioma (HGG) or diffuse intrinsic pontine glioma (DIPG).In phase 1, a 3 + 3 dose-escalation study design was followed. Cabazitaxel was administered at a starting dose of 20 mg/m . Dose-limiting toxicities (DLTs) during cycle 1 were assessed to determine the MTD. Tumor response and cabazitaxel pharmacokinetics were also assessed. In phase 2, patients received cabazitaxel at the MTD determined in phase 1. Tumor responses were assessed every 9 weeks (modified Response Assessment in Neuro-oncology criteria). Progression-free survival and cabazitaxel pharmacokinetics were evaluated, and overall survival was estimated.In phase 1, 23 patients were treated, including 19 with CNS tumors. One patient had a partial response; five had stable disease for >3 cycles. Common adverse events included fatigue, diarrhea, nausea and vomiting, febrile neutropenia, and hypersensitivity reactions. Two of three DLTs (febrile neutropenia) occurred with a dose of 35 mg/m ; the MTD was 30 mg/m . Slightly higher cabazitaxel clearance was observed compared with adult trials. In phase 2, 16 patients (eight HGG and eight DIPG) were enrolled; 11 were evaluable for response and five withdrew (three due to anaphylaxis). All 11 patients progressed within four cycles. No responses were observed; the study was stopped due to futility.The safety profile of cabazitaxel was consistent with previous studies. The MTD (30 mg/m ) was higher than the adult MTD. Cabazitaxel did not demonstrate activity in recurrent/refractory HGG or DIPG.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-11 00:00:00',0,0,'Manley, Peter E, PE|Trippett, Tanya, T|Smith, Amy A, AA|Macy, Margaret E, ME|Leary, Sarah E S, SES|Boklan, Jessica, J|Cohen, Kenneth J, KJ|Goldman, Stewart, S|Kilburn, Lindsay B, LB|Dhall, Girish, G|Devin, Jeanne, J|Herzog, Cynthia E, CE|Partap, Sonia, S|Fauchet, Floris, F|Badreddine, Emmy, E|Bernard, John P, JP|Chi, Susan N, SN','2018-05-17 22:46:19','2018-05-17 22:46:19'),(229,23,29750366,'1530-0277','Feasibility and acceptability of maternal choline supplementation in heavy drinking pregnant women: A randomized, double-blind, placebo-controlled clinical trial.','Choline, an essential nutrient, serves as a methyl-group donor for DNA methylation and is a constituent of the neurotransmitter acetylcholine and a precursor to major components of cell membranes. Findings from animal studies suggest that choline supplementation during pregnancy may mitigate adverse effects of prenatal alcohol exposure on growth and neurocognitive function. We conducted a randomized, double-blind exploratory trial to examine feasibility and acceptability of a choline supplementation intervention during pregnancy.70 heavy drinkers, recruited in mid-pregnancy, were randomly assigned to receive a daily oral dose of 2g of choline or a placebo from time of enrollment until delivery. Each dose consisted of an individually wrapped packet of powder that, when mixed with water, produced a sweet tasting grape-flavored drink. Adherence was assessed by collecting used and unused drink packets on a monthly basis and tabulating the number used. Side effects were assessed in monthly interviews. Blood samples obtained at enrollment and at 4 and 12 weeks after randomization were assayed for plasma choline concentration.Adherence was good-to-excellent (median doses taken=74.0%; interquartile range=53.9-88.7%) and was not related to a range of sociodemographic characteristics or to alcohol consumption ascertained using a timeline follow-back interview. By 4 weeks, plasma choline concentrations were significantly higher in the choline supplementation than the placebo arm, and this group difference continued to be evident at 12 weeks. The only side effect was a small increase in nausea/dyspepsia. No effects were seen for diarrhea, vomiting, muscle stiffness, blood pressure, or body odor changes.This study demonstrated that a choline supplementation program with very heavy drinkers during pregnancy is feasible even among highly disadvantaged, poorly educated women. The broad acceptability of this intervention is indicated by our finding that adherence was not related to maternal education, intellectual function, depression, nutritional status, or alcohol use. This article is protected by copyright. All rights reserved.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-11 00:00:00',0,0,'Jacobson, Sandra W, SW|Carter, R Colin, RC|Molteno, Christopher D, CD|Meintjes, Ernesta M, EM|Senekal, Marjanne, M|Lindinger, Nadine M, NM|Dodge, Neil C, NC|Zeisel, Steven H, SH|Duggan, Christopher P, CP|Jacobson, Joseph L, JL','2018-05-17 22:46:19','2018-05-17 22:46:19'),(230,24,29740624,'2451-8654','Schema therapy as treatment for adults with autism spectrum disorder and comorbid personality disorder: Protocol of a multiple-baseline case series study testing cognitive-behavioral and experiential interventions.','To our knowledge treatment of personality disorder (PD) comorbidity in adults with ASD is understudied and is still in its infancy. This study investigates the effectiveness of schema therapy for PD-psychopathology in adult patients with both ASD and PD.Twelve adult individuals (age > 18 years) with ASD and at least one PD are given a treatment protocol consisting of 30 weekly offered sessions. A concurrent multiple baseline design is used with baseline varying from 4 to 9 weeks, after which weekly supportive sessions varying from 1 to 6 weeks start with the study therapist. After baseline and 1 to 6 supportive sessions, a 5-week exploration phase follows with weekly sessions during which current and past functioning, psychological symptoms, and schema modes are explored, and information about the treatment is given. This is followed by 15 weekly sessions with cognitive-behavioral interventions and 15 weekly sessions with experiential interventions: patients are vice versa and randomly assigned to the interventions. Finally, there is a 10-month follow-up phase with monthly booster sessions. Participants are randomly assigned to baseline length, and report weekly during treatment and monthly at follow-up on Belief Strength of negative core beliefs, and fill out SMI, SCL-90 and SRS-A 7 times during screening procedure (i.e. before baseline), after supportive sessions, after exploration, after cognitive and behavioral interventions, after experiential interventions, and after 5- and 10- month follow-up. The SCID-II is administered during screening procedure, at 5- and at 10-month follow-up.The Netherlands National Trial Register NTR5788. Registered 01 April 2016.','2017-03-01 00:00:00','2017-01-06 00:00:00','2018-05-09 00:00:00',0,0,'Vuijk, Richard, R|Arntz, Arnoud, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(231,24,29721499,'2314-4327','Predictors of Broad Dimensions of Psychopathology among Patients with Panic Disorder after Cognitive-Behavioral Therapy.','Many patients with panic disorder meet criteria for at least one other diagnosis, most commonly other anxiety or mood disorders. Cognitive-behavioral therapy is the best empirically supported psychotherapy for panic disorder. There is now evidence indicating that cognitive-behavioral therapy for panic disorder yields positive benefits upon comorbid disorders.The present study aimed to examine the predictors of broad dimensions of psychopathology in panic disorder after cognitive-behavioral therapy.Two hundred patients affected by panic disorder were treated with manualized group cognitive-behavioral therapy. We examined if the baseline personality dimensions of NEO Five Factor Index predicted the subscales of Symptom Checklist-90 Revised at endpoint using multiple regression analysis based on the intention-to-treat principle.Conscientiousness score of NEO Five Factor Index at baseline was a predictor of four Symptom Checklist-90 Revised subscales including obsessive-compulsive ( = -0.15,  < 0.01), depression ( = -0.13,  < 0.05), phobic anxiety ( = -0.15,  < 0.05), and Global Severity Index ( = -0.13,  < 0.05).Conscientiousness at baseline may predict several dimensions of psychopathology in patients with panic disorder after cognitive-behavioral therapy. For the purpose of improving a wide range of psychiatric symptoms with patients affected by panic disorder, it may be useful to pay more attention to this personal trait at baseline.','2018-05-17 00:00:00','2018-03-12 00:00:00','2018-05-07 00:00:00',0,0,'Ogawa, Sei, S|Kondo, Masaki, M|Ino, Keiko, K|Imai, Risa, R|Ii, Toshitaka, T|Furukawa, Toshi A, TA|Akechi, Tatsuo, T','2018-05-17 22:46:19','2018-05-17 22:46:19'),(232,24,29713294,'1664-0640','Characteristics and Pathways of Long-Stay Patients in High and Medium Secure Settings in England; A Secondary Publication From a Large Mixed-Methods Study.','No abstract found.','2018-05-17 00:00:00','2018-04-16 00:00:00','2018-05-03 00:00:00',0,0,'Völlm, Birgit A, BA|Edworthy, Rachel, R|Huband, Nick, N|Talbot, Emily, E|Majid, Shazmin, S|Holley, Jessica, J|Furtado, Vivek, V|Weaver, Tim, T|McDonald, Ruth, R|Duggan, Conor, C','2018-05-17 22:46:19','2018-05-17 22:46:19'),(233,24,29702176,'1872-7549','Bipolar affective disorder and borderline personality disorder: Differentiation based on the history of early life stress and psychoneuroendocrine measures.','Borderline Personality Disorder (BPD) and Bipolar Affective Disorder (BD) have clinical characteristics in common which often make their differential diagnosis difficult. The history of early life stress (ELS) may be a differentiating factor between BPD and BD, as well as its association with clinical manifestations and specific neuroendocrine responses in each of these diagnoses.Assessing and comparing patients with BD and BPD for factors related to symptomatology, etiopathogenesis and neuroendocrine markers.The study sample consisted of 51 women, divided into 3 groups: patients with a clinical diagnosis of BPD (n = 20) and BD (n = 16) and healthy controls (HC, n = 15). Standardized instruments were used for the clinical evaluation, while the history of ELS was quantified with the Childhood Trauma Questionnaire (CTQ), and classified according to the subtypes: emotional abuse, physical abuse, sexual abuse, emotional neglect and physical neglect. The functioning of the hypothalamic-pituitary-adrenal (HPA) axis was evaluated by measuring a single plasma cortisol sample.Patients with BPD presented with more severe psychiatric symptoms of: anxiety, impulsivity, depression, hopelessness and suicidal ideation than those with BD. The history of ELS was identified as significantly more prevalent and more severe in patients (BPD and BP) than in HC. Emotional abuse, emotional neglect and physical neglect also showed differences and were higher in BPD than BD patients. BPD patients had greater severity of ELS overall and in the subtypes of emotional abuse, emotional neglect and physical neglect than BD patients. The presence of ELS in patients with BPD and BP showed significant difference with lower cortisol levels when compared to HC. The endocrine evaluation showed no significant differences between the diagnoses of BPD and BD. Cortisol measured in patients with BPD was significantly lower compared to HC in the presence of emotional neglect and physical neglect. A significant negative correlation between the severity of hopelessness vs cortisol; and physical neglect vs cortisol were found in BPD with ELS. The single cortisol sample showed a significant and opposite correlations in the sexual abuse diagnosis-related groups, being a negative correlation in BD and positive in BPD.Considering the need for a multi-factorial analysis, the differential diagnosis between BPD and BD can be facilitated by the study of psychiatric symptoms, which is more severe in the BPD patients with a history of early life stress. The function of the HPA axis assessed by this cortisol measure suggests differences between BPD and BP with ELS history.The integrated analysis of psychopathology, ELS and neuroendocrine function may provide useful indicators to differentiate BPD and BD diagnoses. These preliminary data need to be replicated in a more significant sample with a better assessment and multiple assessments of the HPA axis activity.','2018-04-24 00:00:00','2018-04-24 00:00:00','2018-04-27 00:00:00',0,0,'Mazer, Angela Kaline, AK|Cleare, Anthony J, AJ|Young, Allan H, AH|Juruena, Mario F, MF','2018-05-17 22:46:19','2018-05-17 22:46:19'),(234,24,29648858,'1939-2117','The effect of alliance-focused training on a cognitive-behavioral therapy for personality disorders.','To improve success rates in psychotherapy, we developed and evaluated an alliance-focused training (AFT) protocol with regard to patient-therapist interpersonal behavior in a 30-session protocol of cognitive-behavioral therapy (CBT) for outpatients comorbid with Axis I and II conditions.Participants included 40 patients treated by 40 therapists in a multiple baseline design in which novice therapists trained to fidelity standards in CBT were introduced to AFT at different time intervals (after either 8 or 16 sessions) during a 30-session CBT protocol. Interpersonal behaviors were assessed with a simplified version of the Structural Analysis of Social Behavior (SASB) on videotaped sessions sampled from the early (between Sessions 6 through 8), mid (Sessions 14 through 16), and late (Sessions 22 through 24) phases of therapy.As predicted, several significant interactions were observed between within-subject interpersonal change and between-groups differences in exposure to AFT. Specifically, there were decreases in patient dependence and in therapist control (including criticism), plus increases in patient expressiveness and in therapist affirmation and expressiveness, all of which could be attributed to AFT. The predictive relationship of several of these variables to session-level and overall treatment outcome was also demonstrated.This study demonstrates that novice CBT therapists can be trained to improve their interpersonal process with patients who present with comorbid diagnoses, including a personality disorder. (PsycINFO Database Record','2018-04-01 00:00:00','0000-00-00 00:00:00','2018-04-17 00:00:00',0,0,'Muran, J Christopher, JC|Safran, Jeremy D, JD|Eubanks, Catherine F, CF|Gorman, Bernard S, BS','2018-05-17 22:46:19','2018-05-17 22:46:19'),(235,24,29636316,'1438-8871','Harnessing Reddit to Understand the Written-Communication Challenges Experienced by Individuals With Mental Health Disorders: Analysis of Texts From Mental Health Communities.','Mental disorders such as depression, bipolar disorder, and schizophrenia are common, incapacitating, and have the potential to be fatal. Despite the prevalence and gravity of mental disorders, our knowledge concerning everyday challenges associated with them is relatively limited. One of the most studied deficits related to everyday challenges is language impairment, yet we do not know how mental disorders can impact common forms of written communication, for example, social media.The aims of this study were to investigate written communication challenges manifest in online mental health communities focusing on depression, bipolar disorder, and schizophrenia, as well as the impact of participating in these online mental health communities on written communication. As the control, we selected three online health communities focusing on positive emotion, exercising, and weight management.We examined lexical diversity and readability, both important features for measuring the quality of writing. We used four well-established readability metrics that consider word frequencies and syntactic complexity to measure writers\' written communication ability. We then measured the lexical diversity by calculating the percentage of unique words in posts. To compare lexical diversity and readability among communities, we first applied pairwise independent sample t tests, followed by P value adjustments using the prespecified Hommel procedure to adjust for multiple comparison. To measure the changes, we applied linear least squares regression to the readability and lexical diversity scores against the interaction sequence for each member, followed by pairwise independent sample t tests and P value adjustments. Given the large sample of members, we also report effect sizes and 95% CIs for the pairwise comparisons.On average, members of depression, bipolar disorder, and schizophrenia communities showed indications of difficulty expressing their ideas compared with three other online health communities. Our results also suggest that participating in these platforms has the potential to improve members\' written communication. For example, members of all three mental health communities showed statistically significant improvement in both lexical diversity and readability compared with members of the OHC focusing on positive emotion.We provide new insights into the written communication challenges faced by individuals suffering from depression, bipolar disorder, and schizophrenia. A comparison with three other online health communities suggests that written communication in mental health communities is significantly more difficult to read, while also consisting of a significantly less diverse lexicon. We contribute practical suggestions for utilizing our findings in Web-based communication settings to enhance members\' communicative experience. We consider these findings to be an important step toward understanding and addressing everyday written communication challenges among individuals suffering from mental disorders.','2018-04-10 00:00:00','2018-04-10 00:00:00','2018-05-04 00:00:00',0,0,'Park, Albert, A|Conway, Mike, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(236,24,29609713,'1550-9397','Dissociative Identity Disorder CPAP Adherence: An Uncommon Factor in Obstructive Sleep Apnea.','We present a case of a patient with dissociative identity disorder and symptomatic sleep apnea who was treated with continuous positive airway pressure (CPAP). CPAP use depended upon which personality the patient exhibited but apnea reduction did not. This case illustrates in one individual how personality can positively or negatively affect CPAP adherence.','2018-03-30 00:00:00','2018-03-30 00:00:00','2018-04-03 00:00:00',0,0,'Gandotra, Kamal, K|Golish, Joseph, J|Rosenberg, Carl, C|Strohl, Kingman, K','2018-05-17 22:46:19','2018-05-17 22:46:19'),(237,24,29573219,'1601-183X','Predicting loneliness with polygenic scores of social, psychological and psychiatric traits.','Loneliness is a heritable trait that accompanies multiple disorders. The association between loneliness and mental health indices may partly be due to inherited biological factors. We constructed polygenic scores for 27 traits related to behavior, cognition and mental health and tested their prediction for self-reported loneliness in a population-based sample of 8798 Dutch individuals. Polygenic scores for major depressive disorder (MDD), schizophrenia and bipolar disorder were significantly associated with loneliness. Of the Big Five personality dimensions, polygenic scores for neuroticism and conscientiousness also significantly predicted loneliness, as did the polygenic scores for subjective well-being, tiredness and self-rated health. When including all polygenic scores simultaneously into one model, only 2 major depression polygenic scores remained as significant predictors of loneliness. When controlling only for these 2 MDD polygenic scores, only neuroticism and schizophrenia remain significant. The total variation explained by all polygenic scores collectively was 1.7%. The association between the propensity to feel lonely and the susceptibility to psychiatric disorders thus pointed to a shared genetic etiology. The predictive power of polygenic scores will increase as the power of the genome-wide association studies on which they are based increases and may lead to clinically useful polygenic scores that can inform on the genetic predisposition to loneliness and mental health.','2018-03-23 00:00:00','2018-03-23 00:00:00','2018-04-15 00:00:00',0,0,'Abdellaoui, A, A|Nivard, M G, MG|Hottenga, J-J, JJ|Fedko, I, I|Verweij, K J H, KJH|Baselmans, B M L, BML|Ehli, E A, EA|Davies, G E, GE|Bartels, M, M|Boomsma, D I, DI|Cacioppo, J T, JT','2018-05-17 22:46:19','2018-05-17 22:46:19'),(238,24,29547739,'2352-2518','Good psychiatric management: a review.','Borderline personality disorder (BPD) has moved from being an untreatable disorder to a disorder with multiple evidence-based psychotherapies. When a second generation of research showed that less intensive, easier-to-learn therapies could be nearly as effective, they offered an approach that would be responsive to the persisting unmet needs of these patients. This paper describes good psychiatric management (GPM), a once-weekly, generalist model that medicalizes the disorder, emphasizes psychoeducation, and focuses on social adaptation. It is proposed that this approach be the primary intervention for BPD; more intensive evidence-based psychotherapies thereby reserved for those who fail to respond. It is also suggested that whether GPM\'s focus on social adaptation yields significant effects that improve outcome in this domain deserves testing.','2018-01-05 00:00:00','2018-01-05 00:00:00','2018-03-16 00:00:00',0,0,'Gunderson, John, J|Masland, Sara, S|Choi-Kain, Lois, L','2018-05-17 22:46:19','2018-05-17 22:46:19'),(239,25,29752389,'1941-7705','Pregnancy in Women With a Fontan Circulation: A Systematic Review of the Literature.','The Fontan operation has provided life-saving palliation and adult survival for individuals born with single ventricle physiology. Many now seek advice about safe pregnancy. Little data are, however, available, consisting mainly of anecdotal experience and small series. This article seeks to review the published literature and identify lessons learnt from this collective experience.We conducted a systematic review to evaluate maternal and fetal outcomes of pregnancy in women with a Fontan circulation. Among 1150 studies that were screened, 6 studies had sufficient longitudinal data points to qualify for meaningful inclusion, yielding 255 pregnancies in 133 women after Fontan procedure resulting in 115 live births (45%; including reports from 1986 to 2015). There was a total of 137 pregnancy losses (69%), with 115 miscarriages (45%), 19 elective terminations of pregnancy (7%), 2 stillbirths (1%), and 1 ectopic pregnancy (1%).The most common cardiovascular adverse events were supraventricular arrhythmia affecting 8.4% (range, 3%-37%) and heart failure affecting 3.9% (range, 3%-11%) of pregnancies. These complications were successfully managed with conventional approaches. No maternal deaths were reported. Postpartum hemorrhage was the predominant obstetric complication affecting 14% of the patients. Most patients were on antiplatelet agents (27%) or anticoagulants (50%) whereas only a minority (11%) were on neither. Among the 115 live births, 68 were premature (59%), 17 were small for gestational age (20%), and neonatal death occurred in 6 patients (5%).The most commonly reported cardiovascular complications in patients with Fontan physiology-associated pregnancy were arrhythmia and heart failure. Miscarriages were highly prevalent as was prematurity and intrauterine growth restriction. Postpartum hemorrhage seems to be the most common obstetric complication. Large-scale data sets are needed to confirm these early observations and address the late sequelae of pregnancy in women with a Fontan circulation.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-05-12 00:00:00',0,0,'Garcia Ropero, Alvaro, A|Baskar, Shankar, S|Roos Hesselink, Jolien W, JW|Girnius, Andrea, A|Zentner, Dominica, D|Swan, Lorna, L|Ladouceur, Magalie, M|Brown, Nicole, N|Veldtman, Gruschen R, GR','2018-05-17 22:46:19','2018-05-17 22:46:19'),(240,25,29751813,'1756-0500','Ruptured caesarean scar ectopic pregnancy: a diagnostic dilemma in a resource-limited setting.','Caesarean scar pregnancy (CSP) remains a very rare form of ectopic pregnancy associated with serious life threatening obstetric complications and even death in case of late diagnosis and treatment.We report a case of a ruptured caesarean scar pregnancy in a 29 year-old gravida 5, para 3 with a past obstetric history of two consecutive caesarean sections done 9 and 5 years ago respectively. The patient presented with intermittent lower abdominal pains on a 20 weeks gestation associated with mild epigastralgia and 2 previous episodes of mild pervaginal bleeding (2 and 1 months ago respectively before consultation) managed with injectable progesterone. Her evolution 4 h later was marked by an increase in the intensity of the abdominal pain, an unmeasurable blood pressure and a feeble pulse. Immediate paracentesis revealed 10 cc of fresh non coagulating blood. The diagnosis of ruptured ectopic pregnancy with abundant hemoperitoneum was considered and an emergency laparotomy with fluid and blood resuscitation was carried out. A midline laparotomy revealed a ruptured caesarean scar ectopic pregnancy with an abundant hemoperitoneum. Careful resection of the placenta and repair of the ruptured isthmic region of the uterus was carried out. Recovery after surgery was without complications and the patient was discharged on the 6th day following surgery.Caesarean scar pregnancy remains a very rare obstetric condition. Late diagnosis of this condition can be associated with serious life threatening obstetric complications. The rarity of the condition warrants a high index of suspicion among clinicians.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Ajong, Atem Bethel, AB|Kenfack, Bruno, B|Agbor, Valirie Ndip, VN|Njotang, Philip Nana, PN','2018-05-17 22:46:19','2018-05-17 22:46:19'),(241,25,29751791,'1471-2393','A cohort of women with ectopic pregnancy: challenges in diagnosis and management in a rural hospital in a low-income country.','Ectopic pregnancy (EP) is a serious complication of early pregnancy. In low-income countries diagnosis of EP is difficult and it is a major contributor to maternal mortality. We aimed to assess and improve the diagnostic process of women with EP.We conducted a retrospective medical records study of all women with confirmed EP in Ndala Hospital from 2010 to 2012. We used data on demographics, symptoms, diagnostic procedures, surgical findings, treatment and post-operative status.Six thousand six hundred sixty-two women gave birth in the hospital, and 88 women were diagnosed with EP (incidence 1.3%). Thirty-nine percent of women did not report to be pregnant or to have a history of amenorrhea. On admission in Ndala hospital, a diagnosis of \'suspected EP\' was made in less than half (47%) of the cases. Most women had a urine pregnancy test done (sensitivity of 98%). Peritoneal aspiration was done in 42%. The fifty-five women with EP who were diagnosed by ultrasound received a lower mean number of units of blood transfusion and had less often severe anaemia than women who were diagnosed by abdominal aspiration (abdominocentesis). The majority of women (65%) had surgery within 24 h after admission.Diagnosing EP in a rural hospital in Tanzania is challenging. Often there is a large doctors\' delay before the right diagnosis is made. Abdominal aspiration can be useful for rapid diagnosis. A pelvic ultrasound, when available, allows the diagnosis to be made earlier with less intra-abdominal bleeding.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Mooij, R, R|Mgalega, G C, GC|Mwampagatwa, I H, IH|van Dillen, J, J|Stekelenburg, J, J','2018-05-17 22:46:19','2018-05-17 22:46:19'),(242,25,29746021,'0390-6663','Analysis of outcomes of fertility restoration surgery in women with infertility secondary to tubal pregnancy: a series of 77 cases.','To assess pregnancy outcomes after minimally-invasive fertility restoration surgery in women with infertility secondary to tubal pregnancy treated with salpingectomy.The study included 77 women diagnosed with infertility after salpingectomy for tubal pregnancy between December 2008 and October 2010 for intraoperative assessment and treatment of tubal and pelvic adhesions. The mean age of the patients was 31.12 ± 3.58 years and their duration of infertility was 3.91 ± 2.80 years. Chi-square test, Student\'s t-test, rank-sum test, and Kaplan-Meier test was used. A p-value < 0.05 was considered significant.Tubal function was restored in 68.8% of women, 33.77% experienced intrauterine conception, 32.47% had a live birth, 5.19% had an ectopic pregnancy, and 1.30% had a spontaneous abortion within the three-year follow up period.Minimally-invasive fertility restoration surgery after tubal pregnancy treated with salpingectomy restored tubal function in the contralateral fallopian tube in the majority of women.','2018-05-17 00:00:00','0000-00-00 00:00:00','2018-05-10 00:00:00',0,0,'Hu, C, C|Chen, Z, Z|Chen, Y, Y|Hou, H, H|Chen, X, X|Cao, Z, Z|Shi, H, H','2018-05-17 22:46:19','2018-05-17 22:46:19'),(243,25,29741420,'1365-2931','Feasibility of single-incision laparoscopy for ruptured ectopic pregnancies with hemoperitoneum.','The aim of this study was to compare single-incision laparoscopic surgery (SILS) and conventional laparoscopy in ectopic pregnancies accompanied by severe hemoperitoneum.The main outcome measures were duration of surgery, intraoperative bleeding quantity, complications, post-operative pain scores, additional analgesic requirements, and length of hospital stay.A total of 53 women, 28 in the conventional laparoscopy group and 25 in the SILS group, participated in the study. There were no differences in demographic characteristics between the two groups. There were no differences in terms of variables including gestational week, beta human chorionic gonadotropin (βhCG) levels, and operation time. No intraoperative complications were observed in either group. The groups exhibited no significant differences regarding additional analgesic requirements or postoperative pain scores. However, pain at the sixth postoperative hour was lower in the SILS group. This effect was not observed at 12 and 24 hours.SILS appears to be effective and safe for the treatment of ruptured ectopic pregnancies accompanied by hemoperitoneum.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-09 00:00:00',0,0,'Karasu, Yetkin, Y|Akselim, Burak, B','2018-05-17 22:46:19','2018-05-17 22:46:19'),(244,25,29734537,'0390-6663','Role of mean platelet volume and neutrophil/lymphocyte ratio to predict single-dose methotrexate treatment success in tubal ectopic pregnancy.','The aim of the study was to evaluate the value of mean platelet volume (MPV) and neutrophil/lymphocyte ratio (NLR) to predict single-dose methotrexate (MTX) treatment success in ectopic pregnancy (EP).A total of 115 EP diagnosed and hemodynamically stable women were enrolled in the study and divided into two groups as group 1, the treatment success group (n= 78) and group 2, the treatment failure group (n = 37). The authors compared the groups in terms of MPV and NLR.MPV and NLR levels were higher in MTX treatment successful group than in failure group.The cut-off values of MPV and NLR were determined as 10.1 fL and 1.82, respectively. These cut off values showed similar sensitivity and specificity in prediction of MTX treat- ment success.MPV and NLR can be used as reliable markers to predict single-dose MTX treatment success however further studies are needed.','2018-05-17 00:00:00','0000-00-00 00:00:00','2018-05-07 00:00:00',0,0,'Cekmez, Y, Y|Göçmen, A, A|Sanlιkan, F, F|Türkmen, S B, SB','2018-05-17 22:46:19','2018-05-17 22:46:19'),(245,25,29734532,'0390-6663','Effect of different luteal support schemes on clinical outcome in frozen-thawed embryos transfer cycles.','To evaluate the clinical outcome of frozen-thawed embryo transfer (FET) when using different luteal support schemes.Retrospective analysis of FET cycles was performed from June 2013 and December 2013. Infertile women, who underwent FET cycles utilizing embryos cryopreserved on day 3 post-insemination following an initial fresh IVF cycle. Patients were divided into three groups according to the luteal support scheme. Grade A (oral administration of progesterone, n=156), Group B (vaginal administration of progesterone, n=345), Group C (dissolved progesterone in oil with intramuscular infection, n=885), and group C was divided into two subgroups according to with (subgroup Cl, n=521) or without (subgroup C2 ,n=364) human chorionic gonadotrophi (hCG) injected intramuscularly. The authors compared patients\' characteristics and the pregnancy outcomes of each group.There was no difference in the patient characteristics of each group. There was no difference in the implantation rate or clinical and ongoing pregnancy rate among oral, vaginal, and intramuscular progesterone groups. The abortion and ectopic pregnancy rates were not significantly different among the three groups.Oral progesterone in the FET cycles is convenient and has similar pregnancy outcomes compared with intramuscular or vaginal administration.','2018-05-17 00:00:00','0000-00-00 00:00:00','2018-05-07 00:00:00',0,0,'Zhang, Z, Z|Su, D, D|Zhu, P, P|Bi, X, X|Qi, G, G|Wu, X, X','2018-05-17 22:46:19','2018-05-17 22:46:19'),(246,25,29736107,'1986-5961','Sigmoid Colon Perforation Mimics a Tuboovarian Absces.','An adnexal mass may be diagnosed after a routine pelvic ultrasonographic examination or an emergent hospital admission due to rupture of ectopic pregnancy, adnexal torsion or rupture of tuboovarian abscess. It is necessary to evaluate the origin of the mass initially and to classify patients who need further evaluation and treatment for an urgent condition.We report a case of sigmoid colon rupture due to sigmoid colon adenocarcinoma presenting as acute abdomen with left adnexal mass in a 28 years old woman. Abdominopelvic computed tomography revealed a left adnexal mass with suspicion of tuboovarian abscess. In laparatomy, rupture of sigmoid colon was observed and resection of sigmoid colon was performed. Histological examination of resection part revealed diagnosis of sigmoid colon adenocarcinoma due to familial adenomatous polyposis.This case may be interesting for clinicians because pelvic pain, fever, increased infection markers in the laboratory and mass at ultrasonography or other screening methods could cause a misdiagnosis of tubaovarian abscess especially in reproductive age women. Before the operation of the pelvic mass of all age women with the diagnosis of tuboovarian abscess other causes of the pelvic abscess should come into mine and necessary preparation for operation must be done.','2018-04-01 00:00:00','0000-00-00 00:00:00','2018-05-11 00:00:00',0,0,'Sayan, Cemile Dayangan, CD|Yeral, Mahmut Ilkin, MI|Ozkan, Zehra Sema, ZS|Karaca, Gokhan, G|Asal, Nese, N|Aydın, Oktay, O|Sagsoz, Nevin, N','2018-05-17 22:46:19','2018-05-17 22:46:19'),(247,25,29735871,'1119-3077','Ruptured ectopic in heterotopic pregnancy: Management and spontaneous vertex delivery of a live baby at term.','Spontaneous heterotopic pregnancy is an uncommon clinical condition in which there is a simultaneous development of intrauterine and extrauterine pregnancies. It is a life-threatening emergency when the ectopic ruptures. We present Mrs. EC, a 27-year-old GP +  with a family history of multiple gestations who had a heterotopic pregnancy at a gestational age of 7 weeks. She presented with features of threatened miscarriage at early pregnancy with an ultrasound confirmation of intrauterine pregnancy. The diagnosis of ruptured ectopic pregnancy coexisting with intrauterine gestation was made with ultrasound findings as well as clinical features necessitating emergency exploratory laparotomy. Thereafter, pregnancy was carried to term, and she delivered a live male baby that weighed 3.0 kg. Heterotopic pregnancy should be sort for in all pregnancies during the early scan, especially in those with predisposing factors for multiple gestations and risk factors for ectopic gestation. A high index of suspicion is necessary for making a diagnosis in women with intrauterine pregnancy, with or without symptoms of ectopic gestation, and irrespective of the existence of risk factors for ectopic pregnancy.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-05-08 00:00:00',0,0,'Onoh, R C, RC|Ejikeme, B N, BN|Onwe, A B, AB|Asiegbu, O U, OU','2018-05-17 22:46:19','2018-05-17 22:46:19'),(248,25,29733747,'1473-0766','Cornual uterine diverticulum following a failed pregnancy.','The discovery of a uterine diverticulum is a rare event. Diverticula can lead to outcomes including pelvic pain, ectopic pregnancy, and diverticula rupture and should be considered in cases of uterine cystic masses. We report a case of a 32-year-old G3P0030 with a complicated pregnancy and surgical history who presented to us following an abnormal laparoscopy for severe pelvic pain four years after salpingectomy for a tubal pregnancy. This laparoscopy reported a cornual uterine cystic structure. Saline infusion sonohysterography was performed with fluid filling a uterine cornual cystic mass. On hysteroscopy, no outpouching was identified. With chromopertubation on laparoscopy, methylene blue filled the diverticulum. The diverticulum was laparoscopically removed. Pathology examination was consistent with a diverticulum containing a placental implantation site and necrotic chorionic villi.','2018-05-07 00:00:00','2018-05-07 00:00:00','2018-05-07 00:00:00',0,0,'Babcock Gilbert, Sara, S|Reading, Julia I, JI|Post, Miriam D, MD|Alvero, Ruben, R|Al-Safi, Zain A, ZA','2018-05-17 22:46:19','2018-05-17 22:46:19'),(249,26,29752689,'1674-8018','The structure differences of Japanese encephalitis virus SA14 and SA14-14-2 E proteins elucidate the virulence attenuation mechanism.','No abstract found.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Liu, Xinyu, X|Zhao, Xin, X|Na, Rui, R|Li, Lili, L|Warkentin, Eberhard, E|Witt, Jennifer, J|Lu, Xu, X|Yu, Yongxin, Y|Wei, Yuquan, Y|Peng, Guohong, G|Li, Yuhua, Y|Wang, Junzhi, J','2018-05-17 22:46:19','2018-05-17 22:46:19'),(250,26,29751371,'1468-1331','Status epilepticus associated with acute encephalitis: long-term follow-up of functional and cognitive outcomes in 72 patients.','Continued care in patients with encephalitis and prolonged status epilepticus (SE) is controversial. Limited data is available on the functional and cognitive outcomes.In a prospective cohort study from 2007 to 2016, patients with acute encephalitis and SE were reviewed. Long-term outcomes including motor disability (modified Rankin Scale, mRS), daily living skills (activities of daily living, ADL), cognitive ability (modified Telephone Interview for Cognitive Status, TICS-M) and epilepsy sequelae, were evaluated in those survivors at 12-month follow-up.At the 12-month follow-up, 72 patients were recruited, who got a median score of 14 on the total ADL. 68% patients remained independent in their daily activities (mRS≤2). Post-SE symptomatic epilepsy was observed in 49% patients. 62 patients achieved a median score of 40 on the TICS-M and 14 on the TICS-M memory. Patients with autoimmune encephalitis were less prone to post-SE symptomatic epilepsy (18% vs. 58%, P=0.005) but lower TICS-M memory score than those with viral encephalitis (8.5 vs. 15, P=0.017). Compared to non-refractory status epilepticus (RSE), patients with RSE had a longer stay in NCU (39 vs. 26, P=0.002), more in-hospital complications and post-SE symptomatic epilepsy (67% vs. 33%, P=0.005). Long-term outcomes including ADL, mRS, and TICS-M were not significantly different between patients with RSE and non-RSE or between patients with long (≥4h) and short duration (<4h) of SE.Survival with favorable functional recovery was promising after prolonged RSE in patients with acute encephalitis. This article is protected by copyright. All rights reserved.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-11 00:00:00',0,0,'Chen, Weibi, W|Su, Yingying, Y|Jiang, Mengdi, M|Liu, Gang, G|Tian, Fei, F|Ren, Guoping, G','2018-05-17 22:46:19','2018-05-17 22:46:19'),(251,26,29748549,'2045-2322','Genotype I of Japanese Encephalitis Virus Virus-like Particles Elicit Sterilizing Immunity against Genotype I and III Viral Challenge in Swine.','Swine are a critical amplifying host involved in human Japanese encephalitis (JE) outbreaks. Cross-genotypic immunogenicity and sterile protection are important for the current genotype III (GIII) virus-derived vaccines in swine, especially now that emerging genotype I (GI) JE virus (JEV) has replaced GIII virus as the dominant strain. Herein, we aimed to develop a system to generate GI JEV virus-like particles (VLPs) and evaluate the immunogenicity and protection of the GI vaccine candidate in mice and specific pathogen-free swine. A CHO-heparan sulfate-deficient (CHO-HS(-)) cell clone, named 51-10 clone, stably expressing GI-JEV VLP was selected and continually secreted GI VLPs without signs of cell fusion. 51-10 VLPs formed a homogeneously empty-particle morphology and exhibited similar antigenic activity as GI virus. GI VLP-immunized mice showed balanced cross-neutralizing antibody titers against GI to GIV viruses (50% focus-reduction micro-neutralization assay titers 71 to 240) as well as potent protection against GI or GIII virus infection. GI VLP-immunized swine challenged with GI or GIII viruses showed no fever, viremia, or viral RNA in tonsils, lymph nodes, and brains as compared with phosphate buffered saline-immunized swine. We thus conclude GI VLPs can provide sterile protection against GI and GIII viruses in swine.','2018-05-10 00:00:00','2018-05-10 00:00:00','2018-05-11 00:00:00',0,0,'Fan, Yi-Chin, YC|Chen, Jo-Mei, JM|Lin, Jen-Wei, JW|Chen, Yi-Ying, YY|Wu, Guan-Hong, GH|Su, Kuan-Hsuan, KH|Chiou, Ming-Tang, MT|Wu, Shang-Rung, SR|Yin, Ji-Hang, JH|Liao, Jiunn-Wang, JW|Chang, Gwong-Jen J, GJ|Chiou, Shyan-Song, SS','2018-05-17 22:46:19','2018-05-17 22:46:19'),(252,26,29747695,'1746-1596','A case report of granulomatous amoebic encephalitis by Group 1 Acanthamoeba genotype T18 diagnosed by the combination of morphological examination and genetic analysis.','The diagnosis of granulomatous amoebic encephalitis is challenging for clinicians because it is a rare and lethal disease. Previous reports have indicated that Acanthamoeba with some specific genotypes tend to cause the majority of human infections. We report a case of granulomatous amoebic encephalitis caused by Acanthamoeba spp. with genotype T18 in an immunodeficient patient in Japan after allogenic bone marrow transplantation, along with the morphological characteristics and genetic analysis.A 52-year old man, who had undergone allogenic bone marrow transplantation, suffered from rapid-growing brain masses in addition to pneumonia and died within 1 month from the onset of the symptoms including fever, headache and disorientation. Infection with Acanthamoeba in the brain and lung was confirmed by histological evaluation; immunohistochemical staining and polymerase chain reaction analysis using autopsy samples also indicated the growth of Acanthamoeba in the brain. Gene sequence analysis indicated that this is the second documented case of infection with Acanthamoeba spp. with genotype T18 in a human host. Postmortem retrospective evaluation of cerebrospinal fluid sample in our case, as well as literature review, indicated that some cases of granulomatous amoebic encephalitis caused by Acanthamoeba may be diagnosable by cerebrospinal fluid examination.This case indicates that Acanthamoeba spp. with genotype T18 can also be an important opportunistic pathogen. For pathologists as well as physicians, increased awareness of granulomatous amoebic encephalitis is important for improving the poor prognosis along with the attempt to early diagnosis with cerebrospinal fluid.','2018-05-10 00:00:00','2018-05-10 00:00:00','2018-05-11 00:00:00',0,0,'Matsui, Takahiro, T|Maeda, Tetsuo, T|Kusakabe, Shinsuke, S|Arita, Hideyuki, H|Yagita, Kenji, K|Morii, Eiichi, E|Kanakura, Yuzuru, Y','2018-05-17 22:46:19','2018-05-17 22:46:19'),(253,26,29746378,'1532-0987','Acute Encephalitis Syndrome in Gorakhpur, Uttar Pradesh, 2016: Clinical and Laboratory Findings.','Seasonal outbreaks of acute encephalitis syndrome (AES) with high fatality have been occurring in Gorakhpur, Uttar Pradesh, India for several years. We conducted investigations during the 2016 outbreak, to identify the etiology.We included 407 hospitalized AES patients with CSF pleocytosis (>5 cells/cmm) in our study. These patients were clinically examined; their blood and CSF samples were collected and investigated for scrub typhus (ST), Japanese encephalitis virus (JEV), dengue virus and spotted fever group of rickettsia (SFGR) by serology and/or PCR.Of the 407 AES patients, 266 (65.4%), 42 (10.3%) and 29 (7.5%) were diagnosed to have ST, JEV and dengue respectively. Four patients were diagnosed to have SFGR infection. A significantly higher proportion of scrub typhus patients with AES had hepatomegaly, splenomegaly, and facial edema. The common hematological and biochemical abnormalities among ST positive patients include thrombocytopenia, raised liver enzymes and bilirubin levels. The case fatality ratio was significantly higher among ST negative AES patients (36.2% vs 15.2%, p<0.05).ST accounted for approximately two third of the AES case-patients. Efforts are required to identify the etiology of AES case-patients that are negative for ST, JE and dengue fever.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-10 00:00:00',0,0,'Mittal, Mahima, M|Bondre, Vijay, V|Murhekar, Manoj, M|Deval, Hirawati, H|Rose, Winsley, W|Verghese, Valsan Philip, VP|Mittal, Mahim, M|Patil, Gajanan, G|Sabarinathan, R, R|Thangaraj, Jeromie Wesley Vivian, JWV|Kanagasabai, K, K|Prakash, John Antony Jude, JAJ|Gupta, Nivedita, N|Gupte, Manish, M|Gupte, Mohan D, MD','2018-05-17 22:46:19','2018-05-17 22:46:19'),(254,26,29745870,'1465-2099','Isolation, antigenicity and immunogenicity of Lleida bat lyssavirus.','The lyssaviruses are an important group of viruses that cause a fatal encephalitis termed rabies. The prototypic lyssavirus, rabies virus, is predicted to cause more than 60 000 human fatalities annually. The burden of disease for the other lyssaviruses is undefined. The original reports for the recently described highly divergent Lleida bat lyssavirus were based on the detection of virus sequence alone. The successful isolation of live Lleida bat lyssavirus from the carcass of the original bat and in vitro characterization of this novel lyssavirus are described here. In addition, the ability of a human rabies vaccine to confer protective immunity following challenge with this divergent lyssavirus was assessed. Two different doses of Lleida bat lyssavirus were used to challenge vaccinated or naïve mice: a high dose of 100 focus-forming units (f.f.u.) 30 µl and a 100-fold dilution of this dose, 1 f.f.u. 30 µl. Although all naïve control mice succumbed to the 100 f.f.u. 30 µl challenge, 42 % (n=5/12) of those infected intracerebrally with 1 f.f.u. 30 µl survived the challenge. In the high-challenge-dose group, 42 % of the vaccinated mice survived the challenge (n=5/12), whilst at the lower challenge dose, 33 % (n=4/12) survived to the end of the experiment. Interestingly, a high proportion of mice demonstrated a measurable virus-neutralizing antibody response, demonstrating that neutralizing antibody titres do not necessarily correlate with the outcome of infection via the intracerebral route. Assessing the ability of existing rabies vaccines to protect against novel divergent lyssaviruses is important for the development of future public health strategies.','2018-05-10 00:00:00','2018-05-10 00:00:00','2018-05-10 00:00:00',0,0,'Banyard, Ashley C, AC|Selden, David, D|Wu, Guanghui, G|Thorne, Leigh, L|Jennings, Daisy, D|Marston, Denise, D|Finke, Stefan, S|Freuling, Conrad M, CM|Müller, Thomas, T|Echevarría, Juan E, JE|Fooks, Anthony R, AR','2018-05-17 22:46:19','2018-05-17 22:46:19'),(255,26,29745869,'1465-2099','ICTV Virus Taxonomy Profile: Togaviridae.','The Togaviridae is a family of small, enveloped viruses with single-stranded, positive-sense RNA genomes of 10-12 kb. Within the family, the genus Alphavirus includes a large number of diverse species, while the genus Rubivirus includes the single species Rubella virus. Most alphaviruses are mosquito-borne and are pathogenic in their vertebrate hosts. Many are important human and veterinary pathogens (e.g. chikungunya virus and eastern equine encephalitis virus). Rubella virus is transmitted by respiratory routes among humans. This is a summary of the International Committee on Taxonomy of Viruses (ICTV) Report on the taxonomy of the Togaviridae, which is available at www.ictv.global/report/togaviridae.','2018-05-10 00:00:00','2018-05-10 00:00:00','2018-05-10 00:00:00',0,0,'Chen, Rubing, R|Mukhopadhyay, Suchetana, S|Merits, Andres, A|Bolling, Bethany, B|Nasar, Farooq, F|Coffey, Lark L, LL|Powers, Ann, A|Weaver, Scott C, SC|','2018-05-17 22:46:19','2018-05-17 22:46:19'),(256,26,29745301,'2047-7732','Comparative genome analysis of Alkhumra hemorrhagic fever virus with Kyasanur forest disease and tick-borne encephalitis viruses by the in silico approach.','Alkhumra hemorrhagic fever virus (AHFV), a relatively new member of the Flaviviruses, was discovered in Saudi Arabia 23 years ago. AHFV is classified in the tick-borne encephalitis virus serocomplex, along with the Kyasanur forest disease virus (KFDV) and tick-borne encephalitis virus (TBEV). Currently, very little is known about the pathologies of AHFV. In this study, using the available genome information of AHFV, KFDV and TBEV, we have predicted and compared the following aspects of these viruses: evolution, nucleotide and protein compositions, recombination, codon frequency, substitution rate, N- and O-glycosylation sites, signal peptide and cleavage site, transmembrane region, secondary structure of 5\' and 3\' UTRs and RNA-RNA interactions. Additionally, we have modeled the 3D protease and RNA-dependent RNA polymerase structures for AHFV, KFDV and TBEV. Recombination analysis showed no evidence of recombination in the AHFV genome with that of either KFDV or TBEV, although single break point analysis showed that nucleotide position 7399 (in the NS4B) is a breakpoint location. AHFV, KFDV and TBEV are very similar in terms of codon frequency, the number of transmembrane regions, properties of the polyprotein, RNA-RNA interaction sequences, NS3 protease and NS5 polymerase structures and 5\' UTR structure. Using genome sequences, we showed the similarities between these closely- related viruses on several different areas.','2018-05-10 00:00:00','2018-05-10 00:00:00','2018-05-10 00:00:00',0,0,'Palanisamy, Navaneethan, N|Akaberi, Dario, D|Lennerstrand, Johan, J|Lundkvist, Åke, Å','2018-05-17 22:46:19','2018-05-17 22:46:19'),(257,26,29744128,'2053-8855','Fatal case of amoebic encephalitis masquerading as herpes.','Primary amoebic meningoencephalitis (PAM) is a rare, fulminating, hemorrhagic infection of the brain caused by , a thermophilic, free-living amoeba. A 74-year male presented with sudden severe global headache and fever with features of anomic aphasia. Magnetic resonance imaging (MRI) suggested herpes encephalitis and acyclovir (IV) was started but the patient developed altered sensorium, agitation and progressive weakness of lower limbs with gradual truncal weakness. Repeat MRI showed increase in lesion size and edema with confluent blood areas. Dexamethasone showed significant improvement. Ten days after completion of acyclovir, there was recurrence of altered sensorium with seizures. Repeat MRI showed new lesions appearing. Excisional biopsy of brain confirmed . Amphotericin B and miltefosin was started but patient succumbed to his illness after 10 days. This is a first case of PAM in Nepal, involving elderly immune-competent male without environmental exposure to freshwater, mimicking as herpes encephalitis.','2018-05-01 00:00:00','2018-05-03 00:00:00','2018-05-10 00:00:00',0,0,'Baral, Rikesh, R|Vaidya, Binit, B','2018-05-17 22:46:19','2018-05-17 22:46:19'),(258,26,29743771,'0972-5229','Cervical Myelopathy in a Child: A Rare Cause of Hypoventilation Syndrome Presenting with Type 2 Respiratory Failure.','Hypoventilation syndrome leading to Type 2 respiratory failure is not a rare cause of Pediatric Intensive Care Unit admission and mechanical ventilation. Common causes in pediatric population are Guillain-Barre syndrome and various central nervous system disorders such as encephalitis, traumatic brain injury, and drugs. Any injury or disease in the cervical cord can also produce respiratory paralysis causing respiratory failure. Here, we present two cases of mixed cerebral palsy with cervical myelopathy due to compression effect of fractured segments of first and second cervical vertebrae. Both of them presented with Type 2 respiratory failure.','2018-04-01 00:00:00','0000-00-00 00:00:00','2018-05-10 00:00:00',0,0,'Mondal, Alolika, A|Giri, Prabhas Prasun, PP','2018-05-17 22:46:19','2018-05-17 22:46:19'),(259,27,29753309,'1600-0412','Endometriosis and adenomyosis are associated with increased risk of preterm delivery and a small for gestational age child: A systematic review and meta-analysis.','The objective of this systematic review and meta-analysis was to evaluate the risk of preterm delivery and having a small for gestational age child in women with endometriosis and adenomyosis compared to women without these two diseases.Studies on endometriosis or adenomyosis and risk of preterm delivery and/or small for gestational age were included. The systematic search was conducted for all published articles in PubMed and Embase published from 1950 to 2017 using specific search terms. After duplicates were removed, two authors independently reviewed all studies, initially based on title, and subsequently, based on abstract. Studies considered relevant were read in full text by both reviewers to identify if studies met the inclusion criteria RESULTS: The searched resulted 21 studies on a total of 2 517 516 women meeting the inclusion criteria. Women with endometriosis had an increased odds of preterm delivery (OR: 1.47, 95% CI; 1.28-1.69) and small for gestational age (OR 1.26, 95% CI; 1.04-1.549). Compared with endometriosis, adenomyosis implied an even higher odds of both preterm delivery (OR: 3.09, 95% CI; 1.88-5.09) and small for gestational age (OR: 3.23, 95% CI; 1.71-6.09) as well CONCLUSIONS: Women with endometriosis or adenomyosis had a higher odds of preterm delivery and having a child that was small for gestational age compared to women without endometriosis or adenomyosis. The odds of both adverse birth outcomes was highest among women with adenomyosis. The results suggest a closer prenatal monitoring among pregnant women with endometriosis or adenomyosis. This article is protected by copyright. All rights reserved.','2018-05-12 00:00:00','2018-05-12 00:00:00','2018-05-12 00:00:00',0,0,'Bruun, Mette Rahbek, MR|Arendt, Linn Håkonsen, LH|Forman, Axel, A|Ramlau-Hansen, Cecilia Høst, CH','2018-05-17 22:46:19','2018-05-17 22:46:19'),(260,27,29750706,'1538-7151','Immunohistochemical Analysis of Somatostatin Receptors in Endometriosis Tissue Samples: A Retrospective Study.','Three types of endometriosis are described: superficial peritoneal endometriosis (SPE), ovarian endometrioma (OMA), and deep infiltrating endometriosis (DIE). The expression of somatostatin receptors (SSTR1, 2, and 5) in human endometrial tissue and its ectopic form has been previously studied and may be different in each type of endometriosis. The aim of this study was to assess the immunohistochemical expression of SSTR1, 2, and 5 in tissue samples of SPE, OMA, and DIE. We performed a retrospective analysis in the pathology department database. Patients aged <50 yr and diagnosed with endometriosis have been identified and sorted into 3 groups according to their endometriosis type: SPE, OMA, and DIE. For each selected patient, formalin-fixed paraffin-embedded blocks were retrieved in order to make new sections to be incubated with polyclonal rabbit antibodies anti-SSTR1, 2, and 5. Receptor status was considered as positive on the sections when >50% of the cells showed immunostaining. Seventy-six patients were included in the analysis. SSTR1 and 5 were expressed in 95.4% and 77.2% of SPE, respectively, in 95.8% and 83.3% of OMA, respectively, and in 100% and 80% of DIE, respectively. There was no significant difference between SPE, OMA, and DIE with regard to the SSTR1 (P=0.5) and SSTR5 (P=0.9) expression. We observed a significant difference between SPE (9.0%), OMA (16.6%), and DIE (63.3%) with regard to SSTR2 expression (P<0.05). The present study identifies 2 different immunohistochemical patterns of endometriosis lesions with regard to their SSTR expression: SSTR1+/SSTR2-/SSTR5+ for SPE and OMA, and SSTR1+/SSTR2+/SSTR5+ for DIE.','2018-05-10 00:00:00','2018-05-10 00:00:00','2018-05-11 00:00:00',0,0,'Fastrez, Maxime, M|Marchisello, Camille, C|Rassy, Marc, M|Rozenberg, Serge, S|Sirtaine, Nicolas, N','2018-05-17 22:46:19','2018-05-17 22:46:19'),(261,27,29750165,'2314-6141','How Artificial Intelligence Can Improve Our Understanding of the Genes Associated with Endometriosis: Natural Language Processing of the PubMed Database.','Endometriosis is a disease characterized by the development of endometrial tissue outside the uterus, but its cause remains largely unknown. Numerous genes have been studied and proposed to help explain its pathogenesis. However, the large number of these candidate genes has made functional validation through experimental methodologies nearly impossible. Computational methods could provide a useful alternative for prioritizing those most likely to be susceptibility genes. Using artificial intelligence applied to text mining, this study analyzed the genes involved in the pathogenesis, development, and progression of endometriosis. The data extraction by text mining of the endometriosis-related genes in the PubMed database was based on natural language processing, and the data were filtered to remove false positives. Using data from the text mining and gene network information as input for the web-based tool, 15,207 endometriosis-related genes were ranked according to their score in the database. Characterization of the filtered gene set through gene ontology, pathway, and network analysis provided information about the numerous mechanisms hypothesized to be responsible for the establishment of ectopic endometrial tissue, as well as the migration, implantation, survival, and proliferation of ectopic endometrial cells. Finally, the human genome was scanned through various databases using filtered genes as a seed to determine novel genes that might also be involved in the pathogenesis of endometriosis but which have not yet been characterized. These genes could be promising candidates to serve as useful diagnostic biomarkers and therapeutic targets in the management of endometriosis.','2018-05-17 00:00:00','2018-03-20 00:00:00','2018-05-11 00:00:00',0,0,'Bouaziz, J, J|Mashiach, R, R|Cohen, S, S|Kedem, A, A|Baron, A, A|Zajicek, M, M|Feldman, I, I|Seidman, D, D|Soriano, D, D','2018-05-17 22:46:19','2018-05-17 22:46:19'),(262,27,29750135,'2168-8184','Pitfalls of Ovarian Ablative Magnetic Resonance-guided Radiation Therapy for Refractory Endometriosis.','In this case presentation, we describe the challenges of performing magnetic resonance-guided radiation therapy (MRgRT) with plan adaptation in a patient with advanced endometriosis, in whom several prior therapeutic attempts were unsuccessful and extensive pelvic irradiation was regarded as being too toxic. Treatment was delivered in two sessions, first for the seemingly only active right ovary, and at a later stage for the left ovary. Some logistical problems were encountered during the preparation of the first treatment, which were subsequently optimized for the second treatment by using transvaginal ultrasound to determine the optimum time point for simulation and delivery. Using breath-hold gated delivery and plan adaptation, radiation dose to the bowel could be minimized, resulting in good tolerance of treatment. Because of the need to simulate and deliver in a brief optimal time span for visibility of the follicles in the ovaries, a single fraction dose of 8 Gy was used in our patient. Hormonal outcome after her second treatment is still pending. In conclusion, MRgRT with plan adaptation is feasible for the occasional patient with refractory endometriosis. Simulation and delivery needs to be synchronized with the menstrual cycle, ensuring that the Graafian follicles allow the ovaries to be visible on magnetic resonance imaging (MRI). Because the ovaries are only visible on T2-weighted MRI for a very brief period of time, we suggest that it is preferable to use single fraction radiotherapy with a brief interval between simulation imaging and delivery.','2018-03-09 00:00:00','2018-03-09 00:00:00','2018-05-11 00:00:00',0,0,'Tetar, Shyama, S|Bruynzeel, Anna, A|Bohoudi, Omar, O|Nieboer, Theodoor, T|Lagerwaard, Frank, F','2018-05-17 22:46:19','2018-05-17 22:46:19'),(263,27,29746036,'0390-6663','Deep infiltrating endometriosis in young women.','This work aimed to analyze the effect of deep infiltrating endometriosis (DIE) in young women. Twenty-seven cases of patients (below 38-years-old) diagnosed with DIE and admitted to the present hospital from January 2008 to July 2014 were reviewed, and their pre- and postoperative states of illness were summarized. The main preoperative symptoms included dysmenorrhea, chronic pelvic pain, dyspareunia, nodule in rectouterine fossa, and reduced level of fertility. All patients underwent surgery (17 laparoscopies and ten laparotomies). Postoperative pathological explanation confirmed DIE in lesions. DIE significantly affects the health of young women.','2018-05-17 00:00:00','0000-00-00 00:00:00','2018-05-10 00:00:00',0,0,'Zu, M, M|Meng, W, W|Guo, Q Z, QZ|Liu, Z Q, ZQ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(264,27,29747214,'1806-9339','Intestinal Perforation due to Deep Infiltrating Endometriosis during Pregnancy: Case Report.','We report the case of a 33 year-old woman who complained of severe dysmenorrhea since menarche. From 2003 to 2009, she underwent 4 laparoscopies for the treatment of pain associated with endometriosis. After all four interventions, the pain recurred despite the use of gonadotropin-releasing hormone (GnRH) analogues and the insertion of a levonorgestrel intrauterine system (LNG-IUS). Finally, a colonoscopy performed in 2010 revealed rectosigmoid stenosis probably due to extrinsic compression. The patient was advised to get pregnant before treating the intestinal lesion. Spontaneous pregnancy occurred soon after LNG-IUS removal in 2011. In the 33rd week of pregnancy, the patient started to feel severe abdominal pain. No fever or sings of pelviperitonitis were present, but as the pain worsened, a cesarean section was performed, with the delivery of a premature healthy male, and an intestinal rupture was identified. Severe peritoneal infection and sepsis ensued. A colostomy was performed, and the patient recovered after eight days in intensive care. Three months later, the colostomy was closed, and a new LNG-IUS was inserted. The patient then came to be treated by our multidisciplinary endometriosis team. The diagnostic evaluation revealed the presence of intestinal lesions with extrinsic compression of the rectum. She then underwent a laparoscopic excision of the endometriotic lesions, including an ovarian endometrioma, adhesiolysis and segmental colectomy in 2014. She is now fully recovered and planning a new pregnancy. A transvaginal ultrasound (TVUS) performed six months after surgery showed signs of pelvic adhesions, but no endometriotic lesions.','2018-04-01 00:00:00','2018-05-10 00:00:00','2018-05-10 00:00:00',0,0,'Carneiro, Márcia Mendonça, MM|Costa, Luciana Maria Pyramo, LMP|Torres, Maria Das Graças, MDG|Gouvea, Patrícia Salomé, PS|Ávila, Ivete de, I','2018-05-17 22:46:19','2018-05-17 22:46:19'),(265,27,29744578,'1432-1262','Outcomes after rectosigmoid resection for endometriosis: a systematic literature review.','\"Endometriosis\" is defined such as the presence of endometrial glands and stroma outside the uterine cavity. This ectopic condition may develop as deeply infiltrating endometriosis (DIE) when a solid mass is located deeper than 5 mm underneath the peritoneum including the intestinal wall. The ideal surgical treatment is still under search, and treatment may range from simple shaving to rectal resection. The aim of the present systematic review is to report and analyze the postoperative outcomes after rectosigmoid resection for endometriosis.We performed a systematic review according to Meta-analysis of Observational Studies in Epidemiology guidelines. The search was carried out in the PubMed database, using the keywords: \"rectal resection\" AND \"endometriosis\" and \"rectosigmoid resection\" AND \"endometriosis.\" The search revealed 380 papers of which 78 were fully analyzed.Thirty-eight articles published between 1998 and 2017 were included. Three thousand seventy-nine patients (mean age 34.28 ± 2.46) were included. Laparoscopic approach was the most employed (90.3%) followed by the open one (7.9%) and the robotic one (1.7%). Overall operative time was 238.47 ± 66.82. Conversion rate was 2.7%. In more than 80% of cases, associated procedures were performed. Intraoperative complications were observed in 1% of cases. The overall postoperative complications rate was 18.5% (571 patients), and the most frequent complication was recto-vaginal fistula (74 patients, 2.4%). Postoperative mortality rate was 0.03% and mean hospital stay was 8.88 ± 3.71 days.Despite the large and extremely various number of associated procedures, rectosigmoid resection is a feasible and safe technique to treat endometriosis.','2018-05-10 00:00:00','2018-05-10 00:00:00','2018-05-10 00:00:00',0,0,'Balla, Andrea, A|Quaresima, Silvia, S|Subiela, José D, JD|Shalaby, Mostafa, M|Petrella, Giuseppe, G|Sileri, Pierpaolo, P','2018-05-17 22:46:19','2018-05-17 22:46:19'),(266,27,29743986,'1942-0994','The Role of Oxidative Stress and Membrane Transport Systems during Endometriosis: A Fresh Look at a Busy Corner.','Endometriosis is a condition characterized by the presence of endometrial tissue outside the uterine cavity, leading to a chronic inflammatory reaction. It is one of the most widespread gynecological diseases with a 10-15% prevalence in the general female population, rising up to 30-45% in patients with infertility. Although it was first described in 1860, its etiology and pathogenesis are still unclear. It is now accepted that inflammation plays a central role in the development and progression of endometriosis. In particular, it is marked by an inflammatory process associated with the overproduction of an array of inflammatory mediators such as prostaglandins, metalloproteinases, cytokines, and chemokines. In addition, the growth and adhesion of endometrial cells in the peritoneal cavity due to reactive oxygen species (ROS) and free radicals lead to disease onset, its ensuing symptoms-among which pain and infertility. The aim of our review is to evaluate the role of oxidative stress and ROS in the pathogenesis of endometriosis and the efficacy of antioxidant therapy in the treatment and mitigation of its symptoms.','2018-05-17 00:00:00','2018-03-21 00:00:00','2018-05-10 00:00:00',0,0,'Vitale, Salvatore Giovanni, SG|Capriglione, Stella, S|Peterlunger, Isabel, I|La Rosa, Valentina Lucia, VL|Vitagliano, Amerigo, A|Noventa, Marco, M|Valenti, Gaetano, G|Sapia, Fabrizio, F|Angioli, Roberto, R|Lopez, Salvatore, S|Sarpietro, Giuseppe, G|Rossetti, Diego, D|Zito, Gabriella, G','2018-05-17 22:46:19','2018-05-17 22:46:19'),(267,27,29743106,'1472-6874','The FOAM study: is Hysterosalpingo foam sonography (HyFoSy) a cost-effective alternative for hysterosalpingography (HSG) in assessing tubal patency in subfertile women? Study protocol for a randomized controlled trial.','Tubal pathology is a causative factor in 20% of subfertile couples. Traditionally, tubal testing during fertility work-up is performed by hysterosalpingography (HSG). Hysterosalpingo-foam sonography (HyFoSy) is a new technique that is thought to have comparable accuracy as HSG, while it is less expensive and more patient friendly. HyFoSy would be an acceptable alternative for HSG, provided it has similar effectiveness in terms of patient outcomes.We aim to compare the effectiveness and costs of management guided by HyFoSy or by HSG. Consenting women will undergo tubal testing by both HyFoSy and HSG in a randomized order during fertility work-up. The study group will consist of 1163 subfertile women between 18 and 41 years old who are scheduled for tubal patency testing during their fertility work-up. Women with anovulatory cycles not responding to ovulation induction, endometriosis, severe male subfertility or a known contrast (iodine) allergy will be excluded. We anticipate that 7 % (N = 82) of the participants will have discordant test results for HyFoSy and HSG. These participants will be randomly allocated to either a management strategy based on HyFoSy or a management strategy based on HSG, resulting in either a diagnostic laparoscopy with chromopertubation or a strategy that assumes tubal patency (intrauterine insemination or expectant management). The primary outcome is ongoing pregnancy leading to live birth within 12 months after randomization. Secondary outcomes are patient pain scores, time to pregnancy, clinical pregnancy, miscarriage rate, multiple pregnancy rate, preterm birth rate and number of additional treatments. Costs will be estimated by counting resource use and calculating unit prices.This trial will compare the effectiveness and costs of HyFoSy versus HSG in assessing tubal patency in subfertile women.Dutch Trial Register (NTR 4746, http://www.trialregister.nl ). Date of registration: 19 August 2014.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-10 00:00:00',0,0,'van Rijswijk, Joukje, J|van Welie, Nienke, N|Dreyer, Kim, K|van Hooff, Machiel H A, MHA|de Bruin, Jan Peter, JP|Verhoeve, Harold R, HR|Mol, Femke, F|Kleiman-Broeze, Kimiko A, KA|Traas, Maaike A F, MAF|Muijsers, Guido J J M, GJJM|Manger, Arentje P, AP|Gianotten, Judith, J|de Koning, Cornelia H, CH|Koning, Aafke M H, AMH|Bayram, Neriman, N|van der Ham, David P, DP|Vrouenraets, Francisca P J M, FPJM|Kalafusova, Michaela, M|van de Laar, Bob I G, BIG|Kaijser, Jeroen, J|van Oostwaard, Miriam F, MF|Mei','2018-05-17 22:46:19','2018-05-17 22:46:19'),(268,27,29742675,'1873-233X','Risk of Gynecologic Cancer According to the Type of Endometriosis.','To assess the risks of gynecologic cancer according to the type of endometriosis in women with surgically verified endometriosis.This is a population-based study of women with surgically verified endometriosis retrieved from the Finnish Hospital Discharge Register 1987-2012 (N=49,933); the subtypes of ovarian (n=23,210), peritoneal (n=20,187), and deep infiltrating (n=2,372) endometriosis were analyzed separately. Gynecologic cancers were obtained from the Finnish Cancer Registry. The outcome measure was the standardized incidence ratio (95% CI) calculated as the ratio between the observed to the expected number of cancers and defined for each gynecologic cancer and further stratified according to the histology, follow-up time since surgery, and age at follow-up. The follow-up was 838,685 person-years, and the Finnish female population served as the reference.Endometriosis was associated with increased risk of ovarian cancer (standardized incidence ratio 1.76 [95% CI 1.47-2.08]), especially with endometrioid (3.12 [2.15-4.38]) and clear cell (5.17 [3.20-7.89]) histologic type and to a lesser extent with serous type (1.37 [1.02-1.80]). The risk of ovarian cancer was highest among women with ovarian endometriosis and especially for endometrioid (4.72 [2.75-7.56]) and clear cell (10.1 [5.50-16.9]) ovarian cancer, occurring 5-10 years after the index surgery. The overall risk of ovarian cancer was not increased among women with peritoneal and deep infiltrating endometriosis. However, peritoneal endometriosis was associated with a twofold increase in risk of endometrioid histology. The risk of endometrial cancer was not altered in the entire cohort. The standardized incidence ratio for precancerous cervical lesions was 0.81 (0.71-0.92) and for invasive squamous cell carcinoma of the cervical cancer 0.46 (0.20-0.91).The excess risk of ovarian cancer among women with ovarian endometriosis translates into two excess cases per 1,000 patients followed for 10 years. Acknowledging these risks is important when planning long-term management of women with endometriosis.','2018-05-07 00:00:00','2018-05-07 00:00:00','2018-05-09 00:00:00',0,0,'Saavalainen, Liisu, L|Lassus, Heini, H|But, Anna, A|Tiitinen, Aila, A|Härkki, Päivi, P|Gissler, Mika, M|Pukkala, Eero, E|Heikinheimo, Oskari, O','2018-05-17 22:46:19','2018-05-17 22:46:19'),(269,28,29685854,'1437-7780','Distribution of tick-borne diseases in Japan: Past patterns and implications for the future.','The rapid geographical spread of tick-borne diseases (TBDs) worldwide has recently provoked significant concerns amongst public health authorities. Tick-borne pathogens are maintained in enzootic cycles involving ticks and wild animal hosts, with epizootic spread to other mammals, including livestock and humans. Despite the increasing public health concern, current TBD diagnostic tests and treatments are inadequate, and predictive models of future risks posed by TBDs are limited by the heterogeneity of environmental, vector, and host factors, even in neighboring regions. In recent years, infections resulting in severe fever with thrombocytopenia syndrome (SFTS), Japanese spotted fever, and the scrub typhus pathogens have been reported frequently in addition to traditional TBDs in Japan. The Japanese archipelago is extremely elongated from north to south and its climate varies considerably, creating remarkable regional differences in tick species. The importance of continuous surveillance of TBDs has been growing in terms of geopathology - studies dealing with the relationships between geographic factors and the causes of specific diseases - in Japan and neighboring areas among eastern Asian countries, including China and Korea. In this review, we summarize detailed information regarding the history and epidemic status of human TBDs in Japan.','2018-04-20 00:00:00','2018-04-20 00:00:00','2018-04-24 00:00:00',0,0,'Yamaji, Kayoko, K|Aonuma, Hiroka, H|Kanuka, Hirotaka, H','2018-05-17 22:46:19','2018-05-17 22:46:19'),(270,28,29548879,'1878-3511','Development of a rapid and visual nucleotide detection method for a Chinese epidemic strain of Orientia tsutsugamushi based on recombinase polymerase amplification assay and lateral flow test.','Orientia tsutsugamushi is an obligate intracellular pathogen that causes scrub typhus. Diagnosing scrub typhus remains a challenge, and a sensitive, specific, simple, and rapid diagnostic test is still needed.A recombinase polymerase amplification (RPA) assay combined with a lateral flow (LF) test targeting the 56-kDa gene of a Karp-like strain of O. tsutsugamushi was developed and optimized. The detection limits, sensitivity, specificity, and simulative clinical performance were evaluated.Primers and probe were screened to establish the RPA assay, and the reaction conditions were optimized. The detection limit was 10 copies/reaction in detecting plasmid DNA and 12 copies/reaction in detecting genomic DNA. The RPA-LF method could differentiate O. tsutsugamushi from other phylogenetically related bacteria. The sensitivity was 100% and specificity was over 90%, when evaluated using infected animal samples or simulative clinical samples. Furthermore, the method was completed in 20min at 37°C followed by a 3-5min incubation at room temperature for the development of an immunochromatographic strip, and the results could be determined visually.This method is promising for wide-ranging use in basic medical units considering that it requires minimal instruments and infrastructure and is highly time-efficient, sensitive, and specific for diagnosing scrub typhus.','2018-03-13 00:00:00','2018-03-13 00:00:00','2018-05-11 00:00:00',0,0,'Qi, Yong, Y|Yin, Qiong, Q|Shao, Yinxiu, Y|Cao, Min, M|Li, Suqin, S|Chen, Hongxia, H|Shen, Wanpeng, W|Rao, Jixian, J|Li, Jiameng, J|Li, Xiaoling, X|Sun, Yu, Y|Lin, Yu, Y|Deng, Yi, Y|Zeng, Wenwen, W|Zheng, Shulong, S|Liu, Suyun, S|Li, Yuexi, Y','2018-05-17 22:46:19','2018-05-17 22:46:19'),(271,28,29488593,'0717-6341','[Some information regarding the historical development of typhoid fever in Chile].','During the historical development of typhoid fever in Chile, its confusion with other infectious diseases is particularly noteworthy, especially with murine typhus, a problem that was mainly resolved during the 1918 epidemic. The importance of chloramphenicol treatment is also highlighted, which meant an enormous improvement in typhoid/paratyphoid fevers, in combination with public health and health education actions that allowed to almost eliminate these infectious diseases in our country.','2017-10-01 00:00:00','0000-00-00 00:00:00','2018-05-07 00:00:00',0,0,'Laval, Enrique, E','2018-05-17 22:46:19','2018-05-17 22:46:19'),(272,28,29450514,'1538-3598','Our Forefathers\' Knowledge.','No abstract found.','2018-02-13 00:00:00','0000-00-00 00:00:00','2018-03-01 00:00:00',0,0,'','2018-05-17 22:46:19','2018-05-17 22:46:19'),(273,28,29374896,'0254-6450','[Epidemiology of scrub typhus and influencing factors in Yunnan province, 2006-2013].','No abstract found.','2018-01-10 00:00:00','0000-00-00 00:00:00','2018-04-17 00:00:00',0,0,'Sun, Y, Y|Shi, C, C|Li, X L, XL|Fang, L Q, LQ|Cao, W C, WC','2018-05-17 22:46:19','2018-05-17 22:46:19'),(274,28,29309171,'1334-4366','[Red Cross war hospital in Rijeka (1914-1918)].','The article describes how the system of medical care for wounded soldiers in Rijeka during the First World War was organized. In the Austro-Hungarian Empire the hospital care for sick and wounded soldiers, except of a military health care, was under the exclusive jurisdiction of the Red Cross. The Municipal Committee of the Hungarian Red Cross in Rijeka, established in 1881, renewed its previously suspended activity in August 1914, with the task of starting a war hospital for wounded soldiers. For this purpose, the former Hotel for emigrants, a large modern building opened in 1908, was converted. It became the center of hospital care for wounded soldiers in the city. Also, under the supervision of the Red Cross in Rijeka several smaller auxiliary dispensaries were organized. The other city health care facilities and the most of the physicians in Rijeka were included in the care for the wounded. The head of the volunteer nurses of the Red Cross was the president of the Red Cross in Rijeka, Countess Sofia Wickenburg, the wife of the governor and at the same time the president of the Red Cross city branch. The medical staff in Rijeka was particularly noted for its successful and rapid suppression of a typhus epidemic in February and March 1915. The paper is based on research of archival funds in the State Archives in Rijeka and part of the Rijeka and Zagreb press.','2017-12-01 00:00:00','0000-00-00 00:00:00','2018-01-08 00:00:00',0,0,'Manojlović, Zorica, Z','2018-05-17 22:46:19','2018-05-17 22:46:19'),(275,28,29126839,'1873-6254','The epidemic typhus and trench fever are risk for public health due to increased migration in southeast of Turkey.','Pediculus humanus capitis is a small ectoparasitic insect that has lived and feds on human beings for thousands of years. Molecular techniques have been used for Pediculus species identification and evolutionary, phylogenic, and ecological studies. A total of 23 adults of P. h. capitis were collected in Gaziantep, located in southeast Turkey, and DNA was isolated from all P. h. capitis using DNA extraction kit. All DNA samples were screened for investigate of Ricettsia prowazekii, Bartonella quintana and Borrelia recurrentis with real-time polymerase chain reaction. In addition, we investigated genetic variation in DNA samples of Pediculus humanus capitis using the cytochrome oxidase I genetic DNA sequence. We found 4 (17.4%) Ricettsia prowazekii and 3 (13.1%) Bartonella quintana in DNA samples of Pediculus humanus capitis, while we did not find any Bartonella recurrentis in any of the DNA samples. We demonstrated 1.8% genetic variations in DNA samples of Pediculus humanus capitis with Bartonella quintana. The phylogenetic tree based on the cytochrome oxidase I gene revealed that P. h. capitis in southeast Turkey are classified into two clades (clade A, clade B) and Bartonella quintana was found in only clade B. However, we did not find any genetic variations in other DNA samples in this region. The genetic variations may be related to P. h.capitis vector of Bartonella quintana has found in this study. In addition, this study was shown that P. h. capitis do transmit Rickettsia prowazekii and Bartonella quintana to people, epidemic typhus and trench fever may emergence in Gaziantep southeast of Turkey in the future.','2018-02-01 00:00:00','2017-11-07 00:00:00','2018-01-01 00:00:00',0,0,'Ulutasdemir, Nilgün, N|Eroglu, Fadime, F|Tanrıverdi, Mustafa, M|Dagli, Eda Icbay, EI|Koltas, Ismail Soner, IS','2018-05-17 22:46:19','2018-05-17 22:46:19'),(276,28,28810351,'0255-7053','[Schofield and the first spread of western medicine in Shanxi].','After the Second Opium War, the signing of the  and the  legitimized the missionary activities and authorized the missionary the rights to enter inland China for propagating their religious doctrines. In the late 1870s, the\"The extraordinary famine of the \"and the subsequent epidemic provided the opportunity for missionaries to enter Shanxi. Dr. Schofield, sent by the China Inland Mission, arrived in Taiyuan in 1880, set up clinics and practised there. He died of typhus after treating a typhus patient in the summer of 1883. Schofield stayed and practised in Taiyuan for 2 years and 8 months. Later, the China Inland Mission and other missionaries donated to establish a Shanxi\'s first western medicine Hospital to commemorate Schofield. The medical activities of Dr. Schofield enlightened and promoted the Shanxi people\'s understanding of western medicine.','2017-05-28 00:00:00','0000-00-00 00:00:00','2018-04-05 00:00:00',0,0,'Zheng, J Y, JY','2018-05-17 22:46:19','2018-05-17 22:46:19'),(277,29,29747495,'1011-2367','Importance of the knowledge of pathological processes for risk-based inspection in pig slaughterhouses (Study of 2002 to 2016).','The objective of this work was to determine the prevalence of the pathologies that caused the condemnation of pig carcasses in an area of intensive pig farming and Mediterranean climatology and to evaluate their influence in a risk-based inspection procedure for slaughterhouses.A retrospective observational investigation was carried out from 2002 to 2016 into the pathological processes that caused the condemnation of pig carcasses in a slaughterhouse from South-eastern Spain. The seasonal effect on the causes of condemnation carcass was reported. Negative binomial model were used to evaluate the effect of season on the rate of antemortem rejections and post-mortem condemnations. Histopathological examinations were performed to confirm the diagnosis.The risk of antemortem rejections (0.0564%) was significantly greater in summer (RR= 1.57). Autumn was associated with higher rate (RR=1.69) of the total postmortem condemnations (0.1046%). Significally higher rates of pronounced anaemia (0.0111 %) were observed in summer (RR=3.20). The main causes of anaemia were observed gastroesophageal ulcers and haemorrhagic enteropathies. Significantly highest risk of erysipelas (0.0074%) were observed in autumn (RR= 5.485). About other zoonosis, only eight cases (0.0013%) of carcasses were declared unfit due to tuberculosis lesions. Porcine muscular cysticercosis was not detected. Nevertheless, nonspecific causes such as generalized infections and emaciation represented the half of the condemned carcasses (50.90%).The pathologies leading to the condemnation of carcasses in this study can be considered representative of the pathologies that affect the pig population from a region with a high intensive production and Mediterranean climatology because this slaughterhouse receives a lot of animals from many farms of different size from a high intensive pig production zone (Mediterranean region). Increased knowledge of environmental factors that may foment the appearance of the diseases is essential for implementing inspection programs based on risk assessment in pig´s slaughterhouses.','2018-04-25 00:00:00','2018-04-25 00:00:00','2018-05-11 00:00:00',0,0,'Sánchez, Pedro, P|Pallares, Francisco J, FJ|Gómez, Miguel A, MA|Bernabé, Antonio, A|Gómez, Serafin, S|Seva, Juan, J','2018-05-17 22:46:19','2018-05-17 22:46:19'),(278,29,29692940,'2090-6749','Lymph Drainage of Posttraumatic Edema of Lower Limbs.','The present study was aimed at evaluating the use of mechanical and manual lymphatic therapy as a treatment for lymphedema resulting from orthopedic surgery that became painful after an episode of erysipelas.A 70-year-old male patient suffered direct trauma resulting in a compound fracture of the tibia and fibula of the left leg. He was treated with an external fixator for four months followed by plaster cast immobilization for three weeks. He presented with fever and paresthesia in the lower left limb that resulted in an episode of erysipelas, and the patient evolved with painful lymphedema. Treatment using the Godoy and Godoy technique was proposed, including manual and mechanical lymphatic therapy. Water displacement volumetry was used to quantify the leg size reduction.After 10 sessions of therapy, the patient presented a significant reduction in the limb volume and remission of symptoms.The method used may be a promising option for the treatment of posttraumatic edemas with pain.','2018-05-17 00:00:00','2018-03-05 00:00:00','2018-04-29 00:00:00',0,0,'Pereira de Godoy, Ana Carolina, AC|Ocampos Troitino, Rodrigo, R|de Fátima Guerreiro Godoy, Maria, M|Pereira de Godoy, José Maria, JM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(279,29,29690983,'1603-6824','[Shewanella algae bacteriaemia after a vacation in Thailand].','This is a case report of a 56-year-old man, who presented with a very rare cause of erysipelas and bacteraemia caused by the Gram-negative bacillus Shewanella algae. To our knowledge, this is the first reported case of imported Shewanella-infection in Denmark. The patient, who had a history of liver cirrhosis, returned home from a one-month vacation in Thailand. All four blood cultures were positive for S. algae. The patient was treated successfully with IV meropenem and oral ciprofloxacin. S. algae can cause severe local and systemic infection and is not sensitive to standard treatment with penicillin.','2018-04-09 00:00:00','0000-00-00 00:00:00','2018-04-25 00:00:00',0,0,'Petersen, Anja Sofie, AS|Federspiel, Frederik, F|Dungu, Arnold, A|Søborg, Christian, C','2018-05-17 22:46:19','2018-05-17 22:46:19'),(280,29,29683286,'1827-1820','Safety profile of chronic leg ulcer biopsy: a monocentric retrospective series on 866 patients.','Skin biopsy is an important tool for various skin conditions. However, in the case of leg ulcers, some Authors still consider it highly risky and mandatory only in selected cases.To evaluate the rate of adverse events after leg ulcers biopsy in 866 consecutive patients referring to our Wound Care Unit in Bologna from January 2008 to December 2016. Two biopsies were performed (from the border and the centre) by the same dermatologist following a standardized structured protocol.A total of 329 males and 537 females (ratio of 1:1.6), mean age 72 years (range 50-97 years) underwent a skin biopsy. Up to 70% of all analyses revealed a vascular ulcer (614 patients; 70.9%) while other conditions (252 patients; 29.1%) included inflammatory dermatitis, vasculitis, ulcerated neoplasms, infective lesions, post-traumatic and pressure sores, erosive pustular, dermatitis and pyoderma gangrenosum. Adverse events occurred in 322 patients (38.43% of all biopsies), mostly a dull pain (320 patients, 37%) that resolved within some hours. Five patients with vasculitis (0.6%) experienced a worsening of the lesion and another five patients (0.6%) developed erysipelas. Only two patients, on double antithrombotic therapy (0.23%), had intraoperative bleeding. No allergic reactions were detected.According to our experience, skin biopsy should be mandatory for non healing wounds. It is safe and involves only a low rate of adverse events.','2018-04-19 00:00:00','2018-04-19 00:00:00','2018-04-23 00:00:00',0,0,'Baraldi, Carlotta, C|Sacchelli, Lidia, L|Dika, Emi, E|Lambertini, Martina, M|Misciali, Cosimo, C|Bianchi, Tommaso, T|Fanti, Pier A, PA','2018-05-17 22:46:19','2018-05-17 22:46:19'),(281,29,29674005,'2210-2612','Breast cancer cutaneous metastases mimicking Papilloma Cutis Lymphostatica. Biopsy to avoid pitfalls.','Secondary lymphedema is the most frequent long-term complication of axillary lymphadenectomy. It can result in complication as erysipelas, warts, Papilloma Cutis Lymphostatica (PCL), or angiosarcomas. Moreover, in women affected by breast cancer an accurate differential diagnosis among these conditions or complication related to radiation dermatitis or cutaneous metastasis is essential.We report the case of a 60-year-old postmenopausal Caucasian woman affected by secondary lymphedema following complete mastectomy for breast cancer. The patient after surgery was treated with radiotherapy, chemotherapy and hormone therapy, developing a lympedema of left arm after few months. These lesions had clinical typical features of PCL, but histopathological analysis revealed dermo-hypodermic metastasis of breast carcinoma.The presence of skin lesions in secondary lymphedema after oncological lymphadenectomy requires an accurate differential diagnosis. In fact, these lesions can emulate degenerative or infective skin diseases; anyway, in patients affected by secondary lymphedema other less common conditions - as PLC, nodular-type lichen myxedematosus or Gottron\'s carcinoid papillomatosis - should be taken into account.Our case reports the possibility that metastases of breast cancer might also mimic these conditions.','2018-04-10 00:00:00','2018-04-10 00:00:00','2018-04-20 00:00:00',0,0,'Giudice, Giuseppe, G|Vestita, Michelangelo, M|Robusto, Fabio, F|Annoscia, Paolo, P|Ciancio, Francesco, F|Nacchiero, Eleonora, E','2018-05-17 22:46:19','2018-05-17 22:46:19'),(282,29,29655289,'1346-8138','Dacryocystitis mimicking erysipelas due to a giant dacryolith.','No abstract found.','2018-04-14 00:00:00','2018-04-14 00:00:00','2018-04-14 00:00:00',0,0,'Hashimoto, Takashi, T|Namiki, Takeshi, T|Wakasa, Takuya, T|Shimokata, Miho, M|Yokozeki, Hiroo, H','2018-05-17 22:46:19','2018-05-17 22:46:19'),(283,29,29589637,'1581-2979','Trends in the epidemiology of erysipelas in Slovenia.','Erysipelas is a common infection of the skin and subcutaneous tissue. Despite the relative frequency of erysipelas, data on its basic epidemiological characteristics are scant. This study describes the trends in erysipelas epidemiology in Slovenia.Data on notified erysipelas cases from 2000 to 2016 were extracted from the electronic database of reportable communicable diseases and analyzed.There were 36,254 notified cases during the observed time period of 17 years. The yearly age-standardized incidence rate of erysipelas increased from 71.5 per 100,000 in 2000 to 111.3 per 100,000 in 2016, with the main rise in the ≥ 75 age group. Erysipelas was more common in women, but the sex-related difference lessened in the period observed. The hospitalization rate declined. Erysipelas was significantly more frequent in the warmer period of the year. The correlation between erysipelas incidence and average monthly temperature was stronger in the ≤ 64 age group than in the ≥ 65 age group.Retrospective observational data confirmed a rising trend in erysipelas cases, especially among the elderly. Aging of the population will continue to increase the burden of the disease, unless health promotion and prevention lowers the prevalence of the risk factors.','0000-00-00 00:00:00','0000-00-00 00:00:00','2018-03-30 00:00:00',0,0,'Sočan, Katarina, K|Sočan, Maja, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(284,29,29578137,'0366-6999','Bilateral Lower Limb and Abdominal Elephantiasis Due to Erysipelas.','No abstract found.','2018-04-05 00:00:00','0000-00-00 00:00:00','2018-04-15 00:00:00',0,0,'Yang, Yan-Ping, YP|Huang, Wan-Xue, WX|Zhong, Wei-Xi, WX|Fu, Yi-Mu, YM|He, Ping-An, PA|Zhao, Gang, G|Feng, Qi-Ming, QM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(285,29,29566923,'1879-1131','Cutaneous infections in the mature patient.','Dermatologists must be familiar with the peculiarities of the micro-organisms that may affect the elderly, in order to optimize the diagnosis and treatment of infections, which may affect their skin, especially because the world population is rapidly aging. It is estimated that there will be 434 million individuals over 80 years of age in 2050. Since the elderly population is rapidly increasing and their infections are usually more severe and different from those observed in younger adults, it leads to a statistical increase of the rates regarding hospitalization and mortality caused by infectious diseases among people over 85 years. Other health issues may be involved in the older population. These include nutritional alterations, as malnutrition or obesity, which can aggravate the infections. Also the usual signs and symptoms of infection are subtle or uncharacteristic in elderly patients, and frequently, they are unable to report their symptoms, which can delay the diagnosis. Among the many infections that may affect the elderly we reviewed the most frequent and those that are different in this age group, as herpes zoster, cytomegalovirus, herpes simplex, bacterial skin infections, erysipelas, celullitis, impetigo, folliculitis, furunculosis and carbunculosis, secondary infections, intertrigo (body folds), fungal infection, and scabies.','2018-01-01 00:00:00','2017-10-03 00:00:00','2018-03-23 00:00:00',0,0,'Castro, Maria Cristina Ribeiro de, MCR|Ramos-E-Silva, Marcia, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(286,29,29527848,'1565-1088','Corticosteroid Therapy in Combination with Antibiotics for Erysipelas.','Erysipelas, an acute infection of the dermal and subcutaneous tissue, is normally treated with antibiotics. Previous data indicated that treatment with prednisone in combination with antibiotics results in significant acceleration of the healing phase.To investigate the effectiveness of corticosteroids combined with antibiotics for the treatment of erysipelas.A retrospective study was conducted on hospitalized patients diagnosed with erysipelas between 2004 and 2011 at the Department of Dermatology at Sheba Medical Center, Israel. Data included epidemiology, medical background, and course of the disease as documented at admission and during hospitalization.Data were collected on 173 patients (66% males) who were divided into two groups: a control group treated with antibiotics only (97 patients) and a study group treated with antibiotics and prednisone (76 patients). The study group presented with a more severe form of erysipelas (bullous) and those patients were hospitalized for a longer period (8.5 vs. 7 days). Nevertheless, the study group exhibited a 71% clinical improvement shortly after being treated with prednisone, without significant side effects. Short-term follow-up revealed more edema in the study group; however, long-term follow-up revealed a higher incidence of erythema and recurrence of erysipelas in the control group. The return to full function was faster in the study group than in the control group.Combining prednisone with antibiotics for the treatment of erysipelas should be considered, especially in severe cases. In addition, a prospective double-blind study should be conducted to verify these conclusions.','2018-03-01 00:00:00','0000-00-00 00:00:00','2018-03-12 00:00:00',0,0,'Solomon, Michal, M|Barzilai, Aviv, A|Elphasy, Hila, H|Trau, Henri, H|Baum, Sharon, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(287,30,29732450,'2470-1343','Mutations Alter RNA-Mediated Conversion of Human Prions.','Prion diseases are connected with self-replication and self-propagation of misfolded proteins. The rate-limiting factor is the formation of the initial seed. We have recently studied the early stages in the conversion between functional PrP and the infectious scrapie PrP form, triggered by the binding of RNA. Here, we study how this process is modulated by the prion sequence. We focus on residues 129 and 178, which are connected to the hereditary neurodegenerative disease fatal familial insomnia.','2018-04-30 00:00:00','2018-04-09 00:00:00','2018-05-11 00:00:00',0,0,'Alred, Erik J, EJ|Lodangco, Izra, I|Gallaher, Jennifer, J|Hansmann, Ulrich H E, UHE','2018-05-17 22:46:19','2018-05-17 22:46:19'),(288,30,29718878,'1536-5964','Fatal familial insomnia presenting with agrypnia excitata and very low atonia index level: A case report and literature review.','Fatal familial insomnia (FFI) is a human prion disease that is characterized by sleep-wake cycle deterioration, loss of slow-wave sleep, and motor overactivation over the daily 24-hour period.Here, we report the case of a 57-year-old man who had an irregular sleep-wake cycle and exhibited frequent movements and vocalizations during sleep.Video-polysomnography showed disrupted sleep structure, rapid alternation between sleep stages, and an absence of sleep spindles and slow-wave sleep. Moreover, body movements persisted throughout the entire sleep period, including rapid eye movement (REM) sleep. The atonia index was very low (<0.025) during REM sleep. Genetic testing revealed a prion protein gene mutation at codon 178, and the patient was diagnosed with FFI.We tried to treat with amantadine, doxycycline, and immunotherapies, but the disease progressed.Sleep disturbance is the most frequent and essential symptom of FFI.FFI is difficult to diagnose due to the low sensitivity of diagnostic tools. Diagnoses can be further supported by better knowledge of typical polysomnographic findings.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-05-09 00:00:00',0,0,'Yang, Tae-Won, TW|Park, Byeongsu, B|Kim, Keun Tae, KT|Jun, Jin-Sun, JS|Kim, Young-Soo, YS|Lee, Soon-Tae, ST|Jung, Keun-Hwa, KH|Chu, Kon, K|Lee, Sang Kun, SK|Jung, Ki-Young, KY','2018-05-17 22:46:19','2018-05-17 22:46:19'),(289,30,29709939,'1349-7235','A Case of Fatal Familial Insomnia Initially Developing Parkinsonism Mimicking Dementia with Lewy Bodies.','We report a rare case of fatal familial insomnia in a 58-year-old man who initially developed parkinsonism, secondary dementia, and visual hallucinations that were suspected to be due to dementia with Lewy bodies. We evaluated the function of the striatum via dopamine transporter SPECT using I-ioflupane and found marked presynaptic dopamine dysfunction in the bilateral striatum. This is the first reported case in which the initial symptom of fatal familial insomnia was parkinsonism and in which the dopamine transporter function was evaluated by DAT SPECT.','2018-04-27 00:00:00','2018-04-27 00:00:00','2018-04-30 00:00:00',0,0,'Fukuoka, Takuya, T|Nakazato, Yoshihiko, Y|Yamamoto, Masaomi, M|Miyake, Akifumi, A|Mitsufuji, Takashi, T|Yamamoto, Toshimasa, T','2018-05-17 22:46:19','2018-05-17 22:46:19'),(290,30,29676187,'1933-690X','Decrease of RyR2 in the prion infected cell line and in the brains of the scrapie infected mice models and the patients of human prion diseases.','The levels of ryanodine receptors (RyRs) are usually increased in the brains of human Alzheimer disease (AD) and AD animal models. To evaluate the underlying alteration of brain RyRs in prion disease, scrapie infected cell line SMB-S15 and its infected mice were tested. RyR2 specific Western blots revealed markedly decreased RyR2 levels both in the cells and in the brains of infected mice. Assays of the brain samples of other scrapie (agents 139A and ME7) infected mice collected at different time-points during incubation period showed time-dependent decreases of RyR2. Immunofluorescent assays (IFA) verified that the expression of RyR2 locates predominantly in cytoplasm of SMB cells and overlapped with the neurons in the brain slices of mice. Furthermore, significant down-regulation of RyR2 was also detected in the postmortem cortical brains of the patients of various types of human prion diseases, including sporadic Creutzfeldt-Jakob disease (sCJD), fatal familial insomnia (FFI) and G114V-genetic CJD. Our data here propose the evidences of remarkably decreased brain RyR2 at terminal stages of both human prion diseases and prion infected rodent models. It also highlights that the therapeutic strategy with antagonist of RyRs in AD may not be suitable for prion disease.','2018-04-20 00:00:00','2018-04-20 00:00:00','2018-04-20 00:00:00',0,0,'Shi, Qi, Q|Li, Jian-Le, JL|Ma, Yue, Y|Gao, Li-Ping, LP|Xiao, Kang, K|Wang, Jing, J|Zhou, Wei, W|Chen, Cao, C|Guo, Yan-Jun, YJ|Dong, Xiao-Ping, XP','2018-05-17 22:46:19','2018-05-17 22:46:19'),(291,30,29569252,'1600-0404','The clinical features in Chinese patients with PRNP D178N mutation.','Fatal familial insomnia (FFI) is an autosomal dominant disease due to the D178N mutation of PRNP gene coupling with homozygous methionine (Met) at codon 129. It is generally considered that D178N mutation cases with 129 M/M homozygotes present as FFI, and 129 V/V as genetic CJD. However, the frequency of 129 Met alleles in Chinese population is much higher than that in Caucasians. This study aims to investigate the clinical features and genetic characteristics of Chinese D178N mutants in this genetic context.We reviewed the clinical and genetic features of seven D178N patients. The clinical data, genetic data, electroencephalogram (EEG), brain magnetic resonance imaging (MRI), polysomnography (PSG), CSF 14-3-3 protein examinations of the seven patients were analyzed.The genotypes at codon 129 were all M/M. Four of the seven cases reported positive family history. Four patients were more likely the CJD phenotype and three were FFI phenotype according to the core clinical features. No major differences were found on the EEG, CSF 14-3-3 protein, and PSG presentations between this study and western studies. Novel neuroimaging findings were two patients had typical neuroimaging abnormalities of CJD and frontotemporal dementia, respectively.Unlike the western populations, the diverse phenotypical presentations of D178N mutants were not simply determined by the 129 genotypes in Chinese. The underlying modifying factors for phenotypical variations warrant further investigations. For those with atypical clinical and imaging features, genetic testing was important for final diagnosis.','2018-03-22 00:00:00','2018-03-22 00:00:00','2018-03-23 00:00:00',0,0,'Chen, S, S|He, S, S|Shi, X-H, XH|Shen, X-J, XJ|Liang, K-K, KK|Zhao, J-H, JH|Yan, B-C, BC|Zhang, J-W, JW','2018-05-17 22:46:19','2018-05-17 22:46:19'),(292,30,29478593,'0072-9752','Prion disease.','Genetic prion diseases (gPrDs) are caused by autosomal-dominant mutations in the prion protein gene (PRNP). Although the first PRNP mutations identified, and most since, are PRNP missense, octapeptide repeat insertions, deletion and nonsense mutations have now also been shown to cause gPrD. Based on clinicopathologic features of familial disease, gPrDs historically have been classified into three forms: familial Jakob-Creutzfeldt disease, Gerstmann-Sträussler-Scheinker disease, and fatal familial insomnia. This classification, however, occurred prior to the identification of PRNP, and although these forms are still recognized, classification now is somewhat more complex. Clinical manifestations, and even pathology, are known to be more heterogeneous and varied than the historic three phenotypic classifications. Most gPrDs either present rapidly with progression of dementia, ataxia, myoclonus, and other motor features leading to death in few months or present more slowly, declining over a few years with mild cognitive impairment, ataxia, or parkinsonism and later dementia; a few very rare mutations, however, present over years to decades with neuropsychiatric disorders and systemic symptoms (gastrointestinal disorders and neuropathy). In this chapter, we review the broad phenotypic spectrum of PRNP mutations causing gPrDs.','2018-05-17 00:00:00','0000-00-00 00:00:00','2018-02-26 00:00:00',0,0,'Takada, Leonel T, LT|Kim, Mee-Ohk, MO|Metcalf, Stacy, S|Gala, Ignacio Illán, II|Geschwind, Michael D, MD','2018-05-17 22:46:19','2018-05-17 22:46:19'),(293,30,29357384,'1553-7374','Regional and subtype-dependent miRNA signatures in sporadic Creutzfeldt-Jakob disease are accompanied by alterations in miRNA silencing machinery and biogenesis.','Increasing evidence indicates that microRNAs (miRNAs) are contributing factors to neurodegeneration. Alterations in miRNA signatures have been reported in several neurodegenerative dementias, but data in prion diseases are restricted to ex vivo and animal models. The present study identified significant miRNA expression pattern alterations in the frontal cortex and cerebellum of sporadic Creutzfeldt-Jakob disease (sCJD) patients. These changes display a highly regional and disease subtype-dependent regulation that correlates with brain pathology. We demonstrate that selected miRNAs are enriched in sCJD isolated Argonaute(Ago)-binding complexes in disease, indicating their incorporation into RNA-induced silencing complexes, and further suggesting their contribution to disease-associated gene expression changes. Alterations in the miRNA-mRNA regulatory machinery and perturbed levels of miRNA biogenesis key components in sCJD brain samples reported here further implicate miRNAs in sCJD gene expression (de)regulation. We also show that a subset of sCJD-altered miRNAs are commonly changed in Alzheimer\'s disease, dementia with Lewy bodies and fatal familial insomnia, suggesting potential common mechanisms underlying these neurodegenerative processes. Additionally, we report no correlation between brain and cerebrospinal fluid (CSF) miRNA-profiles in sCJD, indicating that CSF-miRNA profiles do not faithfully mirror miRNA alterations detected in brain tissue of human prion diseases. Finally, utilizing a sCJD MM1 mouse model, we analyzed the miRNA deregulation patterns observed in sCJD in a temporal manner. While fourteen sCJD-related miRNAs were validated at clinical stages, only two of those were changed at early symptomatic phase, suggesting that the miRNAs altered in sCJD may contribute to later pathogenic processes. Altogether, the present work identifies alterations in the miRNA network, biogenesis and miRNA-mRNA silencing machinery in sCJD, whereby contributions to disease mechanisms deserve further investigation.','2018-01-01 00:00:00','2018-01-22 00:00:00','2018-02-18 00:00:00',0,0,'Llorens, Franc, F|Thüne, Katrin, K|Martí, Eulàlia, E|Kanata, Eirini, E|Dafou, Dimitra, D|Díaz-Lucena, Daniela, D|Vivancos, Ana, A|Shomroni, Orr, O|Zafar, Saima, S|Schmitz, Matthias, M|Michel, Uwe, U|Fernández-Borges, Natalia, N|Andréoletti, Olivier, O|Del Río, José Antonio, JA|Díez, Juana, J|Fischer, Andre, A|Bonn, Stefan, S|Sklaviadis, Theodoros, T|Torres, Juan Maria, JM|Ferrer, Isidre, I|Zerr, Inga, I','2018-05-17 22:46:19','2018-05-17 22:46:19'),(294,30,29258312,'1948-7193','Genetic and Rare Disease of the CNS. Part I: Fatal Familial Insomnia (FFI).','No abstract found.','2017-12-20 00:00:00','0000-00-00 00:00:00','2018-02-26 00:00:00',0,0,'Lindsley, Craig W, CW','2018-05-17 22:46:19','2018-05-17 22:46:19'),(295,31,29766482,'0303-7339','[Fragile X syndrome: new therapeutic strategies].','Fragile X syndrome (fxs) is the most common hereditary cause of intellectual disability and autism spectrum disorders. Targeted treatment is currently lacking. In the past decades an enormous amount of knowledge has been obtained concerning the involved molecular pathways, introducing potential targets for disease modifying therapy.<br/> AIM: To present an overview of the development of targeted treatment for fxs.<br/> METHOD: Several important publications were collected and indexed.<br/> RESULTS: While preclinical animal model studies with targeted interventions are promising, the translation to the clinic has been disappointing.<br/> CONCLUSION: Targeted treatment for fxs is necessary and could be applied in other causes of autism spectrum disorders and intellectual disability. Factors relating to translation, study design and outcome measures are possibly contributing to the disappointing results. The clustering of patient care in a center of expertise is required to clinically implement future therapeutic strategies and to facilitate research. In addition, this improves patient care, one example being the recent medical guideline for children with fxs.','2018-05-17 00:00:00','0000-00-00 00:00:00','2018-05-16 00:00:00',0,0,'Zeidler, S, S|Dierckx, B, B|Lubbers, K, K|van Eeghen, A M, AM|Lincke, C R, CR|Kievit, J A, JA|Willemsen, R, R|Rietman, A, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(296,31,29760651,'1662-5099','Human DNA Helicase B as a Candidate for Unwinding Secondary CGG Repeat Structures at the  Gene.','The fragile X syndrome (FXS) is caused by a CGG repeat expansion at the  () gene.  alleles with more than 200 CGG repeats bear chromosomal fragility when cells experience folate deficiency. CGG repeats were reported to be able to form secondary structures, such as hairpins, . When such secondary structures are formed, repeats can lead to replication fork stalling even in the absence of any additional perturbation. Indeed, it was recently shown that the replication forks stall at the endogenous  locus in unaffected and FXS cells, suggesting the formation of secondary repeat structures at the  gene . If not dealt with properly replication fork stalling can lead to polymerase slippage and repeat expansion as well as fragile site expression. Despite the presence of repeat structures at the  locus, chromosomal fragility is only expressed under replicative stress suggesting the existence of potential molecular mechanisms that help the replication fork progress through these repeat regions. DNA helicases are known to aid replication forks progress through repetitive DNA sequences. Yet, the identity of the DNA helicase(s) responsible for unwinding the CGG repeats at  locus is not known. We found that the human DNA helicase B (HDHB) may provide an answer for this question. We used chromatin-immunoprecipitation assay to study the  region and common fragile sites (CFS), and asked whether HDHB localizes at replication forks stalled at repetitive regions even in unperturbed cells. HDHB was strongly enriched in S-phase at the repetitive DNA at CFS and  gene but not in the flanking regions. Taken together, these results suggest that HDHB functions in preventing or repairing stalled replication forks that arise in repeat-rich regions even in unperturbed cells. Furthermore, we discuss the importance and potential role of HDHB and other helicases in the resolution of secondary CGG repeat structures.','2018-05-17 00:00:00','2018-04-30 00:00:00','2018-05-15 00:00:00',0,0,'Guler, Gulfem D, GD|Rosenwaks, Zev, Z|Gerhardt, Jeannine, J','2018-05-17 22:46:19','2018-05-17 22:46:19'),(297,31,29747568,'1471-2350','Classical fragile-X phenotype in a female infant disclosed by comprehensive genomic studies.','We describe a female infant with Fragile-X syndrome, with a fully expanded FMR1 allele and preferential inactivation of the homologous X-chromosome carrying a de novo deletion. This unusual and rare case demonstrates the importance of a detailed genomic approach, the absence of which could be misguiding, and calls for reflection on the current clinical and diagnostic workup for developmental disabilities.We present a female infant, referred for genetic testing due to psychomotor developmental delay without specific dysmorphic features or relevant family history. FMR1 mutation screening revealed a methylated full mutation and a normal but inactive FMR1 allele, which led to further investigation. Complete skewing of X-chromosome inactivation towards the paternally-inherited normal-sized FMR1 allele was found. No pathogenic variants were identified in the XIST promoter. Microarray analysis revealed a 439 kb deletion at Xq28, in a region known to be associated with extreme skewing of X-chromosome inactivation.Overall results enable us to conclude that the developmental delay is the cumulative result of a methylated FMR1 full mutation on the active X-chromosome and the inactivation of the other homologue carrying the de novo 439 kb deletion. Our findings should be taken into consideration in future guidelines for the diagnostic workup on the diagnosis of intellectual disabilities, particularly in female infant cases.','2018-05-10 00:00:00','2018-05-10 00:00:00','2018-05-15 00:00:00',0,0,'Jorge, Paula, P|Garcia, Elsa, E|Gonçalves, Ana, A|Marques, Isabel, I|Maia, Nuno, N|Rodrigues, Bárbara, B|Santos, Helena, H|Fonseca, Jacinta, J|Soares, Gabriela, G|Correia, Cecília, C|Reis-Lima, Margarida, M|Cirigliano, Vincenzo, V|Santos, Rosário, R','2018-05-17 22:46:19','2018-05-17 22:46:19'),(298,31,29730505,'1873-3379','A comparison of functional academic and daily living skills in males with fragile X syndrome with and without autism.','Adaptive behaviors, such as functional academic and daily living skills, are critical for independence in adults with intellectual and developmental disabilities. However, little is known about these skills in fragile X syndrome (FXS), the most common form of inherited intellectual disability.The purposes of this study were to describe the functional academic and daily living skills of males diagnosed with FXS across different age groups and compare skill attainment by autism status and other common co-occurring conditions.We used survey methods to assess parent-reported functional academic and daily living skills in 534 males with FXS. Functional academic skills included time and schedules, money, math, reading, and writing skills. Daily living skills included hygiene, cooking, laundry and housekeeping, transportation, and safety skills.Analyses examined functional academic and daily living skills in a cross-sectional sample of males between ages 5 and 67. Differences in skill attainment were found by child age, co-morbid autism status, total number of co-occurring conditions, and respondent education. Functional academic and daily living skills were predictive of community employment and independent living.These data provide important information on the mastery of both foundational and more complex adaptive skills in males with FXS. Both functional academic and daily living skills were predictive of measures of independence above and beyond other child and family characteristics. These findings point to the need to focus interventions to support the attainment of independence in males with FXS.','2018-05-03 00:00:00','2018-05-03 00:00:00','2018-05-16 00:00:00',0,0,'Raspa, Melissa, M|Franco, Vitor, V|Bishop, Ellen, E|Wheeler, Anne C, AC|Wylie, Amanda, A|Bailey, Donald B, DB','2018-05-17 22:46:19','2018-05-17 22:46:19'),(299,31,29722449,'1365-2788','Overactivity, impulsivity and repetitive behaviour in males with fragile X syndrome: contrasting developmental trajectories in those with and without elevated autism symptoms.','Hyperactivity and repetitive behaviour are characteristic features of fragile X syndrome (FXS). However, little is known about the influence of autism symptomatology on how these characteristics develop over time. We investigate the profiles and developmental trajectories of overactivity, impulsivity and repetitive behaviour, in males with FXS over three time points spanning 8 years.Participants formed two subgroups, those who displayed elevated symptoms of autism at Time 1 (n = 37; M  = 16.32; age range = 6.61-43.51) and those who did not (n = 32; M  = 8.43; age range = 8.94-47.49).Participants without elevated symptoms of autism showed a reduction in impulsivity and repetitive questioning over time, whereas those with elevated symptoms of autism did not. Differences between the two subgroups in several topographies of repetitive behaviour emerged at Time 3 only.These results further understanding of the relationship between autistic phenomenology and behavioural characteristics in FXS.','2018-05-03 00:00:00','2018-05-03 00:00:00','2018-05-03 00:00:00',0,0,'Crawford, H, H|Moss, J, J|Stinton, C, C|Singla, G, G|Oliver, C, C','2018-05-17 22:46:19','2018-05-17 22:46:19'),(300,31,29715444,'1872-6240','Dynamic duo - FMRP and TDP-43: Regulating common targets, causing different diseases.','RNA binding proteins play essential roles during development and aging, and are also involved in disease pathomechanisms. RNA sequencing and omics analyses have provided a window into systems level alterations in neurological disease, and have identified RNA processing defects among notable disease mechanisms. This review focuses on two seemingly distinct neurological disorders, the RNA binding proteins they are linked to, and their newly discovered functional relationship. When deficient, Fragile X Mental Retardation Protein (FMRP) causes developmental deficits and autistic behaviors while TAR-DNA Binding Protein (TDP-43) dysregulation causes age dependent neuronal degeneration. Recent findings that FMRP and TDP-43 associate in ribonuclear protein particles and share mRNA targets in neurons highlight the critical importance of translation regulation in synaptic plasticity and provide new perspectives on neuronal vulnerability during lifespan.','2018-04-30 00:00:00','2018-04-30 00:00:00','2018-05-07 00:00:00',0,0,'Ferro, Diana, D|Yao, Stephen, S|Zarnescu, Daniela C, DC','2018-05-17 22:46:19','2018-05-17 22:46:19'),(301,31,29713264,'1662-5099','Modeling Fragile X Syndrome in .','Intellectual disability (ID) and autism are hallmarks of Fragile X Syndrome (FXS), a hereditary neurodevelopmental disorder. The gene responsible for FXS is Fragile X Mental Retardation gene 1 () encoding the Fragile X Mental Retardation Protein (FMRP), an RNA-binding protein involved in RNA metabolism and modulating the expression level of many targets. Most cases of FXS are caused by silencing of  due to CGG expansions in the 5\'-UTR of the gene. Humans also carry the FXR1 and FXR2 paralogs of FMR1 while flies have only one  gene, here called , sharing the same level of sequence homology with all three human genes, but functionally most similar to . This enables a much easier approach for  genetic studies.  has been widely used to investigate  functions at genetic, cellular, and molecular levels since  mutants have many phenotypes in common with the wide spectrum of  functions that underlay the disease. In this review, we present very recent  studies investigating FMRP functions at genetic, cellular, molecular, and electrophysiological levels in addition to research on pharmacological treatments in the fly model. These studies have the potential to aid the discovery of pharmacological therapies for FXS.','2018-05-17 00:00:00','2018-04-16 00:00:00','2018-05-03 00:00:00',0,0,'Drozd, Małgorzata, M|Bardoni, Barbara, B|Capovilla, Maria, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(302,31,29704597,'1872-7549','Modelling fragile X syndrome in the laboratory setting: A behavioral perspective.','Fragile X syndrome is the most common form of inherited mental retardation and the most frequent monogenic cause of syndromic autism spectrum disorders. The syndrome is caused by the loss of the Fragile X Mental Retardation Protein (FMRP), a key RNA-binding protein involved in synaptic plasticity and neuronal morphology. Patients show intellectual disability, social deficits, repetitive behaviors and impairments in social communication. The aim of this review is to outline the importance of behavioral phenotyping of animal models of FXS from a developmental perspective, by showing how the behavioral characteristics of FXS at the clinical level can be translated into effective, developmentally-specific and clinically meaningful behavioral readouts in the laboratory setting. After introducing the behavioral features, diagnostic criteria and off-label pharmacotherapy of FXS, we outline how FXS-relevant behavioral features can be modelled in laboratory animals in the course of development: we review the progress to date, discuss how behavioral phenotyping in animal models of FXS is essential to identify potential treatments, and discuss caveats and future directions in this research field.','2018-04-25 00:00:00','2018-04-25 00:00:00','2018-05-04 00:00:00',0,0,'Melancia, Francesca, F|Trezza, Viviana, V','2018-05-17 22:46:19','2018-05-17 22:46:19'),(303,31,29703945,'1476-5578','Critical period inhibition of NKCC1 rectifies synapse plasticity in the somatosensory cortex and restores adult tactile response maps in fragile X mice.','Sensory perturbations in visual, auditory and tactile perception are core problems in fragile X syndrome (FXS). In the Fmr1 knockout mouse model of FXS, the maturation of synapses and circuits during critical period (CP) development in the somatosensory cortex is delayed, but it is unclear how this contributes to altered tactile sensory processing in the mature CNS. Here we demonstrate that inhibiting the juvenile chloride co-transporter NKCC1, which contributes to altered chloride homeostasis in developing cortical neurons of FXS mice, rectifies the chloride imbalance in layer IV somatosensory cortex neurons and corrects the development of thalamocortical excitatory synapses during the CP. Comparison of protein abundances demonstrated that NKCC1 inhibition during early development caused a broad remodeling of the proteome in the barrel cortex. In addition, the abnormally large size of whisker-evoked cortical maps in adult Fmr1 knockout mice was corrected by rectifying the chloride imbalance during the early CP. These data demonstrate that correcting the disrupted driving force through GABA receptors during the CP in cortical neurons restores their synaptic development, has an unexpectedly large effect on differentially expressed proteins, and produces a long-lasting correction of somatosensory circuit function in FXS mice.','2018-04-27 00:00:00','2018-04-27 00:00:00','2018-05-03 00:00:00',0,0,'He, Qionger, Q|Arroyo, Erica D, ED|Smukowski, Samuel N, SN|Xu, Jian, J|Piochon, Claire, C|Savas, Jeffrey N, JN|Portera-Cailliau, Carlos, C|Contractor, Anis, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(304,31,29693293,'1365-2788','Examining the influence of social-environmental variables on self-injurious behaviour in adolescent boys with fragile X syndrome.','Individuals with fragile X syndrome (FXS), the most common known inherited form of intellectual disability, are at increased risk for showing specific forms of self-injurious behaviour (SIB) such as hand biting and head hitting, suggesting that biological factors associated with the syndrome confers increased risk for SIB. Few studies, however, have examined the extent to which social-environmental variables can influence the occurrence of these behaviours in this population.Twenty-two adolescent boys with FXS, aged 10 to 18 years were systematically exposed to seven environmental conditions in functional analyses of SIB conducted over 2 days at our research centre.Fourteen (63.6%) boys with FXS engaged in SIB during the functional analyses. Ten (45.5%) boys engaged in SIB that was maintained by social-environmental variables, that is, gaining access to attention/tangibles and/or escaping from social interaction, task demands and/or transition demands. For two boys, SIB was undifferentiated across conditions, and for two boys, SIB appeared to be maintained by automatic reinforcement.Social-environmental variables appeared to maintain SIB in a significant proportion of boys with FXS. Given that pharmacological treatments for SIB have limited efficacy in this population, the potential role of social-environmental factors on SIB should be examined before pharmacological treatments are implemented for these behaviours.','2018-04-25 00:00:00','2018-04-25 00:00:00','2018-04-25 00:00:00',0,0,'Hall, S S, SS|Hustyi, K M, KM|Barnett, R P, RP','2018-05-17 22:46:19','2018-05-17 22:46:19'),(305,32,29723971,'2072-6643','Assessment of Lactose-Free Diet on the Phalangeal Bone Mineral Status in Italian Adolescents Affected by Adult-Type Hypolactasia.','Adult-type hypolactasia (ATH) is a clinical syndrome of primary lactase deficiency. A lactose-free diet is advisable to avoid the symptoms linked to the condition, but this potentially creates problems for optimal bone mineralization due to reduced calcium intake. To evaluate the effect of the lactose-free diet on the bone mineral status (BMS), we compared the phalangeal BMS of adolescents with ATH to that of peers on a normal diet. Also, we analyzed the correlations between BMS and dietary behavior, physical exercise, and calcium and vitamin D intake. A total of 102 cases and 102 healthy controls filled out a diet record and underwent phalangeal Quantitative Ultrasound (QUS). No difference in BMS was observed. The time spent on lactose-free diet (4.8 &plusmn; 3.1 years) was inversely correlated to the BMS. More than 98% of cases consumed lactose-free milk, but calcium and vitamin D intake were significantly lower. Calcium intake was correlated to physical exercise but not to BMS. Our results suggest that a lactose-free diet does not affect the phalangeal BMS of adolescents with primary lactase deficiency when their diet includes lactose-free cow&rsquo;s milk. However, there is still a significantly lower calcium intake than in the population reference. The inverse correlation observed between the BMS and the time spent on a lactose-free diet suggests that a long-term follow-up is advisable.','2018-05-01 00:00:00','2018-05-01 00:00:00','2018-05-04 00:00:00',0,0,'Baldan, Alessandro, A|Tagliati, Sylvie, S|Saccomandi, Daniela, D|Brusaferro, Andrea, A|Busoli, Laura, L|Scala, Andrea, A|Malaventura, Cristina, C|Maggiore, Giuseppe, G|Borgna-Pignatti, Caterina, C','2018-05-17 22:46:19','2018-05-17 22:46:19'),(306,32,29699681,'0308-8146','Dipping probe electrospray ionization/mass spectrometry for direct on-site and low-invasive food analysis.','Rapid, direct, on-site and noninvasive food analysis is strongly needed for quality control of food. To satisfy this demand, the technique of dipping probe electrospray ionization/mass spectrometry (dPESI/MS) was developed. The sample surface was pricked with a fine acupuncture needle and a sample of ∼200 pL was captured at the needle tip. After drying the sample, the needle tip was dipped into the solvent for ∼50 ms and was moved upward. A high-voltage was applied to the needle to generate electrospray when the needle reached the highest position, and mass spectra were measured with a time-of-flight mass spectrometer. For evaluation of the method, the technique was used to analyze foods such as vegetables, salmon flesh, cow\'s milk, yogurt, and soy-bean milk. The detected major ions for cow\'s milk and yogurt were [(Lac) + Ca] with n = 1-6 (where (Lac) is lactose), indicating that Ca is tightly bound by Lac molecules.','2018-09-15 00:00:00','2018-04-03 00:00:00','2018-04-27 00:00:00',0,0,'Usmanov, Dilshadbek T, DT|Mandal, Mridul K, MK|Hiraoka, Kenzo, K|Ninomiya, Satoshi, S|Wada, Hiroshi, H|Matsumura, Masaya, M|Sanada-Morimura, Sachiyo, S|Nonami, Hiroshi, H|Yamabe, Shinichi, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(307,32,29686701,'1687-6121','Nontyphoidal  Gastroenteritis in a Tertiary Children\'s Hospital in Southern China: Characteristics and Dietary Considerations.','No abstract found.','2018-05-17 00:00:00','2018-03-04 00:00:00','2018-04-26 00:00:00',0,0,'Ren, Lu, L|Yang, Min, M|Geng, Lanlan, L|Chen, Peiyu, P|Chen, Huan, H|Gong, Sitang, S|Li, Ding-You, DY','2018-05-17 22:46:19','2018-05-17 22:46:19'),(308,32,29649531,'1879-0003','Preparation, characterization and in vitro release of β-galactosidase loaded polyelectrolyte nanoparticles.','Improving encapsulation efficacy (EE) and bioavailability of β-galactosidase (β-gal) is always a challenge due to its fragility. In this work, β-gal loaded β-chitosan (CS) nanoparticles (NPs) were successfully prepared based on ionic gelation technique and electrostatic attraction for improving its EE and in vitro releasing capacity. The particle size of β-gal loaded low and high molecular weight (LMW and HMW) β-CS NPs reached 584.37 and 652.46nm, with Zeta-potential (ZP) of 26.37 and 16.46mV under the optimal conditions, respectively. In vitro release study conducted at pH4.5 and 7.4 showed that β-gal loaded LMW and HMW β-CS NPs with EE of 68.32 and 58.64% sustained the release of the β-gal over 12h. The β-gal incorporated into β-CS NPs was confirmed with the results of physicochemical and structural properties of β-gal loaded β-CS NPs, and prepared NPs had hardly any cytotoxicity in the range of 0.1-1.0mg/mL. The results indicated that β-gal loaded β-CS NPs could serve as non-toxic delivery carriers for the treatment of lactose intolerance.','2018-04-10 00:00:00','2018-04-10 00:00:00','2018-05-15 00:00:00',0,0,'Zhang, Hongcai, H|Yu, Huaning, H|Mei, Jun, J|Zhang, Yifeng, Y|Deng, Zilong, Z','2018-05-17 22:46:19','2018-05-17 22:46:19'),(309,32,29608017,'1097-0282','Improvement of functional properties of a thermostable β-glycosidase for milk lactose hydrolysis.','In this work, a new exploitation of the thermostable β-glycosidase from Sulfolobus solfataricus expressed in Saccharomyces cerevisiae to create functional foods for low lactose diets was evaluated. For this purpose, the lactose hydrolysis reaction using immobilized and soluble enzymes was investigated. Activity and stability at different conditions of pH and temperature were tested. The immobilization process had a big impact on the catalysis performance, leading to an enhancement of the enzymatic reaction rate on lactose, as demonstrated by the increasing of 2 and 2.5 folds of K and K /K , respectively. Moreover, the maximal activity for the immobilized form was referred at pH 6.5 instead of 7.0, leading to an improvement of the catalytic performance at milk pHs. Although the soluble enzyme was already weakly inhibited by the reaction products, the immobilization further reduced the inhibitory action of glucose increasing the K from 96.7 to 110.4 mM. Finally, the immobilized enzyme showed high hydrolysis rate in whole milk that yielded 99% of lactose breakdown in 10 and 30 min at 60 and 40°C, respectively. These results support the application of the immobilized β-glycosidase for the development of new functional foods particularly suitable to the alleviation of lactose intolerance.','2018-04-02 00:00:00','2018-04-02 00:00:00','2018-04-02 00:00:00',0,0,'Ionata, Elena, E|Marcolongo, Loredana, L|La Cara, Francesco, F|Cetrangolo, Giovanni P, GP|Febbraio, Ferdinando, F','2018-05-17 22:46:19','2018-05-17 22:46:19'),(310,32,29597337,'2072-6643','Behavioral Intervention in Adolescents Improves Bone Mass, Yet Lactose Maldigestion Is a Barrier.','Calcium intake during adolescence is important for attainment of peak bone mass. Lactose maldigestion is an autosomal recessive trait, leading to lower calcium intake. The Adequate Calcium Today study aimed to determine if a school-based targeted behavioral intervention over one year could improve calcium intake and bone mass in early adolescent girls. The school-randomized intervention was conducted at middle schools in six states over one school year. A total of 473 girls aged 10-13 years were recruited for outcome assessments. Bone mineral content (BMC) was determined by dual energy X-ray absorptiometry. Dietary calcium intake was assessed with a semi-quantitative food frequency questionnaire. Baseline calcium intake and BMC were not significantly different between groups. After the intervention period, there were no differences in changes in calcium intake and BMC at any site between groups. An unanticipated outcome was a greater increase in spinal BMC among lactose digesters than lactose maldigesters in the intervention schools only (12 months) (6.9 ± 0.3 g vs. 6.0 ± 0.4 g,  = 0.03) and considering the entire study period (18 months) (9.9 ± 0.4 vs. 8.7 ± 0.5 g,  < 0.01). Overall, no significant differences between the intervention and control schools were observed. However, lactose digesters who received the intervention program increased bone mass to a greater extent than lactose maldigesters.','2018-03-28 00:00:00','2018-03-28 00:00:00','2018-05-16 00:00:00',0,0,'Lee, Yujin, Y|Savaiano, Dennis A, DA|McCabe, George P, GP|Pottenger, Francis M, FM|Welshimer, Kathleen, K|Weaver, Connie M, CM|McCabe, Linda D, LD|Novotny, Rachel, R|Read, Marsha, M|Going, Scott, S|Mason, April, A|Van Loan, Marta, M|Boushey, Carol J, CJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(311,32,29505134,'1651-2227','One-third of children with lactose intolerance managed to achieve a regular diet at the three-year follow-up point.','This study described outcomes following treatment for lactose intolerance, which is common in children.The medical records of children aged 6-18 years who underwent lactose hydrogen breath testing at Dana-Dwek Children\'s Hospital, Tel Aviv, Israel, from August 2012 to August 2014 were analysed. We compared 154 children with gastrointestinal symptoms and positive lactose hydrogen breath tests to 49 children with negative test results.Of the 154 children in the study group, 89 (57.8%) were advised to follow a lactose-restricted diet, 32 (20.8%) were advised to avoid lactose completely, 18 (11.7%) were instructed to use substitute enzymes, and 15 (9.7%) did not receive specific recommendations. Only 11 patients (7.1%) received recommendations to add calcium-rich foods or calcium supplements to their diet. Lactose reintroduction was attempted in 119 of 154 patients (77.3%), and 65 of 154 (42.2%) experienced clinical relapses. At the final follow-up of 3.3 years, 62.3% of the study children were still observing a restricted diet. Older children and those who were symptomatic during lactose hydrogen breath testing were more likely to be on a prolonged restricted diet.Our long-term follow-up of lactose-intolerant children showed that only a third were able to achieve a regular diet.','2018-03-05 00:00:00','2018-03-05 00:00:00','2018-03-30 00:00:00',0,0,'Yerushalmy-Feler, Anat, A|Soback, Hagai, H|Lubetzky, Ronit, R|Ben-Tov, Amir, A|Dali-Levy, Margalit, M|Galai, Tut, T|Cohen, Shlomi, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(312,32,29425071,'1549-7852','The effects of probiotics in lactose intolerance: A systematic review.','Over 60 percent of the human population has a reduced ability to digest lactose due to low levels of lactase enzyme activity. Probiotics are live bacteria or yeast that supplements the gastrointestinal flora. Studies have shown that probiotics exhibit various health beneficial properties such as improvement of intestinal health, enhancement of the immune responses, and reduction of serum cholesterol. Accumulating evidence has shown that probiotic bacteria in fermented and unfermented milk products can be used to alleviate the clinical symptoms of lactose intolerance (LI). In this systematic review, the effectiveness of probiotics in the treatment of LI was evaluated using 15 randomized double-blind studies. Eight probiotic strains with the greatest number of proven benefits were studied. Results showed varying degrees of efficacy but an overall positive relationship between probiotics and lactose intolerance.','2018-02-09 00:00:00','2018-02-09 00:00:00','2018-02-09 00:00:00',0,0,'Oak, Sophia J, SJ|Jha, Rajesh, R','2018-05-17 22:46:19','2018-05-17 22:46:19'),(313,32,29384557,'1415-4757','The association between adult-type hypolactasia and symptoms of functional dyspepsia.','Functional dyspepsia and lactose intolerance (adult-type hypolactasia, ATH) are common conditions that may coexist or even be confounded. Their clinical presentation can be similar, however, lactose intolerance does not form part of the diagnostic investigation of functional dyspepsia. Studies on the association between functional dyspepsia and ATH are scarce. This study aimed to evaluate whether ATH is associated with symptoms of functional dyspepsia. Patients fulfilling the Rome III diagnostic criteria for functional dyspepsia underwent genetic testing for ATH. Dyspeptic symptoms were evaluated and scored according to a validated questionnaire. The diagnostic criteria for ATH was a CC genotype for the -13910C/T polymorphism, located upstream of the lactase gene. The mean scores for dyspeptic symptoms were compared between patients with ATH and those with lactase persistence. A total of 197 functional dyspeptic patients were included in the study. Mean age was 47.7 years and 82.7% patients were women. Eighty-eight patients (44.7%) had a diagnosis of ATH. Abdominal bloating scores were higher in ATH patients compared to the lactase persistent patients (P=0.014). The remaining dyspeptic symptom scores were not significantly different between the two groups. The study results demonstrate an association between ATH and bloating in patients with functional dyspepsia.','2018-01-01 00:00:00','2018-01-22 00:00:00','2018-04-25 00:00:00',0,0,'Wortmann, André Castagna, AC|Simon, Daniel, D|Mazzoleni, Luiz Edmundo, LE|Sander, Guilherme Becker, GB|Francesconi, Carlos Fernando de Magalhães, CFM|Nabinger, Débora Dreher, DD|Grott, Camila Schultz, CS|Rech, Tássia Flores, TF|Mazzoleni, Felipe, F|Lunge, Vagner Ricardo, VR|Bona, Laura Renata de, LR|Milbradt, Tobias Cancian, TC|Silveira, Themis Reverbel da, TRD','2018-05-17 22:46:19','2018-05-17 22:46:19'),(314,32,29379537,'1734-1922','Hydrogen excretion in pediatric lactose malabsorbers: relation to symptoms and the dose of lactose.','Lactose malabsorption arises from lactase deficiency and may lead to lactose intolerance - gastrointestinal symptoms after lactose ingestion. Occurrence and severity of the symptoms are influenced by many factors, including the dose of lactose and the intensity of its colonic fermentation to short chain fatty acids and gases.The hydrogen breath test (HBT) after 30 g or 50 g of lactose was performed in 387 children. Further analysis included children who had a positive HBT result. The HBT parameters were net hydrogen concentration in each breath and total net hydrogen concentration during the HBT. The time of the first hydrogen rise was also calculated. HBT parameters were analyzed according to symptoms occurrence (lack or present), symptoms severity (lack, moderate or severe) and the dose of lactose (30 g or 50 g).One hundred and six children (12.1 years, 46 boys) had a positive HBT result. Symptoms occurrence was positively related to net hydrogen concentration at 30 min, 60 min and 90 min ( < 0.001 at each time point), as well as to the total net hydrogen concentration ( < 0.001). There were no differences in hydrogen excretion between subjects with moderate and severe symptoms after lactose ingestion. Symptoms were more frequent in subjects given 50 g of lactose than in those given 30 g of lactose (79% vs. 47%,  = 0.003). In both dose groups symptoms occurrence was related to hydrogen excretion.Symptoms occurrence is closely related to hydrogen excretion and to the dose of ingested lactose.','2018-01-01 00:00:00','2016-07-20 00:00:00','2018-02-01 00:00:00',0,0,'Pawłowska, Katarzyna, K|Seredyński, Rafał, R|Umławska, Wioleta, W|Iwańczak, Barbara, B','2018-05-17 22:46:19','2018-05-17 22:46:19'),(315,33,29762955,'0254-9395','Erythema Necroticans - A Case Report.','Erythema Nodosum Leprosum (ENL) is characterized by evanescent, erythematous, painful raised nodules which fade within 48-72 hours. Necrotic and ulcerative forms are rare presentations of severe ENL. A 27 year old male patient presented with multiple erythematous nodules on trunk and extremities associated with high grade fever, joint pain and pedal edema. Patient developed ulceration of nodules associated with pain and burning sensation over another 3 days. Slit smear showed clumps of granular bacilli. Biopsy showed superficial dermis showing edema with dense focal perivascular infiltrate of lymphocytes, macrophages and few scattered neutrophils. Fite-Faraco stain was negative. Patient was diagnosed as a case of erythema necroticans and started on oral steroids and thalidomide. The histological findings illustrate the need to consider leprosy diagnosis in necrotizing vasculitis even when Virchow\'s cells are not found in the infiltrate. Thalidomide is the drug of choice in such cases. This patient showed a marked response to the drug with healing of all ulcers within 2 weeks of starting thalidomide.','2016-09-01 00:00:00','0000-00-00 00:00:00','2018-05-16 00:00:00',0,0,'Mehta, N, N|Ramachandran, R, R|Srikanth, S, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(316,33,29762954,'0254-9395','A Traditional NSAID Aspirin along with Clofazimine in Erythema Nodosum Leprosum Reaction: Study of Six Cases.','Six male patients of lepromatous leprosy with erythema nodosum leprosum reaction (ENL) reactions diagnosed clinically and by slit skin smear were treated with aspirin and clofazimine. Aspirin was given in the daily dosage of 75mg/kg body weight up to a maximum of 2.8 grams in four divided doses, along with daily 300mg clofazimine in three divided doses and dapsone 100mg daily with rifampicin 600mg once a month. Aspirin was continued in the same dosage for a month before being tapered and stopped at the end of third month when clofazimine was also reduced to 50 mg daily. All the six cases had an excellent response in 15 days.','2016-09-01 00:00:00','0000-00-00 00:00:00','2018-05-16 00:00:00',0,0,'Sharma, P K, PK|Singh, D K, DK','2018-05-17 22:46:19','2018-05-17 22:46:19'),(317,33,29762953,'0254-9395','Correlates of Defaulting from MDT among Leprosy Patients.','In order to analyse the factors of demographic as well as disease related variables and their correlation with Rate of Defaulting (ROD) from Multi Drug Therapy (MDT) among leprosy patients, secondary data have been collected from 3,579 new cases registered for MDT, during a period of 4 years from 2007 to 2010 in four leprosy hospitals/ treatment centers across the four high endemic states viz. Uttar Pradesh, Chhattisgarh; Maharashtra and Andhra Pradesh. Year wise percentage of patients defaulted was calculated on aggregate as well as with reference to each centre and cross tabulated with demographic and disease related factors. Findings show that out of the total 3,579 new cases, 1944,(54.3%) defaulted with variation across centers ranged from 44 to 66 percent. Comparison of ROD against type of leprosy indicated that MB types defaulted (55.7%) more than PB (50.6%) types, (statistically significant difference, (p=0,04). ROD of male patients across the centers ranged from 45% to 67.7% in comparison with 42.4% to 61.5% of female patients. A-statistically significant difference (p=6.04) was found between the overall ROD of males (56.35%) and females (51.47%). The ROD among those with more severe disabilities (WHO Gr-2) ranged between 44% to 67.5% across the centers, while the same among those\'with less severe disabilities (Gr-0&1) ranged from 42.6 to 72.7 percent. Comparison of ROD against severity of disability was found statistically significant only across 2 centers. No statistically significant variation was found when ROD of adult patients with refeince to each centr ranged between (43.6% to 65.4%) was compared with the same of children ranged beeIen (36.2% to 69.3%). Across each of these categories and centers,\'the ROD remained consistent over the ,4 years. Based on the above findings\'this may be concluded that male sex and MB types are significant correlates of default from treatment. Severity of disabilities plays significant role only in certain areas, probably due to other interfering factors, which needs to be further investiged.','2016-09-01 00:00:00','0000-00-00 00:00:00','2018-05-16 00:00:00',0,0,'Raju, M S, MS|Elkana, M, M|Failbus, P, P|Palla, J P, JP|Hembrom, U K, UK|Rao, P S, PS','2018-05-17 22:46:19','2018-05-17 22:46:19'),(318,33,29762952,'0254-9395','Dapsone: An Update.','Dapsone is an extensively Used drug for the treatment of leprosy as well as\'some other clinical problems worldwide: Its use has been predicted to increase further, especially in non leprosy conditions. Treatment with Dapsone is sometimes known\'to be associated with side-effects, which include gastrointestinal intolerance, haemolysis, methaemoglobinaemia, agranulocytosis, psychosis, peripheral neuritis and varied dermatological conditions, varying from simple rash to severe life threatening epidermolytic reactions and Dapsone hypersensitivity syndrome (DHS). DHS is a rare delayed hypersensitivity reaction involving multiple organs. the condition is associated with high morbidity and is potentially fatal. In this article, the focus is on etiopathogenesis, diagnosis and management of DHS. Awareness of the varied presentation/s of the condition, early recognition, withdrawal of the drug and proper management helps in rapid reduction in morbidity and preventing fatalities associated with it.','2016-09-01 00:00:00','0000-00-00 00:00:00','2018-05-16 00:00:00',0,0,'Karjigi, S, S|Murthy, S C, SC|Kallappa, H, H|Kusuma, M R, MR|Aruna, B, B|Reddy, Y N, YN','2018-05-17 22:46:19','2018-05-17 22:46:19'),(319,33,29762951,'0254-9395','Efficacy of Steroid and Physiotherapy in Early Reported Lagophthalmos of Patient Affected with Leprosy. A Report from Trbal Dominated Leprosy Endemic State of India.','Lagophthalmos is one of the well-known complications of leprosy due to involvement of the facial nerve. In the present study an attempt has been made to elucidate the role of early intervention with steroids and adjunct physiotherapy in early reported lagophthalmos in patients affected with leprosy at a tertiary referral institute under the Disability Prevention and Medical rehabilitation (DPMR) programme. During April 2008 to March 2014, 62 patients affected with leprosy reported to Regional leprosy Training and Research Institute with lagophthalmos. Cases reporting within six months of difficulty in closure were categorized as early reporting group. These were either referred from a peripheral health centre (63%) or self-reported (37%). These patients were examined clinically and details were noted in a pretested Performa. The standard dosages of the steroids were given to patients as per NLEP guidelines. Lid gaps on direct gaze and with both gentle and forced closure were assessed using standard measuring technique by a physiotherapist. During the follow-up period the patients were imparted active and passive physiotherapy and any change in the lid gap was recorded. The data was analysed and appropriate test of significance was applied. Out of 62 lagophthalmos patients, 49(79.1%) were males and 13 (20.9%) were females. 56 (90.3%) cases were from MB category and 6 (9.7%) cases were from PB category. 53(85.4%) patients presented with unilateral eye involvement, while 9 (14.6%) had bilateral lagophthalmos. 53 (74.6%) of the eyes achieved complete lid closure, while the remaining 18 (25.4%) eyes had gap on gentle closure. During six month follow-up the amount of recession of lid gap among the early reported lagophthalmos was 4.15 mm with standard steroid regimen and physiotherapy. With the use of the steroid and regular physiotherapy lagophthalmos diagnosed and treated in initial stages shows significant improvement in the lid gap reduction.','2016-09-01 00:00:00','0000-00-00 00:00:00','2018-05-16 00:00:00',0,0,'Kamble, K M, KM|Gitte, S V, SV|Sabat, R N, RN','2018-05-17 22:46:19','2018-05-17 22:46:19'),(320,33,29757547,'0254-9395','Ultrasonographic Features of Ulnar Nerve Affected by Hansen\'s Disease.','Leprosy continues to be a major public health problem in some areas of our country. It predominantly afflicts peripheral nerves and skin and may lead to deformities. Social stigma as a result of deformities further plagues the situation. Prompt and early diagnosis coupled with adequate treatment, concurrent rehabilitative strategies if deformities do occur, and health education help to control the problem. Definitive diagnosis of leprosy has traditionally been based on assessment of slit skin smears (SSS) after AFB-staining and characteristic histopathology after biopsyof the lesion. However, recently, thickening of the peripheral nerves has been demonstrated by ultrasonography and this can be used as a sensitive tool to assess and measure enlargement of peripheral nerves, which are hallmarks for leprosy especially in clinical settings. In this report, the ultrasonographic findings of ulnar nerve enlargement due to leprosy in a fourteen-year-old male patient are described.','0000-00-00 00:00:00','0000-00-00 00:00:00','2018-05-15 00:00:00',0,0,'Aswani, Y, Y|Thakkar, H, H|Sahu, A R, AR|Anandpara, K M, KM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(321,33,29757546,'0254-9395','Elastophagocytosis and Elastolysis in Leprosy.','Elastophagocytosis is the engulfment of the elastic fibres by the histiocytes, multinucleated giant cells, or both. The cutaneous lesions showing elastophagocytosis are annular elastolytic giant cell granuloma, actinic keratoses, persistent insect-bite reactions, elastosis perforans serpiginosa, foreign body granuloma. Occasionally, it may occur in infectious diseases like leprosy, granulomatous syphilis, North-American blastomycosis, bacterial folliculitis, and cutaneous leishmaniasis. We report a case of lepromatous leprosy with necrotic erythema nodosum leprosum with secondary anetoderma. Histopathology from the atrophic macule of anetoderma revealed periappendageal, perineural infiltration, elastophagocytosis and reduction in elastic fibres.','0000-00-00 00:00:00','0000-00-00 00:00:00','2018-05-15 00:00:00',0,0,'Rambhia, K D, KD|Khopkar, U S, US','2018-05-17 22:46:19','2018-05-17 22:46:19'),(322,33,29757545,'0254-9395','Leprosy: A Great Mimicking Disease.','Leprosy may mask a variety of diseases. One such disease is systemic lupus erythematosus. The early differentiation between the two diseases is of utmost importance to institute appropriate treatment and reduce patient morbidity and mortality. Leprosy is a communicable, chronic granulomatous disease caused by Mycobacterium leprae. This clinically manifests predominantly with neurological and cutaneous features. However, it may also manifest with a variety of autoimmune phenomena indicative of autoimmune diseases, such as Systemic Lupus Erythematosus (SLE) or Rheumatoid Arthritis. Infection with Mycobocterium leprae not only mimics lupus flares, but possibly may also act as a trigger for lupus reactivation; however, its relationship is still not fully understood and explored. We report a case that was diagnosed as leprosy but retrospective analysis revealed that it was probablythe initial manifestations of Lupus. During hospitalization the patient suddenly developed hypoxia and was found to have pulmonary haemorrhage. He was successfully managed with steroids, Mycophenolatemofetil along with other supportive treatment. Our case highlights the rare presentation of pulmonary haemorrhage in a male lupus patient and focuses on leprosy mimicking lupus.','0000-00-00 00:00:00','0000-00-00 00:00:00','2018-05-15 00:00:00',0,0,'Garg, G, G|Gogia, A, A|Kakar, A, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(323,33,29757544,'0254-9395','Histoid Leprosy Presenting with Keloid Like Lesions.','A 42 year old male presented with multiple, discrete, hyperpigmented, firm, non elastic, non tender papules and plaques on the posterior trunk of 5 months duration, resembling keloid. The patient had also a few skin colored papules on the anterior trunk and face. The sensations over the skin lesions were intact. The patient had glove and stocking type of anesthesia and bilaterally thickened, non tender peripheral nerve trunks. The slit skin smear for acid fast bacilli from the ear lobes, skin lesions and normal skin were highly positive for Mycobacterium leprae. A skin biopsy showed a well defined collection of spindle shaped histiocytes in the dermis packed with acid fast bacilli. We are presenting here a case of histoid leprosy presenting with keloid like lesions, probably the rarest presentation of histoid leprosy.','0000-00-00 00:00:00','0000-00-00 00:00:00','2018-05-15 00:00:00',0,0,'Nair, S P, SP|Kumar, G N, GN|Mathew, R, R','2018-05-17 22:46:19','2018-05-17 22:46:19'),(324,33,29757543,'0254-9395','Profile of Childhood Leprosy Cases Attending a Tertiary Care Centre.','In spite of 33 years of use of Multidrug Treatment (MDT) implemented by National Leprosy Eradication Programme (NLEP), leprosy continues to be a major public health problem in some regions of India. Recent increase in number of cases of leprosy at our tertiary care centre especially in children encouraged us to undertake a descriptive study for last 5 years. Records were analysed to describe the clinical pattern of leprosy in children below 15 years pertaining to the period 2010 to 2014. Amongst 664 leprosy cases registered during 2010 to 2014, 86 were found to be children between 0-15 years of age (13.1%). The number of newly detected children with leprosy increased from 7 cases (8%) in the year 2010 to 29 cases (34%) in the year 2014. Majority of patients of childhood category belonged to 10-15 years of age group 51/86 (59%), with a male preponderance. PB cases were significantly more (71%) than cases of MB (29%). Borderline tuberculoid leprosy was the commonest type seen (77%). Grade l and grade 2 deformity were observed in 8% and 6% of childhood cases respectively. 91% of these childhood cases had history of BCG vaccination: 21% of children had a contact in family or neighbourhood which shows the importance of asking the patients to bring family contacts specially children for examination or public health workers being asked to approach the families for check up of contacts. Active surveys/school surveys to find cases specially in female children should be considered. As this is a hospital based study it may be indicative of trends only which should be followed by properly designed field based studies.','0000-00-00 00:00:00','0000-00-00 00:00:00','2018-05-15 00:00:00',0,0,'Asia, A J, AJ|Tapre, V, V|Joge, U, U','2018-05-17 22:46:19','2018-05-17 22:46:19'),(325,34,29706541,'1097-4172','The Egyptian Rousette Genome Reveals Unexpected Features of Bat Antiviral Immunity.','Bats harbor many viruses asymptomatically, including several notorious for causing extreme virulence in humans. To identify differences between antiviral mechanisms in humans and bats, we sequenced, assembled, and analyzed the genome of Rousettus aegyptiacus, a natural reservoir of Marburg virus and the only known reservoir for any filovirus. We found an expanded and diversified KLRC/KLRD family of natural killer cell receptors, MHC class I genes, and type I interferons, which dramatically differ from their functional counterparts in other mammals. Such concerted evolution of key components of bat immunity is strongly suggestive of novel modes of antiviral defense. An evaluation of the theoretical function of these genes suggests that an inhibitory immune state may exist in bats. Based on our findings, we hypothesize that tolerance of viral infection, rather than enhanced potency of antiviral defenses, may be a key mechanism by which bats asymptomatically host viruses that are pathogenic in humans.','2018-04-18 00:00:00','2018-04-18 00:00:00','2018-04-30 00:00:00',0,0,'Pavlovich, Stephanie S, SS|Lovett, Sean P, SP|Koroleva, Galina, G|Guito, Jonathan C, JC|Arnold, Catherine E, CE|Nagle, Elyse R, ER|Kulcsar, Kirsten, K|Lee, Albert, A|Thibaud-Nissen, Françoise, F|Hume, Adam J, AJ|Mühlberger, Elke, E|Uebelhoer, Luke S, LS|Towner, Jonathan S, JS|Rabadan, Raul, R|Sanchez-Lockhart, Mariano, M|Kepler, Thomas B, TB|Palacios, Gustavo, G','2018-05-17 22:46:19','2018-05-17 22:46:19'),(326,34,29625392,'1873-5967','The current landscape of nucleic acid tests for filovirus detection.','Nucleic acid testing (NAT) for pathogenic filoviruses plays a key role in surveillance and to control the spread of infection. As they share clinical features with other pathogens, the initial spread of these viruses can be misdiagnosed. Tests that can identify a pathogen in the initial stages of infection are essential to control outbreaks. Since the Ebola virus disease (EVD) outbreak in 2014-2016 several tests have been developed that are faster than previous tests and more suited for field use. Furthermore, the ability to test for a range of pathogens simultaneously has been expanded to improve clinical pathway management of febrile syndromes. This review provides an overview of these novel diagnostic tests.','2018-06-01 00:00:00','2018-03-22 00:00:00','2018-05-13 00:00:00',0,0,'Clark, David J, DJ|Tyson, John, J|Sails, Andrew D, AD|Krishna, Sanjeev, S|Staines, Henry M, HM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(327,34,29593278,'2222-1751','Determining the effect of different environmental conditions on Ebola virus viability in clinically relevant specimens.','In 2013-2016, West Africa experienced the largest and longest Ebola virus disease outbreak ever documented. The wide geographic spread and magnitude of the outbreak often limited the timely and rapid testing of diagnostic samples from patients with suspected Ebola virus disease, raising questions regarding the optimal storage and shipping conditions of clinically relevant specimens, including EDTA-whole blood, plasma, capillary blood, urine and seminal fluid (associated with sexual transmission of the Ebola virus after recovery from the disease). Therefore, the aim of our study was to identify the extent to which storage temperature and clinical specimen type influence Ebola virus viability. Virus infectivity was determined using a fluorescent focus-forming assay. In our study, we show that Ebola virus was the most stable in EDTA-whole blood and plasma samples, whereas rapid decay of infectivity was observed in simulated capillary blood, urine and semen samples, especially when these samples were stored at higher temperatures. The analysis of variance results demonstrated that both temperature and clinical specimen type have significant effects on virus viability, whereas donor differences were not observed. Repeated freeze and thaw cycles of the samples also had a notable impact on virus viability in EDTA-whole blood and urine. Due to the rapid temperature- and specimen-dependent degradation of the virus observed here, our study highlights the importance of proper clinical sample storage at low temperatures during transportation and laboratory analysis.','2018-03-29 00:00:00','2018-03-29 00:00:00','2018-04-01 00:00:00',0,0,'Palyi, Bernadett, B|Magyar, Nora, N|Henczko, Judit, J|Szalai, Balint, B|Farkas, Agnes, A|Strecker, Thomas, T|Takacs, Maria, M|Kis, Zoltan, Z','2018-05-17 22:46:19','2018-05-17 22:46:19'),(328,34,29511143,'2095-8137','Development and characterization of a guinea pig model for Marburg virus.','The Angolan strain of Marburg virus (MARV/Ang) can cause lethal disease in humans with a case fatality rate of up to 90%, but infection of immunocompetent rodents do not result in any observable symptoms. Our previous work includes the development and characterization of a MARV/Ang variant that can cause lethal disease in mice (MARV/Ang-MA), with the aim of using this tool to screen for promising prophylactic and therapeutic candidates. An intermediate animal model is needed to confirm any findings from mice studies before testing in the gold-standard non-human primate (NHP) model. In this study, we serially passaged the clinical isolate of MARV/Ang in the livers and spleens of guinea pigs until a variant emerged that causes 100% lethality in guinea pigs (MARV/Ang-GA). Animals infected with MARV/Ang-GA showed signs of filovirus infection including lymphocytopenia, thrombocytopenia, and high viremia leading to spread to major organs, including the liver, spleen, lungs, and kidneys. The MARV/Ang-GA guinea pigs died between 7-9 days after infection, and the LD was calculated to be 1.1×10 TCID (median tissue culture infective dose). Mutations in MARV/Ang-GA were identified and compared to sequences of known rodent-adapted MARV/Ang variants, which may benefit future studies characterizing important host adaptation sites in the MARV/Ang viral genome.','2018-01-18 00:00:00','0000-00-00 00:00:00','2018-04-13 00:00:00',0,0,'Wong, Gary, G|Cao, Wen-Guang, WG|He, Shi-Hua, SH|Zhang, Zi-Rui, ZR|Zhu, Wen-Jun, WJ|Moffat, Estella, E|Ebihara, Hideki, H|Embury-Hyatt, Carissa, C|Qiu, Xiang-Guo, XG','2018-05-17 22:46:19','2018-05-17 22:46:19'),(329,34,29511141,'2095-8137','Animal models for filovirus infections.','The family , which includes the genera  and , contains some of the most pathogenic viruses in humans and non-human primates (NHPs), causing severe hemorrhagic fevers with high fatality rates. Small animal models against filoviruses using mice, guinea pigs, hamsters, and ferrets have been developed with the goal of screening candidate vaccines and antivirals, before testing in the gold standard NHP models. In this review, we summarize the different animal models used to understand filovirus pathogenesis, and discuss the advantages and disadvantages of each model with respect to filovirus disease research.','2018-01-18 00:00:00','0000-00-00 00:00:00','2018-04-13 00:00:00',0,0,'Siragam, Vinayakumar, V|Wong, Gary, G|Qiu, Xiang-Guo, XG','2018-05-17 22:46:19','2018-05-17 22:46:19'),(330,34,29500195,'1083-351X','Design and evaluation of bi- and trispecific antibodies targeting multiple filovirus glycoproteins.','Filoviruses (family Filoviridae) include five ebolaviruses and Marburg virus. These pathogens cause a rapidly progressing and severe viral disease with high mortality rates (generally 30-90%). Outbreaks of filovirus disease are sporadic and, until recently, were limited to less than 500 cases. However, the 2013-2016 epidemic in western Africa, caused by Ebola virus (EBOV), illustrated the potential of filovirus outbreaks to escalate to a much larger scale (over 28,000 suspected cases). mAbs against the envelope glycoprotein represent a promising therapeutic platform for managing filovirus infections. However, mAbs that exhibit neutralization or protective properties against multiple filoviruses are rare. Here we examined a panel of engineered bi- and trispecific antibodies, in which variable domains of mAbs that target epitopes from multiple filoviruses were combined, for their capacity to neutralize viral infection across filovirus species. We found that bispecific combinations targeting EBOV and Sudan virus (another ebolavirus), provide potent cross-neutralization and protection in mice. Furthermore, trispecific combinations, targeting EBOV, Sudan virus, and Marburg virus, exhibited strong neutralization potential against all three viruses. These results provide important insights into multispecific antibody engineering against filoviruses and will inform future immunotherapeutic discoveries.','2018-04-20 00:00:00','2018-03-02 00:00:00','2018-05-15 00:00:00',0,0,'Nyakatura, Elisabeth K, EK|Zak, Samantha E, SE|Wec, Anna Z, AZ|Hofmann, Daniel, D|Shulenin, Sergey, S|Bakken, Russell R, RR|Aman, M Javad, MJ|Chandran, Kartik, K|Dye, John M, JM|Lai, Jonathan R, JR','2018-05-17 22:46:19','2018-05-17 22:46:19'),(331,34,29462200,'1932-6203','A prophylactic multivalent vaccine against different filovirus species is immunogenic and provides protection from lethal infections with Ebolavirus and Marburgvirus species in non-human primates.','The search for a universal filovirus vaccine that provides protection against multiple filovirus species has been prompted by sporadic but highly lethal outbreaks of Ebolavirus and Marburgvirus infections. A good prophylactic vaccine should be able to provide protection to all known filovirus species and as an upside potentially protect from newly emerging virus strains. We investigated the immunogenicity and protection elicited by multivalent vaccines expressing glycoproteins (GP) from Ebola virus (EBOV), Sudan virus (SUDV), Taï Forest virus (TAFV) and Marburg virus (MARV). Immune responses against filovirus GP have been associated with protection from disease. The GP antigens were expressed by adenovirus serotypes 26 and 35 (Ad26 and Ad35) and modified Vaccinia virus Ankara (MVA) vectors, all selected for their strong immunogenicity and good safety profile. Using fully lethal NHP intramuscular challenge models, we assessed different vaccination regimens for immunogenicity and protection from filovirus disease. Heterologous multivalent Ad26-Ad35 prime-boost vaccination regimens could give full protection against MARV (range 75%-100% protection) and EBOV (range 50% to 100%) challenge, and partial protection (75%) against SUDV challenge. Heterologous multivalent Ad26-MVA prime-boost immunization gave full protection against EBOV challenge in a small cohort study. The use of such multivalent vaccines did not show overt immune interference in comparison with monovalent vaccines. Multivalent vaccines induced GP-specific antibody responses and cellular IFNγ responses to each GP expressed by the vaccine, and cross-reactivity to TAFV GP was detected in a trivalent vaccine expressing GP from EBOV, SUDV and MARV. In the EBOV challenge studies, higher humoral EBOV GP-specific immune responses (p = 0.0004) were associated with survival from EBOV challenge and less so for cellular immune responses (p = 0.0320). These results demonstrate that it is feasible to generate a multivalent filovirus vaccine that can protect against lethal infection by multiple members of the filovirus family.','2018-05-17 00:00:00','2018-02-20 00:00:00','2018-04-24 00:00:00',0,0,'Callendret, Benoit, B|Vellinga, Jort, J|Wunderlich, Kerstin, K|Rodriguez, Ariane, A|Steigerwald, Robin, R|Dirmeier, Ulrike, U|Cheminay, Cedric, C|Volkmann, Ariane, A|Brasel, Trevor, T|Carrion, Ricardo, R|Giavedoni, Luis D, LD|Patterson, Jean L, JL|Mire, Chad E, CE|Geisbert, Thomas W, TW|Hooper, Jay W, JW|Weijtens, Mo, M|Hartkoorn-Pasma, Jutta, J|Custers, Jerome, J|Grazia Pau, Maria, M|Schuitemaker, Hanneke, H|Zahn, Roland, R','2018-05-17 22:46:19','2018-05-17 22:46:19'),(332,34,29457711,'2373-8227','Small Animal Models for Evaluating Filovirus Countermeasures.','The development of novel therapeutics and vaccines to treat or prevent disease caused by filoviruses, such as Ebola and Marburg viruses, depends on the availability of animal models that faithfully recapitulate clinical hallmarks of disease as it is observed in humans. In particular, small animal models (such as mice and guinea pigs) are historically and frequently used for the primary evaluation of antiviral countermeasures, prior to testing in nonhuman primates, which represent the gold-standard filovirus animal model. In the past several years, however, the filovirus field has witnessed the continued refinement of the mouse and guinea pig models of disease, as well as the introduction of the hamster and ferret models. We now have small animal models for most human-pathogenic filoviruses, many of which are susceptible to wild type virus and demonstrate key features of disease, including robust virus replication, coagulopathy, and immune system dysfunction. Although none of these small animal model systems perfectly recapitulates Ebola virus disease or Marburg virus disease on its own, collectively they offer a nearly complete set of tools in which to carry out the preclinical development of novel antiviral drugs.','2018-05-11 00:00:00','2018-02-26 00:00:00','2018-05-11 00:00:00',0,0,'Banadyga, Logan, L|Wong, Gary, G|Qiu, Xiangguo, X','2018-05-17 22:46:19','2018-05-17 22:46:19'),(333,34,29454637,'1872-7492','Tools to study pathogen-host interactions in bats.','Bats are natural reservoirs for a variety of emerging viruses that cause significant disease in humans and domestic animals yet rarely cause clinical disease in bats. The co-evolutionary history of bats with viruses has been hypothesized to have shaped the bat-virus relationship, allowing both to exist in equilibrium. Progress in understanding bat-virus interactions and the isolation of bat-borne viruses has been accelerated in recent years by the development of susceptible bat cell lines. Viral sequences similar to severe acute respiratory syndrome corona virus (SARS-CoV) have been detected in bats, and filoviruses such as Marburg virus have been isolated from bats, providing definitive evidence for the role of bats as the natural host reservoir. Although viruses can be readily detected in bats using molecular approaches, virus isolation is far more challenging. One of the limitations in using traditional culture systems from non-reservoir species is that cell types and culture conditions may not be compatible for isolation of bat-borne viruses. There is, therefore, a need to develop additional bat cell lines that correspond to different cell types, including less represented cell types such as immune cells, and culture them under more physiologically relevant conditions to study virus host interactions and for virus isolation. In this review, we highlight the current progress in understanding bat-virus interactions in bat cell line systems and some of the challenges and limitations associated with cell lines. Future directions to address some of these challenges to better understand host-pathogen interactions in these intriguing mammals are also discussed, not only in relation to viruses but also other pathogens carried by bats including bacteria and fungi.','2018-03-15 00:00:00','2018-02-15 00:00:00','2018-04-16 00:00:00',0,0,'Banerjee, Arinjay, A|Misra, Vikram, V|Schountz, Tony, T|Baker, Michelle L, ML','2018-05-17 22:46:19','2018-05-17 22:46:19'),(334,34,29401664,'1999-4915','A Simple Mechanism Based on Amino Acid Substitutions is not a Critical Determinant of High Mortality of Japanese Encephalitis Virus Infection in Mice.','For the development of effective treatment strategies for Japanese encephalitis (JE), it is important to identify the viral factors causing severe disease during JE virus (JEV) infection. In this study, we assessed whether amino acid substitutions are critical factors for higher mortality of JaTH160 compared with JaOArS982 in mice using the technique of infectious cDNA clones. We raised the possibility that two amino acids of C and NS3 of JaTH160 may contribute to increased mortality in mice. However, simultaneous substitutions of these amino acids did not significantly increase the virulence of JaOArS982, suggesting that high mortality due to JaTH160 viral infection cannot be simply attributed to the specific amino acids. Multiple and complex, but not simple, mechanisms may induce the high mortality of JaTH160 infection in mice.','2018-02-03 00:00:00','2018-02-03 00:00:00','2018-04-13 00:00:00',0,0,'Takamatsu, Yuki, Y|Uchida, Leo, L|Raekiansyah, Muhareva, M|Luz, Mark Anthony, MA|Morita, Kouichi, K|Hayasaka, Daisuke, D','2018-05-17 22:46:19','2018-05-17 22:46:19'),(335,35,29768367,'1536-5964','The phenotypic heterogeneity of patients with Marfan-related disorders and their variant spectrums.','Marfan syndrome (MFS) and Loeys-Dietz syndrome (LDS) are the connective tissue disorders characterized by aortic root aneurysm and/or dissection and various additional features. We evaluated the correlation of these mutations with the phenotypes and determined the clinical applicability of the revised Ghent criteria.The mutation spectrum and phenotypic heterogeneities of the 83 and 5 Korean patients with suspected MFS and LDS were investigated as a retrospective manner. In patients with suspected MFS patients, genetic testing was conducted in half of 44 patients who met the revised Ghent criteria clinically and half of 39 patients who did not meet these criteria.Fibrillin1 gene (FBN1) variants were detected in all the 22 patients (100%) who met the revised Ghent criteria and in 14 patients (77.8%) who did not meet the revised Ghent criteria (P = .0205). Patients with mutations in exons 24-32 were diagnosed at a younger age than those with mutations in other exons. Ectopia lentis was more common in patients with missense mutations than in patients with other mutations. Aortic diameter was greater in patients with missense mutations in cysteine residues than in patients with missense mutations in noncysteine residues. Five LDS patients had either TGFBR1 or TGFBR2 variants, of which 1 patient identified TGFBR1 variant uncertain significance.The revised Ghent criteria had very high clinical applicability for detecting FBN1 variants in patients with MFS and might help in selecting patients with suspected MFS for genetic testing.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-05-16 00:00:00',0,0,'Seo, Go Hun, GH|Kim, Yoon-Myung, YM|Kang, Eungu, E|Kim, Gu-Hwan, GH|Seo, Eul-Ju, EJ|Lee, Beom Hee, BH|Choi, Jin-Ho, JH|Yoo, Han-Wook, HW','2018-05-17 22:46:19','2018-05-17 22:46:19'),(336,35,29765495,'1942-0994','Effect of the Antioxidant Lipoic Acid in Aortic Phenotype in a Marfan Syndrome Mouse Model.','Marfan syndrome (MFS) cardiovascular manifestations such as aortic aneurysms and cardiomyopathy carry substantial morbidity/mortality. We investigated the effects of lipoic acid, an antioxidant, on ROS production and aortic remodeling in a MFS mgΔ mouse model. MFS and WT (wild-type) 1-month-old mice were allocated to 3 groups: untreated, treated with losartan, and treated with lipoic acid. At 6 months old, echocardiography, ROS production, and morphological analysis of aortas were performed. Aortic ROS generation in 6-month-old MFS animals was higher at advanced stages of disease in MFS. An unprecedented finding in MFS mice analyzed by OCT was the occurrence of focal inhomogeneous regions in the aortic arch, either collagen-rich extremely thickened or collagen-poor hypotrophic regions. MFS animals treated with lipoic acid showed markedly reduced ROS production and lower ERK1/2 phosphorylation; meanwhile, aortic dilation and elastic fiber breakdown were unaltered. Of note, lipoic acid treatment associated with the absence of focal inhomogeneous regions in MFS animals. Losartan reduced aortic dilation and elastic fiber breakdown despite no change in ROS generation. In conclusion, oxidant generation by itself seems neutral with respect to aneurysm progression in MFS; however, lipoic acid-mediated reduction of inhomogeneous regions may potentially associate with less anisotropy and reduced chance of dissection/rupture.','2018-05-17 00:00:00','2018-03-25 00:00:00','2018-05-16 00:00:00',0,0,'Guido, Maria C, MC|Debbas, Victor, V|Salemi, Vera M, VM|Tavares, Elaine R, ER|Meirelles, Thayna, T|Araujo, Thaís L S, TLS|Nolasco, Patricia, P|Ferreira-Filho, Julio C A, JCA|Takimura, Celso K, CK|Pereira, Lygia V, LV|Laurindo, Francisco R, FR','2018-05-17 22:46:19','2018-05-17 22:46:19'),(337,35,29758081,'1932-6203','Correction: Sex, pregnancy and aortic disease in Marfan syndrome.','[This corrects the article DOI: 10.1371/journal.pone.0181166.].','2018-05-17 00:00:00','2018-05-14 00:00:00','2018-05-14 00:00:00',0,0,'Renard, Marjolijn, M|Muiño-Mosquera, Laura, L|Manalo, Elise C, EC|Tufa, Sara, S|Carlson, Eric J, EJ|Keene, Douglas R, DR|Backer, Julie De, J|Sakai, Lynn Y, LY','2018-05-17 22:46:19','2018-05-17 22:46:19'),(338,35,29749581,'1092-8464','Preconception Counseling for Patients With Thoracic Aortic Aneurysms.','Acute aortic dissection is a potentially catastrophic cardiovascular emergency that is associated with a high mortality rate. Pregnancy, with its attendant hormonal and physiological changes, increases the risk of dissection in women with known thoracic aortic aneurysms. In this review, we highlight the importance of preconception counseling to help women with known thoracic aortic aneurysms better understand their risk of dissection and the heritable nature of thoracic aortic disease and its associated syndromes.The risk of aortic dissection during pregnancy differs according to the underlying etiology of thoracic aortic aneurysm and the degree of aortic dilatation at baseline. Guideline-specific management of women with thoracic aortic aneurysms in pregnancy reduces their risk of dissection. Management of pregnant women with thoracic aortic aneurysms requires an intensive multidisciplinary approach to maximize the chances of a successful outcome for both the mother and fetus. Preconception counseling provides an opportunity to optimize patients medically and to consider potential prophylactic aortic repair prior to pregnancy.','2018-05-10 00:00:00','2018-05-10 00:00:00','2018-05-14 00:00:00',0,0,'Rao, Prashant, P|Isselbacher, Eric M, EM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(339,35,29732924,'1607-8438','Identification and characterization of a novel FBN1 gene variant in an extended family with variable clinical phenotype of Marfan syndrome.','No abstract found.','2018-05-06 00:00:00','2018-05-06 00:00:00','2018-05-07 00:00:00',0,0,'Ergoren, Mahmut Cerkez, MC|Turkgenc, Burcu, B|Teralı, Kerem, K|Rodopluu, Orhan, O|Verstraeten, Aline, A|Van Laer, Lut, L|Mocan, Gamze, G|Loeys, Bart, B|Tetik, Omer, O|Temel, Sehime G, SG','2018-05-17 22:46:19','2018-05-17 22:46:19'),(340,35,29707410,'2146-4596','A 2-Year-Old Child with Bilateral Ectopis Lentis and a Novel FBN1 Gene Variant Cys129Ser.','Marfan syndrome and dominant ectopia lentis are part of type 1 fibrillinopathies that are caused by  pathogenic variants. Making a diagnosis could be challenging due to the clinical overlap between these disorders. The revised Ghent criteria used for Marfan syndrome diagnosis helped in resolving some of the confusion, especially in younger children. We report on a case of bilateral ectopia lentis in a 2-year-old child with a normal echocardiogram.  sequencing revealed a novel likely pathogenic variant described as c.385T > A (p.Cys129Ser). The patient\'s father also has a history of bilateral ectopia lentis and his genetic analysis detected the same  variant as the proband.','2018-06-01 00:00:00','2017-12-08 00:00:00','2018-05-02 00:00:00',0,0,'Mohammad, Ahmed N, AN|Atwal, Paldeep S, PS','2018-05-17 22:46:19','2018-05-17 22:46:19'),(341,35,29698085,'1460-2202','Analysis of corneal astigmatism before surgery in Chinese congenital ectopia lentis patients.','Purpose This study aims to describe the characteristics of corneal astigmatism before surgery in congenital ectopia lentis (CEL) patients. Methods This retrospective study reviewed 306 CEL patients from 1st January 2006, to 31st December 2015. One eye was randomly selected from each patient when the patient had bilateral EL. The influence of sex, laterality, and Marfan syndrome on corneal astigmatism in different age subgroups was evaluated and compared. The correlation between age and corneal astigmatism was evaluated. Results Two hundred fifty-two eyes were included in this study. The mean corneal astigmatism of CEL patients was 2.00 ± 1.28 D. There was a statistical difference in corneal astigmatism between CEL eyes with and without Marfan syndrome. However, no statistical difference was found between male and female patients, or between the EL-affected eye and the unaffected eye in monocular EL patients. There was a positive correlation between age and corneal astigmatism in CEL eyes. Conclusions This study suggests that CEL patients\' corneal astigmatism is higher in patients with Marfan syndrome, and corneal astigmatism of the CEL eye increases with age. Our results are useful for surgeons to make appropriate incision and intraocular lens (IOL) choices for patients, as well as a useful reference for designs of new IOLs.','2018-04-26 00:00:00','2018-04-26 00:00:00','2018-04-26 00:00:00',0,0,'Zhang, Yichi, Y|Jin, Guangming, G|Young, Charlotte Aimee, CA|Cao, Qianzhong, Q|Lin, Junxiong, J|Lin, Jianqiang, J|Wang, Yiyao, Y|Zheng, Danying, D','2018-05-17 22:46:19','2018-05-17 22:46:19'),(342,35,29696429,'1432-1971','The Pulmonary Artery in Pediatric Patients with Marfan Syndrome: An Underestimated Aspect of the Disease.','Aortic root dilatation and its complications are known to be the most important and life limiting features in patients with Marfan syndrome (MFS). Since monitoring of patients, preventive medical and surgical treatments are available nowadays, other MFS pathologies are becoming more relevant for the outcome of the disease. Main pulmonary artery (MPA) dilatation is a cardiac finding, which has not been fully investigated in children. Due to the similarities in tissue composition of the aortic and pulmonary root, MPA dilatation may cause complications and require treatment. In addition, it may be a predictor for severe connective tissue involvement. We retrospectively examined 135 pediatric patients with MFS. 8.1% showed MPA dilatation. MPA dilatation was associated with earlier occurrence of aortic dilatation, mitral valve prolapse, and systemic manifestations of MFS compared with patients without MPA dilatation (p < 0.05). The presence of MPA dilatation was also associated with a higher incidence of ectopia lentis (p < 0.05). Medical treatment was started earlier in MPA dilatation patients than in those without (p < 0.05). We conclude that MPA dilatation is a sign of more severe vascular and connective tissue involvement. Regular examination of the pulmonary artery is essential in MFS to avoid complications. As medical treatment of life threatening MFS events has improved, other features of MFS need to be investigated to improve quality of life.','2018-04-25 00:00:00','2018-04-25 00:00:00','2018-04-26 00:00:00',0,0,'Stark, Veronika C, VC|Huemmer, Michael, M|Olfe, Jakob, J|Mueller, Goetz C, GC|Kozlik-Feldmann, Rainer, R|Mir, Thomas S, TS','2018-05-17 22:46:19','2018-05-17 22:46:19'),(343,35,29688450,'1569-9285','Morphological features of the thoracic aorta and supra-aortic branches in patients with acute Type A aortic dissection in China.','This study aimed to investigate the morphological characteristics of the dissected thoracic aorta and brachiocephalic arteries within the Chinese population.A retrospective analysis of computed tomography scans of 387 patients with acute Type A aortic dissection was carried out. The dimensions of the thoracic aorta at multiple levels and other imaging characteristics were studied.The patients with a maximum diameter ≥55 mm accounted for less than one-third of the population. Among those without Marfan syndrome (MFS) (n = 349), only 114 (32.8%) patients had a maximal aortic diameter ≥ 55 mm, whereas among those with MFS (n = 38), 20 (78.9%) had a maximal aortic diameter ≥ 45 mm. The predicted maximum aortic diameter is 88.46 - 0.81 × height (cm) + 63.02 × body surface area (m2) + 5.50 × (if diabetes, 1, if not, 0) - 6.63 × (if hypertension, 1, if not, 0). A positive correlation was established between a circular false lumen and the probability that brachiocephalic arteries were involved by dissection. The size ratio of false lumen to true lumen was greater in the circumferential group when compared with the crescent group. The independent predictors for the circumferential false lumen were age, atherosclerosis and smoking.Herein, the morphological characteristics of the thoracic aorta among Chinese patients with acute Type A aortic dissection were described. The currently recommended criteria for prophylactic aorta surgery were applied to most patients with MFS but not to those without MFS within the Chinese population. Furthermore, the shape of the false lumen was identified as a putative risk factor that might affect the prognosis of the patients.','2018-04-24 00:00:00','2018-04-24 00:00:00','2018-04-24 00:00:00',0,0,'Wu, Jin-Lin, JL|Zhang, Liang, L|Qiu, Jun-Tao, JT|Yu, Cun-Tao, CT','2018-05-17 22:46:19','2018-05-17 22:46:19'),(344,35,29684119,'1873-734X','Aortic stiffness in adolescent Turner and Marfan syndrome patients.','Turner syndrome (TS) and Marfan syndrome (MFS) are partially characterized by aortopathies with a risk of developing severe aortic dilation, stiffness and consequent dissection and aneurysm formation. The incidence of a bicuspid aortic valve (BAV) is also increased in TS. We investigated aortic stiffness in teenage TS and MFS patients and evaluated to what degree stiffness in TS patients is augmented by the presence of a BAV.Fifty-seven patients with TS (n = 37) and MFS (n = 20), as well as 22 controls with similar age and size distribution underwent evaluation of thoracic aortic stiffness using phase-contrast magnetic resonance imaging. Calculated stiffness indices including pulse wave velocity (PWV), distensibility and relative area change (RAC) were collected to characterize the ascending aorta and descending aorta. PWV was also determined to evaluate global aortic arch stiffness.Patients with TS had reduced distensibility (0.43 vs 0.58%/mmHg, P < 0.05) and RAC (21 vs 29%, P < 0.01) in the ascending aorta when compared with normal controls. Similarly, patients with MFS had reduced ascending aortic distensibility (0.39 vs 0.58%/mmHg, P < 0.05) and RAC (22 vs 29%, P < 0.05). There were no differences in measured PWV in the ascending aorta. Patients with TS had significantly elevated PWV measured in the aortic arch when compared with controls (2.7 vs 1.9 m/s, P < 0.05). Patients with MFS had more prominent elevation in aortic arch PWV (4.2 vs 1.9 m/s, P < 0.01). The descending aortas had decreased distensibility (0.36 vs 0.55%/mmHg, P < 0.05) and RAC (18 vs 25%, P < 0.01) only in MFS patients. Additionally, 18 TS patients with a BAV were compared with 19 TS patients with a trileaflet aortic valve, without significant differences observed in any of the considered stiffness indices.TS and MFS teenage patients display evidence of increased aortic stiffness. In TS patients, this is focused in the ascending aorta and is independent of the presence of a BAV. MFS patients display a generalized reduction in compliance of the entire aorta.','2018-04-19 00:00:00','2018-04-19 00:00:00','2018-04-23 00:00:00',0,0,'Schäfer, Michal, M|Browne, Lorna P, LP|Truong, Uyen, U|Jaggers, James J, JJ|Mitchell, Max B, MB|Malone, Ladonna, L|Morgan, Gareth, G|Chatfield, Kathryn, K|McLennan, Daniel, D|Turbendian, Harma, H|Vargas, Danial, D|Fonseca, Brian, B|DiMaria, Michael, M|Shah, Anar, A|Ivy, Margaret P, MP|Barker, Alex J, AJ|Hunter, Kendall S, KS|Wilson, Neil, N|Ivy, D Dunbar, DD|Campbell, David N, DN','2018-05-17 22:46:19','2018-05-17 22:46:19'),(345,36,29767995,'1520-4804','Structure-Activity Relationships and Therapeutic Potentials of 5-HT7 Receptor Ligands: An Update.','Serotonin 5-HT7 receptor (5-HT7R) has been the subject of intense research efforts because of its presence in brain areas such as hippocampus, hypothalamus, and cortex. Preclinical data link the 5-HT7R to a variety of central nervous system processes such as regulation of circadian rhythms, mood, cognitions, pain processing, and mechanisms of addiction. 5-HT7R blockade has antidepressant effects and may ameliorate cognitive deficits associated with schizophrenia. 5-HT7R has been recently shown to modulate neuronal morphology, excitability, and plasticity, thus contributing to shape brain networks during development and to remodel neuronal wiring in the mature brain. Therefore, the activation of 5-HT7R has been proposed as a therapeutic perspective for neurodevelopmental and neuropsychiatric disorders associated with abnormal neuronal connectivity. This Perspective celebrates the silver jubilee of the discovery of 5-HT7R by providing a survey of recent studies on the medicinal chemistry of 5-HT7R ligands and on the neuropharmacology of 5-HT7R.','2018-05-16 00:00:00','2018-05-16 00:00:00','2018-05-16 00:00:00',0,0,'Modica, Maria N, MN|Lacivita, Enza, E|Intagliata, Sebastiano, S|Salerno, Loredana, L|Romeo, Giuseppe, G|Pittala, Valeria, V|Leopoldo, Marcello, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(346,36,29766490,'1600-0447','Emotional hyper-reactivity and cardiometabolic risk in remitted bipolar patients: a machine learning approach.','Remitted bipolar disorder (BD) patients frequently present with chronic mood instability and emotional hyper-reactivity, associated with poor psychosocial functioning and low-grade inflammation. We investigated emotional hyper-reactivity as a dimension for characterization of remitted BD patients, and clinical and biological factors for identifying those with and without emotional hyper-reactivity.A total of 635 adult remitted BD patients, evaluated in the French Network of Bipolar Expert Centers from 2010-2015, were assessed for emotional reactivity using the Multidimensional Assessment of Thymic States. Machine learning algorithms were used on clinical and biological variables to enhance characterization of patients.After adjustment, patients with emotional hyper-reactivity (n = 306) had significantly higher levels of systolic and diastolic blood pressure (P < 1.0 × 10 ), high-sensitivity C-reactive protein (P < 1.0 × 10 ), fasting glucose (P < 2.23 × 10 ), glycated hemoglobin (P = 0.0008) and suicide attempts (P = 1.4 × 10 ). Using models of combined clinical and biological factors for distinguishing BD patients with and without emotional hyper-reactivity, the strongest predictors were: systolic and diastolic blood pressure, fasting glucose, C-reactive protein and number of suicide attempts. This predictive model identified patients with emotional hyper-reactivity with 84.9% accuracy.The assessment of emotional hyper-reactivity in remitted BD patients is clinically relevant, particularly for identifying those at higher risk of cardiometabolic dysfunction, chronic inflammation, and suicide.','2018-05-15 00:00:00','2018-05-15 00:00:00','2018-05-16 00:00:00',0,0,'Dargél, A A, AA|Roussel, F, F|Volant, S, S|Etain, B, B|Grant, R, R|Azorin, J-M, JM|M\'Bailara, K, K|Bellivier, F, F|Bougerol, T, T|Kahn, J-P, JP|Roux, P, P|Aubin, V, V|Courtet, P, P|Leboyer, M, M|FACE-BD Collaborators|Kapczinski, F, F|Henry, C, C','2018-05-17 22:46:19','2018-05-17 22:46:19'),(347,36,29766478,'0303-7339','[Time for cluster C personality disorders: state of the art].','Compared to cluster B personality disorders, the assessment and treatment of people with obsessive-compulsive, dependent, and avoidant personality disorders (cluster C) is given little attention in the field of research and clinical practice.Presenting the current state of affairs in regard to cluster C personality disorders.A systematic literature search was conducted using the main data bases.Cluster C personality disorders are present in approximately 3-9% of the general population. In about half of the cases of mood, anxiety, and eating disorders, there is co-morbid cluster C pathology. This has a major influence on the progression of symptoms, treatment effectiveness and potential relapse. There are barely any well conducted randomized studies on the treatment of cluster-C in existence. Open cohort studies, however, show strong, lasting treatment effects.Given the frequent occurrence of cluster C personality disorders, the burden of disease, associated societal costs and the prognostic implications in case of a co-morbid cluster C personality disorder, early detection and treatment of these disorders is warranted.','2018-05-17 00:00:00','0000-00-00 00:00:00','2018-05-16 00:00:00',0,0,'Hutsebaut, J, J|Willemsen, E M C, EMC|Van, H L, HL','2018-05-17 22:46:19','2018-05-17 22:46:19'),(348,36,29766438,'1573-7284','Sexual orientation differences in outpatient psychiatric treatment and antidepressant usage: evidence from a population-based study of siblings.','In the past two decades, population-based health surveys have begun including measures of sexual orientation, permitting estimates of sexual orientation disparities in psychiatric morbidity and differences in treatment utilization. The present study takes advantage of the high-quality, comprehensive nationwide health registry data available in Sweden to examine whether psychiatric outpatient treatment for various diagnoses and antidepressant medication usage are greater in sexual minority individuals compared to their siblings. A longitudinal cohort study design was used with a representative random population-based sample in Stockholm, Sweden. Registry-based health record data on all specialized outpatient health care visits and prescription drug use was linked to a sample of 1154 sexual minority individuals from the Stockholm Public Health Cohort and their siblings. The main outcomes were treatment due to psychiatric diagnoses retrieved from nationwide registry-based health records. In analyses accounting for dependency between siblings, gay men/lesbians had a greater likelihood of being treated for mood disorder [adjusted odds ratio (AOR) 1.77; 99% confidence intervals (CI) 1.00, 3.16] and being prescribed antidepressants (AOR 1.51; 99% CI 1.10, 2.07) compared to their siblings. Further, bisexual individuals had a greater likelihood of any outpatient psychiatric treatment (AOR 1.69; 99% CI 1.17, 2.45) and being prescribed antidepressants (AOR 1.48; 99% CI 1.07, 2.05) as well as a greater likelihood of being treated for a mood disorder (AOR 1.98; 99% CI 1.33, 2.95) compared to their siblings. No difference in anxiety or substance use disorder treatment was found between any sexual minority subgroup and their siblings. The potential role of familial confounding in psychiatric disorder treatment was not supported for more than half of the outcomes that were examined. Results suggest that sexual minority individuals are significantly more likely to be treated for certain psychiatric disorders compared to their siblings. Future research is needed to understand mechanisms other than familial factors that might cause the substantial treatment differences based on sexual orientation reported here.','2018-05-15 00:00:00','2018-05-15 00:00:00','2018-05-16 00:00:00',0,0,'Bränström, Richard, R|Hatzenbuehler, Mark L, ML|Tinghög, Petter, P|Pachankis, John E, JE','2018-05-17 22:46:19','2018-05-17 22:46:19'),(349,36,29765311,'1662-5161','Altered Sense of Body Ownership and Agency in Posttraumatic Stress Disorder and Its Dissociative Subtype: A Rubber Hand Illusion Study.','Traumatic experiences have been linked to the development of altered states of consciousness affecting bodily perception, including alterations in body ownership and in sense of agency, the conscious experience of the body as one\'s own and under voluntary control. Severe psychological trauma and prolonged distress may lead to posttraumatic stress disorder (PTSD). Together, symptoms of derealization and, related specifically to the sense of body ownership and agency, of depersonalization (where parts of the body or the entire body itself is perceived as detached and out of control), constitute the dissociative subtype (PTSD+DS). In this study, we explored the Rubber Hand Illusion, an experimental paradigm utilized to manipulate sense of body ownership in PTSD ( = 4) and PTSD+DS ( = 6) as compared to healthy controls ( = 7). Perceived finger location and self-report questionnaires were used as behavioral and subjective measures of the illusion, respectively. In addition, the correlation between the illusion\'s effect and sense of agency as a continuous feeling of controlling one\'s own body movements was explored. Here, a lower illusion effect was observed in the PTSD as compared to the control group after synchronous stimulation for both the proprioceptive drift and subjectively perceived illusion. Moreover, by both proprioceptive drift and by subjective ratings, the PTSD+DS group showed a response characterized by high variance, ranging from a very strong to a very weak effect of the illusion. Finally, sense of agency showed a trend toward a negative correlation with the strength of the illusion as subjectively perceived by participants with PTSD and PTSD+DS. These findings suggest individuals with PTSD may, at times, maintain a rigid representation of the body as an avoidance strategy, with top-down cognitive processes weakening the impact of manipulation of body ownership. By contrast, the response elicited in PTSD+DS appeared to be driven by either an increased vulnerability to manipulation of embodiment or by a dominant top-down cognitive representation of the body, with disruption of multisensory integration processes likely in both cases. Taken together, these findings further our understanding of bodily consciousness in PTSD and its dissociative subtype and highlight the supportive role played by sense of agency for the maintenance of body ownership.','2018-05-17 00:00:00','2018-05-01 00:00:00','2018-05-16 00:00:00',0,0,'Rabellino, Daniela, D|Burin, Dalila, D|Harricharan, Sherain, S|Lloyd, Chantelle, C|Frewen, Paul A, PA|McKinnon, Margaret C, MC|Lanius, Ruth A, RA','2018-05-17 22:46:19','2018-05-17 22:46:19'),(350,36,29764602,'1879-1360','Psychiatric disorders among people living with HIV/AIDS in IRAN: Prevalence, severity, service utilization and unmet mental health needs.','HIV and psychiatric disorders are closely correlated and are accompanied by some similar risk factors.The aim of this study was to assess psychiatric comorbidity and health service utilization for mental problems among people living with HIV/AIDS in Iran.A total of 250 cases were randomly selected from a large referral center for HIV treatment and care in Tehran, Iran. Psychiatric disorders in the past 12 months including mood, anxiety, and substance use disorders were assessed through face-to-face interview, using a validated Persian translation of the Composite International Diagnostic Interview (CIDI v2.1). Severity of psychiatric disorders, social support, socio-economic status, service utilization and HIV-related indicators were assessed.Participants consisted of 147 men and 103 women. Psychiatric disorders were found in 50.2% (95% confidence interval: 43.8-56.6) of the participants. Major depressive disorder was the most prevalent diagnosis (32.1%), followed by substance use disorders (17.1%). In bivariate analysis, psychiatric disorders were significantly higher among male gender, single and unemployed individuals and those with lower social support. In multivariate regression analysis, only social support was independently associated with psychiatric disorders. Among those with a psychiatric diagnosis, 41.1% had used a health service for mental problems and 53% had received minimally adequate treatment.The findings of the study highlight the importance of mental health services in the treatment of people living with HIV/AIDS.','2018-07-01 00:00:00','2018-04-27 00:00:00','2018-05-16 00:00:00',0,0,'Shadloo, Behrang, B|Amin-Esmaeili, Masoumeh, M|Motevalian, Abbas, A|Mohraz, Minoo, M|Sedaghat, Abbas, A|Gouya, Mohammad Mehdi, MM|Rahimi-Movaghar, Afarin, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(351,36,29764331,'1540-7586','Psychological impact of von Hippel-Lindau genetic screening in patients with a previous history of hemangioblastoma of the central nervous system.','Von Hippel-Lindau (VHL) syndrome is a hereditary cancer syndrome characterized by a high risk of developing benign and malignant tumors, including central nervous system hemangioblastomas (CNS HBs). For an early diagnosis of VHL, before the occurrence of cancers (especially renal cell carcinoma), it is of huge importance to initiate VHL genetic testing in at-risk patients. The aim of the study was to assess the psychological impact of VHL genetic testing in patients previously diagnosed with a CNS HB. From 1999 until 2015, 55 patients underwent surgery for CNS HBs. Eleven patients were already screened for VHL mutations and 3 patients deceased before the start of the study. From the remaining 42 patients, 24 were accepted to be enrolled in the study. Assessment of psychological impact of VHL genetic testing was performed by measuring anxiety levels, mood disorders, quality of life, and psychological consequences of genetic screening. Twenty-one of the enrolled 24 patients underwent VHL genetic testing and 12 patients came back for the communication of positive genetic results. The baseline psychological status did not differ between these 2 groups. Patients who attended the visit of communication of genetic results had similar anxiety levels compared to those who had not. Furthermore, they also experienced an improvement in the level of anxiety and two QoL dimension scores compared to their baseline status. In summary, there is no evidence of a negative psychosocial impact of VHL genetic testing in patients with a previous history of CNS HB. We, therefore, recommend the recall of patients who have not been previously screened.','2018-05-15 00:00:00','2018-05-15 00:00:00','2018-05-16 00:00:00',0,0,'Rochette, Claire, C|Baumstarck, Karine, K|Canoni-Zattara, Hélène, H|Abdullah, Ahmad Esmaeel, AE|Figarella-Branger, Dominique, D|Pertuit, Morgane, M|Barlier, Anne, A|Castinetti, Frédéric, F|Pacak, Karel, K|Metellus, Philippe, P|Taïeb, David, D','2018-05-17 22:46:19','2018-05-17 22:46:19'),(352,36,29764282,'0891-9887','Animal-Assisted Therapy in Elderly Patients: Evidence and Controversies in Dementia and Psychiatric Disorders and Future Perspectives in Other Neurological Diseases.','Animal-assisted therapy (AAT) includes a set of nonpharmacological interventions aimed at improving human health through the use of trained or untrained animals. In recent decades, AAT has been trialed for different neurological and psychiatric disorders. In patients with dementia, interaction with animals seems to have a positive influence on aggressiveness and anxiety and to ameliorate quality of life and relationship skills. In psychiatric patients, AAT seems to increase motivation and self-esteem, improve prosocial conduct, and decrease behavioral problems. The aim of this study is to review the literature on AAT for elderly people with dementia and psychiatric disorders. Other fields of possible application for AAT are suggested.','2018-01-01 00:00:00','2018-01-01 00:00:00','2018-05-16 00:00:00',0,0,'Peluso, Silvio, S|De Rosa, Anna, A|De Lucia, Natascia, N|Antenora, Antonella, A|Illario, Maddalena, M|Esposito, Marcello, M|De Michele, Giuseppe, G','2018-05-17 22:46:19','2018-05-17 22:46:19'),(353,36,29764272,'1502-4725','Does S100B have a potential role in affective disorders? A literature review.','S100B is a calcium-binding protein located in glial cells; it is regarded as a potential biomarker in affective disorders.To review the literature investigating the role of S100B in patients with affective disorders.A systematic review of original English language studies investigating S100B in serum, cerebrospinal fluid, plasma and lymphocytes, in patients with affective disorders, was conducted. The literature search was conducted within the PubMed database. Effect sizes were calculated to adjust for systematic measurement effects.Twenty studies were included, with a total of 1292 participants. Of these, 398 patients had or have had depressive disorder, 301 patients had bipolar disorder and 593 were healthy controls. S100B levels in serum were consistently elevated in studies with statistically significant results which investigated acute affective episodes (comprising major depressive episode in major depressive disorder, and both manic and depressive episodes in patients with bipolar disorder), in comparison to healthy controls. There were few studies assessing S100B levels in cerebrospinal fluid, plasma or lymphocytes, and these had inconsistent results.The results indicated that elevated S100B levels might be associated with mood episodes in affective disorders. However, the role of S100B, and its possible impact in affective disorders, requires further investigation and at the present S100B does not have a role as clinically biomarker in affective disorder. Future longitudinal multicentre studies with larger transdiagnostic real life patient cohorts are warranted.','2018-05-15 00:00:00','2018-05-15 00:00:00','2018-05-16 00:00:00',0,0,'Kroksmark, Hilda, H|Vinberg, Maj, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(354,36,29762764,'1550-9109','Insomnia as a Path to Alcoholism: Tolerance Development and Dose Escalation.','To assess the risks associated with the use of alcohol as a \"sleep aid\", we evaluated tolerance development to pre-sleep ethanol\'s sedative-hypnotic effects, subsequent ethanol dose escalation, and changes in mood and ethanol \"liking\".Volunteers, 21-55 yrs old, with insomnia in otherwise good medical and psychiatric health and no history of alcoholism or drug abuse participated. In experiment 1 (n=24) 0.0, 0.3, or 0.6 g/kg (n=8 per dose) ethanol was administered before sleep and 8 hr nocturnal polysomnograms (NPSGs) were collected. In experiment 2 after 6 nights pre-treatment with ethanol 0.45 g/kg (n=6) vs placebo (n=6), choice of pre-sleep ethanol or placebo was assessed over 7 choice nights.The 0.6 g/kg ethanol dose increased total sleep time and stage 3-4 sleep on night 2, but these effects were lost by night 6 (p<.05). Six nights of ethanol pre-treatment produced on the choice nights more self-administered ethanol refills than the placebo pretreatment (p<.03). Conclusions: These are the first data to explicitly show the risks associated with the use of alcohol as a \"sleep aid\" among people with insomnia. Initially, a moderate dose of ethanol improved NPSG sleep and self-reported sedative effects, which was lost by night 6. Tolerance was associated with enhanced self-administration of pre-sleep ethanol.','2018-05-12 00:00:00','2018-05-12 00:00:00','2018-05-15 00:00:00',0,0,'Roehrs, Timothy, T|Roth, Thomas, T','2018-05-17 22:46:19','2018-05-17 22:46:19'),(355,37,29768729,'1520-7560','Adaptive changes in pancreas post Roux-en-Y gastric bypass induced weight loss.','Obesity has been shown to trigger adaptive increases in pancreas parenchymal and fat volume. Consecutively, pancreatic steatosis may lead to beta-cell dysfunction. However, it is not known, whether the pancreatic tissue components decrease with weight loss and pancreatic steatosis is reversible following RYGB. Therefore, the objective of the study was to investigate the effects of RYGB-induced weight loss on pancreatic volume and glucose homeostasis.11 patients were recruited in the Obesity Centre of the University Medical Centre Hamburg-Eppendorf. Before and 6 months after RYGB, total GLP-1 levels were measured during OGTT. To assess changes in visceral adipose tissue and pancreatic volume, MRI was performed. Measures of glucose homeostasis and insulin indices were assessed. Fractional beta-cell area was estimated by correlation with the C-peptide-to-glucose ratio, beta-cell mass was calculated by the product of beta-cell area and pancreas parenchymal weight.Pancreas volume decreased from 83.8 (75.7-92.0) to 70.5 (58.8-82.3) cm [mean (95% CI), p=0.001]. The decrease in total volume was associated with a significant decrease in fat volume. Fasting insulin and C-peptide were lower post RYGB. HOMA-IR levels decreased, whereas insulin sensitivity increased (p=0.03). This was consistent with a reduction in the estimated beta-cell area and mass.Following RYGB, pancreatic volume and steatosis adaptively decreased to \"normal\" levels with accompanying improvement in glucose homeostasis. Moreover, obesity-driven beta-cell expansion seems to be reversible, however future studies must define a method to more accurately estimate functional beta-cell mass to increase our understanding of glucose homeostasis after RYGB.','2018-05-16 00:00:00','2018-05-16 00:00:00','2018-05-16 00:00:00',0,0,'Lautenbach, A, A|Wernecke, M, M|Riedel, N, N|Veigel, J, J|Yamamura, J, J|Keller, S, S|Jung, R, R|Busch, P, P|Mann, O, O|Knop, F K, FK|Holst, J J, JJ|Meier, J J, JJ|Aberle, J, J','2018-05-17 22:46:19','2018-05-17 22:46:19'),(356,37,29768728,'1467-789X','Evaluation of complex community-based childhood obesity prevention interventions.','Multi-setting, multi-component community-based interventions have shown promise in preventing childhood obesity; however, evaluation of these complex interventions remains a challenge.The objective of the study is to systematically review published methodological approaches to outcome evaluation for multi-setting community-based childhood obesity prevention interventions and synthesize a set of pragmatic recommendations.MEDLINE, CINAHL and PsycINFO were searched from inception to 6 July 2017. Papers were included if the intervention targeted children ≤18 years, engaged at least two community sectors and described their outcome evaluation methodology. A single reviewer conducted title and abstract scans, full article review and data abstraction. Directed content analysis was performed by three reviewers to identify prevailing themes.Thirty-three studies were included, and of these, 26 employed a quasi-experimental design; the remaining were randomized control trials. Body mass index was the most commonly measured outcome, followed by health behaviour change and psychosocial outcomes. Six themes emerged, highlighting advantages and disadvantages of active vs. passive consent, quasi-experimental vs. randomized control trials, longitudinal vs. repeat cross-sectional designs and the roles of process evaluation and methodological flexibility in evaluating complex interventions.Selection of study designs and outcome measures compatible with community infrastructure, accompanied by process evaluation, may facilitate successful outcome evaluation.','2018-05-16 00:00:00','2018-05-16 00:00:00','2018-05-16 00:00:00',0,0,'Karacabeyli, D, D|Allender, S, S|Pinkney, S, S|Amed, S, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(357,37,29768647,'1439-4421','[Neighbourhood deprivation and community nutrition environment: associations between the social and built environment and food availability].','Eating habits are influenced by individual socioeconomic status (SES). As the association between neighbourhood characteristics and food availability is still unclear, we investigated the community nutrition environment in different neighbourhoods.Using official data of the city of Leipzig, we selected three neighbourhoods which differed in terms of their social (2 deprived vs. 1 affluent) and built (1 large housing estates vs. 2 historic buildings) environment. Data on food outlets were assessed via direct observation (ground truthing).Social and residential environment characteristics are associated with food availability. The proportion of fast food outlets is higher in deprived neighbourhoods compared to the affluent one (25%, 30.4% vs. 13.5%). Neighbourhoods with historic buildings offer a greater variety of food outlets.The greater availability of unhealthy food may contribute to the development of obesity. Preventive measures should consider the physical and social environment.','2018-05-16 00:00:00','2018-05-16 00:00:00','2018-05-16 00:00:00',0,0,'Latawitz, Toni, T|Spielau, Ulrike, U|Lipek, Tobias, T|Gausche, Ruth, R|Lück, Martina, M|Kiess, Wieland, W|Grande, Gesine, G|Igel, Ulrike, U','2018-05-17 22:46:19','2018-05-17 22:46:19'),(358,37,29768614,'1678-4561','Factors associated with negative self-rated health in menopausal women.','The scope of this study was to investigate the prevalence and factors associated with negative self-rated health in menopausal women registered with the Family Health Strategy in a Brazilian urban center. It is a cross-sectional study with a random sample of menopausal women. A validated instrument addressing sociodemographic and behavioral data related to self-rated health status was used. The association between the variables studied and negative self-rated health was assessed by bivariate analysis followed by Poisson regression with robust variance, in a hierarchical model. The prevalence of negative self-rated health among the population studied was 41.6%, among 761 women. Among women aged 52-65 years old, 49.2% had negative self-rated health. Age corresponding to post-menopause, education up to eight years of study, having a partner, not having a formal job, current tobacco use and physical inactivity were associated with negative self-rated health. The presence of menopausal symptoms, overweight and obesity, the current use of medication and the presence of chronic diseases were also associated with negative self-rated health in the final model. The associations observed point to the need for health promotion activities aimed at menopausal women.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-05-16 00:00:00',0,0,'Silva, Vitor Hipólito, VH|Rocha, Josiane Santos Brant, JSB|Caldeira, Antonio Prates, AP','2018-05-17 22:46:19','2018-05-17 22:46:19'),(359,37,29768583,'1678-4464','Self-reported weight and height are valid measures to determine weight status: results from the Brazilian National Health Survey (PNS 2013).','Self-reported measures have been used to obtain weight and height information in some epidemiological surveys. The validation of such information is necessary to guarantee data quality. This study assessed the validity of self-reported weight and height to determine weight status. Data were obtained in the Brazilian National Health Survey, a Brazilian household-based nationwide survey carried out in 2013. In this survey, 40,366 individuals (aged ≥ 18 years) provided self-reported and measured information about weight and height. Student\'s paired t-test was used to verify the differences between self-reported and measured data. The agreement between measurements was obtained using the intraclass correlation coefficient (ICC) and Bland-Altman method. To evaluate variations in weight status categorizations, the weighted kappa coefficient and exact agreement were used. Sensitivity and specificity were estimated for the self-reported information to classify overweight and obese individuals. There was high agreement between self-reported and measured weight, height, and body mass index (ICC > 0.88). The mean agreements estimated by the Bland-Altman method were 99.6% for weight and 100.6% for height. The weighted kappa coefficient showed substantial agreement among the weight status categories (> 0.66); the exact agreement was 77%. Sensibility and specificity for overweight (83% and 87.5%, respectively) and obesity (73.4% and 96.7%, respectively) were considered high for the sociodemographic characteristics evaluated. According to our results, self-reported measurements of weight and height can be used cautiously as valid alternatives to determine weight status.','2018-05-10 00:00:00','2018-05-10 00:00:00','2018-05-16 00:00:00',0,0,'Moreira, Naiara Ferraz, NF|Luz, Verônica Gronau, VG|Moreira, Caroline Camila, CC|Pereira, Rosângela Alves, RA|Sichieri, Rosely, R|Ferreira, Márcia Gonçalves, MG|Muraro, Ana Paula, AP|Rodrigues, Paulo Rogério Melo, PRM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(360,37,29768581,'1678-4464','Built environment, contextual income, and obesity in older adults: evidence from a population-based study.','The objective was to verify the association between built environment, contextual income, and obesity in older adults in Florianópolis, Santa Catarina State, Brazil. This was a cross-sectional study in a sample of 1,197 older people (≥ 60 years) evaluated in the EpiFloripa Older Adults Cohort in 2013/2014. The outcomes were overall obesity, abdominal obesity, waist circumference (WC), and body mass index (BMI). Contextual income in the census tract and characteristics of the built environment were analyzed using data from the Florianópolis Institute of Urban Planning (IPUF) and the 2010 Population Census. Logistic and multilevel linear regression models were used. For older women, intermediate mean income was associated with lower odds of abdominal and overall obesity, while higher percentage of paved streets in the census tract was associated with lower odds of abdominal obesity; one percentage point increment in local commerce decreased WC by 0.20cm, and a one percentage point increase in paved streets decreased WC by 0.43cm and BMI by 0.22kg/m2. For older men, better street connectivity and intermediate percentage of local commerce were associated with lower odds of overall obesity; the increment in street density decreased WC by 0.34cm and BMI by 10kg/m2; a one-point increment in lighting increased WC by 0.51cm and BMI by 0.11kg/m2. The results showed different associations according to sex and target outcome, highlighting the need for further studies to explore additional relevant contextual variables for these outcomes in older adults.','2018-05-10 00:00:00','2018-05-10 00:00:00','2018-05-16 00:00:00',0,0,'Araújo, Carolina Abreu Henn de, CAH|Giehl, Maruí W Corseuil, MWC|Danielewicz, Ana Lúcia, AL|Araujo, Pierre Guedes de, PG|d\'Orsi, Eleonora, E|Boing, Antonio Fernando, AF','2018-05-17 22:46:19','2018-05-17 22:46:19'),(361,37,29768501,'1932-6203','Secretion of autoimmune antibodies in the human subcutaneous adipose tissue.','The adipose tissue (AT) contributes to systemic and B cell intrinsic inflammation, reduced B cell responses and secretion of autoimmune antibodies. In this study we show that adipocytes in the human obese subcutaneous AT (SAT) secrete several pro-inflammatory cytokines and chemokines, which contribute to the establishment and maintenance of local and systemic inflammation, and consequent suboptimal immune responses in obese individuals, as we have previously shown. We also show that pro-inflammatory chemokines recruit immune cells expressing the corresponding receptors to the SAT, where they also contribute to local and systemic inflammation, secreting additional pro-inflammatory mediators. Moreover, we show that the SAT generates autoimmune antibodies. During the development of obesity, reduced oxygen and consequent hypoxia and cell death lead to further release of pro-inflammatory cytokines, \"self\" protein antigens, cell-free DNA and lipids. All these stimulate class switch and the production of autoimmune IgG antibodies which have been described to be pathogenic. In addition to hypoxia, we have measured cell cytotoxicity and DNA damage mechanisms, which may also contribute to the release of \"self\" antigens in the SAT. All these processes are significantly elevated in the SAT as compared to the blood. We definitively found that fat-specific IgG antibodies are secreted by B cells in the SAT and that B cells express mRNA for the transcription factor T-bet and the membrane marker CD11c, both involved in the production of autoimmune IgG antibodies. Finally, the SAT also expresses RNA for cytokines known to promote Germinal Center formation, isotype class switch, and plasma cell differentiation. Our results show novel mechanisms for the generation of autoimmune antibody responses in the human SAT and allow the identification of new pathways to possibly manipulate in order to reduce systemic inflammation and autoantibody production in obese individuals.','2018-05-17 00:00:00','2018-05-16 00:00:00','2018-05-16 00:00:00',0,0,'Frasca, Daniela, D|Diaz, Alain, A|Romero, Maria, M|Thaller, Seth, S|Blomberg, Bonnie B, BB','2018-05-17 22:46:19','2018-05-17 22:46:19'),(362,37,29768438,'1932-6203','Survival in patients on hemodialysis: Effect of gender according to body mass index and creatinine.','The association of a higher body mass index (BMI) with better survival is a well-known \"obesity paradox\" in patients on hemodialysis (HD). However, men and women have different body compositions, which could impact the effect of BMI on mortality. We investigated the effect of gender on the obesity-mortality relationship in Korean patients on HD.This study included 2,833 maintenance patients on HD from a multicenter prospective cohort study in Korea (NCT00931970). The relationship between categorized BMI and gender-specific mortality was evaluated by an adjusted Cox proportional hazard model with restricted cubic spline analyses and the Competing risk analysis. We also investigated the effect of changes in BMI over 12 months and serum creatinine level on survival in male and female patients on HD.The mean BMI was 22.6 ± 3.3 kg/m2 and the mean follow up duration was 24.2 ± 3.4 months. The patients with the highest quintile of BMI (≥25.1 kg/m2) showed lower mortality (subdistributional hazard ratio [SHR] = 0.63, 95% confidence interval [CI] = 0.43-0.93, P = 0.019) compared with those with the reference BMI quintile. When analyzed by gender, male patients with a BMI over 25.1 kg/m2 had lower mortality risk (HR = 0.43, 95% CI = 0.25-0.75, P = 0.003); however, no significant difference was found in female patients. Increased BMI after 12 months and high serum creatinine were associated with better survival only in male patients on HD.BMI could be used as a risk factor for mortality in male patients on HD. However, the mortality of female patients on HD was not related with baseline and follow-up BMI. This suggests that BMI is a good surrogate marker of lean body composition, especially in male patients on HD.','2018-05-17 00:00:00','2018-05-16 00:00:00','2018-05-16 00:00:00',0,0,'Park, Jeung-Min, JM|Lee, Jong-Hak, JH|Jang, Hye Min, HM|Park, Yeongwoo, Y|Kim, Yon Su, YS|Kang, Shin-Wook, SW|Yang, Chul Woo, CW|Kim, Nam-Ho, NH|Kwon, Eugene, E|Kim, Hyun-Ji, HJ|Lee, Ji-Eun, JE|Jung, Hee-Yeon, HY|Choi, Ji-Young, JY|Park, Sun-Hee, SH|Kim, Chan-Duck, CD|Cho, Jang-Hee, JH|Kim, Yong-Lim, YL|Clinical Research Center for End Stage Renal Disease (CRC for ESRD) Investigators','2018-05-17 22:46:19','2018-05-17 22:46:19'),(363,37,29768270,'1423-0097','Associations of Current Wheeze and Body Mass Index with Perennial and Seasonal Allergic Rhinitis in Young Adults.','The coexistence of asthma and allergic rhinitis (AR) and its distinct association with obesity have been reported. However, few studies have differentiated the two types of AR, i.e., perennial (PAR) and seasonal AR (SAR), with regard to their associations with asthma and obesity. The aim of this study was to evaluate the coexistence of current wheeze and two types of AR and the impact of body mass index (BMI) on these two conditions in Japanese young adults.First-year students from Hokkaido University were enrolled into this study from 2011 to 2016. A questionnaire survey including the prevalence of current wheeze, PAR, and SAR every year for 11,917 nonsmoking young adults was conducted. The difference in the impact of current wheeze and BMI on these two types of AR was separately evaluated.Although both PAR and SAR were significantly associated with current wheeze, the impact of these two AR types on current wheeze was different (OR for PAR = 2.46 vs. OR for SAR = 1.29). When we classified all of the subjects into 4 groups with or/and without the two types of AR, the prevalence of current wheeze was significantly higher in subjects with PAR than in those without PAR (p < 0.001). However, the prevalence of current wheeze did not differ between subjects with or without SAR. Multinomial regression analyses showed that the association of wheeze with PAR and/or SAR was stronger compared to that of wheeze with SAR without PAR. The prevalence of PAR was not associated with BMI. Contrarily, a low BMI was significantly associated with a high SAR prevalence (p < 0.05).Comparisons between PAR and SAR showed that the conditions are differentially associated with current wheeze and BMI.','2018-05-16 00:00:00','2018-05-16 00:00:00','2018-05-16 00:00:00',0,0,'Matsumoto, Munehiro, M|Konno, Satoshi, S|Kimura, Hirokazu, H|Takei, Nozomu, N|Kimura, Hiroki, H|Shimizu, Kaoruko, K|Goudarzi, Houman, H|Suzuki, Masaru, M|Hashino, Satoshi, S|Nishimura, Masaharu, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(364,37,29768198,'2211-1247','Myocardin-Related Transcription Factor A Promotes Recruitment of ITGA5+ Profibrotic Progenitors during Obesity-Induced Adipose Tissue Fibrosis.','Adipose tissue fibrosis is associated with inflammation and insulin resistance in human obesity. In particular, visceral fat fibrosis is correlated with hyperlipidemia and ectopic fat accumulation. Myocardin-related transcription factor A (MRTFA) is an important coactivator that mediates the transcription of extracellular matrix and other fibrogenic genes. Here, we examine the role of MRTFA in the development of adipose tissue fibrosis and identify a signaling pathway that regulates the fate of vascular progenitors. We demonstrate that obesity induces the formation of Sca1, Sma, ITGA5 fibrogenic progenitor cells (FPCs) in adipose tissue. MRTFA deficiency in mice shifts the fate of perivascular progenitors from FPCs to adipocyte precursor cells and protects against chronic obesity-induced fibrosis and accompanying metabolic dysfunction, without a shift in energy expenditure. Our findings highlight the ITGA5-MRTFA pathway as a potential target to ameliorate obesity-associated metabolic disease.','2018-05-15 00:00:00','0000-00-00 00:00:00','2018-05-16 00:00:00',0,0,'Lin, Jean Z, JZ|Rabhi, Nabil, N|Farmer, Stephen R, SR','2018-05-17 22:46:19','2018-05-17 22:46:19'),(365,38,29768343,'1536-5964','Potential common factors associated with predisposition to common cold in middle-aged and elderly Japanese: A community-based cross-sectional study.','People worldwide frequently catch a common cold, which occasionally develops into secondary severe conditions such as pneumonia. However, it is unclear whether predisposition to the common cold is associated with the individual\'s characteristics including age, body weight, lifestyles, diets, and intestinal functions, besides exposure to a responsible pathogen. We addressed this issue epidemiologically considering many relevant clinical factors.We reviewed data from a cross-sectional study consisting of 39,524 apparently healthy Japanese aged 40 to 79 years (26,975 men and 12,549 women) who underwent a checkup in 2007. Self-reported predisposition to common cold (SPCC) and relevant clinical conditions and parameters were considered.We observed no significant difference in most clinical parameters including age, body mass index (BMI), glycated hemoglobin (HbA1c), and prevalence of men and current smokers between subjects with and without SPCC. In univariate analysis, circulating white blood cell (WBC) count and serum alanine-aminotransferase (ALT) were significantly higher in subjects with SPCC than in those without, whereas serum high-density lipoprotein cholesterol (HDL-C) and duration of sleep were lower. In logistic regression analysis after full adjustment for relevant confounding factors, BMI categories except BMI of ≥27.0 kg/m were significantly associated with SPCC compared with BMI of 23.0 to 24.9 kg/m. Short duration of sleep (≤5 hours), occasional alcohol drinking, and no-exercise were significantly associated with SPCC compared with 7 hours sleep duration, no-drinking alcohol, and low frequent exercise (twice per month), respectively. All gastrointestinal disorders (gastric complaints, constipation, and diarrhea) were independently associated with SPCC. Imbalanced diet and taking a snack were also associated with SPCC in a degree dependent manner. Furthermore, WBC count, serum ALT, and HDL-C (as continuous variables) were associated with SPCC (HDL-C was inversely), whereas no significant association was observed between SPCC and age, smoking, HbA1c, and pharmacotherapy for diabetes, hypertension, and dyslipidemia.Our results demonstrated that multifactorial conditions and parameters might be simultaneously associated with the predisposition to common cold. Prospective studies including detailed common cold questionnaire and measurements are needed to confirm currently suspected causative and protective factors.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-05-16 00:00:00',0,0,'Shibata, Michi, M|Iwane, Taizo, T|Higuchi, Ryoko, R|Suwa, Kaname, K|Nakajima, Kei, K','2018-05-17 22:46:19','2018-05-17 22:46:19'),(366,38,29768293,'1535-1815','Seasonality of Common Pediatric Infectious Diseases.','Traditional sources cite seasonal patterns for common infectious diseases, often based on microbiologic data, but little is known about cyclical trends in clinically diagnosed infectious conditions in the emergency department (ED). We leveraged the publicly available Nationwide Emergency Department Sample database to measure the seasonality of the most common pediatric infectious diseases diagnosed in US EDs.We searched the Nationwide Emergency Department Sample database to identify infectious diagnoses comprising at least 1% of all diagnosis codes ascribed to patients 21 years and younger in US EDs from 2009 to 2013. We used Fourier regression to examine seasonal trends in disease and calculated the peak-to-nadir ratio for each infectious condition.Over 20% of pediatric visits during the study period were for infectious conditions. Upper respiratory infection, otitis media, gastroenteritis, urinary tract infection/pyelonephritis, cellulitis/abscess, and pneumonia showed a seasonal pattern that matched trends found in prior regional or microbiologic-based studies. The strongest seasonal trend as measured by goodness of model fit was found in pneumonia (peak-to-nadir incidence ratio of 2.7), followed by otitis media (2.0), cellulitis/abscess (2.0), gastroenteritis (1.6), upper respiratory infection (3.2), and urinary tract infection/pyelonephritis (1.4). Pharyngitis did not show a strong seasonal trend.Many of the most common pediatric infectious diseases diagnosed in US EDs exhibited seasonal patterns. Large administrative databases can be used to track seasonal disease patterns, with the advantage that they reflect clinician diagnosis beyond microbiologic confirmation. This methodology could aid in resource planning, infection control, and public health educational initiatives.','2018-05-15 00:00:00','2018-05-15 00:00:00','2018-05-16 00:00:00',0,0,'Lipsett, Susan C, SC|Monuteaux, Michael C, MC|Fine, Andrew M, AM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(367,38,29768275,'1423-0356','Predictive Factors for the Long-Term Deterioration of Pulmonary Function in Interstitial Lung Disease Associated with Anti-Aminoacyl-tRNA Synthetase Antibodies.','Little has been reported on long-term pulmonary function trends among patients with interstitial lung disease associated with anti-aminoacyl-tRNA synthetase antibodies (ARS-ILD).To clarify the factors predictive of progression in ARS-ILD based on patients\' initial clinical and radiological features.The clinical courses of 88 patients with > 1 year of follow-up data on pulmonary function tests (PFTs) were retrospectively analyzed. Disease behavior was categorized into three groups: (1) improved or (2) worsened (defined as increases or decreases, respectively, of > 10% in forced vital capacity and > 15% in %diffusing capacity of lung carbon monoxide) or (3) stable based on PFT changes compared between 1-year results as the initial data and results at 3 years to assess the long-term course.In the initial course of 75 patients with ARS-ILD who received anti-inflammatory therapy within 6 months after diagnosis, 48 patients (64.0%) improved and 6 patients (8.0%) worsened. The radiological patterns in the patients with ARS-ILD included nonspecific interstitial pneumonia (NSIP) in 46.7% and NSIP with organizing pneumonia overlap in 52.0% of the cases. One-third of the initially improved patients who worsened over the long-term course were assigned to the unstable group. By multivariate logistic analysis, middle lobe traction bronchiectasis was a significant predictive factor for the patients in the unstable group.Most patients with ARS-ILD receiving anti-inflammatory therapy had improved or remained stable in the first year. However, over the long-term course, some patients worsened despite their initial improvement. Even though the extent of the disease is limited, middle lobe traction bronchiectasis in ARS-ILD may be a useful predictor of poor long-term disease behavior.','2018-05-16 00:00:00','2018-05-16 00:00:00','2018-05-16 00:00:00',0,0,'Yamakawa, Hideaki, H|Hagiwara, Eri, E|Kitamura, Hideya, H|Iwasawa, Tae, T|Otoshi, Ryota, R|Aiko, Naoto, N|Katano, Takuma, T|Shintani, Ryota, R|Ikeda, Satoshi, S|Okuda, Ryo, R|Sekine, Akimasa, A|Baba, Tomohisa, T|Iso, Shinichiro, S|Kuwano, Kazuyoshi, K|Sato, Shinji, S|Ogura, Takashi, T','2018-05-17 22:46:19','2018-05-17 22:46:19'),(368,38,29768218,'1950-6007','MicroRNA-1247 inhibits lipopolysaccharides-induced acute pneumonia in A549 cells via targeting CC chemokine ligand 16.','This study aimed to explore the potential roles and mechanism of miR-1247 in lipopolysaccharides (LPS)-induced acute pneumonia.The miR-1247 expression in acute stage patients with infantile pneumonia was detected. To establish the cell model of acute pneumonia, A549 cells were treated with 1 mg/mL lipopolysaccharides (LPS). The effects of miR-1247 dysregulation on the cell viability, apoptosis, inflammation and autophagy of LPS-induced A549 cells were investigated. Moreover, the functional targets of miR-1247 were identified and the regulatory relationships between miR-1247 and JNK or NF-κB pathways were explored.The miR-1247 was lowly expressed in acute phage patients with infantile pneumonia. In addition, LPS treatment significantly inhibited A549cell viability, induced apoptosis, promoted the production of cytokines and decreased autophagy, thus causing A549 cell injury. Moreover, miR-1247 was decreased expression after LPS treatment, and overexpression of miR-1247 alleviated LPS-induced A549 cell injury. Furthermore, CC chemokine ligand (CCL) 16 was a functional target gene of miR-1247. Knockdown of CCL16 alleviated LPS-induced cell injury, and the combination of miR-1247 inhibition and CCL16 knockdown reversed the effects of CCL16 knockdown alone on LPS-induced A549 cell injury. Besides, inhibition of miR-1247 activated JNK and NF-κB pathways, while knockdown of CCL16 inhibited the activation of these pathways.Our data reveals that miR-1247 is lowly expressed in acute stage patients with infantile pneumonia. Overexpression of miR-1247 may alleviate LPS-induced A549 cell injury through targeting CCL16. JNK and NF-κB pathways may be key mechanisms to regulate the role of miR-1247 in LPS-induced lung injury.','2018-05-13 00:00:00','2018-05-13 00:00:00','2018-05-16 00:00:00',0,0,'Guo, Jinjing, J|Cheng, Ying, Y','2018-05-17 22:46:19','2018-05-17 22:46:19'),(369,38,29767784,'1460-2393','Imaging Features of Typical Usual Interstitial Pneumonia (UIP).','No abstract found.','2018-05-14 00:00:00','2018-05-14 00:00:00','2018-05-16 00:00:00',0,0,'Escalon, Joanna G, JG|Lynch, David A, DA','2018-05-17 22:46:19','2018-05-17 22:46:19'),(370,38,29767563,'1522-1210','Integrative Physiology of Pneumonia.','Pneumonia is a type of acute lower respiratory infection that is common and severe. The outcome of lower respiratory infection is determined by the degrees to which immunity is protective and inflammation is damaging. Intercellular and interorgan signaling networks coordinate these actions to fight infection and protect the tissue. Cells residing in the lung initiate and steer these responses, with additional immunity effectors recruited from the bloodstream. Responses of extrapulmonary tissues, including the liver, bone marrow, and others, are essential to resistance and resilience. Responses in the lung and extrapulmonary organs can also be counterproductive and drive acute and chronic comorbidities after respiratory infection. This review discusses cell-specific and organ-specific roles in the integrated physiological response to acute lung infection, and the mechanisms by which intercellular and interorgan signaling contribute to host defense and healthy respiratory physiology or to acute lung injury, chronic pulmonary disease, and adverse extrapulmonary sequelae. Pneumonia should no longer be perceived as simply an acute infection of the lung. Pneumonia susceptibility reflects ongoing and poorly understood chronic conditions, and pneumonia results in diverse and often persistent deleterious consequences for multiple physiological systems.','2018-07-01 00:00:00','0000-00-00 00:00:00','2018-05-16 00:00:00',0,0,'Quinton, Lee J, LJ|Walkey, Allan J, AJ|Mizgerd, Joseph P, JP','2018-05-17 22:46:19','2018-05-17 22:46:19'),(371,38,29766740,'1943-572X','Factors Predictive of Postoperative Acute Respiratory Failure Following Inpatient Sinus Surgery.','The impact of perioperative risk factors on outcomes following outpatient sinus surgery is well defined; however, risk factors and outcomes following inpatient surgery remain poorly understood. We aimed to define risk factors of postoperative acute respiratory failure following inpatient sinus surgery.Utilizing data from the Nationwide Inpatient Sample Database from the years 2010 to 2014, we identified patients (≥18 years of age) with an Internal Classification of Disease, Ninth Revision, Clinical Modification (ICD-9-CM) procedure code of sinus surgery. We used multivariable logistic regression to identify risk factors of postoperative acute respiratory failure.We identified 4919 patients with a median age of 53 years. The rate of inpatient postoperative acute respiratory failure was 3.35%. Chronic sinusitis (57.7%) was the most common discharge diagnosis. The final multivariable logistic regression analysis suggested that pneumonia, bleeding disorder, alcohol dependence, nutritional deficiency, heart failure, paranasal fungal infections, and chronic kidney disease were associated with increased odds of acute respiratory failure (all P < .05).To our knowledge, this represents the first study to evaluate potential risk factors of acute respiratory failure following inpatient sinus surgery. Knowledge of these risk factors may be used for risk stratification.','2018-05-01 00:00:00','2018-05-01 00:00:00','2018-05-16 00:00:00',0,0,'Burton, Brittany N, BN|Gilani, Sapideh, S|Swisher, Matthew W, MW|Urman, Richard D, RD|Schmidt, Ulrich H, UH|Gabriel, Rodney A, RA','2018-05-17 22:46:19','2018-05-17 22:46:19'),(372,38,29766339,'0942-0940','Predicting factors for shunt-dependent hydrocephalus in patients with aneurysmal subarachnoid hemorrhage.','Chronic hydrocephalus after aneurysmal subarachnoid hemorrhage (SAH) is a major complication that leads to a medical burden and poor clinical outcomes. The aim of this study was to evaluate the predictive factors of shunt-dependent hydrocephalus focusing on postoperative fever and infection.A total of 418 patients were included in this study and the patient demographic features, radiologic findings, days of fever burden, and infection were compared between the shunt (n = 72) and no shunt group (n = 346). Days of fever burden was defined as the total number of days with the highest body temperature ≥ 38.0 °C each day from day 1 to day 14. Pneumonia, urinary tract infection (UTI), meningitis, and bacteremia were recorded in all patients.The independent predictive factors for shunt-dependent hydrocephalus were older age ≥ 65, microsurgical clipping, placement of extraventricular drainage (EVD), days of fever burden, and infection. The incidence of shunt dependency was 2.4% in the no fever burden patients (n = 123), 14.9% in the 1-3 days of fever burden patients (n = 161), 27.0% in the 4-6 days of fever burden patients (n = 74), and 41.7% in the ≥ 7 days of fever burden patients with statistical significance among groups (p < 0.001).The rate of shunt dependency increased proportionally as the days of fever burden increased. Older age (≥ 65), microsurgical clipping, placement of EVD, days of fever burden, and infection were independent predictive factors for shunt dependency. Proper postoperative care for maintaining normal body temperature and preventing infectious disease can help reduce the rate of shunt dependency and improve clinical outcomes.','2018-05-15 00:00:00','2018-05-15 00:00:00','2018-05-16 00:00:00',0,0,'Park, Yung Ki, YK|Yi, Hyeong-Joong, HJ|Choi, Kyu-Sun, KS|Lee, Young-Jun, YJ|Chun, Hyoung-Joon, HJ|Kwon, Sae Min, SM|Kim, Dong-Won, DW','2018-05-17 22:46:19','2018-05-17 22:46:19'),(373,38,29766275,'1432-0460','Implementing Cough Reflex Testing in a Clinical Pathway for Acute Stroke: A Pragmatic Randomised Controlled Trial.','Silent aspiration is common after stroke and can lead to subsequent pneumonia. While standard bedside dysphagia assessments are ineffective at predicting silent aspiration, cough reflex testing (CRT) has shown promise for identifying patients at risk of silent aspiration. We investigated the impact of CRT on patient and service outcomes when embedded into a clinical pathway. 488 acute stoke patients were randomly allocated to receive either CRT or standard care (i.e. bedside assessment). Primary outcomes included confirmed pneumonia within 3 months post stroke and length of acute inpatient stay. Secondary outcomes related to the feasibility of implementing a CRT pathway and clinician and patient satisfaction. There was a non-significant reduction in pneumonia rates by 2.2% points in the CRT group (OR 0.32, 95% CI 0.06-1.62). There was a non-significant difference of 0.7 days (95% CI - 0.29 to 1.71 days) in length of stay between the standard care group and the CRT group. The CRT took on average 3 min longer to complete (p < 0.01) and resulted in a significant 6.7% increase in videofluoroscopic referrals (p = 0.02); however, these results are clinically insignificant. High patient and clinician satisfaction with CRT was found, with clinicians reporting additional knowledge and confidence in decision making for dysphagia management. Post hoc subgroup analyses according to stroke types were conducted and revealed no significant differences in pneumonia rates after adjustment for multiple comparisons. In conclusion, it was possible to implement a CRT pathway with minimal increases in clinician resources. While clinicians perceived CRT as beneficial in clinical decision making, the efficacy of CRT for reducing pneumonia rates in acute stroke remains to be established.Clinical Trial Registration-URL: http://www.anzctr.org.au . Unique identifier: ACTRN12616000724471.','2018-05-15 00:00:00','2018-05-15 00:00:00','2018-05-16 00:00:00',0,0,'Field, Makaela, M|Wenke, Rachel, R|Sabet, Arman, A|Lawrie, Melissa, M|Cardell, Elizabeth, E','2018-05-17 22:46:19','2018-05-17 22:46:19'),(374,38,29766228,'1432-2323','Relationship Between Visceral Obesity and Postoperative Inflammatory Response Following Minimally Invasive Esophagectomy.','Esophagectomy for esophageal cancer is one of the most invasive surgeries. However, the factors influencing postoperative systemic inflammatory response following esophagectomy have not been elucidated. Recently, visceral fat has been shown to play an important role in both chronic and acute inflammation. In this study, we assessed the relationship between visceral obesity and postoperative inflammatory response following minimally invasive esophagectomy (MIE).Visceral fat area (VFA) was measured using computed tomography in 152 patients undergoing MIE for esophageal cancer. We assessed perioperative serum C-reactive protein (CRP) levels preoperatively and on postoperative days (PODs) 1-5 and analyzed the relationship between VFA and perioperative serum CRP levels.VFA was positively associated with preoperative serum CRP level (P < 0.001). Univariate analysis revealed that VFA was significantly associated with increased serum CRP levels on PODs 1-5 (P < 0.001 for each day), whereas multivariate analysis revealed that it was independently associated with increased serum CRP levels on PODs 1-4 (P = 0.033, 0.035, 0.001, and 0.006, respectively). Similar results were observed in patients who did not have postoperative infectious complications, such as pneumonia, anastomotic leak, and surgical site infection. VFA was not an independent risk factor for the occurrence of these postoperative infectious complications.Visceral obesity might be associated with chronic inflammation in patients with esophageal cancer and promote postoperative inflammatory response following MIE.','2018-05-15 00:00:00','2018-05-15 00:00:00','2018-05-16 00:00:00',0,0,'Okamura, Akihiko, A|Watanabe, Masayuki, M|Fukudome, Ian, I|Yamashita, Kotaro, K|Yuda, Masami, M|Hayami, Masaru, M|Imamura, Yu, Y|Mine, Shinji, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(375,39,29766146,'2476-4108','The effect of resveratrol on oxidative stress in the liver and serum of a rat model of polycystic ovary syndrome: An experimental study.','Studies of oxidative status in polycystic ovarian syndrome (PCOS) patients are limited with inconsistent results. The effects of resveratrol as a natural antioxidant on oxidative status in PCOS aren\'t clear.This study evaluated effects of resveratrol on oxidative stress in the liver and serum of the PCOS rats.Fifteen female  rats (3 wk old) were divided into 3 groups (n=5/each e): Control group, PCO-Control group, and PCO-Resveratrol group. For induction of polycystic ovary phenotype, testosterone enanthate 10 mg/kg was injected for 35 days subcutaneously. Then, resveratrol 10 mg/kg was injected intraperitoneally for 28 days to rats of the PCO-Resveratrol group. Ovarian sections were stained with hematoxylin/eosin. The serum glucose and insulin and the levels of malondialdehyde (MDA) and total antioxidant capacity (TAC) in serum and liver were measured.Control animals showed normal ovarian morphology and PCO-Control animals exhibited cystic follicles. There were no significant differences in liver TAC between groups. The serum MDA (p=0.034), and homeostatic model assessment insulin resistance (HOMA-IR) (p=0.014) levels in PCO-Control rats were higher than the controls. The liver MDA in PCO-Control rats was more than that of controls (p=0.001). The HOMA-IR (p=0.008) and serum MDA (p=0.006) levels in PCO-Control rats were more than those of PCO-Resveratrol rats (p=0.008). In PCO-Resveratrol group, serum TAC was higher than that of PCO-Control group (p=0.022) and liver MDA was more than controls (p=0.01).Results indicated that the induction of PCOS in rats increased lipid peroxidation and insulin resistance and resveratrol improved these complications.','2018-03-01 00:00:00','0000-00-00 00:00:00','2018-05-16 00:00:00',0,0,'Ghowsi, Mahnaz, M|Khazali, Homayoun, H|Sisakhtnezhad, Sajjad, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(376,39,29765334,'1664-042X','High-Frequency Electrical Modulation of the Superior Ovarian Nerve as a Treatment of Polycystic Ovary Syndrome in the Rat.','The polycystic ovary syndrome (PCOS) is the most prevalent ovarian pathology in women, with excessive sympathetic activity in the superior ovarian nerve (SON) playing an important role in inducing the PCOS symptoms in the rats and humans. Our previous studies have shown that surgical transection of the SON can reverse the disease progression, prompting us to explore the effect of the kilohertz frequency alternating current (KHFAC) modulation as a method of reversible non-surgical suppression of the nerve activity in the rodent model of PCOS. 56 animals were randomly allocated to three groups: the Control group ( = 18), the PCOS group ( = 15), and the PCOS + KHFAC group ( = 23). The physiological, anatomical, and biochemical parameters of ovarian function were evaluated during the progression of the experimentally-induced PCOS and during long-term KHFAC modulation applied for 2-3 weeks. The KHFAC modulation has been able to reverse the pathological changes in assessed PCOS parameters, namely the irregular or absent estrous cycling, formation of ovarian cysts, reduction in the number of corpora lutea, and ovarian norepinephrine concentration. The fertility capacity was similar in the PCOS and the PCOS + KHFAC groups, indicating the safety of KHFAC modulation approach. In summary, these results suggest that the KHFAC modulation approach of suppressing the SON activity could become a useful treatment modality for PCOS and potentially other pathological ovarian conditions.','2018-05-17 00:00:00','2018-05-01 00:00:00','2018-05-16 00:00:00',0,0,'Pikov, Victor, V|Sridhar, Arun, A|Lara, Hernan E, HE','2018-05-17 22:46:19','2018-05-17 22:46:19'),(377,39,29763897,'1423-002X','Does the Pituitary Gland Volume Change in Polycystic Ovary Syndrome?','Polycystic ovary syndrome (PCOS) is the commonest cause of menstrual irregularity and hirsutism during reproductive age. We hypothesized in the alterations in the pituitary gland in PCOS.We measured the volume of the pituitary gland in 39 PCOS patients and 42 age-matched healthy controls using 0.35 mm thick T1-weighted sagittal cranial images. Serum levels of estradiol (E2), luteinizing hormone (LH), and follicle-stimulating hormone (FSH) were measured on days 3-5 of the menstrual cycle of the participants.There was a significant difference in terms of LH, FSH, and LH/FSH ratio (p < 0.05) between groups. Mean pituitary gland volume (PGV) was 4.1 ± 1.36 mm3 for the study group and 3.4 ± 0.77 mm3 for the control group. PGV was statistically significantly higher in PCOS group than the control group (p < 0.05). There was no correlation between hormone levels and PGVs in groups.Enlarged pituitary volume in PCOS may be due to excessive LH release.','2018-05-15 00:00:00','2018-05-15 00:00:00','2018-05-15 00:00:00',0,0,'Bozkurt Koseoglu, Sezen, S|Dinc Elibol, Funda, F','2018-05-17 22:46:19','2018-05-17 22:46:19'),(378,39,29762821,'2284-0729','The influencing mechanism of mTOR signal pathway mediated by mitofusin-2 in development of follicle.','To investigate the influencing mechanism of mammalian target of rapamycin (mTOR) signal pathway mediated by mitofusin-2 (Mfn2) in the development of follicle.We selected 20 healthy Sprague Dawley (SD) female rats aging between 6 and 8 weeks were divided into the control group and the polycystic ovarian syndrome (PCOS) model group. Rats in PCOS group received the lavage using 0.4 mL 1% carboxymethyl cellulose solution containing letrozole (1 mg/kg/d) consecutively for 20 to 25d. We compared the body weight and ovary weight of rats, and detected levels of sera E2, T, P, FSH and LH through RIA measurement. We also observed the histological morphology of ovary through hematoxylin eosin (HE) staining, as well as the positive expression and location of rMfn2 through immunohistochemistry staining. Finally, we detected the expressions of mTOR, p-Akt, β-catenin, caspase-3, Bcl-2 and Bax in Mfn2 and mTOR signal pathways in the tissues through RT-PCR and Western blot assay.In the PCOS group, the body weight of rats was lower than that of the control group, but the ovary weight of rats was higher than that in the control group. The levels of T and LH in serum were elevated, the levels of E2, P and FSH were decreased (p < 0.05). In the model group, typical polycystic changes were observed in the rats under the microscope, but no corpus luteum was observed, and a significant decrease was identified in the layers of the granular cell of the follicle. Mfn2 was widely expressed in the granular cells of the ovary, follicular fluid, inner theca cells, corpus luteum, and ovarian stroma. However, the expression in the outer theca cells was relatively low. In the observation group, the positive expression rate of Mfn2 was significantly lower (p < 0.05) than that in the control group. In the PCOS group, the mRNA and protein relative expression levels of mTOR, p-Akt, β-catenin, and Bcl-2 were significantly lower (p < 0.05) than those in the control group. Conversely, the levels of caspase-3 and Bax were significantly higher (p < 0.05) than those in the control group.Downregulated expression of Mfn2 may affect the regular development of follicle through the mediation of mTOR signal pathway.','2018-04-01 00:00:00','0000-00-00 00:00:00','2018-05-15 00:00:00',0,0,'Luo, Q-Y, QY|Huo, P, P|Wang, L-L, LL|Wu, X-H, XH','2018-05-17 22:46:19','2018-05-17 22:46:19'),(379,39,29760445,'1546-170X','Elevated prenatal anti-Müllerian hormone reprograms the fetus and induces polycystic ovary syndrome in adulthood.','Polycystic ovary syndrome (PCOS) is the main cause of female infertility worldwide and corresponds with a high degree of comorbidities and economic burden. How PCOS is passed on from one generation to the next is not clear, but it may be a developmental condition. Most women with PCOS exhibit higher levels of circulating luteinizing hormone, suggestive of heightened gonadotropin-releasing hormone (GnRH) release, and anti-Müllerian hormone (AMH) as compared to healthy women. Excess AMH in utero may affect the development of the female fetus. However, as AMH levels drop during pregnancy in women with normal fertility, it was unclear whether their levels were also elevated in pregnant women with PCOS. Here we measured AMH in a cohort of pregnant women with PCOS and control pregnant women and found that AMH is significantly more elevated in the former group versus the latter. To determine whether the elevation of AMH during pregnancy in women with PCOS is a bystander effect or a driver of the condition in the offspring, we modeled our clinical findings by treating pregnant mice with AMH and followed the neuroendocrine phenotype of their female progeny postnatally. This treatment resulted in maternal neuroendocrine-driven testosterone excess and diminished placental metabolism of testosterone to estradiol, resulting in a masculinization of the exposed female fetus and a PCOS-like reproductive and neuroendocrine phenotype in adulthood. We found that the affected females had persistently hyperactivated GnRH neurons and that GnRH antagonist treatment in the adult female offspring restored their neuroendocrine phenotype to a normal state. These findings highlight a critical role for excess prenatal AMH exposure and subsequent aberrant GnRH receptor signaling in the neuroendocrine dysfunctions of PCOS, while offering a new potential therapeutic avenue to treat the condition during adulthood.','2018-05-14 00:00:00','2018-05-14 00:00:00','2018-05-15 00:00:00',0,0,'Tata, Brooke, B|Mimouni, Nour El Houda, NEH|Barbotin, Anne-Laure, AL|Malone, Samuel A, SA|Loyens, Anne, A|Pigny, Pascal, P|Dewailly, Didier, D|Catteau-Jonard, Sophie, S|Sundström-Poromaa, Inger, I|Piltonen, Terhi T, TT|Dal Bello, Federica, F|Medana, Claudio, C|Prevot, Vincent, V|Clasadonte, Jerome, J|Giacobini, Paolo, P','2018-05-17 22:46:19','2018-05-17 22:46:19'),(380,39,29760297,'1674-8301','Follicular hyperandrogenism and insulin resistance in polycystic ovary syndrome patients with normal circulating testosterone levels.','Polycystic ovary syndrome (PCOS) is a common reproductive disease with high heterogeneity. The role of excess androgen in PCOS etiology remains disputed, since around 20%-50% of PCOS women do not display hyperandrogenemia. The microenvironment of the ovary critically influences follicular development. In the present study, we assessed the role of androgen in PCOS by investigating whether excessive follicular fluid androgen was present in PCOS patients with normal serum androgen levels and influenced by follicular fluid insulin resistance (IR). Follicular fluid samples of 105 women with PCOS and 105 controls were collected. Levels of steroid hormones, glucose and insulin in the follicular fluid were examined and compared with data from serum biochemistry tests. We found that 64.9% (63/97) of PCOS patients with normal serum androgen levels displayed abnormally high follicular fluid androgen level. The follicular fluid androgen level was positively correlated with follicular fluid IR within a certain range and follicular fluid estrogen-to-testosterone (E2/T) ratio was significantly reduced in these patients. These results indicated that there existed a subgroup of PCOS patients who displayed excessive follicular fluid androgen and IR despite their normal circulating testosterone (T) levels. Our study highlights the importance of ovary hyperandrogenism and IR in the etiology of PCOS.','2017-11-01 00:00:00','2017-11-01 00:00:00','2018-05-15 00:00:00',0,0,'Andi, Li, L|Lu, Zhang, Z|Jiajia, Jiang, J|Nan, Yang, Y|Ying, Liu, L|Lingbo, Cai, C|Yugui, Cui, C|Feiyang, Diao, D|Xiao, Han, H|Jiayin, Liu, L|Yujie, Sun, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(381,39,29757997,'1420-3049','Tetragonia tetragonioides (Pall.) Kuntze Regulates Androgen Production in a Letrozole-Induced Polycystic Ovary Syndrome Model.','Tetragonia tetragonioides','2018-05-14 00:00:00','2018-05-14 00:00:00','2018-05-14 00:00:00',0,0,'Pyun, Bo-Jeong, BJ|Yang, Hyun, H|Sohn, Eunjin, E|Yu, Song Yi, SY|Lee, Dongoh, D|Jung, Dong Ho, DH|Ko, Byoung Seob, BS|Lee, Hye Won, HW','2018-05-17 22:46:19','2018-05-17 22:46:19'),(382,39,29757582,'1518-0557','Effects of orlistat on serum androgen levels among iranian obese women with polycystic ovarian syndrome.','Polycystic ovary syndrome is one of the most common endocrinopathies in young women, and it affects 6% to 8% of women in reproductive age. Hyperandrogenism is the hallmark of polycystic ovary syndrome. The aim of the present study was to evaluate the effects of orlistat on weight loss and serum androgen levels among Iranian women with polycystic ovary syndrome.The present study was carried out in the clinic of Infertility and Reproductive Health Research Center, Shahid Beheshti University of Medical Sciences, Tehran, Iran. Thirty-two patients with polycystic ovary syndrome were randomly enrolled. We measured serum androgens (Testosterone, 17α-hydroxyprogesterone, dehydroepiandrosterone and sex hormone-binding globulin) before and after 12 weeks of treatment with orlistat. We used the Rotterdam Criteria for all patients and transvaginal sonography was performed.The mean age of patients was 27.75±6.22 and the mean body mass index was 32.69±0.94 kg/m2. Comparing with baseline, treatment with orlistat resulted in a significant reduction in weight, BMI, and waist circumference (p=0.001). We also found a remarkable reduction in total testosterone levels (p>0.001). Treatment improved the sex hormone-binding globulin plasma levels, but the improvement was not statistically significant. There was no reduction in other androgen levels.This study showed a significant reduction of weight and total testosterone level - the most important androgen in polycystic ovary syndrome - after 12 weeks of treatment with orlistat. Therefore, it seems that a short course of orlistat can be useful in the management of patients with polycystic ovary syndrome.','2018-05-14 00:00:00','2018-05-14 00:00:00','2018-05-14 00:00:00',0,0,'Salehpour, Saghar, S|Hosseini, Sedighe, S|Nazari, Leila, L|Saharkhiz, Nasrin, N|Zademodarres, Shahrzad, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(383,39,29752839,'1098-2353','The role of mTOR in ovarian cancer, polycystic ovary syndrome and ovarian aging.','The mammalian target of rapamycin, mTOR, is a serine-threonine protein kinase downstream of the phosphatidylinositol 3-kinase (PI3K)-AKT axis. The pathway can regulate cell growth, proliferation, and survival by activating ribosomal kinases. Recent studies have implicated the mTOR signaling pathway in ovarian neoplasms, polycystic ovary syndrome (PCOS) and premature ovarian failure (POF). Preclinical investigations have demonstrated that the PI3K/AKT/mTOR pathway is frequently activated in the control of various ovarian functions. mTOR allows cancer cells to escape the normal biochemical system and regulates the balance between apoptosis and survival. Some recent studies have suggested that involvement of the mTOR signaling system is an important pathophysiological basis of PCOS. Overexpression of the mTOR pathway can impair the interaction of cumulus cells, lead to insulin resistance, and affect the growth of follicles directly. The roles of mTOR signaling in follicular development have been extensively studied in recent years; abnormalities in this process lead to a series of pathologies such as POF and infertility. To improve understanding of the role of the mTOR signaling pathway in the pathogenesis and development of ovarian diseases, here we review the roles of mTOR signaling in such diseases and discuss the corresponding therapeutic strategies that target this pathway. This article is protected by copyright. All rights reserved.','2018-05-12 00:00:00','2018-05-12 00:00:00','2018-05-12 00:00:00',0,0,'Liu, Jin, J|Wu, Dai-Chao, DC|Qu, Li-Hua, LH|Liao, Hong-Qing, HQ|Li, Mei-Xiang, MX','2018-05-17 22:46:19','2018-05-17 22:46:19'),(384,39,29752614,'1672-0415','Data Do Not Support Effectiveness of Acupuncture for Improving Live Birth Rate in Women with Polycystic Ovary Syndrome.','No abstract found.','2018-05-01 00:00:00','2018-05-11 00:00:00','2018-05-15 00:00:00',0,0,'Kuang, Hong-Ying, HY|Li, Yan, Y|Zhang, He-Ping, HP|Legro, Richard S, RS|Stener-Victorin, Elisabet, E','2018-05-17 22:46:19','2018-05-17 22:46:19'),(385,40,29750570,'1545-1569','Orthognathic Correction in Prader-Willi Syndrome: Occlusion and Sleep Restored.','Children with Prader-Willi Syndrome (PWS) may present with a malocclusion and have a high propensity of developing obstructive sleep apnea (OSA). Obstructive sleep apnea is associated with short- and long-term adverse effects that negatively impact children with PWS. A case of a 15-year-old male with PWS, OSA, and a debilitating malocclusion is presented who underwent a combination of Le Fort 1 osteotomy, genioplasty, and tongue reduction to successfully treat his OSA and malocclusion. In select cases, orthognathic correction and other surgical therapies should be considered in patients with PWS.','2018-01-01 00:00:00','2018-01-01 00:00:00','2018-05-11 00:00:00',0,0,'Xiao, Keliang Kevin, KK|Tomur, Shikhar, S|Beckerman, Robert, R|Cassidy, Kevin, K|Lypka, Michael, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(386,40,29730598,'1468-6244','Molecular genetic classification in Prader-Willi syndrome: a multisite cohort study.','Prader-Willi syndrome (PWS) is due to errors in genomic imprinting. PWS is recognised as the most common known genetic cause of life-threatening obesity. This report summarises the frequency and further characterises the PWS molecular classes and maternal age effects.High-resolution microarrays, comprehensive chromosome 15 genotyping and methylation-specific multiplex ligation probe amplification were used to describe and further characterise molecular classes of maternal disomy 15 (UPD15) considering maternal age.We summarised genetic data from 510 individuals with PWS and 303 (60%) had the 15q11-q13 deletion; 185 (36%) with UPD15 and 22 (4%) with imprinting defects. We further characterised UPD15 findings into subclasses based on the presence (size, location) or absence of loss of heterozygosity (LOH). Additionally, significantly older mothers (mean age=32.5 years vs 27.7 years) were found in the UPD15 group (n=145) compared with the deletion subtype (n=200).We report on molecular classes in PWS using advanced genomic technology in the largest cohort to date. LOH patterns in UPD15 may impact the risk of having a second genetic condition if the mother carries a recessive mutant allele in the isodisomic region on chromosome 15. The risk of UPD15 may also increase with maternal age.','2018-05-05 00:00:00','2018-05-05 00:00:00','2018-05-06 00:00:00',0,0,'Butler, Merlin G, MG|Hartin, Samantha N, SN|Hossain, Waheeda A, WA|Manzardo, Ann M, AM|Kimonis, Virginia, V|Dykens, Elisabeth, E|Gold, June Anne, JA|Kim, Soo-Jeong, SJ|Weisensel, Nicolette, N|Tamura, Roy, R|Miller, Jennifer L, JL|Driscoll, Daniel J, DJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(387,40,29717432,'1879-5447','Classifying dysmorphic syndromes by using artificial neural network based hierarchical decision tree.','Dysmorphic syndromes have different facial malformations. These malformations are significant to an early diagnosis of dysmorphic syndromes and contain distinctive information for face recognition. In this study we define the certain features of each syndrome by considering facial malformations and classify Fragile X, Hurler, Prader Willi, Down, Wolf Hirschhorn syndromes and healthy groups automatically. The reference points are marked on the face images and ratios between the points\' distances are taken into consideration as features. We suggest a neural network based hierarchical decision tree structure in order to classify the syndrome types. We also implement k-nearest neighbor (k-NN) and artificial neural network (ANN) classifiers to compare classification accuracy with our hierarchical decision tree. The classification accuracy is 50, 73 and 86.7% with k-NN, ANN and hierarchical decision tree methods, respectively. Then, the same images are shown to a clinical expert who achieve a recognition rate of 46.7%. We develop an efficient system to recognize different syndrome types automatically in a simple, non-invasive imaging data, which is independent from the patient\'s age, sex and race at high accuracy. The promising results indicate that our method can be used for pre-diagnosis of the dysmorphic syndromes by clinical experts.','2018-05-01 00:00:00','2018-05-01 00:00:00','2018-05-02 00:00:00',0,0,'Özdemir, Merve Erkınay, ME|Telatar, Ziya, Z|Eroğul, Osman, O|Tunca, Yusuf, Y','2018-05-17 22:46:19','2018-05-17 22:46:19'),(388,40,29703235,'1745-6215','The effects of Bifidobacterium animalis ssp. lactis B94 on gastrointestinal wellness in adults with Prader-Willi syndrome: study protocol for a randomized controlled trial.','Constipation is a frequent problem in adults with Prader-Willi syndrome. Certain probiotics have been shown to improve transit and gastrointestinal symptoms of adults with functional constipation. The aim of this study is to determine the effect of daily consumption of Bifidobacterium animalis ssp. lactis B94 (B. lactis B94) on stool frequency, stool form, and gastrointestinal symptoms in adults with Prader-Willi syndrome.Adults with Prader-Willi syndrome (18-75 years old, n = 36) will be recruited and enrolled in a 20-week, randomized, double-blind, placebo-controlled, crossover study. Study subjects will be randomized to B. lactis B94 or placebo each for a 4-week period, preceded by a 4-week baseline and followed by 4-week washouts. Subjects will complete daily records of stool frequency and stool form (a proxy of transit time). Dietary intake data also will be collected. Stools, one in each period, will be collected for exploratory microbiota analyses.To our knowledge, this is the first randomized controlled trial evaluating the effectiveness of B. lactis in adults with Prader-Willi syndrome. The results of this study will provide evidence of efficacy for future clinical trials in patient populations with constipation.ClinicalTrials.gov ( NCT03277157 ). Registered on 08 September 2017.','2018-04-27 00:00:00','2018-04-27 00:00:00','2018-05-03 00:00:00',0,0,'Alyousif, Zainab, Z|Miller, Jennifer L, JL|Sandoval, Mariana Y, MY|MacPherson, Chad W, CW|Nagulesapillai, Varuni, V|Dahl, Wendy J, WJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(389,40,29700824,'1399-0004','Clinical, molecular genetics and therapeutic aspects of syndromic obesity.','Obesity has become a major health problem worldwide. To date, more than 25 different syndromic forms of obesity are known in which one (monogenic) or multiple (polygenic) genes are involved. This review gives an overview of these forms and focuses more in detail on six syndromes: Prader Willi Syndrome and Prader Willi like phenotype, Bardet Biedl Syndrome, Alström Syndrome, Wilms tumor, Aniridia, Genitourinary malformations and mental Retardation syndrome and 16p11.2 (micro)deletions. Years of research provided plenty of information on the molecular genetics of these disorders and the obesity phenotype leading to a more individualized treatment of the symptoms, however, a lot of questions still remain unanswered. As these obesity syndromes have different signs and symptoms in common, it makes it difficult to accurately diagnose patients which may result in inappropriate treatment of the disease. Therefore, the big challenge for clinicians and scientists is to more clearly differentiate all syndromic forms of obesity to provide conclusive genetic explanations and eventually deliver accurate genetic counseling and treatment. In addition, further delineation of the (functions of the) underlying genes with the use of array- or next generation sequencing-based technology will be helpful to unravel the mechanisms of energy metabolism in the general population.','2018-04-26 00:00:00','2018-04-26 00:00:00','2018-04-27 00:00:00',0,0,'Geets, E, E|Meuwissen, M E C, MEC|Van Hul, W, W','2018-05-17 22:46:19','2018-05-17 22:46:19'),(390,40,29696788,'1552-4833','Delayed peak response of cortisol to insulin tolerance test in patients with Prader-Willi syndrome.','Deaths among children with Prader-Willi syndrome (PWS) are often related to only mild or moderate upper respiratory tract infections, and many causes of death remain unexplained. Several reports have hypothesized that patients with PWS may experience latent central adrenal insufficiency. However, whether PWS subjects suffer from alteration of the hypothalamus-pituitary-adrenal (HPA) axis remains unclear. This study aimed to explore the HPA axis on PWS. We evaluated the HPA axis in 36 PWS patients (24 males, 12 females; age range, 7 months to 12 years; median age 2.0 years; interquartile range [IQR], 1.5-3.4 years) using an insulin tolerance test (ITT) in the morning between 08:00 and 11:00. For comparison, ITT results in 37 age-matched healthy children evaluated for short stature were used as controls. In PWS patients, basal levels of adrenocorticotropic hormone (ACTH) were 13.5 pg/ml (IQR, 8.3-27.5 pg/ml) and basal levels of cortisol were 18.0 μg/dl (IQR, 14.2-23.7 μg/dl). For all patients, cortisol levels at 60 min after stimulation were within the reference range (>18.1 μg/dl), with a median peak of 41.5 μg/dl (IQR, 32.3-48.6 μg/dl). Among control children, basal level of ACTH and basal and peak levels of cortisol were 10.9 (IQR, 8.5-22.0 pg/ml), 15.6 (IQR, 11.9-21.6 μg/dl), and 27.8 μg/dl (IQR, 23.7-30.5 μg/dl), respectively. Basal and peak levels of cortisol were all within normal ranges, but peak response of cortisol to ITT was delayed in the majority of PWS patients (64%). Although the mechanism remains unclear, this delay may signify the existence of central obstacle in adjustment of the HPA axis.','2018-04-25 00:00:00','2018-04-25 00:00:00','2018-04-26 00:00:00',0,0,'Oto, Yuji, Y|Matsubara, Keiko, K|Ayabe, Tadayuki, T|Shiraishi, Masahisa, M|Murakami, Nobuyuki, N|Ihara, Hiroshi, H|Matsubara, Tomoyo, T|Nagai, Toshiro, T','2018-05-17 22:46:19','2018-05-17 22:46:19'),(391,40,29696774,'1552-4833','Functional independence of Taiwanese children with Prader-Willi syndrome.','Prader-Willi syndrome (PWS) is a genetic disorder with obesity, developmental delay, short stature, and behavioral abnormalities. The study aimed to assess the functional independence in children with PWS. The Functional Independence Measure for Children (WeeFIM) was used to evaluate 81 children with PWS (44 boys and 37 girls) with a median age of 11 years 1 month (range 2 years 8 months to 20 years 2 months) were recruited between January 2013 and December 2016. The mean total WeeFIM score was 103.8 (maximum 126). Sixty-five patients (80%) had deletion type PWS, 16 (20.0%) had nondeletion type. The scores were 103.6 ± 18.5 for deletion and 104.8 ± 18.3 for nondeletion type (p = .405), 104.8 ± 19.3 in boys and 102.6 ± 17.3 in girls (p = .293). The mean self-care, mobility, and cognition scores were 47 (maximum 56), 33 (maximum 35), and 24 (maximum 35), respectively. All total scores and 18 subscores in the three functional domains were positively correlated with age (p < .05). Most children required assistance in problem-solving, comprehension, and expression. The WeeFIM identified the strengths and limitations of children with PWS and confirmed that support and supervision were needed in cognitive and self-care tasks.','2018-04-25 00:00:00','2018-04-25 00:00:00','2018-04-26 00:00:00',0,0,'Lee, Chung-Lin, CL|Lin, Hsiang-Yu, HY|Tsai, Li-Ping, LP|Chiu, Huei-Ching, HC|Tu, Ru-Yi, RY|Huang, You-Hsin, YH|Chien, Yin-Hsiu, YH|Lee, Ni-Chung, NC|Niu, Dau-Ming, DM|Chao, Mei-Chyn, MC|Tsai, Fuu-Jen, FJ|Chou, Yen-Yin, YY|Chuang, Chih-Kuang, CK|Lin, Shuan-Pei, SP','2018-05-17 22:46:19','2018-05-17 22:46:19'),(392,40,29696471,'1573-7330','Comprehensive meta-analysis reveals association between multiple imprinting disorders and conception by assisted reproductive technology.','To determine whether a history of conception by assisted reproductive technology (ART) is associated with occurrence of one or more imprinting disorders of either maternal or paternal origin.We implemented a systematic review of scholarly literature followed by comprehensive meta-analysis to quantitatively synthesize data from reports relating to use of ART to occurrence of any imprinting disorder of humans, including Beckwith-Wiedemann (BWS), Angelman (AS), Prader-Willi (PWS), and Silver-Russell (SRS) syndromes, as well as transient neonatal diabetes mellitus (TNDB) and sporadic retinoblasoma (RB).The systematic review identified 13 reports presenting unique data from 23 studies that related conception following ART to occurrence of imprinting disorders. Multiple studies of four disorder were identified, for which meta-analysis yielded the following summary estimates of associations with a history of ART: AS, summary odds ratio (sOR) = 4.7 (95% confidence interval (CI) 2.6-8.5, 4 studies); BWS, sOR = 5.8 (95% CI 3.1-11.1, 8 studies); PWS, sOR = 2.2 (95% CI 1.6-3.0, 6 studies); SRS, sOR = 11.3 (95% CI 4.5-28.5, 3 studies). Only one study reported on each of TNDB and RB.Published data reveal positive associations between history of ART conception and each of four imprinting disorders. Reasons for these associations warrant further investigation.','2018-04-25 00:00:00','2018-04-25 00:00:00','2018-04-26 00:00:00',0,0,'Cortessis, Victoria K, VK|Azadian, Moosa, M|Buxbaum, James, J|Sanogo, Fatimata, F|Song, Ashley Y, AY|Sriprasert, Intira, I|Wei, Pengxiao C, PC|Yu, Jing, J|Chung, Karine, K|Siegmund, Kimberly D, KD','2018-05-17 22:46:19','2018-05-17 22:46:19'),(393,40,29691480,'1435-232X','An estimation of the prevalence of genomic disorders using chromosomal microarray data.','Multiple genomic disorders result from recurrent deletions or duplications between low copy repeat (LCR) clusters, mediated by nonallelic homologous recombination. These copy number variants (CNVs) often exhibit variable expressivity and/or incomplete penetrance. However, the population prevalence of many genomic disorders has not been estimated accurately. A subset of genomic disorders similarly characterized by CNVs between LCRs have been studied epidemiologically, including Williams-Beuren syndrome (7q11.23), Smith-Magenis syndrome (17p11.2), velocardiofacial syndrome (22q11.21), Prader-Willi/Angelman syndromes (15q11.2q12), 17q12 deletion syndrome, and Charcot-Marie-Tooth neuropathy type 1/hereditary neuropathy with liability to pressure palsy (PMP22, 17q11.2). We have generated a method to estimate prevalence of highly penetrant genomic disorders by (1) leveraging epidemiological data for genomic disorders with previously reported prevalence estimates, (2) obtaining chromosomal microarray data on genomic disorders from a large medical genetics clinic; and (3) utilizing these in a linear regression model to determine the prevalence of this syndromic copy number change among the general population. Using our algorithm, the prevalence for five clinically relevant recurrent genomic disorders: 1q21.1 microdeletion (1/6882 live births) and microduplication syndromes (1/6309), 15q13.3 microdeletion syndrome (1/5525), and 16p11.2 microdeletion (1/3021) and microduplication syndromes (1/4216), were determined. These findings will inform epidemiological strategies for evaluating those conditions, and our method may be useful to evaluate the prevalence of other highly penetrant genomic disorders.','2018-04-24 00:00:00','2018-04-24 00:00:00','2018-04-29 00:00:00',0,0,'Gillentine, Madelyn A, MA|Lupo, Philip J, PJ|Stankiewicz, Pawel, P|Schaaf, Christian P, CP','2018-05-17 22:46:19','2018-05-17 22:46:19'),(394,40,29691382,'2041-1723','Snord116-dependent diurnal rhythm of DNA methylation in mouse cortex.','Rhythmic oscillations of physiological processes depend on integrating the circadian clock and diurnal environment. DNA methylation is epigenetically responsive to daily rhythms, as a subset of CpG dinucleotides in brain exhibit diurnal rhythmic methylation. Here, we show a major genetic effect on rhythmic methylation in a mouse Snord116 deletion model of the imprinted disorder Prader-Willi syndrome (PWS). More than 23,000 diurnally rhythmic CpGs are identified in wild-type cortex, with nearly all lost or phase-shifted in PWS. Circadian dysregulation of a second imprinted Snord cluster at the Temple/Kagami-Ogata syndrome locus is observed at the level of methylation, transcription, and chromatin, providing mechanistic evidence of cross-talk. Genes identified by diurnal epigenetic changes in PWS mice overlapped rhythmic and PWS-specific genes in human brain and are enriched for PWS-relevant phenotypes and pathways. These results support the proposed evolutionary relationship between imprinting and sleep, and suggest possible chronotherapy in the treatment of PWS and related disorders.','2018-04-24 00:00:00','2018-04-24 00:00:00','2018-04-30 00:00:00',0,0,'Coulson, Rochelle L, RL|Yasui, Dag H, DH|Dunaway, Keith W, KW|Laufer, Benjamin I, BI|Vogel Ciernia, Annie, A|Zhu, Yihui, Y|Mordaunt, Charles E, CE|Totah, Theresa S, TS|LaSalle, Janine M, JM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(395,41,29768465,'1932-6203','Stopping the effective non-fluoroquinolone antibiotics at day 7 vs continuing until day 14 in adults with acute pyelonephritis requiring hospitalization: A randomized non-inferiority trial.','To evaluate whether stopping the effective antibiotic treatment following clinical improvement at Day 7 (Truncated treatment) would be non-inferior to continued treatment until Day 14 (Continued treatment) in patients with acute pyelonephritis (APN) requiring hospitalization treated with non-fluoroquinolone (non-FQ) antibiotics.Hospitalized adult men and non-pregnant women with culture-confirmed APN were eligible for participation after they had clinically improved following empirical or culture-guided treatment with intravenous non-FQ antibiotic(s). We excluded patients with severe sepsis, abscesses, prostatitis, recurrent or catheter-associated urinary tract infection, or urinary tract obstruction. We randomized eligible patients on Day 7 of effective treatment and assessed them at Weeks 1 and 6 after treatment completion. The primary outcome was retreatment for recurrent urinary tract infection. The prespecified non-inferiority margin was 15%.Between March 17, 2015 and August 22, 2016, we randomly allocated 54 patients-27 patients in each arm. Twenty-four (44%) patients were male, and 26 (48%) had diabetes mellitus. Escherichia coli was the most common urinary isolate (47 [87%] patients); 36 (78%) were resistant to ciprofloxacin. In all, 41 (76%) patients received amikacin-based treatment. At the end of 6 weeks, no patient in the truncated treatment arm required retreatment, whereas 1 patient in the continued treatment arm was retreated. Difference (90% CI) in retreatment was -3.7% (-15.01% to 6.15%). Upper bound of the difference (6.15%) was below the prespecified limit, establishing non-inferiority of truncated treatment. Asymptomatic bacteriuria at Week 6 was similar between the two arms (3/24 vs. 3/26; P = 1.0). Patients in the truncated treatment arm had significantly shorter hospital stay (8 [7-10] vs. 14 [14-15] days; P < 0.001) and less antibiotic consumption per patient (8.4 ± 2.8 vs. 17.4 ± 8.3 DDDs; P < 0.001).Stopping the effective non-FQ antibiotics following clinical improvement at Day 7 is non-inferior to continued treatment until Day 14 in selected patients with APN requiring hospitalization.Clinical Trials Registry-India; CTRI/2016/04/006810.','2018-05-17 00:00:00','2018-05-16 00:00:00','2018-05-16 00:00:00',0,0,'Rudrabhatla, Pavankumar, P|Deepanjali, Surendran, S|Mandal, Jharna, J|Swaminathan, Rathinam Palamalai, RP|Kadhiravan, Tamilarasu, T','2018-05-17 22:46:19','2018-05-17 22:46:19'),(396,41,29759852,'1769-6690','Practice guidelines for the management of adult community-acquired urinary tract infections.','No abstract found.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-15 00:00:00',0,0,'Caron, F, F|Galperine, T, T|Flateau, C, C|Azria, R, R|Bonacorsi, S, S|Bruyère, F, F|Cariou, G, G|Clouqueur, E, E|Cohen, R, R|Doco-Lecompte, T, T|Elefant, E, E|Faure, K, K|Gauzit, R, R|Gavazzi, G, G|Lemaitre, L, L|Raymond, J, J|Senneville, E, E|Sotto, A, A|Subtil, D, D|Trivalle, C, C|Merens, A, A|Etienne, M, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(397,41,29757454,'1469-493X','Non-pharmacological interventions for treating chronic prostatitis/chronic pelvic pain syndrome.','Chronic prostatitis/chronic pelvic pain syndrome (CP/CPPS) is a common disorder in which the two main clinical features are pelvic pain and lower urinary tract symptoms. There are currently many approaches for its management, using both pharmacological and non-pharmacological interventions. The National Institute of Health - Chronic Prostatitis Symptom Index (NIH-CPSI) score is a validated measure commonly used to measure CP/CPPS symptoms.To assess the effects of non-pharmacological therapies for chronic prostatitis/chronic pelvic pain syndrome (CP/CPPS).We performed a comprehensive search using multiple databases, trial registries, grey literature and conference proceedings with no restrictions on the language of publication or publication status. The date of the latest search of all databases was August 2017.We included randomised controlled trials. Inclusion criteria were men with a diagnosis of CP/CPPS. We included all available non-pharmacological interventions.Two review authors independently classified studies and abstracted data from the included studies, performed statistical analyses and rated quality of evidence (QoE) according to the GRADE methods.We included 38 unique studies with 3290 men with CP/CPPS across 23 comparisons.1. Acupuncture: (three studies, 204 participants) based on short-term follow-up, acupuncture probably leads to clinically meaningful reduction in prostatitis symptoms compared with sham procedure (mean difference (MD) in total NIH-CPSI score -5.79, 95% confidence interval (CI) -7.32 to -4.26, high QoE). Acupuncture may result in little to no difference in adverse events (low QoE). Acupuncture may not reduce sexual dysfunction when compared with sham procedure (MD in the International Index of Erectile Function (IIEF) Scale -0.50, 95% CI -3.46 to 2.46, low QoE). Acupuncture may also lead to a clinically meaningful reduction in prostatitis symptoms compared with standard medical therapy (MD -6.05, 95% CI -7.87 to -4.24, two studies, 78 participants, low QoE). We found no information regarding quality of life, depression or anxiety.2. Lifestyle modifications: (one study, 100 participants) based on short-term follow-up, lifestyle modifications may be associated with a reduction in prostatitis symptoms compared with control (risk ratio (RR) for improvement in NIH-CPSI scores 3.90, 95% CI 2.20 to 6.92, very low QoE). We found no information regarding adverse events, sexual dysfunction, quality of life, depression or anxiety.3. Physical activity: (one study, 85 participants) based on short-term follow-up, a physical activity programme may cause a small reduction in prostatitis symptoms compared with control (NIH-CPSI score MD -2.50, 95% CI -4.69 to -0.31, low QoE). This programme may not reduce anxiety or depression (low QoE). We found no information regarding adverse events, sexual dysfunction or quality of life.4. Prostatic massage: (two studies, 115 participants) based on short-term follow-up, we are uncertain whether the prostatic massage reduces or increases prostatitis symptoms compared with control (very low QoE). We found no information regarding adverse events, sexual dysfunction, quality of life, depression or anxiety.5. Extracorporeal shockwave therapy: (three studies, 157 participants) based on short-term follow-up, extracorporeal shockwave therapy reduces prostatitis symptoms compared with control (NIH-CPSI score MD -6.18, 95% CI -7.46 to -4.89, high QoE). These results may not be sustained at medium-term follow-up (low QoE). This treatment may not be associated with a greater incidence of adverse events (low QoE). This treatment probably improves sexual dysfunction (MD in the IIEF Scale MD 3.34, 95% CI 2.68 to 4.00, one study, 60 participants, moderate QoE). We found no information regarding quality of life, depression or anxiety.6. Transrectal thermotherapy compared to medical therapy: (two studies, 237 participants) based on short-term follow-up, transrectal thermotherapy alone or in combination with medical therapy may decrease prostatitis symptoms slightly when compared with medical therapy alone (NIH-CPSI score MD -2.50, 95% CI -3.82 to -1.18, low QoE). One included study reported that participants may experience transient adverse events. We found no information regarding sexual dysfunction, quality of life, depression or anxiety.7. Other interventions: there is uncertainty about the effects of most of the other interventions included in this review. We found no information regarding psychological support or prostatic surgery.Based on the findings of moderate quality evidence, this review found that some non-pharmacological interventions such as acupuncture and extracorporeal shockwave therapy are likely to result in a decrease in prostatitis symptoms and may not be associated with a greater incidence of adverse event. The QoE for most other comparisons was predominantly low. Future clinical trials should include a full report of their methods including adequate masking, consistent assessment of all patient-important outcomes including potential treatment-related adverse events and appropriate sample sizes.','2018-05-12 00:00:00','2018-05-12 00:00:00','2018-05-14 00:00:00',0,0,'Franco, Juan Va, JV|Turk, Tarek, T|Jung, Jae Hung, JH|Xiao, Yu-Tian, YT|Iakhno, Stanislav, S|Garrote, Virginia, V|Vietto, Valeria, V','2018-05-17 22:46:19','2018-05-17 22:46:19'),(398,41,29751604,'1420-3049','Graminex Pollen: Phenolic Pattern, Colorimetric Analysis and Protective Effects in Immortalized Prostate Cells (PC3) and Rat Prostate Challenged with LPS.','Prostatitis, a general term describing prostate inflammation, is a common disease that could be sustained by bacterial or non-bacterial infectious agents. The efficacy of herbal extracts with antioxidant and anti-inflammatory effects for blunting the burden of inflammation and oxidative stress, with possible improvements in clinical symptoms, is under investigation. Pollen extracts have been previously reported as promising agents in managing clinical symptoms related to prostatitis. The aim of the present work was to evaluate the protective effects of Graminex pollen (Graminex, Deshler, OH, USA), a commercially available product based on standardized pollen extracts, in rat prostate specimens, ex vivo. In this context, we studied the putative mechanism of action of pollen on multiple inflammatory pathways, including the reduction of prostaglandin E₂ (PGE₂), nuclear factor kappa-light-chain-enhancer of activated B cells (NF&kappa;B), and malondialdehyde (MDA), whose activities were significantly increased by inflammatory stimuli. We characterized by means of chromatographic and colorimetric studies the composition of Graminex pollen to better correlate the activity of pollen on immortalized prostate cells (PC3), and in rat prostate specimens challenged with  lipopolysaccharide (LPS). We found that Graminex pollen was able to reduce radical oxygen species (ROS) production by PC3 cells and MDA, NF&kappa;B mRNA, and PGE₂ levels, in rat prostate specimens. According to our experimental evidence, Graminex pollen appears to be a promising natural product for the management of the inflammatory components in the prostate.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Locatelli, Marcello, M|Macchione, Nicola, N|Ferrante, Claudio, C|Chiavaroli, Annalisa, A|Recinella, Lucia, L|Carradori, Simone, S|Zengin, Gokhan, G|Cesa, Stefania, S|Leporini, Lidia, L|Leone, Sheila, S|Brunetti, Luigi, L|Menghini, Luigi, L|Orlando, Giustino, G','2018-05-17 22:46:19','2018-05-17 22:46:19'),(399,41,29744476,'2466-054X','Prostate calcifications: A case series supporting the microbial biofilm theory.','Prostate calcifications are a common finding during transrectal prostate ultrasound in both healthy subjects and patients, but their etiopathogenesis and clinical significance are not fully understood. We aimed to establish a new methodology for evaluating the role of microbial biofilms in the genesis of prostate calcifications.Ten consecutive patients who had undergone radical prostatectomy were enrolled in this study. All of the patients presented with prostate calcifications during transrectal ultrasound evaluation before surgery and underwent Meares-Stamey tests and clinical evaluation with the National Institutes of Health Chronic Prostatitis Symptom Index and the International Prostate Symptom Score. At the time of radical prostatectomy, the prostate specimen, after removal, was analyzed with ultrasonography under sterile conditions in the operating room. Core biopsy specimens were taken from the site of prostate calcification and subjected to ultrastructural and microbiological analysis.The results of the Meares-Stamey test showed only 1 of 10 patients (10%) with positive cultures for . Two of five patients (40%) had positive cultures from prostate biopsy specimens. , , and  were isolated. Ultrastructural analysis of the prostate biopsy specimens showed prostate calcifications in 6 of 10 patients (60%), and a structured microbial biofilm in 1 patient who had positive cultures for  and .Although the findings are supported by a low number of patients, this study highlights the validity of the proposed methodology for investigating the role of bacterial biofilms in the genesis of prostate calcification.','2018-05-01 00:00:00','2018-04-04 00:00:00','2018-05-13 00:00:00',0,0,'Cai, Tommaso, T|Tessarolo, Francesco, F|Caola, Iole, I|Piccoli, Federico, F|Nollo, Giandomenico, G|Caciagli, Patrizio, P|Mazzoli, Sandra, S|Palmieri, Alessandro, A|Verze, Paolo, P|Malossini, Gianni, G|Mirone, Vincenzo, V|Bjerklund Johansen, Truls E, TE','2018-05-17 22:46:19','2018-05-17 22:46:19'),(400,41,29740844,'1439-0272','Association between male accesory gland infections and prostate cancer in Turkish men: A case-control study.','It is well known that chronic inflammation contributes to several forms of human cancer. Although several studies have investigated the association between prostatitis and prostate cancer, there is a lack of specifically designed study about male accessory gland infections (MAGI) and prostate cancer co-occurrence. We aimed to investigate this association with a case-control study in Turkish men. A total of 155 patients were enrolled to the study. After the pathological examination of the transrectal ultrasound-guided prostate biopsy specimens, patients were divided the two groups as control and prostate cancer and the presence of MAGI was determined. Of 155 patients, 145 met inclusion criteria. In the prostate cancer group, MAGI diagnose was determined in 18 of 31 patients (58.06%), while it was determined in 25 of 114 (21.93%) patients in the control group (p = .001). A significant correlation between MAGI and pathological Gleason score also revealed (p = .0001). We demonstrated that men with MAGI have increased risk for the development of prostate cancer. Moreover, in this population, most of the prostate cancers tend to be clinically significant or high grade.','2018-05-08 00:00:00','2018-05-08 00:00:00','2018-05-09 00:00:00',0,0,'Aykan, S, S|Temiz, M Z, MZ|Yilmaz, M, M|Ulus, I, I|Yuruk, E, E|Muslumanoglu, A Y, AY','2018-05-17 22:46:19','2018-05-17 22:46:19'),(401,41,29740839,'1439-0272','Ageing and inflammation in the male reproductive tract.','Ageing is usually characterised by a mild chronic proinflammatory state. Despite the tight association between both processes, the phenomenon has recently been termed inflammageing. Inflammation in the male reproductive tract is frequently linked with bacterial or virus infections but also with a broad range of noninfectious processes. Prostatitis, epididymitis and orchitis, among others, can lead to infertility. However, in spite of the inflammation theory of disease, chronic inflammation in male urogenital system does not always cause symptoms. With advancing age, inflammatory processes are commonly observed in the male reproductive tract. Nevertheless, the incidence of inflammation in reproductive organs and ducts varies greatly among elderly men. Inflammageing is considered a predictor of pathogenesis and the development of age-related diseases. This article briefly summarises the current state of knowledge on inflammageing in the male reproductive tract. Yet, the precise aetiology of inflammageing in the male urogenital system, and its potential contribution not only to infertility but most importantly to adverse health outcomes remains almost unknown. Thus, further investigations are required to elucidate the precise cross-links between inflammation and male reproductive senescence, and to establish the impact of anti-inflammatory drug treatments on elder men\'s general health status.','2018-05-08 00:00:00','2018-05-08 00:00:00','2018-05-09 00:00:00',0,0,'Frungieri, M B, MB|Calandra, R S, RS|Bartke, A, A|Matzkin, M E, ME','2018-05-17 22:46:19','2018-05-17 22:46:19'),(402,41,29739043,'1433-6510','Elevated Adiponectin in Expressed Prostatic Secretion is a Novel Indicator of Inflammatory Prostatitis.','Prostatitis is a common urologic disease with a high prevalence and a significant negative impact on the quality of life. There is a lack of clear understanding of the pathogenesis of prostatitis, there are no rapid diagnostic methods nor effective treatment methods. The present study explored the cytokine profiles in expressed prostatic secretions of prostatitis in the hope of obtaining specific diagnostic biomarkers for prostatitis.Cytokine antibody arrays, ELISA, and immunohistochemical staining were used to detect the levels and origin of cytokines in expressed prostatic secretions. The diagnostic value of adiponectin as an inflammatory indicator for sub-classification of prostatitis type III were evaluated.The results showed that adiponectin levels in prostatitis type IIIa (577.72 ± 558.86 ng/mL) were higher than in prostatitis type IIIb (124.82 (75.81, 241.04) ng/mL) and healthy controls (76.08 (23.34, 204.81) ng/mL), and that the adiponectin levels in prostatitis type IV (207.10 (128.02, 454.31) ng/mL) had a significant correlation with the white blood cell count in expressed prostatic secretion. Our results indicate that adiponectin had a moderate diagnostic value as an inflammatory indicator for sub-classification of prostatitis type III.It suggests that adiponectin plays an important role in the pathogenesis of inflammatory prostatitis and could be developed as a rapid laboratory test indicating inflammation in prostatitis.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-05-08 00:00:00',0,0,'Wang, Yanyun, Y|Li, Jie, J|Zhang, Lin, L|Xiong, Xiong, X|Che, Guanglu, G|Zhou, Bin, B|Gou, Xin, X|Hu, Huaizhong, H','2018-05-17 22:46:19','2018-05-17 22:46:19'),(403,41,29738184,'1009-3591','[Correlation between TCM syndrome types and clinical symptoms of benign prostatic hyperplasia with chronic prostatitis].','To investigate the correlation between the syndrome types of traditional Chinese medicine (TCM) and clinical symptoms of benign prostatic hyperplasia (BPH) with chronic prostatitis (BPH-CP).We selected 150 cases of BPH-CP in this study and divided them into 7 TCM syndrome types. Using univariate and multivariate logistic regression analyses, we studied the correlation of each TCM syndrome type with the age, disease course, prostate volume, postvoid residual urine volume (PVR), prostate-specific antigen (PSA) level, maximum urinary flow rate (Qmax), and International Prostate Symptoms Score (IPSS).Kidney-yin deficiency was correlated positively with the prostate volume but negatively with Qmax and IPSS; kidney-yang deficiency positively with the age and prostate volume but negatively with IPSS; the damp heat syndrome positively with the PSA level but negatively with the disease course, prostate volume and Qmax; the spleen-qi deficiency syndrome positively with the prostate volume but negatively with the disease course; liver-qi stagnation positively with the disease course but negatively with the age, prostate volume and PVR; the syndrome of qi stagnation and blood stasis positively with the disease course and IPSS but negatively with PVR; the syndrome of lung-heat and qi blockage positively with the age, Qmax and IPSS but negatively with the disease course.The TCM syndrome types of BPH-CP are closely correlated to their clinical symptoms. The analysis of the clinical objective indexes of BPH-CP can provide some reliable evidence for accurate identification of the TCM syndrome type of the disease.','2017-12-01 00:00:00','0000-00-00 00:00:00','2018-05-08 00:00:00',0,0,'Huang, Xin-Fei, XF|Ning, Ke-Qin, KQ|Wang, Qing, Q|Liu, Tao, T|He, Ying, Y|Xue, Jian-Guo, JG|Dai, Li-Qin, LQ|Zhu, Yong-Kang, YK','2018-05-17 22:46:19','2018-05-17 22:46:19'),(404,41,29738183,'1009-3591','[Efficacy of Lamiophlomis Rotata Capsule in the treatment of type ⅢB prostatitis].','To study the therapeutic effect of Lamiophlomis Rotata Capsule (LRC) in the treatment of type ⅢB prostatitis.We randomly divided 225 patients with type ⅢB prostatitis into an experimental group (n =125) and a control group (n =120), the former treated orally with LRC at 3 capsules tid while the latter with tamsulosin hydrochloride sustained-release capsules at 0.2 mg qd, both for 4 weeks. We compared the therapeutic effects between the two groups of patients based on the National Institutes of Health Chronic Prostatitis Symptom Index (NIH-CPSI) obtained before, immediately after and at 4 weeks after medication.A total of 120 patients completed the treatment in the experimental group, which showed remarkable decreases as compared with the baseline in the pain score (5.30 ± 1.23 vs 14.68 ± 1.51, P<0.05), quality of life (QoL) score (6.46 ± 0.93 vs 8.52 ± 1.05, P<0.05) and total NIH-CPSI score (17.50 ± 2.77 vs 27.99 ± 2.98, P<0.05) after 4 weeks of treatment, but no significant change in the urination symptoms score (7.41 ± 1.16 vs 7.16 ± 1.04, P>0.05). The experimental group achieved even markedly lower scores than the controls in the pain symptom (5.30 ± 1.23 vs 13.67 ± 1.49, P<0.05), QoL (6.46 ± 0.93 vs 7.47 ± 0.88, P<0.05) and total NIH-CPSI (17.50 ± 2.77 vs 25.77 ± 2.01, P<0.05) but a higher urination symptoms score than the latter after medication (7.16 ± 1.04 vs 5.68 ± 1.34, P<0.05). At 4 weeks after drug withdrawal, the experimental group also showed significantly lower scores of the pain symptom (7.23 ± 1.03), QoL (6.58 ± 0.87) and total NIH-CPSI (22.18 ± 2.03) than the baseline (all P<0.05) and those in the control group (14.14 ± 0.98, 8.12 ± 0.72 and 26.89 ± 1.67) (all P<0.05). Apart from dizziness in 2 of the patients, who gave up medication halfway, no other obvious adverse reactions were observed during the experiment.Lamiophlomis Rotata Capsule deserves to be recommended for the treatment of type ⅢB prostatitis for its safety and effectiveness in reducing the pain and improving the life quality of the patients.','2017-12-01 00:00:00','0000-00-00 00:00:00','2018-05-08 00:00:00',0,0,'Wei, Zhi-Feng, ZF|Zhou, Kai, K|Dong, Jie, J|Fu, Dian, D|Xu, Xiao-Feng, XF|Li, Ping, P|Cheng, Wen, W|Zhang, Zheng-Yu, ZY','2018-05-17 22:46:19','2018-05-17 22:46:19'),(405,42,29764368,'1471-2334','Airborne geographical dispersal of Q fever from livestock holdings to human communities: a systematic review and critical appraisal of evidence.','Q fever is a zoonotic disease caused by Coxiella burnetii. This bacterium survives harsh conditions and attaches to dust, suggesting environmental dispersal is a risk factor for outbreaks. Spatial epidemiology studies collating evidence on Q fever geographical contamination gradients are needed, as human cases without occupational exposure are increasing worldwide.We used a systematic literature search to assess the role of distance from ruminant holdings as a risk factor for human Q fever outbreaks. We also collated evidence for other putative drivers of C. burnetii geographical dispersal.In all documented outbreaks, infective sheep or goats, not cattle, was the likely source. Evidence suggests a prominent role of airborne dispersal; Coxiella burnetii travels up to 18 km on gale force winds. In rural areas, highest infection risk occurs within 5 km of sources. Urban outbreaks generally occur over smaller distances, though evidence on attack rate gradients is limited. Wind speed / direction, spreading of animal products, and stocking density may all contribute to C. burnetii environmental gradients.Q fever environmental gradients depend on urbanization level, ruminant species, stocking density and wind speed. While more research is needed, evidence suggests that residential exclusion zones around holdings may be inadequate to contain this zoonotic disease, and should be species-specific.','2018-05-15 00:00:00','2018-05-15 00:00:00','2018-05-16 00:00:00',0,0,'Clark, Nicholas J, NJ|Soares Magalhães, Ricardo J, RJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(406,42,29755882,'2166-7403','Concurrent Brucellosis and Q Fever Infection: a Case Control Study in Bamyan Province, Afghanistan.','More than 500,000 people are affected by brucellosis each year while the incidence of Q fever is poorly recorded. Consistent outbreaks of brucellosis have been reported in Afghanistan, affecting social and economic life. This study aimed to determine the means of propagation of brucellosis and Q-fever and establish appropriate control measures for both.An outbreak of 1,317 cases of brucellosis and Q fever was investigated from May 2011 to the end of 2012 in Bamyan province of Afghanistan. A total of 100 cases were selected by random sampling with equal number of neighbor controls. Data were collected through structured questionnaire.The average age was 30 years ±14 years. Of those sampled, 62% were female, 38% were male, and resided in three districts: Punjab, Yakawlang and Waras. Using multivariate analysis, being a housewife (OR=7.36), being within proximity of kitchens to barns (OR= 2.98), drinking un-boiled milk (OR= 5.26), butchering (OR= 3.53) and purchasing new animals in the last six months (OR= 3.53) were significantly associated with contraction of brucellosis and Q fever.Health educators should focus on families dealing with animals, especially on females. Pasturing, healthy milking, dunging, and slaughtering practices, along with use of safe dairy products should be the focus of preventive measures.','2018-05-17 00:00:00','2014-01-03 00:00:00','2018-05-14 00:00:00',0,0,'Saeed, Khwaja Mir Islam, KMI|Ahadi, Jamalludin, J|Sahak, Mohammad Nadir, MN|Ghiasi, Ahmad Farid, AF|Ashgar, Rana Jawad, RJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(407,42,29737455,'1179-1918','Current and Future Use of Chloroquine and Hydroxychloroquine in Infectious, Immune, Neoplastic, and Neurological Diseases: A Mini-Review.','The process of finding new therapeutic indications for currently used drugs, defined as \'repurposing\', is receiving growing attention. Chloroquine and hydroxychloroquine, with an original indication to prevent or cure malaria, have been successfully used to treat several infectious (HIV, Q fever, Whipple\'s disease, fungal infections), rheumatological (systemic lupus erythematosus, antiphospholipid antibody syndrome, rheumatoid arthritis, Sjögren\'s syndrome), and other immunological diseases. Indeed, they have anti-inflammatory, immunomodulating, anti-infective, antithrombotic, and metabolic effects. Among the biological effects of chloroquine and hydroxychloroquine, it is important to highlight their antitumoral properties, likely due to their strong antiproliferative, antimutagenic, and inhibiting autophagy capacities. These effects make these drugs a possible option in the treatment of several tumors in association with radiotherapy and chemotherapy. Finally, the repurposing of chloroquine and hydroxychloroquine is currently being examined for neurological diseases such as neurosarcoidosis, chronic lymphocytic inflammation with pontine perivascular enhancement responsive to corticosteroids, and primary progressive multiple sclerosis. Several ongoing clinical trials have been testing these drugs in non-neoplastic and neoplastic diseases. Moreover, the well-demonstrated good tolerability of chloroquine and hydroxychloroquine make them safe even during pregnancy. Gastrointestinal and cutaneous manifestations are considered not to be serious, while retinal, neuromuscular, and cardiac toxicities are classified as serious adverse events.','2018-05-08 00:00:00','2018-05-08 00:00:00','2018-05-08 00:00:00',0,0,'Plantone, Domenico, D|Koudriavtseva, Tatiana, T','2018-05-17 22:46:19','2018-05-17 22:46:19'),(408,42,29692911,'2052-2975','Comparison of genomes of  strains using formal order analysis.','The  strain NL3262 was isolated during the Q fever outbreak in the Netherlands in 2007-2010. Formal-order analysis (FOA) was used to study the similarity of the genome (chromosome and plasmid) of this strain with the genomes from other strains. Chromosomes from ten  strains and eight plasmids were studied with FOA tools such as \'Map of genes\' and \'Matrix of similarity.\' The \'Map of genes\' tool showed that the chromosome of strain  str. NL3262 distanced itself by the index of average remoteness () of 1.449640 (-axis) from chromosomes of other strains ( 1.448295-1.448865). The \'Matrix of similarity\' was used for an advanced analysis of the obtained results. The complete similarity of the components of chromosomes and plasmids was determined by pairwise comparison and the identification of nucleotides matching with them. A total of 84.90% of the chromosomal components of  strain NL3262 coincided completely with the chromosomal components of strain Z3055. For chromosomes of other strains, this percentage varied from 12.06% to 47.14%. The plasmid of strain NL3262 had 50.0% of the components being completely coincident with the components of the plasmid of RSA 331; with RSA 493 it was 29.89%. Thus,  str. NL3262 is the closest to str. Z3055 by the similarity of the chromosomal components, but on the index of average remoteness of the chromosome and the similarity of the plasmids\' QpH1 components, it is the closest to strain RSA 331.','2018-05-01 00:00:00','2018-02-27 00:00:00','2018-04-29 00:00:00',0,0,'Shpynov, S N, SN|Tarasevich, I V, IV|Skiba, A A, AA|Pozdnichenko, N N, NN|Gumenuk, A S, AS','2018-05-17 22:46:19','2018-05-17 22:46:19'),(409,42,29692904,'2052-2975','European Society for Coxiellosis, Chlamydioses, Anaplasmoses and Rickettsioses - American Society for Rickettsiology joint meeting 2017.','No abstract found.','2018-05-01 00:00:00','2018-02-13 00:00:00','2018-04-25 00:00:00',0,0,'Fournier, P-E, PE','2018-05-17 22:46:19','2018-05-17 22:46:19'),(410,42,29691859,'1751-0813','Survey of rabies vaccination status of Queensland veterinarians and veterinary students.','To determine the rabies vaccination status of Queensland veterinarians and veterinary students and their perception of zoonotic risk from Australian bat lyssavirus (ABLV).Cross-sectional questionnaire surveys.Questionnaires were sent by post in 2011 to veterinary surgeons registered in Queensland, to final-year veterinary students at James Cook University via SurveyMonkey® in 2013 and to final-year veterinary students at James Cook University and University of Queensland via SurveyMonkey® in 2014.The response rate for registered veterinarians was 33.5% and for veterinary students 33.3% and 30% in 2013 and 2014, respectively. Of the 466 registered veterinary surgeons, 147 (31.5%) had been vaccinated, with 72 (15.5%) currently vaccinated. For veterinary students the rabies vaccination rate was 20.0% (4/20) and 13.0% (6/46) in the 2013 and 2014 surveys, respectively. More than 95% of veterinary students had received the mandatory Q fever vaccine. Both veterinarians and students regarded bats and horses as high-risk species for zoonoses.Queensland veterinarians and veterinary students have low levels of protection against ABLV. Although incidents of ABLV spilling over from a bat to a domestic mammal are likely to remain rare, they pose a significant human health and occupational risk given the outcome of infection in humans is high consequence. Principals of veterinary practices and veterinary authorities in Australia should implement a policy of rabies vaccination for clinical staff and veterinary students.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-04-25 00:00:00',0,0,'Mendez, D, D|Foyle, L, L|Cobbold, R, R|Speare, R, R','2018-05-17 22:46:19','2018-05-17 22:46:19'),(411,42,29685511,'1097-6809','Primary and secondary arterial fistulas during chronic Q fever.','After primary infection with Coxiella burnetii, patients may develop acute Q fever, which is a relatively mild disease. A small proportion of patients (1%-5%) develop chronic Q fever, which is accompanied by high mortality and can be manifested as infected arterial or aortic aneurysms or infected vascular prostheses. The disease can be complicated by arterial fistulas, which are often fatal if they are left untreated. We aimed to assess the cumulative incidence of arterial fistulas and mortality in patients with proven chronic Q fever.In a retrospective, observational study, the cumulative incidence of arterial fistulas (aortoenteric, aortobronchial, aortovenous, or arteriocutaneous) in patients with proven chronic Q fever (according to the Dutch Chronic Q Fever Consensus Group criteria) was assessed. Proven chronic Q fever with a vascular focus of infection was defined as a confirmed mycotic aneurysm or infected prosthesis on imaging studies or positive result of serum polymerase chain reaction for C. burnetii in the presence of an arterial aneurysm or vascular prosthesis.Of 253 patients with proven chronic Q fever, 169 patients (67%) were diagnosed with a vascular focus of infection (42 of whom had a combined vascular focus and endocarditis). In total, 26 arterial fistulas were diagnosed in 25 patients (15% of patients with a vascular focus): aortoenteric (15), aortobronchial (2), aortocaval (4), and arteriocutaneous (5) fistulas (1 patient presented with both an aortocaval and an arteriocutaneous fistula). Chronic Q fever-related mortality was 60% for patients with and 21% for patients without arterial fistula (P < .0001). Primary fistulas accounted for 42% and secondary fistulas for 58%. Of patients who underwent surgical intervention for chronic Q fever-related fistula (n = 17), nine died of chronic Q fever-related causes (53%). Of patients who did not undergo any surgical intervention (n = 8), six died of chronic Q fever-related causes (75%).The proportion of patients with proven chronic Q fever developing primary or secondary arterial fistulas is high; 15% of patients with a vascular focus of infection develop an arterial fistula. This observation suggests that C. burnetii, the causative agent of Q fever, plays a role in the development of fistulas in these patients. Chronic Q fever-related mortality in patients with arterial fistula is very high, in both patients who undergo surgical intervention and patients who do not.','2018-04-20 00:00:00','2018-04-20 00:00:00','2018-04-24 00:00:00',0,0,'Karhof, Steffi, S|van Roeden, Sonja E, SE|Oosterheert, Jan J, JJ|Bleeker-Rovers, Chantal P, CP|Renders, Nicole H M, NHM|de Borst, Gert J, GJ|Kampschreur, Linda M, LM|Hoepelman, Andy I M, AIM|Koning, Olivier H J, OHJ|Wever, Peter C, PC','2018-05-17 22:46:19','2018-05-17 22:46:19'),(412,42,29680799,'1757-790X','Rare case of otomastoiditis due to  chronic infection.','Q fever is a zoonotic disease caused by  that usually presents with non-specific or benign constitutional symptoms. Diagnosis is often challenging and, after acute Q fever, 1%-5% of patients can develop chronic disease. We present an 80-year-old male patient who was admitted due to a 3 months history of fever, productive cough, myalgia, weight loss, headache and hearing loss. Chronic Q fever was confirmed by positive antiphase I immunoglobulin G. Frequent locations of chronic infection was discarded, and ear CT revealed a right mastoid infection. He was treated with doxycycline and hydroxychloroquine for 18 months with significant improvement. This is a rare case of chronic Q fever presenting with otomastoiditis that has never been described.','2018-04-21 00:00:00','2018-04-21 00:00:00','2018-04-22 00:00:00',0,0,'Gonçalves, Mariana, M|Moreira, Sónia, S|Gaspar, Elsa, E|Santos, Lèlita, L','2018-05-17 22:46:19','2018-05-17 22:46:19'),(413,42,29675780,'1573-7438','Seroprevalence of brucellosis and Q fever (Coxiellosis) in cattle herds in Maigana and Birnin Gwari agro-ecological zone of Kaduna State, Nigeria.','A cross sectional study was conducted to determine the seroprevalence and risk factors of brucellosis and Q fever in cattle in Maigana and Birnin Gwari agro-ecological zone of Kaduna State, Nigeria. This study aimed at determining the significance of Brucella spp. and Coxiella burnetti infections in cattle. A total of 400 sera samples (139 from males and 261 from females cattle) were collected and screened for brucellosis using Rose Bengal Plate test (RBPT) and competitive enzyme linked immunosorbent assay (cELISA) for brucellosis and indirect enzyme-linked immunosorbent assay (iELISA) for Q fever. A structured questionnaire was used to collect data on the sampled animals from the study population. Data were analyzed to determine association and risk factors. Sera analysis revealed that, 18.5 and 6.8% were seropositive by RBPT and cELISA for brucellosis, while 6.2% was seropositive by iELISA for Q fever. A significant association was detected between cattle sex and sensitivity of RBPT for detecting Brucella. Meanwhile, a non-significant association was found between cattle age and breed with sensitivity of RBPT, cELISA, and iELISA. The study indicates that brucellosis and Q ever exist with high prevalence particularly among female cattle. This presents a serious public health problem, calling for greater awareness among stakeholders and for co-ordinated surveillance for the diseases among cattle populations in Nigeria.','2018-04-19 00:00:00','2018-04-19 00:00:00','2018-04-20 00:00:00',0,0,'Adamu, S G, SG|Kabir, J, J|Umoh, J U, JU|Raji, M A, MA','2018-05-17 22:46:19','2018-05-17 22:46:19'),(414,42,29672510,'1935-2735','Rodent-borne diseases and their public health importance in Iran.','Rodents are reservoirs and hosts for several zoonotic diseases such as plague, leptospirosis, and leishmaniasis. Rapid development of industry and agriculture, as well as climate change throughout the globe, has led to change or increase in occurrence of rodent-borne diseases. Considering the distribution of rodents throughout Iran, the aim of this review is to assess the risk of rodent-borne diseases in Iran.We searched Google Scholar, PubMed, Science Direct, Scientific Information Database (SID), and Magiran databases up to September 2016 to obtain articles reporting occurrence of rodent-borne diseases in Iran and extract information from them. Out of 70 known rodent-borne diseases, 34 were reported in Iran: 17 (50%) parasitic diseases, 13 (38%) bacterial diseases, and 4 (12%) viral diseases. Twenty-one out of 34 diseases were reported from both humans and rodents. Among the diseases reported in the rodents of Iran, plague, leishmaniasis, and hymenolepiasis were the most frequent. The most infected rodents were Rattus norvegicus (16 diseases), Mus musculus (14 diseases), Rattus rattus (13 diseases), Meriones persicus (7 diseases), Apodemus spp. (5 diseases), Tatera indica (4 diseases), Meriones libycus (3 diseases), Rhombomys opimus (3 diseases), Cricetulus migratorius (3 diseases), and Nesokia indica (2 diseases).The results of this review indicate the importance of rodent-borne diseases in Iran. Considering notable diversity of rodents and their extensive distribution throughout the country, it is crucial to pay more attention to their role in spreading infectious diseases for better control of the diseases.','2018-04-01 00:00:00','2018-04-19 00:00:00','2018-05-06 00:00:00',0,0,'Rabiee, Mohammad Hasan, MH|Mahmoudi, Ahmad, A|Siahsarvie, Roohollah, R|Kryštufek, Boris, B|Mostafavi, Ehsan, E','2018-05-17 22:46:19','2018-05-17 22:46:19'),(415,43,29734959,'1469-4409','Calculation of the age of the first infection for skin sores and scabies in five remote communities in northern Australia.','Prevalence of skin sores and scabies in remote Australian Aboriginal communities remains unacceptably high, with Group A Streptococcus (GAS) the dominant pathogen. We aim to better understand the drivers of GAS transmission using mathematical models. To estimate the force of infection, we quantified the age of first skin sores and scabies infection by pooling historical data from three studies conducted across five remote Aboriginal communities for children born between 2001 and 2005. We estimated the age of the first infection using the Kaplan-Meier estimator; parametric exponential mixture model; and Cox proportional hazards. For skin sores, the mean age of the first infection was approximately 10 months and the median was 7 months, with some heterogeneity in median observed by the community. For scabies, the mean age of the first infection was approximately 9 months and the median was 8 months, with significant heterogeneity by the community and an enhanced risk for children born between October and December. The young age of the first infection with skin sores and scabies reflects the high disease burden in these communities.','2018-05-08 00:00:00','2018-05-08 00:00:00','2018-05-08 00:00:00',0,0,'Lydeamore, M J, MJ|Campbell, P T, PT|Cuningham, W, W|Andrews, R M, RM|Kearns, T, T|Clucas, D, D|Gundjirryirr Dhurrkay, R, R|Carapetis, J, J|Tong, S Y C, SYC|McCaw, J M, JM|McVernon, J, J','2018-05-17 22:46:19','2018-05-17 22:46:19'),(416,43,29723368,'1806-4841','Atypical crusted scabies in a patient with chronic liver disease caused by hepatitis B and D viruses.','Crusted scabies is a less common variant of scabies that is highly contagious, difficult to treat and involves infestation by Sarcoptes scabiei var. hominis. The classical clinical presentation includes crusted, scaly and generally non-pruritic lesions usually located on the head, neck, palmar, plantar and periungual region. It was first described in Norway in 1848 in patients with leprosy who presented with crusted lesions. In this study, we report the case of a patient with crusted scabies with florid clinical manifestations and chronic liver disease due to hepatitis B and delta virus infection.','2018-03-01 00:00:00','0000-00-00 00:00:00','2018-05-07 00:00:00',0,0,'Santos, Mônica, M|Maquiné, Gustavo Ávila, GÁ|Talhari, Carolina, C|Schettini, Antonio Pedro Mendes, APM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(417,43,29702253,'1873-0442','Infectious disease profiles of Syrian and Eritrean migrants presenting in Europe: A systematic review.','In the past decade, a large influx of migrants presented in Europe. Their country of origin was mainly either Syria or Eritrea. Public health institutions in host countries in Europe are challenged to screen and care for migrant populations with regard to infectious diseases.We performed a systematic literature review (according to PRISMA guidelines) to define the infectious disease profile of migrants originating in Syria and Eritrea.The search resulted in 825 papers of possible relevance for infectious diseases in migrants from Syria, of which, after screening, we included 35 in the systematic review. A further 265 papers of possible relevance for infectious diseases in Eritrean migrants were screened, of which we included 27 in the systematic review. In migrants from Syria, leishmaniasis was the most frequently reported infectious disease. In addition, colonisation with drug resistant, Gram-negativ bacteria was reported. In the Eritrean migrants the infectious disease most described in the selected papers was louse-borne relapsing fever. Other frequently reported infectious diseases were scabies and Plasmodium vivax malaria.Our systematic analysis defines the profiles of infectious diseases for migrants from Syria and Eritrea and serves as an evidence base for public health screening and care of presenting migrants.','2018-04-24 00:00:00','2018-04-24 00:00:00','2018-04-27 00:00:00',0,0,'Isenring, Egon, E|Fehr, Jan, J|Gültekin, Nejla, N|Schlagenhauf, Patricia, P','2018-05-17 22:46:19','2018-05-17 22:46:19'),(418,43,29698535,'1932-6203','Biological control of potato common scab by Bacillus amyloliquefaciens Ba01.','Potato common scab, which is caused by soil-borne Streptomyces species, is a severe plant disease that results in a significant reduction in the economic value of potatoes worldwide. Due to the lack of efficacious pesticides, crop rotations, and resistant potato cultivars against the disease, we investigated whether biological control can serve as an alternative approach. In this study, multiple Bacillus species were isolated from healthy potato tubers, and Bacillus amyloliquefaciens Ba01 was chosen for further analyses based on its potency against the potato common scab pathogen Streptomyces scabies. Ba01 inhibited the growth and sporulation of S. scabies and secreted secondary metabolites such as surfactin, iturin A, and fengycin with potential activity against S. scabies as determined by imaging mass spectrometry. In pot assays, the disease severity of potato common scab decreased from 55.6 ± 11.1% (inoculated with S. scabies only) to 4.2 ± 1.4% (inoculated with S. scabies and Ba01). In the field trial, the disease severity of potato common scab was reduced from 14.4 ± 2.9% (naturally occurring) to 5.6 ± 1.1% after Ba01 treatment, representing evidence that Bacillus species control potato common scab in nature.','2018-05-17 00:00:00','2018-04-26 00:00:00','2018-05-13 00:00:00',0,0,'Lin, Chih, C|Tsai, Chia-Hsin, CH|Chen, Pi-Yu, PY|Wu, Chia-Yen, CY|Chang, Ya-Lin, YL|Yang, Yu-Liang, YL|Chen, Ying-Lien, YL','2018-05-17 22:46:19','2018-05-17 22:46:19'),(419,43,29692685,'1477-5956','ITRAQ-based quantitative proteomic analysis of processed  L. for reducing the intestinal toxicity.','No abstract found.','2018-05-17 00:00:00','2018-04-17 00:00:00','2018-04-29 00:00:00',0,0,'Zhang, Yu, Y|Wang, Yingzi, Y|Li, Shaojing, S|Zhang, Xiuting, X|Li, Wenhua, W|Luo, Shengxiu, S|Sun, Zhenyang, Z|Nie, Ruijie, R','2018-05-17 22:46:19','2018-05-17 22:46:19'),(420,43,29667798,'1827-1820','Delusional infestation in psychodermatology.','Delusional infestation (DI), also known as delusional parasitosis, consists of a patient\'s strong belief that he or she is infested with a nonliving substance or living organism despite lack of medical evidence to support this belief. The most commonly reported sources of infestation include insects, fibrous strands, worms, and scabies. DI is predominantly seen in women and older patients. This disorder has a variable course and prognosis in patients. DI can be a primary psychiatric problem, or secondary to underlying medical conditions or other psychiatric disorders. It has been proposed that DI presents along a spectrum that includes four categories: overvalued concern of infestation, somatoform preoccupation, delusional state, and terminal delusional state. Management depends on the patient\'s category at presentation. The diagnostic approach for DI involves a thorough evaluation that can rule out medical conditions that underlie the patient\'s symptoms. This includes obtaining a detailed history, physical exam, and ordering laboratory tests. Treatment for primary DI includes both first and second-generation antipsychotics. Secondary DI treatment depends on the etiology. The prognosis of patients with DI is difficult to predict due to various factors including level of insight, underlying psychiatric conditions, and medication adherence. It is important for the physician to maintain a therapeutic relationship with the patient in order to properly address the patient\'s concerns.','2018-08-01 00:00:00','2018-04-18 00:00:00','2018-05-16 00:00:00',0,0,'Rosales Santillan, Monica, M|Taylor, Dustin L, DL|Reichenberg, Jason S, JS','2018-05-17 22:46:19','2018-05-17 22:46:19'),(421,43,29667664,'1756-591X','Identification of a novel aminopolycarboxylic acid siderophore gene cluster encoding the biosynthesis of ethylenediaminesuccinic acid hydroxyarginine (EDHA).','The mechanism of siderophore-mediated iron supply enhances fitness and survivability of microorganisms under iron limited growth conditions. One class of naturally occurring ionophores is the small aminopolycarboxylic acids (APCAs). Although they are structurally related to the most famous anthropogenic chelating agent, ethylenediaminetetraacetate (EDTA), they have been largely neglected by the scientific community. Here, we demonstrate the detection of APCA gene clusters by a computational screening of a nucleotide database. This genome mining approach enabled the discovery of a yet unknown APCA gene cluster in well-described actinobacterial strains, either known for their potential to produce valuable secondary metabolites (Streptomyces avermitilis) or for their pathogenic lifestyle (Streptomyces scabies, Corynebacterium pseudotuberculosis, Corynebacterium ulcerans and Nocardia brasiliensis). The herein identified gene cluster was shown to encode the biosynthesis of APCA, ethylenediaminesuccinic acid hydroxyarginine (EDHA). Detailed and comparatively performed production and transcriptional profiling of EDHA and its biosynthesis genes showed strict iron-responsive biosynthesis.','2018-04-18 00:00:00','2018-04-18 00:00:00','2018-04-18 00:00:00',0,0,'Spohn, Marius, M|Edenhart, Simone, S|Alanjary, Mohammad, M|Ziemert, Nadine, N|Wibberg, Daniel, D|Kalinowski, Jörn, J|Niedermeyer, Timo H J, THJ|Stegmann, Evi, E|Wohlleben, Wolfgang, W','2018-05-17 22:46:19','2018-05-17 22:46:19'),(422,43,29663338,'1365-4632','Tackling scabies: novel agents for a neglected disease.','The scabies mite, Sarcoptes scabiei var hominis, is an obligate ectoparasite of humans. It has been a source of distress for humanity since antiquity. The troublesome mite is emerging triumphant over current acaricidal agents with reports of emerging resistance and treatment failures. Scabies in endemic areas and crusted scabies offer additional management challenges. Exploration of indigenous plants and better understanding of mite biology and pathogenesis provide opportunities for the development of novel agents for this common pest. We review the recent diverse approaches to scabies, including the use of novel plant products with a better safety profile, translating the use of moxidectin from veterinary practice to human scabies, vaccination, immunotherapy, and development of drugs that directly target mite molecules.','2018-04-16 00:00:00','2018-04-16 00:00:00','2018-04-17 00:00:00',0,0,'Gopinath, Hima, H|Aishwarya, Manju, M|Karthikeyan, Kaliaperumal, K','2018-05-17 22:46:19','2018-05-17 22:46:19'),(423,43,29653437,'2211-0356','Early infectious exposures are not associated with increased risk of pediatric-onset multiple sclerosis.','We sought to determine if early infectious exposures such as daycare, early use of antibiotics, vaccinations and other germ exposures including pacifier use and playing on grass are associated with multiple sclerosis (MS) risk in children.This was a case-control study of children with MS or clinically isolated syndrome (CIS) and healthy controls enrolled at sixteen clinics participating in the US Network of Pediatric MS Centers. Parents completed a comprehensive environmental questionnaire that captured early infectious exposures, habits, and illnesses in the first five years of life. A panel of at least two pediatric MS specialists confirmed diagnosis of participants. Association of early infectious variables with diagnosis was assessed via multivariable logistic regression analyses, adjusting for age, sex, race, ethnicity, US birth region, and socioeconomic status (SES).Questionnaire responses for 326 eligible cases (mean age 14.9, 63.5% girls) and 506 healthy pediatric subjects (mean age 14.4, 56.9% girls) were included in analyses. History of flu with high fever before age five (p = 0.01), playing outside in grass and use of special products to treat head lice or scabies (p = 0.04) were associated with increased risk of MS in unadjusted analyses. In the multivariable model adjusted for age, sex, race, ethnicity, and mother\'s highest educational attainment, these results were not statistically significant. Notably, antibiotic use (p = 0.22) and regular daycare attendance before age 6 (p = 0.09) were not associated with odds of developing MS.Early infectious factors investigated in this study were not associated with MS risk.','2018-03-26 00:00:00','2018-03-26 00:00:00','2018-05-15 00:00:00',0,0,'Suleiman, Leena, L|Waubant, Emmanuelle, E|Aaen, Gregory, G|Belman, Anita, A|Benson, Leslie, L|Candee, Meghan, M|Chitnis, Tanuja, T|Gorman, Mark, M|Goyal, Manu, M|Greenberg, Benjamin, B|Harris, Yolanda, Y|Hart, Janace, J|Kahn, Ilana, I|Krupp, Lauren, L|Lotze, Timothy, T|Mar, Soe, S|Moodley, Manikum, M|Ness, Jayne, J|Nourbakhsh, Bardia, B|Rensel, Mary, M|Rodriguez, Moses, M|Rose, John, J|Rubin, Jennifer, J|Schreiner, Teri, T|Tillema, Jan-Mendelt, JM|Waldman, Amy, A|Weinstock-Guttman, Bianca, B|Cas','2018-05-17 22:46:19','2018-05-17 22:46:19'),(424,43,29637174,'2399-9772','Sex differences in child and adolescent physical morbidity: cohort study.','Evidence on sex differences in physical morbidity in childhood and adolescence is based largely on studies employing single/few physical morbidity measures and different informants. We describe sex differences in a wide range of parent/carer-reported physical morbidity measures between ages 4 and 13 years to determine evidence for a generalised pattern of an emerging/increasing female \'excess\'.Parents/carers (approximately 90% mothers) of the population-based UK ALSPAC cohort provided data on general health, physical conditions/symptoms and infections in their child approximately annually between ages 4 and 13. Logistic regression analyses determined the odds of each morbidity measure being reported in respect of females (vs males) at each age and the sex-by-age interaction, to investigate any changing sex difference with age.Six measures (general health past year/month, high temperature, rash, eye and ear infections) demonstrated an , and six (earache, stomach-ache, headache, lice/scabies, cold sores, urinary infections) an ; one (breathlessness) showed a . Just two showed either an  or  \'excess\'. Most changes were evident during childhood (prepuberty). Six measures showed  and four  \'. Few measures showed no sex differences throughout this period of childhood/early adolescence.Sex differences are evident for a wide range of parent-reported physical morbidity measures in childhood and early adolescence. Far more measures showed an emerging/increasing female \'excess\' than an emerging/increasing male \'excess\'. Further studies are required to examine whether patterns differ across sociodemographic/cultural groups, and to explain this generalised pattern.','2018-05-17 00:00:00','2017-12-29 00:00:00','2018-04-13 00:00:00',0,0,'Sweeting, Helen, H|Whitley, Elise, E|Teyhan, Alison, A|Hunt, Kate, K','2018-05-17 22:46:19','2018-05-17 22:46:19'),(425,44,29766929,'0028-3886','Sleep disorders in amyotrophic lateral sclerosis: A questionnaire-based study from India.','Amyotrophic lateral sclerosis (ALS) is a relatively rare neurological disorder affecting upper and lower motor neurons in the brain and spinal cord with survival for 3-5 years and rarely beyond 10 years. Sleep disturbances in ALS are underreported and undertreated and there is no related data from India. This study aimed to assess the frequency of sleep disorders in patients of ALS and their determinants.Patients with definite and probable ALS as per the El Escorial criteria were recruited from May 2014 to April 2016. Functional impairment, presence of sleep specific abnormalities and anxiety and depression were assessed using standardized questionnaires.Forty patients with ALS (23 male; 17 female) with their median age at presentation being 58.5 years (range 44-75 years) and the median duration of illness being 18 months (range: 4-120 months) were includedin the study. Half of the patients had poor sleep quality, which was significantly worse across all components of Pittsburgh Sleep Quality Index (PSQI) compared to controls. Sleep disorders were observed in 70%, insomnia in 65%, sleep disordered breathing/hypoventilation in 52.5% and restless legs syndrome in 5% patients. Night time awakenings attributable to symptoms associated with ALS were noted in 85%, and anxiety and depression in 57.5% patients. Excessive daytime somnolence emerged as an independent predictor for the presence of sleep disorders in ALS patients on multivariate logistic regression [P = 0.043, odd\'s ratio (OR) 1.435; 95% confidence interval[CI] (1.011-2.036)].This is the first study from India providing insight into the presence of sleep disorders in ALS. About half of the patients of ALS had a poor sleep quality and two-thirds suffered from sleep disturbances.','2018-01-01 00:00:00','0000-00-00 00:00:00','2018-05-16 00:00:00',0,0,'Panda, Samhita, S|Gourie-Devi, Mandaville, M|Sharma, Ankkita, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(426,44,29766748,'1708-8283','Medical Cannabis for Pediatric Moderate to Severe Complex Motor Disorders.','A complex motor disorder is a combination of various types of abnormal movements that are associated with impaired quality of life (QOL). Current therapeutic options are limited. We studied the efficacy, safety, and tolerability of medical cannabis in children with complex motor disorder. This pilot study was approved by the institutional ethics committee. Two products of cannabidiol (CBD) enriched 5% oil formulation of cannabis were compared: one with 0.25% δ-9-tetrahydrocannabinol (THC) 20:1 group, the other with 0.83% THC 6:1 group. Patients aged 1 to 17 years (n = 25) with complex motor disorder were enrolled. The assigned medication was administered for 5 months. Significant improvement in spasticity and dystonia, sleep difficulties, pain severity, and QOL was observed in the total study cohort, regardless of treatment assignment. Adverse effects were rare and included worsening of seizures in 2 patients, behavioral changes in 2 and somnolence in 1.','2018-01-01 00:00:00','2018-01-01 00:00:00','2018-05-16 00:00:00',0,0,'Libzon, Stephanie, S|Schleider, Lihi Bar-Lev, LB|Saban, Naama, N|Levit, Luda, L|Tamari, Yulia, Y|Linder, Ilan, I|Lerman-Sagie, Tally, T|Blumkin, Lubov, L','2018-05-17 22:46:19','2018-05-17 22:46:19'),(427,44,29766677,'1099-0496','Sleeping chILD: Neuroendocrine cell hyperplasia of infancy and polysomnography.','Neuroendocrine cell hyperplasia of infancy (NEHI) is a children\'s interstitial and diffuse lung disease of unknown etiology that presents in infancy with characteristic findings of tachypnea, retractions, crackles, and hypoxemia. At the present, the mainstay of treatment is oxygen supplementation to normalize oxygen saturations and decrease work of breathing. There are characteristic pulmonary function, radiographic, and histologic findings, but polysomnography (PSG) data has not been reported. We sought to report PSG data and implications for management and treatment of NEHI patients.A retrospective chart review was performed under a Colorado Institutional Review Board approved protocol for which consent was waived. Informatics for Integrating Biology and the Bedside was used to query the electronic medical record at Children\'s Hospital Colorado for patients with both a diagnosis of NEHI and a PSG. PSG was performed for clinical reasons. Routine sleep quality and respiratory parameters were recorded and analyzed.Of our 77 patients with NEHI, 14 (19%) children underwent PSG during the study period. Eight children met criteria for OSA and three met criteria for CSA. Ten patients had low oxygen saturations during a study, six had low sleep efficiency, and three had periodic limb movement disorder.Patients with NEHI may have sleep related breathing disorders that contribute to disrupted sleep, including obstructive and central sleep apnea, hypoxemia, decreased sleep efficiency, and increased periodic limb movement disorder. PSG should be considered as part of NEHI management, as it may lead to recognition of clinically significant sleep-disordered breathing.','2018-05-15 00:00:00','2018-05-15 00:00:00','2018-05-16 00:00:00',0,0,'Liptzin, Deborah R, DR|Hawkins, Stephen M M, SMM|Wagner, Brandie D, BD|Deterding, Robin R, RR','2018-05-17 22:46:19','2018-05-17 22:46:19'),(428,44,29764710,'1532-2955','A systematic review to explore the feasibility of a behavioural sleep intervention for insomnia in children with neurodevelopmental disorders: A transdiagnostic approach.','Children with neurodevelopmental disorders (NDD) are at high risk for sleep problems, especially insomnia. It is currently not known whether behavioural sleep interventions developed for typically developing (TD) children are effective for children with NDD, and if interventions need to be modified for each diagnostic group. The aim of this systematic review was to identify and evaluate commonalities, trends in outcomes, and the methodological quality of parent-delivered behavioural sleep interventions for children with NDD, specifically Attention-Deficit/Hyperactivity Disorder (ADHD), Autism Spectrum Disorder (ASD), Cerebral Palsy, and Fetal Alcohol Spectrum Disorder. Nine databases were searched. A total of 40 studies met eligibility criteria. The majority of studies were conducted with ASD and ADHD populations. Common sleep problems were evident across the NDD populations. The most frequently reported included bedtime resistance, night-waking, early morning awakening, and co-sleeping. The most common interventions used were implementation of healthy sleep practices, reinforcement, graduated extinction, and faded bedtime. All studies reported at least one behavioural treatment component as effective. Commonalities across NDD populations, as well as the TD population, for both sleep problems reported and behavioural interventions implemented, suggest the feasibility of developing a transdiagnostic behavioural sleep intervention suitable for children with a range of NDD.','2018-03-31 00:00:00','2018-03-31 00:00:00','2018-05-16 00:00:00',0,0,'Rigney, Gabrielle, G|Ali, Nicole S, NS|Corkum, Penny V, PV|Brown, Cary A, CA|Constantin, Evelyn, E|Godbout, Roger, R|Hanlon-Dearman, Ana, A|Ipsiroglu, Osman, O|Reid, Graham J, GJ|Shea, Sarah, S|Smith, Isabel M, IM|Van der Loos, Hendrik F M, HFM|Weiss, Shelly K, SK','2018-05-17 22:46:19','2018-05-17 22:46:19'),(429,44,29764524,'1478-9523','A qualitative examination of the factors related to the development and maintenance of insomnia in cancer survivors.','Insomnia is underrecognized and inadequately managed, with close to 60% of cancer survivors experiencing insomnia at some point in the treatment trajectory. The objective of this study was to further understand predisposing, precipitating, and perpetuating factors in the development and maintenance of insomnia in cancer survivors.A heterogeneous sample of 63 patients who had completed active treatment was recruited. Participants were required to have a score >7 on the Insomnia Severity Index and meet the diagnostic criteria for insomnia disorder. Open-ended, semistructured interviews were conducted to elicit participants\' experiences with sleep problems. An a priori set of codes and a set of codes that emerged from the data were used to analyze the data.ResultThe mean age of the sample was 60.5 years, with 30% identifying as non-white and 59% reporting their sex as female. The cancer types represented were heterogeneous with the two most common being breast (30%) and prostate (21%). Participants described an inherited risk for insomnia, anxious temperament, and insufficient ability to relax as predisposing factors. Respondents were split as to whether they classified their cancer diagnosis as the precipitating factor for their insomnia. Participants reported several behaviors that are known to perpetuate problems with sleep including napping, using back-lit electronics before bed, and poor sleep hygiene. One of the most prominent themes identified was the use of sleeping medications. Participants reported that they were reluctant to take medication but felt that it was the only option to treat their insomnia and that it was encouraged by their doctors.Significance of resultsInsomnia is a prevalent, but highly treatable, disorder in cancer survivors. Patients and provider education is needed to change individual and organizational behaviors that contribute to the development and maintenance of insomnia and increase access to evidence-based nonpharmacological interventions.','2018-05-16 00:00:00','2018-05-16 00:00:00','2018-05-16 00:00:00',0,0,'Garland, Sheila N, SN|Barg, Frances K, FK|Cakouros, Brigid, B|Gehrman, Philip, P|DuHamel, Katherine N, KN|Mao, Jun J, JJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(430,44,29764215,'1525-6073','Myotonic dystrophytype 1 - report of non-24-h sleep-wake disorder with excessive daytime sleepiness.','Myotonic dystrophy (MD) is a neuromuscular disease with myotonia, progressive weakness, and involvement of CNS, heart, and gastrointestinal system. Excessive daytime sleepiness (EDS) in myotonic dystrophy type 1 (MD1) is related to sleep breathing diseases, restless leg syndrome, periodic limb movements during sleep and narcoleptic-like phenotype. However, authors highlight a central dysfunction of sleep regulation. We describe a 26-year-old, female, MD1 patient with EDS. Sleep diary/actigraphy evidenced two different circadian periods with values of 1442 and 1522 min. Agomelatine, 50 mg at night, was prescribed with improvement of the circadian rhythm and complaints of sleepiness. The identification of unanticipated causes of EDS, such as circadian rhythm disorders permits an appropriated treatment. As we know, it is the first relate of non-24-h sleep-wake disorder in patient with MD1. Sleep diary and actigraphy could be good options to investigate sleep-wake cycle disorder in patients with MD and EDS.','2018-05-15 00:00:00','2018-05-15 00:00:00','2018-05-16 00:00:00',0,0,'Filho, Lucio Huebra Pimentel, LHP|Gomes, Ana Carolina Dias, ACD|Gonçalves, Bruno, B|Tufik, Sergio, S|Coelho, Fernando Morgadinho, FM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(431,44,29762213,'1538-9804','Feasibility of a Cognitive-Behavioral and Environmental Intervention for Sleep-Wake Difficulties in Community-Dwelling Cancer Patients Receiving Palliative Care.','High rates of sleep-wake difficulties have been found in patients with cancer receiving palliative care. Pharmacotherapy is the most frequently used treatment option to manage these difficulties despite numerous adverse effects and the absence of empirical evidence of its efficacy and innocuity in palliative care.This pilot study aimed to assess the feasibility and acceptability of a cognitive-behavioral and environmental intervention (CBT-E) to improve insomnia and hypersomnolence in patients with a poor functioning level and to collect preliminary data on its effects.Six patients with cancer receiving palliative care (Eastern Cooperative Oncology Group score 2-3), who had insomnia and/or hypersomnolence, received 1 CBT-E individual session at home. They applied the strategies for 3 weeks. Patients completed the Insomnia Severity Index, the Epworth Sleepiness Scale, a daily sleep diary, and a 24-hour actigraphic recording (7 days) at pretreatment and posttreatment, in addition to a semistructured interview (posttreatment).Participants found strategies easy to apply most of the time, and none was rated as impossible to use because of their health condition. However, their adherence and satisfaction toward CBT-E were highly variable. Results on the effects of CBT-E were heterogeneous, but improvements were observed in patients with a persistent insomnia disorder.The CBT-E protocol tested among this highly selected sample was fairly well received and suggested positive outcomes in some patients, particularly those with an insomnia complaint alone.Efforts should be pursued to adapt CBT-E and develop other nonpharmacological interventions, in order to provide an alternative to pharmacotherapy for sleep-wake difficulties in this population.','2018-05-14 00:00:00','2018-05-14 00:00:00','2018-05-15 00:00:00',0,0,'Bernatchez, Marie Solange, MS|Savard, Josée, J|Savard, Marie-Hélène, MH|Aubin, Michèle, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(432,44,29761579,'1099-1611','Latent class analysis differentiation of adjustment disorder and demoralization, more severe depressive and anxiety disorders, and somatic symptoms in patients with cancer.','Demoralization as a form of existential distress involves poor coping, low morale, hopelessness, helplessness and meaninglessness. In a secondary analysis of a cohort of German cancer patients, we aimed to explore latent class structure to assess the contribution that symptoms of demoralization make to anhedonic depression, anxiety, adjustment and somatic disorders.Measures of demoralization, depression, anxiety, physical symptoms and functional impairment had been completed cross-sectionally by 1527 patients with early or advanced cancer. Latent class analysis used maximum likelihood techniques to define the unobserved latent constructs that can be predicted as symptom clusters. Individual patients were assigned to the most probable class. Classes were compared on demographics, and logistic regression assessed the odds of individual items predicting each class.A four class model provided the best fit. Class 1 (n=829, 54.3%) was defined by the absence of distress; Classes 2, 3 and 4 all carried functional impairment. Class 2 (n=333, 21.8%) was differentiated by somatic symptoms (sleep, tiredness, appetite); Class 3 (n=163, 10.7%) by anhedonia, anxiety and severe demoralization; and Class 4 (n=202, 13.2%) by adjustment and moderate demoralization. Members of Class 3 were more likely to be younger, female, anhedonic, depressed, and anxious. In both Classes 3 and 4, functional impairment, physical symptom burden and suicidal ideation were present.In contrast with the severe symptom cluster carrying anhedonia, anxiety and demoralization, the moderate symptom cluster was formed by patients with demoralization and impaired functioning, a clinical picture consistent with a unidimensional model of adjustment disorder.','2018-05-14 00:00:00','2018-05-14 00:00:00','2018-05-15 00:00:00',0,0,'Bobevski, I, I|Kissane, D W, DW|Vehling, S, S|McKenzie, D P, DP|Glaesmer, H, H|Mehnert, A, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(433,44,29761479,'1469-493X','Antidepressants for insomnia in adults.','Insomnia disorder is a subjective condition of unsatisfactory sleep (e.g. sleep onset, maintenance, early waking, impairment of daytime functioning). Insomnia disorder impairs quality of life and is associated with an increased risk of physical and mental health problems including anxiety, depression, drug and alcohol abuse, and increased health service use. hypnotic medications (e.g. benzodiazepines and \'Z\' drugs) are licensed for sleep promotion, but can induce tolerance and dependence, although many people remain on long-term treatment. Antidepressant use for insomnia is widespread, but none is licensed for insomnia and the evidence for their efficacy is unclear. This use of unlicensed medications may be driven by concern over longer-term use of hypnotics and the limited availability of psychological treatments.To assess the effectiveness, safety and tolerability of antidepressants for insomnia in adults.This review incorporated the results of searches to July 2015 conducted on electronic bibliographic databases: the Cochrane Central Register of Controlled Trials (CENTRAL, 2015, Issue 6), MEDLINE (1950 to 2015), Embase (1980 to 2015) and PsycINFO (1806 to 2015). We updated the searches to December 2017, but these results have not yet been incorporated into the review.Randomised controlled trials (RCTs) of adults (aged 18 years or older) with a primary diagnosis of insomnia and all participant types including people with comorbidities. Any antidepressant as monotherapy at any dose whether compared with placebo, other medications for insomnia (e.g. benzodiazepines and \'Z\' drugs), a different antidepressant, waiting list control or treatment as usual.Two review authors independently assessed trials for eligibility and extracted data using a data extraction form. A third review author resolved disagreements on inclusion or data extraction.The search identified 23 RCTs (2806 participants).Selective serotonin reuptake inhibitors (SSRIs) compared with placebo: three studies (135 participants) compared SSRIs with placebo. Combining results was not possible. Two paroxetine studies showed significant improvements in subjective sleep measures at six (60 participants, P = 0.03) and 12 weeks (27 participants, P < 0.001). There was no difference in the fluoxetine study (low quality evidence).There were either no adverse events or they were not reported (very low quality evidence).Tricyclic antidepressants (TCA) compared with placebo: six studies (812 participants) compared TCA with placebo; five used doxepin and one used trimipramine. We found no studies of amitriptyline. Four studies (518 participants) could be pooled, showing a moderate improvement in subjective sleep quality over placebo (standardised mean difference (SMD) -0.39, 95% confidence interval (CI) -0.56 to -0.21) (moderate quality evidence). Moderate quality evidence suggested that TCAs possibly improved sleep efficiency (mean difference (MD) 6.29 percentage points, 95% CI 3.17 to 9.41; 4 studies; 510 participants) and increased sleep time (MD 22.88 minutes, 95% CI 13.17 to 32.59; 4 studies; 510 participants). There may have been little or no impact on sleep latency (MD -4.27 minutes, 95% CI -9.01 to 0.48; 4 studies; 510 participants).There may have been little or no difference in adverse events between TCAs and placebo (risk ratio (RR) 1.02, 95% CI 0.86 to 1.21; 6 studies; 812 participants) (low quality evidence).\'Other\' antidepressants with placebo: eight studies compared other antidepressants with placebo (one used mianserin and seven used trazodone). Three studies (370 participants) of trazodone could be pooled, indicating a moderate improvement in subjective sleep outcomes over placebo (SMD -0.34, 95% CI -0.66 to -0.02). Two studies of trazodone measured polysomnography and found little or no difference in sleep efficiency (MD 1.38 percentage points, 95% CI -2.87 to 5.63; 169 participants) (low quality evidence).There was low quality evidence from two studies of more adverse effects with trazodone than placebo (i.e. morning grogginess, increased dry mouth and thirst).We identified relatively few, mostly small studies with short-term follow-up and design limitations. The effects of SSRIs compared with placebo are uncertain with too few studies to draw clear conclusions. There may be a small improvement in sleep quality with short-term use of low-dose doxepin and trazodone compared with placebo. The tolerability and safety of antidepressants for insomnia is uncertain due to limited reporting of adverse events. There was no evidence for amitriptyline (despite common use in clinical practice) or for long-term antidepressant use for insomnia. High-quality trials of antidepressants for insomnia are needed.','2018-05-14 00:00:00','2018-05-14 00:00:00','2018-05-15 00:00:00',0,0,'Everitt, Hazel, H|Baldwin, David S, DS|Stuart, Beth, B|Lipinska, Gosia, G|Mayers, Andrew, A|Malizia, Andrea L, AL|Manson, Christopher Cf, CC|Wilson, Sue, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(434,45,29762688,'1460-2091','A multivariate genetic analysis confirms rs5010528 in the human leucocyte antigen-C locus as a significant contributor to Stevens-Johnson syndrome/toxic epidermal necrolysis susceptibility in a Mozambique HIV population treated with nevirapine.','Nevirapine is used in developing countries for the treatment of HIV infection, but its use is associated with rare serious adverse reactions such as Stevens-Johnson syndrome (SJS) and toxic epidermal necrolysis (TEN). Recently, an association between rs5010528 in the human leucocyte antigen (HLA)-C locus and SJS/TEN susceptibility has been described in sub-Saharan populations. Our aim was to verify this association in a population of nevirapine-treated patients from Mozambique.The rs5010528 SNP was analysed by direct sequencing in 27 patients who had developed SJS/TEN and 75 patients who did not develop adverse reactions after nevirapine treatment. A case-control association study was conducted. A multivariate analysis was performed in order to evaluate the role of HLA-C also in relation to other susceptibility genetic factors (CYP2B6, TRAF3IP2, HCP5, PSORS1C1 and GSTM1 genes).rs5010528 was significantly associated with a higher risk of developing SJS/TEN; the variant allele was more frequent in cases than in controls, conferring a high risk of developing this adverse reaction in carriers (OR = 5.72 and P = 0.0002 at genotype level, OR = 3.51 and P = 0.0002 at allelic level). The multivariate analysis showed that the HLA-C SNP, CYP2B6 (rs28399499), TRAF3IP2 (rs76228616) and GSTM1 (null genotype) can explain 25% of the susceptibility to this reaction, with the HLA-C SNP as the most significant contributor (P = 0.02 and OR = 5.64).Our study confirmed the association of the rs5010528 SNP in the HLA-C region with susceptibility to developing SJS/TEN in a population from Mozambique, suggesting that it could be a good genomic biomarker for SJS/TEN susceptibility in different sub-Saharan populations.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-15 00:00:00',0,0,'Ciccacci, Cinzia, C|Politi, Cristina, C|Mancinelli, Sandro, S|Ciccacci, Fausto, F|Lucaroni, Francesca, F|Novelli, Giuseppe, G|Marazzi, Maria Cristina, MC|Palombi, Leonardo, L|Borgiani, Paola, P','2018-05-17 22:46:19','2018-05-17 22:46:19'),(435,45,29762330,'1536-3732','Management of Severe Cicatricial Entropion With Labial Mucous Membrane Graft in Cicatricial Ocular Surface Disorders.','The management of cicatricial entropion represents a therapeutic challenge especially when the underlying causes are progressive cicatricial diseases that affect the ocular surface. The authors aimed to report long-term efficacy of labial mucous membrane graft to manage severe cicatricial entropion of the upper eyelid. This study is a retrospective chart review of patients who underwent tarsotomy associated with labial mucous membrane graft to treat severe cicatricial entropion of the upper eyelid. Surgeries were performed over a 16-year period. Clinical data (age, gender, etiology of the cicatricial entropion, improvement of symptoms, eyelid position, recurrence, complications, and follow-up period) were extracted from these patients\' charts. Etiology of the cicatricial entropion, improvement of symptoms, eyelid position, recurrence, complications, and follow-up period were evaluated. Sixty-three eyelids from 44 patients underwent surgery. Mean follow-up was 48.4 ± 46.1 months (range 6 months to 15 years). Main underlying diagnoses were Stevens-Johnson syndrome (63%), trachoma (19%), chemical injury (8%), and trauma (5%). Forty-three patients (98%) reported improvement of ocular symptoms after the procedure. Complete resolution (restoration of the upper eyelid margin to normal anatomic position with good esthetic appearance) was achieved in 52 eyelids (83%). Recurrence occurred in 7 (11%) eyelids. No postoperative infection, failure of graft survival, or other complications were observed. The use of labial mucous membrane as a posterior lamella graft showed good functional and cosmetic outcomes, long-term stability and low recurrence rates in the treatment of severe cicatricial entropion of the upper eyelid.','2018-05-14 00:00:00','2018-05-14 00:00:00','2018-05-15 00:00:00',0,0,'Osaki, Tammy H, TH|Sant\'Anna, Ana Estela, AE|Osaki, Midori H, MH|Kikkawa, Don O, DO|Yabumoto, Cristina, C|Yang, Patrick, P|Korn, Bobby S, BS','2018-05-17 22:46:19','2018-05-17 22:46:19'),(436,45,29758282,'1523-1747','Stevens-Johnson Syndrome / Toxic Epidermal Necrolysis: a multicenter retrospective study of 377 adult patients from the United States.','Stevens-Johnson syndrome / toxic epidermal necrolysis (SJS/TEN) is a rare, severe mucocutaneous reaction with few large cohorts reported. This multicenter retrospective study included patients with SJS/TEN seen by inpatient consultative dermatologists at 18 academic medical centers in the United States. 377 adult patients with SJS/TEN between 1/1/2000 and 6/1/2015 were entered, including 69.0% from 2010 onward. The most frequent cause of SJS/TEN was medication reaction (89.7%), most often trimethoprim / sulfamethoxazole (27.2%). The majority of patients were managed in an intensive care (27.2%) or burn unit (41.0%). Most received pharmacologic therapy (70.7%) versus supportive care alone (29.3%)-typically corticosteroids (42.5%), IVIG (35.3%), or both therapies (20.3%). Based on Day 1 SCORTEN predicted mortality, 78 in-hospital deaths were expected (21%), while the observed mortality of 54 patients (14.7%) was significantly lower (SMR 0.70; CI 0.58, 0.79). Stratified by therapy received, the standardized mortality ratio was lowest among those receiving both steroids and IVIG (0.52; CI 0.21, 0.79). This large cohort provides contemporary information regarding US patients with SJS/TEN. Mortality, while substantial, was significantly lower than predicted. While the precise role of pharmacotherapy remains unclear, co-administration of corticosteroids and IVIG, among other therapies, may warrant further study.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-14 00:00:00',0,0,'Micheletti, Robert G, RG|Chiesa-Fuxench, Zelma, Z|Noe, Megan H, MH|Stephen, Sasha, S|Aleshin, Maria, M|Agarwal, Ashwin, A|Boggs, Jennifer, J|Cardones, Adela R, AR|Chen, Jennifer K, JK|Cotliar, Jonathan, J|Davis, Mark Dp, MD|Dominguez, Arturo, A|Fox, Lindy P, LP|Gordon, Shayna, S|Hamrick, Ronald, R|Ho, Baran, B|Hughey, Lauren C, LC|Jones, Larry M, LM|Kaffenberger, Benjamin H, BH|Kindley, Kimball, K|Kroshinsky, Daniela, D|Kwong, Bernice Y, BY|Miller, Daniel D, DD|Mostaghimi, Arash, A|Musiek, Amy, ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(437,45,29756724,'1668-3501','Stevens-Johnson Syndrome associated with methotrexate treatment for acute lymphoblastic leukemia: a case report.','Toxic epidermal necrolysis and Stevens-Johnson syndrome are rare mucocutaneous diseases which are associated with a prolonged course and potentially lethal outcome. They are mostly drug induced and mortality rates are very high. Although mostly skin is involved, multiple organ systems such as cardiovascular, pulmonary, gastrointestinal, and urinary systems may be affected. Here, we report a case of Stevens- Johnson Syndrome associated with methotrexate treatment who developed acute cardiac failure and gastrointestinal hemorrhage beside skin findings. He had been treated with intravenous immunglobulin and methylprednisolone succesfully and continued chemotherapy with methotrexate treatment again.','2018-06-01 00:00:00','0000-00-00 00:00:00','2018-05-14 00:00:00',0,0,'Akıncı, Burcu, B|Siviş, Zuhal Ö, ZÖ|Şahin, Akkız, A|Karapınar, Deniz Y, DY|Balkan, Can, C|Kavaklı, Kaan, K|Aydınok, Yeşim, Y','2018-05-17 22:46:19','2018-05-17 22:46:19'),(438,45,29756718,'1668-3501','[Drug reaction with eosinophilia and systemic symptoms due to carbamazepine. Pediatric case].','Severe skin reactions include Stevens-Johnson Syndrome, toxic epidermal necrolysis and Drug reaction with Eosinophilia and Systemic Symptoms (DRESS) syndrome, which are uncommon in the pediatric population (incidence 1/1000- 10 000 children), but they have bad prognosis. Drug-sensitive Syndrome with eosinophilia and systemic symptoms consists in rash, hematological abnormalities, lymphadenopathy and organ involvement. We report the case of a 12-year-old male patient who developed this pathology after initiating anticonvulsant therapy with carbamazepine. We consider that it is important to be aware of this disease and to include it among the differential diagnoses in patients with similar conditions because this syndrome is life-threatening.','2018-06-01 00:00:00','0000-00-00 00:00:00','2018-05-14 00:00:00',0,0,'Pereira-Ospina, Rocío Del P, RDP|Bejarano-Quintero, Ana M, AM|Suescún-Vargas, José M, JM|Pinzón-Salamanca, Javier Y, JY','2018-05-17 22:46:19','2018-05-17 22:46:19'),(439,45,29756000,'2319-9644','Bullous Fixed Drug Eruption Following Ibuprofen Ingestion.','Fixed drug eruption (FDE) is a drug reaction involving skin and less commonly mucosal membranes. The common manifestation is localized well-demarcated patches or plaques appeared following receiving of a culprit drug. When re-exposure occurs, the rashes will appear at areas involved in previous episodes. Limited reports on bullous FDE due to ibuprofen have been documented before. Herein, we described an elderly man who experienced multifocal lesions in his oral mucosa, penis, and multiple sites of skin following ibuprofen ingestion confirmed as FDE by pathological studies. The culprit drug had been discontinued. Systemic and topical glucocorticoids as well as supportive care had been instituted. The patient\'s outcome was favorable and his lesions had been recovered within the next weeks. Patient\'s follow-up showed that he had received ibuprofen again sometime later resulting in anal mucosal lesion and similar penile involvement. In routine clinical practice, mucocutaneous adverse drug reactions should be considered. A high index of suspicion, the detailed medication history, the course of the symptoms, and distributing pattern of the lesions are essential clues for the diagnosis. However, judicious and prompt pathological studies can help to differentiate multifocal bullous FDE from major skin drug reactions such as Stevens-Johnson syndrome/toxic epidermal necrolysis.','2018-01-01 00:00:00','0000-00-00 00:00:00','2018-05-14 00:00:00',0,0,'Fazeli, Seyed Amirhossein, SA|Abbasi, Morteza, M|Jalali, Hadi, H|Eskandari, Sonia, S|Shamshirgaran, Farzaneh, F|Dehghani, Zahra, Z|Golabchifard, Reza, R|Ghiyasvand, Shahram, S|Ghannad, Kaveh, K','2018-05-17 22:46:19','2018-05-17 22:46:19'),(440,45,29743141,'1532-8171','Chemotherapy patient with Stevens-Johnson Syndrome presents to the Emergency Department: A case report.','Stevens-Johnson syndrome (SJS) is part of a continuum of severe mucocutaneous reactions, commonly thought to be triggered by certain medications. The syndrome itself is characterized by diffuse necrosis and detachment of the epidermis.This case report discusses a patient who presented to the Emergency Department with signs and symptoms of Stevens-Johnson syndrome four days after chemotherapy administration of ribociclib (Kisqali®). Ribociclib is a newly approved, cyclin-dependent kinase 4 and 6 (CDK4/6) inhibitor indicated for the treatment of hormone receptor positive, human epidermal growth factor receptor 2 negative (HR+/HER2-) metastatic breast cancer. Our case was a 70-year-old female patient with breast cancer who presented four days after her second administration of Ribociclib exhibiting skin findings consistent with SJS. Patient was transferred from the Emergency Department to a burn center for further management and diagnosis was confirmed by biopsy.While Stevens-Johnson syndrome has been a rare toxicity, it is potentially fatal. The emergency physician should pay special attention cancer patients presenting with suspicious rashes and carefully review their medications.','2018-04-11 00:00:00','2018-04-11 00:00:00','2018-05-10 00:00:00',0,0,'Widmer, Stephanie, S|Grossman, Michele, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(441,45,29734973,'1550-9397','Stevens-Johnson Syndrome After Armodafinil Use.','We present the case of a 21-year-old woman in whom Stevens-Johnson syndrome (SJS) developed after initiation of armodafinil. Although this rare and life-threatening reaction is listed on armodafinil\'s label, no cases have been reported in the literature. This case, in addition to an update of the drug\'s label after post-marketing research, both support the link between armodafinil and SJS. Providers should maintain a high clinical suspicion for SJS when starting therapy to minimize associated morbidity and mortality by discontinuing armodafinil at the onset of first symptoms.','2018-04-30 00:00:00','2018-04-30 00:00:00','2018-05-08 00:00:00',0,0,'Holfinger, Steven, S|Roy, Asim, A|Schmidt, Markus, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(442,45,29731949,'1857-9655','Stevens - Johnson Syndrome and Toxic Epidermal Necrolysis; Extensive Review of Reports of Drug-Induced Etiologies, and Possible Therapeutic Modalities.','Stevens - Johnson Syndrome and Toxic Epidermal Necrolysis are adverse hypersensitivity reactions that affect the skin and mucous membranes. They are characterised by erythematous macules and hemorrhagic erosions of the mucous membranes. Epidermal detachments of varying degrees of severity also occur in these conditions. Various aetiologies are associated with these conditions, with adverse drug reaction being the most common. Though the worldwide incidence of these conditions is recorded as low, diverse types of medication are being observed to lead to these conditions. This review compiles information on the details of Stevens-Johnson syndrome and Toxic Epidermal Necrolysis, the pathophysiology, therapeutic management, and largely considers the drug-induced etiologies associated with these conditions.','2018-04-15 00:00:00','2018-03-28 00:00:00','2018-05-11 00:00:00',0,0,'Fakoya, Adegbenro Omotuyi John, AOJ|Omenyi, Princess, P|Anthony, Precious, P|Anthony, Favour, F|Etti, Precious, P|Otohinoyi, David Adeiza, DA|Olunu, Esther, E','2018-05-17 22:46:19','2018-05-17 22:46:19'),(443,45,29723404,'1528-1167','The risk of Stevens-Johnson syndrome and toxic epidermal necrolysis in new users of antiepileptic drugs: Comment on data sparsity.','No abstract found.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-05-03 00:00:00',0,0,'Safiri, Saeid, S|Ashrafi-Asgarabad, Ahad, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(444,46,29768611,'1678-4561','Deaths of women hospitalized for childbirth and abortion, and of their concept, in maternity wards of Brazilian public hospitals.','The aim of this cross-sectional hospital-based study of 7,845 pregnancies was to analyze deaths of women hospitalized for childbirth and abortion, and fetal and neonatal deaths, in public hospitals in the cities of São Paulo, Rio de Janeiro and Niteroi (RJ), Brazil, in 2011. Outcomes of the pregnancies were: one maternal death, 498 abortions, 65 fetal deaths, 44 neonatal deaths and 7,291 infant survivors. Data were collected through interviews, medical records and the women\'s pregnancy records, and from the Mortality Information System (SIM). The study population was described and kappa coefficients of causes of death (from the SIM, and certified by research) and mortality health indicators were estimated. The maternal mortality ratio was 13.6 per 100,000 live births (LB), the fetal death rate was 8.8‰ births and the neonatal mortality rate was 6.0‰ LB. The drug most used to induce abortion was Misoprostol. The main causes of fetal and neonatal deaths were respiratory disorders and maternal factors. Congenital syphilis, diabetes and fetal death of unspecified cause were under-reported in the SIM. Kappa coefficients by chapter were 0.70 (neonatal deaths) and 0.54 (stillbirths). Good quality care in reproductive planning, prenatal care, during labor and at birth will result in prevention of deaths.','2018-05-01 00:00:00','0000-00-00 00:00:00','2018-05-16 00:00:00',0,0,'Kale, Pauline Lorena, PL|Jorge, Maria Helena Prado de Mello, MHPM|Fonseca, Sandra Costa, SC|Cascão, Angela Maria, AM|Silva, Kátia Silveira da, KSD|Reis, Ana Cristina, AC|Taniguchi, Mauro Tomoyuki, MT','2018-05-17 22:46:19','2018-05-17 22:46:19'),(445,46,29767349,'1433-0423','[Primary ophthalmological diagnosis of Treponema pallidum infection: A case series].','This report is on five patients (four men and one woman) between the age of 24 and 66 years old who presented with unclear visual impairment in our clinic between 2009 and 2016 for co-evaluation. The clinical picture included intermediate uveitis, chorioretinitis, panuveitis and bilateral spontaneous cystoid macular edema. None of the patients reported systemic or dermatological symptoms. In all five patients, serological testing revealed a Treponema pallidum infection as the reason for ocular inflammation. The ophthalmologist was therefore the first to discover a syphilitic infection. After initiation of appropriate antibiotic therapy, there was improvement in all five patients and an increase in visual acuity.','2018-05-16 00:00:00','2018-05-16 00:00:00','2018-05-16 00:00:00',0,0,'Grassl, D, D|Brandi Falcone, V, V|Gorte, K, K|Sauder, G, G','2018-05-17 22:46:19','2018-05-17 22:46:19'),(446,46,29765114,'2045-2322','Evaluation of the utility of a rapid test for syphilis at a sexually transmitted disease clinic in Buenos Aires, Argentina.','Even though syphilis can be easily diagnosed by simple and low-cost laboratory methods, it continues to be an important health problem. Rapid tests (RT) for the detection of treponemal antibodies can facilitate earlier diagnosis, access to treatment and linkage to care. The aim of this study was to analyse the usefulness of the incorporation of a RT in the detection of patients infected with T. pallidum in a sexually-transmitted disease (STD) clinic. Between March and December 2015, a syphilis RT was offered to patients who spontaneously attended the clinic. Conventional serology testing was additionally indicated to every participant. The RT for syphilis was offered to 1887 patients, of whom 31.1% agreed to get tested. VDRL test was performed in 84.0% of patients that were also tested with syphilis RT, with a significantly higher frequency observed among participants with reactive RT (94.3% vs. 79.8%, p < 0.001). These results showed that 33.7% of the participants were reactive for the RT and 27.0% were reactive for the VDRL test. Both tests were reactive in 24.9% and non-reactive in 64.3%. A high prevalence of active syphilis was detected in patients attending the clinic. The use of a syphilis RT had a positive impact, which in combination with the VDRL test increased the number of patients that were effectively diagnosed.','2018-05-15 00:00:00','2018-05-15 00:00:00','2018-05-16 00:00:00',0,0,'Gallo Vaulet, Lucía, L|Morando, Nicolás, N|Casco, Ricardo, R|Melgar, Asunta, A|Nacher, Silvia, S|Rodríguez Fermepin, Marcelo, M|Pando, María A, MA','2018-05-17 22:46:19','2018-05-17 22:46:19'),(447,46,29757546,'0254-9395','Elastophagocytosis and Elastolysis in Leprosy.','Elastophagocytosis is the engulfment of the elastic fibres by the histiocytes, multinucleated giant cells, or both. The cutaneous lesions showing elastophagocytosis are annular elastolytic giant cell granuloma, actinic keratoses, persistent insect-bite reactions, elastosis perforans serpiginosa, foreign body granuloma. Occasionally, it may occur in infectious diseases like leprosy, granulomatous syphilis, North-American blastomycosis, bacterial folliculitis, and cutaneous leishmaniasis. We report a case of lepromatous leprosy with necrotic erythema nodosum leprosum with secondary anetoderma. Histopathology from the atrophic macule of anetoderma revealed periappendageal, perineural infiltration, elastophagocytosis and reduction in elastic fibres.','0000-00-00 00:00:00','0000-00-00 00:00:00','2018-05-15 00:00:00',0,0,'Rambhia, K D, KD|Khopkar, U S, US','2018-05-17 22:46:19','2018-05-17 22:46:19'),(448,46,29750773,'1537-4521','Missed Opportunities for Human Immunodeficiency Virus and Syphilis Testing Among Men Who Have Sex With Men in China: A Cross-Sectional Study.','Men who have sex with men (MSM) are at high risk of human immunodeficiency virus (HIV)/syphilis. To inform strategies for dual testing, we describe patterns of HIV/syphilis testing, and examine factors associated with never testing for HIV/syphilis in China.An online survey (2016) was completed by MSM from 8 cities: men born biologically male, 16 years or older, and had sex with another man at least once during their lifetime. Demographic, sexual behavioral, and HIV/syphilis testing data were collected. Multivariable multinomial logistic regression identified characteristics associated with men who never tested for HIV/syphilis compared with men who ever tested for both infections.Overall, 2105 men participated. Among them, 35.1% (738/2105) never tested for HIV/syphilis, and in those ever tested for HIV, only half (54.0%, 709/1312) had tested for syphilis. Relative to men who had ever tested for both infections, those with increased probability of never testing for HIV/syphilis include non-gay sexual identity (prevalence odds ratio [POR] 1.86; 95% confidence interval [CI], 1.45-2.37), not disclosed their sexuality/sexual history with men other than their regular partner (POR, 2.22; 95% CI, 1.75-2.78]) or with health professionals (POR, 11.11; 95% CI, 7.69-14.29), no condomless sex with casual partners in the last 3 months (POR, 1.89; 95% CI, 1.37-2.56), no community engagement in sexual health (POR, 15.16; 95% CI, 9.40-24.45), and mainly met partners offline (POR, 1.49; 95% CI, 1.16-1.92).There are significant gaps in lifetime testing for HIV/syphilis among Chinese MSM. Strategies to target never testers and integrate syphilis testing within HIV testing services are urgently needed. Future opportunities include point-of-care dual test kits, and testing in China\'s expanding primary healthcare system.','2018-06-01 00:00:00','0000-00-00 00:00:00','2018-05-11 00:00:00',0,0,'Ong, Jason J, JJ|Fu, Hongyun, H|Pan, Stephen, S|Smith, M Kumi, MK|Wu, Dan, D|Wei, Chongyi, C|Cao, Bolin, B|Ma, Wei, W|Yang, Ligang, L|Tang, Weiming, W|Tucker, Joseph D, JD','2018-05-17 22:46:19','2018-05-17 22:46:19'),(449,46,29744768,'1573-3254','Symptom-Based Versus Laboratory-Based Diagnosis of Five Sexually Transmitted Infections in Female Sex Workers in Iran.','Among 1337 Iranian adult female sex workers in 2015, we assessed the diagnostic value of 4 self-reported sexually transmitted infection (STIs) symptoms for detecting laboratory-confirmed gonorrhea, chlamydia, trichomoniasis, human papillomavirus (HPV), and syphilis. While 37.7% reported vaginal discharge (VD), 25.9% reported pain or burning (P/B), 3.0% reported genital ulcers (GU), and 1.4% reported genital warts (GW), the prevalence of laboratory-confirmed syphilis, gonorrhea, chlamydia, trichomoniasis, and HPV was 0.4, 1.3, 6.0, 11.9, and 41.9%, respectively. The sensitivity of VD was 40.3% for detecting tricomoniasis, 37.5% for chlamydia, and 37.5% for gonorrhea. The sensitivity of P/B ranged from 12.5% for gonorrhea to 25.2% for trichomoniasis. The sensitivity of GU and GW was very low for 5 STIs. The sensitivity of all symptoms combined was also lower than 50%. Among asymptomatic participants, 41.2% tested positive for HPV, 11.8% for trichomoniasis, and less than 6.6% for other STIs. Symptom-based case management and surveillance of STIs can lead to misclassification of a large proportion of cases.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-10 00:00:00',0,0,'Shahesmaeili, Armita, A|Karamouzian, Mohammad, M|Shokoohi, Mostafa, M|Kamali, Kianoush, K|Fahimfar, Noushin, N|Nadji, Seyed Alireza, SA|Sharifi, Hamid, H|Haghdoost, Ali Akbar, AA|Mirzazadeh, Ali, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(450,46,29743682,'2045-2322','Preoperative screening for illicit drug use in patients undergoing emergency surgery: A prospective observational study.','Knowledge of illicit drug users (IDUs) is important because of the comorbidity related to drug use. In this prospective, observational study, we screened 1007 patients undergoing emergency surgery and found that 75 of them (7.5%) were IDUs The results of preoperative screening showed that the rates of HIV and syphilis infection were significantly higher in IDUs (HIV (+) 2.6%, syphilis (+) 10.7%) than in non-IDUs (HIV (+) 0, syphilis (+) 0.5%). Intraoperative consumption of remifentanil (IDUs: 1.85 ± 1.30 vs. non-IDUs: 1.31 ± 0.86, p = 0.009), midazolam (IDUs: 4.82 ± 1.52 vs. non-IDUs: 4.15 ± 1.81, p = 0.002), and atracurium (IDUs: 31.5 ± 15.1 vs. non-IDUs: 25.5 ± 11.9, p = 0.006) and the proportion of patients requiring postoperative fentanyl (IDUs: 15 (20.0%) vs. non-IDUs: 95 (1.2%), p = 0.031) were significantly increased in IDUs compared to non-IDUs. Postoperative complications were observed in 22.7% (17/75) of patients who were IDUs, which was significantly increased when compared with non-IDUs (6.0%, 56/932, p < 0.001). The mortality rate within 30 days after surgery was similar between the two groups. These findings suggested that the IDUs were associated with increased rates of HIV and syphilis infection; greater consumption of intraoperative opioids, sedatives, and muscle relaxants; increased postoperative complications and a similar mortality rate within 30 days after surgery when compared with non-IDUs.','2018-05-09 00:00:00','2018-05-09 00:00:00','2018-05-15 00:00:00',0,0,'Li, Jingyi, J|Ma, He, H|Liao, Ren, R|Huang, Yanjuan, Y|Chen, Guiyong, G','2018-05-17 22:46:19','2018-05-17 22:46:19'),(451,46,29741665,'1537-6591','Evaluation of PrEP eligibility criteria using sexually transmissible infections as HIV risk markers at enrolment in PrEPX, a large Australian HIV pre-exposure prophylaxis trial.','The PrEPX trial provided HIV pre-exposure prophylaxis (PrEP) to 2600 people in Victoria, Australia. To determine participants\' HIV risk, PrEPX used six eligibility criteria derived from the Australian PrEP guidelines, based on the CDC PrEP guidelines. Participants who fulfilled no eligibility criteria could be enrolled if clinically assessed to need PrEP. This study evaluated whether PREPX eligibility criteria correlated with biological HIV risk markers, namely syphilis, anorectal chlamydia or anorectal gonorrhoea (STIs).Adjusted odds ratios (aOR) were calculated to assess whether each eligibility criterion predicted a diagnosis of the aforementioned STIs at enrolment.1774 participants were included, 10.2% tested positive for STIs. Eligibility criteria predicted STI diagnoses as follows: (1) aOR 2.5 (95%CI 1.4-4.4) for condomless anal intercourse (CLAI) with a HIV-positive regular sexual partner (RSP) with detectable viral load; (2) aOR 1.8 (95%CI 1.3-2.5) for receptive CLAI with casual sexual partners; (3) aOR 1.8 (95%CI 1.3-2.5) for previous STIs; (4) aOR 2.1 (95%CI 1.4-3.0) for methamphetamine use; (5) aOR 0.8 (95%CI 0.6-1.1) for unsuccessful condom use; and (6) aOR 1.0 (95%CI 0.7-1.4) for insertive CLAI when uncircumcised. Participants who enrolled outside the eligibility criteria had an STI frequency of 7.1%.Eligibility criteria 1-4 predicted diagnoses of STIs, eligibility criteria 5-6 did not. Our findings support the use of PrEP eligibility criteria recommended in current guidelines. Participants enrolled outside the eligibility criteria had substantial prevalence of STIs, suggesting that people who request PrEP but do not fulfil eligibility criteria may nonetheless benefit from PrEP.','2018-05-07 00:00:00','2018-05-07 00:00:00','2018-05-09 00:00:00',0,0,'Cornelisse, Vincent J, VJ|Fairley, Christopher K, CK|Stoove, Mark, M|Asselin, Jason, J|Chow, Eric P F, EPF|Price, Brian, B|Roth, Norman J, NJ|Willcox, Jeff, J|Tee, B K, BK|Penn, Matthew, M|Chang, Christina C, CC|Armishaw, Judith, J|Forgan-Smith, George, G|Wright, Edwina J, EJ|PrEPX study team','2018-05-17 22:46:19','2018-05-17 22:46:19'),(452,47,29766943,'0028-3886','Brain-stem hemangioblastomas: The seemingly innocuous lesion in a perilous location.','Hemangioblastomas [75% sporadic, 25% with Von Hippel Lindau (VHL) disease] are highly vascular, benign lesions. The surgical nuances, management, and complication avoidance in brain-stem hemangioblastomas (BHs) have been studied.Over 18 years, 27(mean age: 29 years; range 15-60 years) consecutive cases of BH underwent microsurgical excision. All patients were assessed clinico-radiologically for neurological deficits and screened for VHL disease. Outcome of the patients was based on Karnofsky Performance Status scale (KPS).12 out of 19 (70.4%) patients with hydrocephalus underwent a cerebrospinal fluid (CSF) diversion procedure. Lower cranial nerve palsy was present in 10 (37%) patients and motor weakness in 13 (48%). The tumours [mean size 3.34 ± 1.06 cm, range: 1.4-5.5 cm; 11 solid, rest solid-cystic; 18 (66.7%) subpial and 9 (33.33%) intramedullary] were divided into four categories based on size: A: <2 cm (n = 5,18.5%); B: 2-3 cm (n = 10,37%); C: 3-4 cm (n = 6,22.2%); D: >4 cm (n = 6,22.2%). Their location was at posterior cervicomedullary junction (n = 12); pontomedullary junction (n = 7); pons (n = 3), medulla (n = 3) and ponto-mesencephalic region (n = 2). Multiple flow voids were seen in >50% patients with tumour >2 cm. 5 patients had syringomyelia; and, 8 had diffuse cervical cord expansion. Two patients with a large vascular tumour underwent preoperative embolization. Six patients had VHL disease; one underwent bilateral adrenalectomy for refractory hypertension; and, the another, nephrectomy for renal cell carcinoma. Twenty-six patients underwent a midline suboccipital craniectomy; and, 1 with a cerebellopontine angle tumour, a retromastoid craniectomy. 15 patients underwent total excision; 10 patients, near-total (<10% remaining) excision, and 2 patients, a subtotal (>10% remaining)) excision. Three patients (2 with VHL disease) expired due to exsanguinating hemorrhage, spreading venous thrombosis and aspiration pneumonitis, respectively. At follow-up visit (median: 25 ± interquartile range 2-56months), 17 patients had improved KPS, 4 remained in same status and 3 (recently operated, on tracheostomy) had worsened KPS.Significant improvement is achievable in neurological status in patients following successful extirpation of a brain-stem hemangioblastoma, despite a turbulent perioperative period. Leaving tumour capsule adherent to the brain-stem often helps in preserving brain-stem function. Postoperatively, the patients should be monitored for their respiratory and lower cranial nerve status to prevent aspiration pneumonitis.','2018-01-01 00:00:00','0000-00-00 00:00:00','2018-05-16 00:00:00',0,0,'Joseph, Jeena, J|Behari, Sanjay, S|Gupta, Shruti, S|Bhaisora, Kamlesh Singh, KS|Gandhi, Anish, A|Srivastava, Arun, A|Jaiswal, Awadhesh K, AK','2018-05-17 22:46:19','2018-05-17 22:46:19'),(453,47,29748208,'1936-959X','Relationship between Cough-Associated Changes in CSF Flow and Disease Severity in Chiari I Malformation: An Exploratory Study Using Real-Time MRI.','Currently no quantitative objective test exists to determine disease severity in a patient with Chiari I malformation. Our aim was to correlate disease severity in symptomatic patients with Chiari I malformation with cough-associated changes in CSF flow as measured with real-time MR imaging.Thirteen symptomatic patients with Chiari I malformation (tonsillar herniation of ≥5 mm) were prospectively studied. A real-time, flow-sensitized pencil-beam MR imaging scan was used to measure CSF stroke volume during rest and immediately following coughing and relaxation periods (total scan time, 90 seconds). Multiple posterior fossa and craniocervical anatomic measurements were also obtained. Patients were classified into 2 groups by neurosurgeons blinded to MR imaging measurements: 1) nonspecific Chiari I malformation (5/13)-Chiari I malformation with nonspecific symptoms like non-cough-related or mild occasional cough-related headache, neck pain, dizziness, paresthesias, and/or trouble swallowing; 2) specific Chiari I malformation (8/13)-patients with Chiari I malformation with specific symptoms and/or objective findings like severe cough-related headache, myelopathy, syringomyelia, and muscle atrophy. The Spearman correlation was used to determine correlations between MR imaging measurements and disease severity, and both groups were also compared using a Mann-Whitney  test.There was a significant negative correlation between the percentage change in CSF stroke volume (resting to postcoughing) and Chiari I malformation disease severity ( = 0.59;  = .03). Mann-Whitney comparisons showed the percentage change in CSF stroke volume (resting to postcoughing) to be significantly different between patient groups ( = .04). No other CSF flow measurement or anatomic measure was significantly different between the groups.Our exploratory study suggests that assessment of CSF flow response to a coughing challenge has the potential to become a valuable objective noninvasive test for clinical assessment of disease severity in patients with Chiari I malformation.','2018-05-10 00:00:00','2018-05-10 00:00:00','2018-05-11 00:00:00',0,0,'Bezuidenhout, A F, AF|Khatami, D, D|Heilman, C B, CB|Kasper, E M, EM|Patz, S, S|Madan, N, N|Zhao, Y, Y|Bhadelia, R A, RA','2018-05-17 22:46:19','2018-05-17 22:46:19'),(454,47,29741445,'2385-1996','Cervical spine taper ratios: Normal tolerance limits.','Background Spinal canal tapering, which can be measured as taper ratios, affects cerebrospinal fluid flow dynamics. We calculated the tolerance interval for normal cervical spine taper ratios to facilitate the detection of abnormal taper ratios. Methods We collected a series of patients who had cervical spine magnetic resonance studies reported as normal. We measured anteroposterior diameters of the cervical spine and calculated C1-C4, C4-C7, and C1-C7 taper by standard methodology. We calculated the normal tolerance limits for taper ratios and compared results of this study with data in previous reports on taper ratios. Results We enrolled 78 patients aged 2-55 years. The 99% tolerance limits for the taper ratios for C1-C4, C4-C7, and C1-C7 were -0.31 to +0.09, -0.11 to +0.14, and -0.13 to +0.05 cm/level, respectively. Age and sex were not significant variables for taper ratios. Taper ratios in this study agreed with those reported for controls in previous studies. Patients with syringomyelia in previous reports tended to have taper ratios outside the normal tolerance limits. Conclusion Normal limits of the cervical taper ratios are reported.','2018-01-01 00:00:00','2018-01-01 00:00:00','2018-05-09 00:00:00',0,0,'Thompson, Adrienne, A|Zea, Ryan, R|Haughton, Victor, V','2018-05-17 22:46:19','2018-05-17 22:46:19'),(455,47,29734193,'1423-0305','Spontaneous Resolution of Chiari 1-Associated Syringomyelia: A Report of Two Cases.','Traditional teaching is that Chiari 1 malformations with syrinx should be operated as soon as possible. We present 2 cases of a radiologically proven Chiari 1 malformation with syrinx which were treated nonoperatively and improved radiologically.Two children with an MRI-proven Chiari 1 malformations were followed up nonoperatively for 7 years (2010-2017). One was a boy aged 8 years and the other a girl aged 9 years at first presentation. Their parents were not interested in a surgical option and so it was decided to adopt a wait-and-watch policy. Both patients were followed up with a regular half-yearly clinical examination and yearly MRI studies (2010-2017).It was found that, in both of them, the initial cough during swallowing and the headache improved. Serial MRI showed that the hind-brain protrusion was reduced and syrinx diminished or resolved well.Some children with Chiari I and syringomyelia may show spontaneous resolution of symptoms and syringomyelia. Large registry studies will be needed to determine how likely it is that Chiari-associated syringes will resolve, and whether there are particular anatomic or neurologic differences between those who require surgery and those who don\'t.','2018-05-07 00:00:00','2018-05-07 00:00:00','2018-05-07 00:00:00',0,0,'Ramnarayan, R, R|Ganesh, C V Shankar, CVS|Kumar, Ramesh, R','2018-05-17 22:46:19','2018-05-17 22:46:19'),(456,47,29732422,'2414-469X','Developments in the treatment of Chiari type 1 malformations over the past decade.','Chiari malformations type 1 (CM-1), a developmental anomaly of the posterior fossa, usually presents in adolescence or early adulthood. There are few studies on the national incidence of CM-1, taking into account outcomes based on concurrent diagnoses. To quantify trends in treatment and associated diagnoses, as retrospective review of the Kid\'s Inpatient Database (KID) from 2003-2012 was conducted.Patients aged 0-20 with primary diagnosis of CM-1 in the KID database were identified. Demographics and concurrent diagnoses were analyzed using chi-squared and -tests for categorical and numerical variables, respectively. Trends in diagnosis, treatments, and outcomes were analyzed using analysis of variance (ANOVA).Five thousand four hundred and thirty-eight patients were identified in the KID database with a primary diagnosis of CM-1 (10.5 years, 55% female). CM-1 primary diagnoses have increased over time (45 to 96 per 100,000). CM-1 patients had the following concurrent diagnoses: 23.8% syringomyelia/syringobulbia, 11.5% scoliosis, 5.9% hydrocephalus, 2.2% tethered cord syndrome. Eighty-three point four percent of CM-1 patients underwent surgical treatment, and rate of surgical treatment for CM-1 increased from 2003-2012 (66% to 72%, P<0.001) though complication rate decreased (7% to 3%, P<0.001) and mortality rates remained constant. Seventy percent of surgeries involved decompression-only, which increased neurologic complications compared to fusions (P=0.039). Cranial decompressions decreased from 2003-2012 (42.2-30.5%) while spinal decompressions increased (73.1-77.4%). Fusion rates have increased over time (0.45% to 1.8%) and are associated with higher complications than decompression-only (11.9%  4.7%). Seven point four percent of patients experienced at least one peri-operative complication (nervous system, dysphagia, respiratory most common). Patients with concurrent hydrocephalus had increased; nervous system, respiratory and urinary complications (P<0.006) and syringomyelia increased the rate of respiratory complications (P=0.037).CM-1 diagnoses have increased in the last decade. Despite the decrease in overall complication rates, fusions are becoming more common and are associated with higher peri-operative complication rates. Commonly associated diagnoses including syringomyelia and hydrocephalus, can dramatically increase complication rates.','2018-03-01 00:00:00','0000-00-00 00:00:00','2018-05-11 00:00:00',0,0,'Passias, Peter G, PG|Pyne, Alexandra, A|Horn, Samantha R, SR|Poorman, Gregory W, GW|Janjua, Muhammad B, MB|Vasquez-Montes, Dennis, D|Bortz, Cole A, CA|Segreto, Frank A, FA|Frangella, Nicholas J, NJ|Siow, Matthew Y, MY|Sure, Akhila, A|Zhou, Peter L, PL|Moon, John Y, JY|Diebo, Bassel G, BG|Vira, Shaleen N, SN','2018-05-17 22:46:19','2018-05-17 22:46:19'),(457,47,29731280,'1532-2653','\"Sandwich Deformity\" in Klippel-Feil syndrome: A \"Full-Spectrum\" presentation of associated craniovertebral junction abnormalities.','Klippel-Feil syndrome (KFS) is defined as congenital fusion of two or more cervical vertebrae resulting from a segmentation failure in the developing spine. According to Samartzis et al., the most commonly fused segments are found at C2/3 (74.1%) and C6/7 (70.4%). In patients with C2/3 fusion, especially when there is additional C1 occipitalization, several secondary anomalies including atlantoaxial dislocation (AAD), basilar invagination (BI), Chiari malformation, and syringomyelia can be identified. In this report, we present a case of a 12-year-old patient with C2/3 and occipitalization and a \"Full-Spectrum\" presentation of associated CVJ abnormalities including C0/1 fusion, AAD, BI, Chiari malformation, syringomyelia, myelopathy and cranial neuropathy received neurological decompression of the cervico-medullary junction by posterior reduction of the AAD and reconstruction of her CVJ using an unconventional hybrid construct due to a high-riding right vertebral artery in C2. To our knowledge, her \"Full-Spectrum\" presentation may include the most categories of concomitant abnormalities in the literature. In addition, She received neurological decompression of the cervico-medullary junction using an unconventional hybrid construct due to a high-riding vertebral artery in C2. Three months after the surgery, all of her symptoms recovered significantly. Neither Chiari malformation nor syringomyelia could be identified by MRI two years after the surgery. At the last follow-up (4 years), the patient became completely asymptomatic.','2018-05-03 00:00:00','2018-05-03 00:00:00','2018-05-07 00:00:00',0,0,'Tian, Yinglun, Y|Fan, Dongwei, D|Xu, Nanfang, N|Wang, Shenglin, S','2018-05-17 22:46:19','2018-05-17 22:46:19'),(458,47,29721352,'2229-5097','Dorsal hemangioblastoma manifesting as holocord syringomyelia.','Intramedullary spinal hemangioblastomas are known to be accompanied by syringomyelia.Here, we report a patient who presented with symptoms of a Chiari malformation but was found to have a D4 intramedullary hemangioblastoma with a holocord syrinx.Although rare, neurosurgeons should keep in mind the possibility of an intramedullary hemangioblastoma in patients presenting with symptoms of a Chiari malformation.','2018-05-17 00:00:00','2018-04-05 00:00:00','2018-05-07 00:00:00',0,0,'Dutta, Gautam, G|Singh, Daljit, D|Singh, Hukum, H|Srivastava, Arvind K, AK|Jagetia, Anita, A|Agrawal, Atul, A','2018-05-17 22:46:19','2018-05-17 22:46:19'),(459,47,29704892,'2045-8118','Fluid outflow in the rat spinal cord: the role of perivascular and paravascular pathways.','Cerebrospinal fluid (CSF) is thought to flow into the brain via perivascular spaces around arteries, where it mixes with interstitial fluid. The precise details concerning fluid outflow remain controversial. Although fluid dynamics have been studied in the brain, little is known about spinal cord fluid inflow and outflow. Understanding the normal fluid physiology of the spinal cord may give insight into the pathogenesis of spinal cord oedema and CSF disorders such as syringomyelia. We therefore aimed to determine the fluid outflow pathways in the rat spinal cord.A fluorescent tracer, Alexa-Fluor-647 Ovalbumin, was injected into the extracellular space of either the cervicothoracic lateral white matter or the grey matter in twenty-two Sprague-Dawley rats over 250 s. The rats were sacrificed at 20 or 60 min post injection. Spinal cord segments were sectioned and labelled with vascular antibodies for immunohistochemistry.Fluorescent tracer was distributed over two to three spinal levels adjacent to the injection site. In grey matter injections, tracer spread radially into the white matter. In white matter injections, tracer was confined to and redistributed along the longitudinal axonal fibres. Tracer was conducted towards the pial and ependymal surfaces along vascular structures. There was accumulation of tracer around the adventitia of the intramedullary arteries, veins and capillaries, as well as the extramedullary vessels. A distinct layer of tracer was deposited in the internal basement membrane of the tunica media of arteries. In half the grey matter injections, tracer was detected in the central canal.These results suggest that in the spinal cord interstitial fluid movement is modulated by tissue diffusivity of grey and white matter. The central canal, and the compartments around or within blood vessels appear to be dominant pathways for fluid drainage in these experiments. There may be regional variations in fluid outflow capacity due to vascular and other anatomical differences between the grey and white matter.','2018-04-29 00:00:00','2018-04-29 00:00:00','2018-05-03 00:00:00',0,0,'Liu, Shinuo, S|Lam, Magdalena A, MA|Sial, Alisha, A|Hemley, Sarah J, SJ|Bilston, Lynne E, LE|Stoodley, Marcus A, MA','2018-05-17 22:46:19','2018-05-17 22:46:19'),(460,47,29701558,'1933-0715','Syringobulbia in pediatric patients with Chiari malformation type I.','OBJECTIVE Syringobulbia (SB) is a rare entity, with few cases associated with Chiari malformation type I (CM-I) in the pediatric population. The authors reviewed all pediatric cases of CM-I-associated SB managed at their institution in order to better understand the presentation, treatment, and surgical outcomes of this condition. METHODS A prospectively maintained institutional database of craniovertebral junction abnormalities was analyzed to identify all cases of CM-I and SB from the MRI era (i.e., after 1984). The authors recorded presenting symptoms, physical examination findings, radiological findings, surgical treatment strategy, intraoperative findings, and outcomes. SB cases associated with tumors, infections, or type II Chiari malformations were excluded. RESULTS The authors identified 326 pediatric patients with CM-I who were surgically treated. SB was identified in 13 (4%) of these 326 patients. Headache and neck pain were noted in all 13 cases. Cranial nerve abnormalities were common: vagus and glossopharyngeal nerve dysfunction was the most frequent observation. Other cranial nerves affected included the trigeminal, abducens, and hypoglossal nerves. Several patients exhibited multiple cranial nerve palsies at presentation. Central sleep apnea was present in 6 patients. Syringomyelia (SM) was present in all 13 patients. SB involved the medulla in all cases, and extended rostrally into the pons and midbrain in 2 patients; in 1 of these 2 cases the cavity extended further rostrally to the cerebrum (syringocephaly). SB communicated with the fourth ventricle in 7 of the 13 cases. All 13 patients were treated with posterior fossa decompression with intradural exploration to ensure CSF egress out of the fourth ventricle and through the foramen magnum. The foramen of Magendie was found to be occluded by an arachnoid veil in 9 cases. Follow-up evaluation revealed that SB improved before SM. Cranial nerve palsies regressed in 11 of the 13 patients, and SB improved in all 13. CONCLUSIONS The incidence of SB in our surgical series of pediatric patients with CM-I was 4%, and all of these patients had accompanying SM. The SB cavity involved the medulla in all cases and was found to communicate with the fourth ventricle in 54% of cases. Posterior fossa decompression with intradural exploration and duraplasty is an effective treatment for these patients.','2018-04-27 00:00:00','2018-04-27 00:00:00','2018-04-27 00:00:00',0,0,'Menezes, Arnold H, AH|Greenlee, Jeremy D W, JDW|Dlouhy, Brian J, BJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(461,47,29698796,'1878-8769','Long-term Outcomes of a New Minimally Invasive Approach in Chiari Type 1 and 1.5 Malformations: Technical Note and Preliminary Results.','The treatment options for patients with Chiari malformation type-1(CM1) and Chiari malformation type-1.5(CM1.5) have not yet been standardized. In these malformations, the main factors include obstruction at the level of the foramen magnum, dural and ligamentous thickening. Here we have presented our outcomes of surgery and decompression using minimal invasive surgery(MIS) technique.Sixty-one patients admitted to our clinics between 2009 and 2016 due to CM1 or CM1.5, and who had undergone MIS, were investigated retrospectively. All patients were followed-up for a mean period of 55 months, both clinically and radiologically, and the outcomes were recorded.All patients underwent foramen magnum decompression through a 1.5 cm mini-open incision, C1 laminectomy and C2 medial inner side tour, posterior atlanto-occipital membrane removal, external dural delamination, and widening of the internal dura with longitudinal incisions. Fifty-six patients (91.8%) were satisfied, 4 (6.5%) remained the same, and 1 (1.6%) reported a poor outcome. Forty-five percent of those patients with syringomyelia demonstrated resolution within 2 years, and 92% demonstrated resolution in 5 years. Scoliosis was seen in 5 patients (8.1%). The benefit rate from the surgical procedure was statistically significant (p=0.0045), and none of the patients required additional surgery due to poor decompression.MIS is effective for non-complicated cases of CM1 and CM1.5 due to its minimal connective and muscular tissue damage, short surgical duration, short recovery time, early mobilization, effective posterior foramen magnum widening, lack of liquor fistula development, and better clinical and radiological improvement during the long-term follow-up.','2018-04-23 00:00:00','2018-04-23 00:00:00','2018-04-26 00:00:00',0,0,'Kotil, Kadir, K|Ozdogan, Selcuk, S|Kayaci, Selim, S|Duzkalir, Hanife Gulden, HG','2018-05-17 22:46:19','2018-05-17 22:46:19'),(462,48,29618308,'1875-5631','Genetics and Therapies for GM2 Gangliosidosis.','Tay-Sachs disease, caused by impaired β-N-acetylhexosaminidase activity, was the first GM2 gangliosidosis to be studied and one of the most severe and earliest lysosomal diseases to be described. The condition, associated with the pathological build-up of GM2 ganglioside, has acquired almost iconic status and serves as a paradigm in the study of lysosomal storage diseases. Inherited as a classical autosomal recessive disorder, this global disease of the nervous system induces developmental arrest with regression of attained milestones; neurodegeneration progresses rapidly to cause premature death in young children. There is no effective treatment beyond palliative care, and while the genetic basis of GM2 gangliosidosis is well established, the molecular and cellular events, from disease-causing mutations and glycosphingolipid storage to disease manifestations, remain to be fully delineated. Several therapeutic approaches has been attempted in patients, including enzymatic augmentation, bone marrow transplantation, enzyme enhancement, and substrate reduction therapy. Hitherto, none of these stratagems has materially altered the course of the disease. Authentic animal models of GM2 gangliodidosis have facilitated in-depth evaluation of innovative applications such as gene transfer, which in contrast to other interventions, shows great promise. This review outlines current knowledge pertaining the pathobiology as well as potential innovative treatments for the GM2 gangliosidoses.','2018-04-04 00:00:00','2018-04-04 00:00:00','2018-04-05 00:00:00',0,0,'Cachon-Gonzalez, María Begona, MB|Zaccariotto, Eva, E|Cox, Timothy Martin, TM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(463,48,29537064,'1469-493X','Preconception risk assessment for thalassaemia, sickle cell disease, cystic fibrosis and Tay-Sachs disease.','Globally, about five per cent of children are born with congenital or genetic disorders. The most common autosomal recessive conditions are thalassaemia, sickle cell disease, cystic fibrosis and Tay-Sachs disease, with higher carrier rates in specific patient populations. Identifying and counselling couples at genetic risk of the conditions before pregnancy enables them to make fully informed reproductive decisions, with some of these choices not being available if genetic counselling is only offered in an antenatal setting. This is an update of a previously published review.To assess the effectiveness of systematic preconception genetic risk assessment to improve reproductive outcomes in women and their partners who are identified as carriers of thalassaemia, sickle cell disease, cystic fibrosis and Tay-Sachs disease in healthcare settings when compared to usual care.We searched the Cochrane Cystic Fibrosis and Genetic Disorders Group\'s Trials Registers. In addition, we searched for all relevant trials from 1970 (or the date at which the database was first available if after 1970) to date using electronic databases (MEDLINE, Embase, CINAHL, PsycINFO), clinical trial databases (National Institutes of Health, Clinical Trials Search portal of the World Health Organization, metaRegister of controlled clinical trials), and hand searching of key journals and conference abstract books from 1998 to date (European Journal of Human Genetics, Genetics in Medicine, Journal of Community Genetics). We also searched the reference lists of relevant articles, reviews and guidelines and also contacted subject experts in the field to request any unpublished or other published trials.Date of latest search of the registers: 20 June 2017.Date of latest search of all other sources: 16 November 2017.Any randomised or quasi-randomised controlled trials (published or unpublished) comparing reproductive outcomes of systematic preconception genetic risk assessment for thalassaemia, sickle cell disease, cystic fibrosis and Tay-Sachs disease when compared to usual care.We identified 25 papers, describing 16 unique trials which were potentially eligible for inclusion in the review. However, after assessment, no randomised controlled trials of preconception genetic risk assessment for thalassaemia, sickle cell disease, cystic fibrosis and Tay-Sachs disease were found.No randomised controlled trials of preconception genetic risk assessment for thalassaemia, sickle cell disease, cystic fibrosis and Tay-Sachs disease were included. One ongoing trial has been identified which may potentially eligible for inclusion once completed.As no randomised controlled trials of preconception genetic risk assessment for thalassaemia, sickle cell disease, cystic fibrosis, or Tay-Sachs disease were found for inclusion in this review, the research evidence for current policy recommendations is limited to non-randomised studies.Information from well-designed, adequately powered, randomised trials is desirable in order to make more robust recommendations for practice. However, such trials must also consider the legal, ethical, and cultural barriers to implementation of preconception genetic risk assessment.','2018-03-14 00:00:00','2018-03-14 00:00:00','2018-04-27 00:00:00',0,0,'Hussein, Norita, N|Weng, Stephen F, SF|Kai, Joe, J|Kleijnen, Jos, J|Qureshi, Nadeem, N','2018-05-17 22:46:19','2018-05-17 22:46:19'),(464,48,29358305,'1539-7262','Cerebral organoids derived from Sandhoff disease-induced pluripotent stem cells exhibit impaired neurodifferentiation.','Sandhoff disease, one of the GM2 gangliosidoses, is a lysosomal storage disorder characterized by the absence of β-hexosaminidase A and B activity and the concomitant lysosomal accumulation of its substrate, GM2 ganglioside. It features catastrophic neurodegeneration and death in early childhood. How the lysosomal accumulation of ganglioside might affect the early development of the nervous system is not understood. Recently, cerebral organoids derived from induced pluripotent stem (iPS) cells have illuminated early developmental events altered by disease processes. To develop an early neurodevelopmental model of Sandhoff disease, we first generated iPS cells from the fibroblasts of an infantile Sandhoff disease patient, then corrected one of the mutant  alleles in those iPS cells using CRISPR/Cas9 genome-editing technology, thereby creating isogenic controls. Next, we used the parental Sandhoff disease iPS cells and isogenic -corrected iPS cell clones to generate cerebral organoids that modeled the first trimester of neurodevelopment. The Sandhoff disease organoids, but not the -corrected organoids, accumulated GM2 ganglioside and exhibited increased size and cellular proliferation compared with the -corrected organoids. Whole-transcriptome analysis demonstrated that development was impaired in the Sandhoff disease organoids, suggesting that alterations in neuronal differentiation may occur during early development in the GM2 gangliosidoses.','2018-03-01 00:00:00','2018-01-22 00:00:00','2018-03-07 00:00:00',0,0,'Allende, Maria L, ML|Cook, Emily K, EK|Larman, Bridget C, BC|Nugent, Adrienne, A|Brady, Jacqueline M, JM|Golebiowski, Diane, D|Sena-Esteves, Miguel, M|Tifft, Cynthia J, CJ|Proia, Richard L, RL','2018-05-17 22:46:19','2018-05-17 22:46:19'),(465,48,29357903,'1750-1172','Principles for interactions with biopharmaceutical companies: the development of guidelines for patient advocacy organizations in the field of rare diseases.','Rare diseases are a global public health concern, affecting an estimated 350 million individuals. Only 5% of approximately 7000 known rare diseases have a treatment, and only about half have a patient advocacy organization. Biopharmaceutical companies face complex challenges in developing treatments for rare diseases. Patient advocacy organizations may play a major role by positively influencing research and development, clinical trials, and regulations. Thus, collaboration among patient advocacy organizations and industry is essential to bring new therapeutics to patients.We identified an unmet need for guidelines on day-to-day decision-making by rare disease patient advocacy organizations when working with biopharmaceutical partners. We convened an Independent Expert Panel experienced in collaborations between patient advocacy organizations and biopharmaceutical companies (April 2017) to develop consensus guidelines for these relationships. The guidelines were based on an original version by the International Fibrodysplasia Ossificans Progressiva Association (IFOPA). The Expert Panel reviewed and broadened these to be applicable to all patient advocacy organizations. Comments on the draft Guidelines were provided first by Panel participants and subsequently by six independent experts from patient advocacy organizations and industry.The Panel comprised four experts from the rare disease community who lead patient advocacy organizations; three leaders who perform advocacy functions within biopharmaceutical companies; and two facilitators, both having leadership experience in rare diseases and industry. The finalized Guidelines consist of four main sections: Identification and Engagement With Companies, Patient Engagement and Patient Privacy, Financial Contributions, and Clinical Trial Communication and Support. The Guidelines address the daily considerations, choices, and consequences of patient advocacy organizations as they engage with biopharmaceutical companies, and offer recommendations for volunteer/paid leaders of the organizations on how to interact in a thoughtful, responsible, ethical way that engenders trust.These Guidelines recommend best practices and standards for interactions between patient advocacy organizations and industry that will ultimately have a positive effect on the development of novel treatments. Patient advocacy organizations will be provided free access to these Guidelines to help bring clarification to day-to-day decision-making around their interactions, and for use as a living document with the potential for regular revisions and updates.','2018-01-22 00:00:00','2018-01-22 00:00:00','2018-02-01 00:00:00',0,0,'Stein, Susan, S|Bogard, Elizabeth, E|Boice, Nicole, N|Fernandez, Vivian, V|Field, Tessa, T|Gilstrap, Alan, A|Kahn, Susan R, SR|Larkindale, Jane, J|Mathieson, Toni, T','2018-05-17 22:46:19','2018-05-17 22:46:19'),(466,48,29352662,'1096-7206','Distinct progression patterns of brain disease in infantile and juvenile gangliosidoses: Volumetric quantitative MRI study.','GM1-gangliosidosis and GM2-gangliosidosis (Tay-Sachs disease and Sandhoff disease) are unrelenting heritable neurodegenerative conditions of lysosomal ganglioside accumulation. Although progressive brain atrophy is characteristic, longitudinal quantification of specific brain structures has not been systematically studied.The goal of this longitudinal study has been to quantify and track brain MRI volume changes, including specific structure volume changes, at different times in disease progression of childhood gangliosidoses, and to explore quantitative brain MRI volumetry (qMRI) as a non-invasive marker of disease progression for future treatment trials.Brain qMRI studies were performed in 14 patients with gangliosidoses (9 infantile, 5 juvenile) yearly. Cerebellar cortex and white matter, caudate, putamen, corpus callosum, ventricles, total brain, and intracranial volumes were measured, as well as total brain volume. Age-matched controls were available for the patients with the juvenile phenotype.The infantile phenotype of all gangliosidoses showed a consistent pattern of macrocephaly and rapidly increasing intracranial MRI volume with both (a) brain tissue volume (cerebral cortex and other smaller structures) and (b) ventricular volume (P<0.01 for all). In contrast to apparent enlargement of the total brain volume, and chiefly the enlarged cerebral cortex, a subset of smaller brain substructures generally decreased in size: the corpus callosum, caudate and putamen became smaller with time. The volume of cerebellar cortex also decreased in patients with infantile GM1-gangliosidosis and juvenile GM1- and GM2-gangliosidosis; however, infantile GM2-gangliosidosis cerebellar cortex was the exception, increasing in size. Elevated intracranial pressure (estimated by lumbar spinal pressure) was a common finding in infantile disease and showed continued increases as the disease progressed, yet lacked MRI signs of hydrocephalus except for increasing ventricular size. Notably, in patients with juvenile gangliosidosis, macrocephaly and elevated intracranial pressure were absent and total brain volume decreased with time compared to controls (P=0.004).The disease course of infantile versus juvenile gangliosidoses is clearly distinguished by the rate of brain disease progression as characterized by qMRI. Assessments by qMRI represent a robust non-invasive method for monitoring CNS changes in the clinical course of gangliosidoses and is ideally suited to monitor effects of novel CNS-directed therapies in future clinical trials.','2018-02-01 00:00:00','2017-12-20 00:00:00','2018-03-02 00:00:00',0,0,'Nestrasil, Igor, I|Ahmed, Alia, A|Utz, Josephine M, JM|Rudser, Kyle, K|Whitley, Chester B, CB|Jarnes-Utz, Jeanine R, JR','2018-05-17 22:46:19','2018-05-17 22:46:19'),(467,48,29214523,'2192-8304','Haematopoietic Stem Cell Transplantation Arrests the Progression of Neurodegenerative Disease in Late-Onset Tay-Sachs Disease.','Tay-Sachs disease is a rare metabolic disease caused by a deficiency of hexosaminidase A that leads to accumulation of GM2 gangliosides predominantly in neural tissue. Late-onset Tay-Sachs disease variant is associated with a higher level of residual HexA activity. Treatment options are limited, and there are a few described cases who have undergone haematopoietic stem cell transplantation (HSCT) with variable outcome.We describe a case of a 23-year-old male patient who presented with a long-standing tremor since 7 years of age. He had gait ataxia, a speech stammer and swallowing problems. His condition had had a static course apart from his tremor that had been gradually deteriorating. Because of the deterioration in his neurological function, the patient had an uneventful, matched-sibling donor bone marrow transplant at the age of 15 years. Eight years post-HSCT, at the age of 23, he retains full donor engraftment, and his white cell beta-HexA of 191 nmol/mg/h is comparable to normal controls (in-assay control = 187). He continues to experience some intentional tremor that is tolerable for daily life and nonprogressive since HSCT.HSCT is a potential treatment option which might arrest neurodegeneration in patients with LOTS.','2017-12-07 00:00:00','2017-12-07 00:00:00','2018-02-27 00:00:00',0,0,'Stepien, Karolina M, KM|Lum, Su Han, SH|Wraith, J Edmond, JE|Hendriksz, Christian J, CJ|Church, Heather J, HJ|Priestman, David, D|Platt, Frances M, FM|Jones, Simon, S|Jovanovic, Ana, A|Wynn, Robert, R','2018-05-17 22:46:19','2018-05-17 22:46:19'),(468,48,29186855,'1422-0067','Translational Aspects of Sphingolipid Metabolism in Renal Disorders.','Sphingolipids, long thought to be passive components of biological membranes with merely a structural role, have proved throughout the past decade to be major players in the pathogenesis of many human diseases. The study and characterization of several genetic disorders like Fabry\'s and Tay Sachs, where sphingolipid metabolism is disrupted, leading to a systemic array of clinical symptoms, have indeed helped elucidate and appreciate the importance of sphingolipids and their metabolites as active signaling molecules. In addition to being involved in dynamic cellular processes like apoptosis, senescence and differentiation, sphingolipids are implicated in critical physiological functions such as immune responses and pathophysiological conditions like inflammation and insulin resistance. Interestingly, the kidneys are among the most sensitive organ systems to sphingolipid alterations, rendering these molecules and the enzymes involved in their metabolism, promising therapeutic targets for numerous nephropathic complications that stand behind podocyte injury and renal failure.','2017-11-25 00:00:00','2017-11-25 00:00:00','2018-01-09 00:00:00',0,0,'Abou Daher, Alaa, A|El Jalkh, Tatiana, T|Eid, Assaad A, AA|Fornoni, Alessia, A|Marples, Brian, B|Zeidan, Youssef H, YH','2018-05-17 22:46:19','2018-05-17 22:46:19'),(469,48,29152458,'2214-6490','Lysosomal storage diseases.','Lysosomes are cytoplasmic organelles that contain a variety of different hydrolases. A genetic deficiency in the enzymatic activity of one of these hydrolases will lead to the accumulation of the material meant for lysosomal degradation. Examples include glycogen in the case of Pompe disease, glycosaminoglycans in the case of the mucopolysaccharidoses, glycoproteins in the cases of the oligosaccharidoses, and sphingolipids in the cases of Niemann-Pick disease types A and B, Gaucher disease, Tay-Sachs disease, Krabbe disease, and metachromatic leukodystrophy. Sometimes, the lysosomal storage can be caused not by the enzymatic deficiency of one of the hydrolases, but by the deficiency of an activator protein, as occurs in the AB variant of GM2 gangliosidosis. Still other times, the accumulated lysosomal material results from failed egress of a small molecule as a consequence of a deficient transporter, as in cystinosis or Salla disease. In the last couple of decades, enzyme replacement therapy has become available for a number of lysosomal storage diseases. Examples include imiglucerase, taliglucerase and velaglucerase for Gaucher disease, laronidase for Hurler disease, idursulfase for Hunter disease, elosulfase for Morquio disease, galsulfase for Maroteaux-Lamy disease, alglucosidase alfa for Pompe disease, and agalsidase alfa and beta for Fabry disease. In addition, substrate reduction therapy has been approved for certain disorders, such as eliglustat for Gaucher disease. The advent of treatment options for some of these disorders has led to newborn screening pilot studies, and ultimately to the addition of Pompe disease and Hurler disease to the Recommended Uniform Screening Panel (RUSP) in 2015 and 2016, respectively.','2017-05-25 00:00:00','2017-05-25 00:00:00','2017-12-19 00:00:00',0,0,'Ferreira, Carlos R, CR|Gahl, William A, WA','2018-05-17 22:46:19','2018-05-17 22:46:19'),(470,48,29143882,'1432-0614','Enzymatic properties of β-N-acetylglucosaminidases.','β-N-Acetylglucosaminidases (GlcNAcases) hydrolyse N-acetylglucosamine-containing oligosaccharides and proteins. These enzymes produce N-acetylglucosamine (GlcNAc) and have a wide range of promising applications in the food, energy, and pharmaceutical industries, such as synergistic degradation of chitin with endo-chitinases and using GlcNAc to produce sialic acid, bioethanol, single-cell proteins, and pharmaceutical therapeutics. GlcNAcases also play an important role in the dynamic balance of cellular O-linked GlcNAc levels, catabolism of ganglioside storage in Tay-Sachs disease, and bacterial cell wall recycling and flagellar assembly. In view of these important biological functions and the wide range of industrial applications of GlcNAcases, this review aims to provide a better understanding of various advances for these enzymes. It focuses on enzymatic properties of GlcNAcases, including substrate specificity, catalytic activity, pH optimum, temperature optimum, thermostability, the effects of various metal ions and organic reagents, and transglycosylation.','2018-01-01 00:00:00','2017-11-16 00:00:00','2018-01-02 00:00:00',0,0,'Zhang, Rui, R|Zhou, Junpei, J|Song, Zhifeng, Z|Huang, Zunxi, Z','2018-05-17 22:46:19','2018-05-17 22:46:19'),(471,48,29100724,'2300-732X','Expression of the GM2 activator protein in mouse testis.','The GM2-activator protein (GM2-AP), revealed by Li et al. in 1973 in human liver, was initially identified as a protein cofactor that stimulated β-hexosaminidase A to hydrolyze N-acetylgalactosamine from GM2 ganglioside. This cofactor was found to be missing in human variant AB Tay-Sachs disease. Over the years, the GM2-AP has also been shown to be involved in kidney vesicular transport, lipid presentation by CD1 molecule to T-cells, and interaction of human sperm with zona pellucida. Since the expression of the GM2-AP via mRNA detection in mouse tissues was found to be the highest in testis, we became interested in the localization of the GM2-AP at cellular level in mouse testis during spermatogenesis. Using immunohistochemical analysis and electron microscopy, we found that the GM2-AP was predominantly localized in the basal cytoplasm and the attenuated processes of Sertoli cells. The stained structure appeared to be lysosomes. The most interesting finding was the association of the GM2-AP with the acrosomal apparatus in early spermatids. A modest to intense staining was observed in some acrosomal granules and acrosomal caps. The GM2-AP seemed to disappear from acrosomal caps in the later stage of spermatids, in which the nucleus became elongated and condensed. These results suggest that the GM2-AP may be involved in the normal functions of Sertoli cells and play important roles during the development of acrosomal caps in the early spermatids.','2017-12-01 00:00:00','2017-11-01 00:00:00','2017-12-08 00:00:00',0,0,'Li, Yu-Teh, YT|Li, Su-Chen, SC|Chen, I-Li, IL','2018-05-17 22:46:19','2018-05-17 22:46:19'),(472,49,29765775,'2059-7908','Potential impact of introducing the pneumococcal conjugate vaccine into national immunisation programmes: an economic-epidemiological analysis using data from India.','Pneumococcal pneumonia causes an estimated 105 000 child deaths in India annually. The planned introduction of the serotype-based pneumococcal conjugate vaccine (PCV) is expected to avert child deaths, but the high cost of PCV relative to current vaccines provided under the Universal Immunization Programme has been a concern. Cost-effectiveness studies from high-income countries are not readily comparable because of differences in the distribution of prevalent serotypes, population and health systems. We extended IndiaSim, our agent-based simulation model representative of the Indian population and health system, to model the dynamics of . This enabled us to evaluate serotype and overall disease dynamics in the context of the local population and health system, an aspect that is missing in prospective evaluations of the vaccine. We estimate that PCV13 introduction would cost approximately US$240 million and avert US$48.7 million in out-of-pocket expenditures and 34 800 (95% CI 29 600 to 40 800) deaths annually assuming coverage levels and distribution similar to DPT (diphtheria, pertussis and tetanus) vaccination (~77%). Introducing the vaccine protects the population, especially the poorest wealth quintile, from potentially catastrophic expenditure. The net-present value of predicted money-metric value of insurance for 20 years of vaccination is US$160 000 (95% CI US$151 000 to US$168 000) per 100 000 under-fives, and almost half of this protection is for the bottom wealth quintile (US$78 000; 95% CI 70 800 to 84 400). Extending vaccination to 90% coverage averts additional lives and provides additional financial risk protection. Our estimates are sensitive to immunity parameters in our model; however, our assumptions are conservative, and if willingness to pay per years of life lost averted is US$228 or greater, then introducing the vaccine is more cost-effective than our baseline (no vaccination) in more than 95% of simulations.','2018-05-17 00:00:00','2018-05-09 00:00:00','2018-05-16 00:00:00',0,0,'Megiddo, Itamar, I|Klein, Eili, E|Laxminarayan, Ramanan, R','2018-05-17 22:46:19','2018-05-17 22:46:19'),(473,49,29764539,'1559-6109','Effect of Chronic Social Stress on Prenatal Transfer of Antitetanus Immunity in Captive Breeding Rhesus Macaques (Macaca mulatta).','Because tetanus can cause significant morbidity and mortality in NHP, colonywide vaccination with tetanus toxoid is recommendedfor outdoor breeding colonies of rhesus macaques, with primary immunizations commonly given to infants at 6 mo of age followed by booster vaccines every 10 y. Maternal antibodies are thought to offer protective immunity to infants younger than 6 mo. However, historical colony data from the Yerkes National Primate Research Center show a higher incidence of tetanus among infants (≤ 6 mo old) born to subordinate dams. Whether this higher incidence of infantile tetanus is due to a higher incidence of trauma among subordinate animals or is a stress-induced impairment of maternal antibody protection is unknown. Studies in other NHP species suggest that chronic exposure to social stressors interferes with the receptor-mediated transplacental transfer of IgG. Therefore, the primary aim of this study was to determine whether chronic stress associated with social subordination impairs prenatal transfer of antitetanus immunity in breeding female rhesus macaques. Subjects included 26 high- and 26 low-ranking adult female rhesus macaques that were nearly 5 or 10 y after their initial immunization and their nonimmunized infants. We hypothesized that infants born to subordinate dams that were nearly 10 y after immunization would have the lowest infant-to-dam antibody ratios and thus would be at greatest risk for infection. Results revealed no significant intergroup differences in infant antitetanus IgG levels. However, infant-to-dam IgG ratios against tetanus were significantly lower among subordinate animals compared with dominant macaques, after accounting for the number of years since the dam\'s initial vaccination. In addition, higher maternal hair cortisol levels predicted lower infant-to-dam tetanus toxoid IgG ratios. Together, these findings suggest that chronic social stress in female rhesus macaques may hamper the prenatal transfer of antitetanus immunity to offspring.','2018-05-15 00:00:00','2018-05-15 00:00:00','2018-05-16 00:00:00',0,0,'Stammen, Rachelle L, RL|Cohen, Joyce K, JK|Meeker, Tracy L, TL|Crane, Maria M, MM|Amara, Rama R, RR|Hicks, Sakeenah L, SL|Meyer, Jerrold S, JS|Ethun, Kelly F, KF','2018-05-17 22:46:19','2018-05-17 22:46:19'),(474,49,29762363,'1532-0987','Immunogenicity and Safety of Primary and Booster Vaccinations of a Fully Liquid DTaP-IPV-HB-PRP-T Hexavalent Vaccine in Healthy Infants and Toddlers in Germany and the Czech Republic.','To support a fully liquid, diphtheria (D)-tetanus (T)-acellular pertussis (aP)-inactivated poliovirus (IPV)-hepatitis B (HB)-Haemophilus influenzae b (PRP-T) vaccine in Europe using a 2, 3, 4 month primary series and a booster at 11 to 15 months of age.Phase III, randomized, observer-blind studies in Germany and the Czech Republic. Participants who had not received HB vaccine were randomized to a 2, 3, 4 month primary series of DTaP-IPV-HB-PRP-T (Group 1; N=266) or a reconstituted DTaPHB-IPV//PRP-T comparator (Group 2; N=263) and a booster of the same vaccine. Pneumococcal vaccine (PCV13) and rotavirus vaccine (RV) were coadministered at 2, 3, 4 months and the booster was coadministered with PCV13. Non-inferiority (Group 1 versus Group 2) was tested post-primary series for seroprotection rates (anti-HB and anti-PRP) and vaccine response rates (anti-PT and anti-FHA). Safety was assessed by parental reports.Non-inferiority was demonstrated with the lower bound of the 95% CI for the difference (Group 1-Group 2) being >-10% for each comparison. Primary series immune responses were high for all antigens and similar in each group. Pre-booster antibody persistence was good and there was a strong anamnestic response, both being similar for the investigational and control vaccines. Responses to PCV13 and RV were similar in each group. There were no safety concerns.These data support the use of the DTaP-IPV-HB-PRP-T vaccine in a 2, 3, 4 month schedule without a birth dose of HB vaccine, with a booster dose in the second year of life administered with routine childhood vaccines.','2018-05-14 00:00:00','2018-05-14 00:00:00','2018-05-15 00:00:00',0,0,'Prymula, Roman, R|Kieninger, Dorothee, D|Feroldi, Emmanuel, E|Jordanov, Emilia, E|B\'Chir, Siham, S|DaCosta, Xavier, X','2018-05-17 22:46:19','2018-05-17 22:46:19'),(475,49,29757589,'1735-1502','The Effect of Differentially Designed Fusion Proteins to Elicit Efficient Anti-human Thyroid Stimulating Hormone Immune Responses.','The production of human thyroid stimulating hormone (hTSH) immunoassays requires specific antibodies against hTSH which is a cumbersome process. Therefore, producing specific polyclonal antibodies against engineered recombinant fusion hTSH antigens would be of great significance. The best immunogenic region of the hTSH was selected based on in silico analyses and equipped with two different fusions. Standard methods were used for protein expression, purification, verification, structural evaluation, and immunizations of the white New Zealand rabbits. Ultimately, immunized serums were used for antibody titration, purification and characterization (specificity, sensitivity and cross reactivity). The desired antigens were successfully designed, sub-cloned, expressed, confirmed and used for in vivo immunization. Structural analyses indicated that only the bigger antigen has showed changed 2 dimensional (2D) and 3D structural properties in comparison to the smaller antigen. The raised polyclonal antibodies were capable of specific and sensitive hTSH detection, while the cross reactivity with the other members of the glycoprotein hormone family was minimum and negligible. The fusion which was solely composed of the tetanus toxin epitopes led to better protein folding and was capable of immunizing the host animals resulting into high titer antibody. Therefore, the minimal fusion sequences seem to be more effective in eliciting specific antibody responses.','2018-04-01 00:00:00','0000-00-00 00:00:00','2018-05-14 00:00:00',0,0,'Mard-Soltani, Maysam, M|Rasaee, Mohamad Javad, MJ|Khalili, Saeed, S|Sheikhi, Abdol-Karim, AK|Hedayati, Mehdi, M|Ghaderi-Zefrehi, Hossein, H|Alasvand, Milad, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(476,49,29757414,'1462-0332','Vaccination coverage in systemic lupus erythematosus-a cross-sectional analysis of the German long-term study (LuLa cohort).','Vaccinations are an important measure to prevent infections in immunocompromised patients. The knowledge of vaccination coverage and reasons for non-vaccination in patients with SLE is scarce. The aim of this study was to assess coverage rates of selected vaccinations in a representative sample of SLE patients and to identify predictors for non-vaccination.In 2013, information on selected vaccinations (coverage, application and reservations) and on demographics, clinical parameters and health beliefs was assessed by means of a self-reported questionnaire among a representative sample of SLE patients in Germany (LuLa cohort).Five hundred and seventy-nine patients participated. Vaccination status was primarily checked by their general practitioner (57.3%). Of all the patients, 24.9% did not get their vaccination status checked at all, 16.1% had generally been advised against the use of vaccinations by a physician, and 37.5% stated that they had rejected vaccinations themselves. Their main reasons were fears of developing a lupus flare (21.8%) or adverse events (13.5%). A greater belief by patients in the doctor controlling one\'s health and the general benefit of medication prevented the rejection of vaccines. Vaccination coverage was low for all recorded vaccinations (tetanus 65.8%, influenza 45.2%, pneumococcus 32.2% and meningococcus 6.1%). Older age was predictive of receiving influenza and pneumococcal vaccination. The same applies for CSs >7.5 mg for receiving influenza vaccination.Vaccination coverage in SLE patients is poor and reflects insufficient implementation of national and international recommendations. Rheumatologists need to recognize patients\' reservations against vaccinations, to communicate their importance and safety and to give individual recommendations to patients and their health-care providers.German Clinical Trials Register, www.germanctr.de, DRKS00011052.','2018-05-10 00:00:00','2018-05-10 00:00:00','2018-05-14 00:00:00',0,0,'Chehab, Gamal, G|Richter, Jutta G, JG|Brinks, Ralph, R|Fischer-Betz, Rebecca, R|Winkler-Rohlfing, Borgi, B|Schneider, Matthias, M','2018-05-17 22:46:19','2018-05-17 22:46:19'),(477,49,29757209,'1660-4601','Immunization Offer Targeting Migrants: Policies and Practices in Italy.','The unprecedented flow of migrants over the last three years places Italy in front of new issues regarding medical care from the rescue phase up to the integration into the national health services, including preventive actions. We used online questionnaires to investigate the Italian national and regional policies for immunization offer targeting asylum seekers, refugees, irregular migrants and unaccompanied minors. Another questionnaire was used to assess how these policies are translated into practice in migrant reception centres and community health services. Questionnaires were filled out at the national level, in 14 out of 21 Regions/Autonomous Provinces, and in 36 community health services and 28 migrant reception centres. Almost all responders stated that all vaccinations included in the National Immunization Plan are offered to migrant children and adolescents. The situation concerning adults is fragmented, with most of the Regions and local centres offering more vaccines than the national offer-which include polio, tetanus and measles⁻mumps-rubella. Data on immunized immigrants is archived at the regional/local level with different methods and not available at the national level. Further efforts to ensure consistency in vaccine provision and adequate mechanisms of exchanging data are needed to guarantee a complete vaccination offer and avoid unnecessary health actions, including unnecessary re-vaccination.','2018-05-12 00:00:00','2018-05-12 00:00:00','2018-05-14 00:00:00',0,0,'Dalla Zuanna, Teresa, T|Del Manso, Martina, M|Giambi, Cristina, C|Riccardo, Flavia, F|Bella, Antonino, A|Caporali, Maria Grazia, MG|Dente, Maria Grazia, MG|Declich, Silvia, S|Italian Survey CARE Working Group','2018-05-17 22:46:19','2018-05-17 22:46:19'),(478,49,29755949,'2214-2509','Tetanus - A Rare But Real Threat.','Tetanus is a potentially fatal disease of the nervous system arising from toxins produced by , an anaerobic bacterium found in soil [1]. Characterized by muscular rigidity, spasms and autonomic dysregulation its identification and, importantly, its prevention remain critical to the welfare of at risk patients. We present the case of a twenty two year old woman who presented to hospital with trismus and generalized muscle spasms three days following a dog bite to the right hand. Here, we discuss the presentation of generalized tetanus and the use of neurophysiology to facilitate its diagnosis.','2018-05-17 00:00:00','2018-02-21 00:00:00','2018-05-16 00:00:00',0,0,'Moynan, David, D|O\'Riordan, Ruth, R|O\'Connor, Roisin, R|Merry, Concepta, C','2018-05-17 22:46:19','2018-05-17 22:46:19'),(479,49,29752315,'1550-6606','Formation of Immune Complexes with a Tetanus-Derived B Cell Epitope Boosts Human T Cell Responses to Covalently Linked Peptides in an Ex Vivo Blood Loop System.','Enhancing T cell responses against both viral and tumor Ags requires efficient costimulation and directed delivery of peptide Ags into APCs. Long peptide vaccines are considered favorable vaccine moieties from a clinical perspective, as they can harbor more than one immunogenic epitope enabling treatment of a broader target population. In addition, longer peptides are not extracellularly loaded on MHC class I; rather, they require intracellular processing and will thereby be presented to T cells mainly by professional APCs, thereby avoiding the risk of tolerance induction. The drawback of peptide vaccines regardless of peptide length is that naked peptides are not actively targeted to and taken up by APCs, and the standard nonconjugated adjuvant-peptide mixtures do not ensure cotargeting of the two to the same APC. We have identified a tetanus toxin-derived B cell epitope that can mediate the formation of immune complexes in the presence of circulating Abs. In this study, we show that these immune complexes improve both Ag uptake by APCs (blood monocytes and CD1c dendritic cells) and consequently improve CD8 T cell recall responses in a human ex vivo blood loop system. The uptake of the peptide conjugate by blood monocytes is dependent on Abs and the complement component C1q. We envision that this strategy can be used to facilitate active uptake of Ags into APCs to improve T cell responses against pathogens or cancer.','2018-05-11 00:00:00','2018-05-11 00:00:00','2018-05-12 00:00:00',0,0,'Fletcher, Erika A K, EAK|van Maren, Wendy, W|Cordfunke, Robert, R|Dinkelaar, Jasper, J|Codee, Jeroen D C, JDC|van der Marel, Gijs, G|Melief, Cornelis J M, CJM|Ossendorp, Ferry, F|Drijfhout, Jan Wouter, JW|Mangsbo, Sara M, SM','2018-05-17 22:46:19','2018-05-17 22:46:19'),(480,49,29752131,'1474-4457','Effectiveness of the DTPa-HBV-IPV/Hib vaccine against invasive Haemophilus influenzae type b disease in the Netherlands (2003-16): a case-control study.','In 2016, an increase in invasive Haemophilus influenzae serotype b (Hib) disease was reported in the Netherlands in children younger than 5 years, which coincided with the introduction of the hexavalent diphtheria, tetanus, and acellular pertussis-hepatitis B virus-inactivated polio virus/Hib vaccine (DTPa-HBV-IPV/Hib) from 2011 onwards. We aimed to estimate the effectiveness of the hexavalent vaccine to assess whether this increase could be explained by decreasing effectiveness.We did a case-control study in the Netherlands. We selected patients with a Hib infection (cases) by use of the surveillance records of the Netherlands Reference Laboratory for Bacterial Meningitis (Amsterdam). Cases with a Hib infection that began from Jan 1, 2003, to Dec 31, 2016, and who were younger than age 5 years were included. Ten controls from the national vaccination register (Praeventis) were selected for each case, matched by date of birth. Vaccination status was ascertained by use of Praeventis, which details the vaccination records of children living in the Netherlands. The last recorded vaccine dose was used to classify the child as having received the hexavalent DTPa-HBV-IPV/Hib vaccine or a pentavalent vaccine (which excludes the hepatitis B virus component) or another vaccine. We estimated the effectiveness of these vaccines by use of conditional logistic regression.We included 159 (94%) of 170 cases reported and 1590 matched controls, who had a median age of 1·5 years (IQR 0·8-2·9). The remaining 11 cases could not be cross-matched with vaccination records from Praeventis. 91 (57%) of 159 cases had been vaccinated, compared with 1408 (89%) of 1590 controls. The overall vaccine effectiveness was 92·8% (95% CI 88·7-95·4), with no differences between the year of disease onset (p=0·9670). There were no differences conferred by type of vaccine given: vaccine effectiveness of the pentavalent and other vaccines was 91·8% (95% CI 86·1-95·1) versus 94·0% (89·0-96·8) for the hexavalent vaccine (OR 0·72, 95% CI 0·36-1·45; p=0·3591). Vaccine effectiveness was highest in children aged 1-2 years at disease onset (97·1-99·0%) and was lowest in children aged 3-4 years at disease onset (60·7-82·3%; p=0·0008).Our results support the current vaccination programme, since Hib vaccine effectiveness has not decreased over time or by the introduction of the hexavalent DTPa-HBV-IPV/Hib vaccine. Vaccine effectiveness was high but waned with age. Alternative explanations for the increase in Hib disease therefore need to be assessed.Dutch Ministry of Health, Welfare and Sports.','2018-05-08 00:00:00','2018-05-08 00:00:00','2018-05-12 00:00:00',0,0,'Monge, Susana, S|Hahné, Susan Jm, SJ|de Melker, Hester E, HE|Sanders, Elisabeth Am, EA|van der Ende, Arie, A|Knol, Mirjam J, MJ','2018-05-17 22:46:19','2018-05-17 22:46:19'),(481,49,29747736,'1558-0474','Infections in Pregnancy and the Role of Vaccines.','Pregnant women are at risk for infection and may have significant morbidity or mortality. Influenza, pertussis, zika, and cytomegalovirus produce mild or asymptomatic illness in the mother, but have profound implications for her fetus. Maternal immunization can prevent or mitigate infections in pregnant women and their infants. The Advisory Committee of Immunization Practices recommends 2 vaccines during pregnancy: inactivated influenza, and tetanus toxoid, reduced diphtheria toxoid, and acellular pertussis during pregnancy. The benefits of MMR, varicella, and other vaccines are reviewed. Novel vaccine studies for use during pregnancy for prevention of illness are explored.','2018-06-01 00:00:00','0000-00-00 00:00:00','2018-05-11 00:00:00',0,0,'Fortner, Kimberly B, KB|Nieuwoudt, Claudia, C|Reeder, Callie F, CF|Swamy, Geeta K, GK','2018-05-17 22:46:19','2018-05-17 22:46:19');
