INSERT INTO `Disease` VALUES (1,'Achondroplasia',56579,742386653,'DOID_4480','Achondroplasia is a common cause of dwarfism. It occurs as a sporadic mutation in approximately 80% of cases (associated with advanced paternal age) or it may be inherited as an autosomal dominant genetic disorder. People with achondroplasia have short stature, with an average adult height of 131 centimeters (52 inches) for males and 123 centimeters (48 inches) for females. Achondroplastic adults are known to be as short as 62.8 cm (24.7 in). If both parents of a child have achondroplasia, and both parents pass on the mutant gene, then it is very unlikely that the homozygous child will live past a few months of its life. The prevalence is approximately 1 in 25,000.','http://commons.wikimedia.org/wiki/Special:FilePath/Jason_Acuña_-_Wee-Man_-_Waterfront_Marriott,_Portland,_Oregon_-_August_15,_2009_-_Full_Body.jpg?width=300','http://dbpedia.org/resource/Achondroplasia','2018-05-17 22:46:19','2018-05-17 22:46:19'),(2,'Adrenoleukodystrophy',52952,742583592,'DOID_10588','Adrenoleukodystrophy (/-ˌlu-koʊ-ˈdis-trə-fiː/; also known as X-linked adrenoleukodystrophy, ALD, X-ALD, Siemerling–Creutzfeldt disease or bronze Schilder disease) is a disease that is linked on the X chromosome. It is a result of fatty acid digestive enzymes not breaking up the fats. These fats build up in the brain. They damage the myelin that surrounds nerves. This can cause seizures and hyperactivity. It can also cause problems with speaking, listening and understanding verbal instructions. In more detail, it is a disorder of peroxisomal fatty acid beta oxidation which results in the accumulation of very long chain fatty acids in tissues throughout the body. The most severely affected tissues are the myelin in the central nervous system, the adrenal cortex and the Leydig cells in the testes. Clinically, ALD is a heterogeneous disorder, presenting with several distinct phenotypes, and no clear pattern of genotype-phenotype correlation. As an X-linked disorder, ALD presents most commonly in males, however approximately 50% of heterozygote females show some symptoms later in life. Approximately two-thirds of ALD patients will present with the childhood cerebral form of the disease, which is the most severe form. It is characterized by normal development in early childhood, followed by rapid degeneration to a vegetative state. The other forms of ALD vary in terms of onset and clinical severity, ranging from adrenal insufficiency to progressive paraparesis in early adulthood (this form of the disease is typically known as adrenomyeloneuropathy). ALD is caused by mutations in ABCD1, a gene located on the X chromosome that codes for ALD, a peroxisomal membrane transporter protein. The exact mechanism of the pathogenesis of the various forms of ALD is not known. Biochemically, individuals with ALD show very high levels of unbranched, saturated, very long chain fatty acids, particularly cerotic acid (26:0). The level of cerotic acid in plasma does not correlate with clinical presentation. Treatment options for ALD are limited. Dietary treatment is with Lorenzo\'s oil. For the childhood cerebral form, stem cell transplant and gene therapy are options if the disease is detected early in the clinical course. Adrenal insufficiency in ALD patients can be successfully treated. ALD is the most common peroxisomal inborn error of metabolism, with an incidence estimated between 1:18,000 and 1:50,000. It does not have a significantly higher incidence in any specific ethnic groups.','http://commons.wikimedia.org/wiki/Special:FilePath/Adrenoleukodystrophy.jpg?width=300','http://dbpedia.org/resource/Adrenoleukodystrophy','2018-05-17 22:46:19','2018-05-17 22:46:19'),(3,'Agoraphobia',57723,744775147,'DOID_593','Agoraphobia is an anxiety disorder characterized by symptoms of anxiety in situations where the person perceives the environment to be unsafe with no easy way to get away. These situations can include open spaces, public transit, shopping malls, or simply being outside the home. Being in these situations may result in a panic attack. The symptoms occur nearly every time the situation is encountered and lasts for more than six months. Those affected will go to great lengths to avoid these situations. In severe cases people may become unable to leave their homes. The cause of agoraphobia is a combination of genetic and environmental factors. The condition often runs in families and stressful events such as the death of a parent or being attacked may be a trigger. In the DSM-5 agoraphobia is classified as a phobia along with specific phobias and social phobia. Other conditions that can produce similar symptoms include separation anxiety, posttraumatic stress disorder, and major depressive disorder. Those affected are at higher risk of depression and substance use disorder. Without treatment it is uncommon for agoraphobia to resolve. Treatment is typically with a type of counselling called cognitive behavioral therapy (CBT). CBT results in resolution for about half of people. Agoraphobia affects about 1.7% of adults. Women are affected about twice as often as men. The condition often begins in early adulthood and becomes less common in old age. It is rare in children. The term \"agoraphobia\" is from Greek ἀγορά, meaning a \"public square\" and -φοβία, -phobia, meaning \"fear\".','http://commons.wikimedia.org/wiki/Special:FilePath/Agora_of_the_Competaliasts_01_(cropped).jpg?width=300','http://dbpedia.org/resource/Agoraphobia','2018-05-17 22:46:19','2018-05-17 22:46:19'),(4,'Allergy',55313,743523311,'DOID_1205','Allergies, also known as allergic diseases, are a number of conditions caused by hypersensitivity of the immune system to something in the environment that usually causes little or no problem in most people. These diseases include hay fever, food allergies, atopic dermatitis, allergic asthma, and anaphylaxis. Symptoms may include red eyes, an itchy rash, runny nose, shortness of breath, or swelling. Food intolerances and food poisoning are separate conditions. Common allergens include pollen and certain food. Metals and other substances may also cause problems. Food, insect stings, and medications are common causes of severe reactions. Their development is due to both genetic and environmental factors. The underlying mechanism involves immunoglobulin E antibodies (IgE), part of the body\'s immune system, binding to an allergen and then to a receptor on mast cells or basophils where it triggers the release of inflammatory chemicals such as histamine. Diagnosis is typically based on a person\'s medical history. Further testing of the skin or blood may be useful in certain cases. Positive tests, however, may not mean there is a significant allergy to the substance in question. Early exposure to potential allergens may be protective. Treatments for allergies include avoiding known allergens and the use of medications such as steroids and antihistamines. In severe reactions injectable adrenaline (epinephrine) is recommended. Allergen immunotherapy, which gradually exposes people to larger and larger amounts of allergen, is useful for some types of allergies such as hay fever and reactions to insect bites. Its use in food allergies is unclear. Allergies are common. In the developed world, about 20% of people are affected by allergic rhinitis, about 6% of people have at least one food allergy, and about 20% have atopic dermatitis at some point in time. Depending on the country about 1–18% of people have asthma. Anaphylaxis occurs in between 0.05–2% of people. Rates of many allergic diseases appear to be increasing. The word \"allergy\" was first used by Clemens von Pirquet in 1906.','http://commons.wikimedia.org/wiki/Special:FilePath/Hives2010.JPG?width=300','http://dbpedia.org/resource/Allergy','2018-05-17 22:46:19','2018-05-17 22:46:19'),(5,'Androgen insensitivity syndrome',52789,744147668,'DOID_4674','Androgen insensitivity syndrome (AIS) is a condition that results in the partial or complete inability of the cell to respond to androgens. The unresponsiveness of the cell to the presence of androgenic hormones can impair or prevent the masculinization of male genitalia in the developing fetus, as well as the development of male secondary sexual characteristics at puberty, but does not significantly impair female genital or sexual development. As such, the insensitivity to androgens is clinically significant only when it occurs in genetic males (i.e. individuals with a Y-chromosome, or more specifically, an SRY gene). Clinical phenotypes in these individuals range from a normal male habitus with mild spermatogenic defect or reduced secondary terminal hair, to a full female habitus, despite the presence of a Y-chromosome. AIS is divided into three categories that are differentiated by the degree of genital masculinization: complete androgen insensitivity syndrome (CAIS) is indicated when the external genitalia are that of a normal female; mild androgen insensitivity syndrome (MAIS) is indicated when the external genitalia are that of a normal male, and partial androgen insensitivity syndrome (PAIS) is indicated when the external genitalia are partially, but not fully, masculinized. Androgen insensitivity syndrome is the largest single entity that leads to 46,XY undermasculinized genitalia.','http://commons.wikimedia.org/wiki/Special:FilePath/Androgen_receptor_3-d_model.jpg?width=300','http://dbpedia.org/resource/Androgen_insensitivity_syndrome','2018-05-17 22:46:19','2018-05-17 22:46:19'),(6,'Anxiety disorder',57688,744602293,'DOID_2030','Anxiety disorders are a group of mental disorders characterized by feelings of anxiety and fear. Anxiety is a worry about future events and fear is a reaction to current events. These feelings may cause physical symptoms, such as a fast heart rate and shakiness. There are a number of anxiety disorders: including generalized anxiety disorder, specific phobia, social anxiety disorder, separation anxiety disorder, agoraphobia, and panic disorder. The disorder differs by what results in the symptoms. People often have more than one anxiety disorder. The cause of anxiety disorders is a combination of genetic and environmental factors. Risk factors include a history of child abuse, a family history of mental disorders, and poverty. They often occur with other mental disorders, particularly major depressive disorder, personality disorder, and substance use disorder. To be diagnosed symptoms typically need to be present at least six months, be more than would be expected for the situation, and decrease functioning. Other psychiatric and medical problems that may result in similar symptoms including hyperthyroidism, heart disease, caffeine , alcohol or cannabis use, and withdrawal from certain drugs. Without treatment, anxiety disorders tend to remain. Treatment may include lifestyle changes, counselling, and medications. Counselling is typically with a type of cognitive behavioural therapy. Medications, such as antidepressants or beta blockers, may improve symptoms. About 12% of people are affected by an anxiety disorder in a given year. They occur about twice as often in females as males, and generally begin before the age of 25. The most common are specific phobia which affects nearly 12% and social anxiety disorder which affects 10% at some point in their life. They affect those between the ages of 15 and 35 the most and become less common after the age of 55. Rates appear to be higher in the United States and Europe.','http://commons.wikimedia.org/wiki/Special:FilePath/The_Scream.jpg?width=300','http://dbpedia.org/resource/Anxiety_disorder','2018-05-17 22:46:19','2018-05-17 22:46:19'),(7,'Apraxia',56458,744656988,'DOID_0060135','Apraxia is a motor disorder caused by damage to the brain (specifically the posterior parietal cortex), in which the individual has difficulty with the motor planning to perform tasks or movements when asked, provided that the request or command is understood and he/she is willing to perform the task. A person with apraxia cannot move his or her lips or tongue to the right place to say sounds correctly because, even though the muscles are not weak, the messages from the brain to the mouth are disrupted. The nature of the brain damage determines the severity.','http://commons.wikimedia.org/wiki/Special:FilePath/Apraxia_001.jpg?width=300','http://dbpedia.org/resource/Apraxia','2018-05-17 22:46:19','2018-05-17 22:46:19'),(8,'Asthma',44905,745282375,'DOID_2841','Asthma is a common long term inflammatory disease of the airways of the lungs. It is characterized by variable and recurring symptoms, reversible airflow obstruction, and bronchospasm. Symptoms include episodes of wheezing, coughing, chest tightness, and shortness of breath. These episodes may occur a few times a day or a few times per week. Depending on the person they may become worse at night or with exercise. Asthma is thought to be caused by a combination of genetic and environmental factors. Environmental factors include exposure to air pollution and allergens. Other potential triggers include medications such as aspirin and beta blockers. Diagnosis is usually based on the pattern of symptoms, response to therapy over time, and spirometry. Asthma is classified according to the frequency of symptoms, forced expiratory volume in one second (FEV1), and peak expiratory flow rate. It may also be classified as atopic or non-atopic where atopy refers to a predisposition toward developing a type 1 hypersensitivity reaction. There is no cure for asthma. Symptoms can be prevented by avoiding triggers, such as allergens and irritants, and by the use of inhaled corticosteroids. Long-acting beta agonists (LABA) or antileukotriene agents may be used in addition to inhaled corticosteroids if asthma symptoms remain uncontrolled. Treatment of rapidly worsening symptoms is usually with an inhaled short-acting beta-2 agonist such as salbutamol and corticosteroids taken by mouth. In very severe cases, intravenous corticosteroids, magnesium sulfate, and hospitalization may be required. In 2013, 242 million people globally had asthma up from 183 million in 1990. It caused about 489,000 deaths in 2013, most of which occurred in the developing world. It often begins in childhood. The rates of asthma have increased significantly since the 1960s. Asthma was recognized as early as Ancient Egypt. The word asthma is from the Greek ἅσθμα, ásthma which means \"panting\".','http://commons.wikimedia.org/wiki/Special:FilePath/Two_Peak_Flow_Meters.jpg?width=300','http://dbpedia.org/resource/Asthma','2018-05-17 22:46:19','2018-05-17 22:46:19'),(9,'Botulism',40142,744523470,'DOID_11976','Botulism is a rare and potentially fatal illness caused by a toxin, produced by the bacterium Clostridium botulinum. The disease begins with weakness, trouble seeing, feeling tired, and trouble speaking. This may then be followed by weakness of the arms, chest muscles, and legs. The disease does not usually affect consciousness or cause a fever. Botulism can be spread several different ways. The bacterial spores which cause it are common in both soil and water. They produce the botulinum toxin when exposed to low oxygen levels and certain temperatures. Foodborne botulism happens when food containing the toxin is eaten. Infant botulism happens when the bacteria develops in the intestines and releases the toxin. This typically only occurs in children less than six months old, as protective mechanisms develop after that time. Wound botulism is found most often among those who inject street drugs. In this situation, spores enter a wound, and in the absence of oxygen, release the toxin. It is not passed directly between people. The diagnosis is confirmed by finding the toxin or bacteria in the person in question. Prevention is primarily by proper food preparation. The toxin, though not the organism, is destroyed by heating it to more than 85 °C (185 °F) for longer than 5 minutes. Honey can contain the organism, and for this reason, honey should not be fed to children under 12 months. Treatment is with an antitoxin. In those who lose their ability to breathe on their own, mechanical ventilation may be necessary for months. Antibiotics may be used for wound botulism. Death occurs in 5 to 10% of people. Botulism can affect many other animals. The word is from Latin, botulus, meaning sausage.','http://commons.wikimedia.org/wiki/Special:FilePath/Botulism1and2.JPG?width=300','http://dbpedia.org/resource/Botulism','2018-05-17 22:46:19','2018-05-17 22:46:19'),(10,'Canavan disease',56461,745014362,'DOID_3613','Canavan disease, also called Canavan-Van Bogaert-Bertrand disease, is an autosomal recessive degenerative disorder that causes progressive damage to nerve cells in the brain, and is one of the most common degenerative cerebral diseases of infancy. It is caused by a deficiency of the enzyme aminoacylase 2, and is one of a group of genetic diseases referred to as a leukodystrophies. It is characterized by degeneration of myelin in the phospholipid layer insulating the axon of a neuron and is associated with a gene located on human chromosome 17.','http://en.wikipedia.org/wiki/Special:FilePath/Autorecessive.svg?width=300','http://dbpedia.org/resource/Canavan_disease','2018-05-17 22:46:19','2018-05-17 22:46:19'),(11,'Cardiomyopathy',46133,741183351,'DOID_0050700','Cardiomyopathy is a group of diseases that affect the heart muscle. Early on there may be few or no symptoms. Others may have shortness of breath, feel tired, or have swelling of the legs due to heart failure. An irregular heart beat may occur as well as fainting. Those affected are at an increased risk sudden cardiac death. Types of cardiomyopathy include hypertrophic cardiomyopathy, dilated cardiomyopathy, restrictive cardiomyopathy, arrhythmogenic right ventricular dysplasia, and broken heart syndrome. In hypertrophic cardiomyopathy the heart muscle enlarges and thickens. In dilated cardiomyopathy the ventricles enlarge and weaken. In restrictive cardiomyopathy the ventricle stiffens. The cause is frequently unknown. Hypertrophic cardiomyopathy is often and dilated cardiomyopathy in a third of cases, is inherited from a person\'s parents. Dilated cardiomyopathy may also result from alcohol, heavy metals, coronary heart disease, cocaine use, and viral infections. Restrictive cardiomyopathy may be caused by amyloidosis, hemochromatosis, and some cancer treatments. Broken heart syndrome is caused by extreme emotional or physical stress. Treatment depends on the type of cardiomyopathy and the degree of symptoms. Treatments may include lifestyle changes, medications, or surgery. In 2013 cardiomyopathy and myocarditis affected 7.9 million people. Hypertrophic cardiomyopathy affects about 1 in 500 people while dilated cardiomyopathy affects 1 in 2,500. They resulted in 443,000 deaths up from 294,000 in 1990. Arrhythmogenic right ventricular dysplasia is more common in young people.','http://commons.wikimedia.org/wiki/Special:FilePath/Idiopathic_cardiomyopathy,_gross_pathology_20G0018_lores.jpg?width=300','http://dbpedia.org/resource/Cardiomyopathy','2018-05-17 22:46:19','2018-05-17 22:46:19'),(12,'Carpal tunnel syndrome',56462,743786245,'DOID_12169','Carpal tunnel syndrome (CTS) is a medical condition due to compression of the median nerve as it travels through the wrist at the carpal tunnel. The main symptoms are pain, numbness, and tingling, in the thumb, index finger, middle finger, and the thumb side of the ring fingers. Symptoms typically start gradually and during the night. Pain may extend up the arm. Weak grip strength may occur and after a long period of time the muscles at the base of the thumb may waste away. In more than half of cases both sides are affected. Risk factors include obesity, repetitive wrist work, pregnancy, and rheumatoid arthritis. There is tentative evidence that hypothyroidism increases the risk. It is unclear if diabetes plays a role. The use of birth control pills does not affect the risk. Types of work that are associated include computer work, work with vibrating tools, and work that requires a strong grip. Diagnosis is suspected based on signs, symptoms, and specific physical tests and may be confirmed with electrodiagnostic tests. If muscle wasting at the base of the thumb is present, the diagnosis is likely. Being physically active can decrease the risk of developing CTS. Symptoms can be improved by wearing a wrist splint or with corticosteroid injections. Taking NSAIDs or gabapentin does not appear to be useful. Surgery to cut the transverse carpal ligament is effective with better results at a year compared to non surgical options. Further splinting after surgery is not needed. Evidence does not support magnet therapy. About 5% of people in the United States have carpal tunnel syndrome. It usually begins in adulthood and women are more commonly affected than men. Up to 33% of people may improve without specific treatment over approximately a year. Carpal tunnel syndrome was first fully described after World War II.','http://commons.wikimedia.org/wiki/Special:FilePath/Carpal-Tunnel.svg?width=300','http://dbpedia.org/resource/Carpal_tunnel_syndrome','2018-05-17 22:46:19','2018-05-17 22:46:19'),(13,'Cervical cancer',53338,745215241,'DOID_4362','Cervical cancer is a cancer arising from the cervix. It is due to the abnormal growth of cells that have the ability to invade or spread to other parts of the body. Early on, typically no symptoms are seen. Later symptoms may include abnormal vaginal bleeding, pelvic pain, or pain during sexual intercourse. While bleeding after sex may not be serious, it may also indicate the presence of cervical cancer. Human papillomavirus (HPV) infection appears to be involved in the development of more than 90% of cases; most people who have had HPV infections, however, do not develop cervical cancer. Other risk factors include smoking, a weak immune system, birth control pills, starting sex at a young age, and having many sexual partners, but these are less important. Cervical cancer typically develops from precancerous changes over 10 to 20 years. About 90% of cervical cancer cases are squamous cell carcinomas, 10% are adenocarcinoma, and a small number are other types. Diagnosis is typically by cervical screening followed by a biopsy. Medical imaging is then done to determine whether or not the cancer has spread. HPV vaccines protect against between two and seven high-risk strains of this family of viruses and may prevent up to 90% of cervical cancers. As a risk of cancer still exists, guidelines recommend continuing regular Pap smears. Other methods of prevention include: having few or no sexual partners and the use of condoms. Cervical cancer screening using the Pap smear or acetic acid can identify precancerous changes which when treated can prevent the development of cancer. Treatment of cervical cancer may consist of some combination of surgery, chemotherapy, and radiotherapy. Five year survival rates in the United States are 68%. Outcomes, however, depend very much on how early the cancer is detected. Worldwide, cervical cancer is both the fourth-most common cause of cancer and the fourth-most common cause of death from cancer in women. In 2012, an estimated 528,000 cases of cervical cancer occurred, with 266,000 deaths. This is about 8% of the total cases and total deaths from cancer. About 70% of cervical cancers occur in developing countries. In low-income countries, it is the most common cause of cancer death. In developed countries, the widespread use of cervical screening programs has dramatically reduced rates of cervical cancer. In medical research, the most famous cell line known as HeLa was developed from cervical cancer cells of a woman named Henrietta Lacks.','http://commons.wikimedia.org/wiki/Special:FilePath/Blausen_0221_CervicalDysplasia.png?width=300','http://dbpedia.org/resource/Cervical_cancer','2018-05-17 22:46:19','2018-05-17 22:46:19'),(14,'Complex regional pain syndrome',56283,740274616,'DOID_3223','Complex regional pain syndrome (CRPS), also known as reflex sympathetic dystrophy (RSD), is a long term condition that often worsens with time. It is characterized by severe pain and sensitivity, swelling, and changes in the skin. It may initially affect one limb and then spread throughout the body; 35% of people report symptoms throughout their whole body. The cause of CRPS is unknown though CRPS is associated with dysregulation of the central nervous system and autonomic nervous system resulting in multiple functional loss, impairment and disability. Precipitating factors include injury and surgery, although there are cases where no injury had occurred at the original site. CRPS is not caused by psychological factors, yet the constant pain and reduced quality of life has been known to cause psychological problems (such as increased depression and anxiety). Although \"research does not reveal support for specific personality or psychopathology predictors of the condition,\" CRPS is associated with psychosocial effects, including impaired social and occupational function. It is classified as an amplified musculoskeletal pain syndrome. Treatment is complicated, involving medications, physical and occupational therapy, psychological treatments, and neuromodulation and is often unsatisfactory, especially if delayed.','http://commons.wikimedia.org/wiki/Special:FilePath/Complex_regional_pain_syndrome.jpg?width=300','http://dbpedia.org/resource/Complex_regional_pain_syndrome','2018-05-17 22:46:19','2018-05-17 22:46:19'),(15,'Conjunctivitis',44410,743111721,'DOID_6195','Conjunctivitis, also known as pink eye, is inflammation of the outermost layer of the white part of the eye and the inner surface of the eyelid. It makes the eye appear pink or reddish. There may also be pain, burning, scratchiness, or itchiness. The affected eye may have increased tears or be \"stuck shut\" in the morning. Swelling of the white part of the eye may also occur. Itching of the eye is more common in cases due to allergies. Conjunctivitis can affect one or both eyes. The most common infectious causes are viral followed by bacterial. The viral infection may occur along with other symptoms of a common cold. Viral and bacterial cases are easily spread between people. Allergies to pollen or animal hair is also a common cause. Diagnosis is often based on signs and symptoms. Occasionally a sample of the discharge is sent for culture. Prevention is partly by handwashing. Treatment depends on the underlying cause. In the majority of viral cases, there is no specific treatment. Most cases due to a bacterial infection will also resolve without treatment; however, antibiotics can shorten the illness. Those who wear contact lens and those with either gonorrhea or chlamydia as the cause should be treated. Allergic cases can be treated with antihistamine or mast cell inhibitor drops. About 3 to 6 million people get conjunctivitis each year in the United States. In adults viral causes are more common, while in children bacterial causes are more common. Typically people get better in one or two weeks. If there is visual loss, significant pain, sensitivity to light, signs of herpes, or a person is not improving after a week, further diagnosis and treatment may be required. Conjunctivitis in a newborn, known as neonatal conjunctivitis, may also require specific treatment.','http://commons.wikimedia.org/wiki/Special:FilePath/An_eye_with_viral_conjunctivitis.jpg?width=300','http://dbpedia.org/resource/Conjunctivitis','2018-05-17 22:46:19','2018-05-17 22:46:19'),(16,'Cowpox',51303,722219608,'DOID_8956','Cowpox is an infectious disease caused by the cowpox virus. The virus, part of the orthopoxvirus family, is closely related to the vaccinia virus. The virus is zoonotic, meaning that it is transferable between species, such as from animal to human. The transferral of the disease was first observed in dairymaids who touched the udders of infected cows and consequently developed the signature pustules on their hands. Cowpox is more commonly found in animals other than bovines, such as rodents. Cowpox is similar to, but much milder than, the highly contagious and often deadly smallpox disease. Its close resemblance to the mild form of smallpox and the observation that dairymaids were immune from smallpox inspired the first smallpox vaccine, created and administered by English physician Edward Jenner. The word “vaccination,” coined by Jenner in 1796, is derived from the Latin root vaccinus, meaning of or from the cow. Once vaccinated, a patient develops antibodies that make him/her immune to cowpox, but they also develop immunity to the smallpox virus, or Variola virus. The cowpox vaccinations and later incarnations proved so successful that in 1980, the World Health Organization announced that smallpox was the first disease to be eradicated by vaccination efforts worldwide. Other orthopox viruses remain prevalent in certain communities and continue to infect humans, such as the cowpox virus (CPXV) in Europe, vaccinia in Brazil, and monkeypox virus in Central and West Africa.','http://commons.wikimedia.org/wiki/Special:FilePath/Cowpox_Engraving_(detail).png?width=300','http://dbpedia.org/resource/Cowpox','2018-05-17 22:46:19','2018-05-17 22:46:19'),(17,'Cystic fibrosis',50601,743231622,'DOID_1485','Cystic fibrosis (CF) is a genetic disorder that affects mostly the lungs, but also the pancreas, liver, kidneys, and intestine. Long-term issues include difficulty breathing and coughing up mucus as a result of frequent lung infections. Other signs and symptoms include sinus infections, poor growth, fatty stool, clubbing of the fingers and toes, and infertility in males, among others. Different people may have different degrees of symptoms. CF is inherited in an autosomal recessive manner. It is caused by the presence of mutations in both copies of the gene for the cystic fibrosis transmembrane conductance regulator (CFTR) protein. Those with a single working copy are carriers and otherwise mostly normal. CFTR is involved in production of sweat, digestive fluids, and mucus. When CFTR is not functional, secretions which are usually thin instead become thick. The condition is diagnosed by a sweat test and genetic testing. Screening of infants at birth takes place in some areas of the world. No cure for cystic fibrosis is known. Lung infections are treated with antibiotics which may be given intravenously, inhaled, or by mouth. Sometimes, the antibiotic azithromycin is used long term. Inhaled hypertonic saline and salbutamol may also be useful. Lung transplantation may be an option if lung function continues to worsen. Pancreatic enzyme replacement and fat-soluble vitamin supplementation are important, especially in the young. Airway clearance techniques such as chest physiotherapy have some short-term benefit, but long-term effects are unclear. The average life expectancy is between 42 and 50 years in the developed world. Lung problems are responsible for death in 80% of people with cystic fibrosis. CF is most common among people of Northern European ancestry and affects about one out of every 3,000 newborns. About one in 25 people is a carrier. It is least common in Africans and Asians. It was first recognized as a specific disease by Dorothy Andersen in 1938, with descriptions that fit the condition occurring at least as far back as 1595. The name \'cystic fibrosis\' refers to the characteristic fibrosis and cysts that form within the pancreas.','http://commons.wikimedia.org/wiki/Special:FilePath/ClubbingCF.JPG?width=300','http://dbpedia.org/resource/Cystic_fibrosis','2018-05-17 22:46:19','2018-05-17 22:46:19'),(18,'Dengue fever',39669,745237925,'DOID_12205','Dengue fever is a mosquito-borne tropical disease caused by the dengue virus. Symptoms typically begin three to fourteen days after infection. This may include a high fever, headache, vomiting, muscle and joint pains, and a characteristic skin rash. Recovery generally takes two to seven days. In a small proportion of cases, the disease develops into the life-threatening dengue hemorrhagic fever, resulting in bleeding, low levels of blood platelets and blood plasma leakage, or into dengue shock syndrome, where dangerously low blood pressure occurs. Dengue is spread by several species of mosquito of the Aedes type, principally A. aegypti. The virus has five different types; infection with one type usually gives lifelong immunity to that type, but only short-term immunity to the others. Subsequent infection with a different type increases the risk of severe complications. A number of tests are available to confirm the diagnosis including detecting antibodies to the virus or its RNA. A novel vaccine for dengue fever has been approved in three countries, but it is not yet commercially available. Prevention is by reducing mosquito habitat and limiting exposure to bites. This may be done by getting rid of or covering standing water and wearing clothing that covers much of the body. Treatment of acute dengue is supportive and includes giving fluid either by mouth or intravenously for mild or moderate disease. For more severe cases blood transfusion may be required. About half a million people require admission to hospital a year. Nonsteroidal anti-inflammatory drug (NSAIDs) such as ibuprofen should not be used. Dengue has become a global problem since the Second World War and is common in more than 110 countries. Each year between 50 and 528 million people are infected and approximately 10,000 to 20,000 die. The earliest descriptions of an outbreak date from 1779. Its viral cause and spread were understood by the early 20th century. Apart from eliminating the mosquitoes, work is ongoing for medication targeted directly at the virus.','http://commons.wikimedia.org/wiki/Special:FilePath/Denguerash.JPG?width=300','http://dbpedia.org/resource/Dengue_fever','2018-05-17 22:46:19','2018-05-17 22:46:19'),(19,'Dermatitis',57713,744838451,'DOID_2723','Dermatitis, also known as eczema, is a group of diseases that results in inflammation of the skin. These diseases are characterized by itchiness, red skin, and a rash. In cases of short duration there may be small blisters while in long term cases the skin may become thickened. The area of skin involved can vary from small to the entire body. Dermatitis is a group of skin conditions that includes atopic dermatitis, allergic contact dermatitis, irritant contact dermatitis, and stasis dermatitis. The exact cause of dermatitis is often unclear. Cases are believed to often involve a combination of irritation, allergy, and poor venous return. The type of dermatitis is generally determined by the person\'s history and the location of the rash. For example, irritant dermatitis often occurs on the hands of people who frequently get them wet. Allergic contact dermatitis; however, can occur following brief exposures to specific substances to which a person is sensitive. Treatment of atopic dermatitis is typically with moisturizers and steroid creams. The steroid creams should generally be of mid to high strength and used for less than two weeks at a time as side effects can occur. Antibiotics may be required if there are signs of skin infection. Contact dermatitis is typically treated by avoiding the allergen or irritant. Antihistamines may be used to help with sleep and to decrease nighttime scratching. Dermatitis was estimated to affect 334 million people globally in 2013. Atopic dermatitis is the most common type and generally starts in childhood. In the United States it affects about 10-30% of people. Contact dermatitis is two times more common in females than males. Allergic contact dermatitis affects about 7% of people at some point in time. Irritant contact dermatitis is common, especially among people who do certain jobs, however exact rates are unclear.','http://commons.wikimedia.org/wiki/Special:FilePath/Dermatitis2015.jpg?width=300','http://dbpedia.org/resource/Dermatitis','2018-05-17 22:46:19','2018-05-17 22:46:19'),(20,'Diabetes insipidus',44738,743800407,'DOID_9409','Diabetes insipidus (DI) is a condition characterized by excessive thirst and excretion of large amounts of severely dilute urine, with reduction of fluid intake having no effect on the concentration of the urine. There are different types of DI, each with a different set of causes. The most common type in humans is the neurological form, called central DI (CDI), which involves a deficiency of arginine vasopressin (AVP), also known as antidiuretic hormone (ADH). The second common type of DI is nephrogenic diabetes insipidus (NDI), which is due to kidney or nephron dysfunction caused by an insensitivity of the kidneys or nephrons to ADH. DI can also be gestational, or caused by alcohol or some types of drug abuse. DI should not be confused with nocturia. Although they have a common name, diabetes mellitus and diabetes insipidus are two entirely separate conditions with unrelated mechanisms. Both cause large amounts of urine to be produced (polyuria). However, diabetes insipidus is either a problem with the production of antidiuretic hormone (central diabetes insipidus) or kidney\'s response to antidiuretic hormone (nephrogenic diabetes insipidus), whereas diabetes mellitus causes polyuria via a process called osmotic diuresis, due to the high blood sugar leaking into the urine and taking excess water along with it. The number of new cases of diabetes insipidus each year is 3 in 100,000. Diabetes insipidus usually starts in childhood or early adulthood and affects men more commonly than women. The term \"diabetes\" is derived from the Greek word meaning siphon.','http://commons.wikimedia.org/wiki/Special:FilePath/Arginine_vasopressin3d.png?width=300','http://dbpedia.org/resource/Diabetes_insipidus','2018-05-17 22:46:19','2018-05-17 22:46:19'),(21,'Diabetic ketoacidosis',56526,734933176,'DOID_1837','Diabetic ketoacidosis (DKA) is a potentially life-threatening complication in people with diabetes mellitus. It happens predominantly in those with type 1 diabetes, but it can occur in those with type 2 diabetes under certain circumstances. DKA results from a shortage of insulin; in response the body switches to burning fatty acids and producing acidic ketone bodies that cause most of the symptoms and complications. DKA may be the first symptom of previously undiagnosed diabetes, but it may also occur in people known to have diabetes as a result of a variety of causes, such as intercurrent illness or poor compliance with insulin therapy. Vomiting, dehydration, deep gasping breathing, confusion and occasionally coma are typical symptoms. DKA is diagnosed with blood and urine tests; it is distinguished from other, rarer forms of ketoacidosis by the presence of high blood sugar levels. Treatment involves intravenous fluids to correct dehydration, insulin to suppress the production of ketone bodies, treatment for any underlying causes such as infections, and close observation to prevent and identify complications. DKA is a medical emergency, and without treatment it can lead to death. DKA was first described in 1886; until the introduction of insulin therapy in the 1920s, it was almost universally fatal. It now carries a mortality of less than 1% with adequate and timely treatment.','http://commons.wikimedia.org/wiki/Special:FilePath/Infuuszakjes.jpg?width=300','http://dbpedia.org/resource/Diabetic_ketoacidosis','2018-05-17 22:46:19','2018-05-17 22:46:19'),(22,'Diabetic retinopathy',56533,745246290,'DOID_8947','Diabetic retinopathy ([ˌrɛtnˈɑpəθi]), also known as diabetic eye disease, is when damage occurs to the retina due to diabetes. It can eventually lead to blindness. It is an ocular manifestation of diabetes, a systemic disease, which affects up to 80 percent of all patients who have had diabetes for 20 years or more. Despite these intimidating statistics, research indicates that at least 90% of these new cases could be reduced if there were proper and vigilant treatment and monitoring of the eyes. The longer a person has diabetes, the higher his or her chances of developing diabetic retinopathy. Each year in the United States, diabetic retinopathy accounts for 12% of all new cases of blindness. It is also the leading cause of blindness for people aged 20 to 64 years.','http://commons.wikimedia.org/wiki/Special:FilePath/Fundus_photo_showing_scatter_laser_surgery_for_diabetic_retinopathy_EDA09.JPG?width=300','http://dbpedia.org/resource/Diabetic_retinopathy','2018-05-17 22:46:19','2018-05-17 22:46:19'),(23,'Diarrhea',53951,736453402,'DOID_13250','Diarrhea, also spelled diarrhoea, is the condition of having at least three loose or liquid bowel movements each day. It often lasts for a few days and can result in dehydration due to fluid loss. Signs of dehydration often begin with loss of the normal stretchiness of the skin and irritable behaviour. This can progress to decreased urination, loss of skin color, a fast heart rate, and a decrease in responsiveness as it becomes more severe. Loose but non-watery stools in babies who are breastfed, however, may be normal. The most common cause is an infection of the intestines due to either a virus, bacteria, or parasite; a condition known as gastroenteritis. These infections are often acquired from food or water that has been contaminated by stool, or directly from another person who is infected. It may be divided into three types: short duration watery diarrhea, short duration bloody diarrhea, and if it lasts for more than two weeks, persistent diarrhea. The short duration watery diarrhea may be due to an infection by cholera, although this is rare in the developed world. If blood is present it is also known as dysentery. A number of non-infectious causes may also result in diarrhea, including hyperthyroidism, lactose intolerance, inflammatory bowel disease, a number of medications, and irritable bowel syndrome. In most cases, stool cultures are not required to confirm the exact cause. Prevention of infectious diarrhea is by improved sanitation, clean drinking water, and hand washing with soap. Breastfeeding for at least six months is also recommended as is vaccination against rotavirus. Oral rehydration solution (ORS), which is clean water with modest amounts of salts and sugar, is the treatment of choice. Zinc tablets are also recommended. These treatments have been estimated to have saved 50 million children in the past 25 years. When people have diarrhea it is recommended that they continue to eat healthy food and babies continue to be breastfed. If commercial ORS are not available, homemade solutions may be used. In those with severe dehydration, intravenous fluids may be required. Most cases; however, can be managed well with fluids by mouth. Antibiotics, while rarely used, may be recommended in a few cases such as those who have bloody diarrhea and a high fever, those with severe diarrhea following travelling, and those who grow specific bacteria or parasites in their stool. Loperamide may help decrease the number of bowel movements but is not recommended in those with severe disease. About 1.7 to 5 billion cases of diarrhea occur per year. It is most common in developing countries, where young children get diarrhea on average three times a year. Total deaths from diarrhea are estimated at 1.26 million in 2013 – down from 2.58 million in 1990. In 2012, it was the second most common cause of deaths in children younger than five (0.76 million or 11%). Frequent episodes of diarrhea are also a common cause of malnutrition and the most common cause in those younger than five years of age. Other long term problems that can result include stunted growth and poor intellectual development.','http://commons.wikimedia.org/wiki/Special:FilePath/Multiple_rotavirus_particles.jpg?width=300','http://dbpedia.org/resource/Diarrhea','2018-05-17 22:46:19','2018-05-17 22:46:19'),(24,'Dissociative identity disorder',39653,740233940,'DOID_10934','Dissociative identity disorder (DID), previously known as multiple personality disorder (MPD), is a mental disorder characterized by at least two distinct and relatively enduring identities or dissociated personality states that alternately show in a person\'s behavior, accompanied by memory impairment for important information not explained by ordinary forgetfulness. These symptoms are not accounted for by substance abuse, seizures, other medical conditions, nor by imaginative play in children. Diagnosis is often difficult as there is considerable comorbidity with other mental disorders. Malingering should be considered if there is possible financial or forensic gain, as well as factitious disorder if help-seeking behavior is prominent. DID is one of the most controversial psychiatric disorders, with no clear consensus on diagnostic criteria or treatment. Research on treatment efficacy has been concerned primarily with clinical approaches and case studies. Dissociative symptoms range from common lapses in attention, becoming distracted by something else, and daydreaming, to pathological dissociative disorders. No systematic, empirically supported definition of \"dissociation\" exists. It is not the same as schizophrenia. Although neither epidemiological surveys nor longitudinal studies have been conducted, it is generally believed that DID rarely resolves spontaneously. Symptoms are said to vary over time. In general, the prognosis is poor, especially for those with comorbid disorders. There are few systematic data on the prevalence of DID. The International Society for the Study of Trauma and Dissociation states that the prevalence is between 1 and 3% in the general population, and between 1 and 5% in inpatient groups in Europe and North America. DID is diagnosed more frequently in North America than in the rest of the world, and is diagnosed three to nine times more often in females than in males. The prevalence of DID diagnoses increased greatly in the latter half of the 20th century, along with the number of identities (often referred to as \"alters\") claimed by patients (increasing from an average of two or three to approximately 16). DID is also controversial within the legal system, where it has been used as a rarely successful form of the insanity defense. The 1990s showed a parallel increase in the number of court cases involving the diagnosis. Dissociative disorders including DID have been attributed to disruptions in memory caused by trauma and other forms of stress, but research on this hypothesis has been characterized by poor methodology. So far, scientific studies, usually focusing on memory, have been few and the results have been inconclusive. An alternative hypothesis for the cause of DID is as a by-product of techniques employed by some therapists, especially those using hypnosis, and disagreement between the two positions is characterized by intense debate. DID became a popular diagnosis in the 1970s, 80s and 90s, but it is unclear if the actual rate of the disorder increased, if it was more recognized by health care providers, or if sociocultural factors caused an increase in therapy-induced (iatrogenic) presentations. The unusual number of diagnoses after 1980, clustered around a small number of clinicians and the suggestibility characteristic of those with DID, support the hypothesis that DID is therapist-induced. The unusual clustering of diagnoses has also been explained as due to a lack of awareness and training among clinicians to recognize cases of DID.','http://commons.wikimedia.org/wiki/Special:FilePath/Dissociative_identity_disorder.jpg?width=300','http://dbpedia.org/resource/Dissociative_identity_disorder','2018-05-17 22:46:19','2018-05-17 22:46:19'),(25,'Ectopic pregnancy',54309,742820539,'DOID_0060329','Ectopic pregnancy, also known as eccyesis or tubal pregnancy, is a complication of pregnancy in which the embryo attaches outside the uterus. Signs and symptoms classically include abdominal pain and vaginal bleeding. Less than 50 percent of women have both of these symptoms. The pain may be described as sharp, dull, or crampy. Pain may also spread to the shoulder if bleeding into the abdomen has occurred. Severe bleeding may result in a fast heart rate, fainting, or shock. With very rare exceptions the fetus is unable to survive. Risk factors for ectopic pregnancy include: pelvic inflammatory disease, often due to Chlamydia infection, tobacco smoking, prior tubal surgery, a history of infertility, and the use of assisted reproductive technology. Those who have previously had an ectopic pregnancy are at much higher risk of having another one. Most ectopic pregnancies (90%) occur in the Fallopian tube which are known as tubal pregnancies. Implantation can also occur on the cervix, ovaries, or within the abdomen. Detection of ectopic pregnancy is typically by blood tests for human chorionic gonadotropin (hCG) and ultrasound. This may require testing on more than one occasion. Ultrasound works best when performed from within the vagina. Other causes of similar symptoms include: miscarriage, ovarian torsion, and acute appendicitis. Prevention is by decreasing risk factors such as chlamydia infections through screening and treatment. While some ectopic pregnancies will resolve without treatment, this approach has not been well studied as of 2014. The use of the medication methotrexate works as well as surgery in some cases. Specifically it works well when the beta-HCG is low and the size of the ectopic is small. Surgery is still typically recommended if the tube has ruptured, there is a fetal heartbeat, or the person\'s vital signs are unstable. The surgery may be laparoscopic or through a larger incision, known as a laparotomy. Outcomes are generally good with treatment. The rate of ectopic pregnancy is about 1 and 2% that of live births in developed countries, though it may be as high as 4% among those using assisted reproductive technology. It is the most common cause of death during the first trimester at approximately 10% of the total. In the developed world outcomes have improved while in the developing world they often remain poor. The risk of death among those in the developed world is between 0.1 and 0.3 percent while in the developing world it is between one and three percent. The first known description of an ectopic pregnancy is by Albucasis in the 11th century. The word \"ectopic\" means \"out of place\".','http://commons.wikimedia.org/wiki/Special:FilePath/Ectopic_pregnancy_on_laparoscopy.png?width=300','http://dbpedia.org/resource/Ectopic_pregnancy','2018-05-17 22:46:19','2018-05-17 22:46:19'),(26,'Encephalitis',37636,744700237,'DOID_9588','Encephalitis is a sudden onset inflammation of the brain. Encephalitis with meningitis is known as meningoencephalitis. Symptoms include headache, fever, confusion, drowsiness, and fatigue. Further symptoms include seizures or convulsions, tremors, hallucinations, stroke, and memory problems. In 2013, encephalitis was estimated to have resulted in 77,000 deaths, down from 92,000 in 1990. The word is from Ancient Greek ἐγκέφαλος, enképhalos \"brain\", composed of ἐν, en, \"in\" and κεφαλή, kephalé, \"head\", and the medical suffix -itis \"inflammation\".','http://commons.wikimedia.org/wiki/Special:FilePath/Hsv_encephalitis.jpg?width=300','http://dbpedia.org/resource/Encephalitis','2018-05-17 22:46:19','2018-05-17 22:46:19'),(27,'Endometriosis',53335,742079355,'DOID_289','Endometriosis is a disease in which tissue that normally grows inside the uterus grows outside it. The main symptoms are pelvic pain and infertility. Nearly half of those affected have chronic pelvic pain, while in 70% pain occurs during menstruation. Pain during sex is also common. Infertility occurs in up to half of women affected. Less common symptoms include urinary or bowel symptoms. About 25% of women have no symptoms. Endometriosis can have both social and psychological effects. The cause is not entirely clear. Risk factors include having a family history of the condition. Most often the ovaries, fallopian tubes, and tissue around the uterus and ovaries are affected; however, in rare cases it may also occur in other parts of the body. The areas of endometriosis bleed each month, resulting in inflammation and scarring. The growths due to endometriosis are not cancer. Diagnosis is usually based on symptoms in combination with medical imaging. Biopsy is the most sure method of diagnosis. Other causes of similar symptoms include pelvic inflammatory disease, irritable bowel syndrome, interstitial cystitis, and fibromyalgia. Tentative evidence suggests that the use of combined oral contraceptives reduces the risk of endometriosis. Exercise and avoiding large amounts of alcohol may also be preventative. There is no cure for endometriosis, but a number of treatments may improve symptoms. This may include pain medication, hormonal treatments, or surgery. The recommended pain medication is usually an NSAID such as naproxen. Taking the active component of the birth control pill continuously or using an intrauterine device with progestogen may also be useful. Gonadotropin-releasing hormone agonist may improve the ability of those who are infertile to get pregnant. Surgical removal of endometriosis may be used to treat those whose symptoms are not manageable with other treatments. Endometriosis is estimated to occur in roughly 6–10% of women. It is most common in those in their thirties and forties; however, can begin in girls as early as 8 years old. It results in few deaths with this being estimated at 200 globally in 2013. Endometriosis was first determined to be a separate condition in the 1920s. Before that time endometriosis and adenomyosis were considered together. It is unclear who first described the disease.','http://commons.wikimedia.org/wiki/Special:FilePath/Endometriosis.jpg?width=300','http://dbpedia.org/resource/Endometriosis','2018-05-17 22:46:19','2018-05-17 22:46:19'),(28,'Epidemic typhus',46177,737828786,'DOID_0050480','Epidemic typhus (also called \"camp fever\", \"jail fever\", \"hospital fever\", \"ship fever\", \"famine fever\", \"putrid fever\", \"petechial fever\", \"Epidemic louse-borne typhus,\" and \"louse-borne typhus\") is a form of typhus so named because the disease often causes epidemics following wars and natural disasters. The causative organism is Rickettsia prowazekii, transmitted by the human body louse (Pediculus humanus humanus).','http://commons.wikimedia.org/wiki/Special:FilePath/Epidemic_typhus_Burundi.jpg?width=300','http://dbpedia.org/resource/Epidemic_typhus','2018-05-17 22:46:19','2018-05-17 22:46:19'),(29,'Erysipelas',58637,741910748,'DOID_11330','Erysipelas (/ɛrᵻˈsɪpələs/; Greek ἐρυσίπελας, \"red skin\"; also known as \"ignis sacer\", \"holy fire\", and \"St. Anthony\'s fire\" in some countries) is an acute infection typically with a skin rash, usually on any of the legs and toes, face, arms, and fingers. It is an infection of the upper dermis and superficial lymphatics, usually caused by beta-hemolytic group A Streptococcus bacteria on scratches or otherwise infected areas. Erysipelas is more superficial than cellulitis, and is typically more raised and demarcated.','http://commons.wikimedia.org/wiki/Special:FilePath/Facial_erysipelas.jpg?width=300','http://dbpedia.org/resource/Erysipelas','2018-05-17 22:46:19','2018-05-17 22:46:19'),(30,'Fatal familial insomnia',43871,744801390,'DOID_0050433','Fatal familial insomnia (FFI) is an extremely rare autosomal dominant inherited prion disease of the brain. It is almost always caused by a mutation to the protein PrPC, but can also develop spontaneously in patients with a non-inherited mutation variant called sporadic fatal insomnia (sFI). FFI has no known cure and involves progressively worsening insomnia, which leads to hallucinations, delirium, and confusional states like that of dementia. The average survival span for patients diagnosed with FFI after the onset of symptoms is 18 months. The mutated protein, called PrPSc, has been found in just 40 families worldwide, affecting about 100 people; if only one parent has the gene, the offspring have a 50% risk of inheriting it and developing the disease. With onset usually around middle age, it is essential that a potential patient be tested if they wish to avoid passing FFI on to their children. The first recorded case was an Italian man, who died in Venice in 1765.','http://commons.wikimedia.org/wiki/Special:FilePath/Autosomal_dominant_-_en.svg?width=300','http://dbpedia.org/resource/Fatal_familial_insomnia','2018-05-17 22:46:19','2018-05-17 22:46:19'),(31,'Fragile X syndrome',53142,743003660,'DOID_14261','Fragile X syndrome (FXS) is a genetic disorder. Symptoms often include mild to moderate intellectual disability. Physical features may include a long and narrow face, large ears, flexible fingers, and large testicles. About a third of people have features of autism such as problems with social interactions and delayed speech. Hyperactivity is common and seizures occur in about 10%. Males are usually more affected than females. Fragile X syndrome is typically due to the expansion of the  CGG triplet repeat within the Fragile X mental retardation 1 (FMR1) gene on the X chromosome. This results in a failure to express the fragile X mental retardation protein (FMRP), which is required for normal neural development. Depending on the length of the CGG repeat, an allele may be classified as normal (unaffected by the syndrome), a premutation (at risk of fragile X associated disorders), or full mutation (usually affected by the syndrome). A diagnosis of fragile X syndrome is made through genetic testing to determine the number of CGG repeats. Testing for premutation carriers may allow for genetic counseling. There is no medication that has a benefit specifically for fragile X syndrome. Medications are commonly used to treat symptoms of attention deficit and hyperactivity, anxiety, and aggression. Supportive management is important in optimizing functioning in individuals with fragile X syndrome, and may involve speech therapy, occupational therapy, and individualized educational and behavioral programs. Fragile X syndrome occurs in about 1 in 4,000 males and 1 in 8,000 females. The first complete DNA sequence of the repeat expansion in someone with the full mutation was generated by scientists in 2012 using SMRT sequencing.','http://commons.wikimedia.org/wiki/Special:FilePath/Fragx-2.jpg?width=300','http://dbpedia.org/resource/Fragile_X_syndrome','2018-05-17 22:46:19','2018-05-17 22:46:19'),(32,'Lactose intolerance',56873,745107780,'DOID_10604','Lactose intolerance is the inability of adults and children to digest lactose, a sugar found in milk and to a lesser extent dairy products, causing side effects. It is due to a lactase deficiency, or hypolactasia. In extremely rare cases, mainly limited to Finland, individuals have congenital alactasia, a total absence of lactase caused by a genetic defect, which prevents them from being able to digest lactose from infancy, including breast milk. Lactose intolerant individuals have insufficient levels of lactase, an enzyme that catalyzes the hydrolysis of lactose into glucose and galactose, in their digestive system. In most cases, this causes symptoms which may include abdominal bloating and cramps, flatulence, diarrhea, nausea, borborygmi (rumbling stomach), or vomiting after consuming significant amounts of lactose. It is common for patients with inflammatory bowel disease to experience gastrointestinal symptoms after lactose ingestion, although the prevalence of lactase deficiency in this population has not been well studied. Most mammals normally cease to produce lactase (lactase nonpersistence), becoming lactose intolerant, after weaning, but some human populations have developed lactase persistence, in which lactase production continues into adulthood which likely developed as a response to growing benefits of being able to digest the milk of farm animals such as cattle. Research reveals intolerance to be more common globally than lactase persistence, and that the variation has been tied to genetics, but that the largest source of variation has been shown to be based on exposure (e.g., cultures that consume dairy). The frequency of lactose intolerance ranges from 5% in Northern European to more than 90% in some African and Asian countries. Some have argued that this links intolerance to natural selection favoring lactase-persistent individuals, but it is also consistent with a physiological response to decrease lactase production when it is not needed in cultures in which dairy products are not an available food source. Although populations in Europe, India, Arabia, and Africa were first thought to have high frequencies of lactase persistence because of a single mutation, lactase persistence has been traced to a number of mutations that occurred independently. Healthy people with lactase nonpersistence are able to consume at least one cup of milk without developing symptoms and this tolerance is improved by consuming the milk with a meal (preferably lactose-reduced milk), adding lactase supplements, or replacing milk by yogurt or hard cheeses.','http://commons.wikimedia.org/wiki/Special:FilePath/Lactose_Haworth.svg?width=300','http://dbpedia.org/resource/Lactose_intolerance','2018-05-17 22:46:19','2018-05-17 22:46:19'),(33,'Leprosy',44700,743999739,'DOID_1024','Leprosy, also known as Hansen\'s disease (HD), is a long-term infection caused by the bacilli Mycobacterium leprae and Mycobacterium lepromatosis. Initially, infections are without symptoms and typically remain this way for 5 to 20 years. Symptoms that develop include granulomas of the nerves, respiratory tract, skin, and eyes. This may result in a lack of ability to feel pain and thus loss of parts of extremities due to repeated injuries or infection due to unnoticed wounds. Weakness and poor eyesight may also be present. Leprosy is spread between people. This is believed to occur through a cough or contact with fluid from the nose of an infected person. Leprosy occurs more commonly among those living in poverty. Contrary to popular belief, it is not highly contagious. The two main types of disease are based on the number of bacteria present: paucibacillary and multibacillary. The two types are differentiated by the number of poorly pigmented, numb skin patches present, with paucibacillary having five or fewer and multibacillary having more than five. The diagnosis is confirmed by finding acid-fast bacilli in a biopsy of the skin or by detecting the DNA using polymerase chain reaction. Leprosy is curable with a treatment known as multidrug therapy. Treatment for paucibacillary leprosy is with the medications dapsone and rifampicin for six months. Treatment for multibacillary leprosy consists of rifampicin, dapsone, and clofazimine for 12 months. A number of other antibiotics may also be used. These treatments are provided free of charge by the World Health Organization. Globally in 2012, the number of chronic cases of leprosy was 189,000, down from some 5.2 million in the 1980s. The number of new cases was 230,000. Most new cases occur in 16 countries, with India accounting for more than half. In the past 20 years, 16 million people worldwide have been cured of leprosy. About 200 cases are reported per year in the United States. Leprosy has affected humanity for thousands of years. The disease takes its name from the Latin word lepra, which means \"scaly\", while the term \"Hansen\'s disease\" is named after the physician Gerhard Armauer Hansen. Separating people by placing them in leper colonies still occurs in places such as India, China, and Africa. However, most colonies have closed since leprosy is not very contagious. Social stigma has been associated with leprosy for much of history, which continues to be a barrier to self-reporting and early treatment. Some consider the word \"leper\" offensive, preferring the phrase \"person affected with leprosy\". World Leprosy Day was started in 1954 to draw awareness to those affected by leprosy.','http://commons.wikimedia.org/wiki/Special:FilePath/Leprosy.jpg?width=300','http://dbpedia.org/resource/Leprosy','2018-05-17 22:46:19','2018-05-17 22:46:19'),(34,'Marburg virus disease',58743,733027007,'DOID_4327','Marburg virus disease (MVD; formerly Marburg hemorrhagic fever) is a severe illness of humans and non-human primates caused by either of the two marburgviruses, Marburg virus (MARV) and Ravn virus (RAVV). MVD is a viral hemorrhagic fever (VHF), and the clinical symptoms are indistinguishable from Ebola virus disease (EVD).','http://commons.wikimedia.org/wiki/Special:FilePath/Marburg_virus.jpg?width=300','http://dbpedia.org/resource/Marburg_virus_disease','2018-05-17 22:46:19','2018-05-17 22:46:19'),(35,'Marfan syndrome',45475,740849937,'DOID_14323','Marfan syndrome (MFS) is a genetic disorder of connective tissue. The degree to which people are affected varies. People with Marfan\'s tend to be tall, and thin, with long arms, legs, fingers and toes. They also typically have flexible joints and scoliosis. The most serious complications involve the heart and aorta with an increased risk of mitral valve prolapse and aortic aneurysm. Other commonly affected areas include the lungs, eyes, bones, and the covering of the spinal cord. Marfan is an autosomal dominant disorder. About 75% of the time the condition is inherited from a parent while 25% of the time it is a new mutation. It involves a mutation to the gene that makes fibrillin which results in abnormal connective tissue. Diagnosis is often based on the Ghent criteria. There is no cure for Marfan syndrome. Many people have a normal life expectancy with proper treatment. Management often includes the use of beta blockers such as propranolol or if not tolerated calcium channel blockers or ACE inhibitors. Surgery may be required to repair the aorta or replace a heart valve. It is recommended that hard exercise be avoided. About one in 3,000 to 10,000 individuals have Marfan syndrome. It occurs equally in males and females. Rates are similar between races and in different regions of the world. It is named after Antoine Marfan, a French pediatrician who first described the condition in 1896.','http://commons.wikimedia.org/wiki/Special:FilePath/MarfanChest.jpg?width=300','http://dbpedia.org/resource/Marfan_syndrome','2018-05-17 22:46:19','2018-05-17 22:46:19'),(36,'Mood disorder',52316,739657062,'DOID_3324','Mood disorder is a group of diagnoses in the Diagnostic and Statistical Manual of Mental Disorders (DSM) classification system where a disturbance in the person\'s mood is hypothesized to be the main underlying feature. The classification is known as mood (affective) disorders in International Classification of Diseases (ICD). English psychiatrist Henry Maudsley proposed an overarching category of affective disorder. The term was then replaced by mood disorder, as the latter term refers to the underlying or longitudinal emotional state, whereas the former refers to the external expression observed by others. Mood disorders fall into the basic groups of elevated mood, such as mania or hypomania; depressed mood, of which the best-known and most researched is major depressive disorder (MDD) (commonly called clinical depression, unipolar depression, or major depression); and moods which cycle between mania and depression, known as bipolar disorder (BD) (formerly known as manic depression). There are several sub-types of depressive disorders or psychiatric syndromes featuring less severe symptoms such as dysthymic disorder (similar to but milder than MDD) and cyclothymic disorder (similar to but milder than BD). Mood disorders may also be substance-induced or occur in response to a medical condition.','http://commons.wikimedia.org/wiki/Special:FilePath/A_depressive_man_standing_by_a_country_pond_in_the_pouring_r_Wellcome_V0011388.jpg?width=300','http://dbpedia.org/resource/Mood_disorder','2018-05-17 22:46:19','2018-05-17 22:46:19'),(37,'Obesity',56435,744108323,'DOID_9970','Obesity is a medical condition in which excess body fat has accumulated to the extent that it may have a negative effect on health. People are generally considered obese when their body mass index (BMI), a measurement obtained by dividing a person\'s weight by the square of the person\'s height, is over 30 kg/m2, with the range 25–30 kg/m2 defined as overweight. Some East Asian countries use lower values. Obesity increases the likelihood of various diseases, particularly heart disease, type 2 diabetes, obstructive sleep apnea, certain types of cancer, and osteoarthritis. Obesity is most commonly caused by a combination of excessive food intake, lack of physical activity, and genetic susceptibility. A few cases are caused primarily by genes, endocrine disorders, medications, or mental illness. Evidence to support the view that obese people eat little yet gain weight due to a slow metabolism is not generally supported. On average, obese people have a greater energy expenditure than their thin counterparts due to the energy required to maintain an increased body mass. Obesity is mostly preventable through a combination of social changes and personal choices. Changes to diet and exercising are the main treatments. Diet quality can be improved by reducing the consumption of energy-dense foods, such as those high in fat and sugars, and by increasing the intake of dietary fiber. Medications may be taken, along with a suitable diet, to reduce appetite or decrease fat absorption. If diet, exercise, and medication are not effective, a gastric balloon or surgery may be performed to reduce stomach volume or bowel length, leading to feeling full earlier or a reduced ability to absorb nutrients from food. Obesity is a leading preventable cause of death worldwide, with increasing rates in adults and children. In 2014, 600 million adults (13%) and 42 million children under the age of five were obese. Obesity is more common in women than men. Authorities view it as one of the most serious public health problems of the 21st century. Obesity is stigmatized in much of the modern world (particularly in the Western world), though it was seen as a symbol of wealth and fertility at other times in history and still is in some parts of the world. In 2013, the American Medical Association classified obesity as a disease.','http://commons.wikimedia.org/wiki/Special:FilePath/Obesity-waist_circumference.svg?width=300','http://dbpedia.org/resource/Obesity','2018-05-17 22:46:19','2018-05-17 22:46:19'),(38,'Pneumonia',52135,739440823,'DOID_552','Pneumonia is an inflammatory condition of the lung affecting primarily the microscopic air sacs known as alveoli. Typical signs and symptoms include a varying severity and combination of productive or dry cough, chest pain, fever, and trouble breathing, depending on the underlying cause. Pneumonia is usually caused by infection with viruses or bacteria and less commonly by other microorganisms, certain medications and conditions such as autoimmune diseases. Risk factors include other lung diseases such as cystic fibrosis, COPD, and asthma, diabetes, heart failure, a history of smoking, a poor ability to cough such as following a stroke, or a weak immune system. Diagnosis is often based on the symptoms and physical examination. Chest X-ray, blood tests, and culture of the sputum may help confirm the diagnosis. The disease may be classified by where it was acquired with community, hospital, or health care associated pneumonia. Vaccines to prevent certain types of pneumonia are available. Other methods of prevention include handwashing and not smoking. Treatment depends on the underlying cause. Pneumonia believed to be due to bacteria is treated with antibiotics. If the pneumonia is severe, the affected person is generally hospitalized. Oxygen therapy may be used if oxygen levels are low. Pneumonia affects approximately 450 million people globally (7% of the population) and results in about 4 million deaths per year. Pneumonia was regarded by William Osler in the 19th century as \"the captain of the men of death\". With the introduction of antibiotics and vaccines in the 20th century survival improved. Nevertheless, in developing countries, and among the very old, the very young, and the chronically ill, pneumonia remains a leading cause of death. Pneumonia often shortens suffering among those already close to death and has thus been called \"the old man\'s friend\".','http://commons.wikimedia.org/wiki/Special:FilePath/PneumonisWedge09.JPG?width=300','http://dbpedia.org/resource/Pneumonia','2018-05-17 22:46:19','2018-05-17 22:46:19'),(39,'Polycystic ovary syndrome',54301,734695372,'DOID_11612','Polycystic ovary syndrome (PCOS) is a set of symptoms due to elevated androgens (male hormones) in women. Signs and symptoms of PCOS include irregular or no menstrual periods, heavy periods, excess body and facial hair, acne, pelvic pain, difficulty getting pregnant, and patches of thick, darker, velvety skin. Associated conditions include type 2 diabetes, obesity, obstructive sleep apnea, heart disease, mood disorders, and endometrial cancer. PCOS is due to a combination of genetic and environmental factors. Risk factors include obesity, not enough physical exercise, and a family history of someone with the condition. Diagnosis is based on two of the following three findings: no ovulation, high androgen levels, and ovarian cysts. Cysts may be detectable by ultrasound. Other conditions that produce similar symptoms include adrenal hyperplasia, hypothyroidism, and hyperprolactinemia. PCOS has no cure. Treatment may involve lifestyle changes such as weight loss and exercise. Birth control pills may help with improving the regularity of periods, excess hair growth, and acne. Metformin and anti-androgens may also help. Other typical acne treatments and hair removal techniques may be used. Efforts to improve fertility include weight loss, clomiphene, or metformin. In vitro fertilization is used by some in whom other measures are not effective. PCOS is the most common endocrine disorder among women between the ages of 18 and 44. It affects approximately 2% to 20% of this age group depending on how it is defined. It is one of the leading causes of poor fertility. The earliest known description of what is now recognized as PCOS dates from 1721 in Italy.','http://commons.wikimedia.org/wiki/Special:FilePath/PCOS.jpg?width=300','http://dbpedia.org/resource/Polycystic_ovary_syndrome','2018-05-17 22:46:19','2018-05-17 22:46:19'),(40,'Prader–Willi syndrome',54996,744345149,'DOID_11983','Prader–Willi syndrome (PWS) is a genetic disorder due to loss of function of specific genes on chromosome 15. In newborns symptoms include weak muscles, poor feeding, and slow development. In childhood the person becomes constantly hungry which often leads to obesity and type 2 diabetes. There is also typically mild to moderate intellectual impairment and behavioral problems. Often the forehead is narrow, hands and feet small, height short, skin light in color, and they are unable to have children. About 70% of cases occur when part of the father\'s chromosome 15 is deleted. In another 25% of cases the person has two copies of chromosome 15 from their mother and none from their father. As parts of the chromosome from the mother\'s is turned off they end up with no working copies of certain genes. PWS is not generally inherited but instead the genetic changes happen during the formation of the egg, sperm, or in early development. There are no known risk factors. Those who have one child with PWS have less than a 1% chance of the next child being affected. A similar mechanism occurs in Angelman syndrome except there is a defective chromosome 15 from the mother or two copies from the father. Prader–Willi syndrome has no cure. Treatment, however, may improve outcomes, especially if carried out early. In newborns feeding difficulties may be supported with feeding tubes. Strike food supervision is typically required starting around the age of three in combination with an exercise program. Growth hormone therapy also improves outcomes. Counseling and medications may help with some behavioral problems. Group homes are often necessary in adulthood. PWS affects between 1 in 10,000 and 1 in 30,000 people. Males and females are affected equally. The condition is named after Andrea Prader, Heinrich Willi, and Alexis Labhart who described it in detail in 1956. An earlier description occurred in 1887 by John Langdon Down.','http://commons.wikimedia.org/wiki/Special:FilePath/PWS8.png?width=300','http://dbpedia.org/resource/Prader–Willi_syndrome','2018-05-17 22:46:19','2018-05-17 22:46:19'),(41,'Prostatitis',55922,745210809,'DOID_14654','Prostatitis (less commonly prostatosis) is inflammation of the prostate gland. Prostatitis is classified into acute, chronic, asymptomatic inflammatory prostatitis, and chronic pelvic pain syndrome. In the United States, prostatitis is diagnosed in 8 percent of all urologist visits and 1 percent of all primary care physician visits.','http://commons.wikimedia.org/wiki/Special:FilePath/Inflammation_of_prostate.jpg?width=300','http://dbpedia.org/resource/Prostatitis','2018-05-17 22:46:19','2018-05-17 22:46:19'),(42,'Q fever',56480,739922733,'DOID_11100','Q Fever is a disease caused by infection with Coxiella burnetii, a bacterium that affects humans and other animals. This organism is uncommon, but may be found in cattle, sheep, goats, and other domestic mammals, including cats and dogs. The infection results from inhalation of a spore-like small-cell variant, and from contact with the milk, urine, feces, vaginal mucus, or semen of infected animals. Rarely, the disease is tick-borne. The incubation period is 9–40 days. Humans are vulnerable to Q Fever, and infection can result from even a few organisms. The bacterium is an obligate intracellular pathogenic parasite.','http://commons.wikimedia.org/wiki/Special:FilePath/Immunohistochemical_detection_of_Coxiella_burnetii_in_resected_cardiac_valve_of_a_60-year-old_man_with_Q_fever_endocarditis.jpg?width=300','http://dbpedia.org/resource/Q_fever','2018-05-17 22:46:19','2018-05-17 22:46:19'),(43,'Scabies',28848,744889009,'DOID_8295','Scabies, known as the seven-year itch, is a contagious skin infestation by the mite Sarcoptes scabiei. The most common symptoms are severe itchiness and a pimple-like rash. Occasionally tiny burrows may be seen in the skin. When first infected, usually two to six weeks are required before symptoms occur. If a person develops a second infection later in life, symptoms may begin within a day. These symptoms can be present across most of the body or just certain areas such as the wrists, between fingers, or along the waistline. The head may be affected, but this is typically only in young children. The itch is often worse at night. Scratching may cause skin breakdown and an additional bacterial infection of the skin. Scabies is caused by infection with the female mite Sarcoptes scabiei. The mites burrow into the skin to live and deposit eggs. The symptoms of scabies are due to an allergic reaction to the mites. Often only between ten and fifteen mites are involved in an infection. Scabies is most often spread during a relatively long period of direct skin contact with an infected person such as that which may occur during sex. Spread of disease may occur even if the person has not developed symptoms yet. Crowded living conditions such as those found in child care facilities, group homes, and prisons increase the risk of spread. Areas with a lack of access to water also have higher rates of disease. Crusted scabies is a more severe form of the disease. It typically only occurs in those with a poor immune system and people may have millions of mites, making them much more contagious. In these cases spread of infection may occur during brief contact or via contaminated objects. The mite is very small and usually not directly visible. Diagnosis is based on the signs and symptoms. A number of medications are available to treat those infected, including permethrin, crotamiton and lindane creams and ivermectin pills. Sexual contacts within the last month and people who live in the same house should also be treated at the same time. Bedding and clothing used in the last three days should be washed in hot water and dried in a hot dryer. As the mite does not live for more than three days away from human skin more washing is not needed. Symptoms may continue for two to four weeks following treatment. If after this time there continue to be symptoms retreatment may be needed. Scabies is one of the three most common skin disorders in children, along with ringworm and bacterial skin infections. As of 2010 it affects approximately 100 million people (1.5% of the world population) and is equally common in both sexes. The young and the old are more commonly affected. It also occurs more commonly in the developing world and tropical climates. The word scabies is from Latin: scabere, \"to scratch\". Other animals do not spread human scabies. Infection in other animals is typically caused by slightly different but related mites and is known as sarcoptic mange.','http://commons.wikimedia.org/wiki/Special:FilePath/Sarcoptes_scabei_2.jpg?width=300','http://dbpedia.org/resource/Scabies','2018-05-17 22:46:19','2018-05-17 22:46:19'),(44,'Sleep disorder',46966,742196223,'DOID_535','A sleep disorder, or somnipathy, is a medical disorder of the sleep patterns of a person or animal. Some sleep disorders are serious enough to interfere with normal physical, mental, social and emotional functioning. Polysomnography and actigraphy are tests commonly ordered for some sleep disorders. Disruptions in sleep can be caused by a variety of issues, from teeth grinding (bruxism) to night terrors. When a person suffers from difficulty falling asleep and/or staying asleep with no obvious cause, it is referred to as insomnia. Sleep disorders are broadly classified into dyssomnias, parasomnias, circadian rhythm sleep disorders involving the timing of sleep, and other disorders including ones caused by medical or psychological conditions and sleeping sickness. Some common sleep disorders include sleep apnea (stops in breathing during sleep), narcolepsy and hypersomnia (excessive sleepiness at inappropriate times), cataplexy (sudden and transient loss of muscle tone while awake), and sleeping sickness (disruption of sleep cycle due to infection). Other disorders include sleepwalking, night terrors and bed wetting. Management of sleep disturbances that are secondary to mental, medical, or substance abuse disorders should focus on the underlying conditions.','http://commons.wikimedia.org/wiki/Special:FilePath/Pediatric_polysomnogram.jpg?width=300','http://dbpedia.org/resource/Sleep_disorder','2018-05-17 22:46:19','2018-05-17 22:46:19'),(45,'Stevens–Johnson syndrome',28649,745245834,'DOID_0050426','Stevens–Johnson syndrome, a form of toxic epidermal necrolysis, is a life-threatening skin condition, in which cell death causes the epidermis to separate from the dermis. The syndrome is thought to be a hypersensitivity complex that affects the skin and the mucous membranes. The best known causes are certain medications (such as lamotrigine), but it can also be due to infections, or more rarely, cancers.','http://commons.wikimedia.org/wiki/Special:FilePath/Stevens-johnson-syndrome.jpg?width=300','http://dbpedia.org/resource/Stevens–Johnson_syndrome','2018-05-17 22:46:19','2018-05-17 22:46:19'),(46,'Syphilis',28852,744845970,'DOID_4166','Syphilis is a sexually transmitted infection caused by the bacterium Treponema pallidum subspecies pallidum. The signs and symptoms of syphilis vary depending in which of the four stages it presents (primary, secondary, latent, and tertiary). The primary stage classically presents with a single chancre (a firm, painless, non-itchy skin ulceration) but there may be multiple sores. In secondary syphilis a diffuse rash occurs, which frequently involves the palms of the hands and soles of the feet. There may also be sores in the mouth or vagina. In latent syphilis, which can last for years, there are little to no symptoms. In tertiary syphilis there are gummas (soft non-cancerous growths), neurological, or heart symptoms. Syphilis has been known as \"the great imitator\" as it may cause symptoms similar to many other diseases. Syphilis is most commonly spread through sexual activity. It may also be transmitted from mother to baby during pregnancy or at birth, resulting in congenital syphilis. Other human diseases caused by related Treponema pallidum subspecies include yaws (subspecies pertenue), pinta (subspecies carateum), and bejel (subspecies endemicum). Diagnosis is usually made by using blood tests; the bacteria can also be detected using dark field microscopy. The Center for Disease Control recommends all pregnant women be tested. The risk of syphilis can be decreased by latex condom use, or not having sex. Syphilis can be effectively treated with antibiotics. The preferred antibiotic for most cases is benzathine penicillin G injected into a muscle. In those who have a severe penicillin allergy, doxycycline or tetracycline may be used. In those with neurosyphilis, intravenous penicillin G potassium or ceftriaxone is recommended. During treatment people may develop fever, headache, and muscle pains, a reaction known as Jarisch-Herxheimer. In 2012 about 0.5% of adults were infected with syphilis with 6 million new cases. During 2010 it caused about 113,000 deaths, down from 202,000 in 1990. After decreasing dramatically with the availability of penicillin in the 1940s, rates of infection have increased since the turn of the millennium in many countries, often in combination with human immunodeficiency virus (HIV). This is believed to be partly due to increased promiscuity, prostitution, decreasing use of condoms, and unsafe sexual practices among men who have sex with men. In 2015, Cuba became the first country in the world to eliminate mother-to-child transmission of syphilis.','http://commons.wikimedia.org/wiki/Special:FilePath/Treponema_pallidum.jpg?width=300','http://dbpedia.org/resource/Syphilis','2018-05-17 22:46:19','2018-05-17 22:46:19'),(47,'Syringomyelia',29666,729256408,'DOID_327','Syringomyelia (/sᵻˌrɪŋɡəmaɪˈiːliə, -ɡoʊ-/) is a generic term referring to a disorder in which a cyst or cavity forms within the spinal cord. This cyst, called a syrinx, can expand and elongate over time, destroying the spinal cord. The damage may result in pain, paralysis, weakness, and stiffness in the back, shoulders, and extremities. Syringomyelia may also cause a loss of the ability to feel extremes of hot or cold, especially in the hands. There is also a disorder that generally leads to a cape-like pain (extreme pain, pressure, and many other painful symptoms in the area where a cape would be) and temperature sensation along the back and arms. Each patient experiences a different combination of symptoms. These symptoms typically vary depending on the extent and, often more critically, to the location of the syrinx within the spinal cord. Syringomyelia has a prevalence estimated at 8.4 cases per 100,000 people, with symptoms usually beginning in young adulthood. Signs of the disorder tend to develop slowly, although sudden onset may occur with coughing, straining, or myelopathy.','http://commons.wikimedia.org/wiki/Special:FilePath/Syringomyelia.jpg?width=300','http://dbpedia.org/resource/Syringomyelia','2018-05-17 22:46:19','2018-05-17 22:46:19'),(48,'Tay–Sachs disease',56481,743556221,'DOID_3320','Tay–Sachs disease (also known as GM2 gangliosidosis or hexosaminidase A deficiency) is a rare autosomal recessive genetic disorder. In its most common variant (known as infantile Tay–Sachs disease), it causes a progressive deterioration of nerve cells and of mental and physical abilities that begins around 7 months of age and usually results in death by the age of four. The disease occurs when harmful quantities of cell membrane components known as gangliosides accumulate in the brain\'s nerve cells, eventually leading to the premature death of the cells. A ganglioside is a form of sphingolipid, which makes Tay–Sachs disease a member of the sphingolipidoses. There is no known cure or treatment. The disease is named after the British ophthalmologist Waren Tay, who in 1881 first described a symptomatic red spot on the retina of the eye; and after the American neurologist Bernard Sachs of Mount Sinai Hospital, who described in 1887 the cellular changes of Tay–Sachs disease and noted an increased disease prevalence in Ashkenazi Jews. Research in the late 20th century demonstrated that Tay–Sachs disease is caused by a genetic mutation in the HEXA gene on chromosome 15. A large number of HEXA mutations have been discovered, and new ones are still being reported. These mutations reach significant frequencies in specific populations. French Canadians of southeastern Quebec have a carrier frequency similar to that seen in Ashkenazi Jews, but carry a different mutation. Cajuns of southern Louisiana carry the same mutation that is seen most commonly in Ashkenazi Jews. HEXA mutations are rare and are most seen in genetically isolated populations. Tay–Sachs can occur from the inheritance of either two similar, or two unrelated, causative mutations in the HEXA gene. As an autosomal recessive disorder, two Tay–Sachs alleles are required for an individual to exhibit symptoms of the disease. Carriers of a single Tay–Sachs allele do not exhibit symptoms of the disease but appear to be protected to some extent against tuberculosis. This accounts for the persistence of the allele in certain populations in that it confers a selective advantage—in other words, being a heterozygote is advantageous.','http://commons.wikimedia.org/wiki/Special:FilePath/Tay-sachsUMich.jpg?width=300','http://dbpedia.org/resource/Tay–Sachs_disease','2018-05-17 22:46:19','2018-05-17 22:46:19'),(49,'Tetanus',45831,738485422,'DOID_11338','Tetanus, also known as lockjaw, is an infection characterized by muscle spasms. In the most common type, the spasms begin in the jaw and then progress to the rest of the body. These spasms usually last a few minutes each time and occur frequently for three to four weeks. Spasms may be so severe that bone fractures may occur. Other symptoms may include fever, sweating, headache, trouble swallowing, high blood pressure, and a fast heart rate. Onset of symptoms is typically three to twenty-one days following infection. It may take months to recover. About 10% of those infected die. Tetanus is caused by an infection with the bacterium Clostridium tetani, which is commonly found in soil, dust and manure. The bacteria generally enter through a break in the skin such as a cut or puncture wound by a contaminated object. They produce toxins that interfere with muscle contractions, resulting in the typical symptoms. Diagnosis is based on the presenting signs and symptoms. The disease does not spread between people. Infection can be prevented by proper immunization with the tetanus vaccine. In those who have a significant wound and less than three doses of the vaccine both immunization and tetanus immune globulin are recommended. In those who are infected tetanus immune globulin or, if it is not available, intravenous immunoglobulin (IVIG) is used. The wound should be cleaned and any dead tissue should be removed. Muscle relaxants may be used to control spasms. Mechanical ventilation may be required if a person\'s breathing is affected. Tetanus occurs in all parts of the world but is most frequent in hot and wet climates where the soil contains a lot of organic matter. In 2013 it caused about 59,000 deaths – down from 356,000 in 1990. Description of the disease by Hippocrates exists from at least as far back as the 5th century BC. The cause of the disease was determined in 1884 by Antonio Carle and Giorgio Rattone at the University of Turin, with a vaccine being developed in 1924.','http://commons.wikimedia.org/wiki/Special:FilePath/Opisthotonus_in_a_patient_suffering_from_tetanus_-_Painting_by_Sir_Charles_Bell_-_1809.jpg?width=300','http://dbpedia.org/resource/Tetanus','2018-05-17 22:46:19','2018-05-17 22:46:19');
