ef_src=twsrc%5Etfw\">#NutsAboutMylk</a> <a href=\"https://t.co/Jbdu5v9cu9\">pic.twitter.com/Jbdu5v9cu9</a></p>&mdash; organicmylk (@organicmylk) <a href=\"https://twitter.com/organicmylk/status/995315116844478464?ref_src=twsrc%5Etfw\">May 12, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(39,4,'https://twitter.com/ebicrab_allergy/status/995701384421851136','NULL','995701384421851136','かに','ebicrab_allergy',0,0,0,0,'Unknown','<blockquote class=\"twitter-tweet\"><p lang=\"ja\" dir=\"ltr\">商売とビジネスに違う意味を込めたり、目的と目標を使い分けてみたり。一部でまかり通る言葉遣いは、その他大勢には通じないことは、時々意識してもいいんじゃないかな。同時に、通じないことは聞き手側だけの責任じゃないってことも。</p>&mdash; かに (@ebicrab_allergy) <a href=\"https://twitter.com/ebicrab_allergy/status/995701384421851136?ref_src=twsrc%5Etfw\">May 13, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(40,4,'https://twitter.com/lelemariee23/status/995701286258475008','NULL','995701286258475008','L ?','lelemariee23',0,0,0,0,'Plainfield, IN','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">My mom just asked if i needed allergy medicine before we go to these baseball games, i replied with I’m good. Then i sneezed for like 5 mins. A mother ALWAYS knows best ???</p>&mdash; L ? (@lelemariee23) <a href=\"https://twitter.com/lelemariee23/status/995701286258475008?ref_src=twsrc%5Etfw\">May 13, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(41,5,'https://twitter.com/iamjessicagrant/status/995648716852858881','NULL','995648716852858881','Jessica Grant','iamjessicagrant',0,0,0,2,'The Great and Glorious City','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">4) intersex people can have a range of chromosome types.  Xy, xx, xxy, xxxxxxxx, xo and so forth, however it isn&#39;t always chromosomes that make you intersex.  You may appear female, with a vagina and have XY chromosomes &amp; internal testes ( as with Androgen Insensitivity Syndrome)</p>&mdash; Delaney King, suddenly, (@delaneykingrox) <a href=\"https://twitter.com/delaneykingrox/status/995570480189919232?ref_src=twsrc%5Etfw\">May 13, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(42,5,'https://twitter.com/Calmide_Bulf/status/995639040039940097','NULL','995639040039940097','Calmide Bulf @ AC2018','Calmide_Bulf',1,0,0,0,'Unknown','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">This ties in with what I&#39;ve learned so far. From what I know, certain DSDs have a significant impact on gender identity. In complete Androgen Insensitivity Syndrome, a person with an XY genotype looks and feels like a woman. There was never an expectation to be male as a child.</p>&mdash; Calmide Bulf @ AC2018 (@Calmide_Bulf) <a href=\"https://twitter.com/Calmide_Bulf/status/995639040039940097?ref_src=twsrc%5Etfw\">May 13, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(43,5,'https://twitter.com/NoToMisogyny/status/995637960849674241','NULL','995637960849674241','WomanIsBiology','NoToMisogyny',0,0,0,1,'Unknown','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">There is no spectrum ... There is female and male. Even the two classic Intersex conditions are specific to the female and male.<br>Congenital Adrenal Hyperplasia affects females.<br>Complete Androgen Insensitivity Syndrome affects males.</p>&mdash; Jacky Holyoake (@JackyHolyoake) <a href=\"https://twitter.com/JackyHolyoake/status/995635268559532032?ref_src=twsrc%5Etfw\">May 13, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(44,5,'https://twitter.com/JackyHolyoake/status/995635268559532032','NULL','995635268559532032','Jacky Holyoake','JackyHolyoake',4,0,0,1,'England, UK','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">There is no spectrum ... There is female and male. Even the two classic Intersex conditions are specific to the female and male.<br>Congenital Adrenal Hyperplasia affects females.<br>Complete Androgen Insensitivity Syndrome affects males.</p>&mdash; Jacky Holyoake (@JackyHolyoake) <a href=\"https://twitter.com/JackyHolyoake/status/995635268559532032?ref_src=twsrc%5Etfw\">May 13, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(45,5,'https://twitter.com/InThePinkBloc/status/995622014298869760','NULL','995622014298869760','A Queer Anarchist','InThePinkBloc',0,0,0,2,'United Kingdom','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">4) intersex people can have a range of chromosome types.  Xy, xx, xxy, xxxxxxxx, xo and so forth, however it isn&#39;t always chromosomes that make you intersex.  You may appear female, with a vagina and have XY chromosomes &amp; internal testes ( as with Androgen Insensitivity Syndrome)</p>&mdash; Delaney King, suddenly, (@delaneykingrox) <a href=\"https://twitter.com/delaneykingrox/status/995570480189919232?ref_src=twsrc%5Etfw\">May 13, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(46,5,'https://twitter.com/alines7777/status/995589766027493377','NULL','995589766027493377','alines#7777 ☭?Ⓐ','alines7777',0,0,0,0,'Unknown','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">we call that &#39;aromatization&#39;.<br>god knows i grew up with exceedingly high testosterone, and as a result, i get hit on by cishet men.<br>they say that excessive testosterone coupled with overtly feminine aspects is reflective of androgen insensitivity syndrome.<br>really makes you think</p>&mdash; alines#7777 ☭?Ⓐ (@alines7777) <a href=\"https://twitter.com/alines7777/status/995589766027493377?ref_src=twsrc%5Etfw\">May 13, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(47,5,'https://twitter.com/delaneykingrox/status/995570480189919232','NULL','995570480189919232','Delaney King, suddenly,','delaneykingrox',75,0,0,2,'Melbourne, Victoria','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">4) intersex people can have a range of chromosome types.  Xy, xx, xxy, xxxxxxxx, xo and so forth, however it isn&#39;t always chromosomes that make you intersex.  You may appear female, with a vagina and have XY chromosomes &amp; internal testes ( as with Androgen Insensitivity Syndrome)</p>&mdash; Delaney King, suddenly, (@delaneykingrox) <a href=\"https://twitter.com/delaneykingrox/status/995570480189919232?ref_src=twsrc%5Etfw\">May 13, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(48,5,'https://twitter.com/LL924/status/995557245621485568','NULL','995557245621485568','Lance Lund','LL924',0,0,0,0,'Oakland, CA','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">21/ Prenatal Testosterone (PT):<br>1.) Androgen Insensitivity Syndrome: cells xy (male sex chromosome) genotype but cannot respond to PT due to T receptor mutation; body/brain anatomy develops mostly female (infertile), gender identity &amp; orientation usually heterosexual female.</p>&mdash; Lance Lund (@LL924) <a href=\"https://twitter.com/LL924/status/995557245621485568?ref_src=twsrc%5Etfw\">May 13, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(49,5,'https://twitter.com/drcindy1701/status/994759732710830082','NULL','994759732710830082','Cindy Pearman','drcindy1701',0,0,0,0,'near the Smokies','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Look up androgen insensitivity syndrome. Just because you haven’t seen it doesn’t mean it doesn’t exist.</p>&mdash; Cindy Pearman (@drcindy1701) <a href=\"https://twitter.com/drcindy1701/status/994759732710830082?ref_src=twsrc%5Etfw\">May 11, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-11 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(50,5,'https://twitter.com/Souldiva72/status/994593882406117377','NULL','994593882406117377','ọkàn Ife Wakanda~Dora Milaje?✍?☕️♉️','Souldiva72',0,0,0,8,'Unknown','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">In addition to increasing women&#39;s reproductive health autonomy, birth control pills treat conditions like ovarian cysts and support people with androgen insensitivity syndrome to develop.</p>&mdash; Ro Khanna (@RoKhanna) <a href=\"https://twitter.com/RoKhanna/status/994251689736712192?ref_src=twsrc%5Etfw\">May 9, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-10 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(51,6,'https://twitter.com/kelseydarragh/status/995045375420567552','NULL','995045375420567552','kelsey darragh','kelseydarragh',16400,0,0,5214,'hollywood, CA','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">I have panic &amp; anxiety disorder. My boyfriend does not... but wants to understand it so he can h