6201899009?ref_src=twsrc%5Etfw\">May 9, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-09 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(112,12,'https://twitter.com/matt_lamb11/status/995736059488153602','NULL','995736059488153602','Matt Lamb','matt_lamb11',0,0,0,93,'Michigan, USA','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Big credit to David Price today for overcoming his carpal tunnel syndrome, just three days after having to miss a start, and handling the Jays. Not all heroes wear capes</p>&mdash; Eric Hubbs (@BarstoolHubbs) <a href=\"https://twitter.com/BarstoolHubbs/status/995443725710000129?ref_src=twsrc%5Etfw\">May 12, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(113,12,'https://twitter.com/PANEcakes_/status/995735113299349504','NULL','995735113299349504','Kyle Pane','PANEcakes_',0,0,0,93,'Omaha, NE','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Big credit to David Price today for overcoming his carpal tunnel syndrome, just three days after having to miss a start, and handling the Jays. Not all heroes wear capes</p>&mdash; Eric Hubbs (@BarstoolHubbs) <a href=\"https://twitter.com/BarstoolHubbs/status/995443725710000129?ref_src=twsrc%5Etfw\">May 12, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(114,12,'https://twitter.com/ZenBaseball/status/995734733836337152','NULL','995734733836337152','Zen Baseball','ZenBaseball',0,0,0,0,'The Cathedral in the Bronx','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Red Sox pitcher David Price dealing with carpal tunnel syndrome <a href=\"https://t.co/tkfqivv6iI\">https://t.co/tkfqivv6iI</a></p>&mdash; Zen Baseball