tf-8\"></script>\n','2018-05-11 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(157,16,'https://twitter.com/Grantshire/status/994982016360775680','NULL','994982016360775680','Sharon Grant','Grantshire',0,0,0,1,'London','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">New fact of the day for me: Edward Jenner’s connection to smallpox vaccination in Canada. He sent cowpox vaccine there in 1798 &amp; 1st vaccination of First Nations people took place in 1803.</p>&mdash; Sylvia Valentine (@Historylady2013) <a href=\"https://twitter.com/Historylady2013/status/994888386149314567?ref_src=twsrc%5Etfw\">May 11, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-11 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(158,16,'https://twitter.com/ExplorationBlog/status/994915390429040640','NULL','994915390429040640','Michael Robinson','ExplorationBlog',2,0,0,0,'Unknown','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">This is wild: &quot;Physicians switched to arm-to-arm vaccination, which involved scraping fluid from the cowpox lesion of one patient and applying it to an incision in the arm of another patient, leaving physicians reliant on their patients’ bodies to store their vaccine supply.&quot;</p>&mdash; Michael Robinson (@ExplorationBlog) <a href=\"https://twitter.com/ExplorationBlog/status/994915390429040640?ref_src=twsrc%5Etfw\">May 11, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-11 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(159,17,'https://twitter.com/terrimbutler/status/995089375590412290','NULL','995089375590412290','Terri Butler MP','terrimbutler',811,0,0,296,'Brisbane, Qld','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Shout out to every nurse &amp; every midwife who has looked after me. Thanks also to those who cared for my family in hospitals, at home, and in aged care as they went through cancer, dementia, stroke, arthritis &amp; DVT. <br><br>It’s International Nurses Day. Where would we be without them?</p>&mdash; Terri Butler MP (@terrimbutler) <a href=\"https://twitter.com/terrimbutler/status/995089375590412290?ref_src=twsrc%5Etfw\">May 11, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-11 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(160,17,'https://twitter.com/nytimes/status/995612139757981696','NULL','995612139757981696','The New York Times','nytimes',221,0,0,118,'New York City','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">With the world&#39;s oldest population, and regular reports of fatal car crashes tied to dementia, Japanese authorities are trying to ease older drivers off the road. But drivers in their 80s and 90s are resisting. <a href=\"https://t.co/G9Diujlpc6\">https://t.co/G9Diujlpc6</a></p>&mdash; The New York Times (@nytimes) <a href=\"https://twitter.com/nytimes/status/995612139757981696?ref_src=twsrc%5Etfw\">May 13, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(161,17,'https://twitter.com/WebMD/status/995371254357151745','NULL','995371254357151745','WebMD','WebMD',188,0,0,122,'USA','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Studies show that if you sit too much, your brain could look just like that of someone with dementia -- it also raises your risk for heart disease and high cholesterol. <a href=\"https://t.co/Ivk0dkvD3Y\">https://t.co/Ivk0dkvD3Y</a> <a href=\"https://t.co/JtmVMq5Jxe\">pic.twitter.com/JtmVMq5Jxe</a></p>&mdash; WebMD (@WebMD) <a href=\"https://twitter.com/WebMD/status/995371254357151745?ref_src=twsrc%5Etfw\">May 12, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" ch