ry of her life before the age of 16. Then, a tragedy triggered a cataclysmic psychological change. Suddenly she was aware of other identities inside her. <a href=\"https://t.co/XZbSUryGvV\">https://t.co/XZbSUryGvV</a> <br>Now on PODCAST ? <a href=\"https://twitter.com/ApplePodcasts?ref_src=twsrc%5Etfw\">@ApplePodcasts</a> <a href=\"https://twitter.com/Spotify?ref_src=twsrc%5Etfw\">@Spotify</a> <a href=\"https://twitter.com/SoundCloud?ref_src=twsrc%5Etfw\">@SoundCloud</a> &amp; RSS <a href=\"https://t.co/PQIExPQ5Ic\">pic.twitter.com/PQIExPQ5Ic</a></p>&mdash; Mosaic (@mosaicscience) <a href=\"https://twitter.com/mosaicscience/status/995734448162340864?ref_src=twsrc%5Etfw\">May 13, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(229,24,'https://twitter.com/mosaicscience/status/995734448162340864','NULL','995734448162340864','Mosaic','mosaicscience',0,0,0,1,'London, UK','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Until she was 40, Melanie had no memory of her life before the age of 16. Then, a tragedy triggered a cataclysmic psychological change. Suddenly she was aware of other identities inside her. <a href=\"https://t.co/XZbSUryGvV\">https://t.co/XZbSUryGvV</a> <br>Now on PODCAST ? <a href=\"https://twitter.com/ApplePodcasts?ref_src=twsrc%5Etfw\">@ApplePodcasts</a> <a href=\"https://twitter.com/Spotify?ref_src=twsrc%5Etfw\">@Spotify</a> <a href=\"https://twitter.com/SoundCloud?ref_src=twsrc%5Etfw\">@SoundCloud</a> &amp; RSS <a href=\"https://t.co/PQIExPQ5Ic\">pic.twitter.com/PQIExPQ5Ic</a></p>&mdash; Mosaic (@mosaicscience) <a href=\"https://twitter.com/mosaicscience/status/995734448162340864?ref_src=twsrc%5Etfw\">May 13, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(230,24,'http