ttps://twitter.com/lennyletter?ref_src=twsrc%5Etfw\">@lennyletter</a> story documenting the incredibly talented georgie wileman&#39;s photography series on endometriosis—the crippling, &quot;invisible&quot; disease that one in 10 women and trans men endure.  <a href=\"https://t.co/NL5IHF93tS\">https://t.co/NL5IHF93tS</a></p>&mdash; Leah Fessler (@LeahFessler) <a href=\"https://twitter.com/LeahFessler/status/993870880127246338?ref_src=twsrc%5Etfw\">May 8, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-08 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(259,27,'https://twitter.com/Endometriosis11/status/995740988202201089','NULL','995740988202201089','Endometriosis Cure','Endometriosis11',0,0,0,0,'Los Angeles','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Despite similarities in their name and location, <a href=\"https://twitter.com/hashtag/endometriosis?src=hash&amp;ref_src=twsrc%5Etfw\">#endometriosis</a> bears no relationship to endometrial cancer.</p>&mdash; Endometriosis Cure (@Endometriosis11) <a href=\"https://twitter.com/Endometriosis11/status/995740988202201089?ref_src=twsrc%5Etfw\">May 13, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(260,27,'https://twitter.com/lennyletter/status/995740596777177088','NULL','995740596777177088','Lenny','lennyletter',0,0,0,0,'Everywhere','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">&quot;There is a continual breach of your body and boundaries in each appointment and operation, a gradual sense of detachment from the skin you live in.&quot; Georgie Wileman documents her life with endometriosis. <a href=\"https://t.co/Xz2xFw5qfB\">https://t.co/Xz2xFw5qfB</a></p>&mdash; Lenny (@lennyletter) <a href=\"https://twitter.com/lennyletter/status/995740596777177088?ref_src=twsrc%5Etfw\">May 13, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(261,27,'https://twitter.com/ChronicallyTS/status/995740477004697602','NULL','995740477004697602','ChronicallyTeresa','ChronicallyTS',0,0,0,0,'Oregon, USA','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Check out my experience having endometriosis  <a href=\"https://twitter.com/hashtag/youtube?src=hash&amp;ref_src=twsrc%5Etfw\">#youtube</a> <a href=\"https://twitter.com/hashtag/smallyoutuber?src=hash&amp;ref_src=twsrc%5Etfw\">#smallyoutuber</a> <a href=\"https://twitter.com/hashtag/endometriosis?src=hash&amp;ref_src=twsrc%5Etfw\">#endometriosis</a> <a href=\"https://twitter.com/hashtag/newvideo?src=hash&amp;ref_src=twsrc%5Etfw\">#newvideo</a> <a href=\"https://twitter.com/hashtag/spoonie?src=hash&amp;ref_src=twsrc%5Etfw\">#spoonie</a>... <a href=\"https://t.co/560iOp0wJF\">https://t.co/560iOp0wJF</a></p>&mdash; ChronicallyTeresa (@ChronicallyTS) <a href=\"https://twitter.com/ChronicallyTS/status/995740477004697602?ref_src=twsrc%5Etfw\">May 13, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(262,27,'https://twitter.com/SofVersailles/status/995737886983995392','NULL','995737886983995392','Servant of Versailles','SofVersailles',0,0,0,0,'Unknown','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">6. Scientific theroies should predict what must be false<br><br>If <a href=\"https://twitter.com/hashtag/ReflexMenstruation?src=hash&amp;ref_src=twsrc%5Etfw\">#ReflexMenstruation</a> causes <a href=\"https://twitter.com/hashtag/endometriosis?src=hash&amp;ref_src=twsrc%5Etfw\">#endometriosis</a>, a progressive disease, then long term benefits from <a href=\"https://twitter.com/hashtag/excision?src=hash&amp;ref_src=twsrc%5Etfw\">#excision</a> must be rare<br><br>Some expert surgeon have 57% CURE rates<a href=\"https://twitter.com/hashtag/SampsonWasWrong?src=hash&amp;ref_src=twsrc%5Etfw\">#SampsonWasWrong</a><a href=\"https://twitter.com/TheBSGE?ref_src=twsrc%5Etfw\">@TheBSGE</a> <a href=\"https://t.co/ePPe9orNSC\">https://t.co/ePPe9orNSC</a></p>&mdash; Servant of Versailles (@SofVersailles) <a href=\"https://twitter.com/SofVersailles/status/995737886983995392?ref_src=twsrc%5Etfw\">May 13, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(263,27,'https://twitter.com/LetsStimTonight/status/995737083309371392','NULL','995737083309371392','Autistic Sinner','LetsStimTonight',0,0,0,0,'South of 3 bridge-tunnels','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">My gynecologist didn&#39;t request a follow-up when I saw her in March,<br><br>so I&#39;m weirdly not upset that she called to tell me that I need another pap smear. ?<br><br>I had to ask what the plan is since nothing was found on the ultrasound.<br><br>Now we explore the possibility of endometriosis.</p>&mdash; Autistic Sinner (@LetsStimTonight) <a href=\"https://twitter.com/LetsStimTonight/status/995737083309371392?ref_src=twsrc%5Etfw\">May 13, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(264,27,'https://twitter.com/ForWomenUnited/status/995736723438166016','NULL','995736723438166016','Women United','ForWomenUnited',0,0,0,0,'Unknown','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">One of the main Symptoms of Endometriosis is painful period. <br><br>Share to Raise Awareness! <a href=\"https://t.co/Bav0HSemsG\">https://t.co/Bav0HSemsG</a></p>&mdash; Women United (@ForWomenUnited) <a href=\"https://twitter.com/ForWomenUnited/status/995736