ipt async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-13 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(269,28,'https://twitter.com/Ben10563785/status/993393976626458624','NULL','993393976626458624','Uri Ben-Avraham','Ben10563785',0,0,0,1,'Perth','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">One of the most remarkable stories of courage and creative thinking in the face of danger is that of Dr. Eugene Lazowski, who managed to create an entire typhus “epidemic” in order to keep the Nazis at bay: <a href=\"https://t.co/99r76ygiN8\">https://t.co/99r76ygiN8</a></p>&mdash; Museum of the Jewish People (@BeitHatfutsot) <a href=\"https://twitter.com/BeitHatfutsot/status/993267931617341440?ref_src=twsrc%5Etfw\">May 6, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-07 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(270,28,'https://twitter.com/FruitNinja246/status/993305052080197632','NULL','993305052080197632','Tristan R.','FruitNinja246',0,0,0,334,'Texas, USA','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Eugene Lazowski was a Polish doctor who saved 8,000 Jewish people from the Holocaust by faking an epidemic causing Germans to abandon the area. He did this by injecting a person with dead bacteria so they would test positive for typhus without experiencing symptoms. <a href=\"https://t.co/jYPTES06v5\">pic.twitter.com/jYPTES06v5</a></p>&mdash; SERIOUSLY STRANGE (@SeriousStrange) <a href=\"https://twitter.com/SeriousStrange/status/972870147093422080?ref_src=twsrc%5Etfw\">March 11, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-07 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(271,28,'https://twitter.com/BeitHatfutsot/status/993267931617341440','NULL','993267931617341440','Museum of the Jewish People','BeitHatfutsot',3,