</p>&mdash; Uncle Junior (@gdubya5047) <a href=\"https://twitter.com/gdubya5047/status/993121733195509765?ref_src=twsrc%5Etfw\">May 6, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-06 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(274,28,'https://twitter.com/PunishedOracle/status/993089478695759872','NULL','993089478695759872','The Oracle','PunishedOracle',1,0,0,0,'Unknown','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">no, it was typhus which is the biggest killer in the camps<br><br>then you have typhus you dont eat and become emaciated before death<br><br>the typhus epidemic at the end of the war was caused by all the allies bombing the civilian targets causing a shortage of food, medicine &amp; insecticide</p>&mdash; The Oracle (@PunishedOracle) <a href=\"https://twitter.com/PunishedOracle/status/993089478695759872?ref_src=twsrc%5Etfw\">May 6, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-06 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(275,28,'https://twitter.com/gdubya5047/status/993031420422606848','NULL','993031420422606848','Uncle Junior','gdubya5047',0,0,0,0,'United States','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">One is almost never talked about, the other is greatly exaggerated and used as the basis of a myth that advances totalitarianism in the contemporary world. The vast majority of deaths of prisoners in German hands were the result of an uncontroled Typhus epidemic.</p>&mdash; Uncle Junior (@gdubya5047) <a href=\"https://twitter.com/gdubya5047/status/993031420422606848?ref_src=twsrc%5Etfw\">May 6, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-06 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(276,28,'https://twitter.com/GrayConnolly/status/99259557461