414620672','NULL','997082482414620672','BENUE Boy AKOR ?','sunnyukc',0,0,0,37,'Lagos, Nigeria','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Fast forward to 2weeks ago, my parish prayed against the hardship in the land but forgot their choice in 2015 and how I was treated like leprosy patient.</p>&mdash; Sir Ikokwu Chidozie Ikemba?? (@IkeokwuChidozie) <a href=\"https://twitter.com/IkeokwuChidozie/status/996977685992701952?ref_src=twsrc%5Etfw\">May 17, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-17 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(322,33,'https://twitter.com/monicaMedHist/status/997082006512058368','NULL','997082006512058368','Monica H Green','monicaMedHist',0,0,0,0,'Unknown','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Hello James. Excellent question. Nearly all the pathogen <a href=\"https://twitter.com/hashtag/aDNA?src=hash&amp;ref_src=twsrc%5Etfw\">#aDNA</a> that&#39;s been sequenced thus far has only been from Europe. That goes for <a href=\"https://twitter.com/hashtag/plague?src=hash&amp;ref_src=twsrc%5Etfw\">#plague</a>, <a href=\"https://twitter.com/hashtag/leprosy?src=hash&amp;ref_src=twsrc%5Etfw\">#leprosy</a>, <a href=\"https://twitter.com/hashtag/smallpox?src=hash&amp;ref_src=twsrc%5Etfw\">#smallpox</a>, &amp; even the new <a href=\"https://twitter.com/hashtag/HepB?src=hash&amp;ref_src=twsrc%5Etfw\">#HepB</a> sequences. So this bias (a function of archaeological practices) leaves a lot of Qs in dark.</p>&mdash; Monica H Green (@monicaMedHist) <a href=\"https://twitter.com/monicaMedHist/status/997082006512058368?ref_src=twsrc%5Etfw\">May 17, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-17 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(323,33,'https://twitter.com/VIJAY10008/status/997081687636041728','NULL','997081687636041728','VI