der - Willi syndrome, which not only slows development, but by... <a href=\"https://t.co/bOiva2k92m\">https://t.co/bOiva2k92m</a></p>&mdash; Snowdrop (@Snowdrop4BIC) <a href=\"https://twitter.com/Snowdrop4BIC/status/996444830208352264?ref_src=twsrc%5Etfw\">May 15, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-15 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(390,40,'https://twitter.com/ralingh/status/996432717985255429','NULL','996432717985255429','R.A. Alingh','ralingh',0,0,0,2,'Unknown','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">New approved study from <a href=\"https://twitter.com/hashtag/Sweden?src=hash&amp;ref_src=twsrc%5Etfw\">#Sweden</a>. Researchers of <a href=\"https://twitter.com/karolinskainst?ref_src=twsrc%5Etfw\">@karolinskainst</a> will measure hair <a href=\"https://twitter.com/hashtag/cortisol?src=hash&amp;ref_src=twsrc%5Etfw\">#cortisol</a> in adults with Prader-Willi syndrome (PWS) and relate the levels to <a href=\"https://twitter.com/hashtag/BMI?src=hash&amp;ref_src=twsrc%5Etfw\">#BMI</a>, <a href=\"https://twitter.com/hashtag/stress?src=hash&amp;ref_src=twsrc%5Etfw\">#stress</a> and levels in matched controls. The results are expected to improve the <a href=\"https://twitter.com/hashtag/treatment?src=hash&amp;ref_src=twsrc%5Etfw\">#treatment</a> of PWS patients. <a href=\"https://t.co/ZsFoj16zvE\">pic.twitter.com/ZsFoj16zvE</a></p>&mdash; Lifelines (@LifelinesNL) <a href=\"https://twitter.com/LifelinesNL/status/996328123850543104?ref_src=twsrc%5Etfw\">May 15, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-15 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(391,40,'https://twitter.com/trionanic/status/996421090833551360','NULL','996421090833551360','triona nic ruairi','trionanic',0,0,0,0,'Unknown','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"l