shtag/wellness?src=hash&amp;ref_src=twsrc%5Etfw\">#wellness</a> than just getting a good night&#39;s sleep. Having a regular rhythm of being active in daylight and inactive in darkness over time is important for mental well-being. <a href=\"https://t.co/YyEQwiz58p\">https://t.co/YyEQwiz58p</a> <a href=\"https://twitter.com/hashtag/wellnesswednesday?src=hash&amp;ref_src=twsrc%5Etfw\">#wellnesswednesday</a></p>&mdash; AMA (@AmerMedicalAssn) <a href=\"https://twitter.com/AmerMedicalAssn/status/996838948440825861?ref_src=twsrc%5Etfw\">May 16, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-16 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(425,44,'https://twitter.com/SleepApnea123/status/997086882881310720','NULL','997086882881310720','Sleep Apnea 123','SleepApnea123',0,0,0,0,'New York, NY','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Oral Exercises That Are Proven to Cure Sleep Apnea! <a href=\"https://t.co/5FqqJ91EJp\">https://t.co/5FqqJ91EJp</a> Sleep Disorder, Insomnia Cure</p>&mdash; Sleep Apnea 123 (@SleepApnea123) <a href=\"https://twitter.com/SleepApnea123/status/997086882881310720?ref_src=twsrc%5Etfw\">May 17, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-17 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(426,44,'https://twitter.com/xbrettalexander/status/997080618717495296','NULL','997080618717495296','Brett Alexander ?','xbrettalexander',0,0,0,0,'Florida, USA','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Bipolar disorder is far from easy, but it&#39;s more tolerable when you have YouTube and a whole genre of videos to watch your favorite musicians, comedians, and actors all in one place. I hope to give somebody the same gift one day. Goodnight for real now I need to sleep</p>&mdash; Brett Alexander ? (@xbrettalexander) <a href=\"https://twitter.com/xbrettalexander/status/997080618717495296?ref_src=twsrc%5Etfw\">May 17, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-17 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(427,44,'https://twitter.com/imiusher/status/997077222447112192','NULL','997077222447112192','Imogen ?','imiusher',1,0,0,0,'England, United Kingdom','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">I don&#39;t understand why people think that sleep is negotiable. I mean, yes, I have a sleeping disorder so when I was having problems in halls and with a roommate on my year abroad (I&#39;m honestly thankful roommates aren&#39;t a thing in the UK!) it was terrifying. But even if</p>&mdash; Imogen ? (@imiusher) <a href=\"https://twitter.com/imiusher/status/997077222447112192?ref_src=twsrc%5Etfw\">May 17, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-17 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(428,44,'https://twitter.com/stutts_aaron/status/997077125525057536','NULL','997077125525057536','aaron stutts','stutts_aaron',0,0,0,0,'Unknown','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Thats the hard part sleep disorder</p>&mdash; aaron stutts (@stutts_aaron) <a href=\"https://twitter.com/stutts_aaron/status/997077125525057536?ref_src=twsrc%5Etfw\">May 17, 2018</a></blockquote>\n<script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>\n','2018-05-17 00:00:00','2018-05-17 22:46:19','2018-05-17 22:46:19'),(429,44,'https://twitter.com/JayHtea/status/997076646434869249','NULL','997076646434869249','Jay Hefner','JayHtea',0,0,0,1,'Unknown','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Anything worse than the disorder of sleep deprivation ? Well, that’s me.</p>&mdash; Kolee.✨ (@KnycholeDeanna_) <a href=\"https://twitter.com/KnycholeDeanna_/status/99707579181611827